import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as v}from"./chunks/framework.B1z0IdBH.js";const D={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,c,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(D,[["render",x],["__scopeId","data-v-138130d4"]]),M=JSON.parse(`[{"page_url":"https://pt.wikipedia.org/wiki/Topless","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Femen_%286890664112%29.jpg","page_title":"Topless","context_page_description":"Topless é um termo originário da língua inglesa que significa sem o top, isto é, sem a peça de roupa que cobre o tronco. O termo designa uma situação em que uma mulher está nua da cintura para cima, com os seios à mostra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D0%BE-%D0%A7%D0%B5%D0%BF%D0%B5%D1%86%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/The_pontoon_bridge_across_the_river_Cheptsa.jpg","page_title":"Кирово-Чепецк","context_page_description":"Ки́рово-Чепе́цк — город в Кировской области России. Административный центр Кирово-Чепецкого района, в состав которого не входит. Образует городской округ город Кирово-Чепецк.\\nНаселение 69 835 чел.\\nОснован в 1935 году. Статус города с 1955 года. Расположен на востоке европейской части России, в центре Кировской области, при впадении реки Чепцы в Вятку, в 22 км к юго-востоку от города Кирова. Входит в Кировскую агломерацию."},{"page_url":"https://ms.wikipedia.org/wiki/2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Qasem_Soleimani_with_Zolfaghar_Order_%28cropped%29.jpg","page_title":"2020","context_page_description":"2020\\nadalah tahun semasa, dan adalah satu tahun lompat bermula pada hari Rabu pada takwim Gregorius, tahun ke-2020 penggunaan Common Era dan Tahun Masihi, tahun ke-20 untuk milenium ke-3, tahun ke-20 untuk abad ke-21, dan tahun pertama untuk dekad 2020-an."},{"page_url":"https://nl.wikipedia.org/wiki/Colin_Joyce","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Colin_Joyce_2016_TOA.jpg","page_title":"Colin Joyce","context_page_description":"Colin Joyce is een Amerikaans wielrenner die anno 2018 rijdt voor Rally Cycling."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_G%C3%BCsen%E2%80%93Jerichow","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Alte_Bahnlinie.jpg","page_title":"Bahnstrecke Güsen–Jerichow","context_page_description":"Die Bahnstrecke Güsen–Jerichow war eine eingleisige Nebenbahn im heutigen Landkreis Jerichower Land in Sachsen-Anhalt. Von Güsen aus wird ein kurzer Abschnitt der Strecke im Güterverkehr betrieben."},{"page_url":"https://de.wikipedia.org/wiki/Leonardo_Pulcini","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/FIA_GP3_Austria_2018_Nr._18_Pulcini_%281%29.jpg","page_title":"Leonardo Pulcini","context_page_description":"Leonardo Pulcini ist ein italienischer Automobilrennfahrer. Er gewann 2016 die Euroformula Open und nimmt seit 2017 an der GP3-Serie teil."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%A2%D1%83%D1%80%D0%BA%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/TM-2005-500manat-a.png","page_title":"Памятные монеты Туркмении","context_page_description":"Памятные и юбилейные монеты выпускаются Центральным банком Туркменистана из драгоценных металлов. Первая монета, посвящённая 54-летию Сапармурата Ниязова, была выпущена в 1994 году.\\nВ связи с отсутствием в стране собственного монетного двора, все монеты чеканятся за рубежом, на Королевском монетном дворе Великобритании."},{"page_url":"https://nl.wikipedia.org/wiki/Nunthorpe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Grey_Towers_-_geograph.org.uk_-_23299.jpg","page_title":"Nunthorpe","context_page_description":"Nunthorpe is een civil parish in het bestuurlijke gebied Middlesbrough, in het Engelse graafschap North Yorkshire met 4866 inwoners."},{"page_url":"https://ast.wikipedia.org/wiki/Campeonatu_Nacional_del_USAC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Foyt1977car.jpg","page_title":"Campeonatu Nacional del USAC","context_page_description":"El Campeonatu Nacional del USAC ye un tornéu d'automovilismu de velocidá que s'apostó principalmente n'Estaos Xuníos ente los años 1956 y 1984. Foi'l principal campeonatu de monoplazes de la rexón mientres gran parte de la so esistencia, cuntando coles 500 milles d'Indianapolis como eventu principal. Ente los sos pilotos más esitosos atópense A. J. Foyt, Mario Andretti, Al Unser, Bobby Unser, Gordon Johncock, Johnny Rutherford, Tom Sneva y Rodger Ward. El Campeonatu Nacional del USAC sustituyó al Campeonatu Nacional de la AAA, y foi movíu en 1980 pola serie CART."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%D9%81%D8%AA%E2%80%8C%D8%A7%DB%8C%D9%86%D8%AC%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Softengine%2C_ESC2014_Meet_%26_Greet_08.jpg","page_title":"سافت‌اینجین","context_page_description":"سافت‌اینجین گروه موسیقی فنلاندی است.\\nآن ها در یوروویژن ۲۰۱۴ نماینده فنلاند بودند."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D9%86%DB%8C%D9%84_%D8%A2%D9%85%D8%A7%D8%B1%D8%AA%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/20150331_Mali_vs_Ghana_119.jpg","page_title":"دنیل آمارتی","context_page_description":"دنیل آمارتی بیر فوتبالیست. لستر سیتی فوتبال کولوبو و غنا میلّی تیمی ترکیبینده چیخیش ائدیب و مودافع موقعیتینده اوْیناییب."},{"page_url":"https://es.wikipedia.org/wiki/Giarole","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Giarole-castello1.jpg","page_title":"Giarole","context_page_description":"Giarole es una localidad y comune italiana de la provincia de Alessandria, región de Piamonte, con 701 habitantes."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%91%A8%E5%8A%9F%E9%91%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/%E5%91%A8%E5%8A%9F%E9%91%AB.jpg","page_title":"周功鑫","context_page_description":"周功鑫，生於浙江，博物館學學者，輔仁大學法文系學士，法國巴黎第四大學藝術史與考古學博士，曾任國立故宮博物院院長秘書、展覽組組長達27年，並曾任教於政治大學、輔仁大學，於2002年在輔仁大學成立博物館學研究所並任所長至2008年。2008年5月20日接任中華民國國立故宮博物院院長，至2012年7月底歸建教職。"},{"page_url":"https://es.wikipedia.org/wiki/Saturnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Saturnia_pyri.jpg","page_title":"Saturnia","context_page_description":"Saturnia es un género de lepidópteros ditrisios de la familia Saturniidae. Son grandes mariposas, comúnmente llamadas pavones. Muchas son paleárticas, pero tres especies son del chaparral de California."},{"page_url":"https://es.wikipedia.org/wiki/Cuevas_(Junco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/06_Cuevas_Asturias_Horreo4_Lou.jpg","page_title":"Cuevas (Junco)","context_page_description":"Cuevas es un lugar de la parroquia asturiana de Junco que a su vez pertenece al concejo de Ribadesella.\\nEste lugar solo tiene dos accesos posibles, uno por carretera, la RS-3 que corresponde al túnel natural de La Cuevona y el otro por el FEVE que va de Oviedo a Santander y que tiene aquí un apeadero ferroviario con su edificio de estación y espera.\\nCuando se circula por La Cuevona aparece al otro lado el resto del valle y a pocos metros de la salida se encuentra el núcleo rural que constituye un buen ejemplo de asentamiento asturiano. ​\\nLo primero que se ve al entrar al pueblo es una ermita dedicada a Santiago. El caserío es de arquitectura tradicional aunque cuenta con otras casas más modernas construidas especialmente para estancias vacacionales. La base de la economía de los lugareños fue desde siempre agrícola destacando los sembrados de maíz, por lo que el edificio auxiliar, disociado a la vivienda, para estas tareas fueron los hórreos; cada familia poseía uno. Se conservan cinco en muy buen estado, incluso alguno en funcionamiento y los restos y paredones de otros. ​"},{"page_url":"https://en.wikipedia.org/wiki/Master_of_the_Osservanza_Triptych","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Maestro_dell%27osservanza%2C_sant%27antonio_abate%2C_1435_ca..JPG","page_title":"Master of the Osservanza Triptych","context_page_description":"The Master of the Osservanza Triptych, also known as the Osservanza Master and as the Master of Osservanza, is the name given to an Italian painter of the Sienese School active about 1430 to 1450.\\nThe Italian scholar Roberto Longhi recognized that two triptychs formerly attributed to Stefano di Giovanni were the work of another hand, now generally referred to as the Master of the Osservanza Triptych. The Virgin and Child with St. Jerome and St. Ambrose and the Birth of the Virgin are both stylistically similar to the work of Stefano di Giovanni, but have a narrative expression that is characteristic of Late Gothic painting.\\nLonghi observed that another group of paintings was closely related to these works and appeared to be by the same hand. These included the predella of the Osservanza Altarpiece, a predella of St. Bartholomew, Scenes of the Passion, the Resurrection, and Scenes from the Life of St. Anthony Abbot. Additionally, the full-length painting of St. Anthony Abbot in the Louvre appears to be from another altarpiece by the same master.\\nResearch in 2010 by Maria Falcone in Siena has revealed the name of the Master to be Sano di Pietro."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Oatman_(Arizona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Oatman_highway.jpg","page_title":"Oatman (Arizona)","context_page_description":"Oatman sī Bí-kok Arizona chiu Mohave kūn ê chi̍t ê chng-thâu.\\n30px Che sī chi̍t phiⁿ koan-î Bí-kok Arizona Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Pintac","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Map_commune_FR_insee_code_65364.png","page_title":"Pintac","context_page_description":"Pintac sī ūi-tī Hoat-kok Midi-Pyrénées toā-khu Hautes-Pyrénées koān ê chi̍t ê commune."},{"page_url":"https://pl.wikipedia.org/wiki/Idole_prillwickie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Piekosi%C5%84ski_-_Kamienie_mikorzy%C5%84skie_-_Tabl._II_A._Radegast_%28prz%C3%B3d%29.jpg","page_title":"Idole prillwickie","context_page_description":"Idole prillwickie, bałwanki przylwickie – nazwa grupy stu kilkudziesięciu figurek odkrytych rzekomo w II połowie XVIII wieku w Prillwitz nad jeziorem Tollensesee w Meklemburgii. Pierwsza informacja o ich odkryciu ukazała się w 1768 roku.\\nFigurki te miały rzekomo pochodzić z Radogoszczy i przedstawiać wyobrażenia bóstw słowiańskich, m.in. Radogosta. Wiele z nich opatrzonych jest napisami runicznymi, rzekomym pismem słowiańskim. Znaczna część figurek przedstawia postacie z lwimi głowami i bujnymi grzywami.\\n„Odnalezienie” idoli prillwickich stało się wielkim wydarzeniem w ówczesnej Europie i początkowo badacze powszechnie przyjęli ich autentyczność. Oszustwu dał się zwieść m.in. Jan Potocki, który w 1794 roku osobiście odwiedził miejsca ich rzekomego odkrycia, wykonał rysunki części z nich, a całą sprawę nagłośnił w wydanej w 1795 w Hamburgu relacji z podróży po Niemczech. O autentyczności znalezisk z Prillwitz było przekonanych wiele autorytetów naukowych ówczesnych czasów, takich jak Wawrzyniec Surowiecki, Joachim Lelewel i Wojciech Cybulski. Jako jeden z nielicznych krytyczne stanowisko zajął Feliks Bentkowski."},{"page_url":"https://en.wikipedia.org/wiki/Turkish_Kurdistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kurdistan_of_Turkey_%28CIA%29.png","page_title":"Turkish Kurdistan","context_page_description":"Turkish Kurdistan or Northern Kurdistan is the portion of Kurdistan under the jurisdiction of Turkey, located in the Eastern Anatolia and Southeastern Anatolia regions, where Kurds form the predominant ethnic group. The Kurdish Institute of Paris estimates that there are 20 million Kurds living in Turkey, the majority of them in the southeast.\\nSoutheastern Turkey is considered to be one of the four parts of Kurdistan, which also includes parts of northern Syria, northern Iraq and northwestern Iran.\\nThe term Turkish Kurdistan is often used in the context of Kurdish nationalism, which makes it a controversial term among proponents of Turkish nationalism. There is ambiguity about its geographical extent, and the term has different meaning depending on context. Scientific papers and news media frequently use the term."},{"page_url":"https://nl.wikipedia.org/wiki/Lunge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Airman_performing_lunge.jpg","page_title":"Lunge","context_page_description":"De lunge is een fitness-oefening die individueel en bij groepslessen gedaan wordt. De basis voor de oefening is een rechtopstaande positie met de voeten vlak bij elkaar. Het ene been stapt naar voren zodanig dat het onderbeen een hoek van 90 graden met de grond maakt. Het achterste been gaat dan naar beneden tot de knie de grond raakt. Dan stapt het voorste been terug zodat de aanvangspositie weer is bereikt waarna de oefening kan worden voortgezet."},{"page_url":"https://nl.wikipedia.org/wiki/Salindres","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Tourbecamel.jpg","page_title":"Salindres","context_page_description":"Salindres is een gemeente in het Franse departement Gard en telt 3055 inwoners. De plaats maakt deel uit van het arrondissement Alès."},{"page_url":"https://sv.wikipedia.org/wiki/Thaumetopoea_solitaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Thaumetopoea_solitaria.JPG","page_title":"Thaumetopoea solitaria","context_page_description":"Thaumetopoea solitaria är en fjärilsart som beskrevs av Freyer 1838. Thaumetopoea solitaria ingår i släktet Thaumetopoea och familjen tandspinnare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/William_Frederick_Poole","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/WilliamFPoole_BostonAthenaeum15.png","page_title":"William Frederick Poole","context_page_description":"William Frederick Poole was an American bibliographer and librarian."},{"page_url":"https://fi.wikipedia.org/wiki/Primorsko","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Primorsko_location_in_Bulgaria.png","page_title":"Primorsko","context_page_description":"Primorsko on kaupunki Bulgariassa. Vuonna 2011 kaupungissa asui noin 5 514 ihmistä. Kaupunki on suosittu matkakohde Mustanmeren rannalla. Primorsko sijaitsee 52 kilometrin päässä Burgasin kaupungista. Joet Ropotamo ja Djavolska laskevat mereen kaupungin lähistöllä.\\nPrimorskon alue on ollut asutettu jo pitkään. Itse kaupunki on perustettu 1879 nimellä Kjupria."},{"page_url":"https://fr.wikipedia.org/wiki/Jour_de_la_Constitution_(Norv%C3%A8ge)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Oslo-May-17th-2005.jpg","page_title":"Jour de la Constitution (Norvège)","context_page_description":"Le jour de la Constitution, plus couramment nommé syttende mai ou Nasjonaldagen en Norvège, est la fête nationale norvégienne.\\nElle est célébrée depuis 1814 le 17 mai, jour de l'adoption de la Constitution de Norvège. Ce jour-là, la Norvège acquit son indépendance par rapport au Danemark, et la Constitution fut signée. Les Norvégiens descendent dans la rue vêtus de costumes traditionnels. Ils font flotter les drapeaux et partagent des repas. Les enfants défilent devant le chateau du roi et de la reine."},{"page_url":"https://fi.wikipedia.org/wiki/Michael_Schumacher","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Michael_Schumacher_pole_lap_monaco_2012.JPG","page_title":"Michael Schumacher","context_page_description":"Michael Schumacher on saksalainen Formula 1 -kuljettaja. Schumacher on menestynein Formula 1 -ajaja kautta aikojen; hänellä on enemmän maailmanmestaruuksia, peräkkäisiä mestaruuksia, GP-voittoja, kilpailun nopeimpia kierroksia kuin kenelläkään muulla ajajalla. Hän on lisäksi lukuisten muiden Formula 1 -ennätysten haltija; hänellä onkin enemmän ennätyksiä kuin kellään muulla F1-kuljettajalla. Schumacher oli ensimmäinen saksalainen F1-maailmanmestaruuden voittanut kuljettaja.\\nF1-kuljettajat arvostivat vuonna 2009 Autosportin kyselyssä Schumacherin kaikkien aikojen toiseksi parhaaksi kuljettajaksi heti Ayrton Sennan jälkeen. Schumacherista käytetään laajalti lempinimeä ”Schumi”. Hänen nuorempi veljensä Ralf Schumacher kilpaili myös Formula 1 -luokassa vuosina 1997–2007.\\nSchumacher loukkaantui vakavasti lasketteluonnettomuudessa Méribelissä Ranskan alpeilla 29. joulukuuta 2013 ja vajosi koomaan. Kesäkuussa 2014 hänen perheensä ilmoitti, ettei hän enää ole koomassa. Häntä hoidetaan hänen kotiinsa rakennetussa sairaalassa Sveitsin Glandissa, missä häntä näkee vain kourallinen ihmisiä."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A1mara_frigor%C3%ADfica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Planta_frigor%C3%ADfica_1.JPG","page_title":"Cámara frigorífica","context_page_description":"Un frigorífico o cámara frigorífica es una instalación industrial estatal o privada en la cual se almacenan carnes o vegetales para su posterior comercialización.\\nEl producto agrícola es en su gran mayoría perecedero. Después de la cosecha sigue un proceso llamado comúnmente respiración durante el cual los azúcares se combinan con el oxígeno del aire produciendo anhídrido carbónico y agua y despidiendo calor, hasta llegar a la completa maduración del fruto. Al mismo tiempo, los microorganismos que están presentes en los frutos a temperatura ambiente, se alimentan y reproducen a un ritmo exponencial, a medida que se acerca la maduración, destruyendo los tejidos. Se comprobó que si se mantiene el producto cosechado a temperatura menor que la del ambiente, se consigue alargar el período de maduración un tiempo que varía desde 3-4 días hasta 6-8 meses, de acuerdo a la especie y a la variedad.\\nLa carne de animales después de sacrificados no siguen ningún proceso natural salvo el ataque de microorganismos que, a temperatura ambiente, atacan los tejidos. La carne deja de ser comestible en 2-3 días."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%A5%D6%80%D5%AD%D5%B8%D6%82%D5%AA%D5%B8%D6%82%D5%B4_%D4%BC%D5%A5%D5%B0%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/7TP-2.jpg","page_title":"Ներխուժում Լեհաստան","context_page_description":"Ներխուժում Լեհաստան, Լեհաստանում հայտնի որպես Սեպտեմբերյան արշավանք կամ 1939 թվականի Պաշտպանական պատերազմ և Գերմանիայում որպես Լեհական արշավանք կամ Վայսի նախագիծ, համատեղ ներխուժում Լեհաստան Նացիստական Գերմանիայի, ԽՍՀՄ-ի, Ազատ քաղաք Դանցիգի և Սլովակիայի փոքրիկ ջոկատի կողմից, որից սկիզբ առավ Երկրորդ համաշխարհային պատերազմը: Գերմանացիները ներխուժեցին Լեհաստան 1939 թվականի սեպտեմբերի 1-ին Մոլոտով-Ռիբենտրոպ պակտից մեկ շաբաթ անց, իսկ ԽՍՀՄ-ը ներխուժեց Լեհաստան սեպտեմբերի 17-ին, երբ ԽՍՀՄ-ը ավարտեց ռազմական գործողությունները Ճապոնիայի դեմ սեպտեմբերի 16-ին: Գործողությունը ավարտվեց հոկտեմբերի 6-ին Գերմանիայի և ԽՍՀՄ կողմից Լեհաստանի տարածքի բաժանմամբ\` համաձայն Խորհրդա-գերմանական սահմանագծային պայմանագրի:"},{"page_url":"https://pt.wikipedia.org/wiki/Syngnathus_watermeyeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Syngnathus_watermeyeri.png","page_title":"Syngnathus watermeyeri","context_page_description":"Syngnathus watermeyeri é uma espécie de peixe da família Syngnathidae.\\nÉ endémica da África do Sul."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Apfelsorten/E","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/The_Pomological_magazine_%28Pl._101%29_%288744817922%29.jpg","page_title":"Liste von Apfelsorten/E","context_page_description":"Erläuterungen und Quellen: Siehe Hauptartikel!"},{"page_url":"https://ceb.wikipedia.org/wiki/Hedysarum_cretaceum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/%D0%9A%D1%80%D0%B5%D0%B9%D0%B4%D1%8F%D0%BD%D1%96_%D0%B2%D1%96%D0%B4%D1%81%D0%BB%D0%BE%D0%BD%D0%B5%D0%BD%D0%BD%D1%8F_Hedysarum_cretaceum4.jpg","page_title":"Hedysarum cretaceum","context_page_description":"Espesye sa sitaw ang Hedysarum cretaceum. Una ning gihulagway ni Dc.. Ang Hedysarum cretaceum sakop sa kahenera nga Hedysarum sa kabanay nga Fabaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%87%86%E6%8F%90%E9%99%80%E7%BE%85%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bronze_Cundi-Avalokitesvara_mirror.jpg","page_title":"准提陀羅尼","context_page_description":"準提陀羅尼，又稱準提咒、準提神咒、準提真言，是佛教的重要咒語，禪門、淨土宗都有許多人持誦。此咒語代表準提菩薩的功德，為早、晚課的十小咒之一，許多寺院在用齋進餐時，也會先誦準提咒。\\n誦持此咒者，準提菩薩會在其頭上護持，使他所求遂意，以精進修習佛理。每日誠心推薦持誦108遍，49日不間斷，準提菩薩即令二眷屬跟隨庇護。傳統上認為，虔誠又具善心者，凡持誦準提神咒，無論在家、出家，茹素、食肉，一律可得福佑、如願，最後得到諸佛加持，成就佛果。"},{"page_url":"https://de.wikipedia.org/wiki/Wilhelmsm%C3%BChlenweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Wilhelmsm%C3%BChlenweg_Mahlsdorf_2012-02-16_AMA_fec.JPG","page_title":"Wilhelmsmühlenweg","context_page_description":"Der Wilhelmsmühlenweg ist eine Straße im Berliner Bezirk Marzahn-Hellersdorf von und verbindet die Ortsteile Mahlsdorf und Kaulsdorf."},{"page_url":"https://es.wikipedia.org/wiki/Sismonastia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Simonastias_2014-04-02_21-29.png","page_title":"Sismonastia","context_page_description":"Sismonastia: es una respuesta a estímulos mecánicos o eléctricos que implican movimiento foliar. Ha sido descrita en plantas insectívoras de hoja bilobulada o en mimosas."},{"page_url":"https://de.wikipedia.org/wiki/Austrian_Wine_Challenge_Vienna","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Festsaal_Rathaus_Vienna_2007.jpg","page_title":"Austrian Wine Challenge Vienna","context_page_description":"Die Austrian Wine Challenge Vienna ist einer der größten offiziell anerkannten Weinwettbewerbe der Welt.\\nIm Jahr 2019 wurde der internationale Weinwettbewerb zum 16. Mal in ununterbrochener Reihenfolge unter der Schirmherrschaft des Bundesministeriums für Nachhaltigkeit und Tourismus und Michael Ludwig und in Zusammenarbeit mit dem Bundesweinbauverband Österreichs, der Stadt Wien und dem Önologenverband ausgetragen. 2019 wurden etwa 13.000 Weine aus 42 Ländern zur Bewertung angestellt. Die Präsentation der Ergebnisse, die awc Gala Nacht des Weines findet im Wiener Rathaus statt.\\nAlle Weine werden an der Höheren Bundeslehranstalt und Bundesamt für Weinbau in Klosterneuburg in neutralen Einzelkabinen blindverkostet und nach dem internationalen 100-Punkte-Schema bewertet.\\nDie Besten der so bewerteten Weine erhalten die international wine trophies des Bewertungsjahres in vier Klassen:\\nbest white wine of the year – Weißwein des Jahres\\nbest red wine of the year – Rotwein des Jahres\\nbest sweet wine of the year – Süßwein des Jahres\\nbest sparkling wine of the year – Schaumwein des Jahres\\nWeitere Bewertungen sind Gold, Silver und seal of approval."},{"page_url":"https://simple.wikipedia.org/wiki/Ayaan_Hirsi_Ali","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Ayaan_Hirsi_Ali_by_Gage_Skidmore.jpg","page_title":"Ayaan Hirsi Ali","context_page_description":"Ayaan Hirsi Ali is a Dutch-American activist who was born in Somalia. She is known for being critical of female genital mutilation and Islam. She is the daughter of Somali politician Hirsi Magan Isse. In 2005 Hirsi Ali was in Time magazine's list of the 100 most influential people in the world. Hirsi Ali became an American citizen in 2013. She is married to British historian and public commentator Niall Ferguson."},{"page_url":"https://no.wikipedia.org/wiki/Suona","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/B-Suonas.JPG","page_title":"Suona","context_page_description":"Suona, eller laba, eller haidi er et kinesisk blåseinstrument med røtter i Sentral-Asia eller Persia. Det spilles med doble rørblad, har en konisk borring og har et klokkstykke av messing. Suona, som trolig kom til Kina allerede på 300-tallet. Det forekommer ofte i nordkinesisk forklore, ikke minst i provinsen Shandong. Det dukker opp på et maleri fra Silkeveien fra 400-tallet, men nevnes først i skriftlige kilder fra Mingdynastiet, er et svært gjennmtrengende instrument som egner seg godt for spill utendørs. Det er fremfor alt vanlig i blåseorkestre i Nord-Kina og benyttes gjerne ved for eksempel tradisjonelle kinesiske høytider, bryllup og begravelser."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%BC%8A%E5%8D%A1%E5%88%A9%E5%AF%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Ikaalisten_Kirkko.jpg","page_title":"伊卡利寧","context_page_description":"伊卡利寧是芬蘭的城鎮，位於該國西南部，距離坦佩雷約50公里，由皮爾卡區負責管轄，面積843.46平方公里，2012年人口7,378，其中約99%居民的母語是芬蘭語。"},{"page_url":"https://fr.wikipedia.org/wiki/Plaza_Miserere","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Avenida_Rivadavia_%28Samuel_Boote%2C_sf%29.jpg","page_title":"Plaza Miserere","context_page_description":"La Plaza Miserere est une des principales places de Buenos Aires, capitale de l'Argentine. Elle se trouve au cœur du quartier de Balvanera. Elle doit son nom à un vieil habitant appelé Antonio González Varela, surnommé \\"miserere\\" pour sa\\nmiséricorde et sa bonhommie. Mais dans la pratique on l'appelle bien plus fréquemment Plaza Once, car sur son flanc se trouve la gare Estación Once de septiembre du\\nChemin de fer Domingo Faustino Sarmiento."},{"page_url":"https://it.wikipedia.org/wiki/Simonetti_(famiglia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/The_Afternoon_Tea.jpg","page_title":"Simonetti (famiglia)","context_page_description":"La Famiglia Simonetti, romana, si mette in luce nel mondo dell'arte nell'Ottocento e si radica in profondità nel panorama culturale e artistico del suo tempo. La sua presenza si fa sentire a Roma anche in pieno Novecento. Per esporre la storia di questa famiglia, bisogna risalire, per ascendenza femminile, ai Raffaelli, noti a Roma fin dal Settecento come produttori di mosaici e di micro mosaici."},{"page_url":"https://de.wikipedia.org/wiki/Mildred-Scheel-Haus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Mildred-Scheel-Haus_Erweiterungsbau_Eingang.jpg","page_title":"Mildred-Scheel-Haus","context_page_description":"Der Erweiterungsbau des Mildred-Scheel-Hauses im Universitätsklinikum Carl Gustav Carus Dresden ist eine Station zur Behandlung krebskranker Kinder. Das Gebäude zählt zu den wenigen in Dresden, die im Stil der organischen Architektur errichtet wurden."},{"page_url":"https://de.wikipedia.org/wiki/Dieffenbachstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Stolperstein_Dieffenbachstr_45_%28Kreuzb%29_Anna_Kaufmann.jpg","page_title":"Dieffenbachstraße","context_page_description":"Die Dieffenbachstraße im Berliner Ortsteil Kreuzberg ist nach dem Chirurgen Johann Friedrich Dieffenbach benannt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%BC%D0%B5%D0%BA%D0%B2%D0%B8%D1%86_(%D0%A0%D0%B5%D0%BA%D0%BA%D0%B5%D0%BB%D1%8C%D0%B2%D0%B8%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Schmeckwitz_001.jpg","page_title":"Шмеквиц (Реккельвиц)","context_page_description":"Шме́квиц или Сме́чкецы — деревня в Верхней Лужице, Германия. Входит в состав коммуны Реккельвиц района Баутцен в земле Саксония. Подчиняется административному округу Дрезден."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B8%D1%82%D0%B8%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Chita_river.jpg","page_title":"Читинка","context_page_description":"Чити́нка — река в Забайкальском крае России, левый приток Ингоды."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Eles_Kerguelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Port-Gazelle_le_8_janvier_1893_retouched.jpg","page_title":"Îles Kerguelen","context_page_description":"Les îles Kerguelen ou archipel Kerguelen, à l'origine baptisées France australe et jadis surnommées « îles de la Désolation », forment un archipel français dans le sud de l'océan Indien. Elles constituent l'un des cinq districts des Terres australes et antarctiques françaises.\\nElles sont éloignées de plus de 3 250 kilomètres de La Réunion, terre habitée la plus proche. L'île principale, la Grande Terre, qui couvre plus de 90 % de la surface, est la troisième plus grande île française. C'est également la plus grande de toutes les îles subantarctiques.\\nCes îles, d'origine volcanique, au relief montagneux, culminent à 1 850 m, au mont Ross. Les côtes, très découpées, sont entaillées de fjords profonds. L'intérieur des terres est parsemé de nombreux lacs et étangs. La région occidentale est surmontée par la calotte glaciaire Cook qui s'étend sur 400 km².\\nIl y règne un climat froid mais non glacial, extrêmement venteux.\\nCes terres furent découvertes le 12 février 1772 par le navigateur breton Yves Joseph de Kerguelen de Trémarec. Elles sont restées, malgré quelques tentatives de colonisation, dépourvues d'habitants permanents."},{"page_url":"https://ga.wikipedia.org/wiki/David_Casa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/David_Casa%2C_EPP_Malta_Congress_2017_%3B_29_March.jpg","page_title":"David Casa","context_page_description":"Is polaiteoir Máltach é David Casa. Is Feisire Pharlaimint na hEorpa é. Tá sé ina bhall de Pártí Náisiúnta Mhálta."},{"page_url":"https://ceb.wikipedia.org/wiki/Trigonognathus_kabeyai","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Trigonognathus_kabeyai_head_1.jpg","page_title":"Trigonognathus kabeyai","context_page_description":"Espesye sa iho ang Trigonognathus kabeyai. Una ning gihulagway ni Kenji Mochizuki ug Ohe ni adtong 1990. Ang Trigonognathus kabeyai sakop sa kahenera nga Trigonognathus sa kabanay nga Etmopteridae. Giklaseklase sa IUCN ang espesye sa kapos sa datos. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC_%D0%91%D0%B0%D0%B0%D0%BB%D0%B0_%D0%B2_%D0%9F%D0%B0%D0%BB%D1%8C%D0%BC%D0%B8%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/The_Temple_of_Bel%2C_Syria_02AM2836.jpg","page_title":"Храм Баала в Пальмире","context_page_description":"Храм Баала в Пальмире — храм, посвящённый местному верховному богу Баалу, входил в состав комплекса руин древнего сирийского города Пальмиры, являлся главной святыней города. Храм представлял из себя своеобразный гибрид восточной и античной архитектур: планировка была выполнена в стиле храмов Ближнего Востока, а фасады — по образцу греческих и римских храмов. Построен в 32 году нашей эры.\\n30 августа 2015 боевики радикальной террористической группировки Исламское государство произвели взрыв на территории Храма, разрушив его центральное строение практически полностью."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E7%BE%8E%E5%85%B0%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Meishe_River_entering_Meishe_River_National_Wetland_Park_2019_01_-_01.jpg","page_title":"美兰区","context_page_description":"美蘭區是中國海南省海口市所轄的一個市轄區。前身為振東區，海口最老的城區大部分位於該區。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC_%D0%B8%D0%BA%D0%BE%D0%BD%D1%8B_%D0%91%D0%BE%D0%B6%D0%B8%D0%B5%D0%B9_%D0%9C%D0%B0%D1%82%D0%B5%D1%80%D0%B8_%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Staraya_Russa_asv2018-07_various30_SP_Monastery.jpg","page_title":"Храм иконы Божией Матери Старорусская","context_page_description":"Храм иконы Божией Матери Старорусская — православный храм в Старой Руссе."},{"page_url":"https://fr.wikipedia.org/wiki/Tranch%C3%A9e_(g%C3%A9nie_civil)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Railway_Cutting_at_the_summit_of_Talerddig_bank_-_geograph.org.uk_-_195516.jpg","page_title":"Tranchée (génie civil)","context_page_description":"En génie civil, une tranchée ou une coupe est l'endroit où une colline ou la montagne est découpée pour faire place à un canal, une route ou une voie ferrée.\\nUne construction basée sur le principe du déblai-remblai permet de garder un tracé droit et/ou à plat, tout en minimisant le coût. La coupe est réalisée par excavation ou en faisant exploser la roche. La coupe peut être réalisée depuis un côté de la pente ou directement par le milieu depuis le sommet de la colline. En général, une coupe est ouverte vers le haut. Une coupe est à l'opposé d'un remblai.\\nLorsqu'elle est utilisée dans les voies de transport, elle permet de réduire la pente du tracé.\\nLes tranchées peuvent être réalisées par de multiples passes d'une niveleuse, d’une décapeuse, d'une excavatrice, ou par explosion. Un moyen inhabituel pour créer une tranchée est de retirer le toit d'un tunnel. Les matériaux extraits des tranchées sont idéalement équilibrés par les matériaux nécessaires pour remblayer la même route, mais ce n'est pas toujours possible, lorsque le matériau de la tranchée est impropre à une utilisation comme matériau de remblai."},{"page_url":"https://nl.wikipedia.org/wiki/Spoorlijn_Homburg_-_Ludwigshafen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/DB_3280_railway_map.png","page_title":"Spoorlijn Homburg - Ludwigshafen","context_page_description":"De spoorlijn Homburg - Ludwigshafen onderdeel van de Pfälzische Ludwigsbahn is een Duitse spoorlijn in Saarland en Rijnland-Palts en is als spoorlijn 3280 onder beheer van DB Netze."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%B2%D0%BB%D0%B0%D0%B4%D0%B5%D1%82%D0%B5%D0%BB%D0%B8%D1%82%D0%B5_%D0%BD%D0%B0_%D0%91%D1%80%D0%B0%D0%BD%D0%B4%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Johann_Georg_Brandenburg_MATEO.jpg","page_title":"Списък на владетелите на Бранденбург","context_page_description":"Маркграфство Бранденбург е основано на 11 юни 1157 г., когато Албрехт Мечката поема управлението на дадената му през 1134 г. земя назаем, като побеждава на бойното поле славянския княз Якса от Кьопеник при крепостта Бранденбург на река Хафел.\\nПървоначално той се нарича маркграф на Бранденбург в свидетелствo от 3 октомври 1157 г. Затова 1157 г. се счита фактически за годината на основаването на марка Бранденбург.\\nМаркграфство Бранденбург съществува от 1157 до 1815 г."},{"page_url":"https://sk.wikipedia.org/wiki/Chr%C3%A1m_sv%C3%A4t%C3%A9ho_Alexandra_Nevsk%C3%A9ho_(Novosibirsk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Novosibirsk_ANevsky_Cathedral_07-2016_img1.jpg","page_title":"Chrám svätého Alexandra Nevského (Novosibirsk)","context_page_description":"Chrám svätého Alexandra Nevského je pravoslávny chrám v ruskom sibírskom meste Novosibirsk. Chrám bol pomenovaný na počesť slávneho ruského vojvodcu a svätca Alexandra Nevského z 13. storočia."},{"page_url":"https://de.wikipedia.org/wiki/Russische_Verhaulinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Abatis.jpg","page_title":"Russische Verhaulinie","context_page_description":"Die russische Verhaulinie bestand etwa vom 13. bis zum 18. Jahrhundert. Hierbei handelte es sich um ein aus speziellen Aufforstungen, Erdwällen und einem Ring aus Festungsstädten bestehendes System von Befestigungsanlagen, die an den südlichen und südöstlichen Grenzen des Moskauer Großfürstentums bzw. später des Russischen Zarentums errichtet worden waren. Hierdurch sollten die häufigen Angriffe der turktatarischen Steppennomaden effektiver abgewehrt werden."},{"page_url":"https://ca.wikipedia.org/wiki/Xinxa_puntejada","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Graphosoma_semipunctatum._Pentatomidae_-_Flickr_-_gailhampshire.jpg","page_title":"Xinxa puntejada","context_page_description":"La xinxa puntejada és un hemípter de la família dels pentatòmids que habita quasi exclusivament a la conca del Mediterrani.\\nEl cos de la xinxa puntejada pot arribar fins a 12 mm de longitud. El seu aspecte i la seua biologia són molt similars als de la xinxa ratllada és molt comú veure a les dues espècies juntes sobre les plantes de les quals s'alimenten.\\nLa coloració general varia entre tons de roig intens i ataronjats, sempre amb un seguit de línies amples longitudinals sobre el dors del cap i el escutel. A diferència de la xinxa ratllada el dors del pronot en lloc de donar continuïtat a les línies negres longitudinals, mostra dues línies transversals de punts negres. Els laterals de l'abdomen que sobreïxen de l'escutel són negres a la part més central i rojos a la vora. Les potes són ataronjades excepte els tarsos que són foscos. Ventralment la coloració de base és la mateixa que al dors però esquitxada de taques negres. La seua coloració aposemàtica adverteix als possibles depredadors que té un gust repugnant.\\nLes nimfes evolucionen en 5 estadis abans de convertir-se en imagos."},{"page_url":"https://en.wikipedia.org/wiki/2015_Ford_EcoBoost_400","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/TSM_-_Kyle_Busch_-_2015_-_Stierch_-_07.jpg","page_title":"2015 Ford EcoBoost 400","context_page_description":"The 2015 Ford EcoBoost 400 was a NASCAR Sprint Cup Series race held on November 22, 2015, at Homestead-Miami Speedway in Homestead, Florida. Contested over 267 laps on the 1.5 mile oval, it was the 36th and final race of the 2015 NASCAR Sprint Cup Series season. Kyle Busch won the race and the championship, his fifth of the season and first of his career. Kevin Harvick finished second. Brad Keselowski, Joey Logano and Kyle Larson rounded out the top-five. Jeff Gordon finished sixth in his 797th and final scheduled career start and Martin Truex, Jr. rounded out the Chase drivers in 14th.\\nDenny Hamlin won the pole for the race and led zero laps on his way to a 10th-place finish. Keselowski led a race high of 86 laps on his way to a third-place finish. The race had 18 lead changes among eight different drivers, as well as seven caution flag periods for 30 laps.\\nThis was the 34th victory for Busch, fifth of the season, first at Homestead-Miami Speedway and sixth at the track for Joe Gibbs Racing. It clinched his first career Sprint Cup Series championship."},{"page_url":"https://de.wikipedia.org/wiki/Touch_(Fernsehserie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Sa%C3%AFd_Taghmaoui_Cannes.jpg","page_title":"Touch (Fernsehserie)","context_page_description":"Touch ist eine US-amerikanische Mystery-Fernsehserie, die vom Heroes–Schöpfer Tim Kring entwickelt und von 20th Century Fox Television, einem Tochterunternehmen von 20th Century Fox, für den US-Sender Fox produziert wurde. Sie handelt von Martin Bohm, dessen autistischer Sohn Jake offenbar die Zukunft vorhersagen kann. Die Pilotfolge wurde am 25. Januar 2012 als Preview auf Fox ausgestrahlt. Die regelmäßige Ausstrahlung begann am 22. März 2012. Die deutschsprachige Erstausstrahlung der Pilotfolge erfolgte am 27. Februar 2012 beim deutschen frei empfangbaren Fernsehsender ProSieben, sowie beim österreichischen Sender ORF eins."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Bec-Hellouin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/%C3%89glise_Saint-Andr%C3%A9_le_Bec-Hellouin.jpg","page_title":"Le Bec-Hellouin","context_page_description":"Le Bec-Hellouin est une commune française située dans le département de l'Eure, en région Normandie. Nichée au cœur de la vallée du Bec, elle bénéficie du label des plus beaux villages de France.\\nLes habitants sont des Bexiens."},{"page_url":"https://pt.wikipedia.org/wiki/Curillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Colombia_-_Caquet%C3%A1_-_Curillo.svg","page_title":"Curillo","context_page_description":"Curillo é um município da Colômbia localizada no departamento de Caquetá."},{"page_url":"https://fr.wikipedia.org/wiki/Fenway_Kenmore_(Boston)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/NEU_Ell_Hall.jpg","page_title":"Fenway Kenmore (Boston)","context_page_description":"Fenway-Kenmore est un quartier de Boston, dans le Massachusetts, au nord-est des États-Unis. Bien qu'il soit considéré comme un quartier administratif, il est composé de nombreuses sections distinctes qui sont presque toujours qualifiés de Fenway, Kenmore Square ou Kenmore. En outre, le quartier de Fenway est divisé en deux sous-quartiers communément appelés East Fenway/Symphony et West Fenway.\\nFenway est nommé d'après le nom de artère principale aménagée par Frederick Law Olmsted, Fenway parkway. Lors du Recensement de 2010 la population du quartier s'élevait à 40 898 habitants pour une superficie définie à 3,2 km.\\nLe Fenway Park, Kenmore Square, l'université de Boston, le Berklee College of Music, l'Emmanuel College, l'université Northeastern, le Simmons College et le musée des beaux-arts de Boston s'y trouvent."},{"page_url":"https://lb.wikipedia.org/wiki/Auderghem_/_Oudergem","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Chateau_Sainte-Anne.JPG","page_title":"Auderghem / Oudergem","context_page_description":"Auderghem op Franséisch, Oudergem op Hollännesch, ass eng vun den 19 Gemenge vun der Haaptstadregioun Bréissel. An der Gemeng liewen 33.161 Awunner op 10,5 km².\\nAuderghem läit am Südoste vu Bréissel a grenzt un d'Bréisseler Gemenge Watermael-Boitsfort, Ixelles, Etterbeek a Woluwe-Saint-Pierre an un d'flämesch Gemengen Tervuren an Overijse. En Deel vun der Forêt de Soignes, dem grousse Bëschgebitt am Südoste vu Bréissel, läit an der Gemeng.\\nHistoresch huet sech Auderghem laanscht d'Strooss vu Bréissel op Namouer entwéckelt, mam Duerfkär ronderëm d'Kapell Sainte-Anne. Fréier Abteien, d'Rout Klouschter an d'Probstei vu Val Duchesse leien do. 1863 huet Gemeng sech vu Watermael-Boitsfort lassgesot a gouf eng eegestänneg Gemeng. Bis um Ufank vum 20. Joerhonnert war Auderghem eng ländlech Gemeng, déi virun allem vun Aktivitéite ronderëm de Bësch a vu Wäschereie gelieft huet.\\nVal Duchesse gehéiert der Donation royale, déi et dem belsche Staat verlount, a gëtt fir Regierungskonklaven oder -empfänk benotzt. An den 1950er Joren ass do eng diplomatesch Aarbechtsgrupp zesummekomm, déi d'Réimesch Traitéen ausgeschafft huet."},{"page_url":"https://en.wikipedia.org/wiki/China%E2%80%93Nepal_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/China_Nepal_Locator.png","page_title":"China–Nepal relations","context_page_description":"The bilateral relation between Nepal and China has been friendly and is defined by the Sino-Nepalese Treaty of Peace and Friendship signed on April 28, 1960 by the two countries. Though initially unenthusiastic, Nepal has been of late making efforts to increase trade and connectivity with China. Relations between Nepal and China got a boost when both countries solved all border disputes along the China–Nepal border by signing the Sino-Nepal boundary agreement on March 21, 1960 making Nepal the first neighboring country of China to agree to and ratify a border treaty with China. The government of both Nepal and China ratified the border agreement treaty on October 5, 1961. From 1975 onward, Nepal has maintained a policy of balancing the competing influence of China and Nepal's southern neighbor India, the only two neighbors of the Himalayan country after the accession of the Kingdom of Sikkim into India in 1975. In recent years, China has been making an effort to gain entry into SAARC, and, Nepal has continuously backed and supported the proposal to include China as a member in the regional grouping."},{"page_url":"https://en.wikipedia.org/wiki/Corn_tortilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Tortilla_machine.jpg","page_title":"Corn tortilla","context_page_description":"In North America, a corn tortilla or just tortilla is a type of thin, unleavened flatbread, made from hominy. In Mexico, there are three colors of maize dough for making tortillas: white maize, yellow maize and blue maize.\\nA similar bread from South America, called arepa, predates the arrival of Europeans to America, and was called tortilla by the Spanish from its resemblance to the traditional Spanish round, unleavened cakes and omelettes. The Aztecs and other Nahuatl-speakers call tortillas tlaxcalli; these have become the prototypical tortillas.\\nMaize kernels naturally occur in many colors, depending on the cultivar: from pale white, to yellow, to red and bluish purple. Likewise, corn meal and the tortillas made from it may be similarly colored. White and yellow tortillas are by far the most common, however."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%83%E4%B8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Panorama_Edam.JPG","page_title":"埃丹","context_page_description":"埃丹是荷蘭北荷蘭省埃丹-福倫丹的一個城鎮，位於該國西北部，鎮上的市政廳建於1737年，該鎮出產著名的埃德姆芝士，人口約7,380。公元十六世紀時，乳酪業是該鎮的主要經濟活動。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B0%BC%E6%9B%BC%E6%B2%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Nemunas.png","page_title":"尼曼河","context_page_description":"尼曼河發源於白俄羅斯的山區，流經白俄羅斯、立陶宛和俄羅斯，河長937公里，最後於克萊佩達注入波羅的海。\\n在俄語中，「德國人」為немец，即「日耳曼人」，因為在中世紀，德國人曾經占領過這個地區;在第二次世界大戰之前，尼曼河代表德語分布地區的東部界限，例如在德國國歌歌詞的第一段有這樣的一句話，描述當時德意志民族的領土：「... von der Maas bis an die Memel....」，但在第二次世界大戰後，生活在尼曼河地區的德國人被流放到奧德河—現在的德國東部邊界—以西。\\n尼曼河流經以下大城市：\\n格羅德諾\\n考納斯\\n蘇維埃茨克"},{"page_url":"https://en.wikipedia.org/wiki/Lyman_Wight","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Lyman_Wight_Home.jpg","page_title":"Lyman Wight","context_page_description":"Lyman Wight was an early leader in the Latter Day Saint movement. He was the leader of the Latter Day Saints in Daviess County, Missouri, in 1838. In 1841, he was ordained a member of the Quorum of the Twelve Apostles. After the death of Joseph Smith resulted in a succession crisis, Wight led his own break-off group of Latter Day Saints to Texas, where they created a settlement. While in Texas, Wight broke with the main body of the group led by Brigham Young. Wight was ordained president of his own church, but he later sided with the claims of William Smith, and eventually of Joseph Smith III. After his death, most of the \\"Wightites\\" joined with the Reorganized Church of Jesus Christ of Latter Day Saints."},{"page_url":"https://it.wikipedia.org/wiki/Melee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/BattleofSluys.jpeg","page_title":"Melee","context_page_description":"Melee, in lingua francese mêlée o pell-mell si riferisce ad un combattimento generalmente disorganizzato, un corpo a corpo, con scarso controllo centrale una volta iniziato."},{"page_url":"https://ceb.wikipedia.org/wiki/H%C3%BCttlingen_(lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Karte_Gemeinde_H%C3%BCttlingen_2011.png","page_title":"Hüttlingen (lungsod)","context_page_description":"Lungsod ang Hüttlingen sa Nasod nga Swiss. Nahimutang ni sa distrito sa Frauenfeld District ug kanton sa Kanton Thurgau, sa amihanan-sidlakang bahin sa nasod, 130 km sa amihanan-sidlakan sa Bern ang ulohan sa nasod. 414 metros ibabaw sa dagat kahaboga ang nahimutangan sa Hüttlingen, ug adunay 847 ka molupyo.\\nAng yuta palibot sa Hüttlingen kay kabungtoran sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang patag. Hüttlingen nahimutang sa usa ka walog nga mihatag og sa sidlakan-kasadpan nga direksyon. Ang kinahabogang dapit sa palibot dunay gihabogon nga 627 ka metro ug 1.0 km sa habagatan sa Hüttlingen. Dunay mga 149 ka tawo kada kilometro kwadrado sa palibot sa Hüttlingen medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Frauenfeld, 6.5 km sa kasadpan sa Hüttlingen. Hapit nalukop sa kaumahan ang palibot sa Hüttlingen.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Disyembre, sa -5 °C. Ang kasarangang pag-ulan 1,943 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 255 milimetro nga ulan, ug ang kinaugahan Marso, sa 72 milimetro."},{"page_url":"https://cs.wikipedia.org/wiki/Struna_h%C5%99betn%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/BranchiostomaLanceolatum_PioM.svg","page_title":"Struna hřbetní","context_page_description":"Struna hřbetní je společný znak strunatců. Vzniká z entodermu, tzv. chordomezodermu, a tvoří ji pružná chondroidní tkáň, která připomíná chrupavku. Během embryonálního vývoje se jedná o významné indukční centrum, jelikož stimuluje vývoj osových součástí zárodku."},{"page_url":"https://en.wikipedia.org/wiki/Hampton_Park_Terrace","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/39_Parkwood_Ave..JPG","page_title":"Hampton Park Terrace","context_page_description":"Hampton Park Terrace is the name both of a neighborhood and a National Register district located in peninsular Charleston, South Carolina. The neighborhood is bounded on the west by The Citadel, on the north by Hampton Park, on the east by Rutledge Ave., and on the south by Congress St. In addition, the one block of Parkwood Ave. south of Congress St. is considered, by some, to be included. The National Register district, on the other hand, is composed of the same area with two exceptions: the northeasternmost block is excluded and an extra block of President St. is included."},{"page_url":"https://de.wikipedia.org/wiki/Pegel_K%C3%B6ln","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Pegeluhr_und_Rheinufer_Koeln.jpg","page_title":"Pegel Köln","context_page_description":"Der Pegel Köln steht in der Kölner Altstadt-Nord am linken Rheinufer und misst den Wasserstand des Rheins am Stromkilometer 688. Er ist einer von 22 Pegeln am Rhein und neben dem Pegel Kaub der bedeutendste. Betrieben wird er vom Wasser- und Schifffahrtsamt Köln."},{"page_url":"https://sv.wikipedia.org/wiki/Arenicolidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Arenicole_coeurs.JPG","page_title":"Arenicolidae","context_page_description":"Arenicolidae är en familj av ringmaskar. Arenicolidae ingår i klassen havsborstmaskar, fylumet ringmaskar och riket djur. Enligt Catalogue of Life omfattar familjen Arenicolidae 24 arter.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%BB%8E%E6%98%8E%E6%96%B0%E6%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/%E5%9C%8B%E7%AB%8B%E5%85%AC%E5%85%B1%E8%B3%87%E8%A8%8A%E5%9C%96%E6%9B%B8%E9%A4%A8%E9%BB%8E%E6%98%8E%E5%88%86%E9%A4%A8.jpg","page_title":"黎明新村","context_page_description":"黎明新村是位于台中市南屯区的官方社区，是台湾省政府兴建的第三个大型省府新市镇，作为当时省府员工住宅及办公区。范围东至黎明路二段、南至公益路二段、西至龙富路五段、北靠近市政南一路，邻近七期重划区。学区为黎明国中与黎明国小。"},{"page_url":"https://id.wikipedia.org/wiki/Achariaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Gynocardia_odorata.jpg","page_title":"Achariaceae","context_page_description":"Achariaceae adalah salah satu suku anggota tumbuhan berbunga. Menurut Sistem klasifikasi APG II suku ini dimasukkan ke dalam bangsa Malpighiales, klad Eudikotil, Rosidae, euRosidae I.\\nTumbuhan penghasil bumbu masak khas Nusantara, kepayang termasuk ke dalam suku ini."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%85%D9%88%D8%A7%D9%82%D8%B9_%D8%A7%D9%84%D8%AA%D8%B1%D8%A7%D8%AB_%D8%A7%D9%84%D8%B9%D8%A7%D9%84%D9%85%D9%8A_%D9%81%D9%8A_%D8%A7%D9%84%D9%8A%D8%A7%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/National_museum_of_western_art05s3200.jpg","page_title":"قائمة مواقع التراث العالمي في اليابان","context_page_description":"هذه القائمة غير مكتملة، ويمكنك المساهمة في إثرائها بتعديلها أو الإضافة عليها.\\nقبلت اليابان اتفاقية اليونسكو الخاصة بمواقع التراث العالمي في 30 يونيو 1992. واعتبارا من يونيو عام 2013, أدرجت سبعة عشر موقع على قائمة التراث العالمي: ثلاثة عشر موقعا ثقافيا وأربعة مواقع للطبيعية. تم التقدم بطلب الإضافة لعشرة مواقع أخرى، وتمديد لموقع واحد وقد قدمت لنقش المستقبل وحاليا على قائمة أولية اعتبارا من عام 2013.\\nفي عام 2013، اقترح إضافة موقع كاماكورا للترشيح لدخول قائمة التراث العالمي. لكن لجنة التراث العالمي أوصت بعدم ادارج الموقع لأنه يفتقر إلى النزاهة والكمال، كما أن اليابان سحبت أصلا قد سحبت الموقع من الترشيح."},{"page_url":"https://en.wikipedia.org/wiki/Atlantic:_The_Wildest_Ocean_on_Earth","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/King_Penguins_at_Salisbury_Plain_%285719989826%29.jpg","page_title":"Atlantic: The Wildest Ocean on Earth","context_page_description":"Atlantic: The Wildest Ocean on Earth is a three-part BBC nature documentary series exploring the natural history of the Atlantic Ocean. It was first broadcast on BBC Two and BBC Two HD in the United Kingdom. A ten-minute making-of feature Atlantic Diaries airs at the end of each episode, taking the total running time to 60 minutes. In English speaking territories the show is narrated by Irish actor Cillian Murphy. The series will broadcast internationally on BBC Earth."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B0_%D0%BD%D0%B0_%D0%A1%D0%90%D0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Armory_Show_1.jpg","page_title":"Култура на САД","context_page_description":"Културата во САД потекнува од западната култура, која што има потекло или влијание од европската култура. Таа се развивала уште пред САД да стане земја со свои сопствени социјални и културни карактеристики како што се дијалектот, музиката, уметноста, социјалните навики, кујната и фолклорот. Денес, САД е етничко-расна развиена земја, како резултат на многуте имиграции во текот низ историјата.\\nВлијанијата започнуваат прво со доселувањето на Англичани и Ирци, коишто се основачи на колонијална Америка. Британската култура во спој колонијалните споеви на Британија го проширува англискиот јазик, легалниот систем и многу други наследства кои имаат формално влијание. Други многу битни влијанија доаѓаат од други земји од Западна Европа, особено од Германија, Франција и Италија.\\nОсобено главна улога во формирањето на културата во САД има иновацијата на Џеферсоновата демократија. Забелешките на Томас Џеферсон во ″Статијата за Државата Вирџинија″, можеби тие беа првите пресудни за секојдневниот и културниот живот на еден Американец како и прв поттик за прекинување на влијанија на европските консензуси кои Америка во своето потекло ги дегенерирала."},{"page_url":"https://cs.wikipedia.org/wiki/D%C3%BDchateln%C3%A1_kapalina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/AnimInolivent.gif","page_title":"Dýchatelná kapalina","context_page_description":"Dýchatelná kapalina je také známá jako okysličené perfluorokarbony. Jde o průzračnou a nereaktivní látku bez chuti a zápachu s nízkým povrchovým napětím. Jsou to molekuly tvořeny silnými vazbami uhlík-fluor, které mohou zvyšovat pevnost a stabilitu mezi dalšími vazbami. Jejich specifická struktura velmi dobře váže dýchatelné plyny – kyslík třikrát a oxid uhličitý dokonce čtyřikrát lépe než krev. Utvoří pak okysličenou látku, která je vhodná pro dýchání."},{"page_url":"https://zh.wikipedia.org/wiki/Redox","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Redox_running_Orbital.png","page_title":"Redox","context_page_description":"Redox是用Rust语言写就的类Unix微内核操作系统。Redox追求可用性、自由和安全性，目标是把Rust语言的创新带入到现代的微内核和整套的应用程序。"},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1988_der_Deutschen_Post_der_DDR","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Stamps_of_Germany_%28DDR%29_1988%2C_MiNr_3157.jpg","page_title":"Briefmarken-Jahrgang 1988 der Deutschen Post der DDR","context_page_description":"Der Briefmarken-Jahrgang 1988 der Deutschen Post der Deutschen Demokratischen Republik umfasste 50 einzelne Sondermarken, sieben Briefmarkenblocks mit neun Sondermarke und vier Kleinbogen mit neun Sondermarken. Acht Briefmarken wurden zusammenhängend gedruckt; dabei gab es vier Paare mit innenliegendem Zierfeld. Erstmals gab es ein Motiv mit einem farblich unterschiedlichen Zierfeld.\\nIn diesem Jahr wurden keine Dauermarken ausgegeben. Insgesamt erschienen 81 Motive.\\nAlle Briefmarken-Ausgaben seit 1964 sowie die 2-Mark-Werte der Dauermarkenserie Präsident Wilhelm Pieck und die bereits seit 1961 erschienene Dauermarkenserie Staatsratsvorsitzender Walter Ulbricht waren ursprünglich unbegrenzt frankaturgültig. Mit der Wiedervereinigung verloren alle Marken nach dem 2. Oktober 1990 ihre Gültigkeit."},{"page_url":"https://ro.wikipedia.org/wiki/Muzeul_Digital_din_Pecica","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Digital_Museum_-_O.jpg","page_title":"Muzeul Digital din Pecica","context_page_description":"Muzeul Digital din Pecica este centrul de vizitare al fermei de bivoli din Pecica din județul Arad, România. Ferma fusese realizată în cadrul proiectului FENNREHAB, iar centrul de vizitare — în cadrul proiectului ECOREHAB2, ambele realizate de municipalitatea locală în parteneriat cu orașul Mórahalom. Centrul a fost proiectat de către arhitectul Claudiu L. Ionescu, un tânăr arhitect aflat la acea vreme în perioada de stagiatură. Scopul clădirii este acela de a oferi spațiu ca centru de expoziții și de a găzdui facilități de prezentare prin mijloace electronice a specificului cultural și natural al regiunii.\\nProiectul a fost denumit în publicațiile de specialitate muzeu digital, iar Club Innovation & Culture France a afirmat că este „primul muzeu complet digital din lume”.\\nClădirea a fost ridicată în cinci luni și a costat 120.000 euro beneficiind de finanțare în proporție de 98% din fonduri din partea Uniunii Europene prin Fondul European de Dezvoltare Regională. A fost inaugurat la 29 octombrie 2013.\\nCu design neobișnuit, principala caracteristică o reprezintă combinația dintre ecologic și tehnologic."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%8D%B7%E8%B1%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Jaguar_X100_front_20080524.jpg","page_title":"捷豹","context_page_description":"捷豹汽车有限公司是英国的一家豪华汽车生产商，总部起初座落于英格兰考文垂的布朗兰，后迁至考文垂的惠特利。1922年成立之初制造摩托车的挂边车，名为Swallow Sidecar Company，简称SS汽车公司，后来改装汽车生产SS90与SS100车款，SS100有使用美洲豹Jaguar的副车名，但因纳粹党卫军的简称也是SS，所以1945年公司改名为Jaguar。\\n早在1935年的捷豹SS100就以匹敌之前宾利的名车但价格不足一半，以“穷人的宾利”自居而在竞争上占了优位，而宾利Speed Six便是第一款被厂家自封为超跑的产品，所以第一代超跑杀手就是捷豹ss 100了。而在1992-1994年间生产的XJ 220更是当时世界最快的量产型汽车，也是一般人公认英国第一款超级跑车。\\n二战后XK120等车在赛车场上的成功帮捷豹建立名声，1960年，捷豹收购戴姆勒汽车，并以此品牌作为XJ车系中最高阶的产品级距。1968年，英国政府发动整合英国汽车工业的计划，捷豹被并入英国汽车集团。这个汽车工业整合计划并不成功，礼兰汽车旗下的许多品牌经过多次改组仍未能挽回颓势；但是相对的，拥有自主研发能力与丰富造车经验的捷豹，却仍能以稳定的步伐成长，生产轿车XJ与跑车E-Type后继车车种XJS十分成功。1984年捷豹脱离礼兰汽车独立，但随后在取代XJ系列的XJ40车系改款业务中，当时的董事长伊根爵士坦承评估错误，使得新车叫好不叫座，因品质问题造成经营困扰。于是在全球性的车厂整并风潮中，于1989年由美国福特汽车以40.7亿美元并购，总算解危。\\n2008年3月26日福特汽车内部因经济情势不佳而改组旗下品牌，又以23亿美元把捷豹连同路虎售予印度塔塔汽车。\\n捷豹和Audi一样发展耐撞又轻量化的铝合金车身技术，新型XJ车款采用全铝合金车身，并如同飞机机身一样采用铆钉接合。"},{"page_url":"https://pl.wikipedia.org/wiki/Laura_Vandervoort","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Laura_Vandervoort_-_Outcast_Red_Carpet_-_9_July_2015.jpg","page_title":"Laura Vandervoort","context_page_description":"Laura Dianne Vandervoort – kanadyjska aktorka."},{"page_url":"https://en.wikipedia.org/wiki/Inigo_Jones","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Exterior_of_St._Paul%27s_Church%2C_Covent_Garden%2C_London.jpg","page_title":"Inigo Jones","context_page_description":"Inigo Jones was the first significant English architect in the early modern period, and the first to employ Vitruvian rules of proportion and symmetry in his buildings.\\nAs the most notable architect in England, Jones was the first person to introduce the classical architecture of Rome and the Italian Renaissance to Britain. He left his mark on London by his design of single buildings, such as the Queen's House which is the first building in England designed in a pure classical style, and the Banqueting House, Whitehall, as well as the layout for Covent Garden square which became a model for future developments in the West End. He made major contributions to stage design by his work as theatrical designer for several dozen masques, most by royal command and many in collaboration with Ben Jonson."},{"page_url":"https://de.wikipedia.org/wiki/NAMES_Project_AIDS_Memorial_Quilt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Aids_Quilt.jpg","page_title":"NAMES Project AIDS Memorial Quilt","context_page_description":"NAMES Project AIDS Memorial Quilt ist ein Quilt in den Vereinigten Staaten.\\nDer Aids Memorial Quilt erinnert an das Leben von Menschen, die an den Folgen von AIDS verstorben sind. Der Quilt wiegt rund 54 Tonnen und ist weltweit das größte Kunstwerk, das von einer Gemeinschaft im Bereich Handarbeiten hergestellt wurde.\\nDer Quilt wurde von der Organisation The Names Project Foundation 1987 in San Francisco gestartet. Zu jener Zeit erhielten einige an den Folgen von AIDS verstorbenen Menschen keine angemessenen Beerdigungsfeiern aufgrund sozialer Ausgrenzung durch überlebende Familienangehörige. Oftmals hatten Freunde von Verstorbenen nur die Möglichkeit, über das Projekt Aids Memorial Quilt an die geliebten Verstorbenen zu erinnern. Letztmals 1996 wurde der Quilt in seiner vollen Größe auf der National Mall in Washington, D.C. ausgebreitet.\\nDer Sitz der Organisation The Names Project Foundation befindet sich in Atlanta, Georgia. Die Organisation verfügt über 21 Unterorganisationen in den Vereinigten Staaten und über mehr als 40 verbundene Organisationen weltweit. Der Quilt wird in Atlanta aufbewahrt, wenn er nicht zeitweise anderenorts ausgestellt wird."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%AA%E3%83%BC%E3%82%BC876c","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Gliese876Orbits.svg","page_title":"グリーゼ876c","context_page_description":"グリーゼ876cは赤色矮星グリーゼ876の周囲を30.258日かけて公転している太陽系外惑星である。2001年4月に、グリーゼ876の軌道を公転する2つ目の惑星として発見された。"},{"page_url":"https://no.wikipedia.org/wiki/Samuel_Borgfeldt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/445._Kristiania._Norums_Pensionat_Bygd%C3%B6_Alle_53_-_no-nb_digifoto_20131127_00044_bldsa_PK00172.jpg","page_title":"Samuel Borgfeldt","context_page_description":"Samuel Borgfeldt var en svensk-norsk byggmester, murmester og arkitekt."},{"page_url":"https://fr.wikipedia.org/wiki/William_Byrd_(compositeur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/William_Byrd.jpg","page_title":"William Byrd (compositeur)","context_page_description":"William Byrd est un compositeur et organiste anglais de la Renaissance."},{"page_url":"https://en.wikipedia.org/wiki/Montacute_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Montacute_House_East_Front_-_geograph.org.uk_-_851610.jpg","page_title":"Montacute House","context_page_description":"Montacute House is a late Elizabethan mansion with garden in Montacute, South Somerset.\\nAn example of English architecture during a period that was moving from the medieval Gothic to the Renaissance Classical, and one of few prodigy houses to survive almost unchanged from the Elizabethan era, the house has been designated by English Heritage as a Grade I listed building, and Scheduled Ancient Monument. It was visited by 125,442 people in 2013. Designed by an unknown architect, possibly the mason William Arnold, the three-storey mansion, constructed of the local Ham Hill stone, was built in about 1598 by Sir Edward Phelips, Master of the Rolls and the prosecutor during the trial of the Gunpowder Plotters.\\nSir Edward Phelips' descendants occupied the house until the early 20th century. For a brief period the house was let to tenants, one of whom was Lord Curzon, who lived at the house with his mistress, the novelist Elinor Glyn. In 1927, it was acquired by the National Trust.\\nThe house is maintained by the National Trust."},{"page_url":"https://pt.wikipedia.org/wiki/Jean_Verdier","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Cardinal_Verdier.jpg","page_title":"Jean Verdier","context_page_description":"Jean Verdier, PSS foi um cardeal francês da Igreja Católica Romana. Ele serviu como arcebispo de Paris de 1929 até sua morte, e foi elevado ao cardinalato em 1929."},{"page_url":"https://es.wikipedia.org/wiki/Carlotta_Zambelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/%D0%97%D0%B0%D0%BC%D0%B1%D0%B5%D0%BB%D0%BB%D0%B8_%D0%9A.jpg","page_title":"Carlotta Zambelli","context_page_description":"Carlotta Zambelli fue una bailarina de ballet italiana.\\nIngresó en 1894 al Ballet de la Ópera de París, del que se retiró en 1930. Fue la primera en entrar a la Legion d'Honneur por danza. Fue parte del Ballet de la Ópera de París.\\nDatos: Q2939526\\nMultimedia: Carlotta Zambelli"},{"page_url":"https://en.wikipedia.org/wiki/The_Drunken_Couple","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Het_dronken_paar_Rijksmuseum_SK-C-232.jpeg","page_title":"The Drunken Couple","context_page_description":"The Drunken Couple is a c.1655-1665 oil on oak panel painting by Jan Steen, now in the Rijksmuseum in Amsterdam. Adriaan van der Hoop left it and the rest of his collection to the city of Amsterdam in 1854. It was initially assigned to the Museum van der Hoop before being moved to its present home on 30 June 1885.\\nThe canvas depicts a drunken couple so inebriated that they are completely unaware of the intruders skulking in the background. The theme is reinforced by the print of an owl above their heads; in 17th century the owl was a metaphor for being stupid and blind, reputedly not able to see in the daytime."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D8%AC%D9%8A%D9%84_%D8%A8%D8%A7%D8%B1%D8%A8%D9%8A%D9%8A%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Universidad_Cat%C3%B3lica_-_Rosario_Central_20190313_17.jpg","page_title":"ميجيل باربييرى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميجيل باربييرى لاعب كورة قدم من ارجنتين."},{"page_url":"https://de.wikipedia.org/wiki/Global_Organic_Textile_Standard","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Global_Organic_Textile_Standard_logo.svg","page_title":"Global Organic Textile Standard","context_page_description":"Der Global Organic Textile Standard ist ein weltweit angewendeter Standard für die Verarbeitung von Textilien aus biologisch erzeugten Naturfasern und damit ein wichtiges Textilsiegel. Er definiert umwelttechnische Anforderungen entlang der gesamten textilen Produktionskette, sowie Sozialkriterien. Die Qualitätssicherung erfolgt durch unabhängige Zertifizierung der gesamten Textillieferkette."},{"page_url":"https://sv.wikipedia.org/wiki/Gulgr%C3%A5_l%C3%B6vm%C3%A4tare","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/%281689%29_Mullein_Wave_%28Scopula_marginepunctata%29_-_Flickr_-_Bennyboymothman.jpg","page_title":"Gulgrå lövmätare","context_page_description":"Gulgrå lövmätare är en fjärilsart som beskrevs av Johann August Ephraim Goeze, 1781. Gulgrå lövmätare ingår i släktet Scopula och familjen mätare, Geometridae. Enligt den svenska rödlistan är arten akut hotad, i Sverige. Arten förekommer sällsynt i Skåne. Artens livsmiljö är kustnära områden. Två underarter finns listade i Catalogue of Life, Scopula marginepunctata argillacea och Scopula marginepunctata terrigena båda beskrivna av Louis Beethoven Prout 1913 resp. 1935."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%AA%E3%83%BC%E3%82%B6%E3%83%99%E3%83%88%E3%83%BB%E3%83%95%E3%82%A9%E3%83%B3%E3%83%BB%E3%83%99%E3%83%BC%E3%83%A1%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Alzbeta.jpg","page_title":"エリーザベト・フォン・ベーメン","context_page_description":"エリーザベト・フォン・ベーメンまたはエリーザベト・フォン・ルクセンブルクは、神聖ローマ皇帝兼ボヘミア王カール4世と3番目の妃アンナ・シフィドニツカの娘。父方の祖母エリシュカ・プシェミスロヴナにちなんで名付けられた。同母弟にローマ王兼ボヘミア王ヴェンツェル、異母弟にローマ皇帝兼ボヘミア王兼ハンガリー王ジギスムントがいる。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_basilicas_in_Germany","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/D%C3%BCsseldorf-Kaiserswerth%3B_St._Suitbertus_a.JPG","page_title":"List of basilicas in Germany","context_page_description":"This is an incomplete list of basilicas of the Roman Catholic Church in Germany. A basilica is a church with certain privileges conferred on it by the Pope. Currently there are some 76 basilicas in Germany."},{"page_url":"https://id.wikipedia.org/wiki/Stasiun_Wolonghu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Wolonghu_Station.jpg","page_title":"Stasiun Wolonghu","context_page_description":"Stasiun Wolonghu adalah sebuah stasiun di Jalur S7 dari Nanjing Metro. Stasiun tersebut mulai beroperasi bersama dengan stasiun lainnya dari jalur tersebut pada 26 Mei 2018."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%82%D1%83-%D0%93%D1%80%D0%BE%D1%81%D1%83-%D0%B4%D1%83-%D0%A1%D1%83%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Pantanal.jpg","page_title":"Мату-Гросу-ду-Сул","context_page_description":"Ма́ту-Гро́су-ду-Сул — штат на юго-западе Бразилии. Административный центр — город Кампу-Гранди.\\nСоседние бразильские штатами являются: Мату-Гросу, Гояс, Минас-Жерайс, Сан-Паулу и Парана. Кроме того, на западе Мату-Гросу-ду-Сул граничит с Парагваем и Боливией."},{"page_url":"https://ast.wikipedia.org/wiki/Central_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Carriage_Central_Park.jpg","page_title":"Central Park","context_page_description":"El Central Park ye un parque urbanu públicu asitiáu nel distritu metropolitanu de Manhattan, na ciudá de Nueva York, Estaos Xuníos. El parque tien forma rectangular y dimensiones averaes de 4000 x 800 m, siendo más grande que dos de les naciones más pequeñes del mundu; ye cuasi dos veces más grande que Mónacu y cuasi ocho veces más que la Ciudá del Vaticanu.\\nCon unos 37,5 millones de visitantes al añu, Central Park ye'l parque más visitáu de los Estaos Xuníos. Amás, la so apaición en numberoses películes y en programes de televisión, convertir n'unu de los parques urbanos más famosos del mundu. El parque ta dirixíu pola Central Park Conservancy, una empresa privada ensin ánimu d'arriquecimientu, que tien un contratu col Departamentu de Parques y Ociu de Nueva York.\\nCentral Park llenda pol norte cola 110th Street, pol oeste cola cai Central Park West, pol sur cola 59th Street y pol este cola Quinta Avenida. Los tramos d'estes cais que pasen alredor de Central Park son conocíes de normal col nome de Central Park North, Central Park South y Central Park West, respeutivamente; anque la Quinta Avenida caltién el so nome al so pasu pel llau este del parque."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D1%8B_%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D1%82%D0%B2%D0%B0_%D0%B2%D0%BD%D1%83%D1%82%D1%80%D0%B5%D0%BD%D0%BD%D0%B8%D1%85_%D0%B4%D0%B5%D0%BB_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/MVD_For_Achievements_in_Aviation.jpg","page_title":"Награды Министерства внутренних дел Российской Федерации","context_page_description":"Ведомственные знаки отличия Министерства внутренних дел Российской Федерации — ведомственные награды федерального органа исполнительной власти Российской Федерации — Министерства внутренних дел.\\nВедомственные знаки отличия Министерства внутренних дел Российской Федерации предназначены для награждения сотрудников органов внутренних дел Российской Федерации, федеральных государственных гражданских служащих, работников системы МВД России, а также лиц, оказавших содействие в выполнении задач и осуществлении полномочий, возложенных на МВД России.\\nВедомственными знаками отличия Министерства внутренних дел Российской Федерации являются ведомственные награды, которые подразделяются на медали МВД России и нагрудные знаки МВД России.\\nДействующее положение о ведомственных знаках отличия Министерства внутренних дел Российской Федерации утверждено приказом министра внутренних дел от 20 апреля 2017 года № 220."},{"page_url":"https://it.wikipedia.org/wiki/Campagna_d%27Italia_(1800)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Von_Melas.jpg","page_title":"Campagna d'Italia (1800)","context_page_description":"La campagna d'Italia del 1800 fu la serie di operazioni militari combattute nel 1800, durante la guerra della seconda coalizione, in Italia settentrionale dopo la caduta nel 1799 delle repubbliche sorelle filo-francesi e il ritorno del generale Napoleone Bonaparte dall'Egitto. Il generale, divenuto Primo console dopo il colpo di Stato del 18 brumaio, organizzò e diresse un audace attraversamento delle Alpi per prendere alle spalle l'esercito austriaco che assediava le truppe francesi bloccate a Genova. Dopo la riuscita della manovra, Bonaparte avanzò nella Pianura padana e affrontò l'armata austriaca nella decisiva battaglia di Marengo che si concluse dopo alterne vicende con la vittoria dei francesi.\\nDopo la battaglia, gli austriaci abbandonarono la Lombardia, il Piemonte e la Liguria e firmarono un armistizio temporaneo, e il Primo console poté restaurare il predominio francese nella penisola; le operazioni militari peraltro ripresero in inverno in Italia e Germania e terminarono solo nel 1801 con il trattato di Lunéville."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D1%81_%D0%B3%D0%B5%D1%80%D0%BE%D0%B8_%D0%BE%D1%82_%D0%98%D0%B3%D1%80%D0%B0_%D0%BD%D0%B0_%D1%82%D1%80%D0%BE%D0%BD%D0%BE%D0%B2%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Rose_Leslie_%28March_2013%29_%28headshot%29.jpg","page_title":"Списък с герои от Игра на тронове","context_page_description":"Тази страница представлява списък с герои от американския сериал „Игра на тронове“, който е базиран върху поредицата „Песен за огън и лед“ на Джордж Р. Р. Мартин. Действието се развива на фиктивния континент Вестерос и представя войната за Железния трон, водена от група съперничещи си благороднически фамилии и техните поддръжници."},{"page_url":"https://en.wikipedia.org/wiki/Power_Station_(Taiwanese_band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Power_Station_Taiwan.jpg","page_title":"Power Station (Taiwanese band)","context_page_description":"Power Station is a Taiwanese rock duo, composed of Yu Chiu-hsin and Yen Chih-lin, both of the Paiwan tribe of Taiwan's Pingtung County. Their music is characterized by their energetic rock ballads, as well as their electrifying rock anthems. Their looks and long hair stand out from the mainstream Taiwan pop scene because of their resemblance to western heavy metal musicians. In 2001, Power Station released their first album on the Grand Music label, Walking Along Zhongxiao East Road Nine Times. The title track of that album won the Silver Award for Best Mandarin Song at the 24th RTHK Top Ten Golden Song Awards."},{"page_url":"https://en.wikipedia.org/wiki/Pablo_Iglesias_Turri%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Pablo_Iglesias_2012_-_La_Tuerka.jpg","page_title":"Pablo Iglesias Turrión","context_page_description":"Pablo Iglesias Turrión is a Spanish politician, serving as Second Deputy Prime Minister and as Minister of Social Rights and 2030 Agenda of the Government of Spain since January 2020. He has been the Secretary-General of Podemos since 2014.\\nBefore then, he was a lecturer in political science at the Complutense University of Madrid and TV host. He was elected to the European Parliament in the 2014 elections as the leading candidate of the newly created Podemos."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Franklin_County_(Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Congregational_Church%2C_East_Hawley_MA.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Franklin County (Massachusetts)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Franklin County in Massachusetts führt alle Bauwerke, National Historic Landmarks und historischen Stätten im Franklin County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%82%A3%E6%99%BA%E5%8F%82%E8%A9%A3%E6%9B%BC%E8%8D%BC%E7%BE%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Fudarakusanji02s1024.jpg","page_title":"那智参詣曼荼羅","context_page_description":"那智参詣曼荼羅は、熊野信仰の聖地である熊野那智山を描いた社寺参詣曼荼羅。"},{"page_url":"https://es.wikipedia.org/wiki/Uruguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/MemorialDesaparecidosVazFerreira.jpg","page_title":"Uruguay","context_page_description":"Uruguay, oficialmente República Oriental del Uruguay, es un país de América del Sur, situado en la parte oriental del Cono Sur. Limita al noreste con Brasil —estado de Río Grande del Sur—, al oeste y suroeste con Argentina —provincias de Entre Ríos, Corrientes, Buenos Aires y la Ciudad Autónoma de Buenos Aires— y tiene costas en el océano Atlántico por el sur. Abarca 176 215 km² y es el segundo país más pequeño de Sudamérica, después de Surinam.​ Según los datos del último censo del INE en 2011, la población de Uruguay es de 3 286 314 habitantes​, con lo que figura en la décima posición entre los países sudamericanos.\\nEs una república presidencialista subdividida en diecinueve departamentos y 112 municipios. La capital y ciudad más poblada del país es Montevideo, con 1,3 millones de habitantes, ​ y cuya área metropolitana ronda los 2 millones, lo que representa el 56,3 % del total nacional.​\\nEs miembro fundador de las Naciones Unidas, del Mercosur, de la OEA, de la UNASUR y del G77, y forma parte de otros organismos internacionales."},{"page_url":"https://fr.wikipedia.org/wiki/Jorma_J%C3%A4rvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Kulosaaren-yhteiskoulu.jpg","page_title":"Jorma Järvi","context_page_description":"Jorma Klaus Henrik Järvi est un architecte finlandais."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%81%D0%BA%D0%B8_%D0%B1%D1%80%D0%B5%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ulmus_pumila_leaves_and_buds.jpg","page_title":"Сибирски брест","context_page_description":"Сибирски брест научни назив добија од Линеа који га описује у „Spеcies plantarum” 1753. године. Врста има и низ синонима као: U. mandshurica Nakai, U. humilis Gmel., U. humilis Amman ex Steud., U. microphylla Pers., U. manshurica Nakai, U. sibirica hort. Шкотски ботаничар и вртни дизајнер Лоудон и Карл Ива́нович Максимо́вич руски ботаничар описују га као варијетет пољског бреста U. campestris var. parvifolia Loud. Ulmus campestris var. pumila Maxim. У оквиру врсте издвојено је неколико природних варијетета U. pumila var. arborea Litv., U. pumila var. pilosa Rehder, U. pumila var. genuina Skvort. и U. pumila var. microphylla Persoon."},{"page_url":"https://sv.wikipedia.org/wiki/Poljaner","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Slavic_peoples_6th_century_historical_map.jpg","page_title":"Poljaner","context_page_description":"Poljaner var en östslavisk folkstam som var bosatt i landområdena runt vad som idag är Kiev i nuvarande Ukraina. Poljanerna kom att spela en central roll vid grundandet av det kievryska riket under 800-900-talen. Enligt vissa kan man härleda namnet \\"ruser\\" från poljanerna och inte från de skandinaviska varjagerna. Hur som helst formade poljanerna starka band med varjager under 800- och 900-talen, och dessa båda folkgrupper kom så småningom att sammansmälta under benämningen rus eller \\"ruser\\".\\nPoljanerna kom under de tidiga århundradena i konflikt med sina grannfolk, oavsett ifall de var slaver eller helt och hållet icke-slaviska. Bland de förstnämnda finns grannarna drevljanerna i nordväst, vilka beskrivs som ett \\"vilt folk\\" men som trots allt hade avancerat till en betydande kulturell nivå, och senare kievryska härskare var ständigt i konflikt med dessa. Hos poljanerna framkom legenden om Kyj, Sjtjek och Choriv, tre bröder som enade folket och markerade sig gentemot grannfolken. Dessa tre bröder hade också en syster vid namn Lybed. Legenden om dessa tre bröder finns omnämnd i den berömda Nestorskrönikan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%88%D0%B8%D1%82%D0%BE%D0%B5_%D0%B4%D0%B2%D0%BE%D0%B8%D1%87%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Threaded_Binary_Tree.png","page_title":"Прошитое двоичное дерево","context_page_description":"Прошитое двоичное дерево — это вариант двоичного дерева, который позволяет производить быстрый обход — если дан указатель на узел в прошитом дереве, можно легко найти следующий по порядку узел."},{"page_url":"https://de.wikipedia.org/wiki/Kirche_von_Kr%C3%A4klingbo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Kraeklingbo-kyrka-Gotland-total1.jpg","page_title":"Kirche von Kräklingbo","context_page_description":"Die Kirche von Kräklingbo ist eine im 13. Jahrhundert eingeweihte Landkirche auf der schwedischen Insel Gotland. Sie gehört zur Kirchengemeinde Östergarn im Bistum Visby."},{"page_url":"https://eo.wikipedia.org/wiki/Pellegrino_Aretusi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/%27Nativity_with_the_Two_Midwives%27%2C_oil_on_canvas_painting_by_Pellegrino_Aretusi%2C_Estense_Gallery%2C_Modena%2C_Italy.jpg","page_title":"Pellegrino Aretusi","context_page_description":"Pellegrino Aretusi, konata ankaŭ kiel Pellegrini de Modena kaj kiel Pellegrino Munari, estis itala pentristo kiu naskiĝis en Modeno, Italujo. Lia eka instruado estis el sia patro Giovanni Munari. Ĉirkaŭ 1509, Pellegrino iris al Rome helpi Rafaelon ĉe Vatikano. Pellegrino estis poste komisiita por pentri freskojn en la preĝejojn Sant'Eustachio kaj Nostra Signora del Sacro Cuore, ambaŭ en Romo. Li estis murdita en la 20a de novembro 1523 fare de parencoj de junulo kiu estis murdita de lia filo."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%AE%D9%88%D9%84%DB%8C_%DA%95%DB%95%DA%AF%D8%A8%DB%8C%DB%8C_%D8%A6%DB%95%D9%85%D8%B1%DB%8C%DA%A9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/345park.jpg","page_title":"خولی ڕەگبیی ئەمریکی","context_page_description":"خولی ڕەگبی ئەمەریکی خولێکی وەرزشی پڕۆفیشناڵی ئەمەریکیە.\\nیەکێکی وەرزشی ڕەگبی لەساڵی ١٩٢٠ دامەزراوە، و هەروەها ژمارەیەکی پێوانەیی هەیە لە ئامادەبوونی هاندەرانی یاریەکە لەنێو یاریگا و یەکێکە لە بەناوبانگترین وەرزشەکانی ئەمەریکا.\\nدەروازەی وەرزش"},{"page_url":"https://fr.wikipedia.org/wiki/Orlick%C3%A9_Podh%C5%AF%C5%99%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Orlick%C3%A9_Podh%C5%AF%C5%99%C3%AD_flag.jpg","page_title":"Orlické Podhůří","context_page_description":"Orlické Podhůří est une commune du district d'Ústí nad Orlicí, dans la région de Pardubice, en Tchéquie. Sa population s'élevait à 685 habitants en 2017."},{"page_url":"https://es.wikipedia.org/wiki/Bardaisan","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Las_dos_grandes_colummnas_de_Edesa.Fotograf%C3%ADa_del_s._XIX_del_libro_Early_eastern_Christianity_de_F._Crawford_Burkitt_1904.jpg","page_title":"Bardaisan","context_page_description":"Bardaisan, también referido como Bardesano, Bardesan o Bardesanes, su nombre en griego, fue un escritor, poeta y filósofo asirio, del siglo II e.c., nacido en la antigua Edesa y reconocido como afín con las corrientes gnósticas del cristianismo primitivo de la escuela valentiniana.​​\\nAutor de numerosos himnos cristianos, Bardaisan ocupa un lugar destacado en la historia de la música litúrgica y ha sido considerado como el verdadero fundador de la poesía siriaca.​​"},{"page_url":"https://az.wikipedia.org/wiki/Ziqetvar_y%C3%BCr%C3%BC%C5%9F%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Nikola_Zrinski_crop.jpg","page_title":"Ziqetvar yürüşü","context_page_description":"Ziqetvar yürüşü - Osmanlının Macarıstana olan yürüşlərindən biri. Sultan Süleyman Qanuninin son səfəri. O, öldükdən sonra Sokullu Mehmed Paşa yürüşə başçılıq etdi. Yürüş 1566-cı ildə baş verib."},{"page_url":"https://cs.wikipedia.org/wiki/Jacqueline_de_Longwy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Jacqueline_de_Longwy.png","page_title":"Jacqueline de Longwy","context_page_description":"Jacqueline de Longwy, vévodkyně z Montpensier a Dauphine z Auvergne, byla francouzskou šlechtičnou a nevlastní neteří krále Františka I. Francouzského. Byla také první manželkou Ludvíka z Montpensier a matkou jeho šesti dětí. Šarlota Bourbonská, třetí manželka Viléma I. Oranžského byla její dcerou.\\nJako vysoce postavený člen rodiny Valois, se účastnila dvorních slavností a obřadů."},{"page_url":"https://es.wikipedia.org/wiki/Instituto_T%C3%A9cnico_Agron%C3%B3mico_Provincial_de_Albacete","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Panoramica_Dehesa_de_Los_Llanos_2.JPG","page_title":"Instituto Técnico Agronómico Provincial de Albacete","context_page_description":"El Instituto Técnico Agronómico Provincial de Albacete, también conocido por sus siglas ITAP, es una institución investigadora de alta tecnología en el ámbito agropecuario y agroalimentario situada en la ciudad española de Albacete. Fue creado el 6 de octubre de 1986 y depende de la Diputación Provincial de Albacete. Forma parte del Parque Científico y Tecnológico de Castilla-La Mancha.​\\nSu misión fundamental se centra básicamente en la transferencia de tecnología y la investigación aplicada en los sectores agrícola, ganadero y alimentario, ejerciendo de nexo de unión entre la ciencia y el campo.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A9%D7%A8_%D7%9E%D7%A4%D7%A2%D7%9C%D7%99_%D7%9E%D7%9C%D7%98_%D7%99%D7%A9%D7%A8%D7%90%D7%9C%D7%99%D7%99%D7%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Yagur_%E2%80%93_Nesher%2C_the_Green_Path_%E2%80%93_Mount_Carmel_073.JPG","page_title":"נשר מפעלי מלט ישראליים","context_page_description":"נשר מפעלי מלט ישראליים היא חברה ישראלית לייצור מלט וצמנט פורטלנד. נכון לשנת 2015 נשר היא החברה הגדולה ביותר בישראל המייצרת מלט, ומהווה מונופול מוכרז בענף.\\nהחברה נשלטת על ידי לן בלווטניק, דרך כלל תעשיות. בעבר החזיקה כלל תעשיות ב-75% מנשר ו-25% הנוספים הוחזק בידי התאגיד האירי CRH. בשנת 2015 נמכרו מניות החברה האירית לכלל, המחזיקה עתה את מלוא הון המניות של נשר."},{"page_url":"https://fr.wikipedia.org/wiki/Armure_japonaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Momonari_ni-mai_dou_gusoku.jpg","page_title":"Armure japonaise","context_page_description":"L’armure japonaise est un équipement traditionnel japonais destiné à la protection individuelle. Ce type d’armure était porté entre autres par les samouraïs et les daïmyos. Elle est constituée de plusieurs parties. L'assemblage des pièces de l'armure est conçu de manière à nuire le moins possible à la mobilité."},{"page_url":"https://en.wikipedia.org/wiki/Four_County_Career_Center","image_url":"https://upload.wikimedia.org/wikipedia/en/8/86/Four_County_Career_Center_School_Districts.png","page_title":"Four County Career Center","context_page_description":"Four County Career Center is a public vocational school located in Ridgeville Township, Henry County, Ohio, south of Archbold. The school derives its name from the fact that it primarily serves students from school districts in the four Ohio counties of Defiance, Fulton, Henry, and Williams."},{"page_url":"https://es.wikipedia.org/wiki/Teatro_europeo_en_la_Segunda_Guerra_Mundial","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Hitler_and_german-nazi_officers_staring_at_french_marechal_foch_statue_21_June_1940.png","page_title":"Teatro europeo en la Segunda Guerra Mundial","context_page_description":"Europa fue el principal teatro de operaciones de la Segunda Guerra Mundial.​ Fue abierto con la invasión de Polonia el 1 de septiembre de 1939 y cerrado con la rendición incondicional de Alemania ante el Reino Unido, los Estados Unidos, Francia y la Unión Soviética el 8 de mayo de 1945.\\nEl importante teatro de operaciones europeo incluyó tres frentes de operaciones:\\nMediterráneo: incluye las campañas en África del Norte, el mar Mediterráneo, los Balcanes, Italia y el sur de Francia.\\nOriental: incluye las campañas en Polonia, Bulgaria, Rumanía, Finlandia, Europa Central y la Unión Soviética.\\nOccidental: incluye las campañas en Francia, Bélgica, Luxemburgo, Países Bajos, Noruega, Dinamarca, el oeste de Alemania y las campañas aéreas sobre las islas Británicas y luego sobre Europa Occidental."},{"page_url":"https://nl.wikipedia.org/wiki/Arvert","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Map_commune_FR_insee_code_17021.png","page_title":"Arvert","context_page_description":"Arvert is een gemeente in het Franse departement Charente-Maritime en telt 2887 inwoners. De plaats maakt deel uit van het arrondissement Rochefort."},{"page_url":"https://no.wikipedia.org/wiki/Vettius","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Sepp-Surinaamsche_vlinders_-_pl_082_plate_Vettius_fantasos.jpg","page_title":"Vettius","context_page_description":"Vettius er en slekt av sommerfugler som tilhører familien smygere."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%A7%D8%B3_%D8%A8%DB%8C%D8%B1%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Wallace_Beery-publicity.JPG","page_title":"والاس بیری","context_page_description":"والاس فیتزجرالد بیری یک هنرپیشه اهل ایالات متحده آمریکا بود. وی بین سال‌های ۱۹۱۳ تا ۱۹۴۹ میلادی فعالیت می‌کرد."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Pristis_pristis_-_Georgia_Aquarium_Jan_2006.jpg","page_title":"エイ","context_page_description":"エイは板鰓亜綱に属する軟骨魚類のうち、鰓裂が体の下面に開くものの総称。\\n鰓裂が側面に開くサメとは区別される。約530種が知られている。世界中の海洋の暖海域から極域まで広く分布し、一部は淡水にも適応している。一般的に上下に扁平な体型で、細長い尾、5-6対の鰓を持ち、多くは卵胎生である。尾の棘に毒を持つ種類もいる。サメの一部の系統から底生生活に適応して進化した系統のひとつと考えられているが、トビエイのように二次的に遊泳生活に戻ったものもある。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%82%D0%BE%D0%BF%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%C2%AB%D0%9B%D1%83%D0%B7%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Lusitania_vast_hole.jpg","page_title":"Потопление «Лузитании»","context_page_description":"Потопление «Лузитании» — морская катастрофа Первой мировой войны, произошедшая 7 мая 1915 года в Кельтском море, в 19 км от берегов Ирландии. Пассажирский турбоход «Лузитания» был потоплен на седьмые сутки следования из Нью-Йорка в Ливерпуль в районе, где активно действовали германские подводные лодки. В 14:10 крупнейший океанский лайнер компании «Кунард Лайн» был торпедирован немецкой субмариной U-20.\\nСразу за первым взрывом раздался более разрушительный второй взрыв. Судебные комиссии в Великобритании и США пришли к выводу, что лайнер был атакован двумя торпедами. Командир U-20 Вальтер Швигер утверждал, что выпустил по «Лузитании» только одну торпеду. Существует множество версий, объясняющих происхождение второго взрыва, в частности, повреждение паровых котлов, взрыв угольной пыли, умышленный подрыв или самопроизвольная детонация нелегально перевозившихся в трюме боеприпасов. Однако военное командование Великобритании отрицает факт перевозки взрывчатых веществ на «Лузитании».\\nВ момент атаки «Лузитания» шла со скоростью 18 узлов."},{"page_url":"https://vi.wikipedia.org/wiki/Dunakeszi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/HUN_Dunakeszi_COA.jpg","page_title":"Dunakeszi","context_page_description":"Dunakeszi là một thành phố thuộc hạt Pest, Hungary. Thành phố này có diện tích 31,06 km², dân số năm 2010 là 38470 người, mật độ 1239 người/km²."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D9%86_%D9%88%D8%A7%D8%B1%D9%86%D8%B1_%D8%A8%D8%A7%D8%B1%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/BarberJohnWarnerPotsdam.jpg","page_title":"جون وارنر باربر","context_page_description":"جون وارنر باربر ‏ هو مؤرخ أمريكي، ولد في 2 فبراير 1798 في أيست ويندسور في الولايات المتحدة، وتوفي في 1 يونيو 1885 في نيو هيفن في الولايات المتحدة."},{"page_url":"https://de.wikipedia.org/wiki/Domsheide","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bremen-%28Marktplatz%29-Braun-Hogenberg.png","page_title":"Domsheide","context_page_description":"Die Domsheide ist ein Platz in Bremen, der zu den drei wichtigsten Verkehrsknotenpunkten des öffentlichen Verkehrsnetzes gehört. Fast alle Straßenbahnen und zwei wichtige Buslinien kreuzen den Platz.\\nEr liegt östlich neben dem Bremer Marktplatz und südlich vom Bremer Dom. Von ihm gehen die Ostertorstraße, Dechanatstraße, Balgebrückstraße und die Violenstraße ab. Der Schnoor und die Johanneskirche schließen im Süden an die Domsheide.\\nAnliegerbauten sind u. a. das Hauptpostamt 1, das Gerichtsgebäude, der Dombezirk mit der Glocke, das Börsennebengebäude und die Volksbank. Die Gestaltung der Domsheide ist relativ uneinheitlich, geprägt durch die Materialien Sandstein und dunklen roten Backstein, roten Klinker, gelben Klinker, Putz, Beton, Marmor und den hellroten Turm für die Straßenbahn."},{"page_url":"https://no.wikipedia.org/wiki/FLK_%C2%ABPolar_Chief%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Anglo_Norse_%28I%29.jpg","page_title":"FLK «Polar Chief»","context_page_description":"FLK «Polar Chief» var et flytende hvalkokeri. Hun ble bygget som passasjerskipet DS «Montcalm» i 1897, men ble i 1916 ombygget til tankskip og omdøpt DS «Crenella». I 1923 ble «Crenella» innkjøpt av Chr. Nielsen & Co og ombygget til hvalkokeri i Larvik. Hun ble omdøpt FLK «Rey Alfonso» og operertes av Larviks Hvalselskap. I 1925 ble hun sammen med fire hvalbåter overtatt av H. M. Wrangell & Co i Haugesund, før hun i 1927 ble solgt videre til Hans Borge i Tønsberg og omdøpt FLK «Anglo Norse» (I).\\nI 1927 ble Anglo-Norse Company Ltd innvilget en femårs-lisens for å operere med et flytende hvalkokeri ved Sør-Sandwichøyene. Selskapet ble administrert av Hans Borge, men det var britiske finansinstitusjoner som hadde aksjemajoriteten gjennom et holdingselskap. FLK «Anglo Norse» opererte i sesongen 1927/28 langs iskanten mellom Sør-Sandwichøyene og Sør-Orknøyene og oppnådde full last, 44 000 fat hvalolje, til tross for at kokeriet ikke var utstyrt med opphalingsslipp. Det ble fanget totalt 470 hval fra tre hvalbåter, som også våget seg inn i isen. Året etter ble fangsten enda større med 630 hval og 65 700 fat olje."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%82%96%E5%8D%A1%E7%89%B9%C2%B7%E9%98%BF%E9%BD%90%E5%85%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Shaukat_Aziz.jpg","page_title":"肖卡特·阿齐兹","context_page_description":"肖卡特·阿齐兹，巴基斯坦现任巴基斯坦总理财长。"},{"page_url":"https://fr.wikipedia.org/wiki/Fond_de_veau","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Beef_Steak_in_Black_Pepper_Sauce.jpg","page_title":"Fond de veau","context_page_description":"Le fond de veau est une préparation de base liquide, sans liaison, c'est-à-dire sans ajout d'ingrédients qui pourraient augmenter la consistance et l'homogénéité. Le fond de veau est obtenu après cuisson à l'eau pendant plusieurs heures, d'os ou de viandes de veau, de légumes, d'aromates, dont le jus est recueilli par filtration à l'issue de la cuisson. Le fond de veau est une préparation aromatique, mais il est non salée. Il sert à la confection de nombreuses sauces chaudes, et aussi pour mouiller un ragoût, un braisé ou pour déglacer."},{"page_url":"https://en.wikipedia.org/wiki/Cyclone_Erica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Erica_2003_track.png","page_title":"Cyclone Erica","context_page_description":"Severe Tropical Cyclone Erica of March 2003 was a powerful cyclone that severely affected New Caledonia and was considered the worst to affect the country since Cyclone Beti. The system was the eighth cyclone and the fifth severe tropical cyclone of the 2002-03 South Pacific cyclone season. Cyclone Erica developed from a monsoonal trough on 4 March just off of Queensland. Originally, the storm moved slowly towards the east and then north early in its existence. However, increasing wind shear caused the storm to be degenerated into a tropical low. After conditions once again became more favorable for development, the remnants regenerated into a tropical cyclone on 10 March. Steadily intensifying, Erica reached peak intensity on 13 March as a Category 5 equivalent on the Australian intensity scale.\\nOn the same day Erica paralleled the coast of New Caledonia before making landfall on the southern end of the island at L'Île-des-Pins. However, at the same time the cyclone also entered an area with strong wind shear and thus began to weaken. After passing the island, an extratropical transition begun, weakening the cyclone as it moved towards the southeast."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%82%B0%ED%83%80%ED%8E%98_%EA%B0%80%EB%8F%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Map_of_Santa_Fe_Trail-NPS.jpg","page_title":"산타페 가도","context_page_description":"산타페 가도는 19세기 미국 서부의 개척 루트 중 하나였다. 오리건 가도가 나라 북서부를 횡단하여 현재 오리건에 이르렀던 반면, 산타페 가도는 미주리주에서 뉴멕시코까지 남서부를 횡단하고 있었다."},{"page_url":"https://it.wikipedia.org/wiki/Remo_Jona","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Stolperstein_f%C3%BCr_Remo_Jona.JPG","page_title":"Remo Jona","context_page_description":"Remo Jona è stato un avvocato italiano di origine ebraica, superstite dell'Olocausto. Epurato dalla sua professione in seguito alle leggi razziali del 1938, fu arrestato, trasferito nel campo di concentramento di Fossoli e infine deportato ad Auschwitz insieme alla sua famiglia.\\nSuperata la selezione all'arrivo del convoglio, riuscì a sopravvivere fino alla liberazione del campo, a differenza di sua moglie e dei suoi due figli. Nel gennaio 2016 sono state posate delle pietre d'inciampo a ricordo suo e dei suoi famigliari, in via Filangieri 4 a Torino."},{"page_url":"https://pt.wikipedia.org/wiki/Arara_(Para%C3%ADba)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Mapa_rodoviario_Arara-pb.png","page_title":"Arara (Paraíba)","context_page_description":"Arara é um município brasileiro do estado da Paraíba.\\nLocaliza-se na Região Geográfica Intermediária de João Pessoa e na Região Geográfica Imediata de Guarabira. Em 2017, possuía uma população de 13.427 habitantes, em uma área territorial de 99 km². Sua principal via de acesso é pela rodovia PB-105, está distante 155 quilômetros de João Pessoa, a capital do estado.\\nA sede municipal tem uma temperatura média anual de 22,4 °C e a vegetação predominante é a caatinga, tendo remanescentes de mata atlântica na região leste do município, localizando-se, neste modo, numa área de transição. Cerca de 70% da população vive na zona urbana.\\nO município foi emancipado da cidade de Serraria e instalado em 1961. A origem de seu nome se deve pela grande quantidade de aves deste tipo que existiam antigamente no local.\\nTradicionalmente desde o ano de 1887, a cidade costuma realizar no mês de setembro a festa da padroeira do município, consta na programação a apresentação de bandas Filarmônica, pregações religiosas, desfiles cívicos e apresentações de bandas populares."},{"page_url":"https://el.wikipedia.org/wiki/%CE%86%CE%BB%CE%B9%CF%83%CE%BF%CE%BD_%CE%9C%CE%B1%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Allison_Mack_%282018_crop%29.jpg","page_title":"Άλισον Μακ","context_page_description":"Η Allison Christin Mack είναι Αμερικανίδα ηθοποιός, γνωστή για τον ρόλο της ως Chloe Sullivan στην σειρά του WB/CW Smallville και ως Amanda στην σειρά του FX Wilfred. Στις 20 Απριλίου 2018 συνελήφθη στο Μπρούκλυν από το FBI με τις κατηγορίες του sex trafficking και της επιβολής υποχρεωτικής εργασίας αναφορικά με τον ρόλο που είχε στον οργανισμό NXIVM. Η Mack κρίθηκε ένοχη απέναντι στις κατηγορίες τον Απρίλιο 2019 και αναμένει την καταδίκη της."},{"page_url":"https://it.wikipedia.org/wiki/Hunters_Point_Avenue","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Hunters_Point_Avenue_-_Flushing_bound_platform.jpg","page_title":"Hunters Point Avenue","context_page_description":"Hunters Point Avenue, in passato conosciuta con il nome di 49th Avenue, è una fermata della metropolitana di New York, situata sulla linea IRT Flushing. Nel 2015 è stata utilizzata da 1 848 769 passeggeri."},{"page_url":"https://sv.wikipedia.org/wiki/Argentinas_president","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Standard_of_the_President_of_Argentina_Afloat.svg","page_title":"Argentinas president","context_page_description":"Argentinas president, egentligen Argentinska nationens president, är både landets stats- och regeringschef.\\nArgentina gjorde sig fria från Spanien i sitt frihetskrig år 1810. Perioden därefter kännetecknades av olika juntor och anarki. Det var först 1826 som den förste presidenten, Bernardino Rivadavia, tillträdde för den då lösa konfederation som landet då var. År 1853 antogs den grundlag som skapade dagens presidentämbete. Argentina har en historia fylld med militärkupper som avsatt den valda presidenten: 1930 och åter 1943, 1955, 1962, 1966 och slutligen 1976.\\nPresidenten väljs i ett tvåvalssystem där de två kandidater som fått flest röster i den första valomgången går vidare till nästa valomgång. Valet kan även vinnas i den första valomgången om en kandidat får mer än 45% av rösterna, eller om en kandidat får 40% och har 10% fler röster än tvåan. Endast en infödd argentinsk medborgare är behörig att väljas till president. presidenten kan väljas för högst två mandatperioder i följd, men kan åter igen väljas till president efter att någon annan suttit under en mandatperiod.\\nCasa Rosada i Buenos Aires är presidentens officiella residens."},{"page_url":"https://en.wikipedia.org/wiki/Anthony_Nugent,_11th_Earl_of_Westmeath","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Antony_Francis_Nugent%2C_11th_Earl_of_Westmeath.jpg","page_title":"Anthony Nugent, 11th Earl of Westmeath","context_page_description":"Anthony Francis Nugent, 11th Earl of Westmeath, PC, styled Lord Delvin from 1879 to 1883, was an Irish peer. He was elected a Representative Peer in 1901. Lord Westmeath occupied properties at Pallas and Spring Garden, Tynagh, County Galway. He owned over 14,000 acres in County Galway in the 1870s as well as property in County Roscommon in the parish of Ogulla, barony of Roscommon.\\nEducated at Oratory School, South Kensington, and Christ Church, Oxford University. He served as an Honorary Attaché to Washington 1895–1897, and as Assistant Secretary to the Royal Commission to inquire into French Treaty Rights in Newfoundland in 1898. From 1898 to 1901 he was Assistant Private Secretary to the Secretary of State for the Colonies. He held the office of Deputy Lieutenant of County Galway, and was a Justice of the Peace.\\nLord Westmeath was appointed to the Privy Council of Ireland in the 1902 Coronation Honours list published on 26 June 1902, and was sworn in by the Lord Lieutenant of Ireland, Earl Cadogan, at Dublin Castle on 11 August 1902.\\nHe died without issue. All his titles devolved upon his youngest surviving brother, Gilbert Nugent."},{"page_url":"https://es.wikipedia.org/wiki/Lago_Kubenskoye","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Relief_Map_of_Vologda_Oblast.png","page_title":"Lago Kubenskoye","context_page_description":"El lago Kubenskoye o Kubenskoe​​​​ es un lago de origen glacial-tectónico que se encuentra en el norte de la Rusia europea.​\\nEl lago, grande y poco profundo, se situa en un entorno de tierras bajas del paisaje central del óblast de Vologda, en la frontera de los distritos de Vologda, Sokol y Ust-Kubinsky.​ Pertenece a la cuenca del Dvina Septentrional, siendo la fuente del río Sújona, que fluye en la esquina sureste del lago.​ Situado a una altitud de 110,1 metros sobre el nivel medio del mar, tiene una superficie de 417 km² y una longitud de 54 km."},{"page_url":"https://es.wikipedia.org/wiki/Watson_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Alaska_Highway_Through_Watson_Lake.jpg","page_title":"Watson Lake","context_page_description":"Watson Lake es un pueblo ubicado en la histórica milla 635 de la carretera de Alaska en el Yukón al sureste, cercana a la frontera con la provincia de Columbia Británica. Su población en el Censo de 2011 fue de 593 habitantes.​"},{"page_url":"https://pl.wikipedia.org/wiki/Towarzystwo_Przytu%C5%82ku_%C5%9Bw._Franciszka_Salezego_w_Warszawie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Sypialnia_w_przytu%C5%82ku_%C5%9Bw._Franciszka_Salezego_%2852668%29.jpg","page_title":"Towarzystwo Przytułku św. Franciszka Salezego w Warszawie","context_page_description":"Towarszystwo Przytułku św. Franciszka Salezego w Warszawie – świecka organizacja pożytku publicznego, której głównym celem statutowym jest „…pomoc społeczna w tym filantropijna na rzecz osób znajdujących się w trudnej sytuacji życiowej lub materialnej, w szczególności niesiona starcom obojga płci lub osobom niepełnosprawnym niezdolnym do pracy zarobkowej…”. Cel realizowany jest przez jednostkę podległą – Dom Pomocy Społecznej im. Franciszka Salezego w Warszawie, prowadzącą całodobową opiekę nad osobami somatycznie chorymi. W przyszłości planowane jest otwarcie dziennego domu opieki, udzielającego wszechstronnej pomocy osobom w wieku senioralnym. 23 lipca 1990 budynek i ogród Przytułku zostały wpisane do rejestru zabytków Warszawy pod nr 1442, 15 marca 2010 do rejestru pod numer 7/2010 wpisano Dom Pomocy Społecznej im. Franciszka Salezego."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D1%8A%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Trun-Bulgaria.jpg","page_title":"Трън","context_page_description":"Трън е град в Западна България. Той се намира в област Перник, разположен е близо до границата със Сърбия и до градовете Брезник и Драгоман. Градът е административен център на община Трън."},{"page_url":"https://de.wikipedia.org/wiki/M%C3%BCrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/M%C3%BCrowSchulhaus_05_14_01_jiw.jpg","page_title":"Mürow","context_page_description":"Mürow ist ein Ortsteil der Stadt Angermünde im Landkreis Uckermark im Nordosten des Landes Brandenburg. Mürow wurde am 26. Oktober 2003 eingemeindet, vorher war der Ort eine eigenständige Gemeinde."},{"page_url":"https://nl.wikipedia.org/wiki/Michael_Jackson","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Michael_Jackson_in_1988.jpg","page_title":"Michael Jackson","context_page_description":"Michael Joseph Jackson, bekend als The King of Pop, was een Amerikaans zanger, danser en componist. Hij geldt als een van de meest succesvolle artiesten van de 20e eeuw. Jackson onderscheidde zich door zijn herkenbare stem en zijn typische dansbewegingen.\\nJackson stond al op zeer jeugdige leeftijd als lid van The Jackson 5 op het podium en startte als tiener een solocarrière. In het begin van de jaren 80 was hij internationaal een van de grootste popsterren. Hij bereikte zijn grootste succes met het album Thriller, dat met 65 miljoen verkochte exemplaren geldt als het bestverkochte album aller tijden. Jackson heeft wereldwijd tussen 300 en 400 miljoen albums en singles verkocht.\\nJackson versterkte zijn muziek en imago met opvallende videoclips, waarin zijn ritmische dansstijl duidelijk tot uitdrukking komt. Een van de bekendste videoclips, die van \\"Thriller\\", duurt veertien minuten. De clip voor zijn single Scream\\", een duet met zijn zus Janet Jackson, kostte zeven miljoen dollar. Deze clip houdt sinds 1995 het record voor duurste muziekvideo."},{"page_url":"https://pt.wikipedia.org/wiki/Nossa_Senhora_da_Candel%C3%A1ria_(Ilhas_Can%C3%A1rias)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/La_Virgen_de_Candelaria%2C_en_Tenerife%2C_Patrona_de_las_Islas_Canarias%2C_Espa%C3%B1a.JPG","page_title":"Nossa Senhora da Candelária (Ilhas Canárias)","context_page_description":"Nossa Senhora da Candelária é uma das designações atribuídas à Virgem Maria. É a padroeira das Ilhas Canárias, venerada na Igreja Católica. Imagem fica na Basílica e Real Santuário Mariano de Nossa Senhora da Candelária na cidade de Candelaria, em Tenerife."},{"page_url":"https://fr.wikipedia.org/wiki/Fodil_El_Ouartilani","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Fudayl_el_wartilani.jpg","page_title":"Fodil El Ouartilani","context_page_description":"Fodil El Ouartilani ; de son vrai noms Ibrahim Ben Mustapha El-Djazaïri est né le 18 février 1906 à Beni Ourtilane en Algérie et décédé le 12 mars 1959 à Istanbul en Turquie, était un militant panarabe, penseur et militant anti-colonialiste algérien proche des Frères musulmans.\\nBrillant orateur et homme de culture, il a été membre de l'Association des oulémas algériens, il était également le conseiller générale de sa majesté le Yahya Muhammad Hamid ed-Din et a joué un rôle central dans la révolution yéménite de 1948."},{"page_url":"https://ceb.wikipedia.org/wiki/Comuna_Giarmata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Turnul_pompierilor_Giarmata.JPG","page_title":"Comuna Giarmata","context_page_description":"Munisipyo ang Comuna Giarmata sa Romaniya. Nahimutang ni sa lalawigan sa Județul Timiș, sa kasadpang bahin sa nasod, 400 km sa kasadpan sa Bucharest ang ulohan sa nasod.\\nMga lungsod sa Comuna Giarmata:\\nGiarmata\\nAng klima hemiboreal. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 992 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 130 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 47 milimetro."},{"page_url":"https://es.wikipedia.org/wiki/Burstcoin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Burstcoin_first_smart_contract.jpg","page_title":"Burstcoin","context_page_description":"Burstcoin es una criptomoneda digital y sistema de pago de la tecnología blockchain. Burstcoin fue introducida en el foro de bitcointalk.org el 10 de agosto de 2014 como una moneda basada en NXT. Las Burstcoin se extraen usando un algoritmo llamado Prueba de Capacidad ​ en el cual los mineros usan memoria informática en vez del más común y costoso método de permanentes y complejos cálculos computacionales.\\nEl requerimiento energético para minar Burstcoin es mínimo comparado a otras criptomonedas, haciendo a Burstcoin una de las de más bajo consumo en el campo de las criptomonedas que usan PoC.​ La plataforma de cadena de bloques NXT permite flexibilidad en el desarrollo, asegurando a promotores la libertad de crear sus propias aplicaciones. En este sentido, Burstcoin puede ser considerado como un proyecto de aplicación criptográfica de próxima generación a diferencia de la primera generación de criptomonedas como Bitcoin.​"},{"page_url":"https://es.wikipedia.org/wiki/T%C5%99inec","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Coat_of_arms_of_T%C5%99inec.svg","page_title":"Třinec","context_page_description":"Třinec es una ciudad de la República Checa en el distrito de Frýdek-Místek de la región de Moravia-Silesia.\\nEn 2017 tiene 35 596 habitantes.​\\nSe conoce su existencia desde 1444 y adquirió estatus urbano en 1931. Es un importante centro para la industria siderúrgica y uno de los principales núcleos culturales de los polacos de la República Checa.\\nSe ubica en la frontera con Polonia, unos 20 km al este de Frýdek-Místek y justo al sur de la conurbación internacional formada por Cieszyn y Český Těšín.​"},{"page_url":"https://nn.wikipedia.org/wiki/Seljord_kommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Seljord_lake.JPG","page_title":"Seljord kommune","context_page_description":"Seljord kommune er ein kommune i Telemark-området i Vestfold og Telemark fylke. Kommunen ligg sentralt i fylket og grensar i aust til Bø og Notodden, i nord til Tinn og Hjartdal, i vest til Tokke og Vinje, og i sør til Kviteseid.\\nKommunegrensene har vore endra to gonger, fyrst i 1873 då eit mindre område vart ført over frå Kviteseid, seinare i 1883 då eit mindre område vart ført over til Bø.\\nAdministrasjonssenteret i Seljord kommune er tettstaden Seljord. Lokalavisa er Vest-Telemark Blad, som kjem ut tre gonger i veka."},{"page_url":"https://no.wikipedia.org/wiki/Innvielseskors","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Reinli_stavkirke%2C_signingskors.jpg","page_title":"Innvielseskors","context_page_description":"Innvielseskors, signingskors eller konsekrasjonskors er tolv korsfigurer som plasseres på veggene i en katolsk kirke under vigslingen av bygget. Antallet symboliserer apostlene.\\nUnder kirkevigslingen blir korsene salvet med krisma og incensert. Det skal tradisjonelt være et lys under hvert kors, men i mange nyere kirker er dette utelatt.\\nI Norge er det bare to kirker fra middelalderen hvor alle de tolv korsene er bevart på sine opprinnelige steder, nemlig Reinli stavkirke hvor de er malt på veggen med tjære og Fiskerkapellet fra Fåberg fra 1459, nå på Maihaugen på Lillehammer, der korsene er skåret inn i tømmerveggene.\\nI enkelte ikke-katolske kirker settes det også opp innvielseskors, men uten at det er noe formelt krav om at det skal være slike, og uten noen spesiell liturgi omkring dem."},{"page_url":"https://pl.wikipedia.org/wiki/Kazimierz_II_Sprawiedliwy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Wislica_slab_of_orants_detail.png","page_title":"Kazimierz II Sprawiedliwy","context_page_description":"Kazimierz II Sprawiedliwy – książę wiślicki w latach 1166–1173, książę sandomierski od 1173, od 1177 książę zwierzchni Polski, od 1186 książę mazowiecki i kujawski. Syn Bolesława III Krzywoustego z rodu Piastów. Przydomek Sprawiedliwy nie był mu współczesny, pojawił się w XVI wieku."},{"page_url":"https://cs.wikipedia.org/wiki/Carlos_Menem","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Menem_con_banda_presidencial.jpg","page_title":"Carlos Menem","context_page_description":"Carlos Saúl Menem je argentinský politik syrsko-arménského původu. V letech 1989–1999 byl prezidentem Argentiny. Původní profesí je právník. Ve třech volebních obdobích byl guvernérem rodné provincie La Rioja. Je představitelem perónistické Justicialistické strany."},{"page_url":"https://pl.wikipedia.org/wiki/Fonologia_i_fonetyka_j%C4%99zyka_angielskiego","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ping_poong.png","page_title":"Fonologia i fonetyka języka angielskiego","context_page_description":"Fonologia i fonetyka języka angielskiego – zjawiska fonetyczne i fonologiczne zachodzące we współczesnym języku angielskim. Język ten jest bogaty w samogłoski oraz dysponuje porównywalną z innymi językami indoeuropejskimi liczbą spółgłosek. Większość samogłosek ma charakter swoisty dla angielszczyzny, w przypadku niektórych trudno znaleźć ich dokładne odpowiedniki w innych językach. Bardziej przystępny dla cudzoziemców jest system spółgłoskowy, choć istnieją również spółgłoski realizowane w nieco odmienny sposób.\\nSystem dźwiękowy języka angielskiego składa się z samogłosek i spółgłosek. Choć angielski alfabet składa się z 26 liter, w mowie używa się co najmniej 44 dźwięków: samogłosek, spółgłosek i dyftongów.\\nAngielskie samogłoski i spółgłoski rzadko występują w izolacji, a najczęściej znajdują się pod wpływem otaczających je dźwięków. Dochodzi do zjawisk związanych z łączeniem międzywyrazowym takich jak asymilacja, osłabianie formy, ubezdźwięcznienie samogłosek, nazalizacja i inne. Choć są to głównie zjawiska czysto fonetyczne, niektóre mogą być fonemiczne, to znaczy produkować nowe fonemy.\\nJęzyk angielski jest bogaty w rozwiązania prozodyczne."},{"page_url":"https://sh.wikipedia.org/wiki/Helga_y_Flora","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Helgayflorac13.png","page_title":"Helga y Flora","context_page_description":"Helga y Flora je čileanska TV-serija koja se originalno prikazuje na programu mreže Canal 13 od 2020. godine. Radnja se događa u Čileu 1930-ih, a naslovne protagonistice, koje tumače Catalina Saavedra i Amelia Kassai, su Helga Gampert i Flora Gutiérrez, prve žene koje su se priključile čileanskoj financijskoj policiji, i koje pretpostavljeni šalju u čileansku Patagoniju kako bi istraživale slučajeve od koje nekih imaju i špijunsku dimenziju."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%88%D8%B1%D8%A8%D9%8A%D8%B1%D8%AA%D9%88_%D8%A8%D9%88%D9%8A%D9%8A%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Norberto_Boggio_%28San_Lorenzo%29_-_El_Gr%C3%A1fico_1987.jpg","page_title":"نوربيرتو بوييو","context_page_description":"نوربيرتو بوييو ‏ هو لاعب كرة قدم. يلعب مع منتخب الأرجنتين لكرة القدم. سبق له أن لعب في كأس العالم لكرة القدم مع منتخب بلاده."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_Amaz%C3%B3nica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Bandera_de_Cascales.png","page_title":"Región Amazónica","context_page_description":"La región Amazónica de Ecuador es una región natural del país sudamericano conformada por un área aproximada de 120.000 km² de la Amazonia. Comprende las provincias de Sucumbíos, Orellana, Napo, Pastaza, Morona Santiago y Zamora. Se extiende sobre un área de exuberante vegetación, propia de los bosques húmedo-tropicales, representa el 43% del territorio ecuatoriano. Sus límites están marcados por la Cordillera de los Andes en la parte occidental de esta región, mientras que Perú y Colombia en el límite meridional y oriental, respectivamente."},{"page_url":"https://ceb.wikipedia.org/wiki/Scrophularia_scopolii","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Scrophularia_scopolii_1.jpg","page_title":"Scrophularia scopolii","context_page_description":"Espesye sa tanom nga bulak ang Scrophularia scopolii. Ang Scrophularia scopolii sakop sa kahenera nga Scrophularia sa kabanay nga Scrophulariaceae."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_Josaphat","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Schaerbeek_Parc_Josaphat_902.jpg","page_title":"Parc Josaphat","context_page_description":"Le parc Josaphat est un parc schaerbeekois de 20 ha à Bruxelles aménagé par le paysagiste Edmond Galoppin en 1904. Il pourrait se décliner au pluriel, en ce sens qu'il s'est constitué en plusieurs étapes et recèle des richesses fort différentes : stade, minigolf, serres communales, grande pelouse de jeu et de tir à l'arc, parc paysager à l'anglaise vallonné et bordé d'essences variées comportant un chapelet d'étangs, une laiterie, un petit zoo et de nombreuses sculptures agrémentent le parc."},{"page_url":"https://sk.wikipedia.org/wiki/Vrtu%C4%BEn%C3%ADkov%C3%A1_z%C3%A1chrann%C3%A1_zdravotn%C3%A1_slu%C5%BEba","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Agusta_A109K2_Slovensko_%288%29.jpg","page_title":"Vrtuľníková záchranná zdravotná služba","context_page_description":"Vrtuľníková záchranná zdravotná služba je súčasťou integrovaného záchranného systému na Slovensku. V súčasnosti prevádzkuje 7 základní, ktoré rovnomerne pokrývajú celé územie krajiny."},{"page_url":"https://ca.wikipedia.org/wiki/Bon%C3%ADtol_ratllat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Katsuwonus_pelamis.png","page_title":"Bonítol ratllat","context_page_description":"El bonítol de ventre ratllat o bonítol ratllat és una espècie de peix de la família dels escòmbrids i de l'ordre dels perciformes."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Farley,_Staffordshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Flag_tower_at_Alton_Towers_%28geograph_3366433%29.jpg","page_title":"Listed buildings in Farley, Staffordshire","context_page_description":"Farley is a civil parish in the district of Staffordshire Moorlands, Staffordshire, England. It contains 54 listed buildings that are recorded in the National Heritage List for England. Of these, five are at Grade II*, the middle of the three grades, and the others are at Grade II, the lowest grade. The most impressive building in the parish is the country house of Alton Towers. This, together with its surrounding gardens, were developed for the Earls of Shrewsbury in the early 19th century. The house and associated structures, and many items in the gardens are listed. Outside the grounds of the house, the parish contains the village of Farley and the surrounding countryside. The listed buildings here are mainly houses, cottages, and associated structures, farmhouses and farm buildings. The other listed buildings include structures in the former Alton Towers railway station, and two mileposts."},{"page_url":"https://es.wikipedia.org/wiki/Adhemarius","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Adhemarius_palmeri_MHNT_dos_male.jpg","page_title":"Adhemarius","context_page_description":"Adhemarius es un género de lepidópteros ditrisios perteneciente a la familia Sphingidae."},{"page_url":"https://ja.wikipedia.org/wiki/%E2%97%8B%E2%97%8B%E3%81%AE%E3%81%AF%E3%81%AA%E3%81%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/OO_no_hanashi47.jpg","page_title":"○○のはなし","context_page_description":"○○のはなしは、西日本旅客鉄道が新下関駅 - 東萩駅間を、山陽本線・山陰本線経由で運行する観光列車である。\\n本項では、前身であるみすゞ潮彩をはじめ山陰本線山口県内を主な運行区間とした臨時観光列車についても記述する。"},{"page_url":"https://de.wikipedia.org/wiki/Renault_Dauphine","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Renault_Dauphine_Interior_1.jpg","page_title":"Renault Dauphine","context_page_description":"Die Renault Dauphine ist ein von 1956 bis 1968 gebautes Pkw-Modell des französischen Herstellers Renault. Das Fahrzeug mit wassergekühltem Vierzylinder-Reihenmotor und Heckantrieb hatte eine typische Pontonkarosserie. Wie schon der Vorläufer 4CV war die Dauphine nur als viertürige Limousine erhältlich.\\nDer Name Dauphine bedeutet „Thronfolgerin“ und zielte damit auf die Verkaufserfolge des Renault 4CV in Europa ab. Die Dauphine erfreute sich großer Beliebtheit vor allem auch in Deutschland, wo jedoch die beiden Zweitürer VW Käfer und Opel Kadett auf den vordersten Rängen blieben."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D8%B3%D8%AA%D9%88%D9%86_%D8%AF%D8%A7%D9%84%D9%85%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Gast%C3%B3n_Dalmau_2011-08-21.jpg","page_title":"جاستون دالماو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجاستون دالماو مغنى من ارجنتين."},{"page_url":"https://pl.wikipedia.org/wiki/Port_lotniczy_S%C3%A3o_Tom%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Sao_Tome_Airport_1_%2815627228594%29.jpg","page_title":"Port lotniczy São Tomé","context_page_description":"Port lotniczy São Tomé - międzynarodowy port lotniczy w São Tomé, stolicy Wysp Świętego Tomasza i Książęcej. Został otwarty w 1992. Jest to największe lotnisko tego kraju."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%84%E5%A4%A7%E4%BB%99%E7%A5%A0_(%E5%B9%BF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/WongDaiSinZi.jpg","page_title":"黄大仙祠 (广州)","context_page_description":"廣州黃大仙祠，位於廣州市荔灣區芳村古祠路，始建於公元1899年，為香港黃大仙祠的原祠所在，為供奉黃大仙的道教宮觀。該祠分為主殿、側殿以及後面的庵堂等建築。"},{"page_url":"https://en.wikipedia.org/wiki/Rietbrock,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Sign_for_the_Western_Hemisphere%27s_45X90_point.jpg","page_title":"Rietbrock, Wisconsin","context_page_description":"Rietbrock is a town in Marathon County, Wisconsin, United States. It is part of the Wausau, WI Metropolitan Statistical Area. The population was 981 at the 2010 census. The unincorporated communities of Poniatowski and Schnappsville are located within the town."},{"page_url":"https://da.wikipedia.org/wiki/Gullaschbaron","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Berliner-Nielsen_opk%C3%B8ber_kv%C3%A6g_til_Tyskland_%28DH013867%29.jpg","page_title":"Gullaschbaron","context_page_description":"En gullaschbaron er en spekulant, der under 1. verdenskrig tjente store penge på at levere madvarer til fronten, især gullasch på konservesdåser, hvis indhold var af tvivlsom kvalitet. Det dækker også over personer, der på kort tid tjente store formuer på handel og værdipapirer under krigen.\\nBegrebet ’gullaschbaroner’ blev opfundet under 1. verdenskrig. De, der blev kaldt for gullaschbaroner, blev meget rige under krigen - de fleste på aktier. Men navnet opstod, da mange tjente deres penge på at sælge mad til fronten – heraf en stor del gullasch. Nogle af producenterne var ligeglade med, om der kom sener, knogler eller brusk med i maden. Så tjente de jo på det. Nogle af producenterne var også ligeglade med, om det var for gammelt kød, der var i maden – eller sågar rottekød. Man kunne alligevel ikke se det, da gullasch jo er kød i sovs.\\nVarerne blev primært solgt til Tysklands soldater selv om der var mistanke om, at kødet var fordærvet, spiste de det alligevel, for ellers ville de slet ikke få noget.\\nGullasch var efterspurgt, netop fordi det både indeholder proteiner fra kødet og vitaminer fra de grøntsager, der er i retten."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E4%B8%AD%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/A-F_%E5%AE%8C%E6%88%90%E7%89%88_%E5%8A%A0%E4%BA%AE.jpg","page_title":"臺中市","context_page_description":"台中市，通称台中，简称“中”，是中华民国的直辖市，台湾六都之一，是中台湾唯一的直辖市。周边与台湾省的六个县相邻，北邻苗栗县、新竹县，南邻彰化县、南投县，东隔中央山脉与花莲县相邻，东北以中央山脉和雪山山脉毗邻宜兰县，西临台湾海峡。台中市面积2,215平方公里，设籍人口约282万人，为台湾人口排名第二大城市，也是台湾第二大都会区“台中都会区”的核心都市，并常与彰化县、南投县合称“中彰投地区”。市内的清泉岗基地为全台最大的空军基地。台中都会区在世界人口普查组织里为世界排名第132大都会区。\\n“台中”意即“台湾之中央”，名称始于日治时期。在清代以前，台中便开始出现聚落，但不若鹿港一带繁荣，台湾建省后，并因南北皆宜环境干爽舒适，清廷便预计将未来行政与经济重心的台湾省城迁移设于此处成为全岛中心，但后来因种种因素被搁置，而台中做为现代化城市雏形，则是1900年在台湾日治时期市区改正之后形成。日治时期因日人刻意打造成现代化城市，以市区改正政策将早期的市区规划整然有致，整治流经市区的绿川和柳川，植有柳树，幽静美丽，彷若京都鸭川，素有“台湾的京都”之美誉。"},{"page_url":"https://it.wikipedia.org/wiki/Valle_d%27Ossau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Vallee_Ossau.jpg","page_title":"Valle d'Ossau","context_page_description":"La valle d'Ossau è una valle dei Pirenei francesi nel dipartimento dei Pirenei Atlantici in Nuova Aquitania. I suoi abitanti sono chiamati Ossalois."},{"page_url":"https://oc.wikipedia.org/wiki/Aus_Gletons","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%C3%89glise_d%27%C3%89gletons.jpg","page_title":"Aus Gletons","context_page_description":"Aus Gletons es una comuna d'Occitània, en Lemosin, situada dins la Dordonha Lemosina. Es administrada per lo departament de Corresa e la region de Novela Aquitània, ancianament de Lemosin."},{"page_url":"https://eo.wikipedia.org/wiki/Tira_(Israelo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/TiraIsrael.jpg","page_title":"Tira (Israelo)","context_page_description":"Tira, estas urbo en Israelo. Ĝi situas ĉ. 12 km sudoriente de Netanja kaj 8 km nordoriente de Kfar Saba. En septembro 2003 Tira havis 19.600 enloĝantojn. La loĝantaro konsistas preskaŭ tute el muslimaj araboj. La statuson de urbo Tira ricevis en Den 1991.\\nĜemeliĝo ekzistas kun Burg ĉe Magdeburg en Germanio."},{"page_url":"https://en.wikipedia.org/wiki/List_of_New_York_City_Designated_Landmarks_in_Manhattan_on_smaller_islands","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/FortJay.jpg","page_title":"List of New York City Designated Landmarks in Manhattan on smaller islands","context_page_description":"The New York City Landmarks Preservation Commission, formed in 1965, is the New York City governmental commission that administers the city's Landmarks Preservation Law. Since its founding, it has designated over a thousand landmarks, classified into four categories: individual landmarks, interior landmarks, scenic landmarks, and historic districts.\\nThe New York City borough of Manhattan consists of the main island of Manhattan as well as several smaller islands. The LPC has designated fifteen landmarks on four smaller islands in Manhattan, including two historic districts, twelve individual landmarks, and one interior landmark. These designations comprise two on Ellis Island, six on Governors Island, one on Liberty Island, and six on Roosevelt Island. The designations include the Statue of Liberty, a national monument, as well as numerous buildings that are all also on the National Register of Historic Places."},{"page_url":"https://hu.wikipedia.org/wiki/Amazonok","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Fragment_of_a_terracotta_volute-krater_MET_DP202056.jpg","page_title":"Amazonok","context_page_description":"Az amazonok harcos nőkből álló népesség, akik a görög hitregékben és a történetírásban is szerepelnek. Amazoi, annyi mint kebeltelenek. Ősi lakóhelyük a hagyomány szerint, a kis-ázsiai Pontosz tartomány területén volt. Kalandozásaik során bejárták csaknem az egész ókori világot, Egyiptomtól Hellász északi részéig. Úgy tartják, több várost is alapítottak, mint például Epheszoszt vagy Szmürnát. Az amazonok leginkább két istenséget tiszteltek: Artemiszt és Arészt. Monda szerinti ősapjuk Arész, ősanyjuk pedig Otréré volt. Az amazonomakhia, az amazonokkal vívott csata tárgyköre igen népszerű volt a görög és római képzőművészetben."},{"page_url":"https://de.wikipedia.org/wiki/Park_Klein-Glienicke","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Gittertor_J%C3%A4gerhof_Glienicke.jpg","page_title":"Park Klein-Glienicke","context_page_description":"Der Park Klein-Glienicke, umgangssprachlich Glienicker Park genannt, ist ein öffentlich zugänglicher englischer Landschaftsgarten, der im äußersten Südwesten Berlins im Ortsteil Wannsee des Bezirks Steglitz-Zehlendorf liegt. Er ist Teil des UNESCO-Welterbes Schlösser und Parks von Potsdam und Berlin. Innerhalb derer gehört er neben Sanssouci, dem Neuen Garten, der Pfaueninsel und dem Park Babelsberg zu den fünf Stammparks.\\nDie etwa 116 ha umfassende Anlage wurde als Potsdamer Sommersitz des Prinzen Carl von Preußen im 19. Jahrhundert gestaltet und ergänzte dessen Hauptresidenz, das Palais Prinz Carl am Berliner Wilhelmplatz. Gestalterischer Mittelpunkt ist die Schloss Glienicke genannte prinzliche Villa im Süden des Parks, heute als Museum zugänglich. Schloss, Nebengebäude und Pleasureground gehören zur Stiftung Preußische Schlösser und Gärten Berlin-Brandenburg. Der eigentliche Park untersteht dem bezirklichen Grünflächenamt Steglitz-Zehlendorf und der Böttcherbergpark der Berliner Landesforstverwaltung."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%8B%E0%B4%AA%E0%B5%8D%E0%B4%B2%E0%B4%BF_%E0%B4%AE%E0%B5%86%E0%B4%A1%E0%B5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Volta_A.jpg","page_title":"കോപ്ലി മെഡൽ","context_page_description":"ഏതെങ്കിലും ഒരു ശാസ്ത്രശാഖയിൽ മികച്ച സംഭാവനകൾ നൽകിയ വ്യക്തിക്ക് ലണ്ടനിലെ റോയൽ സൊസൈറ്റി നൽകുന്ന പുരസ്കാരമാണ് കോപ്ലി മെഡൽ. ഒരു ഭൗതികശാസ്ത്രശാഖയ്ക്ക് ഒരു വർഷം പുരസ്കാരം നൽകിയാൽ, തൊട്ടടുത്ത വർഷം നൽകുന്നത് ഒരു ജീവശാസ്ത്രശാഖയ്ക്കായിരിക്കും.\\nറോയൽ സൊസൈറ്റി നൽകിക്കൊണ്ടിരിക്കുന്ന പുരസ്കാരങ്ങളിൽ ഏറ്റവും പഴക്കമുള്ളതാണ് ഈ പുരസ്കാരം. ഗണിതശാസ്ത്രരംഗത്തെ ഫീൽഡ്സ് മെഡൽ, ആബേൽ പുരസ്കാരം എന്നിവയെക്കാളും പഴക്കമുള്ളതാണ് ഈ പുരസ്കാരം. അതിനാൽ തന്നെ ലോകത്ത് ഇപ്പോഴും നൽകിക്കൊണ്ടിരിക്കുന്ന പഴക്കമേറിയ പുരസ്കാരകാരങ്ങളിലൊന്നാണിത്.\\n1731-ൽ ഈ പുരസ്കാരം ആദ്യമായി ലഭിച്ചത് സ്റ്റീഫൻ ഗ്രേയ്ക്കായിരുന്നു. വൈദ്യുതിയുമായി ബന്ധപ്പെട്ട പരീക്ഷണങ്ങളാണ് അദ്ദേഹത്തെ പുരസ്കാരത്തിനർഹനാക്കിയത്."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%A2%E8%8E%B2%E5%8D%97%E9%87%8C%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Construction_site_of_Hongliannanli_Station_%2820170316115258%29.jpg","page_title":"红莲南里站","context_page_description":"红莲南里站位于北京市西城区广安门外街道，是北京地铁16号线的一座在建车站。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D0%B0%D1%83%D1%80%D0%B5%D0%B0%D1%82%D1%96%D0%B2_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BF%D1%80%D0%B5%D0%BC%D1%96%D1%97_%D0%BC%D0%B8%D1%80%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Al_Gore.jpg","page_title":"Список лауреатів Нобелівської премії миру","context_page_description":"Нобелівська премія миру — одна з п'яти премій, започаткованих Альфредом Нобелем відповідно до його заповіту від 1895 року. Премія присуджується щороку, починаючи з 1901 року, за видатні заслуги у збереженні миру.\\nВибір лауреатів премії здійснюється щороку у жовтні Нобелівським комітетом з 5 осіб при парламенті Норвегії. Нагородження лауреатів відбувається щорічно у день смерті Альфреда Нобеля 10 грудня в Осло. Кожен лауреат отримує диплом та медаль лауреата Нобелівської премії, а також грошову винагороду."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Sant%27Antonio_Abate_(Macchie)","image_url":"https://upload.wikimedia.org/wikipedia/it/9/91/Santantonioaffresco.JPG","page_title":"Chiesa di Sant'Antonio Abate (Macchie)","context_page_description":"La chiesa di Sant'Antonio Abate si trova a Macchie, in Provincia di Macerata, nel comune di Castelsantangelo sul Nera.\\nÈ ubicata all'ingresso del paese, in via San Giovanni."},{"page_url":"https://de.wikipedia.org/wiki/St-Merry_(Paris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Paris_Saint-Merry_au%C3%9Fen_418.JPG","page_title":"St-Merry (Paris)","context_page_description":"Die römisch-katholische Pfarrkirche Saint-Merry oder Saint-Merri wurde zu Beginn des 16. Jahrhunderts im Stil der Spätgotik an der Stelle einer Kapelle aus dem 7. Jahrhundert errichtet. Dort wurde um 700 der heilige Medericus bestattet, nach dem die Kirche benannt ist. Die Eingänge befinden sich in der Rue de la Verrerie Nr. 76 und der Rue Saint-Martin Nr. 78 im 4. Arrondissement von Paris. Die nächsten Metrostationen sind Hôtel de Ville oder Châtelet der Linien 1, 4 und 11. 1862 wurde die Kirche in die Liste der französischen Kulturdenkmäler als Monument historique aufgenommen."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B5%D8%B1_%D8%A7%D9%84%D8%A3%D9%85%D9%8A%D8%B1_%D9%85%D8%AD%D9%85%D8%AF_%D8%B9%D9%84%D9%8A_%D8%A8%D8%A7%D9%84%D9%85%D9%86%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/%D8%BA%D8%B1%D9%81%D8%A9_%D8%A7%D9%84%D8%B9%D8%B1%D8%B4_%D8%A8%D9%82%D8%B5%D8%B1_%D9%85%D8%AD%D9%85%D8%AF_%D8%B9%D9%84%D9%89_%D8%A8%D8%A7%D9%84%D9%85%D9%86%D9%8A%D9%84.jpg","page_title":"قصر الأمير محمد علي بالمنيل","context_page_description":"قصر الأمير محمد علي بالمنيل أو قصر المنيل أو متحف قصر محمد علي بالمنيل أو متحف قصر المنيل هو أحد قصور العهد الملكي في مصر ذات الطابع المعماري الخاص. بدء بناء القصر عام 1901، ويقع بجزيرة منيل الروضة بالقاهرة على مساحة 61711 متر² منها 5000 متر تمثل مساحة المباني. يعد القصر تحفة معمارية فريدة كونه يضم طرز فنون إسلامية متنوعة ما بين فاطمي ومملوكي وعثماني وأندلسي وفارسي وشامي، ويشتمل القصر على ثلاث سرايات هي: سراي الإقامة، وسراي الاستقبال، وسراي العرش، بالإضافة إلى المسجد، والمتحف الخاص، ومتحف الصيد، وبرج الساعة، ويحيط به سور على طراز أسوار حصون القرون الوسطى، فيما تحيط بسراياه من الداخل حدائق تضم مجموعة نادرة من الأشجار والنباتات، ويستخدم القصر حالياً كمتحف.\\nكان القصر ملكاً للأمير محمد علي الابن الثاني للخديوي توفيق، وشقيق الخديوي عباس حلمي الثاني. والذي شغل منصب ولي العهد ثلاث مرات، كما كان أحد الأوصياء الثلاثة على العرش في الفترة ما بين وفاة الملك فؤاد الأول وتولي ابن عمه الملك فاروق سلطاته الدستورية عند إكماله السن القانونية. اختار أرض القصر الأمير محمد علي بنفسه، وأنشأ في البداية سراي الإقامة ثم أكمل بعدها باقي السرايا، وقام الأمير بوضع التصميمات الهندسية والزخرفية، والإشراف على البناء، فيما قام بالتنفيذ المعلم محمد عفيفي، وأوصى الأمير أن يتحول القصر بعد وفاته إلى متحف."},{"page_url":"https://fr.wikipedia.org/wiki/Nationalisme_pakistanais","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Flag_of_Pakistan_on_National_Monument.JPG","page_title":"Nationalisme pakistanais","context_page_description":"Le nationalisme pakistanais est une idéologie politique basée sur la valorisation de la nation pakistanaise. Il trouve ses origines à la fin du XIXᵉ siècle, par la création d'une identité pour les musulmans du sous-continent indien. Il se développe substantiellement avec la fondation de la Ligue musulmane en 1906. Le mouvement politique va progressivement défendre la création d'une nation pour les musulmans d'Inde au travers de la théorie des deux nations. En 1940, la résolution de Lahore va inscrire la volonté de la création d'un État indépendant, concrétisant le « Mouvement pour le Pakistan ».\\nLe 14 août 1947, le Pakistan est créé à la suite de la partition des Indes. Depuis lors, la nation pakistanaise a toutefois fait face à différents problèmes d'identités et de définitions, en plus d'être remis en cause par des mouvements séparatistes ou régionalistes. Le nationalisme pakistanais est aujourd'hui porté par différents partis politiques, notamment ceux issus de la Ligue musulmane du Pakistan."},{"page_url":"https://pl.wikipedia.org/wiki/Leopold_Okulicki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/POL_Leopold_Okulicki_plaque%2C_Warsaw_01.jpg","page_title":"Leopold Okulicki","context_page_description":"Leopold Okulicki, ps. „Niedźwiadek”, „Biedronka”, „Bronka”, „Jan”, „Jan Mrówka”, „Jan Ogór”, „Kobra”, „Konrad”, „Kula”, „Miller”, „Mrówka”, „Stary Boba”, „Osa”, „Pan Jan”, „Sęp”, „Termit” – generał brygady Wojska Polskiego, współtwórca SZP-ZWZ-AK, ostatni komendant główny Armii Krajowej, komendant główny NIE, komendant Okręgu Łódź ZWZ, cichociemny. Więziony przez NKWD m.in. w Brygidkach, na Łubiance, w Lefortowie oraz na Butyrkach."},{"page_url":"https://sq.wikipedia.org/wiki/Pedosfera","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%D7%A4%D7%90%D7%A8%D7%A7_%D7%94%D7%9B%D7%A8%D7%9E%D7%9C_5_-_%D7%92%D7%A0%D7%99%D7%9D_%D7%9C%D7%90%D7%95%D7%9E%D7%99%D7%99%D7%9D_%D7%91%D7%A6%D7%A4%D7%95%D7%9F_%D7%94%D7%90%D7%A8%D7%A5_-_%D7%90%D7%AA%D7%A8%D7%99_%D7%9E%D7%95%D7%A8%D7%A9%D7%AA_2016_%28532%29.jpg","page_title":"Pedosfera","context_page_description":"Pedosfera, është mbështjellës i dheut - tokës, gjegjësisht shtresës së imët të punueshme të Korës së Tokës. Toka është shtresa e hollë e shkriftë e sipërfaqes së Tokës, e cila punohet dhe paraqet bazën për zhvillimin e bujqësisë, sepse shfrytëzohet për kultivimin e bimëve të ndryshme. Formimi i kësaj shtrese të tokës- dheut, varet nga disa faktorë: klima, relievi, përbërja gjeologjike e shkëmbinjve, bota bimore e shtazore dhe nga vet aktiviteti i njeriut.\\nKrijimi i tokës është një proces i gjatë, sepse me shkatërrimin e shkëmbinjve dhe me shndërrimin e botës organike në thermi të imëta, krijohet shtresa sipërfaqësore e tokës së punueshme- dheut. Pra, nga thërrmimin -tjetërsimi i shkëmbinjve dhe nga organizmat e ngordhur të botës bimore e shtazore, krijohet shtresa pjellore e tokës, humusi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D1%80_(%D0%90%D0%B9%D1%84%D0%B5%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Wappen_lahr.png","page_title":"Лар (Айфель)","context_page_description":"Лар — коммуна в Германии, в земле Рейнланд-Пфальц.\\nВходит в состав района Айфель-Битбург-Прюм. Подчиняется управлению Нойербург. Население составляет 186 человек. Занимает площадь 7,23 км². Официальный код — 07 2 32 072."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8A%E6%9C%AB%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/South_Exit_of_Kamisue_Station%28abolished%29.JPG","page_title":"上末站","context_page_description":"上末站是一个曾存在于日本爱知县小牧市大字上末，由桃花台新交通株式会社经营的轻轨捷运系统车站，是已废线的桃花台线沿线的一座高架车站。"},{"page_url":"https://hu.wikipedia.org/wiki/Bulg%C3%A1ria_javasolt_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Bulgarien-Roschen-2-1996.jpg","page_title":"Bulgária javasolt világörökségi helyszínei","context_page_description":"Bulgária területéről a 2019. évvel bezárólag tíz helyszín került fel a világörökségi listára, valamint tizenhat további helyszín a javaslati listán várakozik a felvételre. Bulgária 1974-ben csatlakozott a programhoz."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%97%D1%8E%D0%BB%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Sand_flushing_%28Westerland%29.jpg","page_title":"Зюлт","context_page_description":"Зюлт е най-големият от Севернофризийските острови. Той се простира в Северно море северозападно от бреговете на Шлезвиг-Холщайн и Дания.\\nИзвестен е като най-северния германски остров. Привлича посетители с основните си туристически курорти Вестерланд, Кампин и Венингщедт, както и почти 40-километровия Западен плаж. Цените на имотите на Зюлт са най-високите в Германия. Поради въздействието на Северно море островът непрекъснато променя бреговата си линия и търпи загуби при бурните приливи. От 1927 г. Зюлт е свързан с континента посредством 11-километровия Насип Хинденбург."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1964","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/CiscaWijmenga2015.jpg","page_title":"Lijst van personen geboren in 1964","context_page_description":"Dit is een lijst van personen die geboren zijn in 1964.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pt.wikipedia.org/wiki/Camposanto_Monumentale","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Camposantopisa1.jpg","page_title":"Camposanto Monumentale","context_page_description":"Camposanto Monumentale ou Camposanto Vecchio é um edifício histórico na porção norte do Campo dei Miracoli de Pisa, na Itália.\\nEle tem este nome por que acredita-se que o edifício foi construído à volta de um carregamento de terra santa trazida do Gólgota durante a Quarta Cruzada por Ubaldo de' Lanfranchi, um arcebispo de Pisa do século XII. Uma lenda afirma que os corpos enterrados ali apodrecerão em apenas 24 horas. O campo está sobre as ruínas do antigo batistério da Igreja de Santa Reparata, que ficava onde hoje está a catedral. O termo \\"monumental\\" serve para diferencia-lo de um cemitério urbano mais recente construído em Pisa."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A6%8F%E5%B2%A1%E6%B5%B7%E3%81%AE%E4%B8%AD%E9%81%93%E5%A4%A7%E6%A9%8B%E9%A3%B2%E9%85%92%E9%81%8B%E8%BB%A2%E4%BA%8B%E6%95%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Fukuoka_drunkard_accident2006.jpg","page_title":"福岡海の中道大橋飲酒運転事故","context_page_description":"福岡海の中道大橋飲酒運転事故とは、2006年8月25日に福岡市東区の海の中道大橋で、市内在住の会社員の乗用車が、飲酒運転をしていた当時福岡市職員の男の乗用車に追突され博多湾に転落し、会社員の車に同乗していた3児が死亡した事故。\\n主犯の加害者に対しては、危険運転致死傷罪が適用されるかが争点になったが、危険運転致死傷罪と道路交通法違反を併合した懲役20年の刑が最高裁にて確定した。"},{"page_url":"https://tr.wikipedia.org/wiki/Dinozorlar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Edmontosaurus_skull_7.jpg","page_title":"Dinozorlar listesi","context_page_description":"Bu listede dinozor cinsleri kapsamlı bir şekilde listelenmiştir. Listede, geçerli olan veya henüz resmi isimlendirmesi yapılmamış 1379 cins ve alt sınıf dinozor ismi yer almıştır. Bazı isimlerin yanına aşağıdaki terminolojide belirtilen açıklamalar eklenmiştir."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A7%81%E0%A6%A6%E0%A7%8D%E0%A6%A7%E0%A6%97%E0%A7%81%E0%A6%B9%E0%A7%8D%E0%A6%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Buddhaguhya.JPG","page_title":"বুদ্ধগুহ্য","context_page_description":"বুদ্ধগুহ্য একজন বজ্রযান বৌদ্ধ সন্ন্যাসী ছিলেন।"},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Notre-Dame_de_Rouen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Reliquaire_de_saint_Olav_-_chapelle_Saint-Sever%2C_cath%C3%A9drale_de_Rouen.jpg","page_title":"Cathédrale Notre-Dame de Rouen","context_page_description":"La cathédrale Notre-Dame, officiellement cathédrale primatiale Notre-Dame-de-l'Assomption de Rouen, est le monument le plus prestigieux de la ville de Rouen. Elle est le siège de l'archidiocèse de Rouen, chef-lieu de la province ecclésiastique de Normandie. L'archevêque de Rouen portant le titre de primat de Normandie, sa cathédrale a ainsi le rang de primatiale.\\nC'est une construction d'architecture gothique dont les premières pierres remontent au haut Moyen Âge. Elle a la particularité, rare en France, de conserver son palais archiépiscopal et les constructions annexes environnantes datant de la même époque.\\nComme la plupart des grands édifices religieux du gothique normand, la cathédrale est dotée d'une « tour-lanterne » sur la croisée du transept. La flèche en bois couverte en plomb de style Renaissance qui la couronnait fut détruite par un incendie allumé par la foudre en 1822. Elle est à présent surmontée d'une flèche en fonte, construite de 1825 à 1876 qui culmine à 151 mètres de hauteur."},{"page_url":"https://ceb.wikipedia.org/wiki/Navarretia_heterandra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Navarretia_heterandra_dupl._JEPS101651_%285580129255%29.jpg","page_title":"Navarretia heterandra","context_page_description":"Espesye sa tanom nga bulak ang Navarretia heterandra. Una ning gihulagway ni Mason. Ang Navarretia heterandra sakop sa kahenera nga Navarretia sa kabanay nga Polemoniaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://tr.wikipedia.org/wiki/Florin_R%C4%83ducioiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/KL_2015_Final_%281%29.jpg","page_title":"Florin Răducioiu","context_page_description":"Florin Valeriu Răducioiu, Rumen eski millî futbolcudur.\\nKariyeri boyunca Dinamo București, Bari, Hellas Verona, Brescia, Milan, Espanyol, West Ham United, Stuttgart, Monaco ve Créteil-Lusitanos formalarını giydi. 40 kere Romanya millî takımı forması giyen Răducioiu, 21 gol kaydetti. 1990 ve 1994 FIFA Dünya Kupası ile 1996 Avrupa Futbol Şampiyonası'nda forma giymiş olan futbolcu, Dünya Kupası'nda attığı 4 golle ülkesinin turnuva tarihindeki en golcü oyuncusu konumundadır."},{"page_url":"https://en.wikipedia.org/wiki/Demographics_of_New_Zealand","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Lion_dancers_at_the_Auckland_lantern_festival_2010.jpg","page_title":"Demographics of New Zealand","context_page_description":"The demographics of New Zealand encompass the gender, ethnic, religious, geographic, and economic backgrounds of the 5 million people living in New Zealand. New Zealanders, informally known as \\"Kiwis\\", predominantly live in urban areas on the North Island. The five largest cities are Auckland, Christchurch, Wellington, Hamilton, and Tauranga. Few New Zealanders live on New Zealand's smaller islands. Waiheke Island is easily the most populated smaller island with 9,330 residents, while Great Barrier Island, the Chatham and Pitt Islands, and Stewart Island each have populations below 1,000. New Zealand is part of a realm and most people born in the realm's external territories of Tokelau, the Ross Dependency, the Cook Islands and Niue are entitled to New Zealand passports.\\nAs at the 2018 census, the majority of New Zealand's population is of European descent, with the indigenous Māori being the largest minority, followed by Asians, and non-Māori Pacific Islanders. This is reflected in immigration, with most new migrants coming from Britain and Ireland, although the numbers from Asia in particular are increasing."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B9%D0%BC%D0%B0%D1%80%D0%BA%D1%82-%D0%B8%D0%BD-%D0%B4%D0%B5%D1%80-%D0%9E%D0%B1%D0%B5%D1%80%D0%BF%D1%84%D0%B0%D0%BB%D1%8C%D1%86_(%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Municipalities_in_NM.svg","page_title":"Ноймаркт-ин-дер-Оберпфальц (район)","context_page_description":"Ноймаркт-ин-дер-Оберпфальц — район в административном округе Верхний Пфальц. Центр района — город Ноймаркт-ин-дер-Оберпфальц. Занимает площадь 1344,23 км². Население — 128 825 чел. Плотность населения — 96 человек/км².\\nОфициальный код района — 09 3 73.\\nРайон подразделяется на 19 общин."},{"page_url":"https://eo.wikipedia.org/wiki/Alcal%C3%A1_del_J%C3%BAcar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Alcal%C3%A1_del_J%C3%BAcar_vista_panor%C3%A1mica.JPG","page_title":"Alcalá del Júcar","context_page_description":"Alcalá del Júcar estas municipio en la Provinco Albaceto, sudoriente de Hispanio, en la regiono Kastilio-Manĉo kaj en la komarko Manĉeto aŭ La Manchuela, kun areo de 146,82 km². En 2019 estis 1 170 loĝantoj, laŭ informo de la hispana statistika servo INE. Ĝi estas je 64 km de la provinca ĉefurbo Albacete. La urbeto estis deklarita Histori-Arta Komplekso en 1982. Apartenas al la municipo la submunicipoj Casas del Cerro, Las Eras, La Gila, Tolosa kaj Zulema."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_abbayes_de_Bretagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Abbaye_de_Kergonan_Plouharnel.jpg","page_title":"Liste des abbayes de Bretagne","context_page_description":"La liste des abbayes bretonnes recense de manière exhaustive les abbayes fondées sur le territoire de la Bretagne historique."},{"page_url":"https://fr.wikipedia.org/wiki/Orschwiller","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Orschwiller_A_018.JPG","page_title":"Orschwiller","context_page_description":"Orschwiller est une commune française située dans le département du Bas-Rhin, en région Grand Est.\\nCette commune se trouve dans la région historique et culturelle d'Alsace."},{"page_url":"https://en.wikipedia.org/wiki/Australian_Football_Hall_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/en/1/13/Malcolm_Blight_statue_Adelaide_Oval.jpg","page_title":"Australian Football Hall of Fame","context_page_description":"The Australian Football Hall of Fame was established in 1996, the Centenary year of the Australian Football League, to help recognise the contributions made to the sport of Australian rules football by players, umpires, media personalities, coaches and administrators. It was initially established with 136 inductees. As of 2014, this figure has grown to 257, including 27 \\"Legends\\".\\nWhile those involved in the game from its inception in 1858 are theoretically eligible, as of 2020, very few outside the major leagues have been recognised."},{"page_url":"https://ca.wikipedia.org/wiki/Aq%C3%BCeducte_rom%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Aquae_planlatium_2a.png","page_title":"Aqüeducte romà","context_page_description":"Els enginyers romans van construir aqüeductes, amb característiques pròpies, al llarg de tot l'Imperi. La seva finalitat era portar aigua des de deus externes fins a les ciutats i pobles. L'aigua dels aqüeductes es subministrava a diferents llocs dins d'aquestes: banys públics, latrines, fonts, i llars privades; També s'emprava per donar suport a operacions mineres, molins d'aigua, granges i jardins.\\nEls aqüeductes només deixaven que l'aigua es mogués per gravetat, al llarg d'un lleuger gradient de descens global en conductes de pedra, maó o formigó; Com més pronunciat era el gradient, més ràpid era el flux. La majoria dels conductes eren enterrats sota terra i seguien el contorn del terreny; esquivant els obstacles o, amb menys freqüència, travessant un túnel. Quan s'arribava a les valls o les terres baixes el conducte es portava sobre ponts o les seves conduccions es connectaven a canonades de plom, de ceràmica o de pedra d'alta pressió. La majoria dels sistemes d'aqüeductes incloïen dipòsits de sedimentació, que ajudaven a reduir els residus transportats dins l'aigua, uns estalladors i castella aquae regulaven l'oferta d'aigua a les destinacions individuals."},{"page_url":"https://fr.wikipedia.org/wiki/Connemara_(cheval)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Connemara_mare.jpg","page_title":"Connemara (cheval)","context_page_description":"Le Connemara est une race de poneys, originaire de la côte ouest éponyme de l'Irlande. Ses origines sont obscures. Il a connu de nombreux croisements au cours des siècles avant la création de la Connemara Breeder's Society en 1923 qui fixe les caractéristiques de la race et établit le premier stud-book édité en 1926. C'est un poney compact mais athlétique qui présente le plus souvent une robe grise. Poney de sport, le Connemara est polyvalent. Il se prête tant au dressage qu'au saut d'obstacles, où il se distingue particulièrement. La popularité du poney Connemara s'est étendue à travers le monde. La France et l'Irlande possèdent le cheptel le plus important."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A2%85%E4%BB%80%E7%A7%91%E5%9B%9B%E4%B8%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Mieszko_IV.JPG","page_title":"梅什科四世","context_page_description":"梅什科四世，西里西亚公爵及短暂成为波兰最高的公爵克拉科夫大公。"},{"page_url":"https://en.wikipedia.org/wiki/Cicindela_repanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Cicindela-repanda-002.jpg","page_title":"Cicindela repanda","context_page_description":"Cicindela repanda, commonly known as the bronzed tiger beetle or common shore tiger beetle, is a species of tiger beetle that measures 10–13 millimetres long, lives in most of North America. Its labrum is small with one tooth and the pronotum is coppery and hairy. The shoulder marking touches or nearly touches the middle band. It is usually seen in spring and summer and it lives in sand, gravel, or clay soil. Its food is many insects and some fruit. The species have a two-year life cycle. It can be found all across sand dunes around the great lakes The species comprises three subspecies: C. repanda repanda, C. repanda novascotiae, and C. repanda tanneri."},{"page_url":"https://cs.wikipedia.org/wiki/Eli%C5%A1ka_Pe%C5%A1kov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Eleonora_Peskova_Vilimek.jpg","page_title":"Eliška Pešková","context_page_description":"Eliška Pešková, rozená Elisabeth Peschke, provdaná Eliška Švandová ze Semčic byla česká divadelní herečka."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_generales_de_Tailandia_de_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Thanatorn_cropped_2018.jpg","page_title":"Elecciones generales de Tailandia de 2019","context_page_description":"Las elecciones generales se realizaron en Tailandia el domingo 24 de marzo de 2019. La fecha fue fijada por la Comisión Electoral el miércoles 23 de enero de 2019, solo unas horas después de que se emitió un decreto real que autorizaba la votación. La votación tuvo lugar bajo un estatuto respaldado por el ejército, que puso fin a uno de los períodos más largos de gobierno de una junta militar en la historia moderna de Tailandia.​\\nEl gobierno militar en 2014 prometió celebrar elecciones en 2015, pero luego las pospuso. El primer ministro Prayut Chan-o-cha dijo a la Asamblea General de las Naciones Unidas en septiembre de 2016 que las elecciones se realizarían para fines de 2017. Luego, durante una visita a la Casa Blanca en 2017, Prayut prometió elecciones en 2018. En octubre de 2017, prometió elecciones para noviembre de 2018.​​ Sin embargo, en enero de 2018, se ejecutó un proyecto de ley que regía la elección de los parlamentarios, el cual fue pospuesto por la Asamblea Legislativa Nacional por 90 días, lo que retrasó las elecciones hasta febrero-marzo de 2019. El proyecto de ley era uno de los cuatro necesarios para celebrar una elección general."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Aire-sur-l%27Adour","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Map_commune_FR_insee_code_40001.png","page_title":"Aire-sur-l'Adour","context_page_description":"Aire-sur-l'Adour sī ūi-tī Hoat-kok Aquitaine toā-khu Landes séng ê chi̍t ê commune."},{"page_url":"https://gl.wikipedia.org/wiki/Lago_Nahuel_Huapi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Bariloche._Lago_Nahuel_Huapi-2.JPG","page_title":"Lago Nahuel Huapi","context_page_description":"Nahuel Huapi é un lago arxentino de orixe glaciar, de 557 km² de superficie e localizado a uns 700 msnm. Está partillado polas provincias de Río Negro e do Neuquén, na Arxentina, dentro do Parque Nacional Nahuel Huapi.\\nDestaca pola súa profundidade e as súas sete ramificacións ou brazos: Campanario, de la Tristeza, Blest, Machete, del Rincón, Última Esperanza e Huemul. Relaciónase con outros lagos menos extensos, como o Gutiérrez, o Moreno, o Espejo e o Correntoso. Aliméntase dos desxeos e constitúa a fonte do río Limay. Alcanza 464 m de profundidade máxima. Posúe varias illas, sendo a máis grande e importante pola súa actividade turística a Illa Victoria, de 31 km².\\nOs primeiros europeos visitárono en 1670: eran misioneiros xesuítas provenientes da residencia de Castro, en Chiloé, e fundaron unha misión na península Huemul para evanxelizar aos nativos. A misión foi abandonada en 1718 debido á matanza de cinco membros da orde.\\nCase dous séculos despois, o 22 de xaneiro de 1876, o perito Francisco Pascasio Moreno remontou o río Limay chegando até a costa leste do lago."},{"page_url":"https://it.wikipedia.org/wiki/Biagio_Manzoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Biagio_Manzoni%2C_Martirio_di_Sant%27Eutropio.jpg","page_title":"Biagio Manzoni","context_page_description":"Biagio Manzoni è stato un pittore italiano, documentato a Faenza tra il 1630 e il 1648."},{"page_url":"https://es.wikipedia.org/wiki/Madame_de_Saint-Laurent","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Madame_de_Staint_Laurent.jpg","page_title":"Madame de Saint-Laurent","context_page_description":"Alphonsine-Thérèse-Bernardine-Julie de Montgenêt de Saint-Laurent fue la esposa del barón de Fortisson, coronel al servicio de Francia, y amante del príncipe Eduardo, duque de Kent y Strathearn."},{"page_url":"https://ceb.wikipedia.org/wiki/Bathyporeia_pelagica","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Bathyporeia_pelagica.jpg","page_title":"Bathyporeia pelagica","context_page_description":"Espesye sa krustaseo ang Bathyporeia pelagica. Una ning gihulagway ni Charles Spence Bate ni adtong 1857. Ang Bathyporeia pelagica sakop sa kahenera nga Bathyporeia sa kabanay nga Pontoporeiidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/List_of_prehistoric_jawless_fish_genera","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Drepanaspis_gemuendina.jpg","page_title":"List of prehistoric jawless fish genera","context_page_description":"This list of prehistoric jawless fish is an attempt to create a comprehensive listing of all genera from the fossil record that have ever been considered to be jawless fish, excluding purely vernacular terms. The list includes all commonly accepted genera, but also genera that are now considered invalid, doubtful, or were not formally published, as well as junior synonyms of more established names, and genera that are no longer considered agnathans. Modern forms are excluded from this list."},{"page_url":"https://fr.wikipedia.org/wiki/Temple_d%27Apollon_%C3%A0_Bassae","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/BM%3B_RM16_-_GR%2C_Bassae_Sculpture_1_Temple_of_Apollo_Epikourios_%28420-400B.C%29_~_Full_Elevation_%26_Viewing_West.JPG","page_title":"Temple d'Apollon à Bassae","context_page_description":"Le temple d'Apollon Épicourios à Bassae est un temple de la Grèce antique situé à Bassae, à 8 km NO de la cité antique de Phigalie et à 7 km S du village moderne d'Andritsaina.\\nPerché à 1 130 mètres dans les montagnes arcadiennes, en plein Péloponnèse, il est orienté face au nord sur une des terrasses ouest du mont Cotylion.\\nLe temple fait l'objet de travaux importants et d'une restauration radicale. Depuis 1990, il est protégé par un vélum soutenu par des poteaux métalliques et des câbles d'acier, qui le recouvre entièrement. Ses éléments architecturaux ont été nettoyés et solidarisés par des étais et échafaudages boulonnés et capitonnés."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B9%81%E0%B8%9F%E0%B8%82%E0%B8%B5%E0%B9%89%E0%B8%8A%E0%B8%B0%E0%B8%A1%E0%B8%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Luwak_%28civet_cat%29_in_cage.jpg","page_title":"กาแฟขี้ชะมด","context_page_description":"กาแฟขี้ชะมด หรือ กาแฟชะมด หมายถึงเมล็ดกาแฟที่สัตว์กลุ่มชะมดโดยเฉพาะคืออีเห็นข้างลาย ได้กินและถ่ายออกมาแล้ว\\nนอกจากนั้นแล้ว ยังหมายถึงเครื่องดื่มกาแฟที่ทำมาจากเมล็ดกาแฟชนิดนี้ โดยที่คนอินโดนีเซียเรียกกาแฟชนิดนี้ว่า Kopi Luwak มีราคาซื้อขายที่สูงมาก เมื่อขายปลีกเป็นกาแฟปรุงสำเร็จถ้วยละ 500-1,500 บาท และขายเป็นเมล็ดกาแฟ กิโลกรัมละ 100,000 บาท\\nผู้ผลิตกาแฟอ้างว่า วิธีการที่ให้กำเนิดกาแฟนี้ เพิ่มคุณภาพผ่านกลไกสองอย่างคือ การคัดเลือกเมล็ด และการย่อย\\nคือ ชะมดจะเลือกกินเมล็ดกาแฟซึ่งมีคุณภาพที่ดีกว่า\\nและกลไกการย่อยของชะมดอาจจะเพิ่มรสชาติของเมล็ดกาแฟ\\nคือ ชะมดจะกินเมล็ดกาแฟพร้อมกับเนื้อเข้าไป และจะเกิดการหมักในทางเดินอาหาร\\nเอนไซม์ Protease ซึ่งช่วยย่อยโปรตีนจะซึมเข้าไปในเมล็ด ทำให้เกิดเพปไทด์ที่สั้นกว่าและจำนวนกรดอะมิโนอิสระที่มากกว่า\\nส่วนเมล็ดจะผ่านระบบทางเดินอาหารของตัวชะมดจนกระทั่งถ่ายออกมา\\nซึ่งชาวไร่จะเก็บและนำผ่านกระบวนการผลิตต่อไป\\nวิธีการผลิตกาแฟดั้งเดิมที่เก็บมูลชะมดในป่า ได้เปลี่ยนไปเป็นกระบวนการขังชะมดไว้ในกรงแล้วบังคับให้กินเมล็ดกาแฟ\\nซึ่งได้สร้างปัญหาด้านจริยธรรมเกี่ยวกับวิธีการเลี้ยงชะมด เพราะชะมดถูกบังคับให้อยู่ใน \\"สิ่งแวดล้อมที่น่าสะพรึงกลัว\\" รวมทั้งการถูกขังแยก อาหารที่ไม่ดี กรงที่เล็ก และอัตราการตายในระดับสูง\\nในปี ค.ศ."},{"page_url":"https://fr.wikipedia.org/wiki/Lillian_H._Smith","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Toronto_Public_Library_-_Lillian_H._Smith_Branch.JPG","page_title":"Lillian H. Smith","context_page_description":"Lillian Helena Smith est une bibliothécaire canadienne, la première spécialiste de la littérature d'enfance et de jeunesse dans l'Empire britannique."},{"page_url":"https://it.wikipedia.org/wiki/Kimbo_Slice","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Kimbo_Slice_1.jpg","page_title":"Kimbo Slice","context_page_description":"Kimbo Slice, nome d'arte di Kevin Ferguson, è stato un lottatore di arti marziali miste e pugile bahamense naturalizzato statunitense.\\nHa combattuto nella divisione dei pesi massimi per la promozione di MMA Bellator.\\nLe sue prime apparizioni avvennero in internet, dove inizialmente furono diffusi i filmati dei suoi combattimenti clandestini. Le forze dell'ordine non intervennero mai, perché i combattimenti erano considerati consensuali per i contendenti.\\nDopo essersi lasciato i combattimenti di strada alle spalle, iniziò a combattere ufficialmente nelle arti marziali miste, allenato da Bas Rutten.\\nDal 2010 praticò anche pugilato, disciplina nella quale rimase imbattuto."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A2%85%E6%97%B8%E6%98%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/%E6%A2%85%E6%97%B8%E6%98%A5.jpg","page_title":"梅旸春","context_page_description":"梅暘春，江西南昌人，中國橋樑專家。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B0%B4%E7%87%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Chinese_Dragon_2012.jpg","page_title":"水燈","context_page_description":"水灯，又称流灯，是浮于水面的灯，依水灯所在的水体不同又称河灯、江灯、湖灯等。最原始的水灯是把点燃的灯放进水里漂浮的一种，称为水灯头。水灯源自印度，后来因佛教传播，流传至东南亚及东亚地区。在包括东南亚在内的南亚文化圈中，水灯是祭祀、送厄、祈福的仪式，在东亚则多见于普渡仪式中，属一种接引水中孤魂接受普渡的仪式，为祭水幽仪式的一种，常见于醮会、盂兰胜会等，又称照冥。在台湾、日本又有水灯排，是以大竹子或木头为中柱，左右以数条竹子或杉木扎成筏形，分几十格或几百格，每格悬挂一灯。除了在水中漂浮的水灯外，近年还出现了固定在水中位置的。"},{"page_url":"https://en.wikipedia.org/wiki/Tourism_in_Colombia","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Chinchin%C3%A1_cafetal.jpg","page_title":"Tourism in Colombia","context_page_description":"The contribution of travel and tourism to GDP was US$5,880.3bn in 2016. Tourism generated 556,135 jobs in 2016. Foreign tourist visits were predicted to have risen from 0.6 million in 2007 to 4 million in 2017. Responsible tourism became a peremptory need for Colombia because it minimizes negative social, economic and environmental impacts and makes positive contributions to the conservation of natural and cultural heritage.\\nColombia has major attractions for a tourist destination, such as Cartagena and its historic surroundings, which are on the UNESCO World Heritage List; the insular department of San Andrés, Providencia y Santa Catalina; and Santa Marta and the surrounding area. The coffee region is also a very popular destination, especially the traditional town of Salento, _Quindío and its surroundings. Fairly recently, Bogotá, the nation's capital, has become Colombia's major tourist destination because of its improved museums and entertainment facilities and its major urban renovations, including the rehabilitation of public areas, the development of parks, and the creation of an extensive network of cycling routes."},{"page_url":"https://de.wikipedia.org/wiki/Kathagenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Schloss_F%C3%BCrstenberg_Kathagenberg_Weser_1910.jpg","page_title":"Kathagenberg","context_page_description":"Der Kathagenberg ist ein Naturschutzgebiet in der niedersächsischen Gemeinde Fürstenberg in der Samtgemeinde Boffzen im Landkreis Holzminden.\\nDas Naturschutzgebiet mit dem Kennzeichen NSG HA 111 ist 18 Hektar groß. Es grenzt im Nordosten und Südosten an das Landschaftsschutzgebiet „Solling-Vogler“. Es steht seit dem 11. September 1986 unter Naturschutz. Zuständige untere Naturschutzbehörde ist der Landkreis Holzminden.\\nDas Naturschutzgebiet liegt westlich von Fürstenberg am Rand des Naturparks Solling-Vogler. Es stellt einen nach Südwesten exponierten Prallhang der Weser unter Schutz, der von hervortretenden Felsformationen geprägt wird. Der Prallhang ist von Buchenwald bestanden, bei dem es sich im nördlichen Bereich teilweise um alten Niederwald handelt, der nach Süden in Hochwald mit Alt- und Totholz­beständen übergeht. Vorherrschende Baumarten sind Rotbuche, Eiche, Esche, Bergahorn, Roteiche, Hainbuche und Elsbeere.\\nIm Übergangsbereich von Nieder- zum Hochwald sind vier aufgelassene Buntsandsteinbrüche zu finden, die ihrer natürlichen Entwicklung überlassen werden.\\nDurch einen Teil des Naturschutzgebiets und seine Umgebung verläuft ein Wanderweg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%96%D0%BC%D0%BC%D0%B5%D0%BB%D1%8C%D0%BF%D1%84%D0%BE%D1%80%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Luftaufnahmen_Nordseekueste_2012-05-by-RaBoe-619.jpg","page_title":"Гіммельпфортен","context_page_description":"Гіммельпфортен — громада в Німеччині, розташована в землі Нижня Саксонія. Входить до складу району Штаде. Центр об'єднання громад Ольдендорф-Гіммельпфортен.\\nПлоща — 18,29 км². Населення становить 5263 ос."},{"page_url":"https://tr.wikipedia.org/wiki/Plastik_po%C5%9Fet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Body_bag.jpg","page_title":"Plastik poşet","context_page_description":"Plastik torba, plastik poşet veya plastik kese, ince, esnek, plastik filmden, dokusuz kumaşlar veya plastik tekstilden yapılmış bir kap türüdür. Plastik torbalar, yiyecek, ürün, toz, buz, dergi, kimyasal madde ve atık gibi malları taşımak ve saklamak için kullanılır. Yaygın bir paketleme şeklidir.\\nPlastik torbaların çoğu dikişlerde ısıyla kapatılır, bazıları yapıştırıcılarla yapıştırılır veya dikilir.\\nBirçok ülke hafif plastik poşetlerin tasfiye edilmesine ilişkin yasalar çıkarmaktadır, çünkü plastik asla tam olarak bozulmaz, plastiklerin ve çevresel etkilerin sonsuz kirlenmesine neden olur. Her yıl dünyada yaklaşık 1 ila 5 trilyon plastik poşet kullanılıyor ve atılıyor.\\n10 Aralık 2018 tarihi itibarıyla Türkiye'de plastik poşetler ücretli olmuştur."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9isme_de_1963_%C3%A0_Skopje","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Skopje_X123.JPG","page_title":"Séisme de 1963 à Skopje","context_page_description":"Le séisme de 1963 à Skopje est un séisme d'une magnitude de 6.9 sur l'échelle de Richter qui a frappé une partie de la République socialiste de Macédoine au matin du 26 juillet 1963.\\nLe séisme a principalement touché la vallée du Vardar et les massifs montagneux adjacents. À Skopje, les dégâts sont considérables, tant en pertes humaines qu'en pertes matérielles.\\nLe tremblement de terre est une conséquence directe de l'activité tectonique de la péninsule balkanique et plus précisément de la présence d'une faille qui court de la mer Égée à la région de Belgrade.\\nLa catastrophe a fortement marqué l'histoire de Skopje, qui a alors perdu l'essentiel de ses infrastructures et de son patrimoine, mais elle a aussi marqué les médias de l'époque et a déclenché de nombreuses réactions internationales. Le statut non-aligné de la Yougoslavie a ainsi permis aux Skopiotes de recevoir de l'aide du monde entier. La reconstruction fut rapide et orchestrée par des grands noms de l'architecture moderne, comme le japonais Kenzo Tange."},{"page_url":"https://sl.wikipedia.org/wiki/6._konjeni%C5%A1ki_polk_(ZDA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/6CavRegtCOA.jpg","page_title":"6. konjeniški polk (ZDA)","context_page_description":"6. konjeniški polk je eden izmed konjeniških polkov Kopenske vojske ZDA."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%BD%D1%83%D1%81,_%D0%AF%D1%80%D0%BE%D1%81%D0%BB%D0%B0%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Jaroslav_Janus_-_Blues_vs_Lightning.jpg","page_title":"Янус, Ярослав","context_page_description":"Яросла́в Я́нус — словацкий хоккеист, вратарь. Воспитанник хоккейного клуба «Прешов». В настоящее время является игроком клуба «Литвинов», выступающего в Чешской экстралиги."},{"page_url":"https://en.wikipedia.org/wiki/Isaac","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Giotto_di_Bondone_080.jpg","page_title":"Isaac","context_page_description":"Isaac is one of the three patriarchs of the Israelites and is an important figure in the Abrahamic religions, including Judaism, Christianity, and Islam. He was the son of Abraham and Sarah, the father of Jacob, and the grandfather of the twelve tribes of Israel.\\nIsaac's name means \\"he will laugh\\", reflecting the laughter, in disbelief, of Abraham and Sarah, when told by God that they would have a child. He is the only patriarch whose name was not changed, and the only one who did not move out of Canaan. According to the narrative, he died aged 180, the longest-lived of the three patriarchs."},{"page_url":"https://io.wikipedia.org/wiki/Listo_pri_chefministri_di_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Middle_coat_of_arms_of_the_French_Republic_%281905%E2%80%931953%29.png","page_title":"Listo pri chefministri di Francia","context_page_description":"Yen la listo pri chefministri di Francia de 1871 til nun."},{"page_url":"https://es.wikipedia.org/wiki/Ajimez","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Bifora_castello_roganzuolo.jpg","page_title":"Ajimez","context_page_description":"El ajimez, palabra que viene del árabe al-šimāsa, ​ es una ventana de dos aberturas que está dividida verticalmente en dos partes iguales mediante una pequeña columna o pilastrilla llamada mainel o parteluz, sobre la que se apoyan dos arcos, generalmente de medio punto o apuntados. A veces está enmarcada por otro arco, y en el espacio entre los arcos se inserta una decoración, un escudo de armas o una abertura circular. La palabra proviene del arábigo español šamís. El Diccionario de la Academia da un segundo sentido a la palabra: «Saledizo o balcón saliente hecho de madera y con celosías».\\nTambién se conoce como ventana geminada —adjetivo que se refiere a un objeto formado por dos elementos iguales o bien distintos colocados en parejas— y, en ámbitos de habla catalana, como bífora o ventana biforada.​ Por analogía, el mismo tipo de ventana con tres aberturas se denomina trífora, o ventana triforada, ​ y el de cuatro, quadrífora.\\nLas bíforas y las tríforas aparecen a partir de la Antigüedad romana, y se convierte en elemento frecuente en la arquitectura paleocristiana y bizantina. En la península ibérica, se conoce en la arquitectura visigoda y prerrománica."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%96%AC%E6%9C%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Larix_decidua_Aletschwald.jpg","page_title":"喬木","context_page_description":"喬木係種植物分類，指有明顯主幹嘅木本植物，生得比較高大，距離地面比較遠先至打橫生出枝幹。\\n絕大多數樹都算係喬木。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%86%D0%BD%D0%B4%D0%B0%D0%BD%D0%B5%D0%B7%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Presiden_Sukarno.jpg","page_title":"Інданезія","context_page_description":"Індане́зія, Рэспу́бліка Індане́зія — дзяржава ў Паўднёва-Усходняй Азіі, размешчаная на 17 508 астравах найбуйнейшага ў свеце Малайскага архіпелага і заходняй частцы вострава Новая Гвінея. Мае сухапутныя межы з Малайзіяй, Папуа-Новай Гвінеяй і Усходнім Тыморам. Сухапутная тэрыторыя — 1,9 млн км². Марская акваторыя — 7,9 млн кв. км. Насельніцтва — больш за 250 млн чалавек. Сталіца — Джакарта з насельніцтвам звыш 10 млн чал. Афіцыйная мова — інданезійская. Грашовая адзінка — інданезійская рупія. Нацыянальнае свята — Дзень абвяшчэння незалежнасці.\\nУнітарная дзяржава, прэзідэнцкая рэспубліка. У кастрычніку 2014 года пасаду прэзідэнта заняў Джока Відода, віцэ-прэзідэнта — Юсуф Кала.\\nІнданезія мае значную этнакультурную разнастайнасць. Каля 88 % насельніцтва — мусульмане, што робіць яе краінай з найбольшым мусульманскім насельніцтвам у свеце.\\nАдміністрацыйны падзел: 33 адміністрацыйныя адзінкі.\\nНезалежнасць краіны абвешчана 17 жніўня 1945. У 1942—1945 гадах яна знаходзілася пад японскай акупацыяй, а да таго была каланіяльным уладаннем Нідэрландаў, якія пачалі яе асваенне ў першай палове XVII ст. і аб'ядналі большую частку тэрыторыі сучаснай Інданезіі пад сваёй уладай да пачатку XX ст."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%88%E0%B8%B1%E0%B8%81%E0%B8%A3%E0%B8%9E%E0%B8%A3%E0%B8%A3%E0%B8%94%E0%B8%B4%E0%B8%99%E0%B8%B5%E0%B9%80%E0%B8%8B%E0%B8%B5%E0%B9%88%E0%B8%A2%E0%B8%A7%E0%B9%80%E0%B8%89%E0%B8%B4%E0%B8%87%E0%B9%80%E0%B8%AB%E0%B8%A3%E0%B8%B4%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Empress_XiaoCheng.JPG","page_title":"จักรพรรดินีเซี่ยวเฉิงเหริน","context_page_description":"สมเด็จพระจักรพรรดินีเสี้ยวเฉิงเหริน ทรงเป็นสมเด็จพระจักรพรรดินีพระองค์แรกในจักรพรรดิคังซีทรงมาจากราชสกุล เฮ่อเซ่อหลี่ อภิเษกสมรสกับจักรพรรดิคังซีตั้งแต่พระชนมายุยังน้อย และเสด็จสวรรคตเมื่อพระชนมายุ 20 พรรษา ซึ่งเป็นสมเด็จพระจักรพรรดินีในฐานะสมเด็จพระอัครมเหสีที่พระชนม์น้อยที่สุดในราชวงศ์ชิง"},{"page_url":"https://es.wikipedia.org/wiki/Oswaldo_Salas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Oswaldo_Salas_como_el_cura_en_los_Panamericanos.jpg","page_title":"Oswaldo Salas","context_page_description":"Jorge Oswaldo Salas Williams es un actor peruano de cine, televisión y teatro."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AC%D9%88%D8%AF%DB%8C%D8%AA_%D8%A2%D9%84%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Telephone_Operator_poster.JPG","page_title":"جودیت آلن","context_page_description":"جودیت آلن آمریکالی اوْیونچو ۸ فئوریه ۱۹۱۱ میلادی تاریخینده نیویورک شهرینده دۆنیایا گؤز آچیب. ۸۵ ایل عؤمر ائله‌ییب و ۵ اوکتبر ۱۹۹۶ میلادی تاریخینده وفات ائدیب."},{"page_url":"https://ga.wikipedia.org/wiki/Meghan,_Bandi%C3%BAc_Sussex","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Meghan_Markle_3441.jpg","page_title":"Meghan, Bandiúc Sussex","context_page_description":"Is iar-aisteoir Meiriceánach í Meghan Markle, a rugadh ar an 4 Lúnasa, 1981 agus atá pósta le Prionsa Harry, Diúc Sussex."},{"page_url":"https://tr.wikipedia.org/wiki/A%C4%9Fstafa%C3%A7ay","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Agstev3.JPG","page_title":"Ağstafaçay","context_page_description":"Ağstafaçay - Kura ün sağ koludur. Esasen Ermenistandan ve Azerbaycan'in Qazax ve Ağstafa bölgelerinin üzerinden geçmektedir. Uzunluğu 133 km, havza alanı 2500 km² dir. Başlangıcını Küçük Kafkasya'nın kuzey-doğu bölümünde, Pembek sıra dağlarından alır. Akımıyla yeraltı, kar ve yağış sularından oluşur. Yaz mevsiminde kar ve yağmur suları nehirde taşkınlar meydana getirir.\\nOrtalama yıllık su tüketimi 13,6 kübik m / sn dir. Ortalama yıllık bağımlı getirmeler tüketimi 4,0 kg / sn, orta lillenməsi 290 g / küp m'dir. Suyu hidrokabonatlı-kalsiyumlu olmak üzere 300–500 mg / l minerallaşmaya sahiptir.\\nÇayın yatağında hacmi 112 küp m olan su deposu inşa edilmiştir. Qazax şehri üzerinde bulunmaktadır. Sulama işlerinde kullanılır."},{"page_url":"https://ru.wikipedia.org/wiki/221_%D0%BA%D0%BC_(%D0%BF%D0%BB%D0%B0%D1%82%D1%84%D0%BE%D1%80%D0%BC%D0%B0_%D0%91%D0%9C%D0%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/221_km_BMO_railway_platform_%28magnified_view_from_bridge_to_platform%29.JPG","page_title":"221 км (платформа БМО)","context_page_description":"221 километр — остановочный пункт / пассажирская платформа Большого кольца МЖД на участке Бекасово-1 — Кубинка-1. Находится на северо-востоке Наро-Фоминского городского округа Московской области.\\nПосле расширения Москвы в 2012 году это единственный остановочный пункт Большого кольца полностью в Наро-Фоминском городском округе. Следующая станция на север, Акулово — уже в Одинцовском районе, а на юг, Пожитково — на границе Троицкого округа Москвы и области.\\nПлатформа названа по расстоянию от станции Александров-1 согласно схеме отсчёта расстояний на Большом кольце.\\nСостоит из двух боковых платформ. Платформы низкие, длина на 1 вагон. Ранее, в 90-е годы, платформы были ещё короче.\\nУ северного конца западной платформы находится служебный заброшенный сарай с расписанием на нём. У южного конца восточной находится служебное строение КТСМ. К западу и востоку находятся частные дома/дачные участки. В 730 метрах на север находится автодорожный мост через пути, автодорога от Кубинского шоссе, которое проходит параллельно на западе, к полигону на востоке.\\nПлатформа обслуживается электропоездами Киевского направления МЖД депо ТЧ-20 Апрелевка. Останавливаются все проходящие электропоезда."},{"page_url":"https://ca.wikipedia.org/wiki/Baldomer_Gili_i_Roig","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Baldomer_Gili_i_Roig._Autoretrat_c._1900.jpg","page_title":"Baldomer Gili i Roig","context_page_description":"Baldomer Gili i Roig fou un destacat pintor i dibuixant català. Destacà com a gran paisatgista. Va ser diverses vegades president de la secció de pintura del Reial Cercle Artístic de Barcelona.\\nSi bé la pintura de figura és la temàtica que més singularitza l'obra de Baldomer Gili Roig dins el panorama artístic català a començaments de segle XX, el conreu del paisatge és, per altra banda, el gènere on aplica amb major decisió algunes de les petites llibertats tècniques que el distancien, moderadament, del tradicionalisme més acadèmic, i el tema que, sobretot en els darrers anys de la seva vida, anirà consolidant-se i prenen protagonisme a la pintura costumista.\\nAlguns autors consideren l'exposició que l'any 1918 fa a la Sala Parés de Barcelona com el punt d'inflexió a partir del qual Gili Roig supera l'anomenat realisme impressionista d'etapes anteriors i s'endinsa en el seu darrer període creatiu, caracteritzat per una nova visió del paisatge, on es fa evident la recuperació i l'aplicació d'un llenguatge pictòric diferent."},{"page_url":"https://id.wikipedia.org/wiki/Marcus_Ericsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Marcus_Ericsson_2014.jpg","page_title":"Marcus Ericsson","context_page_description":"Marcus Ericsson adalah pembalap mobil asal Swedia. Dia memulai debut di balap mobil pada tahun 2007. Pada musim 2014 ia membalap di arena F1 bersama tim Caterham. Sejak musim 2015 Ericsson membalap untuk tim Sauber."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%97%D7%A1%D7%99_%D7%99%D7%A4%D7%9F%E2%80%93%D7%A1%D7%9E%D7%95%D7%90%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/%E3%82%B5%E3%83%A2%E3%82%A2%E5%A4%A7%E4%BD%BF%E9%A4%A8%E3%81%8C%E5%85%A5%E5%B1%85%E3%81%99%E3%82%8B%E3%83%93%E3%83%AB%E5%85%A8%E6%99%AF.jpg","page_title":"יחסי יפן–סמואה","context_page_description":"יחסי יפן–סמואה הם היחסים הדיפלומטיים בין יפן לבין המדינה העצמאית של סמואה. שתי המדינות כוננו יחסים דיפלומטיים רשמיים בשנת 1973, כ-11 שנים לאחר עצמאותה של סמואה."},{"page_url":"https://pl.wikipedia.org/wiki/Kozom%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Kozom%C3%ADn_flag.jpg","page_title":"Kozomín","context_page_description":"Kozomín – wieś i gmina w Czechach, w powiecie Mielnik, w kraju środkowoczeskim. Według danych z dnia 1 stycznia 2013 liczyła 321 mieszkańców."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%9B%BC%E7%89%B9%E7%BD%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Mantras_caved_into_rock_in_Tibet.jpg","page_title":"曼特罗","context_page_description":"曼特罗，音译又做曼怛罗，译为真言、神咒、秘密语、梵颂，指据称能够“创造变化”的音、音节、词、词组、句子、段落。它们的用途与类型依照与曼特罗相关的学校和哲理而变化。曼特罗起源于印度吠陀传统，后来逐渐成为印度教的传统的重要组成部分，在佛教，锡克教和耆那教中也有用到。它常被用来祈福、消灾、驱魔等，但实际上不同教派之间曼特罗的用途、结构、重要性都存在差异，并不存在一种普世的曼特罗，对曼特罗的定义都充满了争议。"},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Po%C3%A7o","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Regi%C3%A3o_Metropolitana_de_Jo%C3%A3o_Pessoa.png","page_title":"Estação Poço","context_page_description":"A Estação Poço é uma das estações do Sistema de Trens Urbanos de João Pessoa, situada em Cabedelo, entre a Estação Jacaré e a Estação Jardim Manguinhos.\\nFoi inaugurada em 25 de março de 1889. Localiza-se na Rua Heriberto de Souza. Atende o bairro de Recanto Poço."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%93%D1%80%D1%8B%D0%B3%D0%BE%D1%80%D1%8B%D1%8E%D1%81_XVI","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Gregory_XVI.jpg","page_title":"Грыгорыюс XVI","context_page_description":"Грыгорыюс XVI, сьвецкае імя Барталямэо Альбэрта Капэльяры — папа рымскі з 2 лютага 1831 па 1 чэрвеня 1846 году. Меў кансэрватыўныя погляды і прытрымліваўся традыцыяў."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%80%D0%BE%D1%8D%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Massacre_at_Drogheda.jpeg","page_title":"Дроэда","context_page_description":"Дро́эда — портовый город в Ирландии. Находится в графстве Лаут в статусе боро на восточном побережье Ирландии в 56 километрах к северу от Дублина.\\nРека Бойн разделяла город на две равные части между графствами Лаут и Мит, пока городской совет в 1898 году не решил передать полностью город графству Лаут. В 1976 году районы разросшегося города в графстве Мит снова были переданы под юрисдикцию графства Лаут.\\nНа гербе города присутствует звезда и полумесяц в память о спасении города от голода тремя османскими кораблями с зерном, посланными турецким султаном Абдул-Меджидом I в помощь горожанам во время голода в Ирландии в 1845—1849 годах.\\nВ 1845 году в Ирландии начался Великий Голод, унёсший жизни более миллиона человек. Османский султан Абдул-Меджид объявил о своем намерении отправить ирландским фермерам 10 000 фунтов стерлингов, но королева Виктория попросила его отправить лишь 1000 фунтов, так как сама она отправила 2000. Султан именно так и поступил, однако втайне отправил ещё три судна с продовольствием. Несмотря на препятствование английских кораблей, «флотилия свободы» достигла порта и привезла продовольствие."},{"page_url":"https://uk.wikipedia.org/wiki/1945_%D1%83_%D0%B0%D0%B2%D1%96%D0%B0%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/F%C3%B6hn-Ger%C3%A4t.jpg","page_title":"1945 у авіації","context_page_description":"Хронологічний список подій у авіації за 1945 рік."},{"page_url":"https://sv.wikipedia.org/wiki/Stephen_Carr","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Stephencarrforwiki.png","page_title":"Stephen Carr","context_page_description":"Stephen Carr, född den 30 augusti 1976 i Dublin, är en irländsk före detta fotbollsspelare. Under sin karriär spelade han för Newcastle United, Tottenham Hotspur och Birmingham City. Han gjorde även 44 landskamper för det irländska landslaget."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9D%D0%B0%D1%9E%D0%B3%D0%B0%D1%80%D0%BE%D0%B4%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/%D0%A1%D1%82%D0%B0%D0%B2%D0%BE%D0%BA_-_panoramio_%2815%29.jpg","page_title":"Наўгародка","context_page_description":"Наўгародка — мястэчка ў Кіраваградзкай вобласьці Ўкраіны, на рацэ Камянка. Адміністрацыйны цэнтар Наўгародкаўскага раёну. Насельніцтва 5804 чал."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%A9%D7%A0%D7%A6%27%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Zesp%C3%B3%C5%82_ko%C5%9Bcio%C5%82a_par.p.w._Opieki_MB_w_Osi%C4%99cinach2_N._Chyli%C5%84ska.JPG","page_title":"אושנצ'ין","context_page_description":"אוֹשֶנצ'ין הוא כפר בפרובינציית קויאוויה-פומרניה שבמרכז פולין.\\nבכפר כיכר שוק גדולה, מספר מבנים עירוניים מהמאה ה-19, בית אחוזה, בית קברות, כנסייה בסגנון נאו-גותי שהוקמה באמצע המאה ה-19 ובניין שבו התקיים עד השואה בית כנסת."},{"page_url":"https://de.wikipedia.org/wiki/Audi_Sport_GmbH","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Audi_RS4%2C_IAA_2017%2C_Frankfurt_%281Y7A2886%29.jpg","page_title":"Audi Sport GmbH","context_page_description":"Die Audi Sport GmbH ist eine hundertprozentige Tochtergesellschaft der Audi AG. Das bis Ende 2016 quattro GmbH genannte Unternehmen wurde 1983 gegründet und ist seit 1996 eigenständig. Audi Sport ist dafür zuständig, jedes Audi-Modell – nicht nur sportlich – nach Kundenwunsch zu individualisieren. Bestimmte Ausstattungspakete werden S line, spezielle Fertigungen auch Audi exclusive genannt.\\nDas erste eigenständige Projekt der damaligen quattro GmbH war der Audi S6 Plus, welcher im März 1996 vorgestellt wurde. Sitz des Unternehmens ist in Neckarsulm."},{"page_url":"https://hu.wikipedia.org/wiki/Szent_Gy%C3%B6rgy-hegy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Common_rock_thrush.jpg","page_title":"Szent György-hegy","context_page_description":"A Szent György-hegy a Balaton-felvidék egyik jellegzetes tanúhegye, oldalán hatalmas bazaltoszlopok találhatók. Nevét az egykoron a lábánál állt Szent György-kápolnáról kapta, a heggyel kapcsolatos mondák egy része is összefonódik Szent György és a sárkány legendájával.\\nA hegy alapkőzete a Pannon-tenger üledékéből származik, melyre 3–4 millió évvel ezelőtt, vulkánkitörések sorozatával bazalt- és bazalttufa rétegek rakódtak. A környező pannon-üledék lepusztulásakor a bazaltsapka által védett terület kiemelkedett a környezetéből, melynek magassága így a korábbi felszínről tanúskodik.\\nNövényzete a 20. század közepéig jellemző intenzív tájhasználat következtében már nem sok nyomát őrzi az egykori őshonos állománynak, de a különleges talajviszonyok és a hegy fekvése miatt a kialakult élőhelytípusok tekintetében igen sokrétű. A hegy palástját sok helyen meghódították a tájidegen akácerdők, de a pusztafüves lejtősztyeppek, az erdősztyepprétek, a mészkerülő nyílt sziklagyepek illetve a kitett, bazaltsziklás területek állománya fajban gazdag."},{"page_url":"https://sv.wikipedia.org/wiki/Teresa_Ciep%C5%82y","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Teresa_Cieply.jpg","page_title":"Teresa Ciepły","context_page_description":"Teresa Barbara Ciepły, född den 19 oktober 1937 - död den 8 mars 2006, var en polsk friidrottare som under 1960-talet tävlade i häcklöpning och kortdistanslöpning.\\nCiepły deltog vid de Olympiska sommarspelen 1960 där hon sprang första sträckan i det polska stafettlag på 4 x 100 meter som slutade på tredje plats. Vid Europamästerskapen 1962 i Belgrad blev det totalt tre medaljer. Guld på både 80 meter häck och i stafett samt brons på 100 meter slätt.\\nNästa större mästerskap som hon deltog i var Olympiska sommarspelen 1964 i Tokyo där hon återigen sprang första sträckan i det polska lag som denna gång vann guld på 4 x 100 meter. Dessutom blev hon silvermedaljör på samma tid på 80 meter häck efter Karin Balzer."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E5%8E%9F%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Gwanghallu_Garden_%28Namwon%29.JPG","page_title":"南原市","context_page_description":"南原市は大韓民国全羅北道の南東部にある市である。東は慶尚南道に、南は全羅南道に接する。小白山脈の西側の高原地帯に開けた盆地の町で、蓼川に沿って広がり、市街のすぐ北には蛟竜山がそびえている。また智異山への玄関口でもある。古くから要害の地として城郭や都市が置かれてきたほか、春香伝の舞台としても知られる。"},{"page_url":"https://eu.wikipedia.org/wiki/Cascais","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Cascais_-_Portugal_011.jpg","page_title":"Cascais","context_page_description":"Cascais Portugalgo kontzejurik populatuenetarikoa da, Lisboako barrutian kokatuta dagoena. 2006ko erroldaren arabera, udalerriak 185.279 biztanle zituen.\\nBestalde, udalerri honetan Portugalgo turismogune garrantzitsuenetako bat den Estoril herria kokatzen da."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Football_League_mascots","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Philadelphia_Eagles_Super_Bowl_LII_Victory_Parade_%2840173332621%29.jpg","page_title":"List of National Football League mascots","context_page_description":"The following is a list of mascots of National Football League teams:"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_culturels_d%27importance_nationale_dans_le_canton_de_Fribourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Fountain_of_Loyalty_Fribourg_Aug_2010.jpg","page_title":"Liste des biens culturels d'importance nationale dans le canton de Fribourg","context_page_description":"Cette liste présente les biens culturels d'importance nationale dans le canton de Fribourg. Cette liste correspond à l'édition 2009 de l'Inventaire Suisse des biens culturels d'importance nationale pour le canton de Fribourg. Il est trié par commune et inclus : 205 bâtiments séparés, 14 collections, 18 sites archéologiques et un cas particulier."},{"page_url":"https://de.wikipedia.org/wiki/Trenton_(New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Old_Barracks%2C_South_Willow_Street%2C_Trenton_%28Mercer_County%2C_New_Jersey%29.jpg","page_title":"Trenton (New Jersey)","context_page_description":"Trenton ist die Hauptstadt des US-Bundesstaates New Jersey und der Verwaltungssitz des Mercer County. Bei der Volkszählung 2010 hatte die Stadt 84.913 Einwohner."},{"page_url":"https://nl.wikipedia.org/wiki/Miniklasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Subaru_Vivio_005.JPG","page_title":"Miniklasse","context_page_description":"De miniklasse is een autoklasse waarin de kleinste en goedkoopste auto's vallen. De Europese Commissie en autoverhuurbedrijven omschrijven deze klasse meestal als A-segment. Andere benamingen zijn: \\"submini\\" of \\"stadsauto\\". Een klasse hoger wordt compacte klasse genoemd."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%81%D9%8A%D8%AF_%D8%BA%D9%88%D8%B1%D8%AF%D9%88%D9%86_%D8%BA%D8%B1%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/David_Gordon_Green_%28cropped%29.jpg","page_title":"ديفيد غوردون غرين","context_page_description":"ديفيد غوردون غرين ‏ هو سينمائي أميركي أخرج أفلام دراما مثل جورج واشنطن, جميع الفتيات الحقيقيات وملائكة الثلج، بالإضافة إلى فيلم الإثارة تيار سفلي وقد كتب أو شارك في كتابة جميع هذه الأفلام. في عام 2008، انتقل إلى مجال الكوميديا، مخرجا الأفلام قطار الأناناس السريع و صاحب السمو، وكذلك حلقات مسلسل اتش بي او الكوميدي إيستباوند وداون. في عام 2013، عاد إلى جذوره الدرامية مخرجا فيلم السينما المستقلة الأمير أفالنش. منذ ذلك الحين، تنقل بين الدراما والكوميديا، مخرجا الأفلام جو، مانغلهورن وسمعتنا في أزمة، حلقات المسلسل التلفزيوني الكوميدي-الدرامي رد أوكس، الذي كان منتجه التنفيذي."},{"page_url":"https://nl.wikipedia.org/wiki/Aesch_(Z%C3%BCrich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Karte_Gemeinde_Aesch.png","page_title":"Aesch (Zürich)","context_page_description":"Aesch is een gemeente en plaats in het Zwitserse kanton Zürich, en maakt deel uit van het district Dietikon. Aesch telt 983 inwoners."},{"page_url":"https://es.wikipedia.org/wiki/Teucrium","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Teucrium_fruticans.JPG","page_title":"Teucrium","context_page_description":"Teucrium es un género de plantas de la familia Lamiaceae, de porte arbustivo o herbáceo, común en hábitats soleados tipo tomillar o formando parte del sotobosque e incluso empleado en jardinería. El género consta de 1090 taxones descritos, de los cuales unos 415 están aceptados, entre especies, subespecies, variedades, formas e híbridos.​ Muchos de estos taxones presentan una gran diversificación subespecífica. En la península ibérica crecen numerosas especies, muchas de las cuales son endemismos locales.​"},{"page_url":"https://eo.wikipedia.org/wiki/Abengourou","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Abengourou-history.jpg","page_title":"Abengourou","context_page_description":"Abengourou [abenguru] estas grandurbo kaj diocezo en Ebur-Bordo, en la samnona departemento."},{"page_url":"https://no.wikipedia.org/wiki/Khosrau_og_Shirin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/H%C3%BCsrev_and_Shirin.jpg","page_title":"Khosrau og Shirin","context_page_description":"Khosrau og Shirin er et epos fra ca år 1200, kjent fra den persiske dikter Nizāmi."},{"page_url":"https://es.wikipedia.org/wiki/Universidad_de_Beihang","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/BUAA_Old_Main_Building.jpg","page_title":"Universidad de Beihang","context_page_description":"La Universidad de Beihang, conocida también como Universidad de Aeronáutica y Astronáutica de Pekín es una universidad pública ubicada en Pekín, China.\\nLa BUAA fue fundada el 25 de octubre de 1952 en un campo de unas 100 hectáreas. Constituye una de las primeras universidades de China en cuanto a investigación y nivel de educación. Es conocida como una de las mejores universidades en el área de la ingeniería en China y tiene mucha influencia en la industria china de aeronáutica y astronáutica.​"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Fayette_County,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Roberts_Park_grounds%2C_Connersville.jpg","page_title":"National Register of Historic Places listings in Fayette County, Indiana","context_page_description":"This is a list of the National Register of Historic Places listings in Fayette County, Indiana.\\nThis is intended to be a complete list of the properties on the National Register of Historic Places in Fayette County, Indiana, United States. Latitude and longitude coordinates are provided for many National Register properties; these locations may be seen together in a map.\\nThere are 7 properties listed on the National Register in the county. Another property was once listed but has been removed.\\nProperties and districts located in incorporated areas display the name of the municipality, while properties and districts in unincorporated areas display the name of their civil township. Properties and districts split between multiple jurisdictions display the names of all jurisdictions.\\nThis National Park Service list is complete through NPS recent listings posted November 29, 2019."},{"page_url":"https://sv.wikipedia.org/wiki/Veulettes-sur-Mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Map_commune_FR_insee_code_76736.png","page_title":"Veulettes-sur-Mer","context_page_description":"Veulettes-sur-Mer är en kommun i departementet Seine-Maritime i regionen Normandie i norra Frankrike. Kommunen ligger i kantonen Cany-Barville som tillhör arrondissementet Dieppe. År 2009 hade Veulettes-sur-Mer 318 invånare."},{"page_url":"https://id.wikipedia.org/wiki/Tashi_Namgyal","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Tashi_Namgyal.jpg","page_title":"Tashi Namgyal","context_page_description":"Tashi Namgyal adalah Chogyal Sikkim yang memerintah dari 1914 sampai 1963. Ia adalah putra dari Thutob Namgyal.\\nNamgyal adalah penguasa dinasti Namgyal ke-11 dari Sikkim, yang menggantikan saudara tirinya Sidkeong Tulku Namgyal, yang memerintah dari Februari sampai Desember pada 1914, sampai kematiannya karena gagal jantung. Lahir di Tibet dan dimahkotai oleh Dalai Lama ke-13, Thubten Gyatso, ia merupakan seorang advokat kuat untuk hubungan dekat dengan India.\\nIa menikah pada Oktober 1918 dengan Kunzang Dechen, dan mereka memiliki 3 putra dan 3 putri. Putra sulungnya meninggal dalam sebuah kecelakaan pesawat pada Perang Dunia Dua. Pada kematiannya, ia digantikan sebagai Chogyal oleh putra keduanya Palden Thondup Namgyal.\\nPada masa pemerintahannya, ia dikenal karena reformasi lahan dan pemilihan bebas. Ia juga menjalin hubungan dekat antara Sikkim, India dan Tibet. Beberapa orang menuduh kematiannya disebabkan oleh agen-agen India.\\nSekitar satu dekade setelah kematiannya, putranya Palden Thondup Namgyal, Chogyal pewaris petana, secara resmi dilengserkan untuk digabung dengan Uni India."},{"page_url":"https://eu.wikipedia.org/wiki/Buckholts_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Buckholts.JPG","page_title":"Buckholts (Texas)","context_page_description":"Buckholts Texasko herri bat da. Milam konderrian kokatua dago. 2010ean 515 biztanle zituen, 3,43 kilometro koadrotan banatuta."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_Burgos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Palacio_de_Salda%C3%B1uela_02_by-dpc.jpg","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Burgos","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Burgos."},{"page_url":"https://sk.wikipedia.org/wiki/Valbonnais","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Map_commune_FR_insee_code_38518.png","page_title":"Valbonnais","context_page_description":"Valbonnais je francúzska obec, ktorá sa nachádza v departemente Isère, v regióne Rhône-Alpes."},{"page_url":"https://de.wikipedia.org/wiki/Rio-Niter%C3%B3i-Br%C3%BCcke","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Traffic_Rio-Niter%C3%B3i_Bridge.JPG","page_title":"Rio-Niterói-Brücke","context_page_description":"Die Rio-Niterói-Brücke, offiziell die Ponte Presidente Costa e Silva zu Ehren des brasilianischen Präsidenten, in dessen Amtszeit der Bau erfolgte, die aber vor Ort üblicherweise Ponte Rio-Niterói genannt wird, ist eine Straßenbrücke über die Guanabara-Bucht im brasilianischen Bundesstaat Rio de Janeiro. Sie verbindet die Stadt Rio de Janeiro mit der östlichen Nachbarstadt Niterói.\\nBei ihrer Eröffnung 1974 war die Brücke die zweitlängste Spannbetonbrücke der Welt und die stählernen Hohlkastenträger der Hauptbrücke gehörten zu den weltweit längsten. Die Brücke ist nach wie vor die längste Brücke Südamerikas."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Recorded_Texas_Historic_Landmarks_(Eastland-Gray)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Zapp_building_2008.jpg","page_title":"List of Recorded Texas Historic Landmarks (Eastland-Gray)","context_page_description":"The following is a partial list of Recorded Texas Historic Landmarks arranged by county as designated by the Texas Historical Commission and local county historical commissions in Texas. This page includes RTHLs in the following counties: Eastland, Ector, Edwards, El Paso, Ellis, Erath, Falls, Fannin, Fayette, Fisher, Floyd, Foard, Fort Bend, Franklin, Freestone, Frio, Gaines, Galveston, Garza, Gillespie, Glasscock, Goliad, Gonzales, and Gray.\\nKEY\\nLandmarks with multiple historic designations are colored according to their highest designation within the following hierarchy."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%85%D8%B9%D8%A9_%D8%AA%D9%8A%D8%A7%D9%86%D8%AC%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Peiyang_1900.jpg","page_title":"جامعة تيانجين","context_page_description":"جامعة تيانجين هي أول مؤسسة حديثة للتعليم العالي في الصين، تعد حاليا جامعة وطنية تحت الإدارة المباشرة لوزارة التعليم وأيضا جامعة صينية مزدوجة من الدرجة الأولى في الصين. تأسست الجامعة في عام 1895 باسم جامعة تيانجين أو جامعة تيانجين الامبراطورية ولاحقا جامعة بيانغ.\\nفي عام 1951، بعد إعادة الهيكلة تم تغيير اسمها إلى جامعة تيانجين، وأصبحت واحدة من أكبر جامعات الهندسة متعددة التخصصات في الصين. كانت الجامعة واحدة من أول 16 جامعة معتمدة من قبل الدولة في عام 1959. كما تعد أيضا من بين أول مجموعة من مؤسسات التعليم العالي المنخرطة في \\"مشروع 211\\" الوطني الذي يعطيها الأولوية في مجال البناء.\\nمن أجل تنفيذ \\"خطة عمل إعادة تنشيط التعليم للقرن الحادي والعشرين\\" وقعت وزارة التربية والتعليم وبلدية تيانجين في أواخر عام 2000 اتفاقية تهدف إلى بناء جامعة تيانجين لتصبح جامعة من الدرجة الأولى في العالم في القرن الحادي والعشرين."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Bredbury_and_Romiley","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Arden_Hall_-_geograph.org.uk_-_44224.jpg","page_title":"Listed buildings in Bredbury and Romiley","context_page_description":"Bredbury and Romiley are towns in the Metropolitan Borough of Stockport, Greater Manchester, England. The towns, together with the area of Woodley and the village of Compstall and the surrounding countryside, contain 43 listed buildings that are recorded in the National Heritage List for England. Of these, two are listed at Grade II*, the middle grade, and the others are at Grade II, the lowest grade.\\nMost of the oldest listed buildings that date from before the Industrial Revolution are houses, farm houses and farm buildings, together with a chapel and a public house. The Peak Forest Canal which passes through the area helped to bring industry, in particular the textile industry. The listed building associated with the canal include bridges, an aqueduct, and the entrances to Woodley Tunnel. Two cotton mills, now used for other purposes, have survived and are listed, and the other listed buildings include churches, a bridge, and two war memorials."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/1801_Antoine-Jean_Gros_-_Bonaparte_on_the_Bridge_at_Arcole.jpg","page_title":"Наполеон I Бонапарта","context_page_description":"Наполеон I Бонапарта је био генерал у Француској револуцији и као вођа био је први конзул Француске Републике од 11. новембра 1799. до 18. маја 1804. и цар Француске и краљ Италије од 18. маја 1804. до 6. априла 1814. и онда поново на кратко од 20. марта до 22. јуна 1815.\\nНаполеон је рођен на Корзици, које је Ђенова због дугова само годину дана пре његовог рођења Италија уступила Француској. Потицао је из скромне племићке породице као друго од осморо деце. Био је веома несташан, тврдоглав и одлучан, па га је мајка са пет година послала у школу за девојчице како би он постао послушнији, што се ипак није десило. Касније је уписан у војну школу у којој се истицао из математике из историје. Језици му нису били јача страна, а француски никад није научио да пише правилно и говорио је јаким корзијанским акцентом. Имао је само 14 година када је преузео дужност артиљеријског потпоручника, од када му је каријера била у сталном успону. Женио се два пута и имао је бројне љубавнице. Прву жену, Жозефину Боарне, од њега старију 6 година са којом није имао деце, упознао је на свечаном балу и био је очаран њеном лепотом."},{"page_url":"https://fr.wikipedia.org/wiki/Place_de_l%27Universit%C3%A9_(Bucarest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bucuresti%2C_Romania%2C_Piata_Universitatii%2C_BCR%2C_B-II-m-A-18675%2C_%28Dec._2013%29_%283%29.JPG","page_title":"Place de l'Université (Bucarest)","context_page_description":"La place de l'Université est une place située dans le centre-ville de Bucarest."},{"page_url":"https://en.wikipedia.org/wiki/Ingvar_Fredrik_H%C3%A5kansson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Ingvar_H%C3%A5kansson.jpg","page_title":"Ingvar Fredrik Håkansson","context_page_description":"Ingvar Fredrik Håkansson was a Swedish volunteer fighter pilot in the Royal Air Force during the Second World War. Since Sweden was neutral in the war, Håkansson was one of few Swedes that served in RAF."},{"page_url":"https://uk.wikipedia.org/wiki/FOXN3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/PBB_GE_CHES1_205022_s_at_fs.png","page_title":"FOXN3","context_page_description":"FOXN3 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 14-ї хромосоми. Довжина поліпептидного ланцюга білка становить 490 амінокислот, а молекулярна маса — 53 835.\\nКодований геном білок за функціями належить до репресорів, фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як транскрипція, регуляція транскрипції, клітинний цикл, альтернативний сплайсинг.\\nБілок має сайт для зв'язування з ДНК.\\nЛокалізований у ядрі."},{"page_url":"https://da.wikipedia.org/wiki/MGMT","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/MGMT_a.jpg","page_title":"MGMT","context_page_description":"MGMT er en amerikansk psykedelisk rockduo bestående af Ben Goldwasser og Andrew VanWyngarden fra Brooklyn. De startede gruppen på Wesleyan University i Middletown, Connecticut i 2005.\\nDe er i Danmark især kendt for singlerne Time To Pretend, Electric Feel og Kids. De spillede på Amager Bio. De fik deres gennembrud med albummet Oracular Spetacular fra 2007, men havde inden udgivet EP'en Time To Pretend i 2005 med tidlige udgaver af numrene Time To Pretend og Kids som kan findes på Oracular Spetacular.I foråret i år 2010 udgav de Congratulations, som er meget 60'er og 70'er inspireret. Dog har albummet fået en del kritik. 4. december spillede de i Vega i København."},{"page_url":"https://fr.wikipedia.org/wiki/101e_r%C3%A9giment_d%27infanterie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/INFANTERIE_-_101e_R.I.jpg","page_title":"101e régiment d'infanterie","context_page_description":"Le 101ᵉ régiment d'infanterie est un régiment d'infanterie de l'Armée de terre française créé sous la Révolution à partir du régiment Royal-Liégeois, un régiment français d'Ancien Régime."},{"page_url":"https://en.wikipedia.org/wiki/Public_research_and_development","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Fig.1_Public_and_business_R%26D-_2008-2015.png","page_title":"Public research and development","context_page_description":"Public research and development refers to the R&D activities related to public sectors, including governments, colleges and non-profit organizations. Public R&D include academic fundamental research, applied research and R&D grants and contracts to private sectors, where later two are known as 'R&D subsidy'. Public R&D could be understood as a funder or a performer of an R&D activity. According to National Science Foundation in U.S., in 2015, R&D expenditures performed by federal governments, local governments, colleges and non-profit organizations are 54, 0.6, 64, and 20 billions of dollars, respectively. Meanwhile, industries perform R&D expenditures of 356 billion dollars. Moreover, R&D expenditures funded by federal governments, local governments, colleges and non-profit organizations are 121, 4.3, 17, and 19 billions of dollars, respectively. R&D expenditures funded by industries are 333 billion dollars. In terms of R&D funders, public R&D to private R&D ratio is about 0.5."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D1%88%D0%BB%D1%8F%D1%85_%D0%A2_1419","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/%D0%9C%D1%96%D1%81%D1%82_%D1%87%D0%B5%D1%80%D0%B5%D0%B7_%D0%A1%D0%B2%D1%96%D1%87%D1%83.jpeg","page_title":"Автошлях Т 1419","context_page_description":"Автошлях Т 1419 — автомобільний шлях територіального значення у Львівській та Івано-Франківській областях. Проходить територією Миколаївського, Жидачівського та Калуського районів через Миколаїв — Розділ — Жидачів — Журавно — Калуш. Загальна довжина — 64 км."},{"page_url":"https://en.wikipedia.org/wiki/Apiwat_Ueathavornsuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Apiwat_Eurthavornsuk_from_BBA_Charity_Concert%2C_2016.jpg","page_title":"Apiwat Ueathavornsuk","context_page_description":"Apiwat Ueathavornsuk, nicknamed Stamp, is a Thai singer-songwriter."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_municipalit%C3%A9s_du_Mississippi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Map_of_Mississippi_NA.png","page_title":"Liste des municipalités du Mississippi","context_page_description":"L'État américain du Mississippi est divisé en 299 municipalités, qui ont le statut de city, de town ou de village."},{"page_url":"https://en.wikipedia.org/wiki/Pabilgagaltuku","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Near_East_non_political.png","page_title":"Pabilgagaltuku","context_page_description":"Pabilgagaltuku, also Pabilgeshgaltuku was Governor of Umma, a city-state in Sumer, circa 2450 BCE. He was captured by Ur-Nanshe of Lagash. His successor was Ush, king of Umma.\\nPabilgagaltuku is known from an inscription of Ur-Nanshe, in which Ur-Nanshe claims that he defeated Umma and captured Pabilgagaltuku:\\npabilgax-gal-tuku ensi2 ummaki mu-dab5\\n“He seized Pabilgagaltuku, the governor of Umma.”\\n— Inscription of Ur-Nanshe.\\nPabilgagaltuku may also be mentioned in the Stele of Vultures, as having been vanquished in the past by Ur-Nanshe."},{"page_url":"https://vec.wikipedia.org/wiki/Gr%C3%A9ez-sur-Roc","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Gr%C3%A9ez-sur-Roc%2C_Sarthe%2C_Fr%2C_mairie_%282%29.JPG","page_title":"Gréez-sur-Roc","context_page_description":"Gréez-sur-Roc el xé on comun de 332 abitanti del departemento de Sarthe che el fa parte del rejon Pays de la Loire in Fransa."},{"page_url":"https://ms.wikipedia.org/wiki/Gawang","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Basketball_goal.jpeg","page_title":"Gawang","context_page_description":"Gawang ialah struktur jaring fizikal besar yang menangkap alat diperlumbakan semasa dua pasukan dalam suatu sukan berpasukan lalu meraih mata sesebuah pasukan. Contoh sukan dan permainan yang mengenal istilah ini ialah bola sepak, hoki, hoki ais, polo air, bola jaring dan bola keranjang."},{"page_url":"https://fr.wikipedia.org/wiki/Wallons_de_Su%C3%A8de","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Str%C3%B6msberg_bruks_j%C3%A4rnst%C3%A4mpel.jpg","page_title":"Wallons de Suède","context_page_description":"L'histoire des Wallons de Suède est initiée par Guillaume de Bèche et Louis De Geer, connu comme le « père de l’industrie suédoise » du fer. Cinq à dix mille Wallons émigrèrent alors en Suède, travaillant principalement dans l'industrie de l'acier. Dans les années 1920, ils sont proposés comme modèle mythique aux travailleurs suédois par les syndicalistes."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%99%D7%9E%D7%91%D7%95%D7%A7%D7%98%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Djingareiber_cour.jpg","page_title":"טימבוקטו","context_page_description":"טימבוקטו היא עיר במרכז מאלי שבצפון-מערב אפריקה, ובירת מחוז טימבוקטו. העיר נמצאת בקצה הדרומי של מדבר סהרה, באזור של ביצות ומדבריות, כ-15 ק\\"מ צפונית לנהר ניז'ר. בשנת 2009 הוערכה אוכלוסיית העיר בכ-54,453 תושבים.\\nטימבוקטו נוסדה במאה ה-11 והייתה נקודת מסחר חשובה על נתיב המסחר שחצה את הסהרה מצפון לדרום, ועל נתיב הסחר לאורך נהר ניז'ר ממזרח למערב. היא נודעה באוניברסיטת סנקור ובמדרסות ששכנו בה כבר במאה ה-15, והיא הייתה מרכז לימודי חשוב להפצת האסלאם במערב אפריקה. בשנת 1591 הצבא בראשות אחמד אל-מנסור, מלך מרוקו כבש ובזז את העיר. העיר עברה לשליטה של מרוקו ונכנסה לתקופה ארוכה של דעיכה.\\nבעיר שוכנים שלושה מסגדים ידועים - ג'ינגרבר, סנקור וסידי יאהיה.\\nטימבוקטו נחשבה תמיד לעיר נידחת ואפופת מסתורין, והייתה יעד מבוקש על ידי נוסעים מערביים. רבים מהנוסעים לא הצליחו להגיע לעיר ונהרגו על ידי השבטים הנוודים שבאזור. המושג טימבוקטו משמש עד היום לתיאור מקום נידח בסוף העולם. בשנת 1990 הכריז אונסק\\"ו על העיר כאתר מורשת עולמית והכין תוכניות לשימורה. ב-2007 העיר הייתה מועמדת לשבעת פלאי תבל החדשים אך לבסוף לא נכללה ברשימה. לבקשת ממשלת מאלי בשנת 2012, נכללה העיר ברשימת אתרי המורשת העולמית הנמצאים בסיכון בשל המאבק המזוין בצפון המדינה."},{"page_url":"https://en.wikipedia.org/wiki/Spree","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Sprjewja_w_Po%C5%82picy_1.JPG","page_title":"Spree","context_page_description":"The Spree is a river that flows through the Saxony, Brandenburg and Berlin states of Germany, and in the Ústí nad Labem region of the Czech Republic. Approximately 400 kilometres in length, it is a left bank tributary of the River Havel, which itself flows into the Elbe and then the North Sea. It is the river on which the original centre of Berlin was built.\\nThe reach of the river between the Dämeritzsee and Müggelsee to the east of Berlin is known as the Müggelspree."},{"page_url":"https://de.wikipedia.org/wiki/Hasegawa_Toshiyuki","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Hasegawa_Cafe_Paulista.jpg","page_title":"Hasegawa Toshiyuki","context_page_description":"Hasegawa Toshiyuki war ein japanischer Dichter und Maler der Taishō- und Shōwa-Zeit."},{"page_url":"https://fr.wikipedia.org/wiki/Atacora","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/%C3%89l%C3%A9phants.JPG","page_title":"Atacora","context_page_description":"L'Atacora est un département situé au nord-ouest du Bénin. Il est limitrophe du Togo à l'ouest et du Burkina Faso au nord, ainsi que des départements béninois de l'Alibori, du Borgou et de la Donga. En 1999, la partie méridionale de l'Atacora en a été détachée pour former le nouveau département de la Donga."},{"page_url":"https://it.wikipedia.org/wiki/Basilica_di_Santa_Maria_Gloriosa_dei_Frari","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Frari_%28Venice%29_-_Coro_dei_Frati_-_Right_organ_by_Gaetano_Callido.jpg","page_title":"Basilica di Santa Maria Gloriosa dei Frari","context_page_description":"La basilica di Santa Maria Gloriosa dei Frari, comunemente detta solo i Frari, è la più grande delle chiese di Venezia e ha ricevuto nel 1926 da papa Pio XI il titolo di basilica minore.\\nÈ situata nell'omonimo Campo dei Frari, nel sestiere di San Polo, ed è dedicata all'Assunzione di Maria.\\nLa pianta è a croce latina, e lo stile è gotico veneziano in cotto e pietra d'Istria. Possiede tre navate con archi ogivali che poggiano su sei colonne per lato tra loro collegate da catene rivestite da casse lignee. Misura 102 metri di lunghezza, 48 metri nel transetto ed è alta 28 metri. Oggi ha 17 altari monumentali e al suo interno sono custodite molte opere d'arte, tra cui due dipinti del Tiziano. Ospita, inoltre, tombe e monumenti funebri di numerose personalità legate a Venezia, tra cui Claudio Monteverdi, lo stesso Tiziano, Antonio Canova, oltre a numerosi dogi.\\nÈ l'unica importante chiesa italiana ad aver conservato un grande coro circondato da un alto muro al termine della navata centrale in posizione antistante all'altare maggiore, secondo l'uso medievale."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%DB%8C%D9%88%D9%86%DB%8C%D8%8C_%D8%A7%DB%8C%D9%84%DB%8C%D9%86%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Kewanee_Ill_09.jpg","page_title":"کیونی، ایلینوی","context_page_description":"کیونی، ایلینوی آمریکانین ایلینوی ایالتیندا یئر آلان بیر شهردیر و ۱۷٫۴۲ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۱۲۹۱۶ نفر و اها‌لی سیخلیغی ۷۱۶٫۵ اینسان کیلومتر موربّع دیر. بۇ شهر ۲۴۴ متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%AD%E9%9A%8E%E5%85%AB%E9%82%8A%E5%BD%A2%E9%91%B2%E5%B5%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/H2_tiling_288-2.png","page_title":"六階八邊形鑲嵌","context_page_description":"在幾何學中，六階八邊形鑲嵌是由八邊形組成的雙曲面正鑲嵌圖，每六個八邊形共用一個頂點。在施萊夫利符號用{8,6}表示。六階八邊形鑲嵌即每個頂點皆為六個八邊形的公共頂點，頂點周圍包含了六個不重疊的八邊形，一個八邊形內角135度，六個八邊形超過了360度，因此無法因此無法在平面作出，但可以在雙曲面上作出。"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B5%E0%A4%BE%E0%A4%B3%E0%A5%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/CoralPinkSandDunesSand.JPG","page_title":"वाळू","context_page_description":"वाळू हा दीर्घकालीन नैसर्गिक प्रक्रियेने तयार होणारा पर्यावरणातील एक महत्वाचा घटक आहे. पाण्याच्या प्रवाहामुळे खडकाच्या घर्षणातून बारीक बारीक तुकडे होण्याची प्रक्रिया नदीमध्ये सतत सुरु असते. वाळूच्या कणांचा आकार ०.०६२५ मिमी ते २ मिमी व्यास या दरम्यान असतो. वाळूचा समावेश भारतात 'गौण खनिज' या वर्गात केला जातो. याच्या वापरासाठी वेगवेगळे नियम व कायदे केले गेले आहेत."},{"page_url":"https://en.wikipedia.org/wiki/Bust_of_a_Man_Wearing_a_Gorget_and_Plumed_Beret","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rembrandt_-_Man_Wearing_a_Plumed_Beret_and_Gorget.jpg","page_title":"Bust of a Man Wearing a Gorget and Plumed Beret","context_page_description":"Bust of a Man Wearing a Gorget and Plumed Beret is a 1626/7 oil on panel painting by Rembrandt. It measures 39.8 by 29.4 centimetres and is held in a private collection. It is believe to be the earliest extant single figure painting by Rembrandt.\\nThe work is dated to around 1626/27, when Rembrandt was in his early twenties working in Leiden. X-ray analysis shows that it was painted over an earlier work depicting the head of an old man.\\nThe identity of the subject is not known, but it is believed to be a character study or \\"tronie\\" of a historical character, wearing costume - gorget and cap with feather plume - fashionable in the 15th century, possibly inspired by a woodcut print of a lansquenet.\\nThe subject is depicted in a pose typical of Rembrandt's work, with the subject looking over the left shoulder. It uses an exaggerated fall of light, creating bright highlights and deep shadows, perhaps inspired by Caravaggio.\\nThe early history of the painting is not known with much certainty. It may have been held by Leo Nardus. It was acquired by Heinrich Baron Thyssen-Bornemisza around 1929, and displayed at Schloss Rohoncz at Rechnitz and later at Villa Favorita in Lugano."},{"page_url":"https://de.wikipedia.org/wiki/Sandlaufk%C3%A4fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Tiger_beetle_formosa.jpg","page_title":"Sandlaufkäfer","context_page_description":"Die Sandlaufkäfer, in älteren Texten auch Sandkäfer genannt, sind eine Unterfamilie innerhalb der Familie der Laufkäfer. Sie sind weltweit mit über 2300 Arten in 130 Gattungen verbreitet. In Europa kommen sie mit 121 Arten und Unterarten vor, In Mitteleuropa sind 12 Arten bekannt. Von manchen Systematikern werden die Sandlaufkäfer als eigene Familie gesehen. Im südlichen Europa wird diese Gruppe schnell artenreicher."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A4%E0%B8%94%E0%B8%B9%E0%B8%9E%E0%B8%B2%E0%B8%A2%E0%B8%B8%E0%B9%84%E0%B8%8B%E0%B9%82%E0%B8%84%E0%B8%A5%E0%B8%99%E0%B8%A0%E0%B8%B9%E0%B8%A1%E0%B8%B4%E0%B8%A0%E0%B8%B2%E0%B8%84%E0%B8%AD%E0%B8%AD%E0%B8%AA%E0%B9%80%E0%B8%95%E0%B8%A3%E0%B9%80%E0%B8%A5%E0%B8%B5%E0%B8%A2_%E0%B8%9E.%E0%B8%A8._2562%E2%80%932563","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/TL_09U_2020-03-11_0620Z.jpg","page_title":"ฤดูพายุไซโคลนภูมิภาคออสเตรเลีย พ.ศ. 2562–2563","context_page_description":"ฤดูพายุไซโคลนภูมิภาคออสเตรเลีย พ.ศ. 2562–2563 เป็นฤดูกาลในอดีตที่มีการก่อตัวของพายุหมุนเขตร้อน ภายในมหาสมุทรอินเดียและมหาสมุทรแปซิฟิก ที่ระหว่าง 90°ตะวันออก ถึง 160°ตะวันออก โดยฤดูกาลนี้ได้เริ่มนับอย่างเป็นทางการ ในวันที่ 1 พฤศจิกายน พ.ศ. 2562 และไปสิ้นสุดในวันที่ 30 เมษายน พ.ศ. 2563 อย่างไรก็ตาม พายุหมุนเขตร้อนสามารถก่อตัวได้ตลอดเวลาตั้งแต่ 1 กรกฎาคม พ.ศ. 2562 ถึง 30 มิถุนายน พ.ศ. 2563 และจะถูกนับรวมในฤดูกาลนี้ด้วย ในระหว่างฤดูกาล พายุหมุนเขตร้อนจะถูกติดตามอย่างเป็นทางการโดยสำนักอุตุนิยมวิทยาออสเตรเลีย, สำนักอุตุนิยมวิทยา สภาพภูมิอากาศ และธรณีฟิสิกส์แห่งอินโดนีเซีย ในจาการ์ตา ประเทศอินโดนีเซีย และศูนย์บริการสภาพอากาศแห่งชาติปาปัวนิวกินี ในพอร์ตมอร์สบี ส่วนศูนย์เตือนไต้ฝุ่นร่วมของกองทัพเรือสหรัฐ ในรัฐฮาวาย สหรัฐ และศูนย์บริการทางอุตุนิยมวิทยาแห่งชาติอื่น ๆ ประกอบด้วย เมทเซอร์วิซแห่งประเทศนิวซีแลนด์, เมเตโอ-ฟร็องส์แห่งประเทศฝรั่งเศสบนเกาะเรอูนียง และกรมอุตุนิยมวิทยาฟีจี ก็ต่างเฝ้าติดตามส่วนของแอ่งในระหว่างฤดูกาลด้วยแบบไม่เป็นทางการ"},{"page_url":"https://en.wikipedia.org/wiki/Climbing_formwork","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Takapuna_Sentinel_Building_Construction.jpg","page_title":"Climbing formwork","context_page_description":"Climbing formwork is a special type formwork for vertical concrete structures that rises with the building process. While relatively complicated and costly, it can be an effective solution for buildings that are either very repetitive in form or that require a seamless wall structure.\\nVarious types of climbing formwork exist, which are either relocated from time to time, or can even move on their own."},{"page_url":"https://de.wikipedia.org/wiki/Doktorwerder","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Hann_M%C3%BCnden_Schl%C3%B6sschen_auf_dem_Doktorwerder_um_1850.jpg","page_title":"Doktorwerder","context_page_description":"Der Doktorwerder ist eine Flussinsel der Werra am Rande der Innenstadt von Hann. Münden in Südniedersachsen. Er liegt unmittelbar vor dem Zusammenfluss von Werra und Fulda zur Weser. Der als Parkanlage gestaltete Werder ist über die Alte Werrabrücke zugänglich."},{"page_url":"https://vi.wikipedia.org/wiki/H%E1%BB%93_Eyre","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Lake_eyre_basin_map.png","page_title":"Hồ Eyre","context_page_description":"Trong những lúc có nước đầy, hồ Eyre là hồ lớn nhất tại Úc và có vị trí thấp nhất ở nước này, có cao độ vào khoảng 15 m dưới mực nước biển. Hồ này là trọng điểm của lòng chảo nội lục của Lưu vực hồ Eyre rộng lớn ở miền trung Úc.\\nHồ này có chu kỳ nước đầy rồi cạn khoảng mỗi 3 năm. Do đó, diện tích mặt nước hồ không cố định, dao động 0–8.200 km², phụ thuộc vào nước mưa. Khi mưa nhiều, mặt nước hồ cao so với mặt biển 15 mét và chiếm diện tích hơn 8.000 km², khi hồ cạn, mặt đáy hồ lộ ra một lớp muối khá dày. Quanh hồ này, có hình thành khu Vườn quốc gia hồ Eyre."},{"page_url":"https://lt.wikipedia.org/wiki/Perlejevas","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Church_in_Perlejewo_2.jpg","page_title":"Perlejevas","context_page_description":"Perlejevas – kaimas Lenkijos šiaurės rytuose, Perlejevo valsčiuje, Semiatičės apskrityje, Palenkės vaivadijoje. Kaimas yra apie 26 km į šiaurės vakarus nuo Semiatičės ir apie 74 km į pietvakarius nuo vaivadijos centro Balstogės. Šalia kaimo teka Pelchuvkos upė. Nuo XIII–XIV a. iki 1569 m. Liublino unijos priklausė Lietuvos Didžiajai kunigaikštystei. 1407 m. įkurta Perlejevo Viešpaties Atsimainymo parapija. XIX a. pabaigoje kaime buvo 24 namai ir 120 gyventojų, iš kurių 56 vyrai ir 64 moterys."},{"page_url":"https://en.wikipedia.org/wiki/Court_House,_Arlington,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Clarendon-courthouse_03.jpg","page_title":"Court House, Arlington, Virginia","context_page_description":"Court House, also known as Courthouse, is a transit-oriented neighborhood in Arlington County, Virginia. It is centered around the Court House stop on the Orange Line and the Silver Line of the Washington Metro.\\nAlthough Arlington is so geographically small that it does not have component towns or cities, the Courthouse neighborhood is sometimes referred to as county seat, as it is home to the primary county government administrative complex as well as a justice center consisting of a jail, courthouse and police HQ. Indeed, the neighborhood gets its name from the governmental uses that call it home.\\nThe neighborhood consists of high-rise residential and business buildings including offices of PAE and an 8-screen AMC movie theater. It is home to more than 25 bars and restaurants, ranging from informal lunch take-out spots, to a venue for local bands, to upscale Latin and Thai evening establishments.\\nCourthouse also features one of the first garden-style apartments complexes built in the United States. Built in the 1930s, Colonial Village consists of private condos, co-op housing, and apartments for rent and is listed on the National Register of Historic Places."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E8%89%AF%E7%A5%9E%E7%A4%BE_(%E9%A4%A8%E6%9E%97%E5%B8%82%E6%96%B0%E5%AE%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Torii_at_Nagara_Shrine%2C_Shinjuku%2C_Tatebayashi.jpg","page_title":"長良神社 (館林市新宿)","context_page_description":"長良神社は群馬県館林市新宿1丁目にある神社。旧社格は村社。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B5%E0%B4%A3%E0%B5%8D%E0%B4%9F%E0%B5%BC_%E0%B4%B2%E0%B4%BE,_%E0%B4%95%E0%B5%8A%E0%B4%9A%E0%B5%8D%E0%B4%9A%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Veegaland_awards.JPG","page_title":"വണ്ടർ ലാ, കൊച്ചി","context_page_description":"കൊച്ചിക്കടുത്ത് പള്ളിക്കരയിലെ കുന്നിൻ മുകളിൽ സ്ഥിതിചെയ്യുന്ന അമ്യുസ്മെന്റ്റ്‌ പാർക്കാണ് വണ്ടർ ലാ. വണ്ടർ ലായുടെ പഴയ പേരാണ് വീഗാലാൻഡ്‌. ജോസഫ് ജോൺ ആണ് ഇതു രൂപകല്പന ചെയ്തത്. കൊച്ചിയിൽ നിന്നും 15 കിലോമീറ്റർ ദൂരത്തിലാണ് വീഗാലാൻഡ് സ്ഥിതിചെയ്യുന്നത്. വ്യവസായ പ്രമുഖൻ കൊച്ചൗസേഫ് ചിറ്റിലപ്പിള്ളിയാണ് വീഗാലാൻഡിന്റെ സ്ഥാപകൻ."},{"page_url":"https://en.wikipedia.org/wiki/Victor_Nehlig","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Nehlig-selfportrait.jpeg","page_title":"Victor Nehlig","context_page_description":"Victor Nehlig was a French-American painter."},{"page_url":"https://fr.wikipedia.org/wiki/A%C3%A9roport_de_T%C3%A9h%C3%A9ran-Mehrabad","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%DB%8C%DA%A9%DB%8C_%D8%A7%D8%B2_%D9%BE%D8%A7%D8%B1%DA%A9%DB%8C%D9%86%DA%AF%E2%80%8C%D9%87%D8%A7%DB%8C_%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D9%85%D9%87%D8%B1%D8%A2%D8%A8%D8%A7%D8%AF.jpg","page_title":"Aéroport de Téhéran-Mehrabad","context_page_description":"L'aéroport de Téhéran-Mehrabad est un aéroport international situé dans la ville de Téhéran, en Iran. Il demeure le premier aéroport de Téhéran mais la plupart des vols internationaux utilisent maintenant l'aéroport Imam-Khomeini, achevé en 2004. Contrairement à ce dernier, il est situé dans la ville. Il est principalement utilisé pour les vols intérieurs.\\nIl est accessible depuis la ligne de métro numéro 4."},{"page_url":"https://nn.wikipedia.org/wiki/Cottbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Cottbus_07-2017_img23_Altmarkt.jpg","page_title":"Cottbus","context_page_description":"Cottbus er ein by i Tyskland og i delstaten Brandenburg med om lag 100 000 innbyggjarar. Han ligg rundt 125 km søraust for Berlin ved elva Spree."},{"page_url":"https://sv.wikipedia.org/wiki/Amata_polymita","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Amata_polymita.jpg","page_title":"Amata polymita","context_page_description":"Amata polymita är en fjärilsart som beskrevs av Sparrm. 1769. Amata polymita ingår i släktet Amata och familjen björnspinnare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Linz-Innenstadt/A%E2%80%93K","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Dinghoferstra%C3%9Fe_4.JPG","page_title":"Liste der denkmalgeschützten Objekte in Linz-Innenstadt/A–K","context_page_description":"Die Liste der denkmalgeschützten Objekte in Linz-Innenstadt enthält die 380 denkmalgeschützten, unbeweglichen Objekte der Linzer Katastralgemeinde Linz, die dem bis 2013 bestehenden Stadtteil Innenstadt entspricht. Der jetzige statistische Bezirk Innere Stadt ist gegenüber dem alten Stadtteil verkleinert, einige Objekte befinden sich daher in den Bezirken Froschberg oder Kaplanhof.\\nDie Liste ist zweigeteilt. Dieser Teil listet alle Objekte, deren Standort mit den Buchstaben A–K beginnt. Der zweite Teil listet alle Objekte, deren Standort mit den Buchstaben L–Z beginnt."},{"page_url":"https://pt.wikipedia.org/wiki/The_Flatliners","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/The_Flatliners.jpg","page_title":"The Flatliners","context_page_description":"The Flatliners é uma banda de punk rock de Richmond Hill e Brampton, Ontário, Canadá. Atualmente a banda é formada por Chris Cresswell, Scott Brigham, Jon Darbey e Paul Ramirez.\\nDesde a sua formação em 2002, a banda tem sido uma influência crescente no movimento punk e ska de Toronto, bem como outras áreas da área da Grande Toronto. Atualmente eles tem contrato com a Fat Wreck Chords."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D0%B8%D0%B3%D0%B0%D0%BA%D0%B8_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ishigaki_ryu.jpg","page_title":"Исигаки (остров)","context_page_description":"Исига́ки — остров в островной группе Яэяма островов Сакисима архипелага Рюкю.\\nВместе с островами Сенкаку образует административный округ Исигаки в составе уезда Яэяма префектуры Окинава, Япония."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Bad_Muskau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Muskau-Jungfernberg-10.jpg","page_title":"Liste der Kulturdenkmale in Bad Muskau","context_page_description":"In der Liste der Kulturdenkmale in Bad Muskau sind sämtliche Kulturdenkmale der sächsischen Stadt Bad Muskau verzeichnet, die bis 1. September 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Lede","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Station_Lede_-_Foto_5_%282009%29.png","page_title":"Gare de Lede","context_page_description":"La gare de Lede est une gare ferroviaire belge de la ligne 50, de Bruxelles-Nord à Gand-Saint-Pierre, située sur le territoire de la commune de Lede, dans la province de Flandre-Orientale en région flamande.\\nÉdifiée par la Compagnie du chemin de fer de Dendre-et-Waes et de Bruxelles vers Gand par Alost, elle est mise en service en 1856 par l'administration des chemins de fer de l'État belge. C'est une gare de la Société nationale des chemins de fer belges desservie par des trains InterCity, et Heure de pointe."},{"page_url":"https://nl.wikipedia.org/wiki/Zygmunt_Szczesny_Felinski","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Zygmunt_Szcz%C4%99sny_Feli%C5%84ski_07.jpg","page_title":"Zygmunt Szczesny Felinski","context_page_description":"Zygmunt Szczesny Felinski was een Pools aartsbisschop.\\nFeliński studeerde wiskunde in Moskou en Parijs en werd in 1855 tot priester gewijd in Oekraïne. Hij stichtte in 1857 in Sint-Petersburg de franciscaanse \\"zustergemeenschap van de familie van Maria\\". In 1862 werd hij door paus Pius IX benoemd tot aartsbisschop van Warschau. In het kader van de tsaristische maatregelen tegen de januariopstand, werd hij in 1863 voor 20 jaar verbannen naar Jaroslavl. Hij bouwde er een rooms-katholieke parochiegemeenschap op en steunde andere bannelingen. Na onderhandelingen tussen het Russische Keizerrijk en de Heilige Stoel mocht hij Rusland verlaten. In 1893 deed hij afstand van het ambt van aartsbisschop en werd hij door paus Leo XIII benoemd tot titelvoerend bisschop van Tarsus. Hij bracht de laatste jaren van zijn leven door in Galicië.\\nIn 2002 werd hij door paus Johannes Paulus II zalig verklaard. Op 11 oktober 2009 werd hij heilig verklaard door paus Benedictus XVI."},{"page_url":"https://an.wikipedia.org/wiki/Paradela","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Iglesia_de_Santa_Mar%C3%ADa_de_Ferreiros.jpg","page_title":"Paradela","context_page_description":"Paradela ye un municipio gallego d'a provincia de Lugo, situato en a comarca de Sarria.\\nA suya población ye de 2.193 habitants, en una superficie de 121,1 km² y una densidat de 18,11 hab/km²."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%A9%D9%86%DB%8C%D8%B3%DB%81_%D8%AE%D8%B1%D8%A7%D8%A8%DB%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/PikiWiki_Israel_4656_Jerusalem.jpg","page_title":"کنیسہ خرابہ","context_page_description":"کنیسہ خرابا قدیم یروشلم کے یہودی محلہ میں ایک تاریخی کنیسہ ہے۔\\n1948ء کی عرب اسرائیل جنگ کے دوران میں اسے تباہ کر دیا گیا تھا، تاہم 1967ء کی چھ روزہ جنگ کے بعد یروشلم پر اسرائیلی کنٹرول کے بعد 2010ء میں از سر نو تعمیر کیا گیا۔"},{"page_url":"https://en.wikipedia.org/wiki/Vittorino_Veronese","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Celebration_of_UNESCO%27s_25th_anniversary._Left_to_right%2C_five_Directors-General.png","page_title":"Vittorino Veronese","context_page_description":"Vittorino Veronese was an Italian anti-fascist lawyer and activist who served as UNESCO’s Director-General from 1958 to 1961. Before his appointment as UNESCO’s Director-General he served as Chairman of the Catholic Institute for Social Activity and of Azione Cattolica. From 1952 to 1956 he served on UNESCO’s board and was UNESCO’s chairperson from 1956 to 1958. Three years after the appointment as the Director-General, Veronese had to resign due to health concerns.\\nVeronese would continue to hold roles within the Catholic Church after his career with UNESCO, and to be prominent in the international sphere until his death in 1986 at the age of 76."},{"page_url":"https://en.wikipedia.org/wiki/Light_cruiser","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/London_November_2013-14a.jpg","page_title":"Light cruiser","context_page_description":"A light cruiser is a type of small- or medium-sized warship. The term is a shortening of the phrase \\"light armored cruiser\\", describing a small ship that carried armor in the same way as an armored cruiser: a protective belt and deck. Prior to this smaller cruisers had been of the protected cruiser model, possessing armored decks only. While lighter and smaller than other contemporary ships they were still true cruisers, retaining the extended radius of action and self-sufficiency to act independently across the world. Through their history they served in a variety of roles, primarily as convoy escorts and destroyer command ships, but also as scouts and fleet support vessels for battle fleets."},{"page_url":"https://eu.wikipedia.org/wiki/Shimabarako_gaztelua","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/140321_Shimabara_Castle_Shimabara_Nagasaki_pref_Japan16s3.jpg","page_title":"Shimabarako gaztelua","context_page_description":"Shimabarako gaztelua\\nJaponiako Kyushu uharteko Shimabara hirian dagoen gaztelu japoniarra da."},{"page_url":"https://nl.wikipedia.org/wiki/Martijn_Bosman_(voetballer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Martijn_Bosman.jpg","page_title":"Martijn Bosman (voetballer)","context_page_description":"Martijn Bosman is een Nederlands voetballer."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%B4%D0%BE%D0%B1%D0%B8%D1%82%D0%BD%D0%B8%D0%BA%D0%B0_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%BE%D0%B2%D0%B5_%D0%BD%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D0%B5_%D0%B7%D0%B0_%D1%84%D0%B8%D0%B7%D0%B8%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%98%D1%83_%D0%B8%D0%BB%D0%B8_%D0%BC%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Roger_Wolcott_Sperry.jpg","page_title":"Списак добитника Нобелове награде за физиологију или медицину","context_page_description":"Нобелова награда за физиологију или медицину додељује се сваке године научницима који раде на разним пољима физиологије или медицине. Једна је од пет Нобелових награда које су основане 1895. године по тестаменту Алфреда Нобела, а додељује је Институт Каролинска за изузетне доприносе у физиологији или медицини. Како је настала вољом Алфреда Нобела, наградом управља Нобелова фондација, а додељује ју одбор који се састоји од пет чланова изабраних од стране Шведске краљевске академије наука. Иако се често назива Нобеловом наградом за медицину, Нобел је у свом тестаменту изричито навео да се награда додељује за „физиологију или медицину”, те се тако награда може доделити за шири спектар поља. Додељује се у Стокхолму на годишњој церемонији 10. децембра, на годишњицу смрти Алфреда Нобела. Сваки добитник добија медаљу, диплому и новчану награду која се мењала током година."},{"page_url":"https://pl.wikipedia.org/wiki/K%C5%82oda_(powiat_leszczy%C5%84ski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/K%C5%82oda%2C_obora_z_XIX_wieku.JPG","page_title":"Kłoda (powiat leszczyński)","context_page_description":"Kłoda – wieś w Polsce położona w województwie wielkopolskim, w powiecie leszczyńskim, w gminie Rydzyna.\\nW latach 1975–1998 miejscowość należała administracyjnie do województwa leszczyńskiego."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%8F%E0%A4%B8%E0%A5%8B%E0%A4%B8%E0%A4%BF%E0%A4%8F%E0%A4%B6%E0%A4%A8_%E0%A4%91%E0%A4%AB_%E0%A4%9A%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%9F%E0%A4%B0%E0%A5%8D%E0%A4%A1_%E0%A4%B8%E0%A4%B0%E0%A5%8D%E0%A4%9F%E0%A4%BF%E0%A4%AB%E0%A4%BE%E0%A4%87%E0%A4%A1_%E0%A4%8F%E0%A4%95%E0%A4%BE%E0%A4%89%E0%A4%82%E0%A4%9F%E0%A5%87%E0%A4%82%E0%A4%9F%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/ACCA_29_Lincoln%27s_Inn_Fields.JPG","page_title":"एसोसिएशन ऑफ चार्टर्ड सर्टिफाइड एकाउंटेंट्स","context_page_description":"एसोसिएशन ऑफ चार्टर्ड सर्टिफाइड एकाउंटेंट्स एक ब्रिटिश लेखा निकाय है जो दुनिया भर में चार्टर्ड सर्टिफाइड एकाउंटेंट की योग्यता प्रदान करता है। यह दुनिया के सबसे बड़े और सबसे तेजी से बढ़ते लेखा निकायों में से एक है जिसके पास 170 देशों में 140,000 सदस्य और 404,000 सहयोगी एवं छात्र हैं. संस्थान का मुख्यालय लंदन में है जबकि मुख्य प्रशासनिक कार्यालय ग्लासगो में स्थित है। इसके अलावा एसीसीए के पास दुनिया भर में लगभग 80 कर्मियों से युक्त कार्यालयों और अन्य केन्द्रों का एक नेटवर्क है।\\nएसीसीए कंसल्टेटिव कमिटी ऑफ एकाउंटेंसी बॉडीज और इंटरनेशनल फेडरेशन ऑफ एकाउंटेंट्स का एक संस्थापक सदस्य निकाय है।\\nएसीसीए की योग्यता में 'चार्टर्ड' शब्द का संदर्भ 1974 में युनाइटेड किंगडम में हर मेजेस्टी द क्वीन द्वारा प्रदत्त रॉयल चार्टर से है।\\nचूंकि चार्टर्ड सर्टिफाइड एकाउंटेंट एक कानूनी रूप से सुरक्षित पद है, जो व्यक्ति स्वयं को चार्टर्ड सर्टिफाइड एकाउंटेंट बताते हैं उन्हें अनिवार्य रूप से एसीसीए का सदस्य होना चाहिए, अगर वे सार्वजनिक प्रैक्टिस संबंधी मामलों में संलग्न हैं तो उन्हें अतिरिक्त नियमों का पालन करना चाहिए जैसे कि उनके पास एक प्रैक्टिस करने का प्रमाणपत्र होना चाहिए जिसे किसी संभावित देनदारी के दावों और निरीक्षणों के लिए प्रस्तुतियों के विरुद्ध बीमित होना चाहिए।"},{"page_url":"https://fr.wikipedia.org/wiki/Festival_Tempo_Rives","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Anthony_Joseph_and_the_Spasm_Band_-_20090716.jpg","page_title":"Festival Tempo Rives","context_page_description":"Le festival Tempo Rives est un festival français annuel de musiques actuelles se déroulant à Angers, ville de Maine-et-Loire en région Pays de la Loire. Créé en 2009, il a lieu chaque été deux fois par semaine, sur des scènes musicales montées sur les berges de Maine. Y partagent l'affiche, des groupes internationaux et des artistes émergents angevins."},{"page_url":"https://fi.wikipedia.org/wiki/All_England_Lawn_Tennis_and_Croquet_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Centre_Court_Wimbledon_%282%29.jpg","page_title":"All England Lawn Tennis and Croquet Club","context_page_description":"All England Lawn Tennis and Croquet Club, tunnetaan myös nimellä All-England Club, on Wimbledoniin, Englantiin sijoittuva yksityinen tennikseen liittyvä jäsenkerho. Se tunnetaan parhaiten Wimbledonin tenniskentistä. Ainoa ruohokentällä pelattava Grand Slam -turnaus toteutetaan siellä.\\nKerholla on yhteensä 375 jäsentä, noin 100 satunnaisesti pelaavaa jäsentä ja lukuisia kunniajäseniä, mukaan lukien Wimbledonin aikaisemmat kaksinpelin voittajat. Yksi syy rajoitettuun jäsenmäärään on se, että jäsenet saavat kukin kaksi lippua vuotuiseen Wimbledonin tennisturnaukseen."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A7%81%E0%A6%AE%E0%A6%A1%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Ash_Gourd_%28benincasa_pruriens%29_at_Pogallapalli_Khammam.jpg","page_title":"কুমড়া","context_page_description":"কুমড়া/কুমড়ো কয়েক রকমের হয়; যেমন- মিষ্টিকুমড়া, চালকুমড়া, জালিকুমড়া ইত্যাদি।\\nমিষ্টিকুমড়া ফলজাতীয় সবজি যা কিউকারবিটেসি পরিবারের প্রধান গণ কিউকারবিটার কয়েকটি প্রজাতি। মিষ্টিকুমড়ার আকার পেটমোটা গোল এবং পাকা অবস্থায় এর ভিতরের অংশ উজ্জ্বল কমলা বর্ণের হয়ে থাকে।\\nচালকুমড়া বা জালিকুমড়া Benincasa গণভুক্ত; এটি সবুজ রঙের হয়।\\nমিষ্টিকুমড়া: pumpkin, winter squash, gourd & squash. বৈজ্ঞানিক নাম: Cucurbita mixta, C. pepo, C. maxima, C. alba, C. moschata এবং এদের নানান প্রকরণ ও শংকর। এর মধ্যে C. moschata বাংলাদেশে সবচেয়ে বেশি দেখা যায়।\\nচালকুমড়া, জালিকুমড়া বা ছাচি কুমড়া: Winter melon, white gourd, Wax Gourd, winter gourd, tallow gourd, Chinese preserving melon, বা ash gourd. বৈজ্ঞানিক নাম: Benincasa hispida এবং এর নানান প্রকরণ ও শংকর।\\nএর বিচি মৃদভেদী অঙ্কুরোদগমের মাধ্যমে হয়ে থাকে।"},{"page_url":"https://en.wikipedia.org/wiki/Alawite_State","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Arrete_No_319_Delimitant_le_Territoire_des_Alaouites%2C_31_August_1920.png","page_title":"Alawite State","context_page_description":"The Alawite State, officially named the Territory of the Alawites, after the locally-dominant Alawites from its inception until its integration to the Syrian Federation in 1922, was a French mandate territory on the coast of present-day Syria after World War I. The French Mandate from the League of Nations lasted from 1920 to 1946.\\nThe use of \\"Alawite\\", instead of \\"Nusayri\\", was advocated by the French early in the Mandate period and referred to a member of the Alawite religion. In 1920, the French-named \\"Alawite Territory\\" was home to a large population of Alawites."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_orang_Afrika_Amerika_pertama","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Miles_Davis_by_Palumbo_cropped.jpg","page_title":"Senarai orang Afrika Amerika pertama","context_page_description":"Orang Amerika Afrika merupakan suatu demografi minoriti di Amerika Syarikat. Secara sejarahnya, pencapaian pertama orang Amerika Afrika dalam pelbagai bidang mewujudkan suatu tapak, menjadi duluan untuk perubahan budaya yang lebih meluas. Frasa trengkas untuk fenomena ini ialah \\"memecah rintangan warna\\"."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%A9%D7%91%D7%AA_%D7%94%D7%9B%D7%A3_%D7%94%D7%94%D7%95%D7%9C%D7%A0%D7%93%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Simon_van_der_Stel.jpg","page_title":"מושבת הכף ההולנדית","context_page_description":"מושבת הכף הייתה מושבה הולנדית בדרומה של יבשת אפריקה. לאורך רוב שנות קיומה הייתה המושבה תחת חסותה הישירה של חברת הודו המזרחית ההולנדית. בראשיתה הייתה המושבה תחנת אספקה לספינות בקייפטאון שבסמוך לכף התקווה הטובה, אך במהלך השנים הוקמו בה מאות משקים חקלאיים לצד יישובים חדשים. במקביל, התיישבו בה מהגרים אירופאים רבים. הם התפזרו ברחבי הארץ ועקב כך גדלה המושבה לכדי שליש משטח דרום אפריקה המודרנית. צביונה של החברה הלבנה שהתגבש בשטחי המושבה היה של חברת איכרים נוצרית ושמרנית. בדרך כלל הגיעו תושביה מהשכבות הנמוכות בחברה האירופאית, וגם אם החיים במושבה שיפרו לעיתים את רמת חייהם, לרוב הם חיו בדלות.\\nהתרחבות המושבה במרחבים שיהפכו לימים לדרום אפריקה, הביאה להתנגשויות רבות בין המתיישבים האירופאים לבין האוכלוסייה השחורה המקומית. ההתנגשויות הסתיימו תמיד בניצחון המתיישבים, ולרוב אף בניצחון מכריע. בתקופת קיומה של מושבת הכף ההולנדית התגבשו גם כמה מהתהליכים החברתיים והתרבותיים החשובים ביותר בתולדות דרום אפריקה, לרבות התהוות החברה האפריקאנרית, הצבעונית והאסייתית במקום. לבסוף, לקראת סופה של המאה ה-18, עקב קשייה המדיניים של הולנד במלחמות המהפכה הצרפתית ובמלחמות הנפוליאוניות, עברה המושבה לידיה של האימפריה הבריטית, אשר הקימה בה מושבה בעלת שם זהה."},{"page_url":"https://eu.wikipedia.org/wiki/%C5%BD%C3%ADtkov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Zitkova-znak.jpg","page_title":"Žítková","context_page_description":"Žítková Txekiar Errepublikako udalerri bat da. 172 biztanle ditu eta 6,8 kilometro koadroko azalera. Uherské Hradištěko barrutian dago."},{"page_url":"https://ga.wikipedia.org/wiki/Sp%C3%A1inn%C3%A9ar_fe%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Gessa_d%27Aran_Copo_de_Nieve-_arancio_roano-_prop.Kalesa.jpg","page_title":"Spáinnéar feá","context_page_description":"Spáinnéar beag gníomhach cairdiúil. Na guaillí 45 cm ar airde, na cluasa fada go híseal ar an gceann, an fionnadh fada, dubh nó órga/donn. An t-eireaball sciota gearr is é óg. Pór Meiriceánach a saothraíodh ón bpór Sasanach.\\nIs síol ainmhí é an t-alt seo. Cuir leis, chun cuidiú leis an Vicipéid.\\nMá tá alt níos forbartha le fáil i dteanga eile, is féidir leat aistriúchán Gaeilge a dhéanamh."},{"page_url":"https://nl.wikipedia.org/wiki/Resolutie_646_Veiligheidsraad_Verenigde_Naties","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Campo_Skouriotissa.jpg","page_title":"Resolutie 646 Veiligheidsraad Verenigde Naties","context_page_description":"Resolutie 646 van de Veiligheidsraad van de Verenigde Naties was de laatste resolutie van de VN-Veiligheidsraad in de jaren 1980 en werd unaniem aangenomen op 14 december 1989."},{"page_url":"https://pt.wikipedia.org/wiki/Ret%C3%A1bulo_dos_Reis_Magos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Arcanjo_S._Gabriel_Ret%C3%A1bulo_dos_Reis_Magos.jpg","page_title":"Retábulo dos Reis Magos","context_page_description":"O Retábulo dos Reis Magos, também designado por Retábulo de Antuérpia, é um retábulo misto de escultura e pintura, em tríptico, sendo a peça central uma cena escultórica em madeira e os dois painéis laterais duas pinturas a óleo sobre madeira pintadas de ambos os lados presumivelmente na década de 1520 em Oficina de Antuérpia de que se desconhece a identidade e que se destinou a decorar a Capela dos Reis Magos, na localidade de Estreito da Calheta, onde ainda se encontra.\\nO Retábulo dos Reis Magos é uma notável peça do património madeirense que ainda se encontra no local para onde foi encomendada pela família dos instituidores, uma modesta capela que nos evoca o tipo de construções religiosas do início da economia açucareira, sendo uma das poucas peças de arte de origem flamenga que não se encontram no Museu de Arte Sacra do Funchal."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8F%B0%E6%B9%BE%E3%81%AE%E3%83%A1%E3%83%87%E3%82%A3%E3%82%A2%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/TTV_East-wing_Building_and_Central_Building_20061223.jpg","page_title":"台湾のメディア史","context_page_description":"台湾のメディア史では台湾における近代メディアの萌芽とその発展を概説する。\\n台湾のメディアは日本統治時代に新聞・放送の基礎が築かれたことに遡る事ができる。1945年の終戦によりメディアは比較的制約を受けない環境に置かれたが、二二八事件発生後は言論の自由は、1987年の戒厳令解除まで非常に制約された状況に置かれた。戒厳令解除後は1988年に中華民国政府は報道規制を解除、1993年には地上波放送とケーブルテレビの全面自由化が実施されると、台湾メディアは急速に発達することとなった。現在はメディアでは自由な競争が実現したが、メディアの急増により過当競争も発生、さらに政治勢力もメディア支配を完全に放棄しておらず、メディアの報道のありかたについて社会問題となり、その改善が課題となっている。"},{"page_url":"https://en.wikipedia.org/wiki/Theology_of_Anabaptism","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Dirk.willems.rescue.ncs.jpg","page_title":"Theology of Anabaptism","context_page_description":"Theology of Anabaptism is the beliefs of the Anabaptist movement. Anabaptism has a reputation of de-emphasizing theology in deference to living righteously. The various branches of the Anabaptist movement take slightly different approaches to theology.\\nJohn S. Oyer argues in his article \\"Is there an Amish Theology\\" that no systematic theology exists among the Amish. Oyer states that the Amish have an implicit theology that can be found in their biblical hermeneutics, but take little interest in explicit, formal, and systematic theology. It is easier to find out about their implicit theology in talking with them than reading written documents. According to Oyer, their implicit theology is practical, not theoretical. The most important written source of Amish theology, according to Oyer, is \\"1001 Questions and Answers on the Christian Life\\". Other important written sources for Anabaptist theology are the Schleitheim and Dordrecht Confessions of Faith\\nOld Order Mennonites have even less documents about their theology than the Amish."},{"page_url":"https://pl.wikipedia.org/wiki/Asymetryczny_atom_w%C4%99gla","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/1-Bromo-1-chloroethane.png","page_title":"Asymetryczny atom węgla","context_page_description":"Asymetryczny atom węgla – atom węgla o hybrydyzacji sp³ połączony z czterema różnymi podstawnikami, stanowiący w ten sposób centrum stereogeniczne cząsteczki. Jeżeli w cząsteczce występuje tylko jedno centrum stereogeniczne, to cały układ nie ma płaszczyzny symetrii ani środka symetrii i wykazuje czynność optyczną.\\nJeżeli w cząsteczce występują dwa bliźniacze ugrupowania zawierające asymetryczne atomy węgla o tych samych konfiguracjach, to związek jest chiralny, a obie formy są enancjomerami. Jeśli jednak oba asymetryczne atomy węgla mają przeciwną konfigurację np. R, S lub S, R, to związek taki posiada płaszczyznę symetrii i cały układ nie jest chiralny ani optycznie czynny. Taki przypadek nazywany jest formą „mezo”.\\nPrzykład dwóch enancjomerów i formy mezo kwasu winowego, zawierającego dwa asymetryczne atomy węgla z takimi samymi podstawnikami:\\nJeśli oba asymetryczne atomy węgla różnią się podstawnikami, dany związek może występować w formie czterech stereoizomerów stanowiących dwie pary diastereoizomerów i dwie pary enancjomerów."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D0%B4_%C2%AB%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%BF%D0%BE%D0%BB%D1%96%D1%82%D0%B8%D0%BA%D0%B0%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Ua_policy_foundation.png","page_title":"Фонд «Українська політика»","context_page_description":"Фонд «Українська політика» — український аналітичний центр, який спеціалізується на дослідженні та моделюванні політичних процесів в Україні та світі, організації виборчих кампаній та політичному консалтингу."},{"page_url":"https://eo.wikipedia.org/wiki/William_Hopkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/WilliamHopkins.jpg","page_title":"William Hopkins","context_page_description":"William HOPKINS, membro de la RS estis angla matematikisto kaj geologo. Li estas fama kiel privata tutoro de aspirantaj subgradiĝintoj de Kembriĝo, kio havigis al li la kromnomon \\"senior-wrangler maker.\\"\\nLi faris ankaŭ gravajn kontribuojn asertante solidan, pli ol likvidan, internon por la Tero kaj klarigante multajn geologiajn fenomenojn laŭ tiu modelo. Tamen, kvankam liaj konkludoj montriĝis ĝustaj, lia matematika kaj fizika rezonado estis poste rigardata kiel neracia.\\nHopkins ege interesiĝis pri muziko, poezio kaj pentrarto de pejzaĝoj. Li vivis la vivofinon en psikiatria hospitalo en Stoke Newington."},{"page_url":"https://de.wikipedia.org/wiki/Taborstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Wien_02_Taborstra%C3%9Fe_19_Karmeliterkirche_a.jpg","page_title":"Taborstraße","context_page_description":"Die Taborstraße im 2. Wiener Gemeindebezirk, Leopoldstadt, verläuft zwischen Donaukanal und Vorgartenstraße, u. a. am Rand von Karmeliterviertel, Volkertviertel und Alliiertenviertel. Sie ist seit 2011 mit der damals bekanntgegebenen Verlängerung, die sich zum Teil noch im Planungs- bzw. Baustadium befindet, etwa 2,5 km lang. An der westlichen, linken Straßenseite grenzt von der Nordwestbahnstraße zur Nordbahnstraße seit 1900 der damals von der Leopoldstadt abgetrennte 20. Bezirk, Brigittenau, an. Die 2011 beschlossene Verlängerung um 600 m befindet sich im Nordbahnviertel. Ihren heutigen Namen erhielt die Straße um 1850."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D1%80%D1%8A%D1%88%D0%BB%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Brashlen-mayors-front.jpg","page_title":"Бръшлен","context_page_description":"Бръшлен е село в Северна България. То се намира в община Сливо поле, област Русе."},{"page_url":"https://sh.wikipedia.org/wiki/Kaunos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/0132_Theater_in_Caunos.jpg","page_title":"Kaunos","context_page_description":"Kaunos je bio grad u drevnoj Kariji, dijelu Anadolije, udaljen nekoliko kilometara zapadno od suvremenog grada Dalyan u provinciji Mugla u Turskoj. Kaunos je po predaji osnovao Kaunos, sin Miletosa i Kijane na južnoj obali Karije, nasuprot Rodosa. Kasnije je pripadao distriktu Rodosa poznatom kao Peraea, Peræa Rhodiorum \\"Rodska obala\\", u podnožju planine Tarbelos. Njegova akropola je zvana Imbros. Poznat je po tome što je izvozio, uglavnom u Rim, dragocjene smokve. Bio je dom slavnog slikara Protogena. Pripadao je Hrisaorijanskoj ligi.\\nRuševine grada se nalaze kraj Dalyana, na desnoj obali drevnog Kalbisa. Među njima su teatar, velika pravokutna zgrada koja je mogla biti hram, ostale zgrade nejasne namjene, bizantska crkva i grobovi uklesani u stijenu."},{"page_url":"https://es.wikipedia.org/wiki/J%C3%A9r%C3%A9my_Clapin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/J%C3%A9r%C3%A9my_Clapin.jpg","page_title":"Jérémy Clapin","context_page_description":"Jérémy Clapin es un cineasta y animador francés."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%80%D0%BD%D0%B5%D0%B1%D1%83%D1%80%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Schloss_Agathenburg.jpg","page_title":"Хорнебург","context_page_description":"Хорнебург — коммуна в Германии, в земле Нижняя Саксония.\\nВходит в состав района Штаде. Подчиняется управлению Хорнебург. Население составляет 5551 человек. Занимает площадь 17,13 км². Официальный код — 03 3 59 027."},{"page_url":"https://de.wikipedia.org/wiki/Bayerisches_Jazzweekend","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/090704_regensburg-bayerisches-jazzweekend-kohlenmarkt_1-640x480.jpg","page_title":"Bayerisches Jazzweekend","context_page_description":"Das Bayerisches Jazzweekend ist ein Jazz-Festival in Regensburg, das seit 1982 immer an vier Tagen Mitte Juli stattfindet.\\nDie künstlerische Leitung liegt beim Bayerischen Jazzinstitut, Veranstalter ist das Kulturamt der Stadt Regensburg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%96%D0%BC%D0%B1%D0%B5%D1%80%D0%BB%D1%96_(%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Kimberley_Mountains.png","page_title":"Кімберлі (Британська Колумбія)","context_page_description":"Кімберлі — місто в Канаді, у провінції Британська Колумбія, у складі регіонального округу Іст-Кутеней."},{"page_url":"https://de.wikipedia.org/wiki/Evangelische_Kirche_(D%C5%BAwierzuty)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/205-Preu%C3%9F_1.JPG","page_title":"Evangelische Kirche (Dźwierzuty)","context_page_description":"Die Evangelisch-Augsburgische Kirche in Dźwierzuty ist ein Bauwerk, das in seinen Grundmauern in das 14. Jahrhundert zurückreicht und um 1695 im spätgotischen Stil neu errichtet wurde. Die Kirche ist seit der Reformation ein evangelisches Gotteshaus."},{"page_url":"https://es.wikipedia.org/wiki/Pen%C3%ADnsula_de_La_Magdalena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Santander.Playa.Magdalena.jpg","page_title":"Península de La Magdalena","context_page_description":"La península de La Magdalena, también llamada Real Sitio de La Magdalena, se encuentra en la ciudad de Santander. Tiene una superficie de 24,5 hectáreas. Fue un regalo de la ciudad de Santander al rey Alfonso XIII, que lo utilizó como residencia de veraneo entre 1912 y 1929. En la actualidad la península es un parque público abierto durante el día.\\nLa península fue el punto estratégico más importante de Santander, dado que controlaba el acceso a la bahía de Santander y por ende a la ciudad. Prueba de ello es la presencia de restos arqueológicos romanos posteriores al siglo I. Así mismo, y debido a su importancia militar, perteneció durante mucho tiempo al ejército. En ella se instalaron la batería de la Cerda y el castillo de San Salvador de Hano, parte importante del sistema de defensas costeras que poseía Santander. En julio de 1812, durante la Guerra de la Independencia, los ingleses, aliados de los españoles, capturan la isla de Mouro, desde donde abaten con fuego granado las defensas tomadas por los franceses, logrando expulsarlos de ellas."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%90%B4%E5%A1%9A%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/%E7%90%B4%E5%A1%9A%E9%A7%85%E3%83%9B%E3%83%BC%E3%83%A0%E8%B7%A1.jpg","page_title":"琴塚駅","context_page_description":"琴塚駅は、岐阜県岐阜市琴塚1丁目にあった名古屋鉄道美濃町線の駅。"},{"page_url":"https://af.wikipedia.org/wiki/Tamara_Lees","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Tamara_Lees_in_Tot%C3%B2_Sceicco.jpg","page_title":"Tamara Lees","context_page_description":"Tamara Lees was 'n Engelse aktrise en skryfster. Sy was bekend vir haar rolle in die rolprente Totò sceicco, Filumena Marturano, The Queen of Babylon, en Una spada nell'ombra."},{"page_url":"https://nl.wikipedia.org/wiki/Gao_Xiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Gao_Xiang-Tanzhi_Pavillion.jpg","page_title":"Gao Xiang","context_page_description":"Gao Xiang was een Chinees kunstschilder uit Ganquan, het huidige Yangzhou in Jiangsu. Hij behoort tot de canon van de Acht Excentriekelingen van Yangzhou; een groep schilders in de vroege Qing-periode die orthodoxe ideeën over de schilderkunst verwierpen ten bate van een eigen expressieve stijl.\\nGao leefde in armoede, al was hij een bedreven schilder van landschappen en vogel- en bloemschilderingen. Hij bekwaamde zich met name in het schilderen van pruimenbloesem. Gao had een grote bewondering voor de schilderkunst van Shitao."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Eimsb%C3%BCttel_(West)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/18874_Odenwaldstra%C3%9Fe_7.jpg","page_title":"Liste der Kulturdenkmäler in Hamburg-Eimsbüttel (West)","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Eimsbüttel (West) enthält die in der Denkmalliste ausgewiesenen Denkmäler in den Ortsteilen 301–304 des Stadtteils Eimsbüttel der Freien und Hansestadt Hamburg.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Denkmallistennummer, Art, Typ, Datierung, Entwurf oder Beschreibung sortierbar.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Open Data Portal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung.\\nAlle Denkmäler in den Ortsteilen 301–304, die schon vor der Novelle des Denkmalschutzgesetzes unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Eimsbüttel zu finden.\\nIn der Spalte Lfd. Nr. ist die eindeutige Identifikationsnummer des Denkmals zu finden. In der Spalte Art ist angegeben, ob es sich um ein Objekt oder ein Ensemble handelt."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%95%E0%A5%88%E0%A4%A8%E0%A4%B0%E0%A5%80_%E0%A4%A6%E0%A5%8D%E0%A4%B5%E0%A5%80%E0%A4%AA%E0%A4%B8%E0%A4%AE%E0%A5%82%E0%A4%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Teide_Tenerife3.jpg","page_title":"कैनरी द्वीपसमूह","context_page_description":"कैनरी द्वीपसमूह स्पेन द्वारा नियंत्रित द्वीपों का एक समूह है जो अफ़्रीका के उत्तरपश्चिमी छोर से आगे अंध महासागर में स्थित है। प्रशासनिक दृष्टि से यह स्पेन का एक स्वायत्त समुदाय है, जो लगभग एक राज्य जैसा दर्जा रखता है। इस द्वीपसमूह में यह द्वीप आते हैं: तेनरीफ़, ग्रान कानारिया, फ़्वेरतेवेन्तूरा, लान्सारोते, ला पाल्मा, ला गोमेरा, ला ईएरो, ला ग्रासीओसा, आलेग्रान्सा, मोन्तान्या क्लारा, रोक दॅल एस्ते, रोक दॅल ओएस्ते और इस्ला दे लोबोस ।\\nइस प्रदेश की दो राजधानियाँ हैं: तेनरीफ़ के द्वीप पर स्थित सान्ता क्रूस दे तेनरीफ़ और ग्रान कानारिया द्वीप पर स्थित लास पालमास दे ग्रान कानारिया । तेनरीफ़ पर पिको देल तेइदे नाम का ज्वालामुखी स्थित है जो आकार में विश्व का तीसरा सब से बड़ा ज्वालामुखी है।"},{"page_url":"https://de.wikipedia.org/wiki/Glass_House_Mountains","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Glass_House_Mountains.jpg","page_title":"Glass House Mountains","context_page_description":"Im Gebiet der Glass House Mountains, auch Glasshouse Mountains geschrieben, befinden sich zwölf vulkanische Berge, die sich abrupt aus der relativ flachen Ebene an der Sunshine Coast im Inland von Queensland in Australien erheben. Die Berge liegen etwa 70 Kilometer nördlich von Brisbane. Das Gebiet ist Teil der Great Dividing Range. Die Ebene zwischen und um die Berge wird vor allem zum Anbau von Ananas, zur Geflügelzucht und für Forst- und Holzwirtschaft genutzt."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D8%B1%D9%82%D8%A7%D9%86%D8%AF%D8%A7_%D8%AF%D9%84_%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Hans_Khevenhuller.jpg","page_title":"آرقاندا دل ری","context_page_description":"آرقاندا دل ری ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر بۇ شهرین مساحتی ۷۹٫۶۵ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۵۰۳۰۹ نفر دیر. ۶۱۸ متر دنیز سویه‌سیندن اۇجالیقی وار."},{"page_url":"https://en.wikipedia.org/wiki/Tsuut%CA%BCina_Nation","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Assinaitappi.jpg","page_title":"Tsuutʼina Nation","context_page_description":"The Tsuutʼina Nation is a First Nation band government in Alberta, Canada. Their territory today is confined to the Tsuu T'ina Nation 145 reserve, whose east side is adjacent to the southwest city limits of Calgary. Their traditional territory on the Plains was much more extensive. The land area of the reserve is 283.14 km², and it had a population of 1,982 in the Canada 2001 Census. The northeast portion of the reserve was used as part of CFB Calgary, a Canadian Army base, from 1910 to 1998. In 2006, the land was returned to the Nation by the Government of Canada. The Tsuutʼina people were formerly called the Sarsi or Sarcee, words which are believed to have been derived from a Blackfoot word meaning stubborn ones. The two peoples long had conflict over territory. Because of its origins from an enemy, the term is now viewed as offensive by most of the Tsuutʼina.\\nThe proximity of the territory to the City of Calgary had led to disagreement over the Province of Alberta's plans to construct the southwest portion of a ring road, referred to as Stoney Trail."},{"page_url":"https://es.wikipedia.org/wiki/Aeropuerto_de_Budapest-Ferenc_Liszt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/FerihegyOut.jpg","page_title":"Aeropuerto de Budapest-Ferenc Liszt","context_page_description":"El Aeropuerto Internacional de Budapest Ferenc Liszt es el aeropuerto internacional que da servicio a la capital de Hungría, Budapest. Es el más grande de los cinco aeropuertos internacionales del país y el segundo más grande de los nuevos estados miembros de la Unión Europea. El aeropuerto está localizado a 16 kilómetros al este-sureste del centro de Budapest, en el barrio de Ferihegy –del que toma su nombre el aeropuerto– accesible por la carretera Üllői. En 2017, el aeropuerto atendió a 13.097.239 pasajeros.\\nEl aeropuerto ofrece conexiones internacionales principalmente dentro de Europa, pero también a Asia, Oriente Medio, y Norteamérica. Ferenc Liszt es lo suficientemente grande como para asumir cualquier clase de avión, incluyendo el Boeing 747, el Antonov An-124 y el Antonov An-225 pero la mayor parte del tráfico comprende a aviones bimotor de Airbus y Boeing, que vuelan hacia y desde ciudades europeas, y algunos Boeing 767 de largo radio. El tiempo obliga a desviar aviones frecuentemente, cuando esto ocurre los aviones normalmente aterrizan en Bratislava o Viena."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%BC%D0%BE%D1%82%D0%BE%D1%86%D0%B8%D0%BA%D0%BB%D0%B5%D1%82%D0%BD%D0%B8_%D0%BC%D0%B0%D1%80%D0%BA%D0%B8_%D0%BE%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Puch_Ranger_4TL_p2.JPG","page_title":"Списък на мотоциклетни марки от Европа","context_page_description":"Списъкът представя съществуващи и вече несъществуващи производители и марки на мотоциклети произвеждани в Европа. Информацията в табличен вид е базирана на фирмени или други документи и енциклопедията „The Encyclopedia of the motorcycle“ съставена от Peter Henshaw и публикувана през 2000 година."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D9%84%D8%AC_%D8%A2%DB%8C%D9%88%D9%86%D8%A7_(%D9%86%DB%8C%D9%88%DB%8C%D9%88%D8%B1%DA%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Mazzella_field_01.jpg","page_title":"کالج آیونا (نیویورک)","context_page_description":"کالج آیونا یک کالج کاتولیک خصوصی، جامع و چهار ساله در نیو راشل نیویورک است که در سال ١٩٤٠ توسط انجمن برادران مسیحی در محوطه‌ای به وسعت ۴۵ هکتار تأسیس شد.\\nکالج آیونا بیش از ۶۰ برنامه کارشناسی و ۴۵ دوره کارشناسی ارشد و دکترا را در دانشکده هنر و علوم و مدرسه کسب و کار لاپنتا ارائه می‌دهد. دانش آموزان برتر می‌توانند مدرک افتخاری دریافت کرده و از دوره‌های ویژه، سمینارها، مشاوره، و فرصت‌های خارج از دانشگاه، بهره ببرند. کالج همچنین دوره‌های تحصیلات بالاتر از کارشناسی را در منهتن ارائه می‌دهد و دارای ۱۴ برنامه تحصیلی در خارج از کشور است.\\nطبق آمار سال ۲۰۱۷، این مؤسسه تقریباً ۴۰۰۰ دانشجوی را با پیش‌زمینه‌های مختلف و از ۳۵ ایالت و ۴۷ کشور ثبت نام می‌کند."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CE%AC%CF%83%CF%83%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Columba_palumbus_eating.JPG","page_title":"Φάσσα","context_page_description":"Η φάσσα είναι πτηνό της οικογενείας των Περιστεριδών, που απαντά και στον ελλαδικό χώρο. Η επιστημονική ονομασία του είδους είναι Columba palumbus και περιλαμβάνει 5 υποείδη.\\nΣτην Ελλάδα απαντά το υποείδος Columba palumbus palumbus."},{"page_url":"https://la.wikipedia.org/wiki/Paulus_Romeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/PaoloRomeo.jpg","page_title":"Paulus Romeo","context_page_description":"Paulus Romeo est archiepiscopus emeritus Panormi. Die 20 Novembris 2010 a papa Benedicto XVI Paulus Romeo cardinalis creatus est. Romeo conclavi mense Martio 2013 adfuit, quod Georgium Marium Bergoglio papam creavit."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%87%E0%AE%B0%E0%AE%A9%E0%AF%8D%E0%AE%AE%E0%AE%95%E0%AE%BE%E0%AE%A4%E0%AF%87%E0%AE%B5%E0%AE%BF_%E0%AE%A8%E0%AE%9F%E0%AF%81%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AF%86%E0%AE%B0%E0%AF%81_%E0%AE%B5%E0%AF%86%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%9F%E0%AE%BE%E0%AE%9A%E0%AE%B2%E0%AE%AA%E0%AE%A4%E0%AE%BF_%E0%AE%95%E0%AF%8B%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/CheranmahadeviVenkatachalapathy.jpg","page_title":"சேரன்மகாதேவி நடுத்தெரு வெங்கடாசலபதி கோயில்","context_page_description":"சேரன்மகாதேவி நடுத்தெரு வெங்கடாசலபதி கோயில் தமிழ்நாட்டில் திருநெல்வேலி மாவட்டம், சேரன்மகாதேவி என்னும் ஊரில் அமைந்துள்ள பெருமாள் கோயிலாகும்."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%DB%8C%D8%B3%DB%8C%D8%B3%DB%8C%D9%BE%DB%8C_%D8%A7%DB%8C%D8%A7%D9%84%D8%AA%DB%8C%D9%86_%D8%B4%D9%87%D8%B1%D9%84%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Biloxi123.JPG","page_title":"میسیسیپی ایالتین شهرلری","context_page_description":"میسیسیپی ایالتین شهرلری"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D9%8A%D9%84%D9%83%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Shelkar-Kloster-14-Dukhang-2014-gje.jpg","page_title":"شيلكار","context_page_description":"شيلكار ‏ هي بلدة تقع في الصين في Tingri County. يقدر عدد سكانها بـ 8,767 نسمة وترتفع عن سطح البحر 4,330 متر."},{"page_url":"https://lv.wikipedia.org/wiki/R%C4%ABgas_Avi%C4%81cijas_muzejs","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/An-24B_Latavio_YL-LCD.jpg","page_title":"Rīgas Aviācijas muzejs","context_page_description":"Rīgas aviācijas muzejs ir liels aviācijas iekārtu muzejs Latvijā un viens no lielākajiem Eiropā. Muzejs ietver lielāko padomju lidaparātu, lidmašīnu un helikopteru kolekciju ārpus NVS.\\nMuzeja vēsture aizsākusies ar Fridriha Candera vārdā Jauno lidotāju kluba izveidošanu 1965. gadā.\\nMuzejs tika atklāts 1997. gadā pēc Viktora Talpas, bijušā PSRS Melnās jūras flotes jūras aviācijas militārā inženiera, Latvijas Civilās aviācijas pārvaldes Fridriha Candera vārdā Jauno lidotāju klubā pastāvīga direktora un lidmašīnu An-24, Tu-154B bortinženiera iniciatīvas. Muzeja izvietošanai tika piešķirta teritorija Starptautiskajā lidostā \\"Rīga\\". Tas atrodas pa labi no lidostas termināla."},{"page_url":"https://pt.wikipedia.org/wiki/Tharsis_Montes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Ascraeus_Caldera_Wall_PIA05977.jpg","page_title":"Tharsis Montes","context_page_description":"Tharsis Montes é um conjunto de vulcões na região de Tharsis em Marte.\\nConsistem nos vulcões Ascraeus Mons, Pavonis Mons e Arsia Mons, que estão agrupados em seqüência de norte a sul. Um outro vulcão, o Olympus Mons, a maior montanha conhecida no sistema solar, está localizada a noroeste dos vulcões de Tharsis."},{"page_url":"https://it.wikipedia.org/wiki/Isola_dei_Cipressi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/PeackockSide.jpg","page_title":"Isola dei Cipressi","context_page_description":"L'isola dei Cipressi è una piccola isola situata nel lago di Pusiano, in provincia di Como.\\nIn passato è stata abitata, fra gli altri, dal viceré d'Italia Eugène de Beauharnais. Ora è di proprietà di una famiglia milanese, i Gavazzi, che tuttora la abitano e provvedono alla sua manutenzione, realizzando anche un sito internet ad essa dedicato. Gerolamo Gavazzi ha una grande passione per gli animali, e ha contribuito al ripopolamento della fauna del lago con aironi, pavoni e cigni."},{"page_url":"https://pt.wikipedia.org/wiki/Mar%C3%A9_vermelha","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Mar%C3%A9_vermelha.JPG","page_title":"Maré vermelha","context_page_description":"A maré vermelha é uma aglomeração de micro-planctons dinoflagelados que raramente acontece em alguns determinados locais na superfície das águas. São seres unicelulares, aglomerados em número suficiente para produzir uma mudança de cor na água que se torna amarela, alaranjada, vermelha ou marrom. Além disso, são microrganismos caracterizados pela presença de vários pigmentos como azul celeste e azul escuro e de cor verde, pigmento beta-caroteno que é amarelo e várias outras xantofilas que são alaranjadas e vermelhas. Esses pigmentos estão sempre localizados em cromatóforos.\\nEm todos os gêneros de vida livre e nos seus zoósporos, sempre existem dois flagelos. A maioria são seres autótrofos, mas existem também algumas espécies sem pigmentos, pois não fazem fotossíntese."},{"page_url":"https://pt.wikipedia.org/wiki/Universidade_Estadual_do_Norte_do_Paran%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Logo-uenp.png","page_title":"Universidade Estadual do Norte do Paraná","context_page_description":"A Universidade Estadual do Norte do Paraná é uma instituição pública de ensino superior, mantida pelo Estado do Paraná, e que se localiza nas cidades paranaenses de Jacarezinho, Bandeirantes e Cornélio Procópio. A reitoria da universidade está instalada, por sua vez, no município de Jacarezinho. Atualmente a instituição oferece 24 cursos de Graduação, 19 cursos de Especialização, além de 4 cursos de Mestrado e 1 curso de Doutorado. Com mais de 5.500 mil acadêmicos, a universidade conta com muitos graduandos não apenas do Estado do Paraná, mas também oriundos das regiões sul e sudoeste do Estado de São Paulo."},{"page_url":"https://de.wikipedia.org/wiki/Graben_(Wien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Husarenhaus_am_Graben_18_in_Wien.jpg","page_title":"Graben (Wien)","context_page_description":"Der Graben ist eine der bekanntesten Straßen im Zentrum der Wiener Altstadt, des 1. Bezirks. Er geht vom Stock-im-Eisen-Platz / Stephansplatz beim Beginn der Kärntner Straße aus und führt Richtung Nordwesten zur Querachse Kohlmarkt–Tuchlauben. Vom Graben, der als Fußgängerbereich platzartig gestaltet wurde, zweigen schmale historische Gassen ab. Er fungiert als luxuriöse Einkaufs- und Flanierstraße und bildet mit Kärntner Straße und Kohlmarkt das „goldene U“ des Wiener Handels."},{"page_url":"https://de.wikipedia.org/wiki/Wsewolod_Emiljewitsch_Meyerhold","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Meyerhold_reads_Chekhov%27s_The_Seagull_in_1898.jpg","page_title":"Wsewolod Emiljewitsch Meyerhold","context_page_description":"Wsewolod Emiljewitsch Meyerhold war ein russischer Regisseur und Schauspieler. Er war der Entwickler einer radikal antirealistischen Bühnenkunst und gilt als einer der bedeutendsten Theaterregisseure des 20. Jahrhunderts. Er wurde Opfer der Stalinschen Säuberungen."},{"page_url":"https://ca.wikipedia.org/wiki/Montanari_(cr%C3%A0ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Montanari_sattelite_craters_map.jpg","page_title":"Montanari (cràter)","context_page_description":"Montanari és un cràter d'impacte lunar. Es troba a l'oest-sud-oest del prominent cràter Tycho i del seu sistema de marques radials, en la vora sud de la plana emmurallada del cràter Wilhelm. En el costat nord-oest es troba el cràter Lagalla molt deteriorat, i just al sud es troba la gran plana emmurallada de Longomontanus.\\nEl brocal de Montanari ha estat tan profundament erosionat per successius impactes, que és poc més que una suau elevació irregular vorejant el sòl interior. Aquests impactes han distorsionat la forma del cràter, i gairebé s'ha esborrat per complet el sector meridional de la vora. Materials ejectatats procedents de Longomontanus se superposen a part del sòl sud. El cràter satèl·lit Montanari D travessa la vora en el seu costat occidental, i cobreix part del sòl interior. El sector nord de la planta és més regular, i manca de l'abundància de marques que posseeix el costat sud."},{"page_url":"https://en.wikipedia.org/wiki/Launch_Systems_Directorate","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Launch_and_Range_Systems_Wing.png","page_title":"Launch Systems Directorate","context_page_description":"The United States Air Force's Launch Enterprise Directorate is a unit located at Los Angeles Air Force Base in El Segundo, California."},{"page_url":"https://es.wikipedia.org/wiki/Casa_Torre_del_Reloj_de_Puente_Tocinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Escudo_her%C3%A1ldico_de_Ayll%C3%B3n.jpg","page_title":"Casa Torre del Reloj de Puente Tocinos","context_page_description":"La Casa del Reloj, ubicada en el Carril de la Torre en la en la pedanía murciana de Puente Tocinos. De arquitectura barroca popular es un inmueble también denominado Torre de los Ayllón o popularmente conocido como la Torre del Reloj o Casa del Reloj, siendo el edificio más antiguo de la pedanía. Fue levantado a mediados del Siglo XVIII como\\nvivienda familiar de una familia noble y consta de 2 plantas con una superficie total de 635 metros cuadrados sobre una parcela de 1.175 metros cuadrados. Vinculada en otros tiempos a la explotación agrícola y sericícola actualmente alberga la Casa del Belén de la Región de Murcia como museo de artesanía belenista.\\nLa casa la construye don Diego Ayllón Mula para que sirva de residencia de su hijo mayor que se casará con Ana Ramírez de Carrión.\\nEn esa época, la casa quedaba en las afueras del pueblo en una zona con mucha vegetación y mucha agua que atraía a la fauna menor de la zona como zorras, jabalíes y topos."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%86_%D9%85%D8%A7%D8%B1%D8%AA%DB%8C%D9%86%D8%8C_%D8%A8%D9%88%D8%A6%D9%86%D9%88%D8%B3_%D8%A2%DB%8C%D8%B1%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Catedraldesanmartin.JPG","page_title":"سن مارتین، بوئنوس آیرس","context_page_description":"سن مارتین، بوئنوس آیرس یک شهر در آرژانتین است که در خنرال سن مارتین پارتیدو واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Tropical_Storm_Andres_(1997)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Andres_1997_rainfall.png","page_title":"Tropical Storm Andres (1997)","context_page_description":"Tropical Storm Andres is one out of two tropical cyclones on record to strike El Salvador. The first named storm of the active 1997 Pacific hurricane season, Andres formed on June 1 off the coast of Mexico. It initially moved toward the coast, although a change in steering winds turned the storm toward Mexico and Guatemala. After passing just offshore, Andres again changed direction toward the southeast, gradually weakening in the process. On June 7, it turned toward and hit El Salvador before dissipating. The storm brought rainfall to coastlines along much of its path, destroying some houses and inflicted damage. Two fishermen were reported missing in Nicaragua due to high seas, and there were four deaths in El Salvador."},{"page_url":"https://fr.wikipedia.org/wiki/Andy_Hawkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Andy_Hawkins_2011.jpg","page_title":"Andy Hawkins","context_page_description":"Melton Andrew Hawkins est un lanceur droitier de baseball ayant joué de 1982 à 1991 dans les Ligues majeures, dont 7 saisons avec les Padres de San Diego."},{"page_url":"https://gl.wikipedia.org/wiki/Tsukumi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Tsukumi_in_Oita_Prefecture.png","page_title":"Tsukumi","context_page_description":"Tsukumi é un concello da prefectura de Ōita no Xapón. Está situada ao leste da prefectura e da rexión de Kyūshū, a illa de Kyūshū. Ten 79,54 km² de superficie e unha poboación de 20.129 habitantes e unha densidade de poboación de 253 h/km².\\nO concello de Tsukumi limita cos concellos de Usuki e de Saiki."},{"page_url":"https://es.wikipedia.org/wiki/Sabana_de_piedemonte_del_suroeste_de_Arabia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/AT1320_map.png","page_title":"Sabana de piedemonte del suroeste de Arabia","context_page_description":"La sabana de piedemonte del suroeste de Arabia es una ecorregión de la ecozona afrotropical, definida por WWF, que se extiende a mediana altitud por las montañas del sur de la península arábiga."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Mitte","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Stolperstein_Lichtenberger_Str_32_%28Mitte%29_Gert_Simonsohn.jpg","page_title":"Liste der Stolpersteine in Berlin-Mitte","context_page_description":"Die Liste der Stolpersteine in Berlin-Mitte enthält die Stolpersteine im Berliner Ortsteil Mitte im Bezirk Mitte, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Tabelle erfasst insgesamt 873 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://fr.wikipedia.org/wiki/Famille_Acciaiuoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Armoiries_Famille_Acciaiuoli.svg","page_title":"Famille Acciaiuoli","context_page_description":"La famille Acciaiuoli est une importante famille florentine originaire de Brescia qui tire son nom du commerce de l’acier, à la base de sa richesse. Elle joue un rôle important dans l’histoire du duché d'Athènes où elle succède à la Compagnie de Navarre qui avait conquis Thèbes en 1379 et à la maison d'Aragon dans le reste du duché. Nério Acciaiuoli, aventurier, conquiert Athènes en 1388, puis Néopatras en 1390. Après une éphémère domination vénitienne, les Acciaiuoli demeurent maîtres des duchés jusqu’à leur reconquête par les Byzantins en 1430. Ils reconnaissent alors la suzeraineté de Constantinople et réussissent à se maintenir jusqu’en 1456, date de la prise d'Athènes par Mehmed II."},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_from_Portland,_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Amine_performing_on_Jimmy_Fallon_in_2017_%28crop%29.png","page_title":"List of people from Portland, Oregon","context_page_description":"Portland is a port city in the U.S. state of Oregon located at the confluence of the Willamette and Columbia Rivers. Established in the 1830s as a camp along the Oregon Trail, Portland evolved into a major West Coast industrial city during the twentieth century. Contemporarily, it is the most populous city in Oregon, and the second-largest city in the Pacific Northwest.\\nThis list of notable people includes persons who were either born in, are current residents of, or have lived in Portland. A person who lives in or comes from Portland, Oregon is called a Portlander."},{"page_url":"https://cs.wikipedia.org/wiki/Multiplex_22","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Prima_Cool_logo_zelen%C3%A9.png","page_title":"Multiplex 22","context_page_description":"Multiplex 22 je druhý finální multiplex DVB-T2 v České republice. Provozují ho České Radiokomunikace, a.s. Postupně nahrazuje DVB-T multiplex 2. Během souběžného vysílání DVB-T a DVB-T2 multiplex vysílal jako přechodová síť 12, ve kterém vysílaly i programy multiplexu 23."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B5%86%E0%B5%BD%E0%B4%B8%E0%B5%BA_%E0%B4%86%E0%B5%BD%E0%B4%97%E0%B5%8D%E0%B4%B0%E0%B5%86%E0%B5%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Nelson_Algren_NYWTS.jpg","page_title":"നെൽസൺ ആൽഗ്രെൻ","context_page_description":"നെൽസൺ ആൽഗ്രെൻ ഒരു അമേരിക്കൻ എഴുത്തുകാരനായിരുന്നു. 1949 ൽ പ്രസിദ്ധീകരിക്കപ്പെട്ടതും നാഷണൽ ബുക്ക് അവാർഡ് നേടിയതുമായ “ദ മാൻ വിത്ത് ദ ഗോൾഡൻ ആം” എന്ന പ്രശസ്ത കൃതിയുടെ പേരിലാണ് അദ്ദേഹം ഏറ്റവും കൂടുതൽ അറിയപ്പെടുന്നത്. ഈ നോവൽ 1955 ൽ ഇതേ പേരിൽ സിനിമയാക്കപ്പെട്ടിരുന്നു."},{"page_url":"https://en.wikipedia.org/wiki/Dresden%E2%80%93Werdau_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Hp._Steinpleis_%282%29.JPG","page_title":"Dresden–Werdau railway","context_page_description":"The Dresden–Werdau railway is an electrified, double-track main line in the German state of Saxony. It runs from Dresden via Freiberg, Chemnitz and Zwickau to Werdau wye, where it joins the Leipzig-Hof railway.\\nThe line was opened in several sections and its first section from Werdau to Zwickau was opened 1845, making it one of the oldest railways in Germany. The Dresden–Tharandt section was completed in 1855, the Chemnitz–Zwickau section followed in 1858, the line was extended from Tharandt to Freiberg in 1862 and the section from Chemnitz to Flöha was opened as part of the line to Annaberg in 1866. The entire line was not open until 1869, when the missing section from Freiberg-Flöha was opened. From then on the railway line developed into an important connection. It continues to be an important part of the so-called Saxon-Franconian trunk line from Dresden to Nuremberg."},{"page_url":"https://de.wikipedia.org/wiki/The_Last_of_Us","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/The_Last_of_Us_crossing_USA_en.png","page_title":"The Last of Us","context_page_description":"The Last of Us ist ein Action-Adventure und Survival-Horror-Computerspiel entwickelt von Naughty Dog und publiziert von Sony Interactive Entertainment, das am 14. Juni 2013 exklusiv für Sonys PlayStation 3 veröffentlicht wurde. Offiziell vorgestellt wurde das Spiel bei den Spike Video Game Awards am 10. Dezember 2011. Im Juli 2014 erschien eine Remastered-Version für die PlayStation 4.\\nDas Spiel handelt von zwei Überlebenden: dem erwachsenen Texaner Joel und der jungen Ellie, die zusammen durch die postapokalyptischen Vereinigten Staaten ziehen. Die meisten Menschen sind in diesem Szenario einer Infektion mit einem Pilz ähnlich dem Ophiocordyceps unilateralis erlegen, der ihre Gehirne befällt und sie in aggressive Mutanten verwandelt, deren Körper mit fortschreitender Infektion zunehmend verfällt.\\nInnerhalb von drei Wochen wurden weltweit 3,4 Millionen Exemplare des Spiels verkauft. 2016 wurde der Nachfolger The Last of Us Part II angekündigt. Diese Fortsetzung erschien schließlich am 19. Juni 2020."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Maria_a_Campiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Cafaggiolo-Chapel_in_front_of_the_Villa.jpg","page_title":"Chiesa di Santa Maria a Campiano","context_page_description":"La chiesa di Santa Maria a Cafaggiolo si trova nel comune di Barberino di Mugello, vicino alla villa di Cafaggiolo."},{"page_url":"https://fr.wikipedia.org/wiki/Coblence","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Stadtteilkarte_Koblenz-Metternich.png","page_title":"Coblence","context_page_description":"Coblence est une ville et un arrondissement d'Allemagne, situés dans le nord du Land de la Rhénanie-Palatinat. Au 31 décembre 2014, la ville comptait 111 434 habitants.\\nLes villes les plus proches sont Bonn, à près de 60 km en aval du Rhin, et Mayence, à 90 km en amont du Rhin. Coblence est la troisième ville de la Rhénanie-Palatinat et le siège de la conurbation Mayen-Coblence. C'est également une ville universitaire.\\nLe nom Coblence vient du latin Confluentes qui signifie confluent. Depuis 2002, une partie de Coblence a été inscrite au patrimoine mondial de l'UNESCO.\\nCoblence se trouve dans une région appelée Deutsches Eck, littéralement le coin allemand, au confluent de la Moselle et du Rhin. La ville est bordée par une partie du Hunsrück au sud et par le paysage légèrement vallonné du Maifeld à l'ouest.\\nLes quartiers de la ville situés sur la rive droite du Rhin se trouvent à la bordure de la forêt du Westerwald, qui plonge en partie jusqu'au fleuve. Les quartiers situés entre le Rhin et la Moselle sont en partie plantés d'une forêt mixte qui constitue le poumon vert de la ville et de sa banlieue proche."},{"page_url":"https://eo.wikipedia.org/wiki/Federacio_(nubskrapuloj)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Federation-Tower_in_July%2C_Moscow.jpg","page_title":"Federacio (nubskrapuloj)","context_page_description":"Federacio estas sistemo el du turdomoj, konstruata sur tereno 13 de Moskva-Siti. Ĝi konsistas el 95-etaĝa nubskrapulo \\"Oriento\\" kaj 63-etaĝa \\"Okcidento\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%AA%E3%83%BC%E3%83%B3%E3%83%BB%E3%83%87%E3%83%A5%E3%83%BC%E3%83%8F%E3%83%BC%E3%82%B9%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Colleen_Dewhurst.JPG","page_title":"コリーン・デューハースト","context_page_description":"コリーン・デューハーストはカナダ・モントリオール出身の俳優。"},{"page_url":"https://pt.wikipedia.org/wiki/Golpes_de_Estado_na_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Eduardo_Lonardi_y_Pedro_Eugenio_Aramburu_Revoluci%C3%B3n_Libertadora.png","page_title":"Golpes de Estado na Argentina","context_page_description":"Na Argentina aconteceram seis golpes de estado durante o século XX, em 1930, 1943, 1955, 1962, 1966 e 1976. Os quatro primeiros estabeleceram ditaduras provisórias enquanto os dois últimos estabeleceram ditaduras de tipo permanente segundo o modelo de estado burocrático-autoritário. O último levou a cabo uma guerra suja na linha do terrorismo de Estado, no que foram violados massivamente os direitos humanos, com dezenas de milhares de desaparecidos.\\nNos 53 anos que transcorreram desde o primeiro golpe de estado em 1930, até cair a última ditadura em 1983, os militares governaram 25 anos, impondo 14 ditadores com o título de presidente, um cada 1,7 anos. Nesse período todas as experiências de governo eleitas democraticamente foram interrompidas mediante golpes de estado."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%BC%D0%B5%D1%80%D0%BD%D1%96_%D0%B7%D0%BD%D0%B0%D0%BA%D0%B8_%D0%91%D0%BE%D1%81%D0%BD%D1%96%D1%97_%D1%96_%D0%93%D0%B5%D1%80%D1%86%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bosnia_and_Herzegovina_new_license_plate.JPG","page_title":"Номерні знаки Боснії і Герцеговини","context_page_description":"Автомобільні номерні знаки Боснії і Герцеговини використовуються для реєстрації транспортних засобів у Боснії і Герцеговини. Вони використовуються для перевірки законності використання, наявності страхування та ідентифікації транспортних засобів.\\nНовий формат номерних знаків введений у 1998 році. Знак містить сім символів: п'ять цифр і дві літери, розташовані в такому порядку: «X00-X-000». Поєднання символів не пов'язане з географічним розташуванням. Використовуються лише літери, які є спільними для латиниці та кирилиці.\\nЗліва пластини розміщена синя смуга, уподібнена до смуги ЄС. Символи чорні на білому тлі."},{"page_url":"https://en.wikipedia.org/wiki/Dadeldhura_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Dadeldhura_Sudurpashchim_locator.png","page_title":"Dadeldhura District","context_page_description":"Dadeldhura district, a part of Sudurpashchim Pradesh, is one of the seventy-seven districts of Nepal. The district, with Dadeldhura as its district headquarters, covers an area of 1,538 km² and had a population of 126,162 in 2001 and 142,094 in 2011.\\nThe region has a desert-mountainous landscape that contains many religious temples. The district is seldom visited by tourists but contains local routes to Mt Kailaish in Tibet, Ra Ra Lake in Humla district and the last remaining remnants of the Far Western Malla Kingdom. Nagi Malla was the last royal to live here before Nepalese unification.\\nThe spoken language is Dotyal and the majority of inhabitants are Hindu. The district is rural but some modernization is occurring. Dadeldhura is the most developed district among the other hilly districts in far Western region."},{"page_url":"https://pl.wikipedia.org/wiki/Kiedrich","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Kiedrich-pano-01s.jpg","page_title":"Kiedrich","context_page_description":"Kiedrich – miejscowość i gmina w Niemczech, w kraju związkowym Hesja, w rejencji Darmstadt, w powiecie Rheingau-Taunus."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Europas_fugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Soft-plumaged_Petrel.jpg","page_title":"Liste over Europas fugler","context_page_description":"Denne listen over Europas fugler inkluderer 886 arter. Inkludert er 24 introdusert art.\\nRekkefølge er etter Clements-lista versjon v2015\\nDe norske navn er etter Norske navn på verdens fugler.\\nStatus på lista:\\nFA - Fremmed art. En art som forekommer utenfor sitt naturlige utbredelsesområde. Arten har blitt frakta dit av mennesker.\\nS - Europeisk sjeldenhet eller tilfeldig.\\nX - Lokalt utryddet\\nEX - Utryddet etter IUCNs rødliste\\nNT - Nær truet etter IUCNs rødliste\\nVU - Sårbar etter IUCNs rødliste\\nEN - Sterkt truet etter IUCNs rødliste\\nCR - Kritisk truet etter IUCNs rødliste"},{"page_url":"https://fr.wikipedia.org/wiki/Gottlieb_Siegfried_Bayer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Acta_Eruditorum_-_II_monete%2C_1736_%E2%80%93_BEIC_13456523.jpg","page_title":"Gottlieb Siegfried Bayer","context_page_description":"Gottlieb Siegfried Bayer est un antiquaire et orientaliste allemand, né à Königsberg, aujourd'hui Kaliningrad en 1694 et mort à Saint-Pétersbourg en 1738."},{"page_url":"https://pl.wikipedia.org/wiki/Buchs_(Argowia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Buchs_Chocolat_Frey_3046.jpg","page_title":"Buchs (Argowia)","context_page_description":"Buchs – gmina w północnej Szwajcarii, w kantonie Argowia, w okręgu Aarau. 31 grudnia 2014 liczyła 7587 mieszkańców."},{"page_url":"https://bg.wikipedia.org/wiki/Francolinus_gularis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Francolinus_gularis_hm.jpg","page_title":"Francolinus gularis","context_page_description":"Francolinus gularis е вид птица от семейство Phasianidae. Видът е световно застрашен, със статут Уязвим."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B8%D0%BE%D0%BB%D1%8C,_%D0%94%D0%B8%D0%B4%D1%8C%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Toyota_Corolla_WRC_01.jpg","page_title":"Ориоль, Дидье","context_page_description":"Дидье́ Орио́ль — французский автогонщик, раллист; четырёхкратный победитель чемпионата Франции по ралли; чемпион мира по ралли 1994 года. Родился в Монпелье, и первоначально работал водителем в скорой помощи. Ориоль получил известность в чемпионате мира по ралли в 1990-е. Он стал чемпионом мира по ралли в 1994-м. Является рекордсменом по количеству побед на Ралли Корсики. Получил прозвище «Шевалье асфальта» за то, что очень силен был на асфальтовых трассах."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%85%CE%BC%CE%BC%CE%B5%CF%84%CE%BF%CF%87%CE%AE_%CF%84%CE%B7%CF%82_%CE%99%CF%83%CF%80%CE%B1%CE%BD%CE%AF%CE%B1%CF%82_%CF%83%CF%84%CE%B7_Eurovision","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/David_Fern%C3%A1ndez_Ortiz_-_Rodolfo_Chikilicuatre_-_ESC_2008.jpg","page_title":"Συμμετοχή της Ισπανίας στη Eurovision","context_page_description":"Η Ισπανία συμμετείχε στο διαγωνισμό τραγουδιού της Eurovision 59 φορές από τότε που έκανε το ντεμπούτο της το 1961, όπου έφτασε την ένατη θέση. Από το 1999, η Ισπανία είναι μία από τις \\"Μεγάλες Πέντε\\", μαζί με τη Γαλλία, τη Γερμανία, την Ιταλία και το Ηνωμένο Βασίλειο, οι οποίοι μπορούν αυτομάτως να συμμετάσχουν στον τελικό, επειδή είναι οι πέντε μεγαλύτεροι οικονομικοί συντελεστές στην Ευρωπαϊκή Ραδιοτηλεοπτική Ένωση. Η Ισπανία διαγωνίζεται συνεχώς στο διαγωνισμό από το ντεμπούτο της χώρας το 1961. Η μόνη χώρα με μακρύτερη πορεία απρόσκοπτης εμφάνισης της Eurovision είναι το Ηνωμένο Βασίλειο, που είναι παρών από το 1959.\\nΗ Ισπανία κέρδισε το διαγωνισμό δύο φορές, πρώτα το 1968 με το τραγούδι \\"La, la, la\\" που τραγούδησε η Μασσιέλ και πάλι το 1969, όταν το \\"Vivo cantando\\" της Σαλομέ κέρδισε σε ισοβαθμία με άλλα 3 τραγούδια, το \\"Boom Bang-a-Bang\\" της Λουλού, που εκπροσωπούσε το Ηνωμένο Βασίλειο, το \\"Un jour, un enfant\\" της Φρίντα Μποκαρά, που εκπροσωπούσε τη Γαλλία, και το \\"De troubadour\\" του Λένι Κούρ, το οποίο εκπροσωπούσε την Ολλανδία. Ο διαγωνισμός στη Μαδρίτη το 1969 είναι η μοναδική φορά που η Ισπανία φιλοξένησε την εκδήλωση."},{"page_url":"https://sv.wikipedia.org/wiki/Bl%C3%A5vingeklerodendrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Rotheca_myricoides_%28119832510%29.jpg","page_title":"Blåvingeklerodendrum","context_page_description":"Blåvingeklerodendrum är en växt i familjen kransblommiga växter. Arten är ursprungligen från tropiska Uganda och Zimbabwe och odlas som krukväxt i Sverige. Den har tidigare förts till klerodendrumsläktet.\\nBlåvingeklerodendrum är en slingerväxt, med ovala och klargröna, som kan få rankor på upp till fyra meter i sitt vilda tillstånd i naturen, men hos krukväxter blir de oftast inte mer än ett par meter. Blommorna har ett mycket speciellt utseende och liknar små blåvioletta fjärilar, och sitter samlade i ganska glesa samlingar. Blomman håller sig någon vecka, medan de blå foderbladen sitter kvar flera veckor därefter.\\nDen som sett fjärilen blåvinge förstår precis var blomman fått sitt svenska namn ifrån."},{"page_url":"https://en.wikipedia.org/wiki/Miss_Ohio_USA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/CINvTOR_2017-05-27_-_Alice_Magoto_%2834232289693%29_%28cropped%29.jpg","page_title":"Miss Ohio USA","context_page_description":"The Miss Ohio USA competition is the pageant that selects the representative for the state of Ohio in the Miss USA pageant, and the name of the title held by that winner. It has previously been known as Miss Ohio Universe. It is produced by Proctor Productions.\\nThe pageant is currently held in Springfield and has previously been hosted by Mentor, Steubenville and Portsmouth.\\nTwo Ohio representatives, Sue Downey in 1965 and Kim Seelbrede in 1981, have won the Miss USA title and competed in the Miss Universe pageant.\\nThe most notable Miss Ohio USA is actress and Oscar winner Halle Berry, who was 1st runner up at Miss USA 1986. Other notable former titleholders include actress, model and sportscaster Jayne Kennedy and two former Survivor contestants, Kim Mullen of Survivor: Palau and Candace Smith of Survivor: Tocantins. Two Miss Ohio USA titleholders have previously competed at Miss Teen USA. Two have also competed at Miss America.\\nSthephanie Miranda of Campbell was crowned Miss Ohio USA 2020 on November 9, 2019 at Matthews Auditorium in Sharonville. She will represent Ohio for the title of Miss USA 2020."},{"page_url":"https://pl.wikipedia.org/wiki/Arrows","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Alex_Caffi_1991.jpg","page_title":"Arrows","context_page_description":"Arrows właśc. Arrows Grand Prix International – nieistniejący obecnie brytyjski zespół i konstruktor Formuły 1, który wziął udział w Mistrzostwach Świata Formuły 1 w sezonach 1978-1990 i 1997–2002. W sezonach 1991-1996 stajnia startowała pod nazwą Footwork. W ekipie Arrowsa jeździli m.in. Riccardo Patrese, Thierry Boutsen czy Damon Hill. Zespół wystartował w 291 wyścigach, w których zdobył 142 punkty. Największym sukcesem brytyjskiego zespołu było pięciokrotne zajęcie drugiego miejsca – po raz ostatni zdobył Damon Hill podczas Grand Prix Węgier 1997, natomiast najlepszym sezonem był sezon 1988, w którym Arrows zajął piąte miejsce."},{"page_url":"https://it.wikipedia.org/wiki/Spedizioni_celtiche_nei_Balcani","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/DHM_-_Regenbogensch%C3%BCsselchen.jpg","page_title":"Spedizioni celtiche nei Balcani","context_page_description":"Le spedizioni celtiche in Grecia e nella penisola balcanica furono una serie di movimenti di popolazioni celte e di spedizioni militari, ben attestate da fonti greche e confermate dai ritrovamenti archeologici, le quali tra lo scorcio del IV e i primi decenni del III secolo a.C., determinarono la penetrazione di ondate di Celti nella Penisola balcanica, fino a lambire il recinto sacro di Apollo a Delfi.\\nIl retroterra storico che favorì le invasioni celtiche nella penisola va ricercato nel mutato quadro degli equilibri europei: la civiltà celtica, al suo apogeo, sperimentava una fase di larghissima espansione proprio mentre sul territorio italiano si registrava l'ascesa politica di Roma; più vulnerabile era quindi il mondo ellenico, alle prese con la problematica e confusa successione ad Alessandro Magno.\\nLe incursioni nella penisola balcanica, potenzialmente destabilizzanti, sortirono conseguenze politiche effimere: le egemonie spesso non si consolidarono o addirittura, come nel caso di Delfi e del Regno di Macedonia, non si concretizzarono neppure; laddove presero piede, come nel regno di Tylis o in Tracia, furono di breve o brevissima durata."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%89%E6%9E%9D%E4%BF%91%E7%81%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/%E4%B8%89%E6%94%AF%E4%BF%91%E9%93%9C%E7%81%AF_%E5%A4%B4%E9%83%A8.jpg","page_title":"三枝俑灯","context_page_description":"三枝俑燈，又名三支俑銅燈，出土自中華人民共和國雲南省個舊黑瑪井東漢墓地，是滇國青銅器的代表作，現為雲南省博物館藏。"},{"page_url":"https://lt.wikipedia.org/wiki/Anyk%C5%A1%C4%8Di%C5%B3_koply%C4%8Dia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Anyk%C5%A1%C4%8Di%C5%B3_koply%C4%8Dia_3.JPG","page_title":"Anykščių koplyčia","context_page_description":"Anykščių koplyčia – Anykščių senųjų kapinių koplyčia, esanti netoli miesto centro, Vilniaus g. 36. Tai vienas iš keleto pastatų, išlikusių Anykščiuose iš XIX a. vidurio. Nuosavybės teisė priklauso Anykščių rajono savivaldybei. Senoji koplyčia apsaugota šiuolaikiniu stiklo gaubtu. Ji iš karto atlieka kelias funkcijas: valstybinės įstaigos, sakralinę, koncertinę, muziejinę, parodų. Senąją ir naująją architektūrą atspindintis pastatas jau daug metų yra Anykščių kultūros židinys.\\nKoplyčia veikia kaip daugiafunkcinis kultūros centras, yra vienas iš kultūrinio turizmo traukos centrų Anykščiuose. Koplyčios erdvės pritaikytos daugeliui kultūrinės veiklos sričių, kitiems kultūriniams projektams įgyvendinti. Puikia akustika pasižyminčioje salėje vyksta klasikinės muzikos koncertai, organizuojamos profesionalaus meno ir tautodailės parodos. Koplyčioje rengiami edukaciniai užsiėmimai „Tapyba ant vandens“."},{"page_url":"https://ms.wikipedia.org/wiki/Terrapene_carolina_mexicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Terrapene_carolina_mexicana.jpg","page_title":"Terrapene carolina mexicana","context_page_description":"Terrapene carolina mexicana juga dikenali sebagai Kura-kura Katup Mexico ialah subspesies kura-kura katup yang berasal dari Mexico."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%BB%BA%E9%95%B7%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Kenchoji_Pond.jpg","page_title":"建長寺","context_page_description":"建长寺是位在日本神奈川县镰仓市的寺院，临济宗建长寺派大本山。山号“巨福山”。本尊地藏菩萨、开基为北条时赖、开山为兰溪道隆。镰仓五山第一位。境内以“建长寺境内”被指定为国之史迹。"},{"page_url":"https://fr.wikipedia.org/wiki/Cit%C3%A9_portugaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Mazagan2-CCBY.jpg","page_title":"Cité portugaise","context_page_description":"La cité portugaise est un quartier historique proche de la médina de la ville d'El Jadida, au Maroc. Construit par les Portugais, la cité occupe une superficie de 0,956 km². Elle se compose de quatre bastions : de l'Ange, Saint-Esprit, Saint-Sébastien et Saint-Antoine. Bab El Bhar est une des portes de la cité. Au centre de la cité se trouve une citerne souterraine comportant 23 portes. En 1516, la cité est une prison et une garnison portugaises. En 1790 la cité devient marocaine."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%94%E1%83%A0%E1%83%90%E1%83%9C%E1%83%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Jasikovac.jpg","page_title":"ბერანე","context_page_description":"ბერანე — ქალაქი მონტენეგროში; ბერანეს მუნიციპალიტეტის ადმინისტრაციული ცენტრი. 2011 წლის მდგომარეობით ქალაქში ცხოვრობს 11 073 ადამიანი."},{"page_url":"https://en.wikipedia.org/wiki/Snje%C5%BEana_Kordi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Existential_clauses2.jpg","page_title":"Snježana Kordić","context_page_description":"Snježana Kordić; born 29 October 1964 is a Croatian linguist. In addition to her work in syntax, she has written on sociolinguistics. Kordić is known among non-specialists for numerous articles against the puristic and prescriptive language policy in Croatia. Her 2010 book on language and nationalism popularises the theory of pluricentric languages in the Balkans."},{"page_url":"https://de.wikipedia.org/wiki/Charlotte_Berend-Corinth","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Junge_Frau_mit_Katzen.jpg","page_title":"Charlotte Berend-Corinth","context_page_description":"Charlotte Berend-Corinth war eine deutsche Malerin, Lithographin, Buchillustratorin und Autorin der Moderne. Sie war zudem Schülerin, Ehefrau und häufiges Modell des Malers Lovis Corinth.\\nAb 1908 präsentierte sie ihre eigenen Werke in Ausstellungen der Berliner Secession, konzentrierte sich jedoch vor allem auf ihre Familie und die Karriere ihres Ehemanns. Nach dem Tod von Lovis Corinth war sie in Deutschland und nach ihrer Emigration auch in den USA als Künstlerin erfolgreich. Sie schrieb zudem mehrere Bücher und stellte 1958 das Werkverzeichnis Die Gemälde von Lovis Corinth zusammen, das bis heute als Standard genutzt wird."},{"page_url":"https://de.wikipedia.org/wiki/Barlaam_von_Kalabrien","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Barlaam%2C_Carrying_a_Should.jpg","page_title":"Barlaam von Kalabrien","context_page_description":"Barlaam von Kalabrien war ein süditalienischer Kleriker und Gelehrter, der im 14. Jahrhundert wirkte. Er spielte kurzzeitig eine bedeutende Rolle in der Kirchenpolitik des Byzantinischen Reiches sowie in der orthodoxen Theologie, fiel jedoch im Streit um die Hesychasten beim byzantinischen Kaiser in Ungnade. Später wurde er Bischof von Gerace in Süditalien."},{"page_url":"https://en.wikipedia.org/wiki/Three-man_chess","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Three-Man_Chess_moves_-_bishop%2C_pawn.PNG","page_title":"Three-man chess","context_page_description":"Three-man chess is a chess variant for three players invented by George R. Dekle Sr. in 1984. The game is played on a hexagonal board comprising 96 quadrilateral cells. Each player controls a standard army of chess pieces.\\nThree-man chess was included in World Game Review No. 10 edited by Michael Keller."},{"page_url":"https://af.wikipedia.org/wiki/Peter_Svidler","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Peter_Svidler_2013.jpg","page_title":"Peter Svidler","context_page_description":"Pyotr Veniaminovich Svidler is 'n Russiese skaakspeler en grootmeester. Hy het die Russiese skaakkampioenskap ag maal gewen in 1994, 1995, 1997, 2003, 2008, 2011, 2013 en 2017."},{"page_url":"https://en.wikipedia.org/wiki/William_Harrison_Folsom","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/SLCOldCityhall.jpg","page_title":"William Harrison Folsom","context_page_description":"William Harrison Folsom was an architect and contractor. He constructed many of the historic buildings in Utah, particularly in Salt Lake City. Folsom is probably best known as a Latter-day Saint architect. Many of his most prominent works were commissioned by The Church of Jesus Christ of Latter-day Saints. For a time he was sustained as the Church Architect, a calling in the church."},{"page_url":"https://it.wikipedia.org/wiki/Joseph_Lhota","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Joseph_J._Lhota.jpg","page_title":"Joseph Lhota","context_page_description":"Joseph J. Lhota, meglio noto come Joe Lhota, è un politico statunitense, in passato vice sindaco di New York e presidente e amministratore delegato della Metropolitan Transportation Authority di New York.\\nÈ stato il candidato repubblicano alla carica di sindaco di New York alle elezioni del novembre 2013.\\nHa ricoperto vari incarichi sotto l'amministrazione Giuliani, fra cui quello di vice sindaco. Dal 9 gennaio al 31 dicembre 2012 è stato presidente e amministratore delegato della Metropolitan Transportation Authority di New York, nominato dal governatore di New York Andrew Cuomo e confermato all'unanimità dal Senato dello Stato di New York.\\nPrima di entrare nella MTA, Lhota era un dirigente della società Madison Square Garden, Inc., ed è stato Assessore per le operazioni di New York sotto Rudolph Giuliani. Lhota è stato anche direttore del bilancio e commissario della finanza della città di New York, ed era un membro del consiglio della MTA.\\nLhota si è laureato alla Georgetown University e alla Harvard Business School ed è un fiduciario dell'Università della Città di New York."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B8%D0%A3-5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Ziu5_rear_bridge.jpg","page_title":"ЗиУ-5","context_page_description":"ЗиУ-5 — советский высокопольный троллейбус большой вместимости для внутригородских пассажирских перевозок, серийно производившийся с 1959 по 1972 годы на заводе имени Урицкого в городе Энгельсе Саратовской области. Названием машины является аббревиатура полного названия завода-производителя, которая также служила и его торговой маркой до переименования предприятия.\\nПолное число выпущенных ЗиУ-5 превышает 16 000 машин. Это позволило ЗиУ-5 занять доминирующее положение среди работавших в СССР того времени моделей троллейбусов. Последние ЗиУ-5 были отставлены от работы с пассажирами в середине-конце 1980-х годов. Одними из последних городов СССР, где работали ЗиУ-5, стали:\\nЖитомир\\nДнепропетровск\\nМинск.\\nМосква.\\nОдесса.\\nЛенинград.\\nМестные ремонтные заводы позволяли дольше, чем в других местах, поддерживать в форме последние троллейбусы этой марки, таким образом их срок службы вместо положенных 14 лет продлевался до 16-17 лет. Один из последних ЗиУ-5, реально работавший, а не находящийся в музее, сгорел в Харькове весной 2005 года. Это была лаборатория контактной сети. Небольшое число сохранившихся ходовых ЗиУ-5 в 1990-е и 2000-е годы стали музейными экспонатами."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%81%94%E5%90%88%E5%9B%BD%E5%AE%89%E5%85%A8%E7%90%86%E4%BA%8B%E4%BC%9A%E5%B8%B8%E4%BB%BB%E7%90%86%E4%BA%8B%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/G4_Nations.svg","page_title":"联合国安全理事会常任理事国","context_page_description":"聯合國安全理事會常任理事國是聯合國安全理事會中的常任成員，五個創始成員國是二戰期間同盟國中的五大國。其中，中國和俄羅斯的代表政權曾有所改變。中國原由中華民國代表、俄羅斯原由蘇維埃社會主義共和國聯盟代表。"},{"page_url":"https://eu.wikipedia.org/wiki/Crassulaceae","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Crassula_ovata_700.jpg","page_title":"Crassulaceae","context_page_description":"Krasulazeoak Saxifragalen ordenako landare-familia bat dira. Landare belarkarak dira, edo zuhaixka-formakoak, eta gehienetan zukutsuak. Mundu osoan bizi dira, baina, batez ere, Ipar hemisferioan eta Afrikako hegoaldean.\\nKrasulazeoak, eskuarki, zukutsuak dira, hau da, ura metatzen dute hostoetan, eskualde lehor eta beroetan bizi baitira, ur gutxiko tokietan alegia. Familiak 1.400 espezie inguru ditu, 33 generotan banatuak.\\nHosto bakunak dituzte, eta antolaketa aldatu egiten da espezietik espeziera: aurkakoak, txandakatuak edo hosto-errosetak, estipularik gabeak. Loreak hermafroditak dira, erregularrak. Fruituak kapsula- edo folikulu-formakoak dira.\\nKrasulazeoen familiako espezie asko apaingarri gisa erabiltzen dira, landare gogorrak baitira, zaindu beharra ez dutenak, eta askok itxura bitxia dute. Gainera, erraz ugaltzen dira.\\nSailkapena ez da erraza, espezieek hibridaziorako joera baitute, hala basalandareek nola landatuek. Sailkapen zaharretan Rosales ordenan sartzen ziren, baina, gaur egun, Saxifragales ordenan sailkatzen dira."},{"page_url":"https://ca.wikipedia.org/wiki/Santuari_de_la_Mare_de_D%C3%A9u_de_Lord","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Santuari_de_Lord-PM_44512.jpg","page_title":"Santuari de la Mare de Déu de Lord","context_page_description":"El Santuari de la Mare de Déu de Lord és una església declarada bé cultural d'interès nacional de Sant Llorenç de Morunys."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%85s_(Krokom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%C3%85s_kyrka.jpg","page_title":"Ås (Krokom)","context_page_description":"Ås est une paroisse suédoise située dans la commune de Krokom, dans le Comté de Jämtland. Ås se trouve sur les bords du lac Storsjön et du fleuve Indalsälven. La paroisse est mentionnée dès le Moyen Âge. Les premières mentions écrites du nom d'Ås remontent à 1303. Le pèlerinage de Saint Olaf passe par Ås. L'étape ultime du pèlerinage est la Cathédrale de Nidaros à Trondheim.\\nÅs est aussi une localité à environ 10 km d'Östersund. Jusqu'à 1952, Ås a été chef-lieu de l'ancienne commune d'Ås."},{"page_url":"https://hu.wikipedia.org/wiki/Flavin-adenin-dinukleotid","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/FAD_B%26S.png","page_title":"Flavin-adenin-dinukleotid","context_page_description":"A flavin-adenin-dinukleotid elektronátvivő kofaktor, amely fontos szerepet játszik az oxidatív foszforilációban és a zsírsavak β-oxidációjában."},{"page_url":"https://it.wikipedia.org/wiki/Villa_Favard","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Villa_favard%2C_esterno_01.jpg","page_title":"Villa Favard","context_page_description":"Villa Favard, chiamata anche Palazzo Favard, si trova a Firenze, in via Curtatone 1, angolo Lungarno Vespucci 36, con affacci anche su via Palestro 2, via e via Curtatone 1. È attualmente sede della scuola di Fashion Business e Design Polimoda.\\nSi tratta di una delle opere maggiori di Giuseppe Poggi e di uno dei più significativi esempi di architettura privata fiorentina del secondo Ottocento: chiaramente ispirata a modelli propri delle residenze suburbane fiorentine del Cinquecento, si presenta autonoma rispetto agli allineamenti viari - vinti gli ostacoli posti dall'amministrazione comunale -, aperta alla luce del lungarno e circondata da un giardino che le conferisce, nonostante il tessuto urbano nel quale si colloca, la dignità di villa."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E5%B8%83%E6%96%AF%E6%B2%B3%E7%95%94%E5%85%8B%E9%A9%AC%E6%BB%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/AUT_Kematen_an_der_Ybbs_COA.jpg","page_title":"伊布斯河畔克马滕","context_page_description":"伊布斯河畔克马滕是奥地利下奥地利州阿姆施泰滕县的一个市镇。总面积11平方公里，总人口2484人，人口密度225.8人/平方公里。"},{"page_url":"https://simple.wikipedia.org/wiki/Andelsbuch","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Andelsbuch_im_Bezirk_B.png","page_title":"Andelsbuch","context_page_description":"Andelsbuch is a municipality in the district of Bregenz in the Austrian state of Vorarlberg."},{"page_url":"https://de.wikipedia.org/wiki/Unterst%C3%BCtzungskommando_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/TrspBtl_443..png","page_title":"Unterstützungskommando 4","context_page_description":"Das Unterstützungskommando 4 war ein Unterstützungskommando des Heeres der Bundeswehr mit Sitz des Stabes zuletzt in Diez.\\nDer Großverband wurde 1986 ausgeplant und 1994 aufgelöst. Das Unterstützungskommando unterstand dem Befehlshaber im Wehrbereich IV. Hauptaufgabe war die Unterstützung der US-amerikanischen Streitkräfte bei der Mobilmachung im Rahmen des Wartime Host Nation Support."},{"page_url":"https://de.wikipedia.org/wiki/Blasturm_(Gunzenhausen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Gunzenhausen-Blasturm.jpg","page_title":"Blasturm (Gunzenhausen)","context_page_description":"Der Blasturm, auch Ansbacher Torturm oder Neues Tor genannt, ist ein Stadttor der Altstadt von Gunzenhausen im mittelfränkischen Landkreis Weißenburg-Gunzenhausen und hat die Adresse Rathausstraße 13. Er ist unter der Denkmalnummer D-5-77-136-103 als Baudenkmal in die Bayerische Denkmalliste eingetragen.\\nDer Blasturm ist das letzte erhaltene Tor der Stadt Gunzenhausen. Der Name kommt vom Turmblasen. Der Turm ist 33 m hoch und wurde 1466 errichtet. Der Unterbau mit Durchfahrt stammt vom Vorgängerturm aus dem 15. Jahrhundert. 1578 stürzte der Vorgängerbau vermutlich ein, weshalb die oberen Stockwerke 1603 hinzugebaut wurden. Im Turm befand sich die Wohnung des Türmers. Am Turm befinden sich Reste der Gunzenhäuser Stadtmauer.\\nDer Blasturm besitzt einen achteckigen Turmaufbau mit polygonalem Zeltdach, der von einer Laterne abgeschlossen wird."},{"page_url":"https://nl.wikipedia.org/wiki/Zangeres_Zonder_Naam","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/MiamiNightmare.jpg","page_title":"Zangeres Zonder Naam","context_page_description":"Maria Servaes-Bey was een Nederlands zangeres. Zij vertolkte onder de artiestennaam Zangeres Zonder Naam decennialang het Nederlandse levenslied, hetgeen haar de bijnaam 'Koningin van het Levenslied' opleverde.\\nTot haar grootste successen behoren: Ach vaderlief, toe drink niet meer, De blinde soldaat, Mexico, Het soldaatje, Mandolinen in Nicosia, Keetje Tippel, Rock around the clock, 't Was aan de Costa del Sol en Vragende kinderogen. In totaal nam ze meer dan 550 liedjes op."},{"page_url":"https://es.wikipedia.org/wiki/Eduardo_Frei_Montalva","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Frei_Montalva_%281964%29.JPG","page_title":"Eduardo Frei Montalva","context_page_description":"Eduardo Nicanor Frei Montalva fue un abogado, periodista y político demócrata cristiano chileno. Fue presidente de la República durante el período comprendido entre 1964 y 1970 y presidente del Senado en 1973. Hijo de padre suizo y miembro destacado de la familia Frei. Fue asesinado en 1982 por agentes del estado durante la dictadura de Augusto Pinochet Ugarte, ​ a la cual inicialmente apoyó, mediante la inoculación de una cepa bacteriana resistente a antibióticos manipulada por el exquímico de la Dirección de Inteligencia Nacional Eugenio Berríos.\\nFormado en las filas del Partido Conservador y egresado de la Pontificia Universidad Católica de Chile, fue uno de los fundadores de la Falange Nacional, una escisión del conservadurismo que proponía los postulados de la Doctrina Social de la Iglesia y el humanismo cristiano. Tras participar en el gabinete ministerial del presidente radical Juan Antonio Ríos, fue electo senador de la República entre 1949 y 1957 por las provincias de Atacama y Coquimbo, siendo reelecto para el período entre 1957 y 1965 por la provincia de Santiago."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/MP-panthera_leo_krugeri_8.jpg","page_title":"Лев","context_page_description":"Лев — вид хищных млекопитающих, один из пяти представителей рода пантер, относящегося к подсемейству больших кошек в составе семейства кошачьих. Наряду с тигром — самая крупная из ныне живущих кошек, масса некоторых самцов может достигать 250 кг. Трудно сказать достоверно, массивнее ли крупнейшие подвиды льва, чем крупнейшие подвиды тигров. Связано это с тем, что исторические очень крупные веса амурских тигров в большинстве своём признаны недостаточно достоверными. Достаточными данными о размерах и массе представителей крупнейших подвидов льва наука не располагает. Что касается живущих в неволе животных, они часто являют собой смешение разных подвидов. Существует мнение, что львы в неволе несколько превышают тигров в размерах и массе, так же как и обратное ему.\\nИсторический ареал льва был значительно шире современного: ещё в раннем средневековье лев встречался на всей территории Африки, кроме пустынь и тропических лесов, также его можно было увидеть на Ближнем Востоке, Иране и даже в ряде мест южной Европы. В Северной и Северо-Западной Индии лев был обычным хищником."},{"page_url":"https://ca.wikipedia.org/wiki/Pango-Aluqu%C3%A9m","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Municipalit%C3%A0_Pango_Aluquem.jpg","page_title":"Pango-Aluquém","context_page_description":"Pango-Aluquém és un municipi d'Angola que forma part de la província de Bengo. Té una superfície de 2.753 km ² i una població de 6.571 habitants. Algunes fonts l'inclouen dins la província de Kwanza-Nord, però el govern provincial de Bengo el delimita com a seu. Limita amb els municipis de Dembos, Bula Atumba, Gonguembo, Golungo Alto, Cambambe i Dande."},{"page_url":"https://pt.wikipedia.org/wiki/Salmo_marmoratus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Marble_Trout-Adige_River.jpg","page_title":"Salmo marmoratus","context_page_description":"Salmo marmoratus é uma espécie de peixe da família Salmonidae.\\nPode ser encontrada nos seguintes países: Croácia, Itália, Sérvia e Montenegro e Eslovénia e seus habitats naturais são: rios.\\nEstá ameaçada por perda de habitat."},{"page_url":"https://ru.wikipedia.org/wiki/Nokia_E71","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Nokiae71.jpg","page_title":"Nokia E71","context_page_description":"Nokia E71 — смартфон бизнес-класса Е-серии с QWERTY-клавиатурой, ориентированный на пользователей Интернета и электронной почты. Работает под управлением Symbian OS v9.2 на платформе Symbian S60 3rd Edition, Feature Pack 1. Продолжением линейки стал Nokia E72."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B4%BE%E0%B4%B2%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%81%E0%B4%9F%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Chalakudi_Muncipality-%E0%B4%9A%E0%B4%BE%E0%B4%B2%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%81%E0%B4%9F%E0%B4%BF_%E0%B4%AE%E0%B5%81%E0%B5%BB%E0%B4%B8%E0%B4%BF%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B4%BE%E0%B4%B2%E0%B4%BF%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B4%BF-002.JPG","page_title":"ചാലക്കുടി","context_page_description":"ദേശീയപാത 47-ന് അരികിലായി തൃശൂർ ജില്ലയുടെ തെക്കേ അതിർത്തിയിൽ സ്ഥിതി ചെയ്യുന്ന ഒരു പട്ടണമാണ് ചാലക്കുടി. കേരളത്തിലെ ഒരു ലോകസഭാ മണ്ഡലം കൂടിയാണ്‌ ചാലക്കുടി. ചാലക്കുടി താലൂക്കിന്റെ കിഴക്കെ അതിര് തമിഴ്‌നാടാണ്. പടിഞ്ഞാറു കൊടുങ്ങല്ലൂരും വടക്കു തൃശ്ശൂരും തെക്കു എറണാകുളം ജില്ലയുടെ ഭാഗമായ അങ്കമാലിയും സ്ഥിതി ചെയ്യുന്നു. ചരിത്രപ്രധാന്യമുള്ള ചാലക്കുടി, ഇന്ന് അതിരപ്പിള്ളി വെള്ളച്ചാട്ടങ്ങൾ, പോട്ട, മുരിങ്ങൂർ എന്നിവിടങ്ങളിലെ ക്രിസ്തീയധ്യാനകേന്ദ്രങ്ങൾ, ചലച്ചിത്രതാരങ്ങൾ എന്നിവ മൂലമാണ് പ്രസിദ്ധമായിരിക്കുന്നത്. ചാലക്കുടി പുഴയോട് ബന്ധപ്പെട്ട പുതിയ ജലവൈദ്യുതപദ്ധതികളും വിവാദങ്ങളും സമീപകാലത്ത് ചൂടു പിടിപ്പിക്കുന്ന ചർച്ചാവിഷയങ്ങളാണ്. അടുത്ത കാലത്തായി നിർദ്ദിഷ്ട അതിരപ്പിള്ളി ജലവൈദ്യുത പദ്ധതിക്ക് കേന്ദ്രം അനുമതി നിഷേധിച്ചതും വാർത്തയായിരുന്നു, കേരളത്തിൽ."},{"page_url":"https://en.wikipedia.org/wiki/Pisces_(astrology)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Symbole_du_signe_astrologique_des_poissons.png","page_title":"Pisces (astrology)","context_page_description":"Pisces is the twelfth astrological sign in the Zodiac. It is a negative mutable sign. It spans 330° to 360° of celestial longitude. Under the tropical zodiac, the sun transits this area between February 19 and March 20. In sidereal astrology, the Sun currently transits the constellation of Pisces from approximately March 12 to April 18. In classical interpretations, the symbol of the fish is derived from the ichthyocentaurs, who aided Aphrodite when she was born from the sea.\\nAccording to some tropical astrologers, the current astrological age is the Age of Pisces, while others maintain that currently it is the Age of Aquarius."},{"page_url":"https://en.wikipedia.org/wiki/Kiev_Fortified_Region","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Irpin_Pillbox_429_2.jpg","page_title":"Kiev Fortified Region","context_page_description":"The Kiev Fortified Region is a fortified district in the Kiev area, a complex of defensive structures, consisting of permanent and field fortifications and engineering obstacles. It was built in the period from 1929 to 1941 for the protection of the old border of the USSR. The total length of the fortified region is about 85 km between the flanks, which are anchored on the river Dnieper, and the depth of the defensive zone ranges from 1 to 6 km.\\nThe fortifications had a significant impact in the fighting for the defence of the city in 1941."},{"page_url":"https://fi.wikipedia.org/wiki/Joanne_Froggatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Joanne_Froggatt_May_3%2C_2014_%28cropped%29.jpg","page_title":"Joanne Froggatt","context_page_description":"Joanne Froggatt on brittiläinen televisio- ja elokuvanäyttelijä, joka tunnetaan parhaiten sisäkkö Annan roolistaan palkitussa draamasarjassa Downton Abbey. Froggatt palkittiin Annan roolistaan parhaan naissivuosan Golden Globella vuonna 2015 ja on saanut myös kahdesti Emmy-ehdokkuuden parhaasta naissivuosasta draamasarjassa vuosina 2012 ja 2014."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E8%8D%9E%E9%BA%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Fagopyrum_cymosum.jpg","page_title":"金荞麦","context_page_description":"金荞麦为蓼科荞麦属下的一个种。"},{"page_url":"https://it.wikipedia.org/wiki/Eccidi_di_San_Ruffillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Dante_Ferrarini.jpg","page_title":"Eccidi di San Ruffillo","context_page_description":"Gli eccidi di San Ruffillo si riferiscono ad una serie di fucilazioni di massa avvenute agli ordini delle forze nazifasciste a Bologna, nei pressi della stazione ferroviaria di San Ruffillo, fra il 10 febbraio e il 16 marzo 1945. Nell'arco di questo tempo, almeno 133 oppositori politici e partigiani provenienti da Bologna e dintorni furono fucilati nel corso di almeno nove diverse esecuzioni sommarie."},{"page_url":"https://pl.wikipedia.org/wiki/Galaktyka_Panna_A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/M87-jets.jpg","page_title":"Galaktyka Panna A","context_page_description":"Panna A – wielka galaktyka eliptyczna znajdująca się w gwiazdozbiorze Panny w odległości około 53 milionów lat świetlnych od Ziemi. Jest to największy i najjaśniejszy obiekt w obrębie gromady galaktyk w Pannie. Została odkryta 18 marca 1781 przez francuskiego astronoma Charles’a Messiera.\\nGalaktyka ta należy do klasy galaktyk aktywnych ze względu na procesy zachodzące w jej jądrze i jest źródłem silnej emisji w szerokim zakresie widmowym, w szczególności radiowym, i jest najbliższą nam radiogalaktyką. Najnowsze badania sugerują, że masa tej galaktyki zawarta wewnątrz promienia o rozmiarze 32 kpc wynosi ×10¹² mas Słońca. Ocenia się, że M87 może zawierać do 100 bilionów gwiazd.\\nW galaktyce tej zaobserwowano supernową SN 1919A."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BE%D1%80%D0%BC%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Taormina_BW_2012-10-05_17-13-58.jpg","page_title":"Таормина","context_page_description":"Таорми́на, древн. Тавроме́ний — исторический город на восточном побережье Сицилии, на склоне горы Тауро, на террасе, 206 м над уровнем моря, на полпути между Мессиной и Катанией.\\nНаселение — 10863 жителя.\\nПодчинён административному центру Мессина. Неподалёку — остров Изола-Белла, вулкан Этна."},{"page_url":"https://es.wikipedia.org/wiki/Tlaxcala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Canto_del_Bosque_Santuario_de_la_Luci%C3%A9rnaga%2C_San_Felipe_Hidalgo_%28Unsplash_PYpxtshj4g%29.jpg","page_title":"Tlaxcala","context_page_description":"Tlaxcala, oficialmente llamado Estado Libre y Soberano de Tlaxcala, es uno de los treinta y un estados que, junto con la Ciudad de México, conforman México.​​ Su capital es Tlaxcala de Xicohténcatl y su ciudad más poblada, San Pablo del Monte.​ Está ubicado en la región este del país, limitando al norte con Hidalgo, al norte, este y sur con Puebla y al oeste con el Estado de México.​\\nCon 1 272 847 habitantes en 2015 es el quinto estado menos poblado —por delante de Nayarit, Campeche, Baja California Sur y Colima—, con 4016 km², el menos extenso y con 291.32 hab/km², el tercero más densamente poblado, por detrás del Estado de México y Morelos.​\\nFue fundado el 9 de diciembre de 1856. Se divide internamente en 60 municipios.​​ Los antiguos tlaxcaltecas se aliaron con los españoles para derrotar a los mexicas, tras años de dominio por parte de estos, por lo que esta alianza les permitió permanecer casi intactos durante 300 años de periodo colonial.​ Fue reconocido como territorio federal de México en la Constitución de 1824, bajo dependencia del gobierno de Puebla.​ En 1857 se convirtió en el vigésimo segundo estado de la república.​"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B5-%D0%9C%D0%B5%D1%81%D1%82%D0%B0_(%D0%9F%D1%80%D0%B0%D0%B3%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/New_Town_%28Prague%29_CoA_CZ.jpg","page_title":"Нове-Места (Прага)","context_page_description":"Но́ве-Ме́ста — гістарычны раён Прагі, кадастравы квартал у складзе адміністрацыйных раёнаў Прага 1, Прага 2, і Прага 8. Мае межы з кадастравымі кварталамі Стара-Места, Карлін, Жыжкаў, Вінаграды, Нусле і Вышаград, а таксама Голашавіцы і Сміхаў. З захаду і поўначы прылягае да ракі Влтава.\\nНове-Места — адзін з гістарычных пражскіх гарадоў, якія ў 1784 годзе Іосіф II аб'яднаў у адзіны цэнтралізаваны горад.\\nНазва «Новы горад» не вельмі адпавядае рэчаіснасці. Ён быў заснаваны ў 1348 годзе Карлам IV на месцы яшчэ больш старажытных паселішчаў, і яго гісторыя налічвае больш за 650 гадоў. Раён быў закладзены, каб аб'яднаць Стара-Места і Вышаград."},{"page_url":"https://nl.wikipedia.org/wiki/Gerard_Wijdeveld","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Gerard_Wijdeveld_%281905-1997%29_-_promotie_1937_-_Anton_van_Duinkerken_%28links%29_-_Joan_Kat_%28rechts%29.gif","page_title":"Gerard Wijdeveld","context_page_description":"Gerard Egbert Antoon Maria Wijdeveld was een Nederlands auteur en classicus."},{"page_url":"https://la.wikipedia.org/wiki/Valetudinarium_Universitatis_Lundense","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Usil5.jpg","page_title":"Valetudinarium Universitatis Lundense","context_page_description":"Valetudinarium Universitatis Lundense fuit valetudinarium Lundae Sueciae situm, et a die 1 Ianuarii 2010 cum Valetudinario Universitatis Malmogiensi Malmogiae Sueciae coniunctum est sub novo nomine Valetudinarium Universitatis Scaniense. Aedificia quondam Valetudinarii Universitatis Lundensis etiamnunc activa sunt sub recenti institutione."},{"page_url":"https://fr.wikipedia.org/wiki/Gabe_Kaplan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Gabe_Kaplan.jpg","page_title":"Gabe Kaplan","context_page_description":"Gabe Kaplan est un acteur, scénariste, animateur de télévision, et joueur de poker américain, né le 31 mars 1944 à Brooklyn, New York."},{"page_url":"https://eu.wikipedia.org/wiki/Polesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ukraine-Polissya.png","page_title":"Polesia","context_page_description":"Polesia edo Polissya Ukrainako eta Bielorrusiako padura zabala da, Pripiat ibaiaren arroa hartzen duena. Lurralde zingiratsua da, baso trinkoek inguratua. XIV. mendean, Lituaniak konkistatu zuen, eta Poloniar-Lituaniar Batasunako lurralde izan zen 1569tik aurrera. 1795ean, Errusiar Inperioaren mende geratu zen. Gaur egun, zati gehiena Bielorrusia eta Ukraina estatuen artean banatzen da, baina Polonia eta Errusiako eremu batzuk ere hartzen ditu."},{"page_url":"https://ca.wikipedia.org/wiki/Kaluga","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Space_museum_%28Kaluga%29.jpg","page_title":"Kaluga","context_page_description":"Kaluga - Калуга - és una ciutat de Rússia, capital de la província de Kaluga. Està a la vora de l'Okà, a 188 km al sud-oest de Moscou."},{"page_url":"https://nn.wikipedia.org/wiki/Rensvik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Rensvik.JPG","page_title":"Rensvik","context_page_description":"Rensvik er ein tettstad i Kristiansund kommune i Møre og Romsdal fylke. Staden har 2 539 innbyggjarar per 1. januar 2017 og ligg nord på øya Frei."},{"page_url":"https://ca.wikipedia.org/wiki/Revoluci%C3%B3_Oriental","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Encuentro_entre_Artigas_y_Rondeau.jpg","page_title":"Revolució Oriental","context_page_description":"L'anomenada Revolució Oriental va ser un moviment inicialment amb un caràcter autonomista expressat així en les Instruccions que portaven els diputats orientals al congrés provisional reunit a Buenos Aires el 1813. Fins aleshores, no s'havia plantejat la possibilitat de crear, en el territori de la Banda Oriental, un país independent de les altres províncies del Virregnat del Riu de la Plata. Però, en la lluita per resistir les imposicions del centralisme de Buenos Aires i la conseqüent aspiració a aconseguir autonomia política, es va anar gestant un sentiment nacionalista que va acabar sent un dels factors determinants en fomentar la separació posterior el 1828."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Th%C3%A9zac_(Charente-Maritime)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Th%C3%A9zac_17_Le_clocher_vu_de_la_D138_2014.jpg","page_title":"Thézac (Charente-Maritime)","context_page_description":"Thézac sī ūi-tī Hoat-kok Poitou-Charentes tōa-khu Charente-Maritime séng ê chi̍t-ê commune."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Sch%C3%B6neberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Stolperstein_M%C3%BCnchener_Str_16_%28Sch%C3%B6n%29_Lydia_Mayer.jpg","page_title":"Liste der Stolpersteine in Berlin-Schöneberg","context_page_description":"Die Liste der Stolpersteine in Berlin-Schöneberg enthält die Stolpersteine im Berliner Ortsteil Schöneberg im Bezirk Tempelhof-Schöneberg, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden.\\nDie Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 688 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://en.wikipedia.org/wiki/Laryngectomy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Larynx_external_en.svg","page_title":"Laryngectomy","context_page_description":"Laryngectomy is the removal of the larynx and separation of the airway from the mouth, nose and esophagus. In a total laryngectomy, the entire larynx is removed. In a partial laryngectomy, only a portion of the larynx is removed. Following the procedure, the person breathes through an opening in the neck known as a stoma. This procedure is usually performed by an ENT surgeon in cases of laryngeal cancer. Many cases of laryngeal cancer are treated with more conservative methods. A laryngectomy is performed when these treatments fail to conserve the larynx or when the cancer has progressed such that normal functioning would be prevented. Laryngectomies are also performed on individuals with other types of head and neck cancer. Post-laryngectomy rehabilitation includes voice restoration, oral feeding and more recently, smell and taste rehabilitation. An individual's quality of life can be affected post-surgery."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D1%82%D0%BF%D1%83%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Betpouey_Mairie.JPG","page_title":"Бетпуе","context_page_description":"Бетпуе́ — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Верхні Піренеї. Населення — 112 осіб.\\nМуніципалітет розташований на відстані близько 690 км на південь від Парижа, 140 км на південний захід від Тулузи, 39 км на південь від Тарба."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_na_Mal%C3%A9_Stran%C4%9B_%E2%80%93_Doln%C3%AD_malostransk%C3%BD_obvod","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/M%C4%9B%C5%A1%C5%A5ansk%C3%BD_d%C5%AFm_U_Plani%C4%8Dk%C5%AF_%28Mal%C3%A1_Strana%29%2C_Praha_1%2C_U_lu%C5%BEick%C3%A9ho_semin%C3%A1%C5%99e_4%2C_Mal%C3%A1_Strana.jpg","page_title":"Seznam kulturních památek na Malé Straně – Dolní malostranský obvod","context_page_description":"Tento seznam nemovitých kulturních památek v části Malá Strana v hlavním městě Praze vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nTento seznam zahrnuje území základní sídelní jednotky Dolní malostranský obvod. Ta zahrnuje část Malé Strany východně od ulic Újezd a Karmelitská, Malostranského náměstí, Tomášské ulice a od budovy Valdštejnská čo. 14.\\nCelá Malá Strana je od roku 1971 součástí Pražské památkové rezervace."},{"page_url":"https://ca.wikipedia.org/wiki/L%27adoraci%C3%B3_de_l%27Anyell_M%C3%ADstic","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Retable_de_l%27Agneau_mystique_%2811%29.jpg","page_title":"L'adoració de l'Anyell Místic","context_page_description":"El retaule L'adoració de l'Anyell Místic o Retaule de Gant és una obra realitzada per Jan van Eyck l'any 1432. Pertany a l'escola dels primitius flamencs i és un oli sobre taula. És considerada una de les obres mestres de Flandes i un dels tresors mundials.\\nEs troba a la catedral de Sant Bavó, a Gant, si bé no està a la seva ubicació inicial –la capella Joost Vijdt–, d'on va ser traslladat per raons de seguretat dins de la mateixa catedral. Va ser encarregat per un ric comerciant i financer, Joost Vijdt, per a la seva capella privada i de la seva esposa, Lysbette Borluut. El va començar Hubert van Eyck, que va morir el 1426 mentre l'estava realitzant i el va acabar el seu germà més jove, Jan van Eyck, qui figura històricament com el seu autor. El retaule va aportar una «concepció nova de l'art», en la qual la idealització de la tradició medieval es transformava en una observació precisa de la natura.\\nÉs un políptic que consta de 24 escenes compartimentades que presenta dues visions, oberta i tancada, que s'alternen tancant les ales laterals."},{"page_url":"https://nv.wikipedia.org/wiki/T%C3%B3_w%C3%B3naan%C3%ADd%C4%99%CC%81%C4%99%CC%81%CA%BC_tsidii%C5%82b%C3%A1h%C3%AD_daach%CA%BC%C4%AF%CC%81d%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/LinariaFlavirostrisIUCNver2018_2.png","page_title":"Tó wónaanídę́ę́ʼ tsidiiłbáhí daachʼį́dígíí","context_page_description":"Tó wónaanídę́ę́ʼ tsidiiłbáhí daachʼį́dígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Tó Wónaanídę́ę́ʼ Bilagáana Bikéyahdi dóó Bilį́į́ʼ Ńdeiltihii Dineʼé Bikéyahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Linaria flavirostris\\" deiłníigo dayózhí."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9E%D0%B1%D1%81%D0%B0%D0%B4%D0%B0_%D0%BD%D0%B0_%D0%9E%D0%B4%D1%80%D0%B8%D0%BD_(1912%E2%80%931913)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Bulgarian_Guards_Cavalry_Regiment_in_Odrin.jpg","page_title":"Обсада на Одрин (1912–1913)","context_page_description":"Обсадата на Одрин от български и сръбски войски от октомври 1912 до 26 март 1913 г. завършва с превземането на турската крепост от Втора българска армия, решителна победа, довела до края на Балканската война. Съюзниците са под общото командване на ген. Никола Иванов, а решителният пробив на източния сектор от крепостта е извършен под командването на ген. Георги Вазов, брат на Иван Вазов и генерал Владимир Вазов.\\nОбсадата е известна с едни от първите случаи на действие на бойна авиация."},{"page_url":"https://hu.wikipedia.org/wiki/Szotyori-L%C3%A1z%C3%A1r_Zolt%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Lazarzoltan.jpg","page_title":"Szotyori-Lázár Zoltán","context_page_description":"Dr. Szotyori-Lázár Zoltán magyar politikus, ügyvéd, zenész, a Jobbik Szolnok városi szervezetének elnöke és Jász-Nagykun-Szolnok megyei szervezetének alelnöke, Szolnok Megyei Jogú Város Közgyűlésének tagja."},{"page_url":"https://it.wikipedia.org/wiki/Casa_dell%27Albergo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Casa_dell%27Albergo_1.JPG","page_title":"Casa dell'Albergo","context_page_description":"La casa dell'Albergo è una casa di epoca romana, sepolta durante l'eruzione del Vesuvio del 79 e ritrovata a seguito degli scavi archeologici dell'antica Ercolano: tra tutte le abitazioni esplorate, è la più grande della città."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%B9%D0%BC%D1%96%D1%82%D1%96_(%D0%9E%D1%80%D0%B5%D0%B3%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Amity%2C_Oregon_aerial.jpg","page_title":"Ейміті (Орегон)","context_page_description":"Ейміті — місто в США, в окрузі Ямгілл штату Орегон. Населення — 1614 осіб."},{"page_url":"https://it.wikipedia.org/wiki/Unimog","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Unimog_U20_in_Germany.JPG","page_title":"Unimog","context_page_description":"L'Unimog è una gamma di autocarri fuoristrada della Daimler-Benz, prodotti a partire dal 1948 e utilizzati in origine come trattori per le coltivazioni di rape.\\nGli Unimog hanno una notevole altezza da terra, resa possibile dall'utilizzo di assali a portale, che permettono agli assi e alla trasmissione di essere più in alto del centro della ruota. Sono anche dotati di un telaio flessibile che consente alle ruote ampi movimenti verticali che, insieme alle sospensioni a molle elicoidali, permettono agli Unimog di affrontare con comodità ogni tipo di terreno, anche il più accidentato, con ostacoli di oltre un metro e pendenze fino al 100%. Altre caratteristiche comuni di questi mezzi sono la trazione integrale, marce con rapporti molto corti e il bloccaggio manuale dei differenziali anteriore e posteriore.\\nGli Unimog sono stati usati e vengono tuttora utilizzati da varie forze armate, inclusi gli eserciti tedeschi e svizzeri. Sono anche in dotazione all'esercito sudafricano e neozelandese.\\nInoltre, gli Unimog possono essere usati come locomotiva nelle ferrovie; venivano anche usati per il traino degli aerei."},{"page_url":"https://en.wikipedia.org/wiki/Rail_transport_in_China","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Headed_south_to_Hanoi.jpg","page_title":"Rail transport in China","context_page_description":"Rail transport is an important mode of long-distance transportation in China. As of 2015, the country has 121,000 km of railways, the second longest network in the world. By the end of 2018, China had 29,000 kilometres of high-speed rail, the longest HSR network in the world.\\nAlmost all rail operations are handled by the China State Railway Group Company, Limited, a state-owned company created in March 2013 from dissolution of the Ministry of Railways. It was converted into a joint-stock company and placed under the control of the Ministry of Finance in June 2019.\\nChina's railways are among the busiest in the world. In 2019, railways in China delivered 3.660 billion passenger trips, generating 1,470.66 billion passenger-kilometres and carried 4.389 billion tonnes of freight, generating 3,018 billion cargo tonne-kilometres. Freight traffic turnover has increased more than fivefold over the period 1980-2013 and passenger traffic turnover has increased more than sevenfold over the same period."},{"page_url":"https://en.wikipedia.org/wiki/Mechanical_School_N%C2%B01,_Bydgoszcz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/School_1941_police_HQ.jpg","page_title":"Mechanical School N°1, Bydgoszcz","context_page_description":"The building of the Mechanical School in Bydgoszcz is a historic public edifice, serving educational purposes, located at Świętej Trójcy Street 37, in downtown. It is registered on the Kuyavian-Pomeranian Voivodeship Heritage List."},{"page_url":"https://fr.wikipedia.org/wiki/Anges_buccinateurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Le_triomphe_de_1810%2C_Jean-Pierre_Cortot%2C_Arc_triomphe_Paris.jpg","page_title":"Anges buccinateurs","context_page_description":"Les anges buccinateurs sont des anges du christianisme annonciateurs, en soufflant à pleins poumons dans leur buccin, de l'apocalypse et du Jour du jugement dans le Nouveau Testament de la Bible."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B5%D0%B3%D0%B0,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Gheorghe_Brega_%2801%29.png","page_title":"Брега, Георгий Владимирович","context_page_description":"Гео́ргий Влади́мирович Бре́га — молдавский политический и государственный деятель, с 30 июля 2015 года вице-премьер по социальным вопросам республики Молдова. Также был с 30 октября 2015 года и до 20 января 2016 года — и.о. премьер-министра Молдовы."},{"page_url":"https://en.wikipedia.org/wiki/.17_Remington_Fireball","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/17fireballand17rem.png","page_title":".17 Remington Fireball","context_page_description":"The .17 Remington Fireball was created in 2007 by Remington Arms Company as a response to the popular wildcat round, the .17 Mach IV. Factory loads drive a 20 grain bullet around 4,000 ft/s. Velocity is close to the .17 Remington but with significantly less powder, and therefore less heat and fouling. Both are important issues to high-volume shooters such as varmint hunters.\\nIt is based on the .221 Remington Fireball necked down to accept a .17 caliber bullet and is very similar to the .17 Mach IV. Reports on this cartridge show mild recoil, high velocity, with minimal report."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BB%D0%B8%D0%B2%D0%B8%D1%86%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Slivitsa_Cheshma_Woman_IWW.jpg","page_title":"Сливица","context_page_description":"Сливица е село в южната част на Северна Македония, община Новаци."},{"page_url":"https://de.wikipedia.org/wiki/Ka%C5%A1persk%C3%A9_Hory","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Ka%C5%A1persk%C3%A9_Hory_%28okr._Klatovy%29%2C_%C4%8Dp._1%2C_radnice_od_jihov%C3%BDchodu.JPG","page_title":"Kašperské Hory","context_page_description":"Kašperské Hory ist eine Stadt in Tschechien. Sie liegt elf Kilometer südlich von Sušice und gehört zum Okres Klatovy. Kašperské Hory ist die höchstgelegene gotische Stadt Böhmens."},{"page_url":"https://en.wikipedia.org/wiki/Iraq_Study_Group_Report","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/U.S._President_George_W._Bush_with_Lee_Hamilton%2C_left%2C_and_former_Secretary_of_State_James_Baker_in_the_Cabinet_Room%2C_Dec._6._2006.jpg","page_title":"Iraq Study Group Report","context_page_description":"The Iraq Study Group Report: The Way Forward – A New Approach is the report of the Iraq Study Group, as mandated by the United States Congress. It is an assessment of the state of the war in Iraq as of December 6, 2006, when the ISG released the report to the public on the Internet and as a published book. The report was seen as crucial by Bush, who declared: \\"And truth of the matter is, a lot of reports in Washington are never read by anybody. To show you how important this one is, I read it, and [Tony Blair] read it.\\"\\nAccording to the Executive Summary of the report, page 16, as quoted, \\"The Iraqi government should accelerate assuming responsibility\\nfor Iraqi security by increasing the number and quality of Iraqi Army brigades. While this process is under way, and to facilitate it, the United States should significantly increase the number of U.S. military personnel, including combat troops, imbedded in and supporting Iraqi Army units. As these actions proceed, U.S. combat forces could begin to move out of Iraq. ... The situation in Iraq is grave and deteriorating.\\""},{"page_url":"https://ceb.wikipedia.org/wiki/Montacute_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Montacute_House_%288601967521%29.jpg","page_title":"Montacute House","context_page_description":"Kastilyo ang Montacute House sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Somerset ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 190 km sa kasadpan sa London ang ulohan sa nasod. 53 metros ibabaw sa dagat kahaboga ang nahimutangan sa Montacute House.\\nAng yuta palibot sa Montacute House kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 132 ka metro ug 1.0 km sa kasadpan sa Montacute House. Dunay mga 160 ka tawo kada kilometro kwadrado sa palibot sa Montacute House medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Yeovil, 5.8 km sa sidlakan sa Montacute House. Hapit nalukop sa kaumahan ang palibot sa Montacute House.\\nAng klima baybayon. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Agosto, sa 16 °C, ug ang kinabugnawan Pebrero, sa 2 °C."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%B2%D0%B5%D0%BD,_%D0%90%D0%B1%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/AbbaEban1951.jpg","page_title":"Эвен, Абба","context_page_description":"А́бба Э́вен — израильский государственный и политический деятель, министр иностранных дел Израиля, министр образования Израиля, посол Израиля в ООН и в США."},{"page_url":"https://pt.wikipedia.org/wiki/Avi%C3%A3o_de_correio","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Model40.jpg","page_title":"Avião de correio","context_page_description":"Um avião de correio é uma aeronave utilizada para o transporte de correio.\\nAeronaves que eram puramente aviões de correio existiram quase que exclusivamente antes da Segunda Guerra Mundial. Pelo fato das primeiras aeronaves serem pouco potentes para carregar carga, e muito custosas para o serviço de transporte de passageiros em \\"classe econômica\\", a principal tarefa civil para as aeronaves era carregar correio de forma mais rápida do que antes já visto. Em 1934, alguns serviços de correio nos Estados Unidos foram operados pelo Corpo Aéreo do Exército dos Estados Unidos, encerrando logo no Air Mail scandal.\\nNo passado, as aeronaves de transporte de correio tinham que carregar um emblema oficial na fuselagem; no caso de aeronaves registradas na Grã-Bretanha, um emblema especial com o título Royal Air Mail pennant era por vezes colocado.\\nA partir do final da década de 1940, os aviões de correio tornaram-se cada vez mais raros, devido ao aumento no tamanho das aeronaves e melhor economia, direcionando ao transporte de correio a bordo de voos de empresas aéreas comerciais, sendo este ainda o principal método nos dias de hoje."},{"page_url":"https://en.wikipedia.org/wiki/DeWitt_Motor_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/1909DeWittFront.jpg","page_title":"DeWitt Motor Company","context_page_description":"The DeWitt Motor Company produced automobiles in a factory in North Manchester, Indiana from about 1908 through 1910.\\nThe vehicles came in two models, a 2-seater runabout and a 2-seater light truck. Both were high wheelers which much resembled standard buggies of the era, and were powered by a simple 2-cylinder opposed air-cooled engine.\\nThe company was started and named after Virgil DeWitt, a Swedish immigrant to the United States."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%90%E1%80%9B%E1%80%B1%E1%80%AC%E1%80%BA%E1%80%95%E1%80%84%E1%80%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Phalsa03_Asit.jpg","page_title":"တရော်ပင်","context_page_description":"ရုက္ခဗေဒအလိုအားဖြင့် တရော်ပင်မျိုး၌ မျိုးကွဲများစွာရှိသည်။ ယင်းတို့အနက်'ဂရူးဝီးယား အေရှားတစ်ကား'ကို ကြက် တရော်ဟူ၍၎င်း၊ ကွက်တရော်ဟူ၍၎င်၊ 'ဂရူးဝီးယား အီလာတို့ စတီမွိုက်ဒီ'ကို ပင်တရော်ဟူ၍၎င်း ခေါ်ကြသည်။ ယင်းတို့ကို မြန်မာနိုင်ငံ နေရာအနှံ့အပြား၌ တွေ့ရသည်။ ရခိုင်လို အုန်းဒူရွက်ဟု ခေါ်သည်။ တရော်ခေါက် များမှ ချွဲကျွိသောအရည်ထွက်သည်။ အထူးအားဖြင့် တရော်ခေါက်ကို ထုပြီးနောက် ရေတွင်စိမ်၍ ခေါင်းလျှော်ရသည်။\\nခေါင်းလျှော်ရည်လုပ်ရာ၌ တရော်ခေါက်ကို ကင်ပွန်းသီးနှင့်ရောစပ်၍ လုပ်လေ့ရှိကြသည်။ သကြားချေးချွတ်ရာ၌လည်း တရော်\\nခေါက်ကို အသုံးပြုတတ်ကြသည်။ တရော်ပင်မျိုးသည် ဆေး ဖက်ဝင်၏။ အချို့အပင်မျိုးမှ အခေါက်ကို အယားဖြေဆေး\\nအဖြစ်ဖြင့် အသုံးပြုကြသည်။ အချို့အပင်မျိုး၌ အသီးသည် ချုပ်သောသတ္တိ ရှိသည်။ အချို့၌ကား အရွက်သည် အရေပြား\\nရောဂါအတွက်ကောင်း၏။\\nတရော်အမည်ဖြင့် အပင်တစ်မျိုးရှိသေးသည်။ ထိုတရော် ပင်မျိုးကို ရုက္ခဗေဒအလိုအားဖြင့် 'အက်စီကေးရီး ယားအဂယ်\\nလော့ခါး'ဟု ခေါ်သည်။ မျိုးရင်းမှာ 'ယူဖောဗီ ယေစီအီး'ဖြစ် သည်။ ပင်လတ်စား အပင်မျိုးဖြစ်၍၊ ရေတက် ရေကျရှိသော\\nဒေသများတွင် ပေါက်ရောက်သည်။ ထိုအပင်မှ တရော်ရည်မှ အမြုပ်ထသည်။ သစ်သားအနံ့မှာ ဆိုးရွားသည်။ အသားပျော့၍\\nအဖြူရောင်ရှိသည်။ ကြာရှည်မခံပေ။ ယင်းကို ပေါ့ပါးသော အကြမ်းထည်ပရိဘောဂပစ္စည်းများ လုပ်ရာ၌၎င်း၊ သျွှောများ\\nပြုလုပ်ရာ၌၎င်း အနည်းအကျဉ်းအသုံးပြုကြသည်။"},{"page_url":"https://en.wikipedia.org/wiki/List_of_freshwater_fish_of_Sri_Lanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Chan_gachu_120715_0406_krw.jpg","page_title":"List of freshwater fish of Sri Lanka","context_page_description":"Sri Lanka is a tropical island situated close to the southern tip of India. It is situated in the middle of Indian Ocean. Because of being an island, Sri Lanka has many endemic freshwater fauna, including fish, crabs, molluscs, and other aquatic insects."},{"page_url":"https://sv.wikipedia.org/wiki/Pralong","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Map_commune_FR_insee_code_42179.png","page_title":"Pralong","context_page_description":"Pralong är en kommun i departementet Loire i regionen Auvergne-Rhône-Alpes i centrala Frankrike. Kommunen ligger i kantonen Boën som tillhör arrondissementet Montbrison. År 2009 hade Pralong 848 invånare."},{"page_url":"https://eu.wikipedia.org/wiki/Isaac_Peral","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Isaac_Peral_%28Ayuntamiento_de_Cartagena%29.jpg","page_title":"Isaac Peral","context_page_description":"Isaac Peral y Caballero zientzialaria, itsasgizona eta militarra izan zen, Espainiako Itsas Armadako itsasontzi teniente, eta itsaspeko torpedo ontziaren asmatzailea.\\nKarrera labur baina oso ondo aprobetxatua izan zuen espainiar armadan, Kubako Hamar Urteetako Guduan eta Hirugarren Gerra Karlistan parte hartu zuelarik. Horrela, erakutsitako ausardia eta abilezia medio, kondekoratua izan zen. Izaera zientifikoa zuten lan eta misioetan ere nabarmendu zen: haize erauntsiei buruzko tratatu teoriko praktikoa idatzi zuen, Simanaléseko kanaleko planoetan lan egin zuen eta, 1883an, Armadako Ikasketak Zabaltzeko Eskolako Fisika-Matematikoaren katedraren kargu egin zen.\\nBerak egindako itsaspekoaren probek arrakasta izan zuten, baina orduko agintariek asmakuntza baztertu eta asmalariaren aurkako kanpaina bat aurrera eraman zuten aurrera, honen izen ona galtzeko asmoz. Isaacek Itsas Armadan baja eskatu beste erremediorik ez zuen izan, eta jendearen iritzia aldatzen saiatu zen gertatutakoari buruzko egia kontatuz.\\nAsmatzailea 1895ean hil zen, meningitisak jota."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%98%87%E5%A7%BF%E8%B1%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/AMD_CEO_Lisa_Su_20130415_cropped.jpg","page_title":"蘇姿豐","context_page_description":"蘇姿豐是台裔美國人企業家，現任超微半導體CEO暨總裁。"},{"page_url":"https://en.wikipedia.org/wiki/Camino_Real_de_Tierra_Adentro","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Acueductos_Ciudad_de_Quer%C3%A9taro_M%C3%A9xico.jpg","page_title":"Camino Real de Tierra Adentro","context_page_description":"The Camino Real de Tierra Adentro was an historic 2,560-kilometre-long trade route between Mexico City and San Juan Pueblo, New Mexico, USA, from 1598 to 1882. It was the northernmost of the four major \\"royal roads\\" that linked Mexico City to its major tributaries during and after the Spanish colonial era.\\nIn 2010, 55 sites and five existing UNESCO World Heritage Sites along the Mexican section of the route were collectively added to the World Heritage List, including historic cities, towns, bridges, haciendas and other monuments along the 1,400-kilometre route between the Historic Center of Mexico City and the town of Valle de Allende, Chihuahua.\\nThe 404-mile section of the route within the United States was proclaimed the El Camino Real de Tierra Adentro National Historic Trail, a part of the National Historic Trail system, on October 13, 2000. The historic route is overseen by both the National Park Service and the U.S. Bureau of Land Management with aid from the El Camino Real de Tierra Adentro Trail Association. A portion of the trail near San Acacia, New Mexico was listed on the National Register of Historic Places in 2014."},{"page_url":"https://nl.wikipedia.org/wiki/Ruige_leeuwentand","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Leontodon_hispidus_blatt.jpeg","page_title":"Ruige leeuwentand","context_page_description":"De ruige leeuwentand of wilde leeuwentand is een vaste plant, die behoort tot de composietenfamilie en staat op de Nederlandse Rode lijst van planten als vrij zeldzaam en matig afgenomen. De plant komt van nature voor in Eurazië.\\nDe plant wordt 15 tot 40 cm hoog, vormt een wortelrozet en heeft een wit behaarde, onvertakte stengel. De plant vormt oppervlakkige, kruipende wortelstokken. De wortelbladeren zijn langwerpig, veervormig bochtig gelobd tot gespleten en kaal of hebben gegaffelde haren. De bladsteel is gevleugeld.\\nDe ruige leeuwentand bloeit van juni tot de herfst met gele bloemen. De randbloemen hebben meestal aan de onderzijde een blauwgrijze of roodachtige streep. De alleenstaande 2 tot 4 cm brede hoofdjes zijn voor de bloei geknikt. De behaarde omwindselblaadjes zijn 11 tot 15 mm lang.\\nDe vrucht is een 2 - 4 mm lang, donkerbruin, recht nootje. De vrucht heeft een tweerijige pappus, die uit haren bestaat, waarvan de buitenste rij haren fijn getand zijn en de binnenste geveerd.\\nDe plant komt voor tussen het gras op matig vochtige, kalkhoudende grond."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Buellin_moottoripy%C3%B6r%C3%A4malleista","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Buell_XB9SX_a.jpg","page_title":"Luettelo Buellin moottoripyörämalleista","context_page_description":"Tämä artikkeli sisältää luettelon Buellin valmistamista moottoripyörämalleista."},{"page_url":"https://en.wikipedia.org/wiki/Bresalc","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bresalc_Gjilan_1.jpg","page_title":"Bresalc","context_page_description":"Bresalc is a village in the District of Gjilan, Kosovo. It is located northwest of Gjilan and southeast of Pristina."},{"page_url":"https://de.wikipedia.org/wiki/St%C3%A9phanie_Bouvier","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Stephanie-Bouvier.jpg","page_title":"Stéphanie Bouvier","context_page_description":"Stéphanie Bouvier ist eine ehemalige französische Shorttrackerin.\\nBei Bouviers erstem internationalen Start, der Europameisterschaft 1998, erreichte sie zwar keine Medaille, platzierte sich aber als Fünfte über 1500 m recht gut. Bei ihrer ersten Teilnahme an einer Weltmeisterschaft im selben Jahr schied sie jedoch gleich in den Vorläufen aus, ebenfalls wenig erfolgreich verlief ihre Teilnahme an den Großereignissen 1999. Nachdem sie in der Saison 1999/2000 erstmals für den Weltcup nominiert wurde, dort aber nicht über den ersten Lauf hinausgekommen war, startete sie erfolgreich bei der Europameisterschaft 2000, wo sie in drei Disziplinen mindestens bis ins Viertelfinale kam. Dieses Ergebnis hielt sie auch bei der Weltmeisterschaft desselben Jahres.\\nDennoch gelang Bouvier erst Anfang 2001 der internationale Durchbruch, als sie zunächst nur knapp das 1500-m-Finale bei der Junioren-WM verpasste und anschließend gute Platzierungen bei der Europameisterschaft einfuhr. Da sie dort mehrere Podestplatzierungen auf den Einzelstrecken erreichte, gelang ihr der Gesamtrang drei und damit die Bronzemedaille im Mehrkampf."},{"page_url":"https://no.wikipedia.org/wiki/Hu_Xiansu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/%E8%83%A1%E5%85%88%E9%A9%8C%E9%99%A2%E5%A3%AB%E9%81%BA%E5%83%8F.jpg","page_title":"Hu Xiansu","context_page_description":"Hu Xiansu var en kinesisk botaniker og innflytelsesrik tradisjonell lærd. Han var grunnleggeren av plantetaksonomi i Kina og en pioner innen moderne botanisk forskning i landet.\\nSammen med sine kolleger i Det kinesiske vitenskapsselskap ble Hu en nøkkelleder for landets første biologiske forskningssenter, og spilte en viktig rolle vor grunnleggelsen av Kinas botaniske selskap. Han opprettet landets første botaniske forskningsplantasje på Lufjellet i provinsen Jiangxi, og satte i gang en storstilt kartlegging av kinesisk flora.\\nMellom 1940 og 1944 var han grunnleggende president for Det nasjonale Chung Cheng-universitet. I 1940-årene spilte han en nøkkelrolle, sammen med Wan Chun Cheng, ved identifiseringen og navngivningen av urtre, som tidligere bare var kjent fra fossiler. Det skjedde i fylket Wan i daværende Sichuan.\\nI 1950-årene var Hu åpent kritisk til Lysenkos antimendelianske arvelære og jordbruksteknikker."},{"page_url":"https://sco.wikipedia.org/wiki/Statesman_(automobile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Statesman_Caprice_%281974-1976_HJ_series%29_01.jpg","page_title":"Statesman (automobile)","context_page_description":"Statesman wis an automotive marque creatit bi General Motors Holden, the Australian subsidiary o General Motors in 1971. Statesman vehicles wur sauld throu Holden's dealerships, an wur initially based on the mainstream Holden HQ models, but affered mair luxury an considerably extendit lenth. Production ceased in 1984.\\nHolden reintroduced the luxury range in 1990; housomeivver, thay wur nae marketit as Statesmans, but instead as the Holden Statesman. The umwhile flagship o the Statesman range, the Caprice, wis an aa relaunched as the Holden Caprice, but the Statesman Custom, de Ville, an SL/E names wur no revived."},{"page_url":"https://pl.wikipedia.org/wiki/Plac%C3%B3wki_dyplomatyczne_i_konsularne_w_Polsce:_L","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/AMBASADA_LIBII.jpg","page_title":"Placówki dyplomatyczne i konsularne w Polsce: L","context_page_description":"Stan na: 7 stycznia 2020\\nOpracowane na podstawie materiału źródłowego"},{"page_url":"https://de.wikipedia.org/wiki/St._Johanner_Markt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/St.JohannerMarkt19.JahrhundertL1010520.JPG","page_title":"St. Johanner Markt","context_page_description":"Der St. Johanner Markt ist ein Marktplatz und Distrikt im Saarbrücker Stadtteil St. Johann und bildet das Zentrum der saarländischen Landeshauptstadt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Buttenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Kirche_Gunzendorf_01.jpg","page_title":"Liste der Baudenkmäler in Buttenheim","context_page_description":"Auf dieser Seite sind die Baudenkmäler des oberfränkischen Marktes Buttenheim zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 20. Februar 2014 wieder und enthält 67 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/Xylobiops_texanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Xylobiops_texanus.jpg","page_title":"Xylobiops texanus","context_page_description":"Xylobiops texanus is a species of horned powder-post beetle in the family Bostrichidae. It is found in the Caribbean Sea, Central America, and North America."},{"page_url":"https://eu.wikipedia.org/wiki/Domenico_Ghirlandaio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Pala_degli_innocenti%2C_ghirlandaio%2C_autoritratto%2C_dettaglio.jpg","page_title":"Domenico Ghirlandaio","context_page_description":"Domenico Ghirlandaio, jaiotza-izena Domenico di Tommaso Curradi di Doffo Bigordi italiar Pizkundeko margolaria izan zen. Florentziar Errenazimentuko hirugarren belaunaldiko kidea izan zen, Andrea del Verrocchio, Pollaiolo anaiak eta Sandro Botticellirekin batera.\\nEz zuen sekula utzi bere hiria, 1481-1482an Sixto IV.ak Erromara deitu zuenean izan ezik. Orduan margotu zuen Petri eta Andres apostoluen bokazioa. Etxean lantegi bat zuen beste bi anaiekin batera, eta bertan ikasle izan zen, besteren artean, Michelangelo. Bere mendeko Florentzia eta bertan bizi ziren burgesak freskoetan irudikatu zituen. Erretratua eta freskoa bateratu zituen; teknika berriak erabili zituen, Gizon zaharra eta bere iloba obrak erakusten duen bezala."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%97%D7%95%D7%91_%D7%9E%D7%9C%D7%9B%D7%99_%D7%99%D7%A9%D7%A8%D7%90%D7%9C_(%D7%99%D7%A8%D7%95%D7%A9%D7%9C%D7%99%D7%9D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/%D7%9C%D7%95%D7%97_%D7%96%D7%99%D7%9B%D7%A8%D7%95%D7%9F_%D7%9C%D7%99%D7%A9%D7%A2%D7%99%D7%94%D7%95_%D7%A7%D7%A8%D7%99%D7%A9%D7%91%D7%A1%D7%A7%D7%99_%D7%91%D7%9E%D7%A7%D7%95%D7%9D_%D7%94%D7%A4%D7%99%D7%92%D7%95%D7%A2.jpg","page_title":"רחוב מלכי ישראל (ירושלים)","context_page_description":"רחוב מלכי ישראל הוא רחובה המרכזי של שכונת גאולה בירושלים."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E9%9B%81%E5%A1%94%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Platform_of_Dayanta_Station_%2820171002120638%29.jpg","page_title":"大雁塔站","context_page_description":"大雁塔站位于西安市雁塔区，是西安地铁3号线的一个车站，因位于大雁塔附近而得名。同时也为4号线的换乘站。"},{"page_url":"https://cs.wikipedia.org/wiki/Administrativn%C3%AD_d%C4%9Blen%C3%AD_%C4%8Ceska","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Uherske_Hradiste_CoA_CZ.png","page_title":"Administrativní dělení Česka","context_page_description":"Česká republika se dělí na 14 samosprávných krajů a 6 253 obcí včetně 5 jim na roveň postavených vojenských újezdů.\\nZ nich je 393 s pověřenými obecními úřady a z nich dále 205 obcí s rozšířenou působností; ty stejně jako kraje vykonávají ve svých obvodech státní správu v přenesené působnosti.\\nMimopražské území se dělí na 76 okresů; ty i po zrušení okresních úřadů k 1. lednu 2003 a převedení jejich pravomocí na obce s rozšířenou působností slouží především pro statistické účely a územní členění některých úřadů státní správy.\\nMimo tohoto administrativního členění se pro volby do Senátu území republiky dělí na 81 zhruba stejně lidnatých obvodů; pro administraci evropských dotací se kraje sdružují do celkem osmi regionů NUTS2.\\nÚzemí obcí se pro některé administrativní a statistické účely dělí na katastrální území a dále základní sídelní jednotky."},{"page_url":"https://fr.wikipedia.org/wiki/William_Wilkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Northington_Grange_-_Hampshire.jpg","page_title":"William Wilkins","context_page_description":"William Wilkins, né le 31 août 1778 à Norwich et mort le 31 août 1839 à Cambridge, est un architecte et archéologue britannique.\\nIl a notamment conçu la National Gallery et l'University College de Londres."},{"page_url":"https://sv.wikipedia.org/wiki/San_Mauro_Cilento","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Chiesa_san_mauro_cilento.JPG","page_title":"San Mauro Cilento","context_page_description":"San Mauro Cilento är en ort och kommun i provinsen Salerno i regionen Kampanien i Italien. Kommunen hade 865 invånare."},{"page_url":"https://bs.wikipedia.org/wiki/AMX-30","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/AMX-50.jpg","page_title":"AMX-30","context_page_description":"AMX-30 je glavni borbeni tenk druge generacije kojeg je projektirala francuska kompanija GIAT, a čiji je prvi naručilac i korisnik bila francuska vojska 1966. godine. Razvijan je uporedo s njemačkim Leopard 1. Prvih 5 tenkova je predano 501. Régiment de Chars de Combat u augustu 1966. godine. Proizvodna verzija tenka AMX-30 je zbog povećanja pokretljivosti bila teška 36 tona, ali je zbog toga žrtvovana oklopna zaštita. Francuzi su važnost pokretljivosti tenka stavljali ispred oklopne zaštite. Vjerovali su da ako tenk bude pretežak, da će i pored svog silnog oklopa biti ranjiviji zbog premale pokretljivosti. Manjak oklopne zaštite su pokrili većom brzinom i manjim dimenzijama tenka, uključujući i visinu od 2,28 metara. Glavno naoružanje je činio 105 mm top, koji ispaljuje visoko-eksplozivne protivtenkovske granate poznate kao Obus G. Tenk pokreće 720 KS snažan HS-110 dizelski motor koji omogućuje maksimalnu brzinu od 65 km/h. Snaga se prenosi uz pomoć pomalo problematične transmisije koja utječe na ukupne performanse tenka.\\nZbog problema uzrokovanih nepouzdanom transmisijom, 1979. francuska vojska je počela modernizaciju svojih tenkova na standard AMX-30B2."},{"page_url":"https://pl.wikipedia.org/wiki/Frank_D%C5%BCibuti","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/5_Djiboutian_Francs_in_1991_Reverse.jpg","page_title":"Frank Dżibuti","context_page_description":"Frank Dżibuti – oficjalna jednostka płatnicza używana w Dżibuti. Jeden frank dżibutyjski dzieli się na 100 centymów. Kod ISO dla franka Dżibuti to DJF.\\nW obiegu znajdują się monety o wartości 1, 2, 5, 10, 20, 50, 100, 250, 500 franków, oraz banknoty o wartości 1000, 2000, 5000 i 10 000 franków.\\nKurs franka Dżibuti jest ściśle związany z kursem dolara amerykańskiego, 1 dolar = 177,721 franków"},{"page_url":"https://vi.wikipedia.org/wiki/Kuala_Terengganu","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Location_map_Malaysia_Peninsula.png","page_title":"Kuala Terengganu","context_page_description":"Kuala Terengganu là thành phố lớn nhất và là thủ phủ bang Terengganu, Malaysia. Ngày 01 tháng 1 năm 2008, Kuala Terengganu đã được nâng thành thành phố. Thành phố có dân số 286.317 người và cũng là thủ phủ của một huyện cùng tên. Kuala Terengganu có khoảng cách khoảng 500 km về phía đông bắc Kuala Lumpur nằm trên một doi đất được bao quanh ba mặt của Biển Đông. Cái tên có nghĩa là \\"Bến cảng Terengganu\\", đề cập đến cửa sông Terengganu đổ vào đại dương vào thời điểm này. Những cư dân của thành phố nói một phương ngữ khác biệt Terengganese của Mã Lai.\\nMột gia đình của thương nhân Trung Quốc kinh doanh giữa Trung Quốc và bán đảo Mã Lai thành lập Kuala Terengganu vào đầu thế kỷ XV. Ngay sau khi nó được thành lập, thị trấn phát triển thành một tiền đồn kinh doanh quan trọng giữa hai nước. Tuy nhiên, sau khi đế chế Malacca chinh phục thị trấn, ảnh hưởng của nó như là một cửa ngõ hàng đầu trong khu vực Đông Nam Á giảm vì hầu hết các thương nhân ưa thích để dừng lại ở Melaka, là trung tâm thương mại giữa Trung Quốc, Ấn Độ và Đông Nam Á."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Gmunden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Gmunden_%28Marktplatz_16%29.jpg","page_title":"Liste der denkmalgeschützten Objekte in Gmunden","context_page_description":"Die Liste der denkmalgeschützten Objekte in Gmunden enthält die 139 denkmalgeschützten, unbeweglichen Objekte der Bezirkshauptstadt Gmunden im oberösterreichischen Bezirk Gmunden."},{"page_url":"https://sl.wikipedia.org/wiki/Mirza","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Mirzas1878.jpg","page_title":"Mirza","context_page_description":"Mirza je bil naslov, ki je bil v turških državah, na primer v Kazaškem, Kazanskem, Astrahanskem, Krimskem in Sibirskem kanatu in Nogajski hordi, rezerviran za visoko aristokracijo. Na enak način se je kasneje uporabljal tudi v Osmanskem cesarstvu, Perziji, Čerkeziji, Širvanu, Mogulskem imperiju in muslimanskih državah v severni Indiji.\\nV sodobnem času se v je Vzhodni Evropi, Centralni Aziji in na Indijski podcelini naslov mirza pretvoril v osebno ime, ki namiguje, da je njegov nosilec moški potomec iz vladarske rodbine.\\nPod rusko carico Katarino Veliko so imeli mirze zaradi izjemnega bogastva enake pravice kot rusko plemstvo. V zameno za svoj položaj so financirali ruske vojne proti Osmanskemu cesarstvu. Abdul Mirza je dobil naslov princ Jusupov. Njegov naslednik princ Feliks Jusupov se je poročil s princeso Irino Aleksandrovno Rusko, edino nečakinjo carja Nikolaja II."},{"page_url":"https://ast.wikipedia.org/wiki/Tresporte_celular","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Turgor_pressure_on_plant_cells_diagram-es.svg","page_title":"Tresporte celular","context_page_description":"El tresporte celular ye l'intercambiu de sustances al traviés de la membrana plasmática, que ye una membrana semipermeable.\\nEl tresporte ye bien importante pa la célula porque-y dexa espulsar del so interior les refugayes del metabolismu, tamién el movimientu de sustances que sintetiza como hormones. Amás ye la forma en qu'adquier nutrientes por aciu procesos d'incorporación a la célula de nutrientes disueltos na agua. Les víes de tresporte al traviés de la membrana celular y los mecanismos básicos pa les molécules de pequeños tamaños son:"},{"page_url":"https://ceb.wikipedia.org/wiki/Erilepis_zonifer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Erilepis_zonifer1.jpg","page_title":"Erilepis zonifer","context_page_description":"Espesye sa isda nga una nga gihulagway ni William Neale Lockington ni adtong 1880 ang Erilepis zonifer. Ang Erilepis zonifer sakop sa kahenera nga Erilepis sa kabanay nga Anoplopomatidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Neue_Kantstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Blick_von_Ostpreu%C3%9Fenbr%C3%BCcke_auf_A_100_und_S-Bahn_%282009%29.jpg","page_title":"Neue Kantstraße","context_page_description":"Die Neue Kantstraße ist eine rund einen Kilometer lange Verbindungsstraße zwischen den Ortsteilen Charlottenburg und Westend des Berliner Bezirks Charlottenburg-Wilmersdorf. Sie verläuft von der Suarezstraße am Amtsgerichtsplatz über die Ostpreußenbrücke bis zum Messedamm, wo sie in die Masurenallee übergeht. Als Verlängerung der vom Breitscheidplatz kommenden Kantstraße erhielt sie ihren Namen am 27. August 1905 nach dem Philosophen Immanuel Kant. Am 20. Oktober 1966 wurde auch der Abschnitt der Masurenallee von der Ostpreußenbrücke bis zum Messedamm in Neue Kantstraße umbenannt. Der ursprüngliche Name des seinerzeitigen Bebauungsplans war Straße 9d. Als Hauptverkehrsstraße verbindet die Neue Kantstraße zusammen mit der Kantstraße die City-West mit dem Funkturm und dem Messegelände.\\nUngefähr auf der Hälfte ihrer Länge überquert die Neue Kantstraße mit der Lietzenseebrücke den Lietzensee. Seit 1904 ist der See durch einen – seinerzeit für die Neue Kantstraße aufgeschütteten – Damm geteilt, der den See in eine Nord- und Südhälfte teilt. Beide Teile sind seit 1954 durch eine Unterführung miteinander verbunden."},{"page_url":"https://ca.wikipedia.org/wiki/C%C3%B2mic_d%27aventures","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Fight_Comics_77.jpg","page_title":"Còmic d'aventures","context_page_description":"El còmic d'aventures és un dels gèneres d'acció més populars dins del còmic. Als gèneres de còmic, una de les diferenciacions que es fa, és entre còmic realista, i còmic d'humor. El còmic realista, també sol anomenar-se còmic d'aventures, doncs aquesta és una de les temàtiques més generals en aquest tipus de còmic."},{"page_url":"https://en.wikipedia.org/wiki/Lordship_of_Diepholz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Van_Diepholt_Arms%2C_Utrecht.jpg","page_title":"Lordship of Diepholz","context_page_description":"The County of Diepholz, that was first known as the Lordship of Diepholz, was a territory in the Holy Roman Empire in the Lower-Rhenish-Westphalian Circle. It was ruled by the Noble Lords, later Counts, of Diepholz from the late tenth century until 1585, when it was mostly incorporated into the Duchy of Brunswick-Lüneburg."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A2%D1%8D%D1%80%D1%8B%D1%8F%D0%BB%D1%8F%D0%B3%D1%96%D1%87%D0%BD%D0%B0%D1%8F_%D1%88%D0%BA%D0%BE%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Mam%C3%ADferos.jpg","page_title":"Тэрыялягічная школа","context_page_description":"«Тэрыялягічная школа» — назва прафэсійнай і адукацыйнай сеткі, якая аб’ядноўвае адмыслоўцаў-тэрыёлягаў Украіны і сумежных краінаў. Тэрыялягічная школа як супольнасьць існуе ў дзьвюх формах — як сетка адмыслоўцаў і як штогадовая сустрэча."},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_in_Estonia","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Malvaste_chapel%2C_July_2009.jpg","page_title":"List of churches in Estonia","context_page_description":"This is the List of churches in Estonia. It does not include some minor chapels or church ruins. Note that the \\"Year\\" here denotes the year that the construction of the church began or finished, when it was inaugurated, or the main construction period of the church in question.\\nIn line with the common church naming traditions in Estonia, a traditionally Lutheran country, the Lutheran parish churches are listed by their locality name, while churches of other denominations are listed by their full name. If a locality has several Lutheran churches, the official names are given. All together Estonia has 214 churches."},{"page_url":"https://en.wikipedia.org/wiki/Northbridge,_New_South_Wales","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Map_Willoughby_Northbridge.jpg","page_title":"Northbridge, New South Wales","context_page_description":"Northbridge is a suburb on the Lower North Shore of Sydney, New South Wales, Australia. It is located 6 kilometres north of the Sydney Central Business District, in the local government area of Willoughby.\\nThe Suspension Bridge, linking the suburb to Cammeray, has become a recognised symbol of Northbridge, completed in January 1892 and purchased by the state government in 1912.\\nThe suburb celebrated its centenary in 2013."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Phoenix,_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Phoenix-William_E._Cavness_House-1914.JPG","page_title":"National Register of Historic Places listings in Phoenix, Arizona","context_page_description":"This is a list of the National Register of Historic Places listings in Phoenix, Arizona.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Phoenix, the largest city in Maricopa County, Arizona, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 412 properties and districts listed on the National Register in Maricopa County, including 3 that are also National Historic Landmarks. The city of Phoenix is the location of 218 of these properties and districts, including 1 National Historic Landmark; they are listed here, while the remaining properties and districts and 2 National Historic Landmarks are located elsewhere in the county and are listed separately. Nineteen properties in Phoenix were once listed, but have since been removed. One property, the George E. Cisney House, has been delisted and relisted.\\nThis National Park Service list is complete through NPS recent listings posted August 7, 2020."},{"page_url":"https://es.wikipedia.org/wiki/Ionizaci%C3%B3n_qu%C3%ADmica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Chemical_Ionization.png","page_title":"Ionización química","context_page_description":"La ionización química es una técnica de ionización suave utilizada en espectrometría de masas.​​ Esto fue introducido por primera vez por Burnaby Munson y Frank H. Field en 1966.​ Esta técnica es una rama de la química de la molécula de iones gaseosos.​ Las moléculas de gas reactivo se ionizan por ionización electrónica, que luego reaccionan con moléculas del analito en la fase gaseosa para lograr la ionización. La ionización química negativa, la ionización química de intercambio de carga y la ionización química a presión atmosférica son algunas de las variaciones comunes de esta técnica. La CI tiene varias aplicaciones importantes en la identificación, elucidación de estructuras y la cuantificación de compuestos orgánicos.​ Además de las aplicaciones en química analítica, la utilidad de la ionización química se extiende también a los campos bioquímicos, biológicos y medicinales.​"},{"page_url":"https://vi.wikipedia.org/wiki/B%E1%BB%99_N%E1%BB%99i_v%E1%BB%A5_v%C3%A0_Truy%E1%BB%81n_th%C3%B4ng","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Government_Office_Complex_2_of_Japan_2009.jpg","page_title":"Bộ Nội vụ và Truyền thông","context_page_description":"Bộ Nội vụ và Tryuền thông là một bộ cấp trong Nội các Nhật Bản. Tên tiếng Anh của nó là Bộ Quản lý Công cộng, Nội vụ, Bưu chính Viễn thông trước năm 2004. Trụ sở được đặt trong Tòa nhà thứ hai của Văn phòng Chính phủ Trung ương tại 2-1-2 Kasumigaseki tại Chiyoda, Tokyo, Nhật Bản.\\nBộ này chuyên giám sát hệ thống hành chính Nhật Bản, quản lý chính quyền địa phương, bầu cử, viễn thông, bưu điện và thống kê chính phủ.\\nBộ trưởng Nội vụ và Truyền thông là người đứng đầu Bộ và là thành viên của Nội các Nhật Bản."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%83%D8%B3%D9%88%D9%8A%D9%84_%D9%81%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Maxwell_Fry_and_Jane_Drew_at_Lartington_Hall_1984.JPG","page_title":"ماكسويل فرى","context_page_description":"ماكسويل فرى كان مهندس من المملكه المتحده."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%D8%B1%D8%A8%DB%8C%D9%86_%D8%A8%D9%84%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Corbin_Bleu_Logo_2.jpg","page_title":"کوربین بلو","context_page_description":"کوربین بلو ریورز که به کوربین بلو مشهور است، بازیگر، مدل، رقصنده و خوانندهٔ آمریکایی است. او بیشتر به خاطر نقشش در سری فیلم‌های دبیرستان موزیکال، مجموعه پرواز ۲۹ سقوط کرد و بپر داخل! شناخته می‌شود. به عنوان یک مهمان افتخاری به نظر می‌رسد در برخی از قسمت‌های تلویزیون سری هانا مونتانا. در پاییز سال ۲۰۰۹، باعث شد نقش اصلی را در سبک آزاد فیلم.\\nاو همچنین به صورت خواننده تک‌خوان اولین آلبوم خود را با نام جهت دیگر در ۱ مه ۲۰۰۷ عرضه کرد. آلبوم در بیلبورد ۲۰۰ ۱۸٬۰۰۰ نسخه در هفته اول رتبه ۳۶ را گرفت. دومین آلبوم او با نام سرعت نور در ۱۰ مارس ۲۰۰۹ در آمریکا عرضه شد. در این منطقه از مرحله، در سال ۲۰۱۰ به تئاتر موزیکال در خیابان برادوی، یک بازی در مناطق مرتفع شده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/Tuscaloosa_County","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Tuscaloosa_Court_House.jpg","page_title":"Tuscaloosa County","context_page_description":"Tuscaloosa County is een county in de Amerikaanse staat Alabama.\\nDe county heeft een landoppervlakte van 3.430 km² en telt 164.875 inwoners. De hoofdplaats is Tuscaloosa.\\nVlak bij het plaatsje Vance ligt Mercedes-Benz Tuscaloosa; de enige assemblagefabriek van Mercedes-Benz in de VS."},{"page_url":"https://ro.wikipedia.org/wiki/Fecioara_Maria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/NechitaZugravu_%282%29.JPG","page_title":"Fecioara Maria","context_page_description":"Maica Domnului sau Fecioara Maria a fost, conform scrierilor Noului Testament, mama lui Iisus din Nazaret. Conform protoevangheliei după Iacob, Fecioara Maria a fost fiica lui Ioachim și Ana. Conform Noului Testament, în momentul conceperii lui Iisus Hristos, fapt ce i-a fost revelat de Arhanghelul Gabriel, ea era logodnica lui Iosif din Nazaret. În tradiția creștină, precum și în cea musulmană, a rămas prin minune fecioară în timpul conceperii și nașterii lui Iisus.\\nTermenul de logodnă este o traducere greșită a conceptului de kiddushin, din punct de vedere al legii iudaice cei denumiți în traduceri greșite drept „logodiți” erau deja soț și soție. În realitate la evreii antici nu existau logodne, ci doar căsătorii, fiecare căsătorie era după câtva timp urmată de altă ceremonie, de consumare a căsătoriei. Deci în loc să vorbim de logodnă urmată de căsătorie, corect din punct de vedere istoric este să vorbim despre căsătorie urmată de ceremonia de consumare a căsătoriei.\\nAl treilea sinod ecumenic, ținut la Efes în anul 431, convocat pentru a dezbate asupra învățăturii dioprosopiste a patriarhului Nestorie, a confirmat învățătura Bisericii primare cu privire la Maica Domnului."},{"page_url":"https://de.wikipedia.org/wiki/RurUfer-Radweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Sundown_in_Kalterherberg.jpg","page_title":"RurUfer-Radweg","context_page_description":"Der RurUfer-Radweg ist ein Radfernweg, der über rund 180 Kilometer an der Rur entlangführt. Er beginnt in Belgien in der Nähe der Rurquellen an der höchsten Erhebung Belgiens, dem Botrange im Hohen Venn, und führt bis zur Mündung in die Maas im niederländischen Roermond. Die Strecke führt durch Monschau, an den Rurstauseen vorbei und dann über Heimbach, Düren, Jülich und Linnich durch den Kreis Heinsberg und die niederländische Gemeinde Roerdalen nach Roermond. Die Route verläuft nahezu ausschließlich auf separaten Rad- und Wirtschaftswegen. Die Route ist in beide Richtungen einheitlich mit dem Radwege-Logo beschildert. In Belgien sowie in den Niederlanden durch das „Knotenpunktsystem“."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_du_Valais","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Helvetische_Revolution.png","page_title":"Histoire du Valais","context_page_description":"Occupé dès la préhistoire, le territoire du canton du Valais voit se développer une civilisation originale lors de l'Âge du bronze. Dès le IVᵉ siècle av. J.-C., quatre tribus celtes se partagent son territoire, incorporé par Auguste dans l'Empire romain. Le Valais gallo-romain, situé sur l'importante route du Grand-Saint-Bernard est prospère. Le christianisme y est attesté dès 377 et un évêché est sis à Martigny au plus tard en 381.\\nÀ la chute de l'Empire, la région devient burgonde avant d'être intégrée avec celui-ci dans le royaume franc carolingien. À sa disparition, il fait partie du royaume de Bourgogne transjurane dont l'abbaye de Saint-Maurice d'Agaune est le centre religieux. Le comté du Valais devient propriété de l'évêque en 999, sur donation de Rodolphe III de Bourgogne et, au XIᵉ siècle, il passe au Saint-Empire romain germanique et la féodalité le fragmente en de nombreuses seigneuries et territoires. La partie amont du territoire se germanise en vagues successives entre les IXᵉ et XIVᵉ siècles ; parallèlement l'influence des comtes, puis ducs, de Savoie augmente dans le Bas-Valais."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%91%A9%E6%89%98%E8%BB%8A%E9%A1%9E%E5%9E%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/2007_Suzuki_DRZ-400SM.jpg","page_title":"摩托車類型","context_page_description":"機車的類型有很多種分類方式，各國法律一般是以引擎動力、排氣量和限速的方式來分類，機車騎士則更熱衷於以機車的機械構造、外觀設計和實際用途來進行分類。\\n量產型機車常見的類型有街車、跑車、巡航車、旅行車、多功能車和越野車等幾種類型，有些型號目錄則會把旅跑車分劃成為一個單獨的類型； 有些型號目錄會把速克達、彎梁車和助力車排除在機車之外，將它們歸類為「輕機車」，也有些目錄把它們視同為小型機車。\\n事實上，機車的分類並沒有各國通用的標準，一方面取決於同款式的機車是否適合參加運動競賽，另一方面也取決於道路車輛的製造、註冊、排放、安全和執照的法律定義；同時，也取決於製造商的企圖、機車型號目錄的歸類和當地的機車文化。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B3%D8%AC%D8%AF_%D8%A8%D9%86%DB%8C%D8%A7_%D8%A8%D8%A7%D8%B4%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Banya-bashi-imagesfrombulgaria.JPG","page_title":"مسجد بنیا باشی","context_page_description":"مسجد بنیا باشی یک مسجد متعلق به ترک‌های بلغارستان در پایتخت بلغارستان شهر صوفیه که توسط خواجه معمار سنان آغا معمار مشهور امپراطوری عثمانی به سال ۱۵۷۶ میلادی به صورت تک‌مناره با ارتفاع ۱۵ متر و با شیوه معماری عثمانی بنا شده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Dagbladet","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Dagbladet_2._januar_1905_-_framside.JPG","page_title":"Dagbladet","context_page_description":"Dagbladet es un periódico de Noruega fundado en 1869 en Oslo que se publica en la variedad bokmål del noruego. Su redactor jefe es John Arne Markussen, y se edita en formato tabloide desde 1983. Dagbladet es tradicionalmente el tercer periódico del país tras la edición matutina del Aftenposten y el Verdens Gang, compitiendo directamente con este último. Fue el primer periódico nacional noruego con edición online, dagbladet.no, el 8 de marzo de 1995 que en 2012 tenía 771.000 visitas únicas en ordenadores y 237.000 en dispositivos móviles .​\\nEl 20 de junio de 2013 se anunció que Aller Media compraría el 100% de la propiedad del Dagbladet al Berner Gruppen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%BF%E5%B7%9E%E5%8D%81%E4%B8%89%E8%A1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/%E5%BA%B7%E7%86%99%E4%BA%94%E5%8D%81%E4%B8%83%E5%B9%B4%E5%85%A9%E5%BB%A3%E7%B8%BD%E7%9D%A3%E6%A5%8A%E7%90%B3%E9%97%9C%E6%96%BC%E5%8D%81%E4%B8%89%E8%A1%8C%E7%9A%84%E5%A5%8F%E6%8A%98.jpg","page_title":"广州十三行","context_page_description":"廣州十三行，又稱廣東十三行、十三洋行，是指清朝沿用明朝之習慣稱呼廣州對外貿易特區內的十三家牙行商人。後來，這地區稱為「十三行街」，「洋貨行」、「洋行」成為外貿商行的通稱。十三行街現為十三行路，原十三行地區位於今十三行路以南及廣州文化公園一帶。\\n康熙二十三年，康熙批准外商在粵海關、閩海關、浙海關、江海關四個口岸經商，當時，國內外運到廣東海口的商貨很多，行商卻很少。1686年洋商獲准在廣州市珠江口的一個街區居住和經商。\\n乾隆二十二年，清廷下令封鎖全國對外口岸，僅保留廣州珠江粵海關一帶作為對外通商港口，及不得在中國其他地方經商。廣州的洋行集中在離珠江約三百尺的十三行區。在廣州立洋行的包括花旗國、紅毛國、雙鷹國、單鷹國、黃旗國、法蘭西、瑞典、葡萄牙等國商人。十三洋行區除洋商、十三行外，還有官辦的商行。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%AE%E9%9A%86%E6%AF%94%E8%80%B6%E5%B0%94%E8%8E%B1%E7%8F%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Map_commune_FR_insee_code_88351.png","page_title":"普隆比耶尔莱班","context_page_description":"普隆比耶尔莱班是法国洛林大区孚日省的一个市镇，属于埃皮纳勒区和勒瓦勒达若勒县。该市镇2009年时的人口为1,678人。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86%D8%AA%DB%8C%D8%A7%DA%AF%D9%88_%DA%A9%D8%A7%D9%84%D8%A7%D8%AA%D8%B1%D8%A7%D9%88%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Santiago_Calatrava_%28cropped%29.jpg","page_title":"سانتیاگو کالاتراوا","context_page_description":"سانتیاگو کالاتراوا معمار برجسته، مهندس سازه و مجسمه‌ساز اسپانیایی است. او به عنوان یک طراح نخبه در جهان شهرت کسب کرده‌است. دفاتر کاری او در زوریخ، پاریس، نیویورک و شهرهای دیگر جهان گسترده‌است. شهرت وی در معماری نوین زبانزد خاص و عام شده‌است.\\nوی هم‌اکنون در حال ساخت سه پل در شهر دالاس و در حال تکمیل یک برج ۱۵۰ طبقه‌ای در شهر شیکاگو، ایلینوی به نام «منار شیکاگو» است."},{"page_url":"https://ceb.wikipedia.org/wiki/Outer_Hebrides","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Outer_Hebrides_banner_Machair_Flowers.JPG","page_title":"Outer Hebrides","context_page_description":"Kapuloan ang Outer Hebrides sa Hiniusang Gingharian. Nahimutang ni sa dapit sa konseho sa Eilean Siar ug apil sa nasod sa Scotland, sa amihanan-kasadpang bahin sa nasod, 800 km sa amihanan-kasadpan sa London ang ulohan sa nasod. Naglangkob kin og 3.1 ka kilometro kwadrado.\\nAng yuta sa Outer Hebrides kay medyo bungtoron. Ang labing taas nga punto sa pulo mao ang 787 metros ibabaw sa dagat nga lebel. Hapit nalukop sa kasagbotan ang palibot sa Outer Hebrides."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D1%96-%D0%86%D0%B2_%D0%9D%D0%BE%D0%BB%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Marie-%C3%88ve_Nault_%2821119002754%29.jpg","page_title":"Мері-Ів Нолт","context_page_description":"Марі-Єв Но — канадська футболістка, олімпійська медалістка."},{"page_url":"https://eo.wikipedia.org/wiki/Hlohovec_(distrikto_B%C5%99eclav)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Hlohovec_%28okres_B%C5%99eclav%29_vlajka.jpg","page_title":"Hlohovec (distrikto Břeclav)","context_page_description":"Hlohovec estas vilaĝo en Ĉeĥio.\\nLa vilaĝo, situanta proksime de Valtice, estas en skribfontoj unuafoje menciata nur en la jaro 1414, sed ĝi jam estiĝis en la 13-a jarcento kiel koloniiga vilaĝo, fondita de pasova episkopejo. De tiu loko ni derivas ankaŭ ties germanan nomon - Bischofswarth, t.e episkopa gardantaro, ĉar tra ties katastro kondukis devena moravia-aŭstria limo. Tiun hodiaŭ rememorigas klasicisma Lima kastelo, konstruita en la jaro 1826, en kies fronto ni povas legi surskribon \\"Zwischen Österreich und Mähren\\" kaj tra ties akso tiu ĉi limo ĝis la jaro 1920 kondukis. Post ampleksa rekonstruo, finita en la jaro 1996, estas lokigita en ĝi agrabla restoracio, el kies teraso estas videbla fiŝlago de Hlohovec, plena de protektata akvobirdaro. La fiŝlago estas parto de nacia naturrezervejo Lednické rybníky, proklamita jam en la jaro 1953."},{"page_url":"https://no.wikipedia.org/wiki/Pyronia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Galicia_%28Spain%29._Bolboreta_dourada.jpg","page_title":"Pyronia","context_page_description":"Pyronia er en slekt av sommerfugler som hører til underfamilien ringvinger i den store familien flikvinger."},{"page_url":"https://en.wikipedia.org/wiki/Slender-billed_prion","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Slender-billed_Prion_Close.jpg","page_title":"Slender-billed prion","context_page_description":"The slender-billed prion or thin-billed prion, is a species of petrel, a seabird in the family Procellariidae. It is found in the southern oceans."},{"page_url":"https://en.wikipedia.org/wiki/Death_in_Venice","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Hotel_des_Bains_02.jpg","page_title":"Death in Venice","context_page_description":"Death in Venice is a novella written by the German author Thomas Mann and was first published in 1912 as Der Tod in Venedig. The work presents a great writer suffering writer's block who visits Venice and is liberated, uplifted, and then increasingly obsessed, by the sight of a stunningly beautiful youth.\\nTadzio, the boy in the story, is the nickname for the Polish name Tadeusz and based on a boy Mann had seen during his visit to Venice in 1911."},{"page_url":"https://pl.wikipedia.org/wiki/Metro_w_Kioto","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Kyoto-karasumaoike.jpg","page_title":"Metro w Kioto","context_page_description":"Metro w Kioto, jap.: 京都地下鉄 Kyōto Chikatetsu, pełna nazwa 京都市営地下鉄 Kyōto Shiei Chikatetsu – sieć szybkiej kolei miejskiej należącej do Miasta Kioto i obsługującej jego terytorium. Sieć, długości 31,2 km, jest przykładem jednego z mniejszych systemów metra funkcjonujących w Japonii."},{"page_url":"https://de.wikipedia.org/wiki/Papierwerd","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Murerplan_Farbe.jpg","page_title":"Papierwerd","context_page_description":"Die Papierwerd oder manchmal auch Papierwerd-Insel war bis 1950 eine Insel in der Limmat in der Stadt Zürich."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Bardhaman","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Burnpur_bungalow.jpg","page_title":"Distrito de Bardhaman","context_page_description":"Bardhaman es un distrito de la India en el estado de Bengala Occidental. Código ISO: IN.WB.BR.​\\nComprende una superficie de 1 100 km².\\nEl centro administrativo es la ciudad de Bardhaman."},{"page_url":"https://en.wikipedia.org/wiki/Skin_biopsy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Biopsi.JPG","page_title":"Skin biopsy","context_page_description":"Skin biopsy is a biopsy technique in which a skin lesion is removed to be sent to a pathologist to render a microscopic diagnosis. It is usually done under local anesthetic in a physician's office, and results are often available in 4 to 10 days. It is commonly performed by dermatologists. Skin biopsies are also done by family physicians, internists, surgeons, and other specialties. However, performed incorrectly, and without appropriate clinical information, a pathologist's interpretation of a skin biopsy can be severely limited, and therefore doctors and patients may forgo traditional biopsy techniques and instead choose Mohs surgery. There are four main types of skin biopsies: shave biopsy, punch biopsy, excisional biopsy, and incisional biopsy. The choice of the different skin biopsies is dependent on the suspected diagnosis of the skin lesion. Like most biopsies, patient consent and anesthesia are prerequisites."},{"page_url":"https://de.wikipedia.org/wiki/Lange_Gasse_25_(Quedlinburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Lange_Gasse_25_Hof_%28Quedlinburg_2012%29_by_Andreas_Werner_-_IMG_7615.jpg","page_title":"Lange Gasse 25 (Quedlinburg)","context_page_description":"Das Haus Lange Gasse 25 ist ein denkmalgeschütztes Gebäude in Quedlinburg in Sachsen-Anhalt."},{"page_url":"https://nl.wikipedia.org/wiki/Yaquina_Bay_Lighthouse","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Yaquina_Bay_Lighthouse.jpg","page_title":"Yaquina Bay Lighthouse","context_page_description":"Yaquina Bay Lighthouse is een vuurtoren in Oregon. De vuurtoren werd in 1871 gebouwd als havenlicht voor Newport. Newport was destijds een belangrijke haven tussen San Francisco en de Puget Sound. Vier jaar later al buiten gebruik gesteld vanwege de bouw van een nieuwe vuurtoren, Yaquina Head Lighthouse, zo’n vijf kilometer ten noorden van Yaquina Bay Light. Het gebouw is nu een museum en open voor publiek."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A1%94%E5%B8%95%E6%96%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Ensaladilla_rusa_tapas.jpg","page_title":"塔帕斯","context_page_description":"塔帕斯是西班牙饮食中重要的一部分，是指正餐之前作为前菜食用的各种小吃，也通常作为下酒菜。塔帕斯可以是凉菜，如各式奶酪及橄榄；也可以是热菜，如裹好面糊油炸的鱿鱼，煮马铃薯等等。塔帕斯最初作为佐酒用的小食，然而如今在西班牙的一些酒吧里，塔帕斯发展成为一种比较完整而复杂的菜式。各式各样的塔帕斯组合起来甚至可以成为一顿完整的正餐。"},{"page_url":"https://de.wikipedia.org/wiki/British_Racing_Motors","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Rodriguez%2C_Pedro_-_BRM_1968.jpg","page_title":"British Racing Motors","context_page_description":"British Racing Motors war ein britischer Hersteller von Rennwagen, dem ein Werksteam für den Einsatz in der Formel 1 angegliedert war. Das Team nahm unter der Bezeichnung Owen Racing Organisation zwischen 1951 und 1977 an der Formel-1-Weltmeisterschaft teil und belieferte außerdem unabhängige Kundenteams mit Motoren und anderen Komponenten. Der größte Erfolg der Teamgeschichte war der Gewinn der Fahrerweltmeisterschaft 1962 durch Graham Hill sowie des Konstrukteurstitels im selben Jahr. Nach dem wirtschaftlichen Niedergang wurde es 1977 kurzfristig als Stanley-BRM geführt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D1%81%D0%B8_%D0%94%D0%B6%D0%B5%D0%B9%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/14-10-16_Venus-Verleihung_Jesse_Jane_01.jpg","page_title":"Джеси Джейн","context_page_description":"Джеси Джейн е артистичен псевдоним на американската порнографска актриса и еротичен модел Синди Тейлър. Определяна е като лицето на модерното порно."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%A4%E4%BA%AD%E7%AB%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/GT_12.JPG","page_title":"古亭站","context_page_description":"古亭站位於台北市中正區、大安區交界處，為台北捷運松山新店線與中和新蘆線交會的捷運車站。\\n已廢止的臺灣鐵路管理局新店線亦曾設有古亭車站，但位置與捷運站現址不同。\\n古亭站屬於松山新店線和中和新蘆線的交會站，故月台等標示顏色也以綠橘雙色為主。2012年中和新蘆線貫通時，松山線尚未完工，新店線仍與淡水線直通行駛，因此新店線月臺的路線指標及中和新蘆線列車到站的轉乘廣播都曾以淡水線為主，直到2014年11月松山線通車。"},{"page_url":"https://de.wikipedia.org/wiki/Junkers_Ju_86","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Junkers_Ju_86K-4_Flygvapenmuseum.jpg","page_title":"Junkers Ju 86","context_page_description":"Die Junkers Ju 86 war ein zweimotoriges Ganzmetall-Propellerflugzeug der Junkers Flugzeugwerk AG in Dessau, das sowohl für den zivilen als auch für den militärischen Einsatz entwickelt wurde. In verschiedenen Varianten fertigten Junkers und Lizenznehmer insgesamt rund 900 Exemplare des freitragenden Tiefdeckers."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1971","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Katie_Finneran_in_Annie_The_Musical%2C_October_6%2C_2012.jpg","page_title":"Lijst van personen geboren in 1971","context_page_description":"Dit is een lijst van personen die geboren zijn in 1971.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_Congress_members_who_died_in_office_(1900%E2%80%931949)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/James_C._McLaughlin_%28Michigan_Congressman%29.jpg","page_title":"List of United States Congress members who died in office (1900–1949)","context_page_description":"The following is a list of U.S. Senators and Representatives who died of natural and accidental causes, due to illnesses, and by suicide, while they were serving their terms between 1900 and 1949.\\nParty colors: Democratic Republican Progressive Unionist"},{"page_url":"https://fr.wikipedia.org/wiki/Coupe_du_monde_de_football_des_moins_de_20_ans_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Kadir-has-stadium-kamilsaim.jpg","page_title":"Coupe du monde de football des moins de 20 ans 2013","context_page_description":"La Coupe du monde de football des moins de 20 ans 2013 est la dix-neuvième édition de la Coupe du monde de football des moins de 20 ans et réunit 24 équipes en Turquie du 21 juin au 13 juillet 2013.\\nLe pays organisateur a été choisi par le comité exécutif de la Fédération internationale de football association le 3 mars 2011. Tout joueur né à partir du 1ᵉʳ janvier 1993 peut participer à la compétition.\\nLa France s'impose en finale de la compétition face à l'Uruguay. Elle remporte à cette occasion le dernier trophée FIFA manquant à son palmarès. À ce jour, elle devient la seule nation à avoir gagné l'ensemble des compétitions masculines de football à 11 organisées par la FIFA : coupe du monde de football, coupe du monde de football des moins de 20 ans, coupe du monde de football des moins de 17 ans, Coupe des confédérations et tournoi olympique de football.\\nTrois sélections font leurs débuts en Coupe du monde : Cuba, le Salvador et la Grèce."},{"page_url":"https://az.wikipedia.org/wiki/%C5%9E%C9%99k%C9%99r","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sugarcubes.jpg","page_title":"Şəkər","context_page_description":"Şəkər - bir çoxu qida olaraq istifadə olunan, şirin dad verən, kimyəvi olaraq qısa zəncirli, suda həll olunn bir sıra karbohidrata verilən ümumi addır. Müasir dövrdə ən çox yayılmış qida məhsuludur. Şəkər əksər bitkinin toxumalarında mövcud olsa da sənaye istehsalı üçün kifayət qədər yüksək konsentrasiya əsas şəkər qamışı və şəkər çuğundurunda var. Dünya üzrə 94-97 milyon ton şəkər istehsalının 56-60 milyon ton şəkər qamışının, 36-38 milyon tonu şəkər çuğundurunun payına düşür.\\nDünyada 1500 şəkər qamışı emal edən və təxminən 1000 şəkər çuğunduru emal edən zavod mövcuddur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D0%B1%D1%82%D1%80%D0%BE%D0%BF%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Rododendron.jpg","page_title":"Субтропический лес","context_page_description":"Субтропический лес — лес, произрастающий в субтропических поясах как Северного, так Южного полушарий. Здесь почти не осталось природных старых лесных массивов, большую часть субтропических лесов составляют культурные посадки.\\nПодразделяется на зоны гемигилей, муссонных смешанных лесов и средиземноморских летнесухих лесов и кустарников. Позднее Калесник С. В. рассматривал гемигилеи и муссонные смешанные леса как единую ландшафтную зону субтропических вечнозелёных и смешанных лесов. В состав новой зоны вошло Закавказье, в котором зональная субтропическая растительность сменилась широколиственными лесами с вечнозелёным подлеском. Если одни географы занимались слиянием, то другие продолжили обособлять переходные зоны. Лесотундра дополнилась подтайгой и субсредиземноморской ландшафтной зоной. Субсредиземноморскую зону откололи от средиземноморской. Субсредиземноморский тип ландшафтов характерен для южного берега Крыма и участка от полуострова Абрау до окрестностей Туапсе."},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_on_the_postage_stamps_of_Azerbaijan","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/H._Aliyev_stamp-1_m.jpg","page_title":"List of people on the postage stamps of Azerbaijan","context_page_description":"Designs on the postage stamps of Azerbaijan closely follow the political history of Azerbaijan. The country briefly obtained independence in 1918, lost it to the Soviet Union in 1920, and re-acquired it in 1991 after the dissolution of the Soviet Union. Throughout that period 87 different persons have been depicted on stamps, excluding those featuring national football teams. Some people are featured on souvenir sheets. The currency value of the stamps varies depending on the year of issue. The person featured most frequently over the years is President Heydar Aliyev. Zarifa Aliyeva, Huseyn Aliyev, Huseyn Javid, John Paul II, Jalil Mammadguluzadeh, and Nasiraddin Tusi have been featured twice.\\nThe first Azerbaijani national postage stamps were issued by the Azerbaijan Democratic Republic; they depicted ordinary individuals. From 1920s until 1991 Azerbaijan used Soviet postage stamps. The national postage stamp company Azermarka began functioning in 1992. People have been featured on stamps of the Republic of Azerbaijan since 1993. The first person to be featured on a postage stamp after the dissolution of the Soviet Union was Heydar Aliyev, the third President of Azerbaijan."},{"page_url":"https://fr.wikipedia.org/wiki/Sal%C3%A9e_au_sucre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Salee_au_sucre_2.jpg","page_title":"Salée au sucre","context_page_description":"Une salée au sucre est un dessert typique du canton de Vaud. Le terme aujourd'hui contre-intuitif de « salée » est attesté dès 1660 et désignait toute forme de gâteau.\\nSi la littérature du XIXᵉ siècle parle de « sorte de galette aux œufs » ou de « gâteau sur la pâte duquel on répand des œufs battus », il s'agit de nos jours d'une pâte levée sur laquelle est épandu un mélange de crème, beurre, farine et sucre.\\nLa salée ormonanche est une variante à base de cassonade et canelle que l'on trouverait essentiellement dans la vallée des Ormonts et le Pays-d'Enhaut."},{"page_url":"https://de.wikipedia.org/wiki/Universit%C3%A4t_Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Rotes_Kolleg.jpg","page_title":"Universität Leipzig","context_page_description":"Die Universität Leipzig – Alma Mater Lipsiensis – ist mit ihrem Gründungsjahr 1409 nach der Universität Heidelberg die zweitälteste ohne Unterbrechung betriebene Universität im heutigen Deutschland."},{"page_url":"https://es.wikipedia.org/wiki/Lan%C4%8Dov","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Kostel_svat%C3%A9_Ma%C5%99%C3%AD_Magdal%C3%A9ny_v_Lan%C4%8Dov%C4%9B_02.JPG","page_title":"Lančov","context_page_description":"Lančov es una localidad del distrito de Znojmo en la región de Moravia Meridional, República Checa, con una población estimada a principio del año 2018 de 231 habitantes.\\nSe encuentra ubicada al suroeste de la región, cerca de la orilla del río Dyje —un afluente del río Morava que, a su vez, lo es del Danubio—, de la frontera con Austria y la región de Vysočina, y a poca distancia al suroeste de la ciudad de Brno.​"},{"page_url":"https://pt.wikipedia.org/wiki/Sileno","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Head_of_Silenus_-_Project_Gutenberg_eText_19115.png","page_title":"Sileno","context_page_description":"Sileno era, na mitologia grega, um dos seguidores de Dioniso, seu professor e companheiro fiel. Notório consumidor de vinho, era representado como estando quase sempre bêbado e tendo de ser amparado por sátiros ou carregado por um burro. Sileno era descrito como o mais velho, o mais sábio e o mais beberrão dos seguidores de Dioniso, e era descrito como tutor do jovem deus nos hinos órficos.\\nQuando estava sob o efeito do álcool, Sileno adquiria conhecimentos especiais e o poder da profecia. O rei da Frígia Midas estava ansioso para aprender com ele, e o aprisionou, laçando-o numa fonte onde Sileno costumava beber.\\nSegundo o filólogo e filósofo alemão Friedrich Nietzsche:\\n\\"Reza a antiga lenda que o rei Midas perseguiu-o na floresta, durante longo tempo, sem conseguir apanhá-lo. Quando, por fim, ele veio a cair em suas mãos, perguntou-lhe qual dentre as coisas era a melhor e a mais preferível para o homem. Obstinado e imóvel, calava-se; até que, forçado pelo rei, prorrompeu finalmente, por entre um riso amarelo, nestas palavras: - Estirpe miserável e efêmera, filhos do acaso e do tormento! Por que me obrigas a dizer-te o que seria para ti mais salutar não ouvir?"},{"page_url":"https://ro.wikipedia.org/wiki/Erlend_Krauser","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Erlend_Krauser%2C_2018%2C_Timisoara2.jpg","page_title":"Erlend Krauser","context_page_description":"Erlend Krauser este un muzician de etnie germană, fost membru al formației Phoenix."},{"page_url":"https://es.wikipedia.org/wiki/Gastronom%C3%ADa_de_Jalisco","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Bunuelos_3_IMG_5460.jpg","page_title":"Gastronomía de Jalisco","context_page_description":"La gastronomía jalisciense son los alimentos, técnica culinarias y platos típicos de Jalisco en el occidente de México. Se trata de una cocina abundante y diversa, fruto del mestizaje entre la cocina indígena nativa y de los productos traídos por los colonizadores hispanos.​ Algunos antojitos y platillos típicos de Jalisco son las tortas ahogadas, la birria, los tamales, el pozole estilo tapatío o las enchiladas tapatías;​ «tapatío» es una denominación cariñosa para Guadalajara, su capital.\\nEntre los alimentos que se cultivan en Jalisco, destacan el agave, el maíz, las frutas, la caña de azúcar, el tomate y las legumbres.​​ Pero también, el nopal, la biznaga, el madroño, la avellana, el ocote, el oyamel o la ceiba. De carnes, es de gran importancia la ganadería bovina, siendo líder de esta en México, ​ y también de pollo y de huevo. La actividad pesquera se da en la costa y en el lago Chapala, de la que destacan el charal, el huachinango y el pargo.​"},{"page_url":"https://sl.wikipedia.org/wiki/Sonarna_boja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Airlaunched_sonobuoy_179.jpg","page_title":"Sonarna boja","context_page_description":"Sonarna boja je relativno majhna akustična naprava s sonarjem in hidrofonom. Uporablja se za detektiranje podmornic in drugih vodnih plovil ali pa za oceanografske meritve in komunikacijo s podmornicami. Lahko se jih odvrže s letal, helikopterjev ali pa ladij. Po navadi se uporabijo samo enkrat.\\nKo boja zadena vodo, se hidrofon potopi na želeno globino, radijski oddajnik, ki služi za komunikacijo z letali pa plava na površju.\\nKo se podmornice postale efektivno protiladijsko orožje, se je pojavila po odkrivanju le teh. Britanci so v 2. svetovni vojni razvili aktivni sonar, ki so ga poimenovali ASDIC. Pred njim je bilo možno samo pasivno odkrivati podmornice. Po 2. Svetovni vojni se je sonar zelo razvil.\\nPrve sonarne boje so razvili za protipodmorniška letala kot Lockheed P-2 Neptune, Grumman S-2 Tracker, Lockheed S-3 Viking in Lockheed P-3 Orion.\\nObstajajo tri kategorije sonarnih boj: aktivna, pasivna in posebej namenjena\\nAktivne sonarne boje oddajajo zvočne signale, ki zadenejo tarčo in se odbijejo. Hidrofoni poslušajo odboje in preko UHF/VHF radijskih komunikacij podajo letalu podatke."},{"page_url":"https://de.wikipedia.org/wiki/Jasienica_Rosielna","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Jasienica_Rosielna%2C_parkovi%C5%A1t%C4%9B.jpg","page_title":"Jasienica Rosielna","context_page_description":"Jasienica Rosielna ist ein Dorf im Powiat Brzozowski der Woiwodschaft Karpatenvorland in Polen. Es ist Sitz der gleichnamigen Landgemeinde mit etwas mehr als 7800 Einwohnern."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_ameryka%C5%84skich_senator%C3%B3w_ze_stanu_Wirginia_Zachodnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/DavisElkins.jpg","page_title":"Lista amerykańskich senatorów ze stanu Wirginia Zachodnia","context_page_description":"Lista amerykańskich senatorów ze stanu Wirginia Zachodnia – senatorzy wybrani ze stanu Wirginia Zachodnia.\\nStan Wirginia Zachodnia został włączony do Unii 20 czerwca 1863 roku po odłączeniu się od Wirginii. Posiada prawo do mandatów senatorskich 1. i 2. klasy. Do 8 kwietnia 1913 roku senatorowie byli wybierani przez stanowy parlament. Od tego czasu wybierani są w wyborach powszechnych."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%94_%D7%A7%D7%90%D7%A8%D7%99%D7%A0%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Aankomst_Franse_filmster_Anna_Karina_op_Schiphol%2C_Anna_Karina_tijdens_persconfer%2C_Bestanddeelnr_921-0593.jpg","page_title":"אנה קארינה","context_page_description":"אנה קארינה הייתה שחקנית קולנוע, במאית ותסריטאית דנית, אשר פעלה במהלך מרבית הקריירה הקולנועית שלה בצרפת.\\nקארינה הייתה ידועה בעיקר בשל שיתופי הפעולה שלה עם הבמאי הצרפתי ז'אן-לוק גודאר, מחלוצי הגל הצרפתי החדש. כמה משיתופי הפעולה הידועים ביותר עמו, הם הסרטים \\"החייל הקטן\\", \\"אישה היא אישה\\", \\"לחיות את חייה\\", ו\\"אלפאוויל\\". עבור תפקידה בסרט \\"אישה היא אישה\\", זכתה קארינה בפרס השחקנית הטובה ביותר בפסטיבל הסרטים הבינלאומי בברלין."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9C%E0%B4%AF%E0%B4%BF%E0%B4%82%E0%B4%B8%E0%B5%8D_%E0%B4%95%E0%B5%8B%E0%B4%B3%E0%B4%BF%E0%B4%AA%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/J._B._Collip_in_his_office_at_McGill_University_ca._1930.png","page_title":"ജയിംസ് കോളിപ്","context_page_description":"കനേഡിയൻ ജീവരസതത്രജ്ഞനാണ് ജയിംസ് കോളിപ്..ഇൻസുലിന്റെ കണ്ടുപിടിത്തത്തിൽ നിർണ്ണായക പങ്കാണ് കോളിപ് വഹിച്ചത്. പ്രമേഹ രോഗിയായ ലിയോനാർഡ് തോംസൺ എന്ന ബാലനിൽ കോളിപ് സംബന്ധിച്ച് നടത്തിയ പരീക്ഷണങ്ങൾ വിജയമായിരുന്നു.ഹോർമോണുകളെ സംബന്ധിച്ച കോളിപ്പിന്റെ പഠനങ്ങൾ ശ്രദ്ധേയമാണ്."},{"page_url":"https://cs.wikipedia.org/wiki/Falc_(hrad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/NRW%2C_D%C3%BCsseldorf_-_Kaiserpfalz_Kaiserswerth_01.jpg","page_title":"Falc (hrad)","context_page_description":"Falc je typ raně středověkého hradu ve Svaté říši římské."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%81%96%E8%8B%A5%E7%91%9F%E8%8B%B1%E6%96%87%E5%B0%8F%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/SJACS_Founder_19261940.jpg","page_title":"聖若瑟英文小學","context_page_description":"圣若瑟英文小学是香港观塘区一所私立全日制小学，除中文科外均采用英语作为教学语言。中文校训为“止于至善”，而拉丁文校训则为\\"AD Astra\\"。该校是一所天主教小学，办学团体为天主教香港教区，以大圣若瑟为主保圣人及学校名称，并以大圣若瑟的瞻礼日－3月19日为校庆。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%82%D9%84%D9%82_%D8%A3%D8%A8%D9%8A%D8%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/White_Stork_3weeks.jpg","page_title":"لقلق أبيض","context_page_description":"اللقلق الأبيض أو بلاّرج أبيض في الجزائر والمغرب أو أبو سعد في بلاد الشام أو العنز في مصر ويسمى في السودان أبو الودَيع، هو طائر من الطيور الخواضة ذات الأرجل الطويلة التي تنتمي لفصيلة اللقلق، ولون ريشه أبيض تماما إلا نهاية أطراف أجنحته فهي سوداء بينما السيقان والمنقار فهما أحمرا اللون. وهو طائر ضخم يصل طوله إلى 100-125 سم ويصل طول جناحه إلى 155-200 سم والوزن يصل إلى 2.3 -4.5 كجم. وله سلالتين مختلفتين من ناحية الجسم، إحداهما توجد في شمال أوربا حتى فنلندا، وشمال غرب أفريقيا، وجنوب غرب آسيا. وهو من الطيور المهاجرة القوية حيث يستطيع أن يصل إلى المنطقة الاستوائية و أفريقيا جنوب الصحراء أو أفريقيا السوداء وحتى أفريقيا الجنوبية وشبه القارة الهندية جنوبا. وأثناء هجرته من أوروبا إلى أفريقيا لا يمر بالبحر الأبيض المتوسط إنما ببلاد الشام في الشرق، ومن خلال مضيق جبل طارق في الغرب. والسبب في هذا حاجته إلى تيارات حرارية لا تتكون من خلال البحر. وأثناء حركته في البرية يمشي ببطء ولكن بلا توقف. وهو مثل كل اللقالق باستثناء جنس أبو سعن فهو يطير ورقبته ممدودة إلى الأمام.\\nاللقلق هو من اللواحم، ويتغذى على مجموعة واسعة من الطيور الصغيرة و الثدييات الصغيرة من الحشرات والزواحف والبرمائيات والأسماك. والمواد الغذائية أغلبها من الأرض، وتجمع من النباتات القصيرة داخل غطاء وكذلك المياه الضحلة."},{"page_url":"https://en.wikipedia.org/wiki/Merseyrail","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/British_Rail_Class_777.jpg","page_title":"Merseyrail","context_page_description":"Merseyrail is a commuter rail network serving Liverpool, England, the surrounding Liverpool City Region, the Wirral Peninsula and adjacent areas of Cheshire and Lancashire, including a number of underground stations. The core of the network is formed by two dedicated electrified lines known as the Northern Line and the Wirral Line, which run underground in central Liverpool and Birkenhead, providing a metro-style service. The third line, separate from the metro-style network, is named the City Line. The City Line is a term used by the governing body Merseytravel referring to local Northern services it sponsors serving in its area operating on the Liverpool to Manchester Lines and Liverpool to Wigan Line. Many of the City Line stations are branded Merseyrail using Merseyrail ticketing.\\nThe Merseyrail third rail network has 68 stations and 75 miles of route, of which 6.5 miles are underground. Carrying approximately 110,000 passengers each weekday, or 34 million passengers per year, it forms the most heavily used urban railway network in the UK outside London."},{"page_url":"https://en.wikipedia.org/wiki/Prince_Waldemar_of_Prussia_(1889%E2%80%931945)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Prince_Waldemar_Wilhelm_Ludwig_Friedrich_of%2C_Germany.jpg","page_title":"Prince Waldemar of Prussia (1889–1945)","context_page_description":"Prince Waldemar William Louis Frederick Victor of Prussia was the eldest son of Prince Henry of Prussia and his wife, Princess Irene of Hesse and by Rhine."},{"page_url":"https://de.wikipedia.org/wiki/Air_Central","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Air_Central_F50.JPG","page_title":"Air Central","context_page_description":"Air Central war eine japanische Fluggesellschaft mit Sitz in Tokoname. Sie war eine Tochtergesellschaft der All Nippon Airways und bediente regionale Ziele vom Flughafen Chūbu aus."},{"page_url":"https://pl.wikipedia.org/wiki/Portret_Lady_Meux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%27Portrait_of_Lady_Meux_in_Furs%27%2C_photograph_of_lost_oil_painting_by_James_McNeill_Whistler%2C_1881%2C_University_of_Glasgow.jpg","page_title":"Portret Lady Meux","context_page_description":"Portret Lady Meux – tytuł nadany kilku pełnopostaciowym portretom namalowanym przez Jamesa Whistlera, przedstawiającym Valerie Susan Meux, z domu Langdon, żonę wiktoriańskiego ekonomisty i londyńskiego browarnika, Sir Henry Meuxa. Valerie Susan Meux utrzymywała, iż była aktorką, ale w rzeczywistości występowała na scenie tylko przez jeden sezon. Spotkała ona Henry Meuxa przypuszczalnie w Casino de Venise w Holburn, gdzie pracowała jako grająca na banjo barmanka i prostytutka pod imieniem Val Reece."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%81%DB%81%D8%B1%D8%B3%D8%AA_%D9%85%D9%86%D8%AA%D8%AE%D8%A8_%DB%8C%D8%A7_%D9%85%D9%82%D8%B1%D8%B1_%D8%AE%D9%88%D8%A7%D8%AA%DB%8C%D9%86_%D8%B3%D8%B1%D8%A8%D8%B1%D8%A7%DB%81_%D8%AD%DA%A9%D9%88%D9%85%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Countries_which_have_had_female_Heads_of_State_and_Government.svg","page_title":"فہرست منتخب یا مقرر خواتین سربراہ حکومت","context_page_description":"یہ خواتین کی ایک فہرست ہے جو اپنے متعلقہ ممالک میں بطور سربراہ حکومت منتخب یا مقرر ہوئیں۔"},{"page_url":"https://de.wikipedia.org/wiki/Chewsuretien","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/KhevsuretiHistorical.jpg","page_title":"Chewsuretien","context_page_description":"Chewsuretien oder Chewsurien ist eine historisch-geographische Region im Nordosten des heutigen Georgien."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27arrondissement_de_Bayeux","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/La_Pierre_Debout1.JPG","page_title":"Liste des monuments historiques de l'arrondissement de Bayeux","context_page_description":"Cette liste regroupe une partie des monuments historiques du Calvados."},{"page_url":"https://en.wikipedia.org/wiki/List_of_medieval_churches_on_Gotland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Gotland-Boge_kyrka_Au%C3%9Fen.jpg","page_title":"List of medieval churches on Gotland","context_page_description":"There are 92 well-preserved churches from the Middle Ages on the Swedish island Gotland, which is more than in any other part of Sweden and unusual also compared with other parts of Europe. Benefiting from its location in the middle of the Baltic Sea, the island enjoyed an increase in trade and wealth thanks to increasing trade between Western and Eastern Europe, giving the inhabitants the means to build large and prestigious churches. The preserved churches date from a period between the early 12th century to the middle of the 14th century. The first churches were stave churches, but of these only fragments remain. The oldest still preserved churches on Gotland are simple Romanesque churches. Church architecture remained conservative on Gotland, and while Gothic forms eventually replaced Romanesque, it never acquired the structurally light character it did elsewhere in Europe. The churches built during the first half of the 14th century on Gotland are sometimes referred to as \\"counter-Gothic\\" in Swedish literature.\\nThe churches were often decorated with paintings of walls and vaults and stained glass windows inside, and with decorative sculptures both inside and outside."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AF%E3%82%B7%E3%83%B3%E3%83%88%E3%83%B3%E5%B1%B1_(%E3%83%8B%E3%83%A5%E3%83%BC%E3%83%8F%E3%83%B3%E3%83%97%E3%82%B7%E3%83%A3%E3%83%BC%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Mt_Washington_Auto_Road_at_summit.JPG","page_title":"ワシントン山 (ニューハンプシャー州)","context_page_description":"ワシントン山は、アメリカ合衆国北東部の最高峰であり、ミシシッピ川以東では麓との標高差が最も高い山である。気象が危険なほど変わりやすいことで有名である。2010年までの76年間で、頂上の気象観測所で記録した地表最大風速は、1934年4月12日午後の 231マイル/時 だった。ヨーロッパ人開拓者がこの地域に入ってくる以前、この山は「アジオコチョク」すなわち「偉大な精神の宿る所」と呼ばれていた。\\nワシントン山はホワイト山地の中のプレジデンシャル山地に属し、行政区ではニューハンプシャー州コーアス郡サージェンツパーチェイス郡区に入っている。山のほぼ全域が、広さ59エーカー のホワイト山国立の森の中にあり、山頂はワシントン山州立公園になっている。"},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%84%D9%85%DB%8C_%D8%AC%DB%8C%D8%A8%D9%88%D8%A7%D9%84%DB%8C_%D9%81%D8%B1%D9%88%D9%B9_%DA%86%D9%85%DA%AF%D8%A7%D8%AF%DA%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Long-tongued_Fruit_Bat_area.png","page_title":"لمی جیبوالی فروٹ چمگادڑ","context_page_description":"لمی جیبوالی فروٹ چمگادڑ وڈیاں چمگادڑاں دے ٹبر دی اک چمگادڑ اے۔"},{"page_url":"https://ceb.wikipedia.org/wiki/Provincia_Bautista_Saavedra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Charazani.jpeg","page_title":"Provincia Bautista Saavedra","context_page_description":"Lalawigan ang Provincia Bautista Saavedra sa Bolibiya. Nahimutang ni sa departamento sa Departamento de La Paz, sa amihanan-kasadpang bahin sa nasod, 600 km sa amihanan-kasadpan sa Sucre ang ulohan sa nasod. Adunay 16,308 ka molupyo. Naglangkob kin og 2,525 ka kilometro kwadrado.\\nAng yuta sa Provincia Bautista Saavedra kay kasagaran kabukiran, apan sa habagatang-kasadpan nga kini mao ang kabungtoran.\\nHapit nalukop sa kasagbotan ang palibot sa Provincia Bautista Saavedra. Dunay mga 5 ka tawo kada kilometro kwadrado sa palibot sa Provincia Bautista Saavedra may kaayo gamay nga populasyon. Ang klima tropikal sa ibabwan. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Agosto, sa 10 °C, ug ang kinabugnawan Enero, sa 4 °C. Ang kasarangang pag-ulan 1,205 milimetro matag tuig. Ang kinabasaan nga bulan Pebrero, sa 219 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 6 milimetro."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%AA%E3%83%A4%E3%83%BC%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Countries_where_Oriya_is_spoken.png","page_title":"オリヤー語","context_page_description":"オリヤー語とは、インドの公用語の一つで、東インドのオリッサ州の公用語。インド・ヨーロッパ語族インド語派東部語群に属し、ベンガル語、アッサム語などと近い関係にある。西ベンガル州にも話者が相当数いる。西インドグジャラート州の都市スーラトではオリッサ州からの労働者の増加によりインドで二番目にオリヤー語話者の多い町になった。インド憲法の第8付則に定められた22の指定言語のひとつである。\\nオリヤー語には13世紀までさかのぼる豊かな文学遺産がある。 14世紀に生き有名なヒンドゥー教の僧であったサララ・ダサは『マハーバーラタ』をオリヤー語に翻訳した。 この言語は『マハーバーラタ』、『ラーマーヤナ』のような古典サンスクリットテキストをオリヤー語に翻訳プロセスを通してサンスクリットからの翻訳方法を初めに標準化した。\\nオリヤー語の語彙は伝統的にヒンドゥー教、ジャイナ教の影響を受けている。また詩の強い伝統、特に祈祷の詩のものが多い。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Seen_im_Kanton_Uri","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Lake_near_Sunnig_Grat_summit.JPG","page_title":"Liste der Seen im Kanton Uri","context_page_description":"Die folgende Liste enthält benannte Seen und andere Stillgewässer im Kanton Uri.\\nSiehe auch: Liste der grössten Seen in der Schweiz"},{"page_url":"https://de.wikipedia.org/wiki/Musikjahr_1758","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Haydn-Symphony-37-I-bar1-6.png","page_title":"Musikjahr 1758","context_page_description":"Karneval: Das Opernlibretto Issipile von Pietro Metastasio wird in der Vertonung von Florian Leopold Gassmann am Teatro San Moisè in Venedig uraufgeführt. Eine weitere Vertonung von Gioacchino Cocchi hat ihre Uraufführung am 14. Mai am King’s Theatre am Haymarket in London.\\nChristoph Willibald Gluck – L’île de Merlin"},{"page_url":"https://hu.wikipedia.org/wiki/Bakkafrost","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Fish_Farming_in_the_Faroe_Islands_2013.JPG","page_title":"Bakkafrost","context_page_description":"A P/F Bakkafrost Feröer vezető lazac- és lazactermék előállító és exportőr vállalata. A termelési folyamat teljes vertikumát átfogja a lazactenyésztéstől a késztermékekig, és termékeit világszerte forgalmazza. Több mint 600 alkalmazottjával az ország egyik legnagyobb foglalkoztatója."},{"page_url":"https://en.wikipedia.org/wiki/Eric_LeGrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Eric_LeGrand.png","page_title":"Eric LeGrand","context_page_description":"Eric J. LeGrand is a former American football defensive tackle who played college football at Rutgers. He became paralyzed while making a tackle in an October 2010 game, but has since regained movement in his shoulders and sensation throughout his body. As of 2020, LeGrand has been making constant recovery in the Kessler Institute of Rehabilitation. The Tampa Bay Buccaneers signed him to a symbolic contract as an undrafted free agent in May 2012. In 2017, LeGrand was inducted into the WWE Hall of Fame as the third recipient of the Warrior Award."},{"page_url":"https://pl.wikipedia.org/wiki/Choroba_marburska","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Marburg_virus_liver_injury.jpg","page_title":"Choroba marburska","context_page_description":"Choroba marburska – ciężka choroba wirusowa, należąca do grupy gorączek krwotocznych."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%B7_%D8%A2%DB%8C%E2%80%8C%D8%A2%D8%B1%D8%AA%DB%8C_%D9%86%DB%8C%D9%88_%D9%84%D9%88%D8%AA%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/NYCS_R62_front.jpg","page_title":"خط آی‌آرتی نیو لوتز","context_page_description":"خط آی‌آرتی نیو لوتز یکی از خط‌های متروی نیویورک سیتی در بخش بروکلین است.\\nاین خط که در سال ۱۹۲۰ تأسیس شده دارای ۷ ایستگاه و ۷٫۹ کیلومتر طول است."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E6%85%B6%E5%AF%BA_(%E9%8E%8C%E5%80%89%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Taikei-ji_hondo.JPG","page_title":"大慶寺 (鎌倉市)","context_page_description":"大慶寺は、神奈川県鎌倉市にある臨済宗円覚寺派の寺院である。山号は霊照山、本尊は釈迦如来。"},{"page_url":"https://fy.wikipedia.org/wiki/De_Hepkema","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Nieuwsblad_van_Friesland_-_Hepkema%27s_courant_06-04-1901.jpg","page_title":"De Hepkema","context_page_description":"De Hepkema waard oprjochte yn 1874 en waard as it Nieuw Advertentieblad laat troch J. Hingst, Jacob Hepkema en Mindert Evert Hepkema, nei 1878 troch de Hepkema's. Dy fielden krekt wat lêzers fan in neutraal streekblêd foar Midden- en Súdeastfryslân fregen. Soks wie oars as lêzers wend wiene. Jacob makke 'De Hepkema' ta in sukses."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Thomas_(poet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Edward_Thomas_memorial_stone.jpg","page_title":"Edward Thomas (poet)","context_page_description":"Philip Edward Thomas was a British poet, essayist, and novelist. He is commonly considered a war poet, although few of his poems deal directly with his war experiences, and his career in poetry only came after he had already been a successful writer and literary critic. In 1915, he enlisted in the British Army to fight in the First World War and was killed in action during the Battle of Arras in 1917, soon after he arrived in France.\\nA Study Centre dedicated to Thomas is located at Petersfield Museum in Hampshire."},{"page_url":"https://en.wikipedia.org/wiki/Soufri%C3%A8re,_Saint_Lucia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Malgretout_Beach%2C_Saint_Lucia.jpg","page_title":"Soufrière, Saint Lucia","context_page_description":"Soufrière is a town on the West Coast of Saint Lucia, in the eastern Caribbean Sea. The town and the surrounding district has a population of 7,935. It was colonized by the French and was the original capital of the island."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Weevilicious.jpg","page_title":"ويف","context_page_description":"أندرو آلن أشر أورنهايمر ‏ويفأندرو"},{"page_url":"https://az.wikipedia.org/wiki/%C3%87%C4%B1lpaq_Maxa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Manet%2C_Edouard_-_Olympia%2C_1863.jpg","page_title":"Çılpaq Maxa","context_page_description":"Çılpaq Maxa və ya Çılpaq Maja — İspan rəssam Fransisko Qoyyanın 1790 və 1800-cü illər arasında tamamladığı təxmin edilən rəsm əsəridir. \\"Çılpaq Maxa\\" əsərindən ilk bəhs edən Manuel de Qodoyun şəkil kolleksiyası haqqında məqalə yazan alim və yazıçı Pedro Qonzales de Sepulveda olmuşdu. Sepulveda bu məqaləni 1800-ci ildə yazmışdı. Əsər hazırda Madriddəki Prado muzeyində sərgilənir. Rəssam bu əsəri kilsənin İspaniyada çılpaq qadın şəkillərinin çəkilməsini qadağan etdiyi bir dövrdə, İspaniya baş naziri Manuel de Qodoyun istəyi ilə çəkmişdi. Şəkil Qodoyun kolleksiyasına 12 noyabr 1800-cü il tarixində daxil edilmişdir.\\nQoyya bu əsərində üzərində yastıqlar olan yataqda uzanmış çılpaq bir qadını təsvir etmişdi. Bu əsər XIX əsr romantizmindəki erotik cərəyanın əsas əsərlərindən biri hesab olunur. \\"Çılpaq Maxa\\" əsərindəki modelin rəssamın \\"Su satıcısı\\", \\"Geyimli Maxa\\" və \\"Yemişan satıcısı\\" adlı əsərlərindəki modellər kimi səmimi bir şəkildə izləyicinin gözlərinin içinə baxması, qadına cinsi baxımdan asan əlçatan bir imic qazandırmışdır. Qoyyanın bu təsviri rəssamın xəyal dünyasında aşağı təbəqədən olan qadınlarla əlaqədar utancaq bir günah işləmə tabusu olması şəklində şərh olunur."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%A8%E5%85%83%E5%BA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Yang_Yuanqing_-_Annual_Meeting_of_the_New_Champions_Tianjin_2008_%28cropped%29.jpg","page_title":"杨元庆","context_page_description":"楊元慶，生於中國安徽省合肥市，現任聯想集團董事局主席和CEO，畢業於上海交通大學。"},{"page_url":"https://lt.wikipedia.org/wiki/Baltoji_snieguol%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/GalanthusNivalis001.JPG","page_title":"Baltoji snieguolė","context_page_description":"Baltoji snieguolė – amarilinių šeimos anksti pavasarį pražystanti darželio gėlė. Snieguolė yra kilusi iš pietinės Europos dalies, bet natūralizuota praktiškai visoje Europoje.\\nDaugiametis, 8-20 cm aukščio augalas. Svogūnas 1 cm skersmens, su rudais lukštais; kasmet išaugina po vieną pridėtinį svogūną. Lapai linijiški, trumpesni už stiebą. Stiebas cilindriškas. Žiedai varpiški. Apdulkina vabzdžiai.\\nDekoratyvinis augalas, vertinamas kaip pirmas pavasario žiedas. Turi gydomųjų savybių."},{"page_url":"https://en.wikipedia.org/wiki/Campus_of_Dartmouth_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Dartmouth_College_campus_2007-10-02_Rockefeller_Center.JPG","page_title":"Campus of Dartmouth College","context_page_description":"Dartmouth College is located in the rural town of Hanover in the Upper Valley of the Connecticut River in the New England state of New Hampshire. Dartmouth's 269-acre campus centered on The Green makes the institution the largest private landowner of the town of Hanover, and its landholdings and facilities are valued at an estimated $419 million. Dartmouth's campus buildings vary in age from several early 19th century buildings to a number of ongoing construction projects. Most of Dartmouth's buildings are designed in the Georgian style, a theme which has been preserved in recent architectural additions."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%BE%D0%B3%D1%80%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Royal_Monogram_of_King_Alexander_I_Yugoslavia.svg","page_title":"Монограм","context_page_description":"Монограм је мотив направљен преклапањем или спајањем два или више слова или неке графеме у стварање неког симбола. Монограми се често праве комбиновањем иницијала појединца или неке организације, који се користе као симболи или логотипи."},{"page_url":"https://pt.wikipedia.org/wiki/Bebeto","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Bebeto.JPG","page_title":"Bebeto","context_page_description":"José Roberto Gama de Oliveira, mais conhecido como Bebeto, é um ex-futebolista brasileiro que atuava como atacante. Trabalhou também como treinador, e atualmente é político. Foi membro do Conselho de Administração do Comitê Organizador Local da Copa do Mundo da FIFA Brasil 2014.\\nComo jogador, foi campeão mundial pelo Brasil na Copa do Mundo de 1994 e vice-campeão na de 1998. Uma de suas marcas registradas era o gol de voleio, onde rebatia a bola num salto de lado, geralmente caindo no chão, e mandando direto pro gol. Quando defendia o Flamengo, também tinha o costume de marcar vários gols de cabeça.\\nConseguiu ser ídolo nos rivais Flamengo e Vasco da Gama. Passou brevemente também por outro rival, o Botafogo, conseguindo também deixar sua marca. Mas foi no Deportivo La Coruña em que ele foi um ídolo máximo de uma torcida, integrando o SúperDepor da década de 1990."},{"page_url":"https://ceb.wikipedia.org/wiki/Pandea_conica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/BlaschkaDublinMuseum_%2813%29.JPG","page_title":"Pandea conica","context_page_description":"Espesye sa mananap nga una nga gihulagway ni Jean René Constant Quoy ug Joseph Paul Gaimard ni adtong 1827 ang Pandea conica. Ang Pandea conica sakop sa kahenera nga Pandea sa kabanay nga Pandeidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/List_of_railway_stations_in_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Rhymneystation.jpg","page_title":"List of railway stations in Wales","context_page_description":"This is a list of railway stations in Wales, one of the four countries of the United Kingdom. It includes all railway stations in Wales that form part of the British National Rail network that currently have timetabled train services. It does not include stations on heritage railways, except for those shared with the National Rail network.\\nThe main operator is Transport for Wales who run almost all services in Wales. However Great Western Railway operates the South Wales-London service, CrossCountry operates long-distance services to Central and North East England from Cardiff Central and Newport, and Avanti West Coast run from North Wales-West Midlands-London.\\nThe main rail routes in Wales include:\\nLondon–South Wales\\nCardiff–Newport–Wrexham–Holyhead/Manchester\\nValley Lines urban network\\nLondon–Holyhead/Bangor/Wrexham\\nThe table includes, where known, the year that each station was opened. Detailed records are not always available, and some stations, particularly in the South Wales Valleys area, were operated as halts for workmen, and public services only appeared later."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Canada","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/CityPlace_Montage.JPG","page_title":"List of tallest buildings in Canada","context_page_description":"This is a list of the tallest buildings in Canada. As of December 2017 there are a total of 133 completed and under construction buildings in Canada with an official height of 150 m or more. Greater Toronto has 86, Calgary has 19, Metro Vancouver has 14, Montreal has 11, Edmonton has 2, and Niagara Falls has 1.\\nFive of Canada's ten largest cities enforce height restriction laws. In Ottawa, skyscrapers could not be built above the height of the Peace Tower until the late 1970s, when the restriction was changed so that no building could overwhelm the skyline. In Montreal, skyscrapers cannot be built above the elevation of Mount Royal. The City of Vancouver has enacted \\"view corridors\\" which limit the height of buildings in most areas of downtown. The City of Edmonton had an elevation restriction, approximately 150 m above downtown, due to the proximity of the city centre airport, until it closed in November 2013.\\nThis list does not include towers, including the CN Tower in Toronto, as they are not technically considered to be a building."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%A2n_v%E1%BA%ADn_%C4%91%E1%BB%99ng_Cheonan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Cheonan_Stadium.JPG","page_title":"Sân vận động Cheonan","context_page_description":"Sân vận động Cheonan Baekseok là sân vận động đa năng ở Cheonan, Hàn Quốc.Nó hiện đang được sử dụng chủ yếu cho các trận đấu bóng đá. Sân vận động có 26.000 ghế khán giả. Nó đã xây vào năm 2001. Vào ngày 15 tháng 10 năm 2013, Đội tuyển bóng đá quốc gia Hàn Quốc đã từng sử dụng sân vận đông 1 lần cho trận giao hữu trước đối thủ Mali, Kết thúc với chiến thắng 3-1 của Hàn Quốc. Nó đã được chọn để tổ chức các trận đấu tại vòng bảng, vòng 16 và vòng tứ kết của Giải vô địch bóng đá U-20 thế giới 2017."},{"page_url":"https://de.wikipedia.org/wiki/Fritzlar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Fritzlar_Grebenturm_%282%29.JPG","page_title":"Fritzlar","context_page_description":"Fritzlar ist eine Kleinstadt und ein wirtschaftliches Mittelzentrum im nordhessischen Schwalm-Eder-Kreis. Die Entstehung der Stadt geht auf eine Kirchen- und Klostergründung durch Bonifatius zurück. Die Dom- und Kaiserstadt gilt als der Ort, an dem sowohl die Christianisierung Mittel- und Norddeutschlands als auch das mittelalterliche Deutsche Reich ihren Anfang nahmen. Der Name Fritzlar ist abgeleitet von der ursprünglichen Bezeichnung Friedeslar, „Ort des Friedens“."},{"page_url":"https://nl.wikipedia.org/wiki/Western_(Sierra_Leone)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Freetown_SPOT_1094.jpg","page_title":"Western (Sierra Leone)","context_page_description":"Western is het kleinste van de vier deelgebieden van Sierra Leone. Het is geen provincie zoals de drie andere delen, maar een speciaal gebied. Het ligt aan de kust in het uiterste zuidwesten van Sierra Leone. In het gebied Western is de hoofdstad van het land, Freetown, gelegen die tevens hoofdstad van het gebied is. Western is 557 vierkante kilometer in oppervlakte en had in 2004 zo'n 950.000 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Char_lourd_M103","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/US_M103_%283666459908%29.jpg","page_title":"Char lourd M103","context_page_description":"Le M103 était un char lourd américain développé à la suite du blocus de Berlin en 1948, afin d'appuyer les M48 Patton en cas de conflit armé avec l'Union des républiques socialistes soviétiques.\\nLe M103 fut déployé en 1954 et fut retiré du service actif en 1974."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27esp%C3%A8ces_envahissantes_class%C3%A9es_parmi_les_plus_nuisibles_au_XXIe_si%C3%A8cle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Khapra_beetle.jpg","page_title":"Liste d'espèces envahissantes classées parmi les plus nuisibles au XXIe siècle","context_page_description":"Bien qu'il existe plusieurs définitions des espèces envahissantes, elles sont toujours basées sur quatre critères principaux :\\nl’origine de l’espèce ;\\nla capacité de l’espèce à se reproduire en milieu naturel ;\\nla dispersion géographique de l’espèce ;\\net son impact environnemental.\\nSi la plupart des espèces exotiques persistent seulement au travers de petites populations isolées, quelques-unes peuvent adopter un comportement nuisible d'invasion biologique. On voit alors apparaître des populations importantes qui se dispersent au travers des paysages et qui peuvent, parfois, entrer en compétition avec les espèces indigènes et altérer le fonctionnement des écosystèmes. Les conséquences et les impacts des espèces envahissantes diffèrent selon l’espèce en question et les milieux envahis. Leur position dans les réseaux trophiques et leur capacité de colonisation interviennent sur la nature, l’intensité et l’ampleur des impacts. On distingue généralement les effets écologiques, économiques et sanitaires.\\nLe nombre des espèces aujourd'hui considérées comme envahissantes est élevé et ne cesse de croître."},{"page_url":"https://it.wikipedia.org/wiki/Hillman_(azienda)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Hillman.minx.arp.750pix.jpg","page_title":"Hillman (azienda)","context_page_description":"La Hillman è stata una casa automobilistica britannica fondata nel 1907. In un primo tempo la compagnia produceva biciclette e fu fondata da William Hillman a Ryton-on-Dunsmore, vicino a Coventry, in Inghilterra. Sebbene acquistata nel 1929 dalla Humber, e successivamente dal Rootes nel 1931, la denominazione Hillman fu utilizzata come marchio principale da quest'ultima fino al 1967, quando la Chrysler a sua volta rilevò l'intero gruppo Rootes. Il marchio continuò ad essere usato fino al 1976."},{"page_url":"https://no.wikipedia.org/wiki/Pjotr_Stolypin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Bundesarchiv_Bild_183-R04510%2C_Russland%2C_Attentat_auf_Stolypin.jpg","page_title":"Pjotr Stolypin","context_page_description":"Pjotr Arkadjevitsj Stolypin var en russisk statsmann. Han var russisk statsminister fra 1906 til 1911, da han ble skutt under et besøk i Kiev-operaen under en framføring av Nikolaj Rimskij-Korsakovs Tsar Saltan. Stolypin var til stede i operaen blant annet sammen med tsar Nikolaj II og resten av tsar-familien.\\nHan var kjent for sin hardhendte kamp mot revolusjonære grupper og for gjennomføring av en jordbruksreform som kom i kjølvannet av opphevelsen av livegenskapet og hvor en ønsket å få et mer fremtidsrettet, kapitalistisk system innen landbruket. Reformen ga rett til å eie egen gård og jord."},{"page_url":"https://en.wikipedia.org/wiki/Haldwani","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Map_of_the_United_Provinces_from_The_Imperial_Gazetteer_of_India_%281907-1909%29.jpg","page_title":"Haldwani","context_page_description":"Haldwani is the second most populous city, the largest commercial market in the Indian state of Uttarakhand. With a population of 3,64,129 in 2019, it is also the largest city of the Kumaon region. Haldwani is located in the Nainital District, and is one of its eight Subdivisions. The Haldwani Urban agglomeration has 10,32,095 people, and is the third most populous UA in Uttarakhand, after Dehradun and Haridwar. Being situated in the immediate foothills of Kumaon Himalayas, Haldwani is known as the \\"Gateway to Kumaon\\".\\nLocated in the Bhabhar region in the Himalayan foothills on the banks of the Gaula River, the town of Haldwani was established in 1834, as a mart for hill people who visited Bhabar during the cold season. The establishment of the Bareilly-Nainital provincial road in 1882 and the Bhojeepura-Kathgodam railway line by Rohilkund and Kumaon Railway in 1884 helped develop the town into a major trading post and then a hub between the hilly regions of Kumaon and the Indo-Gangetic Plains."},{"page_url":"https://en.wikipedia.org/wiki/Grady_County_Courthouse_(Georgia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/08-09-01_GradyCrths2.JPG","page_title":"Grady County Courthouse (Georgia)","context_page_description":"The Grady County Courthouse is a courthouse in Cairo, Grady County, Georgia. It was constructed in 1985 after the previous courthouse burned down in 1980. The building was designed by Jinright, Ryan and Lynn Architects in the Classical Revival architectural style."},{"page_url":"https://es.wikipedia.org/wiki/Ronnie_Whelan","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Ronnie_Whelan.JPG","page_title":"Ronnie Whelan","context_page_description":"Ronald \\"Ronnie\\" Andrew Whelan es un exfutbolista irlandés que jugaba como centrocampista y formó parte del legendario Liverpool FC de la década de los 80.\\nTras su retirada como futbolista tuvo una breve carrera como entrenador de fútbol. Actualmente ejerce como comentarista de la televisión irlandesa."},{"page_url":"https://no.wikipedia.org/wiki/Betong","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/ConcreteHardening.JPG","page_title":"Betong","context_page_description":"Betong er et byggemateriale som lages ved å blande sement og vann med sand, stein og tilsetningsstoffer. Sementen reagerer kjemisk med vannet, prosessen kalles hydratisering, og resultatet blir betong. Betong er et allsidig materiale og er et av de mest brukte byggematerialene i verden i vår tid. Bare fantasien setter grenser for betongens formbarhet. Betong kan støpes i faste former eller den kan støpes med glidende forskaling som ved støping av broer og tårn. Riktig produsert og ved normal bruk har betong lang levetid og stor styrke. Et moderne samfunn er avhengig av betong som byggemateriale til bygging av for eksempel bygninger, industrianlegg, broer, tunneler, kaier, flyplasser, dammer og oljeplattformer. Legfolk har lett for å forveksle betong med sement i den forstand at de sier «sement» når de mener «betong». Sement er pulveret som blandes med vann, sand og stein. Betong er byggematerialet som blir resultatet av denne blandingen."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%90%8D%E9%90%B5%E4%B8%80%E5%AE%AE%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/MT-Meitetsu_Ichinomiya_Station-Sidetrack.jpg","page_title":"名鐵一宮站","context_page_description":"名铁一宫站是位于爱知县一宫市新生一丁目，名古屋铁道的车站。车站编号为NH50。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ed_Asner","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/EdAsnerHWOFMay2013.jpg","page_title":"Ed Asner","context_page_description":"Edward \\"Ed\\" Asner sī Bí-kok ê ián-goân."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%B2%D0%BE%D1%80%D0%BA%D1%8F%D0%BD,_%D0%90%D1%80%D1%82%D1%91%D0%BC_%D0%90%D1%88%D0%BE%D1%82%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Artyom_Gevorkyan_2.jpg","page_title":"Геворкян, Артём Ашотович","context_page_description":"Артем Ашотович Геворкян — армянский государственный и хозяйственный деятель."},{"page_url":"https://sv.wikipedia.org/wiki/Shushs_palats","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/%D9%82%D9%84%D8%B9%D9%87_%D8%B4%D9%88%D8%B4.jpg","page_title":"Shushs palats","context_page_description":"Shushs palats återuppbyggdes av franska arkeologer med det material som upptäckts i Susas arkeologiska kulle. Detta palats är ett av de mest unika historiska byggnadsverken i Iran. Palatset är beläget i provinsen Khuzestan."},{"page_url":"https://fr.wikipedia.org/wiki/Vegard_Heggem","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Vegard_Heggem_portrait.png","page_title":"Vegard Heggem","context_page_description":"Vegard Heggem, né le 13 juillet 1975 à Trondheim, est un footballeur norvégien, qui évoluait au poste d'arrière droit au Liverpool FC et en équipe de Norvège."},{"page_url":"https://cs.wikipedia.org/wiki/Uetersen","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Uetersener_Pferdebahn.jpg","page_title":"Uetersen","context_page_description":"Uetersen IPA je město na severozápadě Německa, ve spolkové zemi Šlesvicko-Holštýnsko, 30 km východně od Hamburku. V roce 2012 zde žilo 17 598 obyvatel, čímž je jedním z nejhustěji obydlených měst v Šlesvicku-Holštýnsku."},{"page_url":"https://pl.wikipedia.org/wiki/Poppy_3B","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Thor_SLV-2A_Agena_D_with_Composite-4_%28Jan._11_1964%29.gif","page_title":"Poppy 3B","context_page_description":"Poppy 3B – amerykański satelita wywiadu elektronicznego serii Poppy. Zbierał dane o parametrach pracy radzieckich radarów obrony powietrznej i antybalistycznej. Pozostawał utajniony do września 2005. Zbudowany przez Naval Research Laboratory, NRL.\\nWystrzelony na orbitę 11 stycznia 1964 razem z Poppy 3A, Poppy 3C, SECOR 1B i FTV 2354.\\nStatek pozostaje na orbicie okołoziemskiej, której trwałość szacuje się na 1000 lat."},{"page_url":"https://de.wikipedia.org/wiki/Reichenauer_Hof_(Ulm)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Reichenauer_Hof_03.JPG","page_title":"Reichenauer Hof (Ulm)","context_page_description":"Der Reichenauer Hof ist ein baugeschichtlich bis in die Gotik zurückgehendes, ehemaliges Patrizierhaus in Ulm. Im Inneren birgt es im sogenannten „Meistersingersaal“ oder „Minnesängersaal“ die ältesten Fresken Ulms. Es ist ein geschütztes Kulturdenkmal nach § 2 DSchG BW."},{"page_url":"https://en.wikipedia.org/wiki/Bovine_papillomavirus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Papillomavirus_capsid.png","page_title":"Bovine papillomavirus","context_page_description":"Bovine papillomaviruses are a paraphyletic group of DNA viruses of the subfamily Firstpapillomavirinae of Papillomaviridae that are common in cattle. All BPVs have a circular double-stranded DNA genome. Infection causes warts of the skin and alimentary tract, and more rarely cancers of the alimentary tract and urinary bladder. They are also thought to cause the skin tumour equine sarcoid in horses and donkeys.\\nBPVs have been used as a model for studying papillomavirus molecular biology and for dissecting the mechanisms by which this group of viruses cause cancer."},{"page_url":"https://fi.wikipedia.org/wiki/Unkarilaiset_riimut","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Enlaka_rovas_inscription.jpg","page_title":"Unkarilaiset riimut","context_page_description":"Unkarilaiset riimut eli székely rovásírás -merkit ovat alkuaan Transilvanian unkarinkielisen székely-heimon parissa käytetty kirjaimisto. Nimityksellä voidaan viitata sekä tähän perinteiseen kirjaimistoon, jonka varhaisimmat todetut esiintymät ovat keskiajalta ja jota käytettiin Transilvaniassa 1800-luvulle saakka, että tästä kirjaimistosta 1900-2000-luvuilla Unkarissa kehitettyihin modernisoituihin versioihin. Unkarilainen riimukirjoitus on aakkoskirjoitusta, ja sen kirjoitus- ja lukusuunta on normaalisti oikealta vasemmalle."},{"page_url":"https://sv.wikipedia.org/wiki/Kane_(fribrottare)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Kane_Rosemont_IL_031108.jpg","page_title":"Kane (fribrottare)","context_page_description":"Glen Thomas Jacobs, född 26 april 1967 i Torrejón de Ardoz, Spanien, är en amerikansk professionell brottare. Jacobs är mer känd under sitt wrestlingnamn, Kane. Han är 203 cm lång och väger 147 kilo. Jacobs debuterade i WWF 1995 och han har vunnit i princip allt som går att vinna, WWE Championship, World Heavyweight Championship, Intercontinental Championship och WWE Tag Team Championship. Kane hade först några gimmicks i WWE som inte passade in, sedan kom han på rollfiguren Dr. Isaac Yankem DDS, en galen tandläkare. Kane är en av de största attraktionerna i WWE och brottas på WWE Raw. Han har huvudrollen i filmen \\"See No Evil\\".\\nJacobs finisher är vanligtvis en chokeslam eller en Tombstone Piledriver \\"adopterad\\" från The Undertaker. Han är en Brawler, relativt orörlig med många långsamma men kraftfulla rörelser. Några av hans signature moves är en backbreaker, Big Boot, Falling Powerbomb, Tilt-a-Whirl Slam och Top Rope Clothesline.\\nKane är fiktiv bror till den också kända wrestlaren Undertaker. Det vill säga de är bröder i wreslingens story lines men inte på riktigt. En tid hade de ett s.k. \\"team\\" i WWE namngett: \\"Brothers of Destruction\\" som bestod av de två."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D5%B5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/%D0%91%D1%80%D1%83%D0%BD%D0%B8_-_%D0%9C%D0%B0%D0%B4%D0%BE%D0%BD%D0%BD%D0%B0_%D0%90%D0%BB%D1%8C%D0%B1%D0%B0.jpg","page_title":"Մայր","context_page_description":"Մայր կին, իր երեխայի համար՝ ծնող։\\nՍոցիալական, մշակութային կամ կրոնական համատեքստում տարբեր իմաստներ ունեցող բառ է։"},{"page_url":"https://cy.wikipedia.org/wiki/Philip_Vaughan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Thumb_IMG_1074_1024.jpg","page_title":"Philip Vaughan","context_page_description":"Roedd Philip Vaughan yn ddyfeisiwr a haearnfeistr Cymreig a gofrestrodd batent gyda'r cynllun cynta o bêl-feryn yng Nghaerfyrddin yn 1794.\\nRoedd ei gynllun yn rhedeg ar hyd trac mewn cydosodfa echel, a adnabuwyd fel ras peli, ac felly yn darddiad i'r cynllun pêl-feryn modern.\\nRoedd Cymro arall yn flaengar iawn yn y maes hwn, sef Joseph Henry Hughes o Birmingham a gofrestrodd batent am bêl-feryn amgen yn 1877. Dywedodd papur newydd y Times ar y pryd fod ei batent yn hynod werthfawr."},{"page_url":"https://en.wikipedia.org/wiki/LIANTI","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/LIANTI_Amplification_Uniformity_3.png","page_title":"LIANTI","context_page_description":"Linear Amplification via Transposon Insertion is a linear whole genome amplification method. To analyze or sequence very small amount of DNA, i.e. genomic DNA from a single cell, the picograms of DNA is subject to WGA to amplify at least thousands of times into nanogram scale, before DNA analysis or sequencing can be carried out. Previous WGA methods use exponential/nonlinear amplification schemes, leading to bias accumulation and error propagation. LIANTI achieved linear amplification of the whole genome for the first time, enabling more uniform and accurate amplification.\\nShown in the figure is a simulation to illustrate the advantages of linear amplification over exponential amplification, assuming two DNA fragments A and B with replication yields of 100% and 70% per round, respectively. First, linear amplification is more even than exponential amplification. To achieve ~10,000 fold amplification of fragment A, exponential amplification results in a ratio of 8:1, hampering the accuracy of CNV detection. In contrast, linear amplification exhibits a ratio of 1:0.7, which is much closer to unity. Second, linear amplification is superior to exponential amplification in fidelity."},{"page_url":"https://en.wikipedia.org/wiki/Coronel_Macedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/SaoPaulo_Municip_CoronelMacedo.svg","page_title":"Coronel Macedo","context_page_description":"Coronel Macedo is a municipality in the state of São Paulo in Brazil. The population is 4,922 in an area of 304 km². The elevation is 624 m."},{"page_url":"https://pl.wikipedia.org/wiki/Commodore_VIC-20","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/CBMVIC20P8.jpg","page_title":"Commodore VIC-20","context_page_description":"Commodore VIC-20 – komputer domowy produkowany przez firmę Commodore, posiadający 5 kB pamięci RAM i procesor MOS 6502. Jest pierwszym komputerem domowym, którego liczba sprzedanych sztuk wyniosła ponad milion egzemplarzy."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%A6%D9%88%D9%81%D9%84%D8%A7%D9%88%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Neoflavonoid.PNG","page_title":"نئوفلاوان","context_page_description":"نئوفلاوان یک ترکیب شیمیایی با شناسه پاب‌کم ۳۸۲۶۱۰۶ است."},{"page_url":"https://it.wikipedia.org/wiki/Geografia_dell%27Alto_Mantovano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Panorama_Solferino.JPG","page_title":"Geografia dell'Alto Mantovano","context_page_description":"Geograficamente, l'Alto Mantovano è grosso modo limitato a est e a ovest rispettivamente dai fiumi Chiese e Mincio, a nord dalle colline moreniche del lago di Garda, mentre i suoi confini meridionali sono segnati dalla pianura medio-mantovana attraversata dalla Via Postumia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Lana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Lana_Villa_Stefania.jpg","page_title":"Liste der Baudenkmäler in Lana","context_page_description":"Die Liste der Baudenkmäler in Lana enthält die 77 als Baudenkmäler ausgewiesenen Objekte auf dem Gebiet der Gemeinde Lana in Südtirol.\\nBasis ist das im Internet einsehbare offizielle Verzeichnis der Baudenkmäler in Südtirol. Dabei kann es sich beispielsweise um Sakralbauten, Wohnhäuser, Bauernhöfe und Adelsansitze handeln. Die Reihenfolge in dieser Liste orientiert sich an der Bezeichnung, alternativ ist sie auch nach der Adresse oder dem Datum der Unterschutzstellung sortierbar."},{"page_url":"https://es.wikipedia.org/wiki/Valle_de_Guerra","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Valle_de_Guerra._Tenerife.jpg","page_title":"Valle de Guerra","context_page_description":"Valle de Guerra es un pueblo del municipio de San Cristóbal de La Laguna, en la isla de Tenerife —Canarias, España—.\\nAdministrativamente se incluye en la Zona 5 del municipio.​\\nJunto con Bajamar, Tejina y Punta del Hidalgo constituye una pequeña comarca."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%AB%D5%B4_%D5%89%D5%B8%D5%B6_%D4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/130629_%EC%A0%95%EC%95%84.jpg","page_title":"Կիմ Չոն Ա","context_page_description":"Կիմ Չոն Ա, հարավկորեացի երգչուհի: Առավել հայտնի է, որպես After School աղջիկների խմբի նախկին անդամ:"},{"page_url":"https://es.wikipedia.org/wiki/Aeropuerto_Internacional_de_Kansai","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kansai_closeup.jpg","page_title":"Aeropuerto Internacional de Kansai","context_page_description":"El Aeropuerto internacional de Kansai es un aeropuerto internacional ubicado en una isla artificial en la bahía de Osaka, Japón. Fue diseñado por el arquitecto Renzo Piano e inaugurado el 4 de septiembre de 1994.\\nEl aeropuerto sirve de núcleo para Japan Airlines, All Nippon Airways y Nippon Cargo Airlines. Es la puerta de enlace para la región de Kansai, compuesta por las ciudades de Osaka, Kioto y Kōbe, entre otras. Los vuelos nacionales son llevados a cabo desde el anterior Aeropuerto internacional de Osaka en Itami.\\nEn el dialecto Kansai del japonés, el aeropuerto es comúnmente llamado Kankū."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mosques_in_Baghdad","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%D8%AC%D8%A7%D9%85%D8%B9_%D8%A7%D9%84%D8%B9%D8%B3%D8%A7%D9%81%D9%8A_%D9%81%D9%8A_%D8%A8%D8%BA%D8%AF%D8%A7%D8%AF.jpg","page_title":"List of mosques in Baghdad","context_page_description":"Baghdad, located in Iraq, was once the capital of the Abbasid Caliphate and a center of Islamic advancements. This is a list of mosques in Baghdad from different dynastic periods. Today, there are 912 Jama Masjids in Baghdad which conduct Friday Prayer, and 149 smaller mosques which only hold regular daily prayers."},{"page_url":"https://de.wikipedia.org/wiki/Urft","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Bahnhof_Urft.jpg","page_title":"Urft","context_page_description":"Urft ist ein östlicher Ortsteil der Gemeinde Kall im nordrhein-westfälischen Kreis Euskirchen. Urft hat etwa 340 Einwohner."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80_%D0%B8%D0%BD%D0%BE%D1%81%D1%82%D1%80%D0%B0%D0%BD%D0%BD%D1%8B%D1%85_%D0%B4%D0%B5%D0%BB_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Jean-Yves_Le_Drian_2017_%282%29.jpg","page_title":"Министр иностранных дел Франции","context_page_description":"Министр иностранных дел в Правительстве Франции является членом кабинета, ответственным за отношения Французской Республики с зарубежными странами.\\nВ подчинении министра находятся министр-делегат по европейским делам, министр-делегат по делам развития и министр-делегат по делам французских граждан за рубежом и франкофонии. В настоящее время министром является Жан-Ив Ле Дриан.\\nМинистерство иностранных дел расположено на набережной Кэ д'Орсе в Париже. Кэ д’Орсе часто используется как синоним министерства иностранных дел Франции. Часть центрального аппарата Министерства расположена в Нанте."},{"page_url":"https://en.wikipedia.org/wiki/Long_baseline_acoustic_positioning_system","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ohio-class_submarine_launches_Tomahawk_Cruise_missiles_%28artist_concept%29.jpg","page_title":"Long baseline acoustic positioning system","context_page_description":"A long baseline acoustic positioning system is one of three broad classes of underwater acoustic positioning systems that are used to track underwater vehicles and divers. The other two classes are ultra short baseline systems and short baseline systems. LBL systems are unique in that they use networks of sea-floor mounted baseline transponders as reference points for navigation. These are generally deployed around the perimeter of a work site. The LBL technique results in very high positioning accuracy and position stability that is independent of water depth. It is generally better than 1-meter and can reach a few centimeters accuracy. LBL systems are generally employed for precision underwater survey work where the accuracy or position stability of ship-based positioning systems does not suffice."},{"page_url":"https://de.wikipedia.org/wiki/Stettiner_Pastetchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/1104_Pasztecik_Szczeci%C5%84ski.JPG","page_title":"Stettiner Pastetchen","context_page_description":"Stettiner Pastetchen sind eine Gebäckform der polnischen Küche. Es handelt sich dabei um eine gefüllte Krapfenart aus Hefeteig. Der Name leitet sich von der Stadt Stettin ab, die als Herkunftsort gilt.\\nZur Vorbereitung füllt man Teig mit unterschiedlichen Füllungen. Typisch sind Gehacktes aus Rind- und Schweinefleisch, Sauerkraut mit Pilzen und Käse mit Champignons. Anschließend frittiert man die Pasteten in Pflanzenfett. Sie werden als Imbiss oder zu klaren Rote-Bete-Suppen verzehrt."},{"page_url":"https://af.wikipedia.org/wiki/Staat_Palestina","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Palestine_recognition_only.svg","page_title":"Staat Palestina","context_page_description":"Palestina, amptelik die Staat Palestina, is 'n land met omstrede status, geleë in Wes-Asië, en word deur Israel beset en geëis. Die Staat Palestina is deur die Palestynse Bevrydingsorganisasie verklaar op 15 November 1988 en word deur meer as 134 lande erken. Op 31 Oktober 2011 het Palestina 'n lid van Unesco geword en op 29 November 2012 het die Algemene Vergadering van die Verenigde Nasies met 'n groot meerderheid vir die opname van Palestina as waarnemer gestem. Palestina bestaan uit die Gasastrook en die Wesoewer.\\nSedert die begin van die Palestynse Burgeroorlog tussen die Fatah en Hamas is die Grondgebiede verdeel: Die Fatah beheer die Wesoewer, terwyl die Hamas die Gasastrook regeer. Die Fatah is 'n lid van die Palestynse Bevrydingsorganisasie, maar nie die Hamas nie. Nes die Suid-Afrikaanse ANC en die Namibiese SWAPO is die Fatah 'n lid van die Sosialistiese Internasionaal, terwyl die Hamas deur verskeie lande as 'n terroristiese organisasie gelys word."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%A0%E5%AE%B6%E5%B1%B1%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Zhangjiashan_Railway_Station_20170726_175401.jpg","page_title":"张家山站","context_page_description":"张家山站是一个沪昆线上的铁路车站，位于江西省宜春市樟树市张家山街道，目前为三等站，邮政编码为331208。目前不办理客运业务；货运：仅办理专用线、专用铁路货运作业。"},{"page_url":"https://ro.wikipedia.org/wiki/Loudes","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Loudes_planeur.jpg","page_title":"Loudes","context_page_description":"Loudes este o comună în departamentul Haute-Loire, Franța. În 2009 avea o populație de 869 de locuitori."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_French_monarchs","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Louis_XI_of_France.jpg","page_title":"List of French monarchs","context_page_description":"Ruled from the start of the Frankish Kingdom in 486 to 1870. During most of its history, France was ruled by kings. Four Carolingian monarchs were also Roman Emperors and the Bonapartes were Emperors of the French.\\nThe title \\"King of the Franks\\" was in use until the reign of Philip II. During the short time when the French Constitution of 1791 was in effect and after the July Revolution in 1830, the style \\"King of the French\\" was used instead of \\"King of France\\".\\nIn addition to the Kingdom of France, there were also two French Empires. The First French Empire was from 1804–1815. It was founded and ruled by Napoleon I. The Second French Empire was from 1852–1870. It was founded and ruled by his nephew Napoleon III Then 3rd 4th and 5th republic formed"},{"page_url":"https://de.wikipedia.org/wiki/Zeppelin_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Teil-Rekonstruktion_von_LZ_129_%22Hindenburg%22.jpg","page_title":"Zeppelin Museum","context_page_description":"Das 1996 eröffnete Zeppelin Museum befindet sich in Friedrichshafen, Baden-Württemberg. Es ist im ehemaligen Hafenbahnhof direkt am Bodensee untergebracht. Es versteht sich als Haus, in dem lebendige Geschichte multimedial erzählt wird.\\nDas Museum beherbergt die weltgrößte Sammlung zu Geschichte und Technik der Luftschifffahrt, eine begehbare originalgetreue Rekonstruktion eines Teils von LZ 129 „Hindenburg“, und die Kunstsammlung versammelt die größten Meister Süddeutschlands vom Mittelalter bis zur Neuzeit."},{"page_url":"https://fr.wikipedia.org/wiki/Art_roman_proven%C3%A7al","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/France_-_Dr%C3%B4me_-_Eglise_Notre-Dame_du_Val_des_Nymphes_-_01.jpg","page_title":"Art roman provençal","context_page_description":"L'art roman provençal présente comme particularité d'être fortement influencé par l'antiquité romaine par le biais des nombreux vestiges romains subsistant en Provence. Par contre, l'influence du style roman lombard y est très limitée, au contraire de l'art roman languedocien voisin."},{"page_url":"https://de.wikipedia.org/wiki/Arbeitslosigkeit_in_den_Niederlanden","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Werkloosheid_in_Nederland_in_2006.png","page_title":"Arbeitslosigkeit in den Niederlanden","context_page_description":"Die Daten zur Arbeitslosigkeit in den Niederlanden basieren auf Angaben von Eurostat und denen des niederländischen Centraal Bureau voor de Statistiek.\\nDie Arbeitslosenquote ist der Anteil der Arbeitslosen an der Erwerbsbevölkerung in den Niederlanden. Die Erwerbsbevölkerung ist die Summe der Erwerbstätigen und der Arbeitslosen. Zu den Arbeitslosen zählen alle Personen von 15 bis 74 Jahren:\\ndie während der Berichtswoche ohne Arbeit waren\\ndie gegenwärtig für eine Beschäftigung verfügbar waren, das heißt Personen, die innerhalb der zwei auf die Berichtswoche folgenden Wochen für eine abhängige Beschäftigung oder eine selbständige Tätigkeit verfügbar waren\\ndie aktiv auf Arbeitssuche waren, das heißt Personen, die innerhalb der letzten vier Wochen spezifische Schritte unternommen haben, um eine abhängige Beschäftigung oder eine selbständige Tätigkeit zu finden oder die einen Arbeitsplatz gefunden haben, die Beschäftigung aber erst später, das heißt innerhalb eines Zeitraums von höchstens drei Monaten aufnehmen\\nDie jährlichen Arbeitslosenquoten von 1948 bis 2006, sind jeweils ein Durchschnittswert aus 12 Monatsberichten zur Arbeitslosigkeit in den Niederlanden."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_principale_des_forces_arm%C3%A9es_russes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/InstallationOfBells2019-07.jpg","page_title":"Cathédrale principale des forces armées russes","context_page_description":"La Cathédrale principale des forces armées russes est une cathédrale patriarcale sous l'invocation de la Résurrection du Christ, « dédiée au 75ᵉ anniversaire de la victoire dans la Grande Guerre patriotique, ainsi qu'aux hauts faits militaires du peuple russe dans toutes les guerres », construite dans le Patriot Park du quartier Odintsovsky, Oblast de Moscou.\\nLa cathédrale est construite grâce à des dons et à des fonds publics de Moscou et de l'oblast de Moscou. La consécration a eu lieu dans le cadre de la célébration du 75ᵉ anniversaire de la victoire dans la « Grande Guerre patriotique ». Une exposition consacrée à l'histoire de la formation de l'État russe et de ses forces armées est présentée sur place.\\nLa construction de la cathédrale a été achevée le 9 mai, Jour de la Victoire, elle a été consacrée le 14 juin par le patriarche Cyrille de Moscou et inaugurée le 22 juin 2020, Jour du Souvenir et du Chagrin en présence du président de la Fédération de Russie, Vladimir Poutine."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-de-Malte_d%27Aix-en-Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Aix-Saint-Jean-de-Malte-bjs180814-01.jpg","page_title":"Église Saint-Jean-de-Malte d'Aix-en-Provence","context_page_description":"L'église Saint-Jean-de-Malte, à l'angle de la rue d'Italie et de la rue Cardinale, à Aix-en-Provence est la première église gothique de Provence. Elle se situe à l'extrémité est de la rue Cardinale. Elle a été construite sur l'emplacement d'une première chapelle érigée par les Hospitaliers à leur installation à Aix, au XIIᵉ siècle. Ses travaux de construction se seraient étalés de 1272 à 1277, même si ces dates ne sont pas avérées. Le clocher de l'église s'élève à 67 mètres. C'est le point le plus élevé de la ville d'Aix-en-Provence.\\nAujourd'hui Saint-Jean-de-Malte est une église paroissiale confiée à la Fraternité des Moines apostoliques. Grâce aux offices monastiques, elle est fréquemment ouverte et peut être visitée. Elle surprend par sa luminosité intérieure, la couleur de la pierre, sa sobriété, son orgue contemporain construit par Daniel Kern et ses nombreux tableaux.\\nCette église fait l’objet d’un classement au titre des monuments historiques par la liste de 1840."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B1%CE%B3%CE%BA%CF%8C%CF%83%CE%BC%CE%B9%CE%BF_%CF%80%CF%81%CF%89%CF%84%CE%AC%CE%B8%CE%BB%CE%B7%CE%BC%CE%B1_%CE%A6%CF%8C%CF%81%CE%BC%CE%BF%CF%85%CE%BB%CE%B1_1_(2001)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Mika_Hakkinen_2001_Canada.jpg","page_title":"Παγκόσμιο πρωτάθλημα Φόρμουλα 1 (2001)","context_page_description":"Το Παγκόσμιο Πρωτάθλημα Φόρμουλα 1 του 2001 ήταν το 52ο που διοργάνωσε η FIA. Περιλάμβανε 17 αγώνες, ο πρώτος έγινε στη Μελβούρνη της Αυστραλίας στις 4 Μαρτίου 2001 και ο τελευταίος στη Σουζούκα της Ιαπωνίας στις 14 Οκτωβρίου 2001.\\nΤο πρωτάθλημα οδηγών κατέκτησε, για δεύτερη συνεχόμενη σαιζόν, ο Γερμανός Μίχαελ Σουμάχερ, ενώ ήταν το τέταρτό του πρωτάθλημα στο σύνολο. Το πρωτάθλημα κατασκευαστών κατέκτησε η Σκουντερία Φερράρι συγκεντρώνοντας συνολικά 179 βαθμούς."},{"page_url":"https://de.wikipedia.org/wiki/Thomas_K%C3%B6ner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/ThomasKoener_Goethe-Institut_Boston_22-10-2010_bySusannaBolle.jpg","page_title":"Thomas Köner","context_page_description":"Thomas Köner ist ein deutscher Klang- und Multimediakünstler. Köner kombiniert in seinen Werken oft visuelle mit auditiven Erfahrungen."},{"page_url":"https://es.wikipedia.org/wiki/Wiener_Platz_(Dresde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/040518-dresden-wienerplatz--baugrube-pano.jpg","page_title":"Wiener Platz (Dresde)","context_page_description":"Wiener Platz es una plaza de la ciudad de Dresde. Se encuentra al norte de la estación central, lo que la convierte en uno de los puntos más importantes del tráfico de tranvías de la ciudad, junto a Postplatz y Albertplatz. Al norte se extiende el bulevar Prager Straße. El nombre de la plaza hace referencia a la ciudad de Viena."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B6%D5%BF%D5%AB%D5%AF%D5%B8%D5%A4%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/TRNA-Met_yeast.svg","page_title":"Անտիկոդոն","context_page_description":"Անտիկոդոն, հակակոդոն, տրիպլետ, փոխադրող ռիբոնուկլեինաթթվի հատված, որը բաղկացած է երեք չզույգված՝ ազատ կապեր ունեցող նուկլեոտիդներից։ Այս անտիկոդոնները ճանաչում են ինֆորմացիոն ՌՆԹ-ի կոդոններին և պայմանավորում են յուրաքանչյուր ամինաթթվի ճիշտ տեղը սինթեզվող սպիտակուցի մոլեկուլում։\\nՅուրաքանչյուր բջջին անհրաժեշտ է 61 տարբեր տիպի փՌՆԹ, որպեսզի անտիկոդոնները կարողանան կապվել բոլոր կոդոնների հետ։ Սովորաբար բջիջները պարունակում են 61-ից քիչ թվով փՌՆԹ-ի տեսակներ, քանի որ յուրաքանչյուր փՌՆԹ կարող է կապվել մի քանի տեսակի կոդոնի։ Ամենաքիչն անհրաժեշտ է 31 փՌՆԹ, որպեսզի տեղի ունենա տրանսլյացիա։"},{"page_url":"https://en.wikipedia.org/wiki/Chiloglottis_cornuta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Chiloglottis_cornuta_LC0241.jpg","page_title":"Chiloglottis cornuta","context_page_description":"Chiloglottis cornuta, commonly known as the green bird orchid, is a species of orchid found in south-eastern Australia and in New Zealand including many of its offshore islands. It has two broad leaves and a single green or pinkish flower with six to eight rounded, green, reddish or blackish calli on the labellum."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%82%A3%E3%83%AA%E3%82%A2%E3%83%A0%E3%83%BB%E3%83%88%E3%83%AD%E3%82%B9%E3%83%88%E3%83%BB%E3%83%AA%E3%83%81%E3%83%A3%E3%83%BC%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/WLA_brooklynmuseum_Old_Orchard_at_Newport_1875.jpg","page_title":"ウィリアム・トロスト・リチャーズ","context_page_description":"ウィリアム・トロスト・リチャーズはアメリカ合衆国の風景画家である。"},{"page_url":"https://fr.wikipedia.org/wiki/Femmes_de_la_maison_de_Savoie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Anna_Cristina_of_Sulzbach%2C_Princess_of_Piedmont.jpg","page_title":"Femmes de la maison de Savoie","context_page_description":"Cet article présente, par ordre chronologique de naissance, les principales personnalités féminines ayant appartenu à la Maison de Savoie, par naissance ou par mariage.\\nLa position de la maison de Savoie sur l'échiquier européen permet à certaines princesses d'être mariées à des monarques ou futurs monarques. Ainsi, Berthe de Turin devient impératrice du Saint-Empire et Jeanne de Savoie impératrice byzantine de 1326 à 1341, puis régente de 1341 à 1347. Plusieurs sont également reines comme Adélaïde de Savoie, reine des Francs ou Mathilde de Savoie, première reine du Portugal.\\nLa comtesse de Provence, Béatrice de Savoie, quant à elle, est mère de quatre futures reines : Marguerite, reine de France ; Éléonore, reine d'Angleterre ; Sancie, comtesse de Cornouailles puis reine des Romains et Béatrice, héritière de la Provence et de Forcalquier, devient pour quelques mois reine de Sicile."},{"page_url":"https://en.wikipedia.org/wiki/Marieville,_Quebec","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Marieville-Architecture_d%E2%80%99inspiration_Victorienne.jpg","page_title":"Marieville, Quebec","context_page_description":"Marieville is a city in the Canadian province of Quebec. It is located within the Rouville Regional County Municipality in the Montérégie region about 30 kilometers east of Montreal. The population as of the Canada 2011 Census was 10,094."},{"page_url":"https://en.wikipedia.org/wiki/Gujarat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/GauravPath1.jpg","page_title":"Gujarat","context_page_description":"Gujarat is a state on the western coast of India with a coastline of 1,600 km – most of which lies on the Kathiawar peninsula – and a population of 60.4 million. It is the fifth largest Indian state by area and the ninth largest state by population. Gujarat is bordered by Rajasthan to the northeast, Dadra and Nagar Haveli and Daman and Diu to the south, Maharashtra to the southeast, Madhya Pradesh to the east, and the Arabian Sea and the Pakistani province of Sindh to the west. Its capital city is Gandhinagar, while its largest city is Ahmedabad. The Gujarati-speaking people of India are indigenous to the state. The economy of Gujarat is the third-largest in India, with a gross state domestic product of ₹15.02 lakh crore and has the country's 11th-highest GSDP per capita of ₹197,000. Gujarat ranks 21st among Indian states in human development index. The state traditionally has low unemployment and widely considered one of the most industrially developed state of India and a manufacturing hub.\\nThe state encompasses some sites of the ancient Indus Valley Civilisation, such as Lothal, Dholavira and Gola Dhoro. Lothal is believed to be one of the world's first seaports."},{"page_url":"https://eu.wikipedia.org/wiki/L%C3%B6hningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Karte_Gemeinde_L%C3%B6hningen_2013.png","page_title":"Löhningen","context_page_description":"Löhningen Suitzako udalerria da. Schaffhausen kantonamenduan dago, Schaffhausen kantonamendua barrutian. 2014an 1,472 biztanle zituen 6.83 kilometro koadrotan banatuta."},{"page_url":"https://hu.wikipedia.org/wiki/Cheverny","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Population_-_Municipality_code_41050.svg","page_title":"Cheverny","context_page_description":"Cheverny település Franciaországban, Loir-et-Cher megyében. Cheverny Cellettes, Contres, Cormeray, Cour-Cheverny, Fontaines-en-Sologne és Fresnes községekkel határos."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CF%81%CF%85%CE%BB%CE%AC%CE%BD%CE%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Brulange_eglise.JPG","page_title":"Μπρυλάνζ","context_page_description":"Το Μπρυλάνζ είναι μια κοινότητα στο νομό Μοζέλ στο Γκραντ Εστ στη βορειοανατολική Γαλλία."},{"page_url":"https://en.wikipedia.org/wiki/Willis_Blatchley","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Dunedin_FL_Blatchley_House02.jpg","page_title":"Willis Blatchley","context_page_description":"Willis Stanley Blatchley was an American entomologist, malacologist, geologist, and author. His studies included Coleoptera, Orthoptera, Hemiptera, and the freshwater molluscs of Indiana. Blatchley described several taxa. His home in Dunedin, Florida, the Willis S. Blatchley House, is listed on the National Register of Historic Places.\\nHe was born in Connecticut and his parents moved to Indiana in 1860 a year later. He attended high school in Bainbridge and enrolled at Indiana University in 1883, graduating with a B.A. in 1887 and an M.A. in 1891. There he worked under ichthyologist David Starr Jordan and geologist John Casper Branner. Blatchley received an honorary degree from Indiana University in 1921.\\nFrom 1887-1893 he taught at Terre Haute High School where he was Head of the Science Department from 1887-1893. From 1894-1910 he was State Geologist for Indiana.\\nAfter being defeated for re-election in 1911, he retired from public office, but continued his natural history work as an amateur. Though much of his work focused on the fauna of Indiana, he traveled to Arkansas, Alaska, Florida, Canada, Mexico, and South America.\\nBlatchley married Clara A."},{"page_url":"https://en.wikipedia.org/wiki/Revival_meeting","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Revival_crusade_in_Andhra_Pradesh%2C_India%2C_Johannes_Maas%2C_American_evangelist%2C_speaking.jpg","page_title":"Revival meeting","context_page_description":"A revival meeting is a series of Christian religious services held to inspire active members of a church body to gain new converts. Nineteenth-century Baptist preacher Charles Spurgeon said, \\"Many blessings may come to the unconverted in consequence of a revival among Christians, but the revival itself has to do only with those who already possess spiritual life.\\" These meetings are usually conducted by churches or missionary organizations throughout the world. Notable historic revival meetings were conducted in the US by evangelist Billy Sunday and in Wales by evangelist Evan Roberts."},{"page_url":"https://de.wikipedia.org/wiki/Einfarbsegler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Einfarbsegler.jpg","page_title":"Einfarbsegler","context_page_description":"Der Einfarbsegler ist eine Vogelart aus der Familie der Segler. Es handelt sich um einen dunkel gefärbten Segler mittlerer Größe. Die Art brütet auf Madeira und den Kanarischen Inseln. Der Einfarbsegler ähnelt stark dem in Mitteleuropa häufigen, nahe verwandten Mauersegler. Wie dieser ist er sehr gesellig, wobei Einfarbsegler häufig auch gemischte Schwärme mit Mauer- und Fahlseglern bilden. Die Population gilt als stabil und die Art wird als ungefährdet eingestuft."},{"page_url":"https://en.wikipedia.org/wiki/November_1965","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/ElisabethofBelgium.jpg","page_title":"November 1965","context_page_description":"The following events occurred in November 1965:"},{"page_url":"https://en.wikipedia.org/wiki/Ripley_Township,_Brown_County,_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Map_highlighting_Ripley_Township%2C_Brown_County%2C_Illinois.svg","page_title":"Ripley Township, Brown County, Illinois","context_page_description":"Ripley Township is one of nine townships in Brown County, Illinois, USA. As of the 2010 census, its population was 102 and it contained 59 housing units."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%94%D0%BB%D0%BE%D0%BC%D0%BD%D0%B0_%D1%85%D0%B2%D0%BE%D1%80%D0%BE%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Plasmacytoma_ultramini1.jpg","page_title":"Мієломна хвороба","context_page_description":"Мієломна хвороба, або множинна мієлома, застаріле — хвороба Рустицького-Калера, плазмоцитома, плазмоклітинна мієлома — захворювання, що характеризується пухлинним розростанням плазматичних клітин кісткового мозку. Одним з першовідкривачів хвороби був український хірург Йосип Олександрович Рустицький, часто раніше хворобу називали захворюванням Рустицького-Калера.\\nЗахворювання тривалий час може не викликати скарг, супроводжуючись упродовж років лише підвищеним ШОЕ. У подальшому можуть з'явитися скарги на загальну слабкість, схуднення, біль у кістках. Рентгенологічно виявляють обмежені ділянки розрідження кісткової тканини, особливо у плоских кістках — черепі, груднині, ребрах та кістках таза, деяких змішаних кістках — хребцях. У пізнішій стадії ураження кісток може ускладнитися переломами ребер, хребта. У всіх хворих по мірі прогресування хвороби розвивається анемія, причому прямої залежності між її ступенем та величиною кісткових уражень немає. Можлива лейкопенія.\\nУ сироватці крові збільшений вміст загального білка до 100—120 г/л за рахунок появи крупнодисперсного парапротеїну, який виробляється плазматичними клітинами. Цей білок може виділятися із сечею."},{"page_url":"https://it.wikipedia.org/wiki/Brooklyn_(Citt%C3%A0_del_Capo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Klein_Zoar%2C_4_Wemyss_Road%2C_Brooklyn..jpg","page_title":"Brooklyn (Città del Capo)","context_page_description":"Brooklyn è un sobborgo della città sudafricana di Città del Capo, nella provincia del Capo Occidentale. Il centro abitato è situato a nord del sobborgo di Maitland, a sud della costa atlantica ed a ovest della base aerea di Ysterplaat ed è attraversato dal fiume Nero."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_ferrocarril_de_Hangzhou_Este","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/20151226%E6%9D%AD%E5%B7%9E%E4%B8%9C%E7%AB%99%E8%A5%BF%E5%B9%BF%E5%9C%BA%E5%85%A8%E6%99%AF.jpg","page_title":"Estación de ferrocarril de Hangzhou Este","context_page_description":"La estación de ferrocarril Hangzhou Este es una estación de ferrocarril ubicada en Hangzhou, Zhejiang, República Popular de China.\\nOriginalmente construido como una pequeña estación en 1992 que sirve el ferrocarril Shanghai-Kunming, ha sido reconstruido como un centro ferroviario de alta velocidad, que entró en funcionamiento el 1 de julio de 2013 y se convirtió en una de las estaciones de tren más grandes de Asia.​​"},{"page_url":"https://it.wikipedia.org/wiki/Attacco_a_tre_punti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/3PUNTI.JPG","page_title":"Attacco a tre punti","context_page_description":"L'attacco a tre punti è un congegno meccanico usato sui trattori agricoli per agganciare e usare attrezzi o macchine operatrici come aratro, fresa, coltivatore."},{"page_url":"https://is.wikipedia.org/wiki/Macintosh","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Macintosh_128k_transparency.png","page_title":"Macintosh","context_page_description":"Macintosh, líka þekkt sem Mac eða Makki á íslensku, er vörumerki tölvulínu frá Apple. Nafnið kemur frá McIntosh sem er eplategund og það var uppáhalds eplið hans Jef Raskin sem vann hjá Apple 1979. Fyrsta Macintosh-tölvan kom á markaðinn þann 24. janúar 1984: Macintosh 128K.\\nAllar núverandi Mac-tölvur eru með Thunderbolt-tengi sem þróað var af Apple og Intel."},{"page_url":"https://eu.wikipedia.org/wiki/Ahoghill","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Ahoghill.jpg","page_title":"Ahoghill","context_page_description":"Ahoghill edota Ahohill Ipar Irlandako Antrim konderrian dagoen udalerri bat da, Ulster probintzian. 2001ean 3.403 biztanle zituen."},{"page_url":"https://ja.wikipedia.org/wiki/NTT%E3%83%89%E3%82%B3%E3%83%A2%E3%81%AE%E4%B8%BB%E3%81%AA%E6%90%BA%E5%B8%AF%E9%9B%BB%E8%A9%B1%E7%AB%AF%E6%9C%AB%E7%B4%8D%E5%85%A5%E3%83%A1%E3%83%BC%E3%82%AB%E3%83%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/DocomoT-01A.jpg","page_title":"NTTドコモの主な携帯電話端末納入メーカー","context_page_description":"NTTドコモの主な携帯電話端末納入メーカーでは、NTTドコモの主な携帯電話端末納入メーカーについて詳細に説明する。"},{"page_url":"https://cs.wikipedia.org/wiki/John_Deighton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Gassyjack.jpg","page_title":"John Deighton","context_page_description":"John Deighton, známý po jménem Gassy Jack, byl anglický obchodník, majitel baru a kapitán. Ve Vancouveru po něm nese jméno historická čtvrť Gastown."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Ciclidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/PSM_V68_D531_Crenicichla_saxatilis_of_the_chiclidae.png","page_title":"Specie di Ciclidi","context_page_description":"Lista delle specie di Cichlidae."},{"page_url":"https://fi.wikipedia.org/wiki/Hans_Driesch","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Driesch1.jpg","page_title":"Hans Driesch","context_page_description":"Hans Adolf Eduard Driesch oli saksalainen biologi ja filosofi. Hän toimi biologian professorina Heidelbergin yliopistossa. Filosofina hänet voidaan lukea saksalaisen elämänfilosofian edustajiin.\\nDriesch tutki muun muassa embryologiaa eli sikiöiden kehitystä. Hän osoitti vuonna 1895 kokeiden perusteella, että hedelmöittyneistä munasoluista oli mahdollista poistaa osia ilman että tämä vaikutti kehittyneisiin sikiöihin. Tätä pidettiin todisteena siitä, että mikä tahansa alkuperäisen munasolun osa kykeni muodostamaan minkä tahansa osan lopullisesta sikiöstä.\\nFilosofiassa Drieschin ajattelu oli vitalistista. Hän katsoi, että sikiönkin kehityksessä havaittava elämän autonomia ja organismissa vaikuttava muodon antava tekijä on Aristoteleelta lainatulla termillä entelekheia, jotain jolla on oma päämääränsä itsessään. Hän käytti tästä myös nimitystä psykoidi, jolla hän tarkoitti entiteettiä, jolla on psyykkistä potentiaalia, joka ilmenee ei-avaruudellisena, intensiivisenä ja kvalitatiivisena ennemmin kuin avaruudellisena, ekstensiivisenä ja kvantitatiivisena. Drieschin ajattelu kohtasi suurta vastustusta."},{"page_url":"https://vi.wikipedia.org/wiki/Th%E1%BB%91ng_%C4%91%E1%BB%91c_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Governor_Ralph_Northam_Gives_Inaugural_Address_%2839348612584%29_%28cropped%29.jpg","page_title":"Thống đốc Virginia","context_page_description":"Thống đốc Thịnh vượng chung Virginia giữ vai trò là người đứng đầu Thịnh vượng chung Virginia trong nhiệm kỳ bốn năm. Thống đốc hiện tại của văn phòng là Ralph Northam, người đã tuyên thệ nhậm chức vào ngày 13 tháng 1 năm 2018. Nhiệm kỳ của ông sẽ kết thúc vào năm 2022."},{"page_url":"https://fr.wikipedia.org/wiki/Halimedaceae","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Capo_Gallo_021.jpg","page_title":"Halimedaceae","context_page_description":"Les Halimedaceae sont une famille d'algues vertes de l'ordre des Bryopsidales. Selon les classifications, elles peuvent être intégrées aux Udoteaceae, sinon elles ne contiennent que le genre Halimeda."},{"page_url":"https://ca.wikipedia.org/wiki/Almati","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Almaty_landsat.jpg","page_title":"Almati","context_page_description":"Almati, coneguda abans com a Alma-Atà durant l'època soviètica i Verni en la Rússia imperial, fou la capital des del Kazakhstan del 1929 fins a la construcció de la nova capital Astanà el 1998, i és la ciutat més gran del Kazakhstan, amb una població total d'uns 1.300.000 habitants. El nom significa rica en pomes en kazakh, ja que la poma és originària d'aquesta zona. Fou també capital de l'oblast del mateix nom del 1931 al 2001.\\nLa ciutat, el principal centre comercial del país, és la seu de la principal universitat del país, la Universitat Estatal del Kazakhstan i de molts edificis i oficines del govern, incloent-hi la residència presidencial, construïda després del col·lapse de la Unió Soviètica. Va ser ciutat candidata per a la realització dels Jocs Olímpics d'hivern de 2014.\\nVegeu també: Província d'Almati"},{"page_url":"https://pt.wikipedia.org/wiki/Kenny_Omega","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/BULLET_CLUB_2015.JPG","page_title":"Kenny Omega","context_page_description":"Tyson Smith é um lutador profissional canadense, mais conhecido pelo seu nome no ringue Kenny Omega. Ele atualmente trabalha para a All Elite Wrestling onde é o atual Campeão Mundial de Duplas ao lado de Adam Page. Omega também é conhecido por seu trabalho na New Japan Pro Wrestling onde ele foi uma vez Campeão Intercontinental da IWGP, duas vezes Campeão dos Pesos-Pesados Júnior da IWGP, uma vez Campeão de Duplas Pesos-Pesadas Júnior da IWGP, duas vezes Campeão de Trios de Peso Aberto NEVER e IWGP Heavyweight Champion dando fim ao reinado lendário de Kazuchika Okada. Ele também foi vencedor por uma ocasião do torneio da NJPW G1 Climax, tendo ganho em 2016 e se tornou o primeiro lutador estrangeiro a vencê-lo. Ele também fez aparições na promoção americana Ring of Honor.\\nEle também é conhecido por seu trabalho no circuito independente japonês, aparecendo em promoções como a Dramatic Dream Team, onde ele foi uma vez Campeão Peso-Aberto da KO-D, três vezes Campeão de Duplas da KO-D, duas vezes Campeão de Trios da KO-D e uma vez Campeão da Divisão Extrema da DDT. Ele também trabalhou para a All Japan Pro Wrestling, onde ele foi Campeão Mundial dos Pesos-Pesados Júnior."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A7%80%E4%B8%96%E9%9F%B3%E8%8F%A9%E8%96%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Seated_Guanyin_in_white_glaze%2C_Dehua_ware.JPG","page_title":"南无观世音菩萨","context_page_description":"觀世音菩薩，漢語音譯「阿婆盧吉低舍婆羅」、「阿縛盧枳低濕伐邏」，名號意為「觀察世間音聲覺悟有情」，又譯為觀音菩薩、觀自在菩薩、光世音菩薩，手持蓮花的觀音菩薩也被稱爲蓮花手菩薩或持蓮觀音，在大中華地區佛教自唐代開始主要是以蓮華部母白衣觀音為所有觀世音菩薩的本尊；在民間信仰中常被尊稱觀音佛祖、觀音大士、觀音娘娘、觀音媽、白衣大士。在密教中，祂為蓮華部尊，在淨土宗則是西方淨土的大菩薩，與大勢至菩薩分別為阿彌陀佛的左、右脅侍菩薩，並稱「西方三聖」，同時祂也是四大菩薩之一。"},{"page_url":"https://es.wikipedia.org/wiki/Saint-Georges-sur-Baulche","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Mobeye-%C3%89t%C3%A9DesVilles-Saint-Georges-sur-Baulche-806.jpg","page_title":"Saint-Georges-sur-Baulche","context_page_description":"Saint-Georges-sur-Baulche es una población y comuna francesa que se encuentra en la región de Borgoña, departamento de Yonne, en el distrito de Auxerre y cantón de Auxerre-Sud-Ouest."},{"page_url":"https://nl.wikipedia.org/wiki/Michael_Baur","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/SV_Gr%C3%B6dig_gegen_FC_Red_Bull_Salzburg_Mai_2015_44.JPG","page_title":"Michael Baur","context_page_description":"Michael Baur is een voormalig Oostenrijks voetballer, die na zijn actieve loopbaan het trainersvak instapte."},{"page_url":"https://pl.wikipedia.org/wiki/Robot_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Robot_building.jpg","page_title":"Robot Building","context_page_description":"Robot Building – 20-piętrowy, postmodernistyczny wieżowiec biurowy, zlokalizowany w dzielnicy Sathorn w Bangkoku, stolicy Tajlandii. Robot Building jest siedzibą United Overseas Bank. Wieżowiec stoi przy 191 South Sathorn Road i ma powierzchnię 23 506 m².\\nObiekt zaprojektowany przez tajskiego architekta Sumet Jumsai Na Ayudhaya na potrzeby Bank of Asia. Jego forma i nazwa odzwierciedla duże przemiany w bankowości, jaki miały miejsce w końcu XX wieku, a mianowicie dogłębną komputeryzację tej części działalności gospodarczej. Budynek wyobraża potoczny wizerunek robota, wykreowany przez pop-kulturę. Ukończony został w 1986."},{"page_url":"https://pl.wikipedia.org/wiki/Sziszapangma","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Shisha_Pangma_2006.jpg","page_title":"Sziszapangma","context_page_description":"Sziszapangma – 8013 m n.p.m., ośmiotysięcznik na terytorium Tybetu w Himalajach Wysokich, ok. 120 km na północny zachód od grupy Mount Everestu. W oznaczeniu Indyjskiej Służby Topograficznej otrzymała numer XXIII, przez wiele lat znana była pod sanskrycką nazwą Gosainthan, co oznacza Miejsce Świętych. Tybetańska nazwa Shi-sha-sbang-ma oznacza Grań nad Trawiastą Równiną. Szczyt tworzy potężny masyw, pokryty wiecznymi śniegami i lodowcami. Na północnym skłonie ma źródła rzeka Arun, należąca do dorzecza Gangesu."},{"page_url":"https://pl.wikipedia.org/wiki/Negley","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/State_Routes_154_and_170_in_Negley.jpg","page_title":"Negley","context_page_description":"Negley – jednostka osadnicza w Stanach Zjednoczonych, w stanie Ohio, w hrabstwie Columbiana."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D9%86_%D8%B1%D9%88%D9%8A%D9%86%D9%8A%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Ron_Roenicke_on_April_1%2C_2013.jpg","page_title":"رون روينيك","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nرون روينيك لاعب بيسبول من امريكا."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_de_Yala","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Yalapath.jpg","page_title":"Parc national de Yala","context_page_description":"Le parc national de Yala ou parc national Ruhuna est le deuxième plus grand parc national du Sri Lanka et le plus visité. Le parc est situé dans la région sud-est du pays dans la province du Sud et la province d'Uva. Le parc couvre 979 km2 et est situé à environ 300 km de Colombo. Il a été initialement désigné comme un sanctuaire de vie sauvage en 1900, et avec le parc national de Wilpattu, il fut l'un des deux premiers parcs nationaux créés au Sri Lanka en étant élevé à ce rang en 1938. Le parc est surtout connu pour sa richesse en animaux sauvages et joue un rôle important pour la conservation de l'Élephant du Sri Lanka et des oiseaux d'eau.\\nIl y a six parcs nationaux et trois sanctuaires de vie sauvage à proximité du parc de Yala. Le parc est situé dans la région de climat semi-aride et les précipitations tombent principalement durant la période de la mousson. Le parc national abrite une variété d'écosystèmes allant des forêts humides de mousson aux zones humides marines et d'eau douce. Le tsunami de l'océan Indien de 2004 a causé de sévères dommages au parc national de Yala, où 250 personnes ont trouvé la mort."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%82%A5%E3%83%AB%E3%83%A0%E9%81%BA%E8%B7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Tulum_-_15.jpg","page_title":"トゥルム遺跡","context_page_description":"トゥルム遺跡は、マヤ文明末期に栄えた城壁都市の遺跡である。内陸にあるコバー遺跡のための主要な港として用いられていた。メキシコのカリブ海に面したユカタン半島東海岸のキンタナ・ロー州にあり、廃墟は、高さ12メートルの崖の上に位置している。トゥルムは、マヤ人によって造られ居住された最後の都市の1つで、13から15世紀の間に繁栄し、スペイン人がメキシコを占領し始めたあとも、およそ70年間を生き延びた。スペインの移民によって持ち込まれた感染症が、終焉の原因であったようにも見られている。トゥルムは、沿岸部で最も保存の良いマヤ遺跡の一つで、観光客の人気を博している。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EB%8B%A4%EB%A7%88_%ED%8A%B8%EB%9D%BC%EC%98%A4%EB%A0%88_(1996%EB%85%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/2012_2013_-_Adama_Traore_-_Flickr_-_Castroquini-FCB.jpg","page_title":"아다마 트라오레 (1996년)","context_page_description":"아다마 트라오레 디아라는 스페인의 말리계 축구 선수이다. 포지션은 윙어이며, 현재 소속팀 울버햄프턴 원더러스에서 활약하고 있다."},{"page_url":"https://cy.wikipedia.org/wiki/Cap_inc_yr_aelwyd","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Coprinopsis_picacea_12184.jpg","page_title":"Cap inc yr aelwyd","context_page_description":"Math a rhywogaeth o ffwng yn nheulu'r Psathyrellaceae yw'r Cap inc yr aelwyd. 'Y Capannau Inc' yw'r enw ar lafar ar y grwp mae'r ffwng yma'n perthyn iddo, ond nid yw'n derm gwyddonol. Gair arall am 'gapiau' yw 'capannau'; defnyddir inc i ysgrifennu a defnyddir y gair yma oherwydd ei liw tywyll. Mae'r teulu Psathyrellaceae yn gorwedd o fewn urdd yr Agaricales."},{"page_url":"https://ast.wikipedia.org/wiki/Kim_Novak","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Kim_Novak_01.jpg","page_title":"Kim Novak","context_page_description":"Kim Novak, ñació en Chicago el 13 de febreru de 1933, ye una actriz estauxunidense d'orixe checu, con una llarga carrera cinematográfica. Trabayó con direutores como Alfred Hitchcock o Billy Wilder, y compartió películes con Judy Holliday, Jack Lemmon, William Holden, Rita Hayworth, Frank Sinatra, James Stewart, Walter Matthau, Dean Martin, Fred Astaire, Ernest Borgnine, Tony Curtis, Rock Hudson o Elizabeth Taylor, faciendo papeles de femme fatale."},{"page_url":"https://en.wikipedia.org/wiki/History_of_medicine","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Leeuwenhoek_Microscope.png","page_title":"History of medicine","context_page_description":"The history of medicine shows how societies have changed in their approach to illness and disease from ancient times to the present. Early medical traditions include those of Babylon, China, Egypt and India. Sushruta, from India, introduced the concepts of medical diagnosis and prognosis. The Hippocratic Oath was written in ancient Greece in the 5th century BCE, and is a direct inspiration for oaths of office that physicians swear upon entry into the profession today. In the Middle Ages, surgical practices inherited from the ancient masters were improved and then systematized in Rogerius's The Practice of Surgery. Universities began systematic training of physicians around 1220 CE in Italy.\\nInvention of the microscope was a consequence of improved understanding, during the Renaissance. Prior to the 19th century, humorism was thought to explain the cause of disease but it was gradually replaced by the germ theory of disease, leading to effective treatments and even cures for many infectious diseases. Military doctors advanced the methods of trauma treatment and surgery."},{"page_url":"https://la.wikipedia.org/wiki/Barrettali","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Corse-04642-marine_de_Giottani-_cap_Corse.jpg","page_title":"Barrettali","context_page_description":"Barrettali est commune Francicum 139 incolarum praefecturae Corsicae Superioris in regione australi Corsica."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Rathen","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Rhododendronpark_Kleine_Bastei_Rathen_8.JPG","page_title":"Liste der Kulturdenkmale in Rathen","context_page_description":"Die Liste der Kulturdenkmale in Rathen enthält die Kulturdenkmale in Rathen.\\nDie Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Sächsische Schweiz-Osterzgebirge.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://sv.wikipedia.org/wiki/Forsgrenska_stilen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Gr%C3%A4ngshammars_bruk_2008a.jpg","page_title":"Forsgrenska stilen","context_page_description":"Forsgrenska stilen är en arkitekturstil som användes under 1800-talets mitt i samband med byggnader uppförda av slaggsten. Stilen kom till användning huvudsakligen i Västerbergslagen och har uppkallades efter dess upphovsman Olof Forsgren, som var ingenjör och disponent vid Grängshammars bruk åren 1816-1855."},{"page_url":"https://en.wikipedia.org/wiki/Nicolas_Kazadi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Nicolas_Kazadi_Angola.png","page_title":"Nicolas Kazadi","context_page_description":"Nicolas Kazadi is a Congolese politician and career diplomat who has been Ambassador-at-large for the Democratic Republic of the Congo since 7 March 2019.\\nHe is a member of the presidential party Union for Democracy and Social Progress, the oldest and largest opposition party since President Mobutu cancelled the multi-party system upon his rise to power in 1965."},{"page_url":"https://eu.wikipedia.org/wiki/Lovrijenac","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Pogled_na_Dubrovnik_s_Lovrijenca.JPG","page_title":"Lovrijenac","context_page_description":"Lovrijenac gotorlekua edo San Lorenzo, sarritan \\"Dubrovnikeko Gibraltar\\" bezala deitua, Dubrovnik hiriaren kanpoaldean dagoen gotorleku eta antzokia da. Itsas gaineko 37 metrotan dago eta horrek hartuezin itxura ematen dio. Dubrovnikeko harresiak indartzen zituen."},{"page_url":"https://de.wikipedia.org/wiki/Neuweiler_Viehweide","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Neuweiler_Viehweide_01.JPG","page_title":"Neuweiler Viehweide","context_page_description":"Neuweiler Viehweide ist ein Naturschutzgebiet auf dem Gebiet der baden-württembergischen Gemeinde Waldenbuch im Landkreis Böblingen."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%84%E0%B8%B1%E0%B8%A1%E0%B8%A0%E0%B8%B5%E0%B8%A3%E0%B9%8C%E0%B8%84%E0%B8%99%E0%B8%A2%E0%B8%B2%E0%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Im%C3%A1gen_de_Mar%C3%ADa_Sant%C3%ADsima_de_la_Trinidad._Iglesia_de_la_Trinidad_de_C%C3%B3rdoba.JPG","page_title":"พระคัมภีร์คนยาก","context_page_description":"พระคัมภีร์คนยาก คำว่า “พระคัมภีร์คนยาก” ในปัจจุบันหมายถึงงานศิลปะภายในคริสต์ศาสนสถานที่อาจจะเป็นงานชิ้นเดียวหรืองานชุดที่สร้างขึ้นเพื่อใช้ประกอบการสอนสาระของคัมภีร์ไบเบิลต่อประชากรส่วนใหญ่ที่ไร้การศึกษา ศิลปะ “พระคัมภีร์คนยาก” อาจจะเป็นงานประติมากรรม งานแกะสลัก จิตรกรรม งานโมเสก หรือหน้าต่างประดับกระจกสี ในโบสถ์บางแห่งหน้าต่างบานเดียวก็อาจจะเรียกได้ว่าเป็น “พระคัมภีร์คนยาก” ขณะที่ในโบสถ์อื่นทั้งโบสถ์อาจจะตกแต่งด้วยบทบรรยายพระคัมภีร์ไบเบิลอันซับซ้อนภายใต้หัวใจของเรื่องที่เป็นอันหนึ่งอันเดียวกัน"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D5%BB%D5%B8%D6%82%D5%AF%D5%AB_%D5%B3%D5%A5%D5%B2%D6%84%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nuclear_fission.svg","page_title":"Միջուկի ճեղքում","context_page_description":"Միջուկի տրոհում՝ տրոհման բեկորներ կոչվող, ատոմի միջուկի երկու իրար մոտ զանգվածներով միջուկների բաժանում։ Տրոհման արդյունքում կարող են առաջանալ նաև ռեակցիայի այլ արգասիքներ՝, նեյտրոններ և գամմա–քվանտներ։ Տրոհումը կարող է լինել ինքնաբերաբար և հարկադրաբար ։ Ծանր միջուկների տրոհումը էկզոթերմիկ պրոցես է, որի արդյունքում, ռեակցիայի արգասիքների կինետիկ էներգիայի ինչպես նաև ճառագայթման էներգիայի տեսքով հսկայական էներգիա է անջատվում։ Միջուկների տրոհումը էներգիայի աղբյուր է հանդիսանում միջուկային ռեակտորներում և միջուկային զենքում։"},{"page_url":"https://ca.wikipedia.org/wiki/Ag%C3%A0mids","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Red-headed_Rock_Agama.jpg","page_title":"Agàmids","context_page_description":"Els agàmids són una família de sauròpsids escatosos que inclou més de 300 espècies de llangardaixos repartides entre Àfrica, Àsia, Austràlia i el sud d'Europa. Filogenèticament, podrien ser el grup germà dels iguànids, i presenten una aparença similar.\\nEls agàmids sovint tenen unes potes fortes i ben desenvolupades. La cua no es regenera com sí que passa amb els dragons, encara que sí que s'ha observat un cert grau de regeneració en alguns agàmids. Moltes espècies tenen certa capacitat de canvia de color. Habiten entorns càlids, des de deserts fins a boscos tropicals."},{"page_url":"https://en.wikipedia.org/wiki/Foreign_relations_of_Mexico","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Vladimir_Putin_at_the_Millennium_Summit_6-8_September_2000-12.jpg","page_title":"Foreign relations of Mexico","context_page_description":"The foreign relations of Mexico are directed by the President of the United Mexican States and managed through the Secretariat of Foreign Affairs. The principles of the foreign policy are constitutionally recognized in the Article 89, Section 10, which include: respect for international law and legal equality of states, their sovereignty and independence, non-intervention in the domestic affairs of other countries, peaceful resolution of conflicts, and promotion of collective security through active participation in international organizations. Since the 1930s, the Estrada Doctrine has served as a crucial complement to these principles.\\nAfter the War of Independence, the relations of Mexico were focused primarily on the United States, its northern neighbor, largest trading partner, and the most powerful actor in hemispheric and world affairs. Once the order was reestablished, its foreign policy was built under hemispheric prestige in subsequent decades."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D9%8A%D8%B1%D9%86%D8%A7%D9%86%D8%AF%D9%88_%D8%B3%D9%83%D9%8A%D8%A7%DA%A4%D9%8A%D8%AA%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Fernando_Schiavetti.jpg","page_title":"فيرناندو سكياڤيتى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nفيرناندو سكياڤيتى كان سياسى من ايطاليا."},{"page_url":"https://id.wikipedia.org/wiki/Kapal_induk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/US_Navy_090819-N-6567V-024_An_F-A-18F_Super_Hornet_from_the_Diamondbacks_of_Strike_Fighter_Squadron_%28VFA%29_102%2C_prepares_to_launch_off_the_aircraft_carrier_USS_George_Washington.jpg","page_title":"Kapal induk","context_page_description":"Kapal induk adalah sebutan untuk kapal perang yang memuat pesawat tempur dalam jumlah besar. Tugasnya adalah memindahkan kekuatan udara ke dalam armada angkatan laut sebagai pendukung operasi-operasi angkatan laut. Selain itu juga digunakan sebagai pusat komando operasi dan sebagai kekuatan detterence atau memberikan efek gentar pada lawan. Sebagai kapal yang membawa pesawat, kapal induk memiliki fleksibilitas tempur yang lebih tinggi dibanding jenis kapal perang lainnya. Selain kegunaan tempur, kapal induk juga memiliki fungsi-fungsi lain seperti pengintaian, superioritas udara, atau memberikan bantuan. Saat Tsunami Aceh tahun 2004, Angkatan Laut Amerika Serikat menurunkan 1 kapal induknya yaitu USS Abraham Lincoln guna memberikan bantuan kemanusiaan kepada para korban, mencari orang-orang hilang, dan mengangkut jenazah-jenazah korban."},{"page_url":"https://gl.wikipedia.org/wiki/Alepo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Aleppo_citadel001.jpg","page_title":"Alepo","context_page_description":"Alepo é unha cidade de Siria, capital da provincia de Alepo. A cidade ten unha poboación de arredor de 1 700 000, converténdoa na segunda cidade de Siria, despois de Damasco. Situada nun lugar estratéxico entre o río Éufrates e o mar Mediterráneo. Coñecida na antigüídade como Khalpe, os gregos déronlle o nome de Beroea, e os árabes o de Ḥalab. É un importante centro comercial, e ten unha gran mesquita dos séculos XI e XII."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%84%D8%A7%D9%82%D8%A7%D8%AA_%D8%A7%D9%84%D8%B5%D9%8A%D9%86_%D8%A7%D9%84%D8%AE%D8%A7%D8%B1%D8%AC%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Diplomatic_relations_of_the_People%27s_Republic_of_China.svg","page_title":"علاقات الصين الخارجية","context_page_description":"توجه العلاقات الخارجية لجمهورية الصين الشعبية، المعروفة عمومًا باسم الصين، الطريقة التي تتفاعل بها الصين مع الدول الأجنبية، وتعبر عن نقاط ضعفها وقيمها السياسية والاقتصادية. تمتلك سياسة الصين الخارجية وتفكيرها الاستراتيجي تأثيرًا كبيرًا باعتبارها دولة كبرى وقوة عظمى مرتقبة. تدعي الصين رسميًا أنها «تتبع بثبات سياسة خارجية ذات نهج سلمي مستقل. تهدف هذه السياسة بشكل أساسي إلى الحفاظ على استقلال الصين وسيادتها وسلامتها الإقليمية، وخلق بيئة دولية مواتية للإصلاح والانفتاح وتحديث البناء في الصين، مع الحفاظ على السلام العالمي ودفع التنمية المشتركة». من الأمثلة على قرارات السياسة الخارجية تحت ضوء «السيادة والسلامة الإقليمية»، عدم انخراط جمهورية الصين الشعبية في علاقات دبلوماسية مع أي دولة تعترف بجمهورية الصين، التي لا تعترف جمهورية الصين الشعبية بها على أنها أمة مستقلة.\\nتُعتبر الصين عضوًا في العديد من المنظمات الدولية، وتحتل مناصب رئيسية مثل العضوية الدائمة في مجلس الأمن التابع للأمم المتحدة. سعت الأهداف الدبلوماسية لجمهورية الصين الشعبية إلى التوسعية في تحقيق الثورة الشيوعية الدولية قبل انتهاء الثورة الثقافية. حلت جمهورية الصين الشعبية محل جمهورية الصين باعتبارها حكومة «الصين» المعترف بها في الأمم المتحدة بعد قرار الجمعية العامة للأمم المتحدة 2758 في أوائل سبعينيات القرن الماضي."},{"page_url":"https://fi.wikipedia.org/wiki/Akateeminen_skeptisismi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Arcesilaus_and_Carneades.jpg","page_title":"Akateeminen skeptisismi","context_page_description":"Akateeminen skeptisismi viittaa antiikin aikaisen skeptisismin suuntaukseen, joka vaikutti Platonin Akatemiassa noin vuodesta 265 eaa., jolloin Arkesilaoksesta tuli koulun johtaja, noin vuoteen 90 eaa., jolloin Antiokhos Askalonlainen hylkäsi skeptisismin. Akatemian historiassa sen skeptisistisiä kausia kutsutaan myös keskimmäiseksi ja uudeksi Akatemiaksi.\\nAkatemialaiset skeptikot katsoivat pyrrhonististen skeptikoiden tavoin, että tieto on mahdotonta, eikä ihminen voi tietää mitään varmuudella. Vaikutelmista ei voi sanoa, ovatko ne tosia vai epätosia. Sen sijaan niillä on erilaisia todennäköisyyksiä ja siksi niihin liittyy eri määrä luottamusta, mikä mahdollistaa inhimillisen toiminnan. Koulu tunnetaan hyökkäyksistään stoalaisuutta vastaa ja erityisesti stoalaisen niin kutsuttujen kataleptisten vaikutelmien olemassaolon kieltämisestä.\\nMerkittävimmät akatemialaiset skeptikot olivat Arkesilaos ja Karneades. Akateeminen skeptisismi voidaan lukea yhdeksi hellenistisen filosofian koulukunnista."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A7%D8%A8%D8%B1%D8%AA_%DA%AF%D8%AF%D8%A7%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Dr._Robert_H._Goddard_-_GPN-2002-000131.jpg","page_title":"رابرت گدارد","context_page_description":"رابرت هاچینگز گُدارد استاد و دانشمند آمریکایی پیشگام موشک سوخت مایع کنترل‌شونده.\\nگدارد اولین موشک سوخت مایع را در تاریخ ۱۶ مارس ۱۹۲۶ پرتاب کرد. بین سال‌های ۱۹۳۰ تا ۱۹۳۵ با پرتاب موشک‌های مختلف به سرعت ۵۵۰ مایل بر ساعت دست یافت."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Vav%C5%99ince_(%C4%8Cernovi%C4%8Dky)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Kostel_sv._Vav%C5%99ince%2C_osada_%C4%8Cernovi%C4%8Dky%2C_%C4%8D%C3%A1st_obce_St%C5%99edokluky%2C_okres_Praha-z%C3%A1pad%2C_St%C5%99edo%C4%8Desk%C3%BD_kraj_10.JPG","page_title":"Kostel svatého Vavřince (Černovičky)","context_page_description":"Kostel svatého Vavřince v Černovičkách, části obce Středokluky v okrese Praha-západ je původně románská stavba z 2. poloviny 12. století. Katastrálně spadá do obce Číčovice. V blízkosti se nachází přírodní památka Čičovický kamýk. Díky přestavbám a stavebním úpravám v průběhu staletí se v kostele mísí prvky románské, gotické a barokní architektury. Je chráněn jako kulturní památka České republiky. O obnovení kulturního dědictví filiálního kostela sv. Vavřince v Černovičkách usilují členové Komunity Chemin Neuf se sídlem v Tuchoměřicích."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8E%D1%86%D0%B5%D1%80%D0%BD%D0%B0_%D0%BC%D0%B0%D0%BB%D0%B5%D0%BD%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Medicago_minima_seeds.JPG","page_title":"Люцерна маленька","context_page_description":"Люцерна маленька, люцерна мала, равельник маленький, равлинник найменший — вид квіткових рослин родини бобові. Латинський епітет minima означає «мінімальний, найменший»."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B1%D9%83%D9%88%D8%B5%D9%88%D8%B1%D8%A7%D8%AA_%D8%A7%D9%84%D8%B4%D9%83%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Americanalligator.jpg","page_title":"أركوصورات الشكل","context_page_description":"أركوصورات الشكل هي أصنوفة من الزواحف ثنائية الأقواس التي تضم أسلاف أشباه الأركوصورات في فترة البرمي المتأخر. وقد عرفها جاك غوتييه بأنه الأصنوفة المنحدر من آخر سلف مشترك للتماسيح الأولية والأركوصورات؛ وقد عرفها فيل سنتر بأنها الأصنوفة الأكثر تميزاً بسبب ضمها للتمساح الأولي والأركوصورات."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Neustift","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Kloster_Neustift_Kreuzgang_Fresken_01.JPG","page_title":"Kloster Neustift","context_page_description":"Das Kloster Neustift ist ein Stift der Kongregation der österreichischen Augustiner-Chorherren in Neustift."},{"page_url":"https://nl.wikipedia.org/wiki/Sandillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Map_commune_FR_insee_code_45300.png","page_title":"Sandillon","context_page_description":"Sandillon is een gemeente in het Franse departement Loiret en telt 3570 inwoners. De plaats maakt deel uit van het arrondissement Orléans."},{"page_url":"https://tr.wikipedia.org/wiki/%C3%87ang%C3%A7un","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/CC_sisters.PNG","page_title":"Çangçun","context_page_description":"Çangçun, Çin'de bir şehir ve Jilin eyaletinin başkentidir. Bir eyalet altı özel statülü şehir olarak yönetilmekte olup bu idari bölgede 7.5 milyon civarında kişi yaşamaktadır. Şehrin kendisinin nüfusu ise 4.86 milyon kişidir. \\"Çangçun\\" adı Çincede \\"uzun ilkbahar\\" anlamına gelmektedir.\\nŞehrin ana ekonomik faaliyetleri gıda maddeleri, biyoloji ve eczacılık ile otomobil sektörüdür. Çangçun ülkedeki en büyük otomobil üretim merkezidir.\\nTicaretle geçinen küçük bir kasaba olarak kurulan şehir, 1800 yılında İmparator Jiaqing tarafından \\"Changchun Ting\\" olarak adlandırıldı. 1898 yılında Ruslar Harbin'den Lüshun'a bir demiryolu inşa ederken Çangçun'da \\"Kuançeng\\" bir demiryolu istasyonu yaptı. 1904-1905 Rus-Japon savaşı sonrası Rusya bu hattın güney kısmını kaybedince Kuançeng de bu hattın son istasyonu hâline geldi. Japonlar ise çok az bir mesafe güneyde Çangçun Demiryolu İstasyonu'nu inşa etti. 1907'deki bir antlaşma Rus trenlerinin Çangçun'a, Japon trenlerinin ise Kuançeng'e kadar gidebilmesini sağladı. Çangçun da Japon ve Rus demiryolu hatlarının birleştiği yer olarak hızlı bir büyümeye tanık oldu."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D9%8A%D9%84%D8%B2_%D8%A8%D8%A7%D8%B1%D9%86%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Giles_Barnes%2C_Houston_Dynamo_vs_D.C._United._August_3%2C_2014.jpg","page_title":"جايلز بارنز","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجايلز بارنز لاعب كورة قدم من المملكه المتحده."},{"page_url":"https://es.wikipedia.org/wiki/Hidetaka_Miyazaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Berserk_Logo.png","page_title":"Hidetaka Miyazaki","context_page_description":"Hidetaka Miyazaki ​ es un diseñador de videojuegos japonés y actual presidente de la compañía de videojuegos From Software.​ Miyazaki empezó a trabajar en From Software como programador en el 2004, y después de trabajar en la saga Armored Core, se hizo conocido por crear la franquícia Souls. Aunque Miyazaki ha dirigido los dos primeros videojuegos de la serie, decidió tomar un papel menos activo en el desarrollo de Dark Souls II, supervisando el proyecto mientras Tomohiro Shibuya y Yui Tanimura se encargaron de la co-dirección."},{"page_url":"https://vi.wikipedia.org/wiki/Prajadhipok","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/King_Chulalongkorn.jpg","page_title":"Prajadhipok","context_page_description":"Phra Bat Somdet Phra Poramintharamaha Prajadhipok Phra Pok Klao Chao Yu Hua, hay Rama VII, là quân chủ thứ bảy của vương triều Chakri tại Xiêm. Ông là vị quân chủ chuyên chế cuối cùng, cũng là vị quân chủ lập hiến đầu tiên của quốc gia. Triều đại của ông là một thời kỳ sóng gió tại Xiêm với các biến đổi to lớn về chính trị và xã hội trong cuộc cách mạng năm 1932. Ông là vị quân chủ duy nhất của Xiêm thoái vị cho đến nay."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%AE%9C%E8%98%AD%E7%B8%A3%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Old_Tsau_Ling_Tunnel.jpg","page_title":"宜蘭縣文化資產","context_page_description":"宜兰县文化资产是位于台湾宜兰县的古迹与历史建筑等文化资产，以下的文化资产均收录在中华民国文化部文化资产局网站里。"},{"page_url":"https://lt.wikipedia.org/wiki/Daugiaspalv%C4%97s_e%C5%A1er%C5%BEuv%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Aulonocara_hansbaenschi_RB3.jpg","page_title":"Daugiaspalvės ešeržuvės","context_page_description":"Daugiaspalvės ešeržuvės, arba ciklidai – ešeržuvių būrio žuvų šeima, kuriai priklauso spalvingos gėlavandenės žuvys.\\nNeretai auginama akvariumuose kaip dekoratyvinės žuvys.\\nŠeimoje yra apie 1700 rūšių."},{"page_url":"https://fr.wikipedia.org/wiki/Chevrolet_Bel_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/1958_chevy_bel_air_2014-06-26_21-42.jpg","page_title":"Chevrolet Bel Air","context_page_description":"La Chevrolet Bel Air est une voiture du constructeur automobile américain General Motors sous la marque Chevrolet. Elle fut produite de 1950 à 1981 durant sept générations différentes. Le dernier modèle fut vendu uniquement au Canada. Initialement, seuls les modèles Hardtops deux portes dans la gamme Chevrolet étaient désignés par le nom Bel Air de 1950 à 1952, à la différence des modèles StyleLine et FleetLine pour le reste de la gamme. À partir de 1953, le nom désigna aussi d'autres carrosseries. La Bel Air a continué avec diverses autres désignations de niveau de finition jusqu'à ce que la production aux États-Unis cesse en 1975. La terminologie Bel Air continua d'être utilisée au Canada pour son marché intérieur jusqu'en 1981.\\nLe nom de Bel Air, vient d'un quartier huppé de la ville de Los Angeles.\\nUn concept car de la marque reprenant le nom Bel Air, fut présenté lors du Salon international de l'automobile d'Amérique du Nord de 2002 mais ne fut jamais commercialisé."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%84%B1%E7%9A%AE%E5%8B%95%E7%89%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Eoperipatus_totoro.jpg","page_title":"脱皮動物","context_page_description":"脱皮動物は冠輪動物と共に前口動物を二分する動物の大分類群で、節足動物、線形動物などの動物門を含む。\\nAguinaldoらにより1997年に設定されたが、これは主として18SリボソームRNA遺伝子の系統樹に基づいている。\\n形態的にはクチクラ由来の外骨格を持ち脱皮を行うという共通点を持っており、古く形態学的特徴から設定された Ecdysozoaにほぼ相当する。\\n最も重要な共通点は体表の上皮を覆う3重のクチクラで、これが成長にともなう定期的な脱皮によって新生する。運動のための繊毛は持たず、精子はアメーバ状で、胚は一般の前口動物の特徴とされる螺旋卵割を行わない。そのほかにもいくつかの共通の性質が見られる。\\n脱皮動物は以下の動物門から構成される。\\n節足動物門 Arthropoda\\n有爪動物門 Onychophora\\n緩歩動物門 Tardigrada\\n動吻動物門 Kinorhyncha\\n鰓曳動物門 Priapulida\\n胴甲動物門 Loricifera\\n線形動物門 Nematoda\\n類線形動物門 Nematomorpha\\n腹毛動物門などもこれに含まれる可能性があるが、共通の性質を欠いており、別の群とされている。\\n節足動物・有爪動物・緩歩動物は体が体節から構成されている点から、かつては環形動物に近いと考えられていた。これらは前口動物であり、螺旋卵割や裂体腔、はしご形神経系などを共有するまとまった群であると考えられていたが、現在ではそれらの共通点である体節制は別個の系統でそれぞれ独立に獲得されたと考えられている。"},{"page_url":"https://pl.wikipedia.org/wiki/Kruki_(okr%C4%99g_szawelski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Kriukuherbas.png","page_title":"Kruki (okręg szawelski)","context_page_description":"Kruki – miasteczko na Litwie, położone w okręgu szawelskim i w rejonie janiskim, w pobliżu granicy z Łotwą. Liczy 602 mieszkańców."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Pfronten","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Pfronten354_Achtalstr_17.JPG","page_title":"Liste der Baudenkmäler in Pfronten","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Gemeinde Pfronten zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nAlte Ansichten der Anwesen sind in den Mitteilungsblättern des Heimatvereins Pfronten bei der jeweiligen Hausgeschichte veröffentlicht."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD-%D0%BA%D0%BE%D1%81%D1%82%D1%83%D1%80%D0%BD%D0%B8%D1%86%D0%B0_(%D0%A3%D0%B4%D0%BE%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%D0%92%D0%B8%D0%BA%D0%B8%D0%B5%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%98%D0%B0_%D0%91%D0%BE%D1%98%D0%BC%D0%B8%D1%98%D0%B0_237.jpg","page_title":"Спомен-костурница (Удово)","context_page_description":"Спомен-костурница во Удово — спомен-костурница и православен параклис во валандовското село Удово. Објектот е сместен на влезот од селото, од десната страна покрај патот кој води од селото Јосифово, на височинка која доминира во однос на остатокот од селото. Спомен-костурницата е подигната во чест на загинатите српски војници во валандовско-удовската акција на Велики петок, 20 март 1915 година, како и на останатите загинати српски војници во ова подрачје во периодот на Првата светска војна.\\nСпомен-костурницата денес е заштитена со Законот за заштита на културното наследство на Македонија."},{"page_url":"https://en.wikipedia.org/wiki/Postage_stamps_and_postal_history_of_Eastern_Rumelia","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/StampEasternRumelia1885Michel18II.JPG","page_title":"Postage stamps and postal history of Eastern Rumelia","context_page_description":"Eastern Rumelia or Eastern Roumelia was an autonomous province in the Ottoman Empire from 1878 to 1908; however, it was under Bulgarian control beginning in 1885. The province is remembered today by philatelists for having issued postage stamps from 1881 on, although a postcard was issued locally for internal use in 1880.\\nThe 1878 Treaty of Berlin provided for the Ottoman Empire to issue special stamps for Eastern Rumelia. However, they were slow to do so. In 1880, in part a reaction to the local postcard, the Turkish government sent some 50,000 piasters worth of Turkish stamps overprinted with \\"ROUMELIE / ORIENTALE\\" in an oval. The Eastern Rumelian government found these to be unsatisfactory in presenting the province as an autonomous region, and refused to issue them. A compromise was reached, new stamps specifically printed for Eastern Rumelia were sent from Constantinople and both versions were issued on 16 January 1881.\\nOverprints on stamps of Turkey were made locally. First was an \\"R.O.\\" that was stamped both on regular Turkish stamps and the oval overprinted ones. This was done in Philippopolis. In addition, a pattern of bars was sometimes used."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BB%9At_Scotch_bonnet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/A_Scotch_Bonnet.jpg","page_title":"Ớt Scotch bonnet","context_page_description":"Ớt Scotch bonnet, còn được gọi là ớt bonney, hoặc ớt đỏ Caribbean, là một loại ớt được đặt tên giống với mũ shanter của tam o '. Nó có nguồn gốc từ các đảo Caribbean và Trung Mỹ. Hầu hết các quả Scotch bonnet có mức nhiệt là 80.000-400.000 đơn vị Scoville. Để so sánh, hầu hết ớt jalapeño có mức nhiệt từ 2.500 đến 8.000 trên thang Scoville. Tuy nhiên, các loại ớt Scotch bonnet ngọt hoàn toàn được trồng trên một số hòn đảo Caribbean, được gọi là ớt cachucha.\\nNhững quả ớt này được sử dụng để làm hương vị nhiều món ăn và món ăn khác nhau trên toàn thế giới và thường được sử dụng trong nước sốt và gia vị nóng. Scotch Bonnet có hương vị ngọt ngào và hình dạng stouter, khác biệt với habanero tương đối mà chúng thường bị nhầm lẫn, và cung cấp cho các món ăn lạng và các món ăn Caribê khác với hương vị độc đáo của chúng. Scotch bonnets chủ yếu được sử dụng trong các món ăn ở Tây Phi, Antiguan, Kittiti / Nevisian, Anguilan, Dominican, St. Lucian, St Vincentian, Grenadian, Trinidadian, Jamaica, Barbadian, Guyan, Surinamese, Haiti và Cayman trong các công thức nấu ăn Caribbean khác."},{"page_url":"https://ro.wikipedia.org/wiki/Sauli_Niinist%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Sauli_Niinist%C3%B6_Senate_of_Poland_2015.JPG","page_title":"Sauli Niinistö","context_page_description":"Sauli Väinämö Niinistö este un om politic finlandez din Partidul Coaliția Națională. El este președintele Finlandei, preluând funcția la data de 1 martie 2012, când a devenit primul președinte al țării promovat de partidul său de la Juho Kusti Paasikivi, al cărui mandat s-a încheiat în 1956.\\nEducat ca avocat, Niinistö a fost ministru de finanțe între 1996 și 2003 și candidat al Partidului Coaliția Națională la alegerile prezidențiale din 2006. A fost președinte al parlamentului Finlandei între 2007 și 2011 și președinte de onoare al Partidului Popular European din 2002. El este și președinte al Asociației de Fotbal din Finlanda.\\nNiinistö a fost candidat din partea Partidului Coaliția Națională la alegerile prezidențiale din 2012. Obținând 37% din voturi în primul tur, a intrat în al doilea tur de scrutin împreună cu Pekka Haavisto de la Liga Verzilor. În acest al doilea tur, a obținut 62,6% din voturi."},{"page_url":"https://gl.wikipedia.org/wiki/Lista_das_%C3%B3peras_m%C3%A1is_importantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Charles_near_piano.jpg","page_title":"Lista das óperas máis importantes","context_page_description":"O renacemento da presenza da ópera no mundo da música, decote grazas ás gravacións, supuxo un considerable incremento do repertorio. Antes, os teatros ofrecían sempre os mesmos títulos, limitando a cincuenta ou como moito a cen as obras que ofrecían regularmente. Porén, actualmente non para de medrar o número de óperas redescubertas que se foron incorporando aos circuítos operísticos.\\nEsta lista de óperas máis importantes segue o criterio dos expertos que se mostran no apartado de bibliografía consultada e pretende mostrar todas aquelas óperas que se interpretan con frecuencia, tiveron un éxito considerable na súa estrea, ou ben pasaron á historia por algún motivo que as fixo notables. As óperas da lista cobren tódolos xéneros importantes, e inclúen tódalas óperas interpretadas regularmente, a partir do século XVII as obras de Monteverdi, Cavalli, e Purcell, ata finais do século XX as óperas de Messiaen, Berio, Glass, Adams, Birtwistle, e Weir. Os comentarios que acompañan a cada ópera ofrecen unha breve explicación de por que se considerou importante."},{"page_url":"https://an.wikipedia.org/wiki/Werner_M%C3%B6lders","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bundesarchiv_Bild_183-L09694%2C_Werner_M%C3%B6lders.jpg","page_title":"Werner Mölders","context_page_description":"Werner Mölders, naixito de Gelsenkirchen o 18 de marzo de 1913 y muerto en Breslau o 22 de noviembre de 1941, estió un piloto melitar alemán d'a Luftwaffe mientres o Tercer Reich, que partecipó en a Guerra Civil Espanyola con a Lechión Condor y que tamién partecipó en a Segunda Guerra Mundial, plegando dica o ran d'Oberst, mandando escuadrillas de cazata."},{"page_url":"https://fr.wikipedia.org/wiki/Corylopsis_willmottiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Corylopsis_willmottiae_flower_%C3%96BG_Bayreuth.jpg","page_title":"Corylopsis willmottiae","context_page_description":"Corylopsis willmottiae est un petit arbuste de la famille des Hamamelidacées originaire de Chine.\\nNom chinois : 四川蜡瓣花."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monastic_houses_in_Hungary","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Premontrei_pr%C3%A9posts%C3%A1gi_templom_romja_%287623._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29.jpg","page_title":"List of monastic houses in Hungary","context_page_description":"Monastic houses in Hungary include abbeys, priories and friaries, among other monastic religious houses."},{"page_url":"https://uk.wikipedia.org/wiki/FKBP4","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Protein_FKBP4_PDB_1n1a.png","page_title":"FKBP4","context_page_description":"FKBP4 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 12-ї хромосоми. Довжина поліпептидного ланцюга білка становить 459 амінокислот, а молекулярна маса — 51 805.\\nКодований геном білок за функціями належить до шаперонів, ізомераз, ротамаз.\\nЛокалізований у цитоплазмі, цитоскелеті, ядрі, мітохондрії, клітинних відростках."},{"page_url":"https://it.wikipedia.org/wiki/Kogon_(Distretto_di_Kogon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Naqschbandi-Mausoleum.JPG","page_title":"Kogon (Distretto di Kogon)","context_page_description":"Kogon è il capoluogo del distretto di Kogon della regione di Bukhara, in Uzbekistan. Si trova 10 km a est di Bukhara a un'altitudine di 221 m s.l.m., aveva 48.000 abitanti al censimento del 1989 e una popolazione calcolata di 87.612 abitanti per il 2010.\\nLa città ha una stazione che serve la città di Bukhara sulla linea ferroviaria transcaspiana che proviene dal Turkmenistan e collega Türkmenbaşy, sul mar Caspio, e Aşgabat a Tashkent."},{"page_url":"https://ca.wikipedia.org/wiki/Limia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Limia_perugiae_01.jpg","page_title":"Limia","context_page_description":"Limia és un gènere de peixos de la família dels pecílids i de l'ordre dels ciprinodontiformes."},{"page_url":"https://sv.wikipedia.org/wiki/Scientrier","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Map_commune_FR_insee_code_74262.png","page_title":"Scientrier","context_page_description":"Scientrier är en kommun i departementet Haute-Savoie i regionen Auvergne-Rhône-Alpes i sydöstra Frankrike. Kommunen ligger i kantonen Reignier-Ésery som tillhör arrondissementet Saint-Julien-en-Genevois. År 2009 hade Scientrier 1 036 invånare."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BD%D1%8C_%D1%81%D1%83%D1%80%D0%BA%D0%B0_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bill_Murray_TIFF_2012.jpg","page_title":"День сурка (фильм)","context_page_description":"«День сурка́» — комедия Гарольда Рамиса по сценарию Дэнни Рубина. Шестой совместный фильм Гарольда Рамиса и Билла Мюррея, работа, после которой творческий дуэт распался. Картина получила премию BAFTA за лучший сценарий, а впоследствии была включена в Национальный реестр фильмов США.\\nКартина снималась в Вудстоке в 1992 году, в прокат вышла 12 февраля 1993 года. Сюжет картины повествует об истории метеоролога Фила Коннорса, попавшего во временну́ю петлю во время ежегодного празднования Дня сурка в городке Панксатони. Только переосмыслив своё отношение к жизни, герой завоёвывает внимание любимой женщины и вырывается из петли. Критики высоко оценили актёрскую игру, сценарий, философский контекст и моральный посыл картины. Особенно был отмечен авторский замысел — скрыть от зрителя причины, вызвавшие временну́ю аномалию. Фильм успешно прошёл в прокате, только по США и Канаде собрав около 71 млн долларов.\\nКонцепция временной петли, построения героем «идеального дня» и моральное преображение героя стали хорошей иллюстрацией для многих религиозных доктрин, философов; используются в психологии и экономике. Картина породила множество подражаний."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%AA%D9%84%D8%AC_%DA%86%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Indus_river.svg","page_title":"ستلج چایی","context_page_description":"ستلج چایی هیندوستان اؤلکه‌سینده یئرلشن بیر چای. اۇزونلوغو۱۵۰۰ کیلومتر دیر."},{"page_url":"https://it.wikipedia.org/wiki/Veggenti","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Michelangelo_-_Sistine_Chapel_-_Ezekiel%2C_detail_-_1510.jpg","page_title":"Veggenti","context_page_description":"La serie dei Veggenti decora i peducci della volta della Cappella Sistina. Si tratta di una serie di affreschi con Profeti e Sibille, realizzati da Michelangelo Buonarroti tra il 1508 e il 1512. Ciascuno ha un'altezza variabile tra i 260 e i 298 cm."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Saskatchewan_College_of_Agriculture_and_Bioresources","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/AgricultureBioresourcesCollegeUofS.jpg","page_title":"University of Saskatchewan College of Agriculture and Bioresources","context_page_description":"The College of Agriculture and Bioresources is a faculty at the University of Saskatchewan in Saskatoon, Saskatchewan.\\nIt has an annual budget of $38 million and an enrolment of approximately 1,000 students studying at the diploma, undergraduate degree, graduate degree and postgraduate levels. The College has approximately 350 employees, including faculty, research scientists, administrative and scientific support staff."},{"page_url":"https://de.wikipedia.org/wiki/Polnische_Mark","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/1_mp-23-08-1919.jpg","page_title":"Polnische Mark","context_page_description":"Polnische Mark war Landeswährung im sogenannten Regentschaftskönigreich Polen zwischen 1916 und 1918 und in der Zweiten Polnischen Republik zwischen 1918 und 1924. Am 14. April 1924 wurde die infolge einer Hyperinflation wertlos gewordene Währungseinheit durch den goldgedeckten Złoty ersetzt, der zum Umtauschkurs 1 Złoty = 1.800.000 polnische Mark eingeführt wurde. 1 Dollar war nun 5,18 Złoty wert."},{"page_url":"https://da.wikipedia.org/wiki/Audi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/2007_Audi_A5_side.JPG","page_title":"Audi","context_page_description":"Audi er en bilfabrikant med hovedsæde i Ingolstadt i Tyskland og blev grundlagt 25. april 1910 af August Horch.\\nI 1932 sluttede Audi sig sammen med tre andre tyske bilproducenter og dannede Auto Union. Det velkendte logo er fire ringe, der repræsenterer producenterne Audi, Horch, DKW og Wanderer. Fra 1977 er alle Auto Union-biler markedsført under Audi-navnet.\\nAudis slogan er \\"Vorsprung durch Technik\\", der repræsenterer August Horchs pionérånd.\\nAudi er i dag en del af VAG-koncernen. Audi kørte også med i 24-timers racerløbet i Le Mans og har vundet 13 gange. Bilproducenten meldte sig dog ud af 24-timers løbet tilbage i 2016, eftersom de hellere ville fokusere på deres produktion, samt lancere en 100% elektrisk bil i slutningen af 2018."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%A4%D7%90_%D7%A8%D7%95%D7%9E%D7%99%D7%90%D7%95_146","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Alfa_Romeo_146_silver.jpg","page_title":"אלפא רומיאו 146","context_page_description":"אלפא רומיאו 146 היא מכונית משפחתית קטנה המוגדרת כמכונית קומפקטית, תוצרת יצרנית הרכב האיטלקית אלפא רומיאו אשר יוצרה באיטליה בין השנים 1995–2001."},{"page_url":"https://az.wikipedia.org/wiki/G%C3%BCrc%C3%BC_m%C9%99tb%C9%99xi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Kharcho_meat_soup.jpg","page_title":"Gürcüstan mətbəxi","context_page_description":"Gürcüstan mətbəxi — dünyanın zəngin və dadlı mətbəxlərindən biri."},{"page_url":"https://pl.wikipedia.org/wiki/Potoccy_herbu_Pilawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/JanMatejko.AlfredPotocki.ws.jpg","page_title":"Potoccy herbu Pilawa","context_page_description":"Potoccy – polski ród magnacki herbu Pilawa."},{"page_url":"https://ms.wikipedia.org/wiki/Gunung_Cheaha","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Alabama4.jpg","page_title":"Gunung Cheaha","context_page_description":"Gunung Cheaha, adalah puncak semulajadi tertinggi di negeri Alabama, Amerika Syarikat.. Ia terletak beberapa kilometer barat laut bandar Delta di Taman Negara Cheaha, yang menawarkan rumah tumpangan, restaurant, dan kemudahan lain.\\nTitik tertinggi ditanda dengan mercu tanda USGS dihadapan Menara Bunker, bangunan batu Kor Pemuliharaan Tamadun"},{"page_url":"https://vi.wikipedia.org/wiki/Agra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Taj_Mahal_in_India.jpg","page_title":"Agra","context_page_description":"Agra là một thành phố nằm bên sông Yamuna, thuộc bang Uttar Pradesh, Ấn Độ. Nó nằm cách thủ phủ bang Lucknow 378 kilômét về phía tây, cách thủ đô New Delhi 206 kilômét về phía nam, cách Mathura 58 kilômét về phía nam và cách Gwalior 125 kilômét về phía bắc. Agra là thành phố đông dân thứ tư của Uttar Pradesh, và thứ 24 của toàn Ấn Độ.\\nAgra là một điểm đến du lịch nổi tiếng nhờ những công trình thời kì Mughal, nổi bật nhất là Tāj Mahal, pháo đài Agra và Fatehpūr Sikrī, cả ba đều là di sản thế giới UNESCO. Agra là một phần của tam giác vàng du lịch của Ấn Độ, cùng với Delhi và Jaipur; và của vòng cung di sản Uttar Pradesh, cùng Lucknow và Varanasi. Agra nằm trong vùng văn hóa Braj.\\nNơi đây được nhắc tới lần đầu trong Mahābhārata, dưới tên Agrevaṇa."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%B8%E0%B9%80%E0%B8%A1%E0%B8%98_%E0%B8%8A%E0%B8%B8%E0%B8%A1%E0%B8%AA%E0%B8%B2%E0%B8%A2_%E0%B8%93_%E0%B8%AD%E0%B8%A2%E0%B8%B8%E0%B8%98%E0%B8%A2%E0%B8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Photo_of_Sumet_-_6.jpg","page_title":"สุเมธ ชุมสาย ณ อยุธยา","context_page_description":"สุเมธ ชุมสาย ณ อยุธยา เป็นสถาปนิก จิตรกร ศิลปินชาวไทย และศิลปินแห่งชาติ สาขาศิลปะสถาปัตยกรรม ประจำปี 2541 สุเมธเป็นที่รู้จักกันดีในฐานะสถาปนิกที่นำเสนองานออกแบบสมัยใหม่ ที่มีความโดดเด่นไม่ว่าจะเป็น \\"ตึกหุ่นยนต์\\" อาคารและผังแม่บทมหาวิทยาลัยธรรมศาสตร์ รังสิต อาคารเนชั่น อาคารอาคารศรีสวรินทิรา โรงพยาบาลศิริราช ศูนย์วิทยาศาสตร์เพื่อการศึกษา โรงแรมเอส 31 สุขุมวิท เป็นต้น\\nสุเมธเกิดและเติบโตในกรุงเทพมหานคร โดยเป็นพี่ชายแท้ๆของ ดร.อาจอง ชุมสาย ณ อยุธยา สุเมธได้เข้าศึกษาระดับมัธยมศึกษาจากโรงเรียนสวนกุหลาบวิทยาลัย ต่อมาเข้ารับการศึกษาต่อที่โรงเรียนกรุงปารีส แล้วจึงย้ายไปศึกษาที่โรงเรียนเวลลิ่งบาเร่อร์ ที่ประเทศอังกฤษ ต่อมาได้เข้ารับการศึกษาในคณะสถาปัตยกรรมศาสตร์ จากมหาวิทยาลัยเคมบริดจ์ ตั้งแต่ปริญญาตรีจนจบปริญญาเอก รวมอยู่ในยุโรปกว่า 17 ปี แล้วจึงเข้ารับราชการที่กรมโยธาธิการและสำนักผังเมือง กระทรวงมหาดไทย จนกระทั่งลาออกมาก่อตั้งบริษัทสถาปนิกเป็นของตนเอง"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D1%8C%D0%BE%D0%B2%D0%B8%D0%B9_%D1%88%D0%BF%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/2005feldspar.PNG","page_title":"Польовий шпат","context_page_description":"Польові́ шпа́ти — група найпоширеніших породотвірних мінералів класу силікатів каркасної структури, які характеризуються порівняно високою твердістю.\\nПольовики — староукраїнська назва польових шпатів."},{"page_url":"https://sh.wikipedia.org/wiki/Hybe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Hybe_and_the_High_Tatras.jpg","page_title":"Hybe","context_page_description":"Hibe je naseljeno mjesto u okrugu Liptovski Mikulaš, u Žilinskom kraju, Republika Slovačka."},{"page_url":"https://lv.wikipedia.org/wiki/Autoce%C4%BC%C5%A1_P92","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/P92_Iecav%C4%81.JPG","page_title":"Autoceļš P92","context_page_description":"P92 autoceļš Iecava—Stelpe ir Latvijas reģionālais autoceļš, kas savieno autoceļu A7 Iecavā ar autoceļu P89 pie Stelpes. Autoceļa kopējais garums ir 24,6 km, no tiem 8,1 km klāts ar asfaltbetona segumu, bet pārējais — ar grants segumu. Ceļš šķērso Iecavas un Vecumnieku novadus."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D1%82%D0%B5%D1%81%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Cortes_Catalanas.jpg","page_title":"Кортеси","context_page_description":"Кóртеси – в средновековна Испания са регионални съсловно-представителни събрания, а от XIX век насам така се нарича парламентът в Испания и Португалия. Първите Кортеси са създадени през 1137 г. в кралство Леон. Първоначално в Кортесите имали право да участват само дворяните и духовенството. Гражданите получават представителство едва през 1188 г.\\nВ средновековните иберийски кралства кралското управление никога не е абсолютно, а е под влиянието на аристокрацията и е ограничено от Кортесите и техните закони. Например в кралство Кастилия през XV в. съгласието им е абсолютно необходимо за въвеждането на нови данъци. Свикването на трите съставни части – благородници, духовенство и представителите на градовете – става винаги поотделно, като всяка представя заключението си, а те добиват качеството на закон след одобрението на краля и вписване в регистър на Кортесите.\\nЗначението на Кортесите нараства отново през 18 век и по време на Полуостровната война срещу Наполеон Кортесите в Кадис играят ролята на испанско правителство в изгнание и изготвят първата испанска конституция от 1812 г., една от най-либералните за времето си."},{"page_url":"https://tr.wikipedia.org/wiki/Deniz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/The_tube.jpg","page_title":"Deniz","context_page_description":"Deniz, bir okyanus ile bağı olan ve büyük bir alanı kaplayan ve genellikle tuzlu olan su kütlesi. Terim genellikle okyanus terimi yerine de kullanılır.\\nDenizler Dünya yüzeyinin % 70'ini kaplamaktadır. Yeryüzünde kapladıkları 1.338 milyar km³ hacimle dünya üzerindeki su varlığının % 96,5'ini oluşturmaktadırlar. Ancak, deniz suyu ortalama % 3,5 oranında tuz içerdiğinden, hâlen oldukça pahalı olan arıtma yöntemleri uygulanmadan içme suyu olarak kullanılamamaktadır.\\nDenizler üzerinden gerçekleştirilen ticaret, hava yoluyla taşımacılığın gittikçe gelişmesine karşın, öneminden pek bir şey yitirmemiştir. Dünya ticaretinde aktarılan malların % 92'si, yılda 5,7 milyar ton, deniz yolu üzerinden taşınmaktadır."},{"page_url":"https://pt.wikipedia.org/wiki/Col%C3%A9gio_Padre_de_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Unileste_na_d%C3%A9cada_de_1990%2C_Coronel_Fabriciano_MG.JPG","page_title":"Colégio Padre de Man","context_page_description":"O Colégio Católica Padre de Man, mais conhecido como Colégio Padre de Man, é uma instituição de ensino do município brasileiro de Coronel Fabriciano, no interior do estado de Minas Gerais. Foi criado como parte das obras sociais da Congregação Padres do Trabalho em 1967. Está situado no campus principal do Centro Universitário Católica do Leste de Minas Gerais e é mantido pela União Brasileira de Educação Católica, oferecendo a educação infantil e os ensinos fundamental, médio e técnico."},{"page_url":"https://pl.wikipedia.org/wiki/Klon_(powiat_szczycie%C5%84ski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/1._Widok_z_wie%C5%BCy_przeciwpo%C5%BCarowej_w_Klonie_%28powiat_szczycie%C5%84ski%29.jpg","page_title":"Klon (powiat szczycieński)","context_page_description":"Klon – wieś w Polsce położona w województwie warmińsko-mazurskim, w powiecie szczycieńskim, w gminie Rozogi, znajdująca się przy szosie Wielbark – Rozogi. W latach 1975–1998 miejscowość administracyjnie należała do województwa ostrołęckiego.\\nWieś mazurska, założona na planie ulicówki z zachowaną, zabytkową zabudową drewnianą, pochodzącą z końca XIX i początku XX w. oraz murowanym kościołem."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9thode_des_six_chapeaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/6_chapeaux.jpg","page_title":"Méthode des six chapeaux","context_page_description":"La méthode des 6 chapeaux extraite de l'ouvrage Six chapeaux pour penser est une méthode de management personnel ou de groupe, développée par Edward de Bono, permettant de traiter les problèmes dont une des conséquences est d'éviter la censure des idées nouvelles, dérangeantes, inhabituelles.\\nPour cela, chaque participant prend un « chapeau » d'une couleur particulière, lui assignant ou lui reconnaissant un rôle.\\nCe chapeau peut changer durant la réunion. Il peut aussi être identique à celui d'autres participants."},{"page_url":"https://de.wikipedia.org/wiki/Atlantischer_Hering","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Hdgs_Fishing.gif","page_title":"Atlantischer Hering","context_page_description":"Der Atlantische Hering ist einer der häufigsten Fische der Welt, einer der bedeutendsten Speisefische und gehört zur Gattung der Echten Heringe. Er wird seit Menschengedenken besonders an seinen Laichplätzen gefangen. Viele Städte wurden in der Nähe der Laichplätze und Durchzugsgebiete gegründet. Für die Hanse war der Atlantische Hering eines der wichtigsten Handelsgüter.\\nNoch bis in das 20. Jahrhundert hinein war der Atlantische Hering so häufig, dass er als „Arme-Leute-Essen“ galt. Heute sind die Bestände durch starke Befischung und ökologische Probleme in der Ostsee deutlich zurückgegangen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%82%A2%E3%83%BC%E3%83%8B%E3%83%83%E3%83%9D%E3%83%B3%E3%83%8D%E3%83%83%E3%83%88%E3%83%AF%E3%83%BC%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/De_Havilland_Canada_DHC-8-300_%28ANA%29_804k.jpg","page_title":"エアーニッポンネットワーク","context_page_description":"株式会社エアーニッポンネットワークは、かつて存在した全日本空輸系列の日本の航空会社。通称はA-net。ターボプロップ機を運航していた。現在のANAウイングスの直接の前身である。"},{"page_url":"https://nl.wikipedia.org/wiki/Onze-Lieve-Vrouwekerk_(Sint-Truiden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Sint-Truiden%2C_OLV-kerk02.jpg","page_title":"Onze-Lieve-Vrouwekerk (Sint-Truiden)","context_page_description":"De Onze-Lieve-Vrouwekerk, ook wel Kerk van Onze-Lieve-Vrouw-Tenhemelopneming of Onze-Lieve-Vrouw-Hemelvaartkerk, is een deels gotisch, deels neogotisch kerkgebouw in het centrum van de Belgisch Limburgse stad Sint-Truiden. De kerk is de hoofdparochiekerk van Sint-Truiden en herbergt onder andere een belangrijke kerkschat."},{"page_url":"https://fr.wikipedia.org/wiki/Reine_de_Cornouaille","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Premi%C3%A8re_f%C3%AAte_des_Reines_1923.jpg","page_title":"Reine de Cornouaille","context_page_description":"La Reine de Cornouaille est une élection destinée à choisir une représentante du pays historique de Cornouaille, parmi les candidates élues dans les cercles celtiques. Ce concours ouvre droit, pour la gagnante, au titre annuel du même nom. Créé en 1923 par Louis Le Bourhis, il est à la base de l'actuel festival de Cornouaille."},{"page_url":"https://oc.wikipedia.org/wiki/Destral","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Pr%C3%A9forme_de_hache_223.1_%282%29.jpg","page_title":"Destral","context_page_description":"Una destral, es un esplech format d'una lama de metal estacada a un margue de fusta. Es mai sovent utilizada per copar de fusta, mas foguèt tanben emplegada coma arma. Los pompièrs l'utilizan se cal per dubrir de pòrtas."},{"page_url":"https://es.wikipedia.org/wiki/Escamandro","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Iliad41.jpg","page_title":"Escamandro","context_page_description":"En la mitología griega, Escamandro era el dios del río que discurría junto a Troya."},{"page_url":"https://ceb.wikipedia.org/wiki/Nemipterus_randalli","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Nemipterus_randalli.jpg","page_title":"Nemipterus randalli","context_page_description":"Espesye sa isda ang Nemipterus randalli. Una ning gihulagway ni Russell ni adtong 1986. Ang Nemipterus randalli sakop sa kahenera nga Nemipterus sa kabanay nga Nemipteridae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ast.wikipedia.org/wiki/Comerciu_transa%E1%B8%A5ariano","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Oasis-Bilma.jpg","page_title":"Comerciu transaḥariano","context_page_description":"El comerciu transahariano referir al tráficu de mercancíes al traviés del Sahara hasta algamar África Subsahariana dende la mariña del Norte d'África, Europa o'l Llevante. Magar esistió dende tiempos prehistóricos, l'apoxéu d'esta ruta comercial producir ente los sieglos VIII hasta'l XVI."},{"page_url":"https://en.wikipedia.org/wiki/What_You_Waiting_For%3F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/GwenStefaniJonesBeach.jpg","page_title":"What You Waiting For?","context_page_description":"\\"What You Waiting For?\\" is a song by American singer Gwen Stefani from her debut solo studio album, Love. Angel. Music. Baby. Written by Stefani and Linda Perry, the song is the album's opening track and was released as Stefani's debut solo single. \\"What You Waiting For?\\" details Stefani's lack of inspiration, fear of producing the album, as well as her reaction to pressures exerted by her record label. It is primarily an electropop song and introduces Stefani's four back-up dancers, the Harajuku Girls, who had a major input into the album's production.\\n\\"What You Waiting For?\\" was released as the album's lead single; according to Stefani, as an \\"explanation for doing the record\\". The song was well received by critics, and was frequently cited as a highlight of the album. The single was commercially successful, topping the chart in Australia and reaching the top 10 in several countries. It was certified gold in the United States, and was nominated for Best Female Pop Vocal Performance at the 47th Annual Grammy Awards. The song has been remixed a number of times, and was covered by the indie rock band Franz Ferdinand and singer Marina Diamandis."},{"page_url":"https://fi.wikipedia.org/wiki/Vapauden_palkinto","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/DavidSarnoff_1922.jpg","page_title":"Vapauden palkinto","context_page_description":"Vapauden palkinto on kansainvälinen humanistipalkinto, joka myönnetään pakolaisten ja vapauden puolesta työskenneelle henkilölle. International Rescue Committee on jakanut palkintoa vuodesta 1957 lähtien."},{"page_url":"https://de.wikipedia.org/wiki/Feodora_von_D%C3%A4nemark","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Schaeggergaarden-offisiell.jpg","page_title":"Feodora von Dänemark","context_page_description":"Prinzessin Feodora von Dänemark war ein Mitglied der dänischen Königsfamilie und damit Angehörige des Hauses Schleswig-Holstein-Sonderburg-Glücksburg, einer Nebenlinie des Hauses Oldenburg.\\nIhr vollständiger Vorname lautete Feodora Louise Caroline Mathilde Viktoria Alexandra Frederikke Johanne. Nach ihrer Heirat trug sie den Familiennamen Prinzessin zu Schaumburg-Lippe."},{"page_url":"https://nl.wikipedia.org/wiki/Elizabeth_Nourse","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Elisabeth_Nourse_Women.jpg","page_title":"Elizabeth Nourse","context_page_description":"Elizabeth Nourse was een Amerikaans kunstschilderes die het grootste deel van haar carrière werkte in Europa."},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%A9riph%C3%A9rique_informatique","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Dvdburner.jpg","page_title":"Périphérique informatique","context_page_description":"Un périphérique informatique est un dispositif connecté à un système de traitement de l'information central et qui ajoute à ce dernier des fonctionnalités."},{"page_url":"https://pt.wikipedia.org/wiki/Kuala_Lumpur","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Kuala_lumpur_panorama_from_charas.jpg","page_title":"Kuala Lumpur","context_page_description":"Kuala Lumpur, Cuala Lumpur, Quala Lumpur ou Cualalampur, ou frequentemente abreviada como K.L., é a capital e a maior cidade da Malásia. A cidade propriamente ocupa uma área de 244 quilômetros quadrados, tem uma população estimada de 1,6 milhões de habitantes em 2006. A Grande Kuala Lumpur, também conhecida como Vale Kelang, é uma aglomeração urbana com 7,2 milhões de pessoas. É a região metropolitana com o mais rápido crescimento do país, tanto em população quanto na economia.\\nO Parlamento da Malásia está localizado em Kuala Lumpur, fazendo dessa a capital legislativa do país. A cidade já foi a casa dos poderes executivo e judiciário do governo federal, mas eles estão se transferindo para Putrajaya desde 1999. Algumas seções do judiciário permanecem na capital. A residência oficial do rei da Malásia, o palácio Istana Negara, também está situada em Kuala Lumpur. A cidade é, também, o centro cultural e econômico do país, devido a sua posição tanto de capital quanto de principal cidade. Kuala Lumpur é reconhecida como uma cidade global, sendo a única da Malásia."},{"page_url":"https://nl.wikipedia.org/wiki/Heinrich_von_Kittlitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Kittlitz-Wappen_Hdb.png","page_title":"Heinrich von Kittlitz","context_page_description":"Heinrich von Kittlitz was een Duitse vogelkundige, natuuronderzoeker, ontdekkingsreiziger en illustrator. Hij werd vooral bekend om de nieuwe vogelsoorten die hij ontdekte tijdens een ontdekkingsreis rond de wereld van 1826 tot 1829 tijdens een expeditie in opdracht van de Russische Tsaar."},{"page_url":"https://es.wikipedia.org/wiki/Armada_Real_Australiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/HMAS_Canberra_%28LHD_02%29_at_berth_prior_to_commissioning.jpg","page_title":"Armada Real Australiana","context_page_description":"La Armada Real Australiana es la rama naval de la Fuerza de Defensa Australiana. A raíz de la Federación de Australia en 1901, las naves y los recursos de las armadas coloniales independientes se integraron en una fuerza nacional: Commonwealth Naval Forces. Originalmente concebida para la defensa local, a la Marina se le concedió el título de 'Royal Australian Navy' en 1911 y fue adquiriendo cada vez más responsabilidad en la defensa de la región.\\nLa Royal Navy británica continuó apoyando a la RAN y proporcionando medios de defensa oceánica en el Pacífico hasta los primeros años de la Segunda Guerra Mundial. Entonces, la rápida expansión de la guerra motivó la adquisición de grandes buques de superficie y la construcción de muchos buques de guerra y patrulleros. En la década que siguió a la guerra, la RAN adquirió un pequeño número de portaaviones, el último de ellos el HMAS Melbourne, dado de baja en 1982.\\nHoy en día, la RAN es una de las fuerzas navales más grandes y sofisticadas en la región del Pacífico, con una presencia significativa en el océano Índico, efectuando operaciones en todo el mundo en apoyo de las campañas militares y las misiones de mantenimiento de la paz."},{"page_url":"https://gl.wikipedia.org/wiki/Atol_Fangatau","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Fangatau.jpg","page_title":"Atol Fangatau","context_page_description":"Fangatau é un atol das Tuamotu na Polinesia Francesa. Está situado ao leste e ao centro do arquipélago, a 900 km ao nordés de Tahití."},{"page_url":"https://en.wikipedia.org/wiki/Hyrum,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Hyrum-Lake-Park.JPG","page_title":"Hyrum, Utah","context_page_description":"Hyrum is a city in Cache County, Utah, United States. The population was 7,609 at the 2010 census, with an estimated population of 8,403 in 2018. It is included in the Logan, Utah–Idaho Metropolitan Statistical Area."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AA%A8%EB%A9%98%ED%8A%B8_%EB%B6%84%EB%B0%B0%EB%B2%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/MomentDistributionMethod2.jpg","page_title":"모멘트 분배법","context_page_description":"모멘트분배법은 1930년 5월에 미국 일리노이 주립 대학교 어바나-샴페인의 하디 크로스 교수가 미국토목학회지의 논문 \\"Analysis of Continuous Frames by Distributing Fixed-End Moments\\"을 통해 발표한 부정정 구조해석방법으로, 반복적인 계산을 통해 연속보와 뼈대 구조의 절점 모멘트를 구할 수 있는 근사해법이다. 고정모멘트법으로도 불린다."},{"page_url":"https://cs.wikipedia.org/wiki/Pr%C5%AFzkumn%C3%BD_letoun","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Mosquito_600pix.jpg","page_title":"Průzkumný letoun","context_page_description":"Průzkumný letoun je vojenský letoun používaný k monitorování nepřátelské aktivity."},{"page_url":"https://eu.wikipedia.org/wiki/Biriketako_tronboenbolismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/SegandSubsegPE.png","page_title":"Biriketako tronboenbolismo","context_page_description":"Biriketako tronboenbolismoa biriketako arteria baten blokeo edo buxaduraren ondorioz gauzatzen da. Odol hodi hau oxigeno gutxiko odola eramango du bihotzetik biriketara, hau oxigenatzeko asmoz. Gehienetan, koaguloa gorputzeko beheko gorputz adarretan sortzen da eta biriketako arteriaraino garraiatua izaten da odolaren bidez. Maiztasun gutxiagoz, blokeoa aireak edo gantzak sortuko du.\\nHonen sintomak arnasteko ezintasuna, bularreko mina eta eztula egiterakoan odol jarioa izatea izan daitezke. Gainera, hankaren odol blokeoaren sintomak eman daitezke ere, hala nola; gorritasuna, beroa, hanka handitua izatea eta mina nabaritzea.\\nBuxadura honek biriketan eta bihotzean du eragina batez ere. Alde batetik, biriketako guneren batek ez du odola jasotzen, eta ondorioz ezin du hau oxigenatu. Ondorioz, eragin negatiboa izango du gorputzeko gainerako erraiek eta ehunek jasoko duten oxigeno mailan. Bestalde, bihotzak odola ponpatzen jarraituko du, eta blokeoaren ondorioz presioa igoko da biriketako arteriaren barruan, bihotzeko eskuin bentrikulua ahulduz.\\nBiriketako tronboenbolia 430,000 pertsonek pairatzen dute urtero Europan."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB%D1%8C%D1%86%D0%B1%D1%83%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Map_of_the_Salzburg_trolleybus.png","page_title":"Зальцбург","context_page_description":"За́льцбург — көнбайыш Австриялағы ҡала, Зальцбург федераль еренең баш ҡалаһы. Австрияла Вена, Граца һәм Линца ҡалаларынан һуң ҙурлығы буйынса дүртенсе урында.\\nЗальцбургтың Үҙәк тарихи өлөшө ЮНЕСКО-ның Бөтә донъя мираҫы исемлегенә индерелгән."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Gent/Ko","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/20111023_Gent_%280007%29.jpg","page_title":"Lijst van onroerend erfgoed in Gent/Ko","context_page_description":"Een overzicht van het onroerend erfgoed in Gent. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://oc.wikipedia.org/wiki/Tecnicas_de_produccion_del_fu%C3%B2c","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Thesaurus_opticus_Titelblatt.jpg","page_title":"Tecnicas de produccion del fuòc","context_page_description":"Existís nombrosas tecnicas de produccion del fuòc. Los sistèmas d'alucatges tradicionals se destrian en doas categorias màger:\\nlos procediments per friccion, utilizant l'escaufament produch per la friccion de dos troces de fusta;\\nlos procediments per percussion, utilizant las belugas produchas pel tust d'una ròca dura coma lo selze e d'un mineral de fèrre, coma la marcassita.\\nAmbedoas tecnicas modèrnas mai espandidas, respectivament lo batifòc e l'aluqueta, utilizan precisament los mèsmes principis."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kategorie-A-Bauwerke_in_East_Lothian","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Oldhamstocks_Kirk_-_geograph.org.uk_-_1229851.jpg","page_title":"Liste der Kategorie-A-Bauwerke in East Lothian","context_page_description":"Die Liste der Kategorie-A-Gebäude in East Lothian umfasst sämtliche in der Kategorie A eingetragenen Baudenkmäler in der schottischen Council Area East Lothian. Die Einstufung wird anhand der Kriterien von Historic Scotland vorgenommen, wobei in die höchste Kategorie A Bauwerke von nationaler oder internationaler Bedeutung einsortiert sind. In East Lothian sind derzeit 126 Bauwerke in der Kategorie A gelistet."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Aubin-Routot","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Saint-Aubin-Routot_-_mairie.JPG","page_title":"Saint-Aubin-Routot","context_page_description":"Saint-Aubin-Routot est une commune française située dans le département de la Seine-Maritime en région Normandie."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%82%E3%81%84%E3%81%A1%E8%88%AA%E7%A9%BA%E3%83%9F%E3%83%A5%E3%83%BC%E3%82%B8%E3%82%A2%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Location_map_Nagoya.jpg","page_title":"あいち航空ミュージアム","context_page_description":"あいち航空ミュージアムは、愛知県西春日井郡豊山町にある県立の航空博物館で、名古屋飛行場内の南西側、旧国際線ターミナルを改装したエアポートウォーク名古屋に隣接して設けられた。"},{"page_url":"https://de.wikipedia.org/wiki/Corral_(Chile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Corral%2C_2019_%2809%29.jpg","page_title":"Corral (Chile)","context_page_description":"Corral ist eine Stadt im Süden des südamerikanischen Anden-Staates Chile und liegt in der Región de los Ríos etwa 15 Kilometer westlich von Valdivia direkt am Pazifischen Ozean. Im Jahre 2005 hatte sie 5300 Einwohner."},{"page_url":"https://it.wikipedia.org/wiki/Raymond_J._Barry","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Raymond_J._Barry_by_Nathan_Morgan.jpg","page_title":"Raymond J. Barry","context_page_description":"Raymond John Barry è un attore statunitense."},{"page_url":"https://tr.wikipedia.org/wiki/Pisanello","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Pisanello_007.jpg","page_title":"Pisanello","context_page_description":"Pisanello, İtalyan Rönesansının ve Quattrocento döneminin seçkin ressamlarından biriydi. Guarino da Verona gibi şairler tarafından övülen Pisanello, döneminin hümanistlerince Cimabue, Fidias ve Praksiteles gibi ünlü isimlerle karşılaştırılmıştır.\\nPisanello, büyük duvar resimlerindeki muhteşem freskleri, portreleri, küçük şövale resimleri ve çizimleriyle tanınmaktadır. 15. yüzyılın ilk yarısının en önemli madalya portresi üreticisidir ve bu türü ortaya çıkardığı iddia edilmektedir.\\nVenedikli Doge, Vatikan'daki Papa ve Verona, Ferrara, Mantua, Milano, Rimini ve Napoli Kralı tarafından çalıştırılmış, Gonzaga ve Este ailelerinde yüksek saygınlık kazanmıştır.\\nPisanello'nun eserlerinin birçoğu hatalı şekilde Piero della Francesca, Albrecht Dürer, Leonardo da Vinci ve diğer sanatçılara atfedilmiştir. Resimlerinin çoğu yok olurken, çizimleri ve madalyalarının çoğu günümüze ulaşmıştır."},{"page_url":"https://nl.wikipedia.org/wiki/Sirawai","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Ph_locator_zamboanga_del_norte_sirawai.png","page_title":"Sirawai","context_page_description":"Sirawai is een gemeente in de Filipijnse provincie Zamboanga del Norte op het eiland Mindanao. Bij de laatste census in 2007 had de gemeente ruim 20 duizend inwoners."},{"page_url":"https://it.wikipedia.org/wiki/Rybn%C3%ADk_(Nitra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kostol_najsvatejsej_trojice_rybnik.jpg","page_title":"Rybník (Nitra)","context_page_description":"Rybník è un comune della Slovacchia facente parte del distretto di Levice, nella regione di Nitra.\\nHa dato i natali a Benedikt Sőlőši, gesuita che compilò Cantus catholici, la prima raccolta di canti cattolici in slovacco."},{"page_url":"https://en.wikipedia.org/wiki/Trap_rock","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Palisades_Sill_near_Englewood_Cliffs.jpg","page_title":"Trap rock","context_page_description":"Trap rock, also known as either trapp or trap, is any dark-colored, fine-grained, non-granitic intrusive or extrusive igneous rock. Types of trap rock include basalt, peridotite, diabase, and gabbro. Trapp is also used to refer to flood basalts, e.g. the Deccan Traps and Siberian Traps. The erosion of trap rock created by the stacking of successive lava flows often created a distinct stairstep landscape from which the term \\"trap\\" was derived from the Swedish word \\"trappa\\", which means \\"stairway\\".\\nThe slow cooling of magma either as a sill or as a thick lava flow sometimes creates systematic vertical fractures within the resulting layer of trap rock. These fractures often form rock columns that are typically hexagonal, but also four- to eight-sided."},{"page_url":"https://sk.wikipedia.org/wiki/Rajeck%C3%A1_kotlina","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Kamenna_Poruba_zo_Sokola.JPG","page_title":"Rajecká kotlina","context_page_description":"Rajecká kotlina je podcelok Žilinskej kotliny."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B2%D0%BE%D0%BD_%D0%92%D0%B0%D0%BB%D0%B8_(%D0%90%D1%98%D0%B4%D0%B0%D1%85%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Swan_Valley%2C_Wyoming_20161125.jpg","page_title":"Свон Вали (Ајдахо)","context_page_description":"Свон Вали град је у америчкој савезној држави Ајдахо."},{"page_url":"https://es.wikipedia.org/wiki/Ca%C3%B1%C3%B3n_medieval","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Vase_cannonfortnelson.jpg","page_title":"Cañón medieval","context_page_description":"Los cañones en la Edad Media eran enormes armas de fuego en forma de tubo, diseñadas para disparar un proyectil pesado a una gran distancia. Se empleaban en China, Europa y el Medio Oriente, y son el arquetipo de la artillería moderna. Ya en 1326, la ciudad de Florencia tenía cañones, mientras que, en 1327, el castillo de Gassino Torinese, cerca de Turín, estaba equipado con armas de fuego​. El primer cañón en Europa probablemente haya aparecido en la Iberia mora y cristiana. El cañón inglés fue utilizado por primera vez en la batalla de Crécy, durante la guerra de los Cien Años.\\nLa palabra francesa antigua cannon deriva del italiano antiguo cannone, que a su vez proviene del latín canna —tubo—.​ La forma latinizada canon se utilizó para designar un arma desde 1326 en Italia y 1418 en Inglaterra. Bombardum, o «bombarda», fue la palabra más antigua usada para referirse al «cañón», pero desde 1430 pasó a emplearse únicamente para las armas más grandes.​"},{"page_url":"https://pl.wikipedia.org/wiki/Konstanty_Sk%C4%85pski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Konstanty_Sk%C4%85pski_%28-1932%29.jpg","page_title":"Konstanty Skąpski","context_page_description":"Konstanty Zdzisław Skąpski – pułkownik saperów Wojska Polskiego II RP i Polskich Sił Zbrojnych, mianowany generałem brygady przez Władysława Andersa."},{"page_url":"https://fr.wikipedia.org/wiki/Communaut%C3%A9_de_communes_du_Mont_des_Avaloirs","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/53-Intercos2019-200042182.png","page_title":"Communauté de communes du Mont des Avaloirs","context_page_description":"La communauté de communes du Mont des Avaloirs est une communauté de communes française, située dans le département de la Mayenne et dans la région Pays de la Loire."},{"page_url":"https://ceb.wikipedia.org/wiki/Nha_Trang","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Nha_Trang_skyline.jpg","page_title":"Nha Trang","context_page_description":"Nha Trang usa ka munisipyo sa probinsiya sa Khanh Hoa, Nam Trung Bo region, Vietnam. Sumala sa sensus sa tuig 2011, kini may populasyon nga 392,279 ka tawo sa 251 ka bubong.\\nTugpahanang sa Cam Ranh sa 30 km from Nha Trang."},{"page_url":"https://de.wikipedia.org/wiki/Hornepayne","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Hornepayne_Airport.JPG","page_title":"Hornepayne","context_page_description":"Hornepayne ist ein Ort mit 1.050 Einwohnern in der kanadischen Provinz Ontario. Er liegt im Algoma District."},{"page_url":"https://de.wikipedia.org/wiki/Schmidtburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Schmidtburg02.jpg","page_title":"Schmidtburg","context_page_description":"Die Schmidtburg ist die Ruine einer Höhenburg auf der Gemarkung der Ortsgemeinde Schneppenbach im Landkreis Bad Kreuznach in Rheinland-Pfalz."},{"page_url":"https://ca.wikipedia.org/wiki/Parc_Natural_de_la_Serra_Calderona","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Mapa_SerraCalderona.png","page_title":"Parc Natural de la Serra Calderona","context_page_description":"El Parc Natural de la Serra Calderona és un parc natural de la Generalitat Valenciana des que fou declarat el 15 de gener de 2002."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8B%89%E7%BD%97%E8%B0%A2%E6%B3%A2%E5%9F%8E%E5%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Chateau_La_Rochepot2.JPG","page_title":"拉罗谢波城堡","context_page_description":"拉罗谢波城堡是一座13世纪法国城堡，位于勃艮第科多尔省博讷西南6号国道上的拉罗谢波小镇以北的石灰岩上。\\n它建于13世纪，后来沦为废墟，直到19世纪才由卡诺家族修复，现在向游客开放。"},{"page_url":"https://en.wikipedia.org/wiki/Architecture_of_Liverpool","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Wapping_Tunnel_ventilator%2C_Upper_Pitt_Street_2018.jpg","page_title":"Architecture of Liverpool","context_page_description":"The architecture of Liverpool is rooted in the city's development into a major port of the British Empire. It encompasses a variety of architectural styles of the past 300 years, while next to nothing remains of its medieval structures which would have dated back as far as the 13th century. Erected 1716-18, Bluecoat Chambers is supposed to be the oldest surviving building in central Liverpool.\\nThere are over 2500 listed buildings in Liverpool of which 27 are Grade I and 85 Grade II* listed. It has been described by English Heritage as England's finest Victorian city. However, due to neglect, some of Liverpool's finest listed buildings are on English Heritage's Heritage at Risk register. Though listed buildings are concentrated in the centre, Liverpool has many buildings of interest throughout its suburbs.\\nIn accordance with Liverpool's role as a trading port, many of its best buildings were erected as headquarters for shipping firms and insurance companies. The wealth thus generated led to the construction of grand civic buildings, designed to allow the local administrators to \\"run the city with pride\\"."},{"page_url":"https://en.wikipedia.org/wiki/Highway_of_Death","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Highway_of_Death%2C_DShKM_or_Type_54_HMG_mounted_on_top_of_a_turret_of_a_tank.JPEG","page_title":"Highway of Death","context_page_description":"The Highway of Death is a six-lane highway between Kuwait and Iraq, officially known as Highway 80. It runs from Kuwait City to the border town of Safwan in Iraq and then on to the Iraqi city of Basra. The road was used by Iraqi armored divisions for the 1990 Invasion of Kuwait. It was repaired after the Persian Gulf War and used by U.S. and British forces in the initial stages of the 2003 invasion of Iraq.\\nDuring the American led coalition offensive in the Persian Gulf War, American, Canadian, British and French aircraft and ground forces attacked retreating Iraqi military personnel attempting to leave Kuwait on the night of February 26–27, 1991, resulting in the destruction of hundreds of vehicles and the deaths of many of their occupants. Between 1,400 and 2,000 vehicles were hit or abandoned on the main Highway 80 north of Al Jahra.\\nThe scenes of devastation on the road are some of the most recognizable images of the war, and it has been suggested that they were a factor in President George H. W. Bush's decision to declare a cessation of hostilities the next day. Many Iraqi forces, however, successfully escaped across the Euphrates river, and the U.S."},{"page_url":"https://en.wikipedia.org/wiki/Kulpakji","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Kolanupaka_Temple_%28Kulpakji_Temple%29_entrance_01.jpg","page_title":"Kulpakji","context_page_description":"Kulpakji also Kolanupaka Temple is a 2,000 year-old Jain temple at the village of Kolanupaka in Aler City, Yadadri district, Telangana, India. The temple houses three idols: one each of Lord Rishabhanatha, Lord Neminatha, and Lord Mahavira. The image of Lord Rishabhanatha, carved of a green stone has been historically famous as \\"Manikyaswami\\". The temple is about 80 km from Hyderabad on the Hyderabad-Warangal Highway NH 163.it is also called as jivitswami"},{"page_url":"https://en.wikipedia.org/wiki/Paris_in_the_17th_century","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Fort_Royal_1651_Ch%C3%A2teau_cardinal.jpg","page_title":"Paris in the 17th century","context_page_description":"Paris in the 17th century was the largest city in Europe, with a population of half a million, matched in size only by London. It was ruled in turn by three monarchs; Henry IV, Louis XIII, and Louis XIV, and saw the building of some of the city's most famous parks and monuments, including the Pont Neuf, the Palais Royal, the newly joined Louvre and Tuileries Palace, the Place des Vosges, and the Luxembourg Garden. It was also a flourishing center of French science and the arts; it saw the founding of the Paris Observatory, the French Academy of Sciences and the first botanical garden in Paris, which also became the first park in Paris open to the public. The first permanent theater opened, the Comédie-Française was founded, and the first French opera and French ballets had their premieres. Paris became the home of the new Royal Academy of Painting and Sculpture, and of some of France's most famous writers, including Pierre Corneille, Jean Racine, La Fontaine and Moliere. Urban innovations for the city included the first street lighting, the first public transport, the first building code, and the first new aqueduct since Roman times."},{"page_url":"https://cs.wikipedia.org/wiki/M%C4%9B%C5%A1%C5%A5ansk%C3%BD_d%C5%AFm_u_radnice_v_Krom%C4%9B%C5%99%C3%AD%C5%BEi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/KoVnamesti3.jpg","page_title":"Měšťanský dům u radnice v Kroměříži","context_page_description":"Měšťanský dům u radnice je budova č.p. 20 stojící na rohu Kovářské ulice a Velkého náměstí v centru města Kroměříž. Budova je chráněna jako nemovitá Kulturní památka České republiky pod číslem 18636/7-6009."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%80%D0%B5%D0%B4%D0%B0%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2_%D0%B8_%D0%B0%D0%B2%D1%82%D0%BE%D1%80%D0%BE%D0%B2_%C2%AB%D0%AD%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%BE%D0%BF%D0%B5%D0%B4%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D1%80%D1%8F_%D0%93%D1%80%D0%B0%D0%BD%D0%B0%D1%82%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Chubinskiy_MP.jpg","page_title":"Список редакторов и авторов «Энциклопедического словаря Гранат»","context_page_description":"Список лиц, участвовавших в составлении Энциклопедического словаря Гранат."},{"page_url":"https://es.wikipedia.org/wiki/V%C3%ADa_Nomentana","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Via_Nomentana2.jpg","page_title":"Vía Nomentana","context_page_description":"La vía Nomentana era una importante vía consular romana que iba desde Roma hasta Nomentum, ciudad situada en las cercanías de la actual ciudad de Mentana. Originalmente era llamada vía Ficulensis, por el hecho de acabar en Ficulea. La extensión de dicha calle hasta Nomentum provocó el cambio de nombre de la vía.\\nEl camino tenía origen en la puerta Nomentana y desde ella continuaba en dirección noreste hasta llegar a Nomentum. Actualmente, la vía Nomentana empieza en la puerta Pía, a cientos de metros de su antiguo origen.\\nDurante el siglo XIX surgió una polémica en relación al hallazgo de tres cuerpos decapitados, supuestamente pertenecientes al papa Alejandro I y a dos de sus fieles allegados. Las iglesias católica y ortodoxa veneran otros santos que, según se cree, fueron enterrados en la vía Nomentana, entre ellos, Inés, Primo y Feliciano mártires."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B1_(%D1%80%D1%96%D0%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Carpinus_laxiflora_bonsai.jpg","page_title":"Граб (рід)","context_page_description":"Граб — рід багаторічних деревних рослин родини березових, до складу якого входить 41 вид. Існують варіанти родової назви, наприклад, Carpiniphyllum. Серед представників роду багато декоративних, лісомеліоративних, технічних культур, деякі з них мають обмежене значення як кормові рослини."},{"page_url":"https://de.wikipedia.org/wiki/Franz_Wei%C3%9Febach","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Franz_Weissebach.jpg","page_title":"Franz Weißebach","context_page_description":"Peter Franz Weißebach war ein deutscher Privatier, Mitbesitzer des Weinguts Kanzemer Berg, ein Trierer Schalk und Stifter des Trierer Palastgartens. Nach ihm ist der Franz-Weißebach-Preis benannt."},{"page_url":"https://pl.wikipedia.org/wiki/Mi%C5%84sk_Sartyrawalny","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Minsk-Sortirovochny_09.jpg","page_title":"Mińsk Sartyrawalny","context_page_description":"Mińsk Sartyrawalny – stacja kolejowa w Mińsku, na Białorusi. Leży na linii Moskwa - Mińsk - Brześć. Stacja nie obsługuje ruchu pasażerskiego.\\nNa stacji znajduje się obrotnica kolejowa."},{"page_url":"https://de.wikipedia.org/wiki/Fallblattanzeige","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/U-Bahn_M%C3%BCnchen_B.jpg","page_title":"Fallblattanzeige","context_page_description":"Eine Fallblattanzeige, fälschlicherweise manchmal „Faltblattanzeige“ genannt, kommt vor allem als Anzeige bei Digitaluhren, insbesondere bei Synchronuhren, als Kalender, bei Aufrufanzeigen in Wartebereichen sowie bei Anzeigetafeln auf Flughäfen und Bahnhöfen zum Einsatz. Sie wurde jedoch inzwischen weitgehend durch großformatige Segmentanzeigen, Matrixanzeigen oder bistabile Anzeigeelemente abgelöst. Eine alternative Bezeichnung für Module, die ganze Wörter auf einmal anzeigen, ist Palettenanzeiger, bei rein numerischen Anzeigen spricht man auch von einer Klappzahlenanzeige."},{"page_url":"https://fr.wikipedia.org/wiki/Notre-Dame_de_la_Bonne_Sant%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/ND_de_Fourvi%C3%A8re_ND_de_Vailankanni.jpg","page_title":"Notre-Dame de la Bonne Santé","context_page_description":"Notre-Dame de la Bonne Santé, appelée aussi Notre-Dame de Velankanni, est un titre catholique célébré de la Bienheureuse Vierge Marie qui serait apparu dans le village de Velankanni, Tamil Nadu, Inde. Selon les croyances traditionnelles, l'apparition Mariale aurait eu lieu à un jeune berger qui livrait du lait au voisinage lorsque la Vierge Marie portant l'enfant Jésus, lui apparaît. Cette apparition n'a pas été reconnue par le Saint-siège.\\nLa Basilique de Notre-Dame de Bonne Santé édifiée par les Portugais et les Indiens se dresse sur ce site. L'emblématique représentation de la vierge est unique sur le fait qu'elle est l'une des deux seules icônes où Marie est représentée vêtue d'un Sari indien, tandis que l'autre statue aurait été enterrée avec Aurangzeb, l'Empereur Moghol. La basilique est connue comme un site pour les pèlerins de tous les coins de l'Inde et de son assemblée multilingue de prières à chaque Noël."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B6%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Ryazhsk_%28Ryazan_Oblast%29_03-2014_img3_-_Khupta_River.jpg","page_title":"Ражск","context_page_description":"Ражск — горад у Расіі, адміністрацыйны цэнтр Ражскага раёна Разанскай вобласці. Насельніцтва 22,1 тыс. чалавек. Заснаваны ў 1502 годзе.\\nГорад размешчаны на паўночна-заходняй ускраіне Окска-Данской раўніны, на высокім і стромкім беразе р. Хупта, у 117 км на поўдзень ад Разані. Вузел чыгуначных ліній на Разань, Тулу, Пензу, Мічурынск і аўтадарог.\\nЭканоміка: харчакамбінат, малочны камбінат, мясакамбінат, аўтарэмзавод, цагельня, друкарская фабрыка."},{"page_url":"https://nl.wikipedia.org/wiki/Helicodonta_obvoluta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Haarschnecke.jpg","page_title":"Helicodonta obvoluta","context_page_description":"Helicodonta obvoluta is een op het land levende longslak uit de familie Helicodontidae."},{"page_url":"https://en.wikipedia.org/wiki/Government_House,_Chisinau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Stonememory_to_the_Victims_of_the_Soviet_Occupation.jpg","page_title":"Government House, Chisinau","context_page_description":"The Government House in Chisinau is a government building in Chisinau located on Great National Assembly Square and Stefan cel Mare Avenue. It was designed by Semyon Fridlin in 1964 on Victory Square and along Lenin Avenue. It used to be the headquarters of the Council of Ministers of the Moldovan SSR. The building is a 6-storey reinforced concrete structure, lined with white stone, made in the shape of a letter Russian letter П. Above the main entrance to the building is the inscription \\"The Government of the Republic of Moldova\\", as well as the Coat of Arms of Moldova and the Flag of Moldova. In 2010, the Monument to the Victims of the Soviet Occupation was opened right in front of the building."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%82%AF%E3%82%B5%E3%83%B3%E3%83%89%E3%83%AB%E3%83%BB%E3%83%91%E3%83%8A%E3%83%A8%E3%83%BC%E3%83%88%E3%83%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/KiViN_%282017-07-22%29_10.jpg","page_title":"アレクサンドル・パナヨートフ","context_page_description":"アレクサンドル・セルゲーヴィッチ・パナヨートフは、ロシアの歌手、シンガーソングライターである。\\n公営テレビ局「テレビロシア」で2003年に放映されたオーディション番組「ナロードヌィ・アルチストコンクール」の準優勝者。\\n3.5オクターブの音域を操り、ロシアのポップス界では「黄金の声の持ち主」とか「至高の声を持つ歌手の一人」と称されている。"},{"page_url":"https://pl.wikipedia.org/wiki/%C5%9Awiadkowie_Jehowy_w_wojew%C3%B3dztwie_%C5%9Bl%C4%85skim","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/USTRO%C5%83%2C_AB._011.JPG","page_title":"Świadkowie Jehowy w województwie śląskim","context_page_description":"Świadkowie Jehowy w województwie śląskim – wspólnota religijna Świadków Jehowy w województwie śląskim. Liczba głosicieli na terenie województwa wynosi ok. 41 084. W lipcu 2020 roku na terenie województwa znajdowały się miejsca zgromadzeń 202 zborów."},{"page_url":"https://pl.wikipedia.org/wiki/Solwyczegodsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B1%D0%BE%D0%B3%D0%B0%D0%B4%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8_%281876%29._%D0%A3%D0%BB%D0%B8%D1%86%D0%B0_%D0%A3%D1%80%D0%B8%D1%86%D0%BA%D0%BE%D0%B3%D0%BE%2C_%D0%B4._6%2C_%D0%A1%D0%BE%D0%BB%D1%8C%D0%B2%D1%8B%D1%87%D0%B5%D0%B3%D0%BE%D0%B4%D1%81%D0%BA.JPG","page_title":"Solwyczegodsk","context_page_description":"Solwyczegodsk – miasto w północnej Rosji, w obwodzie archangielskim, w rejonie kotłaskim, na prawym brzegu rzeki Wyczegdy.\\nMiejscowość została pierwszy raz wspomniana w 1492 roku, prawa miejskie od 1796 roku, 1 stycznia 2013 w mieście zamieszkiwało 2350 osób.\\nNa terenie miasta istnieje zabytkowy zespół sakralno-muzealny obejmujący:\\nsobór Zwiastowania z 1584 roku z bogatymi freskami moskiewskich artystów z 1597—1600 i kaplicą grobową rodu Stroganowów z 28 epitafiami.\\nmuzeum ikon z XVI-XVII w. głównie miejscowych twórców\\nmonaster Wprowadzenia Matki Bożej do Świątyni z soborem tego samego wezwania zbudowany w ostatniej dekadzie XVII w.\\ncerkiew Podniesienia Krzyża Pańskiego\\nAtrakcją turystyczną miasta jest również Muzeum „Dom-pamiatnik politiczeskich ssylnych” umiejscowione w domu, w którym w latach 1908-1910 przebywał na zesłaniu Józef Stalin. Ośrodek upamiętnia dzieje Solwyczegodska w latach 1867-1917, gdy do miasta trafiło około 1500 zesłańców z całej Rosji.\\nW 1908 roku w Solwyczegodsku urodził się Stefan Du Chateau."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Verma","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Verma_stasjon.jpeg","page_title":"Station Verma","context_page_description":"Station Verma is een spoorwegstation in Verma in de gemeente Rauma in Noorwegen. Het station, uit 1923, is ontworpen door Gudmund Hoel en Bjarne Friis Baastad. Verma ligt aan Raumabanen. Het station is gesloten voor personenvervoer."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_rimskih_cesarjev","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Theodosius.jpg","page_title":"Seznam rimskih cesarjev","context_page_description":"Rimski cesar je dokaj sodoben pojem, ki uspešno opisuje položaj posameznikov, ki so imeli vrhovno oblast v Rimskem cesarstvu.\\nRimsko cesarstvo se je razvilo iz Rimske republike, ko je prerasla v vladajočo vojaško in politično silo v Evropi. Za cesarstvo je bila značilna združitev moči v posamezniku in ne v »senatu in prebivalcih Rima«. Avgust, ki je na oblast prišel leta 27 pr. n. št. in se na splošno obravnava kot prvi rimski cesar, je skrbel samo za vzdrževanje videza republikanske oblasti in ni imel nobenega posebnega naslova, ki bi označeval njegovo vlogo. Avgust je v svoji osebi preprosto združil že obstoječo moč rimskega magistrata in privzel naslov Princeps Senatus, se pravi prvi mož senata. Takšen način vladanja, ki je trajal skoraj tristo let, se zato imenuje principat. Sodoben naslov cesar izhaja iz naslova imperator. Tega je rimska armada podeljevala svojim zaslužnim generalom in so ga kot takega v začetnem obdobju Rimskega cesarstva podeljevali tudi princepsom."},{"page_url":"https://de.wikipedia.org/wiki/Kirchengeb%C3%A4ude_in_Cottbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Zeugen_Jehovas.jpg","page_title":"Kirchengebäude in Cottbus","context_page_description":"Die Cottbuser Kirchengebäude stellen mit ihren Bildwerken, Orgeln und Glocken einen wertvollen Schatz sakraler Kunst dar. Kirchen prägten über Jahrhunderte die Kulturlandschaft, so auch in Cottbus."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B5%81%E0%B4%B2%E0%B5%8D%E0%B4%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/JasmineBud.JPG","page_title":"മുല്ല","context_page_description":"200 ൽ പരം ഇനങ്ങളുള്ള ഒലിയേസീ എന്ന കുടുംബത്തിലെ ജാസ്മീനം എന്ന ജനുസ്സിൽപ്പെട്ട കുറ്റിച്ചെടിയാണ്‌ മുല്ല. ഇംഗ്ലീഷിൽ ജാസ്മിൻ. \\"ദൈവത്തിന്റെ സമ്മാനം\\" എന്നർത്ഥമുള്ള യാസിൻ എന്ന പേർഷ്യൻ വാക്കിൽ നിന്നാണ് ജാസ്മിൻ എന്ന പേരിന്റെ ഉദ്ഭവം. ചിലയിനങ്ങൾ നിത്യഹരിത സസ്യങ്ങളും മറ്റുള്ളവ ഇലപൊഴിയും സസ്യങ്ങളുമാണ്. വെളുത്ത നിറമുള്ള മുല്ലപ്പൂക്കൾ വളരെ സുഗന്ധമുള്ളവയാണ്."},{"page_url":"https://cs.wikipedia.org/wiki/Kalek","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Kalek_2016-05-11_Tov%C3%A1rna.jpg","page_title":"Kalek","context_page_description":"Kalek je obec s 242 obyvateli v Ústeckém kraji v okrese Chomutov. V samotném Kalku však žije pouze okolo sta lidí. Vesnice stojí v Krušných horách v nadmořské výšce okolo 700 metrů na hranici s Německem. Vznikla přibližně v polovině šestnáctého století okolo hamru, ve kterém se zpracovávala železná ruda z blízkého okolí. V polovině osmnáctého století došlo k rozvoji zpracování železa a zdejší železárna časem zaměstnávala až 400 pracovníků. Po jejím úpadku bylo zpracování železa nahrazeno výrobou smaltovaného nádobí a dřevěných výrobků. Průmysl z vesnice vymizel až ve druhé polovině dvacátého století, kdy se počet obyvatel snížil přibližně na desetinu stavu před druhou světovou válkou.\\nK obci patří části obce Jindřichova Ves a Načetín. V jejích katastrálních územích stávaly také zaniklé vesnice Gabrielina Huť a Kienhaid."},{"page_url":"https://pl.wikipedia.org/wiki/Jay_Munly","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Jay_Munly_2009.JPG","page_title":"Jay Munly","context_page_description":"Jay Munly jest muzykiem grającym na banjo, gitarzystą, singer/songwriterem i pisarzem, obecnie przebywającym w Denver. Jest jednym z najważniejszych przedstawicieli tzw. \\"brzmienia z Denver\\", będącego unikatową miksturą alt-country, gotyckiego rocka, americany i gospel. Oprócz projektów solowych, współpracował m.in. ze Slim Cessna's Auto Club i zespołem DeVotchKa."},{"page_url":"https://en.wikipedia.org/wiki/481st_Night_Fighter_Operational_Training_Group","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Northrop_P-61B-15-NO_Black_Widow_42-39728.jpg","page_title":"481st Night Fighter Operational Training Group","context_page_description":"The 481st Night Fighter Operational Training Group was a unit of the United States Army Air Forces. It was inactivated on 31 March 1944 at Hammer Field, California.\\nThe group was the primary night fighter Operational Training Unit /Replacement Training Unit of the Army Air Forces during World War II. Its mission was to train either new graduates of Training Command advanced flying schools or transition experienced pilots into the P-61 Black Widow night fighter. It trained them in the flight characteristics of the aircraft and also night fighter interceptor techniques prior to the operational squadrons or replacement pilots being deployed to one of the overseas combat theaters."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Postcard_BNR.jpg","page_title":"Белорусская народная республика","context_page_description":"Белору́сская Наро́дная Респу́блика — государство, провозглашённое на территории современной Белоруссии 9 марта 1918 года 2-й Уставной грамотой Рады Белорусской Народной Республики, установившей с 25 марта 1918 года независимость данного образования на оккупированных немецкими войсками территориях бывшей Российской империи.\\nИдея создания белорусского государства была выдвинута в декабре 1917 года частью делегатов Первого Всебелорусского съезда в Минске, но съезд был разогнан большевиками. В преддверии занятия Минска немцами 21 февраля 1-й Уставной грамотой Исполком Рады Всебелорусского съезда объявил себя властью в крае и образовал правительство. 25 марта, в условиях немецкой оккупации, 3-й Уставной грамотой Белоруссия провозглашалась независимым и свободным государством.\\nПосле денонсации Брестского мира Германия начала вывод своих войск с оккупированных территорий. Уже в декабре 1918 года части Красной армии заняли Минск. Правительство БНР продолжило деятельность в эмиграции. В октябре 1925 Все­бе­ло­рус­ская по­ли­тическая кон­фе­рен­ция в Бер­ли­не зая­ви­ла о ли­к­ви­да­ции БНР. Многие вид­ные дея­те­ли БНР вер­ну­лись в БССР."},{"page_url":"https://pl.wikipedia.org/wiki/Bawolce","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Hartebeest.jpg","page_title":"Bawolce","context_page_description":"Bawolce – podrodzina ssaków wołowatych obejmująca duże antylopy afrykańskie klasyfikowane w rodzajach:\\nbawolec\\nhirola\\ngnu\\nsasebi\\nBawolce pojawiły się w Afryce ok. 5-4,5 mln lat temu. Charakteryzują się długimi kończynami, wydłużoną głową oraz obecnością u przedstawicieli obydwu płci lirowatych rogów i dobrze rozwiniętych gruczołów przedoczodołowych."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%90%D0%97-204","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/%D0%9F%D1%80%D0%B8%D0%BD%D1%86%D0%B8%D0%BF_%D1%80%D0%B0%D0%B1%D0%BE%D1%82%D1%8B_%D0%B4%D0%B2%D1%83%D1%85%D1%82%D0%B0%D0%BA%D1%82%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B4%D0%B8%D0%B7%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B4%D0%B2%D0%B8%D0%B3%D0%B0%D1%82%D0%B5%D0%BB%D1%8F.gif","page_title":"ЯАЗ-204","context_page_description":"ЯАЗ-204 — двухтактный четырёхцилиндровый дизельный двигатель, выпускавшийся на Ярославском автомобильном заводе с 1947 по, как минимум, конец 1980-х годов. Использовался на грузовых автомобилях, стационарных и передвижных дизельных электростанциях, компрессорных станциях, мотовозах и катерах.\\nЯвляется четырёхцилиндровой модификацией шестицилиндрового дизельного двигателя ЯАЗ-206."},{"page_url":"https://en.wikipedia.org/wiki/Eesha_Karavade","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Eesha_Karavade_2011.jpg","page_title":"Eesha Karavade","context_page_description":"Eesha Karavade is a chess player from Pune, India.\\nShe holds the titles of Woman Grandmaster and International Master.\\nShe played for India in the Chess Olympiads of 2010, 2012 and 2014."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A1%D5%B5%D5%AF%D5%A1%D5%AF%D5%A1%D5%B6_%D5%AA%D5%A1%D5%B6%D5%B5%D5%A1%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Armenian_lace%2C_Sofia_History_Museum.jpg","page_title":"Հայկական ժանյակ","context_page_description":"Հայկական ժանյակ, գեղարվեստական ստեղծագործության այս ինքնուրույն և յուրահատուկ տեսակը հայ ժողովրդի հետ միասին անցել է շատ փորձություների միջով, պահպանել իր պարզությունն ու նրբագեղությունը և հասել մեր օրեր։ Նյութի մատչելիության, գործիքների համեմատաբար պարզ ձևերի, դրա հետ մեկտեղ գեղարվեստական արտահայտչության լայն միջոցների շնորհիվ ժողովրդի մոտ լայն տարածում ստացած և սիրված զբաղմունքներից մեկն է եղել։\\nԶարդանկարների հարստությունն ու բազմազանությունը, ոճային միասնականությունը, առանձին մոտիվների մշակված, հղկված ձևերը, մեծ կոմպոզիցիաների մեջ ներդաշնակությունը, համաչափությունը յուրահատուկ նուրբ գեղեցկություն են հաղորդել հայկական ժանյակին։ Չնայած, որ հայկական ժանյակի մեջ գերիշխել է սպիտակ գույնը, գունավոր ժանյակներում, տարազի հետ կապված, բավական չափավոր և ներդաշնակ են գույների համադրությունը, որն էլ արտահայտում է հայկական արվեստին բնորոշ մեղմությունը։\\nՀայկական ժանյակի լավագույն նմուշներ են պահպանվել մասնավոր հավաքածուներում և աշխարհի տարբեր թանգարաններում։"},{"page_url":"https://fy.wikipedia.org/wiki/Tsjerke-monumint_foar_de_fallen_soldaten_by_de_oermastering_fan_Kazan_(1552)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/%D0%9F%D0%BB%D0%B0%D0%BD_%D0%BF%D0%B5%D1%80%D0%B2%D0%BE%D0%B3%D0%BE_%D1%8F%D1%80%D1%83%D1%81%D0%B0_%D1%85%D1%80%D0%B0%D0%BC%D0%B0-%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%B0_%D0%BF%D0%B0%D0%B2%D1%88%D0%B8%D0%BC_%D0%BF%D1%80%D0%B8_%D0%B2%D0%B7%D1%8F%D1%82%D0%B8%D0%B8_%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D0%B8.jpg","page_title":"Tsjerke-monumint foar de fallen soldaten by de oermastering fan Kazan (1552)","context_page_description":"It Tsjerke-monumint foar de fallen soldaten by de oermastering fan Kazan yn 1552 is in monumint út de 19e iuw yn Kazan, Ruslân. It monumint betinkt de fallen soldaten by de oermastingering fan de stêd troch Ivan de Ferskriklike. It is ien fan de âldste militêre betinkingsmonuminten fan Ruslân.\\nIt monumint stiet ûnder nûmer 1610035000 ynskreaun op de list fan Ruslân's nasjonale erfgoed."},{"page_url":"https://en.wikipedia.org/wiki/Tony_Smibert","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Painting_by_Tony_Smibert_3.jpeg","page_title":"Tony Smibert","context_page_description":"Anthony Charles Smibert AM is an artist and aikido teacher. He has exhibited artworks and published research internationally, much of the latter on the methods of 19th century watercolourist J. M. W. Turner. He is the President of Aiki Kai Australia and a member of the Senior Council of the International Aikido Federation. In the Queen's Birthday Honours in June 2016, Smibert was appointed a Member of the Order of Australia \\"for significant service to aikido through a range of roles, and to the visual arts as a painter and water colourist\\". His home, studio and gallery are in Deloraine, Tasmania."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%8B%89%E9%9C%8D%E5%B0%94%E5%A7%86%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Laholm_Municipality_in_Halland_County.png","page_title":"拉霍尔姆市","context_page_description":"拉霍爾姆市是瑞典西南部哈蘭省的一個自治市。其治所位於拉霍爾姆。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monarques_de_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Phil6france.jpg","page_title":"Liste des monarques de France","context_page_description":"La liste des monarques de France réunit les rois et les empereurs qui ont régné sur la France, au travers des différentes constructions politiques, territoriales et dynastiques qui se succédèrent. Parmi les différents moments de cette royauté française, on distingue l'époque des royaumes francs au haut Moyen Âge, le royaume de France en tant que tel jusqu'à la Révolution française, puis le Premier Empire, la Restauration, la monarchie de Juillet et enfin le Second Empire. Le dernier monarque ayant régné en France est l'empereur Napoléon III, déchu officiellement le 1ᵉʳ mars 1871, après la défaite de Sedan. Jusqu'alors, la France avait toujours été une monarchie ou un empire, hormis durant deux périodes : la Première République, du 22 septembre 1792 au 18 mai 1804, et la Deuxième République, du 24 février 1848 au 2 décembre 1852.\\nLa date de commencement de la France en tant que royaume et entité politique constituée est sujette à controverse. La date la plus reculée admise est celle de l'avènement de Clovis en 481, qui correspond globalement à l'émergence et la consolidation du Regnum Francorum."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%BF%AA%E5%80%AB%C2%B7%E6%96%AF%E6%99%AE%E7%BE%85%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/NYU_Local_chats_with_Dylan_Sprouse_01_%28cropped%29.jpg","page_title":"迪倫·斯普羅斯","context_page_description":"迪伦·斯普罗斯，出生于意大利，是美国男演员，与科尔·斯普罗斯是双胞胎兄弟。他因在迪士尼频道的《小查与寇弟的顶级生活》和《小查与寇弟的顶级游轮生活》中饰演“查克·马丁”而出名。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_parties_to_the_Hague_Conventions_of_1899_and_1907","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Permanent-Court-of-Arbitration-Members.svg","page_title":"List of parties to the Hague Conventions of 1899 and 1907","context_page_description":"The following tables indicate the states that are party to the various Hague Conventions of 1899 and 1907. If a state has ratified, acceded, or succeeded to one of the treaties, the year of the original ratification is indicated. An \\"S\\" indicates that a state has signed but not yet ratified a particular treaty, and a \\"–\\" indicates that the state has taken no action with respect to the treaty. Italicised states have ceased to exist with no legal successor. Dates which have been struck and have a \\"\\" are ratifications that have been subsequently withdrawn."},{"page_url":"https://en.wikipedia.org/wiki/Kashgar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Kashgar%2C_China_Bebop_Drone_2015-09-13T194539%2B0000_18F943.jpg","page_title":"Kashgar","context_page_description":"Kashgar, also Kashi, is an oasis city in Xinjiang. It is one of the westernmost cities of China, near the border with Afghanistan, Kyrgyzstan, Tajikistan and Pakistan. With a population of over 500,000, Kashgar has served as a trading post and strategically important city on the Silk Road between China, the Middle East and Europe for over 2,000 years.\\nAt the convergence point of widely varying cultures and empires, Kashgar has been under the rule of the Chinese, Turkic, Mongol and Tibetan empires. The city has also been the site of a number of battles between various groups of people on the steppes.\\nNow administered as a county-level unit, Kashgar is the administrative centre of Kashgar Prefecture, which has an area of 162,000 square kilometres and a population of approximately 4 million as of 2010. The city itself has a population of 506,640, and its urban area covers 15 km², though its administrative area extends over 555 km². The city was made into a Special Economic Zone in 2010, the only city in western China with this distinction."},{"page_url":"https://en.wikipedia.org/wiki/Phalaenopsis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Phalaenopsis_stobartiana_Orchi_064.jpg","page_title":"Phalaenopsis","context_page_description":"Phalaenopsis Blume, commonly known as moth orchids, is a genus of about seventy species of plants in the family Orchidaceae. Orchids in this genus are monopodial epiphytes or lithophytes with long, coarse roots, short, leafy stems and long-lasting, flat flowers arranged in a flowering stem that often branches near the end. Orchids in this genus are native to India, Taiwan, China, Southeast Asia, New Guinea and Australia with the majority in Indonesia and the Philippines."},{"page_url":"https://sh.wikipedia.org/wiki/%C5%BDeleznice_Srbije","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Railway_bridges_belgrade_railway_junction.JPG","page_title":"Železnice Srbije","context_page_description":"Železnice Srbije je akcionarsko društvo kome je glavna delatnost obavljanje prometa roba i putnika na prugama, vuča vozova i održavanje vučnih jedinica, održavanje pruge i tehnički nadzor, u Srbiji."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9isme_de_2010_en_Ha%C3%AFti","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/USAID_SAR_team_builds_pallet_for_transport_to_Haiti_at_March_ARB_2010-01-13.jpg","page_title":"Séisme de 2010 en Haïti","context_page_description":"Le séisme de 2010 en Haïti est un tremblement de terre d’une magnitude de 7,0 à 7,3 survenu le 12 janvier 2010 à 16 heures 53 minutes et 10 secondes, heure locale. Son épicentre est situé approximativement à 25,3 km de Port-au-Prince, la capitale du pays. Le foyer du séisme a été localisé à 10 km de profondeur. Une douzaine de secousses secondaires de magnitude s’étalant entre 5,02 et 5,95 ont été enregistrées dans les heures qui ont suivi. L'intensité de ce séisme a été d'environ X à l'épicentre.\\nUn second tremblement de terre d’une magnitude de 6,1 est survenu le 20 janvier 2010 à 6 heures 3 minutes, heure locale. Son foyer est situé approximativement à 59 km à l’ouest de Port-au-Prince, et à moins de 10 kilomètres sous la surface.\\nLe premier tremblement de terre a causé de nombreuses victimes, morts, blessés, amputés et des milliers de personnes victimes de troubles psychologiques. En date du 9 février 2010, Marie-Laurence Jocelyn Lassegue, ministre des Communications, confirme un bilan de plus 280 000 morts, 300 000 blessés et 1,3 million de sans-abris."},{"page_url":"https://sv.wikipedia.org/wiki/Villa_Kallstenius","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Villa_Kallstenius_2013.jpg","page_title":"Villa Kallstenius","context_page_description":"Villa Kallstenius är en kulturhistoriskt värdefull byggnad vid Krokvägen 1B i Storängen, Nacka kommun. Villan ritades 1906 av arkitekt Gustaf Petterson för konstnärsparet Gottfrid Kallstenius och Gerda Roosval-Kallstenius. Villan bedömdes enligt en kulturhistorisk byggnadsinventering av Storängen år 1979 som ”värdefull”."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D1%81%D0%B1%D0%BE%D0%BB%D0%B4%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Barsboldia_sicinskii_%282%29.jpg","page_title":"Барсболдия","context_page_description":"Барсболдия — род растительноядных утконосых динозавров подотряда орнитопод, обитавший в конце мелового периода на территории современной Монголии. Описан по находкам из Нэмэгэтской свиты."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%97%E8%B0%B7_(%E5%88%97%E8%BB%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/JRH_DMU261_SE-201_Soya.jpg","page_title":"宗谷 (列車)","context_page_description":"宗谷は、北海道旅客鉄道が札幌駅 - 稚内駅間を函館本線・宗谷本線経由で運行している特別急行列車。\\n本項目では、同じく宗谷本線で運行されている特急「サロベツ」と、過去に宗谷本線およびその支線である天北線で運行されていた優等列車の沿革についても記述する。"},{"page_url":"https://it.wikipedia.org/wiki/Grattacieli_pi%C3%B9_alti_della_Germania","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Hochhaus_Deutsche_Welle_K%C3%B6ln-3588.jpg","page_title":"Grattacieli più alti della Germania","context_page_description":"Questa è una lista dei grattacieli più alti della Germania ordinati per altezza.\\nSecondo la classificazione internazionale e come riportato nel sito del Ctbuh, il grattacielo più elevato in base all'altezza strutturale è la Commerzbank Tower di Francoforte. Il grattacielo con il maggior numero di piani è, invece, la Messeturm sempre di Francoforte, che è anche il secondo più alto della Germania.\\nLa costruzione di grattacieli non è, tuttavia, comune nelle città tedesche, soprattutto nei centri città dove tradizionalmente sono i campanili le strutture più alte. Infatti, solo la città di Francoforte, grazie al suo profilo economico di centro finanziario internazionale, è riuscita a sviluppare un consistente numero di grattacieli nel centro della città; basti pensare che su 15 edifici che superano i 150 metri, ben 14 sono situati a Francoforte."},{"page_url":"https://en.wikipedia.org/wiki/James_O%27Kelly","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/JamesOKelly.jpg","page_title":"James O'Kelly","context_page_description":"James O'Kelly was an American clergyman during the Second Great Awakening and an important figure in the early history of Methodism in America. He was also known for his outspoken views on abolitionism, penning the strong antislavery work, Essay on Negro Slavery. Appointed as a Methodist circuit rider in 1777, he organized preaching circuits on the frontier in central and southeastern North Carolina during the American Revolutionary War. He continued his affiliation with the Methodist Episcopal Church from its formal organization in 1784 at the Christmas Conference, when he was ordained an elder. Well regarded as a preacher, he successfully supervised pastors in several regions of Virginia and North Carolina.\\nO'Kelly, who favored the congregationalist system of church polity, came to oppose the church's system of centralized episcopal authority, which he believed infringed on the freedom of preachers. At the 1792 General Conference of the Methodist Church, he introduced a resolution to allow clergy to appeal to the Conference if they believed their assignments from the bishop to be unsatisfactory. After several days of debate, the resolution was defeated."},{"page_url":"https://no.wikipedia.org/wiki/Hvit_g%C3%A5seblom","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Anthemis_arvensis_W.jpg","page_title":"Hvit gåseblom","context_page_description":"Hvit gåseblom er en urt i kurvplantefamilien.\\nDen er som regel ettårig med en forgrenet stengel og har ingen sterk duft. Bladene er dobbelt fjærflikete med linjeformete, spisse avsnitt; de er ullhårete under. Blomsterkurvene sitter enkeltvis i enden av en lang stilk og er 2–3 cm i diameter. Randkronene er hvite, og skivekronene er gule. Blomsterkurven har lansettformede agner mellom enkeltblomstene. Kurven er flat til å begynne med, men blir kjegleformet når fruktene modnes.\\nI Norge kan hvit gåseblom forveksles med prestekrage, balderbrå og kamilleblom, men de har annerledes blader og mangler agner i kurven. Den sjeldne tappgåseblom har en ekkel lukt, børstelignende agner og taggete frukter.\\nArten er knyttet til områder med menneskelig aktivitet, som dyrket mark, brakkmark og vegkanter. Den hører hjemme i Europa, men har spredt seg som et åkerugras til alle verdensdeler. Hvit gåseblom kom til Norge med korndyrking. Den er vanlig på Østlandet og finnes mer spredt nordover til Finnmark."},{"page_url":"https://ca.wikipedia.org/wiki/Volkswagen_Escarabat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/K%C3%A4fertaxi_in_Mexiko-Stadt.fcm.jpg","page_title":"Volkswagen Escarabat","context_page_description":"El Volkswagen Sedan, denominat també Volkswagen Tipus 1 i més comunament com Volkswagen Escarabat, és un automòbil de baix cost produït pel fabricant alemany Volkswagen entre els anys 1938 i 2003, exceptuant-ne l'època de la Segona Guerra Mundial. Fou el primer automòbil de la marca i van construir-se'n 21 milions, superant el Ford T com el model únic més venut en la història.\\nÉs un automòbil de quatre places amb motor darrer i tracció darrera, disponible amb carrosseries Sedan i descapotable de dues portes. L'Escarabat és un cotxe de culte en nombroses subcultures, com la hippie i la tuning. A tot el món existeixen clubs de propietaris i fans d'aquest model."},{"page_url":"https://en.wikipedia.org/wiki/Hendrik_Grav%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Hendrik_Grave.jpg","page_title":"Hendrik Gravé","context_page_description":"Hendrik Gravé was a Dutch admiral."},{"page_url":"https://ro.wikipedia.org/wiki/Premiul_Oscar_pentru_cea_mai_bun%C4%83_actri%C8%9B%C4%83_%C3%AEn_rol_secundar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/MarySteenburgenDec09.jpg","page_title":"Premiul Oscar pentru cea mai bună actriță în rol secundar","context_page_description":"Premiul Oscar pentru cea mai bună actriță în rol secundar este unul dintre premiile acordate actrițelor care lucrează în industria filmului în cadrul ceremoniei Premiilor Oscar. Premiul este acordat de Academy of Motion Picture Arts and Sciences și se decernează anual începând cu 1937."},{"page_url":"https://fr.wikipedia.org/wiki/Pav%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Pav%C3%A9_de_jardin.JPG","page_title":"Pavé","context_page_description":"Un pavé est un bloc généralement en pierre, en bois ou en béton utilisé pour le revêtement de la chaussée. De nos jours, il est utilisé essentiellement pour des voies piétonnières ou rarement empruntées, dans des secteurs historiques ou pour de courts segments de routes."},{"page_url":"https://es.wikipedia.org/wiki/%C3%81reas_metropolitanas_de_Colombia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Mapa_de_Colombia_%28%C3%A1reas_metropolitanas%29.svg","page_title":"Áreas metropolitanas de Colombia","context_page_description":"Áreas metropolitanas de Colombia es, de acuerdo a la ley 1625 de 2013, una entidad administrativa formada por un conjunto de dos o más municipios integrados alrededor de un municipio que sirve de núcleo o metrópoli. Debido a que estas entidades están vinculados entre sí por estrechas relaciones de orden físico, económico y social, se requiere por tanto de una administración coordinada para la programación de su desarrollo y la racional prestación de sus servicios públicos.​​ Las áreas metropolitanas están dotadas de personería jurídica de derecho público, autonomía administrativa, patrimonio y autoridades propias.​ En Colombia han sido configuradas y/o reconocidas unas 10 áreas metropolitanas."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%B1%D8%AE%D8%AA%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Flag_of_Nerekhta_%28Kostroma_oblast%29.png","page_title":"نرختا","context_page_description":"نرختا هي إحدى مدن روسيا في الكيان الفدرالي الروسي كوستروما أوبلاست."},{"page_url":"https://en.wikipedia.org/wiki/Dutch_heraldry","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Escudo_tajado.JPG","page_title":"Dutch heraldry","context_page_description":"The study of Dutch heraldry focuses on the use of coats of arms and other insignia in the country of the Netherlands. Dutch heraldry is characterised by its simple and rather sober style, and in this sense, is closer to its medieval origins than the elaborate styles which developed in other heraldic traditions."},{"page_url":"https://cs.wikipedia.org/wiki/Rota%C4%8Dn%C3%AD_%C4%8D%C3%ADselnice","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Telefon04_2.jpg","page_title":"Rotační číselnice","context_page_description":"Rotační číselnice je součást starších telefonních přístrojů a veřejných telefonních automatů, která umožňuje volbu telefonního čísla v systémech s pulzní signalizací. Za jejího vynálezce je považován Almon Brown Strowger, jehož patentová přihláška podaná 21. prosince 1891 byla přijata jako U.S. patent #486,909 dne 29. listopadu 1892.\\nKlasická rotační číselnice byla mechanické zařízení s jedním kontaktem. V klidu a v průběhu natahování zvoleného čísla byl kontakt sepnutý. Zpětný pohyb číselnice byl umožněn pérem a odstředivou brzdou. Výsledkem byl zpětný pohyb číselnice konstantní rychlostí a současně rozpojování kontaktu s frekvencí cca 10 Hz. Číslici 1 odpovídalo 1 přerušení obvodu, číslici 9 odpovídalo devět impulzů a číslici 0 pak deset impulzů. Na konci zpětného pohybu byla mrtvá doba, za kterou se nevyslaly další 2 impluzy. Ta sloužila k tomu, aby telefonní ústředna měla čas k provedení dalších úkonů. Rotační číselnice byla ve skutečnosti konstruovaná jako 12 impulzová, ale poslední dva neodesílala.\\nPozději se objevily tlačítkové impulzní číselnice realizované elektronickými obvody. Ty však byly brzy překonány tlačítkovými číselnicemi s tónovou volbou."},{"page_url":"https://es.wikipedia.org/wiki/Protectorado_franc%C3%A9s_de_Camboya","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Flag_of_Cambodia_under_French_protection.svg","page_title":"Protectorado francés de Camboya","context_page_description":"El Protectorado francés de Camboya, se refiere al Reino de Camboya cuando era un protectorado francés dentro de la Indochina francesa - una colección de protectorados del sudeste asiático dentro del Imperio colonial francés. El protectorado fue establecido en 1867 cuando el rey camboyano Leggio Norodom solicitó el establecimiento de un protectorado francés sobre su país, mientras tanto, Siam renunció a la soberanía sobre Camboya y reconoció oficialmente el protectorado francés en ella. Camboya se integró en la unión de Indochina francesa en 1887 junto con las colonias y protectorados franceses en Vietnam. En 1946, a Camboya se le concedió el autogobierno dentro de la Unión Francesa y se abolió su estatus de protectorado en 1949. Camboya ganó posteriormente su independencia y el día independiente se celebró el 9 de noviembre de 1953."},{"page_url":"https://ro.wikipedia.org/wiki/Ordinul_corintic","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/The_Feast_in_the_House_of_Levi_by_Paolo_Veronese_%28edited_2%29.jpg","page_title":"Ordinul corintic","context_page_description":"Ordinul corintic este ultimul dezvoltat dintre cele trei ordine clasice principale ale arhitecturii grecești și romane antice. Celelalte două sunt ordinul doric, care e cel mai timpuriu, urmat de cel ionic. Când arhitectura clasică a fost reînviată în timpul Renașterii, au fost adăugate la canon încă două ordine: cel toscan și cel compozit. Corinticul, cu versiunea sa compozită, e cel mai ornamentat dintre ordine. Acest stil arhitectural se caracterizează prin coloane subțiri canelate și cu capiteluri elaborate decorate cu frunze de acantă și niște volute foarte mici în partea de sus. De-a lungul istoriei au apărut mai multe variante.\\nTermenul „Corintic” derivă de la vechiul oraș grecesc Corint, chiar dacă stilul avea un model propriu în practica romană, în urma precedentelor stabilite de Templul lui Marte Pedepsitorul din Forumul lui Augustus. A fost folosit în sudul Galiei la Maison Carrée și la Templul comparabil al lui Augustus și al Liviei din Vienne. Alte exemple principale remarcate de Mark Wilson Jones sunt ordinul inferioar al Bazilicii Ulpia și Arcul lui Traian din Ancona, Columna lui Focas și Templul lui Bacchus din Baalbek."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1959/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Armand_MARSICK_%281908%29.jpg","page_title":"Lijst van personen overleden in 1959/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1959.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B0%A2%E5%B0%94%E6%AF%94%E9%87%8E%E9%A9%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Shelby_GT.jpg","page_title":"谢尔比野马","context_page_description":"謝爾比是由謝爾比美國於1965至1967年所創造的一種高性能的福特野馬變種車，以及於1968至1970年所創造的汽車。繼推出第五代福特野馬後，謝爾比的標示牌於2007年在野馬的高性能版本中所復興，但此次的設計和組裝是在福特本身的組裝工廠所完成。"},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Esteve_de_Pallerols_de_Rialb","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Pl%C3%A0nol_sant_esteve_pallerols.jpg","page_title":"Sant Esteve de Pallerols de Rialb","context_page_description":"Sant Esteve de Pallerols de Rialb és una església medieval catalana neoclàssica, però d'origen romànic, a la població de Pallerols de Rialb al municipi de la Baronia de Rialb. Juntament amb l'església s'hi troba l'antiga escola i la rectoria, que actualment es troba en fase de rehabilitació per tal de convertir-se en un punt de trobada pel peregrins del camí de Pallerols a Andorra. Forma part de l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://en.wikipedia.org/wiki/Millwall_brick","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Millwall_brick_held.jpg","page_title":"Millwall brick","context_page_description":"A \\"Millwall brick\\" is an improvised weapon made of a manipulated newspaper, used as a small club. It was named after supporters of Millwall F.C., who had a reputation for football hooliganism. The Millwall brick was allegedly used as a stealth weapon at football matches in England during the 1960s and 1970s. The weapon's popularity appears to have been due to the wide availability of newspapers, the difficulty in restricting newspapers being brought into football grounds, and the ease of its construction."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%82%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/%D9%85%D8%B3%D8%AC%D8%AF_%D8%AC%D8%A7%D9%85%D8%B9_%D9%82%D9%85.jpg","page_title":"قم","context_page_description":"قم\\nاسلامی جمہوریہ ایران دے اہ‏م شہراں وچ اک شہر ا‏‏ے۔ جسنو‏ں قم المقدس دے ناں تو‏ں یاد کیتا جاندا ا‏‏ے۔ ایران دا آٹھواں وڈا شہر اے ۔ تے شیعہ مسلماناں دا نجف اشرف عراق دے بعد سب تو‏ں اہ‏م علمی مرکز شمار ہوتاا‏‏ے۔ قم، اہل تشیع دے لئی بہت اہمیت دا حامل شہر اے ۔ اس شہر وچ شیعاں دے اٹھويں امام علی بن موسی الرضامعروف بہ امام رضا د‏‏ی بہن فاطمہ معصومہ دا مزار اے جس د‏‏ی زیارت دے لئی دنیا بھر تو‏ں شیعہ ایتھ‏ے اُتے اکٹھے ہُندے نيں۔2011ء د‏‏ی مردم شماری دے مطابق قم د‏‏ی آبادی 1074036 سی ۔ اس آبادی دا اک بہت وڈا حصہ علماء تے دینی تعلیم حاصل کرنے والے طالب علماں دا اے، انہاں علماء تے طالب علماں وچ ایرانیاں دے علاوہ ہزاراں د‏‏ی تعداد وچ افغانی، عراقی، پاکستانی، ہندوستانی، لبنانی، کویندی، سعودی، بحرینی،یمنی، جزائری، مراکشی، ترکی، آذری، انڈونیشین، ملائشین، سی ئیلنڈی، چینی تے ہور یورپی ملکاں دے لوگ وچ شامل نيں۔ قم د‏‏ی آبادی وچو‏ں 99.76 فی صد آبادی شیعہ اثنا عشری نيں۔ اس شہر وچ اہل سنت دا کوئی گھرانہ نئيں اے بلکہ بقیہ زرتشتی یا فیر مسیحی دین دے پیروکار آباد نيں۔\\nقم ایران دا اک شہر اے۔ اے قم دریا دے کنڈے تے تہران توں دکھن ول وس ریا اے۔شیعہ مسلماناں دا اک اہم اور مقدس شہر شمار کیتا جاندا اے۔"},{"page_url":"https://vi.wikipedia.org/wiki/Psectra_diptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Psectra_diptera.jpg","page_title":"Psectra diptera","context_page_description":"Psectra diptera là một loài côn trùng trong họ Hemerobiidae thuộc bộ Neuroptera. Loài này được Burmeister miêu tả năm 1839."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%81%93303%E5%8F%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/R303-192.jpg","page_title":"国道303号","context_page_description":"国道303号は、岐阜県岐阜市から福井県三方上中郡若狭町に至る一般国道である。"},{"page_url":"https://de.wikipedia.org/wiki/Santa_Maria_del_Castello_(Mesocco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Sta_Maria_del_Castello_Nordseite.JPG","page_title":"Santa Maria del Castello (Mesocco)","context_page_description":"Die katholische Kirche Santa Maria del Castello steht unterhalb des Castello di Mesocco bei Mesocco im Misox im Kanton Graubünden in der Schweiz."},{"page_url":"https://fr.wikipedia.org/wiki/Annoire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Mairie-Annoire.jpg","page_title":"Annoire","context_page_description":"Annoire est une commune française située dans le département du Jura, en région Bourgogne-Franche-Comté."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A8%81%E5%BB%89%C2%B7%E9%98%BF%E9%81%93%E5%A4%AB%C2%B7%E5%B8%83%E6%A0%BC%E7%BD%97%E7%BB%98%E7%94%BB%E4%BD%9C%E5%93%81%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Lesprunes_W-A_Bouguereau1900.png","page_title":"威廉·阿道夫·布格罗绘画作品列表","context_page_description":"威廉·阿道夫·布格罗是19世纪末的法国学院派画家。已知绘画作品828幅，创作于1845至1905年间。"},{"page_url":"https://it.wikipedia.org/wiki/Emanuele_Paparo","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Paparo_sl.JPG","page_title":"Emanuele Paparo","context_page_description":"Emmanuele Paparo è stato un pittore, architetto e scrittore italiano."},{"page_url":"https://ro.wikipedia.org/wiki/Gabriel_Marcel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Gabriel_Marcel_%281969%29.jpg","page_title":"Gabriel Marcel","context_page_description":"Gabriel Honoré Marcel a fost un filozof, dramaturg, editor de carte, critic literar și teatral, muzicolog și teatrolog francez."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BA%D0%B8_%D1%88%D0%BE%D1%99%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Tiki3.jpg","page_title":"Тики шоља","context_page_description":"Тики шоља је керамички суд за пијење настао педесетих година двадесетог века за потребе тики барова и тропских тематских ресторана. Изумео их је Дон Бичкомбер, који је такође имао удео у популаризовању коктелских кишобранчића. На оваквим шољама, које су најчешће облика полинежанског идола, могу бити представљене гравире и остали симболи и теме из живота становника Полинезије, Микронезије и Меланезије. У најопштијем случају, присутан је ма какав тропски мотив — плажа, вахине, сурфовање, море и друго.\\nИспрва, овај суд за испијање створен је као карактеристично и маркетиншко дело тики културе. Шездесетих година двадесетог века, предузећа и други прозвођачи керамике постали су заинтересовањи и за тики шоље и тако их пласирали на тржиште. Најпопуларнији су били безбојни примерци, такозвани калупи, које хобисти могу украшавати и осликавати по жељи. Осамдесетих и деведесетих, продавнице типа „све за долар“ преплављене су овим артиклима. То је био део обнове интересовања за „рајске дестинације“ и њихову културу.\\nМада је након тога употреба тики шоља замрла, хобисти и уметници чије је интересовање керамика наставили су са кућном произвоњом сопствених примерака, али у малом броју."},{"page_url":"https://en.wikipedia.org/wiki/GNRI_Class_T","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Trains_lined_up_at_sheds%2C_Adelaide%2C_Co._Antrim._%2819861078829%29.jpg","page_title":"GNRI Class T","context_page_description":"The Great Northern Railway T class were 4-4-2T Atlantic locomotives built by Beyer, Peacock and Company in 1913. Five of this type were built. They were later rebuilt with superheaters as class T1.\\nAs the T1 class, they featured 18 x 24 inch or 18½ x 24 inch cylinders with 5 foot 9 inch wheels, built to 5 feet 3 inches gauge."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BB%90c_s%C3%AAn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Snail_in_Ubud%2C_Bali%2C_2010_%281%29.jpg","page_title":"Ốc sên","context_page_description":"Ốc sên hay ốc sên hoa hay còn gọi là ốc ma là loài động vật thân mềm sống trên cạn, thuộc họ Achatinidae."},{"page_url":"https://en.wikipedia.org/wiki/T%E1%BB%8Bnh_X%C3%A1_Trung_T%C3%A2m","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/T%E1%BB%8Bnh_X%C3%A1_Trung_T%C3%A2m%2C_s%E1%BA%A3nh_ch%C3%ADnh.JPG","page_title":"Tịnh Xá Trung Tâm","context_page_description":"Tịnh Xá Trung Tâm is a Buddhist temple in Ho Chi Minh City, the largest city in Vietnam. It was founded in 1965 and is the spiritual birthplace of the khất sĩ tradition of Vietnamese Buddhism that attempts to recreate the original tradition of the Buddhist sangha by walking barefoot and begging for alms. The temple is located at 7 Nguyễn Trung Trực Street, in Bình Thạnh District. It is known for its weekly Bát Quan Trai Giới retreat, which is staged more frequently than at other institutions in the city, and has a reputation among its followers for rigour and discipline. The attendees of the temple are typically over 40 years of age and are overwhelmingly female.\\nThe temple is set on a plot of 5,490 square metres, and construction took ten years. Initially, the complex comprised two halls, two compounds for the sangha other buildings. The temple was the headquarters of the Vietnamese khất sĩ Sangha Association until 1980. In 1998, an octagonal nine-story tower, named the Buddha Gem Tower, was built. The tower is lit at night and is visible throughout the surrounding area. The bottom four floors form the library as well as the repository for some relics of Gautama Buddha."},{"page_url":"https://nl.wikipedia.org/wiki/Evangelos_Venizelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/%CE%A3%CF%85%CE%BD%CE%AD%CE%BD%CF%84%CE%B5%CF%85%CE%BE%CE%B7_%CE%A4%CF%8D%CF%80%CE%BF%CF%85_%CE%92%CE%B1%CE%B3%CE%B3%CE%AD%CE%BB%CE%B7_%CE%92%CE%B5%CE%BD%CE%B9%CE%B6%CE%AD%CE%BB%CE%BF%CF%85_%CF%83%CF%84%CE%B7%CE%BD_%CE%9A%CE%BF%CE%BC%CE%BF%CF%84%CE%B7%CE%BD%CE%AE_24.05.2007_CROP.jpg","page_title":"Evangelos Venizelos","context_page_description":"Evangelos Venizelos is een Grieks politicus en lid van het Griekse Parlement voor de socialistische partij PASOK. In het verleden heeft hij verschillende ministerposten bekleed en was hij meermaals vicepremier."},{"page_url":"https://fr.wikipedia.org/wiki/Vitoria_(cuirass%C3%A9)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Vitoria.jpg","page_title":"Vitoria (cuirassé)","context_page_description":"Le Vitoria était un Cuirassé à coque en fer de la Marine espagnole."},{"page_url":"https://it.wikipedia.org/wiki/Bagneux_(Meurthe_e_Mosella)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bagneux54.jpg","page_title":"Bagneux (Meurthe e Mosella)","context_page_description":"Bagneux è un comune francese di 155 abitanti situato nel dipartimento della Meurthe e Mosella nella regione del Grand Est."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D1%85%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%BC_%D0%9B%D0%B8%D0%B4%D0%B2%D0%B0%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Lidval_House_balcony.jpg","page_title":"Доходный дом Лидваль","context_page_description":"Доходный дом Лидваль — памятник северного модерна в Санкт-Петербурге. Находится по адресу: Каменноостровский проспект, д. № 1-3 / Малая Посадская улица, д. № 5 / Кронверкский проспект, д. № 15. Построен в 1899—1904 годах.\\nДоходный дом Иды Амалии Лидваль — первая самостоятельная работа выдающегося архитектора Ф. И. Лидваля, выполнена по заказу его матери. Северное крыло дома являлось особняком Лидвалей."},{"page_url":"https://es.wikipedia.org/wiki/Beglik_Tash","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Begliktash_Tunnel.jpg","page_title":"Beglik Tash","context_page_description":"Beglik Tash es un santuario tracio de roca situado en la costa sur del Mar Negro de Bulgaria, a pocos kilómetros al norte de la ciudad de Primorsko.\\nBeglik Tash es un fenómeno natural de enormes megalitos dispuestos y tallados por una tribu tracia y luego se utilizaron para las ceremonias religiosas. Es parte de un área más amplia alrededor y una formación rocosa natural de grandes bloques monolíticos de origen volcánico, y se formaron de magma endurecido que entró en erupción de un volcán activo durante la era Mesozoica. En la actualidad, el museo al aire libre es mantenido por la Sociedad Histórica de Burgas. La mayoría de los megalitos tienen restos de tallas de los efectos de los rituales de Tracia. También están los restos de un laberinto que los visitantes pueden pasar a través de él. El reloj de sol es de Tracia y está formado por grandes piedras. También hay una roca enorme grande, de pie en tan sólo dos puntos y una cueva, parecida a falda de una mujer."},{"page_url":"https://jv.wikipedia.org/wiki/Prau_panumpes_Jepang_Hatsuyuki_(1928)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Hatsuyuki.jpg","page_title":"Prau panumpes Jepang Hatsuyuki (1928)","context_page_description":"Prau Hatsuyuki iku prau panumpes klas Fubuki kang kaanggo nalika Perang Donya II darbéné Wadya Sagara Kamaharajan Jepang. Prauné minangka prau angka loro kang kaaran mitrut jenengé \\"Hatsuyuki\\".\\nHatsuyuki kapernahaké rikala 12 April 1927 déning Astragara Wadya Sagara Maizuru; banjur kababar rikala 29 Sèptèmber 1928. Prau iki kinepyakaké rikala 30 Maret 1929 ing pamangkuné Lètnan Kolonèl Saburo Ishibashi. Prau iki kèrem rikala 17 Juli 1943 ing Kepuloan Shortlands."},{"page_url":"https://en.wikipedia.org/wiki/Pete_Wishart","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Official_portrait_of_Pete_Wishart_crop_2.jpg","page_title":"Pete Wishart","context_page_description":"Peter Wishart is a Scottish National Party politician and rock / folk musician who has served as the Member of Parliament for Perth and North Perthshire since 2005. Wishart previously served as the MP for North Tayside from 2001 until the seat was abolished for the 2005 general election.\\nWishart is currently the SNP Shadow Leader of the House in the House of Commons and the chair of the Scottish Affairs Select Committee. He has previously served as the SNP's Westminster Spokesperson for the Constitution and for Culture and Sport and Chief Whip. He is also a former keyboard player of the Scottish Celtic rock bands Runrig and Big Country.\\nHe is the longest-serving Scottish National Party MP."},{"page_url":"https://en.wikipedia.org/wiki/John_William_Lambert","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/John_William_Lambert_1909.png","page_title":"John William Lambert","context_page_description":"John William Lambert was an American automotive pioneer, inventor, automobile manufacturer, and the inventor of the first American gasoline automobile."},{"page_url":"https://nl.wikipedia.org/wiki/Henry_Hudson_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Henry_Hudson_Bridge_1936.jpg","page_title":"Henry Hudson Bridge","context_page_description":"De Henry Hudson Bridge is een stalen tolbrug in New York tussen Bronx en het noordeinde van Manhattan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Guingamp","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Guingamp_%2822%29_Basilique_01.jpg","page_title":"Liste der Monuments historiques in Guingamp","context_page_description":"Die Liste der Monuments historiques in Guingamp führt die Monuments historiques in der französischen Gemeinde Guingamp auf."},{"page_url":"https://ga.wikipedia.org/wiki/Loughton","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Loughton_Hall-geograph.org.uk-1226307.jpg","page_title":"Loughton","context_page_description":"Is baile suite in Essex é Loughton."},{"page_url":"https://lt.wikipedia.org/wiki/Balcersas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Flag_of_Balzers_Liechtenstein.png","page_title":"Balcersas","context_page_description":"Balcersas – miestelis ir apskritis pietų Lichtenšteine. 4,4 tūkst. gyventojų. Pagrindinė miestelio dalis įsikūrusi rytiniame Reino krante."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AA%D8%B1%D9%88_%D9%85%D8%AF%D8%B1%D9%8A%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Madrid_Metro_Sign.jpg","page_title":"مترو مدريد","context_page_description":"مترو أنفاق مدريد هو نظام مترو الانفاق الكبيرة التي انشأت في مدينة مدريد, وهو واحد من أكبر نظم مترو الانفاق في العالم، ويمتد ليغطي أغلب اجزاء المدينة خاصة بالنظر إلى ان مدريد يبلغ عدد سكانها حوالي 3,5 مليون إلى 6 ملايين. وتعد قطاراته من بين أطول 10 قطارات كهربائية تحت الأرض في العالم، والثالثة في أوروبا بعد لندن وموسكو، على الرغم من أن مدينة مدريد تعد تقريبا في المرتبة الخامسة والعشرين بين المدن الأكثر سكانا في العالم. وهو أيضا يعد واحداً من أكثر النظم سرعة في النمو في العالم، ضمن أشياء أخرى كثيرة، الانتهاء من التوسعات في ربيع 2007 إلى زيادة طوله إلى 317 كيلومترا، مما يجعله ثالث أكبر نظام مترو انفاق في العالم بعد نظامي لندن ونيويورك."},{"page_url":"https://de.wikipedia.org/wiki/Unruh_(Adelsgeschlecht)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Unruh2siebmacher.JPG","page_title":"Unruh (Adelsgeschlecht)","context_page_description":"Der Familienname von Unruh bezeichnet mehrere nicht miteinander verwandte adelige Familien."},{"page_url":"https://pt.wikipedia.org/wiki/Turismo_em_Teres%C3%B3polis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Dedo_de_deus_tere.jpg","page_title":"Turismo em Teresópolis","context_page_description":"Teresópolis é uma cidade com diversas opções de turismo. O município é estadualmente conhecido pelo turismo do montanhismo. A cidade também conta com diversos atrativos naturais como as cascatas do Imbiú e a dos Frades.Outros atrativos turísticos de Teresópolis são seus eventos que atraem grande público tando da cidade quanto a de outros municípios."},{"page_url":"https://en.wikipedia.org/wiki/%CA%BBUpolu_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Upolu-Airport-MCB.jpg","page_title":"ʻUpolu Airport","context_page_description":"ʻUpolu Airport is a regional airport of the State of Hawai'i in Hawai'i County. Located on the northern tip of the Big Island, ʻUpolu Airport is 3 NM northwest of the unincorporated town of Hawi.\\nIt is included in the Federal Aviation Administration National Plan of Integrated Airport Systems for 2017–2021, in which it is categorized as a general aviation facility."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_h%C3%B6chsten_Geb%C3%A4ude_in_den_Niederlanden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Rotterdam_erasmus_mc.jpg","page_title":"Liste der höchsten Gebäude in den Niederlanden","context_page_description":"Der Artikel Liste der höchsten Gebäude in den Niederlanden umfasst eine Liste mit allen Gebäude in den Niederlanden über 100 Metern Höhe. Ein Gebäude gilt ab einer Höhe von 150 Metern als ein Wolkenkratzer. Die Niederlande weisen derzeit 6 fertiggestellte Wolkenkratzer mit einer Höhe von 150 Metern und mehr auf. Die höchsten Gebäude des Landes befinden sich in der Hafenstadt Rotterdam und nahezu alle höheren Gebäude im Land befinden sich innerhalb des Ballungsraums Randstad. Das höchste Gebäude des Landes ist derzeit der Maastoren mit einer Höhe von 164,8 Metern. 2021 soll De Zalmhaven fertiggestellt werden, der das erste Gebäude mit einer Höhe von mehr als 200 Metern sein wird."},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%A2tisserie_marocaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/P%C3%A2tisserie_marocaine_020.JPG","page_title":"Pâtisserie marocaine","context_page_description":"La pâtisserie marocaine regroupe l'ensemble des pâtisseries traditionnelles issues de la cuisine marocaine. Ces pâtisseries sont en majeure partie réalisées à base d'amandes et de miel et sont généralement accompagnées par du thé à la menthe."},{"page_url":"https://vi.wikipedia.org/wiki/Vilalba","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Situacion_Vilalba.png","page_title":"Vilalba","context_page_description":"Villalba là một đô thị thủ phủ comarca Terra Chá, tỉnh Lugo, cự ly 34 km so với tỉnh lỵ theo hướng bắc.\\nĐô thị này có dân số 15.455 người."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%84%E3%83%9E%E3%82%AB%E3%83%AFRPG","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Satsumakawa_RPG_2017-05-21.jpg","page_title":"サツマカワRPG","context_page_description":"サツマカワRPGは、ケイダッシュステージに所属する日本のピン芸人。山梨県甲府市出身。\\n本名、薩川 凜。WCS14期生。"},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_the_City_of_London","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/St_Ethelburga%2C_Bishopsgate_-_geograph.org.uk_-_1089576.jpg","page_title":"Grade I listed buildings in the City of London","context_page_description":"There are over 9,000 Grade I listed buildings in England. This page is a list of these buildings in the City of London."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%9D%E5%A1%9A%E5%8F%A4%E5%A2%B3_(%E6%9D%BE%E9%98%AA%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/ja/a/a9/%E5%AE%9D%E5%A1%9A1%E5%8F%B7%E5%A2%B3%E5%87%BA%E5%9C%9F_%E7%9B%BE%E5%BD%A2%E5%9F%B4%E8%BC%AA_%28%E4%B8%BB%E5%A2%B3%E4%B8%98%E5%87%BA%E5%9C%9F%29.JPG","page_title":"宝塚古墳 (松阪市)","context_page_description":"宝塚古墳は、三重県松阪市宝塚町・光町にある古墳2基の総称。宝塚古墳群を構成する古墳の2つ。国の史跡に指定され、1号墳の出土品は国の重要文化財に指定されている。"},{"page_url":"https://hu.wikipedia.org/wiki/Les_Agnettes_(metr%C3%B3%C3%A1llom%C3%A1s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Les_Agnettes_quais.jpg","page_title":"Les Agnettes (metróállomás)","context_page_description":"A Les Agnettes egy metróállomás Franciaországban, Párizsban a párizsi metró 13-as metróvonalán. Tulajdonosa és üzemeltetője a RATP."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_Turkey","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/2012-12-29_AMA_fec_%286a%29_t%C3%BCrkische_botschaft.JPG","page_title":"List of diplomatic missions of Turkey","context_page_description":"This is a list of diplomatic missions of Turkey, including consulates-general. In 1793, the first permanent Turkish embassy was established by Ottoman Sultan Selim III in London.\\nThe Republic of Turkey, which had a total of 39 missions abroad in 1924, is now represented by 246 official missions, excluding honorary consulates, throughout the world. Of these missions, 142 are embassies, 13 are permanent representations, 89 are consulates-general and one is a trade office. According to the Global Diplomacy Index \\"2016 Country Ranking\\", Turkey is the sixth country, only after the P-5 members, in number of worldwide representations.\\nIt is also the only country to have an embassy in the Turkish Republic of Northern Cyprus; no other country recognizes TRNC as a sovereign state. It does not have an embassy in Armenia, a neighbouring country, because the two countries have not yet established diplomatic relations.\\nOf the 236 Turkish ambassadors in service as of March 2016, 37 are women."},{"page_url":"https://en.wikipedia.org/wiki/Coxcomb_prominent","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Ptilodon_capucina02.jpg","page_title":"Coxcomb prominent","context_page_description":"The coxcomb prominent is a moth of the family Notodontidae. It is a common species throughout the Palearctic ecozone from Ireland to Japan. It was first described by Carl Linnaeus in his 1758 10th edition of Systema Naturae.\\nThis species has brown forewings, varying considerably in tone, with indistinct darker markings. The hindwings are buffish with a black spot at the tornus. At rest, the species has a very distinctive profile with tufts of hairs protruding upwards from the thorax and the hind edge of the forewings. The margins of the forewings are also wavy. This rather \\"lumpy\\" appearance has led to the rather fanciful comparison to the comb on a cock's head. Two broods are produced each year with adults on the wing in May and June and again in August and September. This moth flies at night and is attracted to light.\\nThe larva is green or brown with a yellow stripe down each side and two red humps at the rear end. It is polyphagous and feeds on a wide variety of deciduous trees and shrubs. The species overwinters as a pupa.\\nThe flight season refers to the British Isles. This may vary in other parts of the range."},{"page_url":"https://ca.wikipedia.org/wiki/Regionalisme_americ%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Midnight_ride.jpg","page_title":"Regionalisme americà","context_page_description":"El Regionalisme americà és un moviment d'art modern realista dels Estats Units que va incloure pintures, murals, litografies i il·lustracions que representen escenes realistes de l'Amèrica rural i de pobles petits principalment a l'Oest Mitjà i al Sud profund. Va sorgir a la dècada de 1930 com a resposta a la Gran Depressió, i va acabar a la dècada de 1940 a causa del final de la Segona Guerra Mundial i la falta de desenvolupament dintre del moviment. Va arribar al seu cim de popularitat entre 1930 i 1935, ja que va ser molt apreciat per les seves imatges tranquil·litzadores del cor dels Estats Units durant la Gran Depressió. Malgrat les principals diferències estilístiques entre artistes específics, l'art regionalista en general tenia un estil relativament conservador i tradicionalista que apel·lava a les sensibilitats dels Estats Units populars, mentre que s'oposava estrictament a la suposada dominació de l'art francès."},{"page_url":"https://pt.wikipedia.org/wiki/Cinquenta_maiores_diretores_e_seus_100_melhores_filmes_(Entertainment_Weekly)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Fritz_Lang_%281969%29.jpg","page_title":"Cinquenta maiores diretores e seus 100 melhores filmes (Entertainment Weekly)","context_page_description":"Em 1996, no centenário do cinema, a revista estadunidense Entertainment Weekly publicou a lista dos 50 maiores cineastas de todos os tempos e dois filmes obrigatórios de cada um. Segundo a mesma, o critério seria: \\"um corpo consistente de trabalho ou um punhado de ótimos filmes; uma visão convincente; um estilo inovador; acima de tudo, um selo pessoal que abrange filmes, gêneros e décadas. Tentamos equilibrar o time da casa contra diretores de outros países e gênios do passado contra prodígios presentes. Se a lista é gritantemente composta por homens brancos - um fato inevitável da história do cinema - é porque ainda é muito cedo para refletir as diferentes vozes que começam a ser ouvidas\\"."},{"page_url":"https://ca.wikipedia.org/wiki/Drezna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Drezna_lyceum.jpg","page_title":"Drezna","context_page_description":"Drezna - Дрезна és una ciutat de la província de Moscou, a Rússia. Es troba a la vora del riu Drezna, un afluent del Kliazma, a 77 km a l'est del centre de Moscou."},{"page_url":"https://hu.wikipedia.org/wiki/Spacewar!","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Spacewar1.svg","page_title":"Spacewar!","context_page_description":"A Spacewar! egy 1962-es videójáték, amelyet Steve Russell fejlesztett ki az MIT-n az egyetem 1961-ben üzembe helyezett PDP-1 számítógépén. Ez a játék forradalminak számít, hiszen ez volt az első videójáték. Két űrhajó szerepel a játékban, amelyeket természetesen emberek irányítanak. A lényeg az, hogy a játékosok elpusztítsák egymás hajóját, és ne csapódjanak neki a repülő aszteroidáknak/csillagoknak. Mivelhogy a Spacewar! volt az első számítógépes játék, nagyon népszerű volt. Manapság már nem elérhető, habár így is kultusz státuszt ért el. Később más hasonló játékok készültek, amelyek gyakorlatilag a Spacewar! utánzatai, megpróbálták meglovagolni a sikerét. 2007-ben a New York Times az egyik legjobb játéknak nevezte ki. 1978-ban ugyanilyen címmel, bár más írásmóddal megjelent a forradalmi játék Atari 2600 platformra."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Regensburg-Westenviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Prebrunnallee_7_Regensburg_2014_a.JPG","page_title":"Liste der Baudenkmäler in Regensburg-Westenviertel","context_page_description":"Auf dieser Seite sind die Baudenkmäler der bayerischen Gemeinde Regensburg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://es.wikipedia.org/wiki/Motines_anticlericales_de_1835","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ripoll-fanatisme-laic-1835-1_%28aquarela_de_Soler_i_Rovirosa%29.png","page_title":"Motines anticlericales de 1835","context_page_description":"Los motines anticlericales de 1835 fueron unas revueltas contra las órdenes religiosas en España, fundamentalmente por su apoyo a los carlistas en la guerra civil iniciada tras la muerte del rey Fernando VII a finales de 1833, y que se produjeron durante el verano de 1835 en Aragón y, sobre todo, en Cataluña, dentro del contexto de las sublevaciones de la Revolución liberal española que pretendían poner fin al régimen del Estatuto Real, implantado en 1834 por la regente María Cristina de Borbón-Dos Sicilias, y dar paso a un monarquía constitucional con el restablecimiento de la Constitución de 1812. Los motines anticlericales más importantes tuvieron lugar en Zaragoza y en Reus, Barcelona y otras localidades catalanas, durante los cuales fueron asaltados numerosos conventos y monasterios y resultaron muertos setenta miembros del clero regular y ocho sacerdotes, lo que trajo a la memoria lo ocurrido un año antes en la matanza de frailes en Madrid de 1834."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E6%B5%B7%E8%A6%B3%E5%85%89%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Nadabus_Naddy.jpg","page_title":"日本海観光バス","context_page_description":"日本海観光バス株式会社は、石川県加賀市に本社を置くバス事業者。"},{"page_url":"https://ca.wikipedia.org/wiki/Castell_de_Castellar","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Castell_de_Castellar2.JPG","page_title":"Castell de Castellar","context_page_description":"El Castell de Castellar és un castell termenat adaptat com a masia del municipi d'Aguilar de Segarra declarat bé cultural d'interès nacional."},{"page_url":"https://pl.wikipedia.org/wiki/Farma_wiatrowa_Wartkowo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Logo_of_Poland.png","page_title":"Farma wiatrowa Wartkowo","context_page_description":"Farma wiatrowa Wartkowo – farma wiatrowa o mocy 31 MW zlokalizowana w miejscowości Wartkowo. Farma składa się z 15 turbin wiatrowych i została zbudowana przez firmę GDF SUEZ Energia Polska."},{"page_url":"https://en.wikipedia.org/wiki/Marilyn_Manson_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Nights_of_Nothing_MM.jpg","page_title":"Marilyn Manson (band)","context_page_description":"Marilyn Manson is an American rock band formed by namesake lead singer Marilyn Manson and guitarist Daisy Berkowitz in Fort Lauderdale, Florida, in 1989. Originally named Marilyn Manson & the Spooky Kids, they gained a local cult following in South Florida in the early 1990s with their theatrical live performances. In 1993, they were the first act signed to Trent Reznor's Nothing Records label. Until 1996, the name of each member was created by combining the first name of a female sex symbol and the last name of a serial killer, for example Marilyn Monroe and Charles Manson. Their lineup has changed between many of their album releases; the eponymous lead singer is the only remaining original member.\\nIn the past, band members dressed in outlandish makeup and costumes, and engaged in intentionally shocking behavior both onstage and off. Their lyrics often received criticism for their anti-religious sentiment and references to sex, violence and drugs, while their live performances were frequently called offensive and obscene."},{"page_url":"https://de.wikipedia.org/wiki/Cray","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Cray_XE6.jpg","page_title":"Cray","context_page_description":"Cray Inc. ist ein Unternehmen, das 1972 unter dem Namen Cray Research von Seymour Cray gegründet wurde.\\nDas Unternehmen stellt Supercomputer her, deren Rechenleistung heute im PFLOPS-Bereich liegt."},{"page_url":"https://fr.wikipedia.org/wiki/Kitty_Lange_Kielland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kielland-kitty-1843-1914-self-portrait.jpg","page_title":"Kitty Lange Kielland","context_page_description":"Christine Lange Kielland est une artiste peintre norvégienne née le 8 octobre 1843 à Stavanger et morte le 1ᵉʳ octobre 1914 à Oslo. Elle réalise essentiellement de la peinture de paysages."},{"page_url":"https://ro.wikipedia.org/wiki/Nirekha","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Nirekha.jpg","page_title":"Nirekha","context_page_description":"Nirekha este un munte cu altitudinea de 6.069 m, situat în masivul Himalaya, regiunea Khumbu. El a fost pentru prima oară escaladat de Matt Fioretti, Greg Valentine și ca prima femeie, de alpinista sudcoreeană Oh Eun-Sun."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%BD%D0%BE%D0%B2%D0%B0%D1%86%D0%B8%D1%98%D0%B5_%D1%83_%D0%BD%D0%B0%D1%81%D1%82%D0%B0%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Vizuelni_identitet_casopisa4.jpg","page_title":"Иновације у настави","context_page_description":"Иновације у настави је научни часопис чији је издавач Учитељски факултет Универзитета у Београду. Први број Часописа штампан је 1983. године.\\nЧасопис се налази на листи научних публикација Министарства просвете, науке и технолошког развоја Републике Србије. и реферише се у међународној бази података\\nИновације у настави излазе четири пута годишње, и у штампаној и у електронској форми."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BB_%D0%91%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Capital_Bra_bei_GERMANIA_%28Video-Format_von_funk%29.png","page_title":"Капитал Бра","context_page_description":"Capital Bra — немецкий рэпер русско-украинского происхождения. Также известен как просто Capital и как Joker Bra. Дебютировал с альбомом Kuku Bra в 2016 году. За свою карьеру выпустил шесть студийных альбомов, последний вышел в апреле 2019 года.\\nВ 2018 году с восемью синглами поднимался на 1-го место в Германии, поставив национальный рекорд по количеству песен одного исполнителя, занимавших первую позицию в течение одного года, и приблизившись к рекорду по общему количеству хитов номер 1 в этой стране за всё время.\\nКроме того, по итогам 2018 года он стал в своей стране самым прослушиваемым через стриминговые сервисы музыкальным исполнителем."},{"page_url":"https://sk.wikipedia.org/wiki/Geografia_%C4%8Ceska","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Pravcicka_brana_001.jpg","page_title":"Geografia Česka","context_page_description":"Tento článok popisuje geografické pomery v Česku."},{"page_url":"https://eu.wikipedia.org/wiki/Pradoluengo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Pradoluengo.jpg","page_title":"Pradoluengo","context_page_description":"Pradoluengo Burgosko udalerria da, Montes de Oca eskualdean dagoena.\\n2008ko urtarrilaren 1eko erroldaren arabera 1.460 biztanle zituen."},{"page_url":"https://it.wikipedia.org/wiki/Billy_Owens","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/2002_Summer_Pro_League_%28Long_Beach%29_-_Billy_Owens.jpg","page_title":"Billy Owens","context_page_description":"Billy Eugene Owens è un ex cestista statunitense, professionista nella NBA."},{"page_url":"https://es.wikipedia.org/wiki/Natschbach-Loipersbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/AUT_Natschbach-Loipersbach_COA.png","page_title":"Natschbach-Loipersbach","context_page_description":"Natschbach-Loipersbach es una localidad del distrito de Neunkirchen, en el estado de Baja Austria, Austria, con una población estimada a principio del año 2018 de 1702 habitantes.\\nSe encuentra ubicada al sur del estado, al sur de Viena y del río Danubio y a poca distancia al norte de la frontera con el estado de Estiria.​"},{"page_url":"https://fr.wikipedia.org/wiki/Juste_parmi_les_nations","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Kaddour_5846748964163.jpg","page_title":"Juste parmi les nations","context_page_description":"« Juste parmi les nations » est une expression du judaïsme tirée du Talmud.\\nEn 1953, la Knesset, en même temps qu’elle créait le mémorial de Yad Vashem à Jérusalem consacré aux victimes de la Shoah, décida d’honorer « les Justes parmi les nations qui ont mis leur vie en danger pour sauver des Juifs ». Le titre de Juste est décerné au nom de l’État d’Israël par le mémorial de Yad Vashem. Au 1ᵉʳ janvier 2016, 25 271 Justes parmi les nations de 46 pays ont été honorés ; la Pologne, les Pays-Bas et la France sont les pays dont les citoyens ont été le plus médaillés. En tout, les Justes ont sauvé des centaines de milliers de personnes.\\nIl s’agit actuellement de la plus haute distinction honorifique délivrée par l'État d'Israël à des civils."},{"page_url":"https://en.wikipedia.org/wiki/Dading_Kalbuadi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Dading_Kalbuadi_East_Timor.jpg","page_title":"Dading Kalbuadi","context_page_description":"Dading Kalbuadi was an Indonesian Army Officer and the commander of Operation \\"Seroja\\" during the Indonesian invasion of East Timor. He last served as an Inspector General of the Departement Of Defense of Indonesia. He collected over 25 medals and a number of honors from abroad, including from France, United States, Vietnam, Singapore, and Malaysia."},{"page_url":"https://hu.wikipedia.org/wiki/Arcizans-Dessus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Watermills_Val_d%27Azun.jpg","page_title":"Arcizans-Dessus","context_page_description":"Arcizans-Dessus település Franciaországban, Hautes-Pyrénées megyében. Arcizans-Dessus Salles, Bun, Gaillagos és Arras-en-Lavedan községekkel határos."},{"page_url":"https://ht.wikipedia.org/wiki/Rake,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/IAMap-doton-Rake.PNG","page_title":"Rake, Iowa","context_page_description":"Rake, Iowa se yon vil Etazini. Li sitye nan leta Iowa.\\nChèf-lye li se?."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE%E0%AE%B5%E0%AE%BF%E0%AE%B2%E0%AF%8D_%E0%AE%89%E0%AE%B3%E0%AF%8D%E0%AE%B3_%E0%AE%9A%E0%AE%BF%E0%AE%B5%E0%AE%A9%E0%AF%8D_%E0%AE%95%E0%AF%8B%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Kashiswar_Bhairava%2C_Andul.jpg","page_title":"இந்தியாவில் உள்ள சிவன் கோயில்கள்","context_page_description":"சிவன் ஒரு இந்து தெய்வம், இந்தியாவில் ஷைவர்களால் வணங்கப்படுபவர், அறியாமையை அழிப்பவர் பிரபஞ்சம் முழுவதும் பரவியுள்ளார். இந்து மதகுருவில் உள்ள மூன்று முக்கிய கடவுள்களில் ஒருவராக, இந்தியாவில் அவரது வழிபாட்டிற்காக அர்ப்பணிக்கப்பட்ட கோவில்கள் உள்ளன. அதில் மிகவும் முக்கியமானது உள்ளன ஜோதிலிங்க கோயில்கள் மற்றும் Mellacheruvu Swayabhu Shambhulingeshwara சுவாமி. ஷைவ மதத்தில், சிவன் அனைவருக்கும் கடவுள், பிரம்மா, விஷ்ணு மற்றும் இந்திரன் போன்ற தேவர்கள், பனசுரா மற்றும் ராவணன் போன்ற அசுரர்கள், ஆதிசங்கரா மற்றும் நயனர்கள் போன்ற மனிதர்கள் மற்றும் உயிரினங்கள் அனைவரையும் வணங்குவதாக விவரிக்கப்படுகிறார்கள். ஜடாயு, ஒரு கழுகு, மற்றும் வாலி, ஒரு குரங்கு. தெய்வங்கள், ரிஷிகள் மற்றும் கிரஹாக்கள் சிவனை வழிபட்டு பல்வேறு இடங்களில் சிவலிங்கங்களை நிறுவினர்."},{"page_url":"https://pl.wikipedia.org/wiki/Jan_Feliks_Piwarski","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Piwarski-Karczma_Ostatni_grosz-1845.jpg","page_title":"Jan Feliks Piwarski","context_page_description":"Jan Feliks Piwarski – – polski malarz i grafik, kustosz Gabinetu Rycin przy Uniwersytecie Warszawskim, profesor Szkoły Sztuk Pięknych w Warszawie. Jeden z pierwszych polskich litografów. Ojciec Adolfa Piwarskiego, miniaturzysty i rysownika, prapradziadek Andrzeja Jana Piwarskiego, malarza i grafika."},{"page_url":"https://it.wikipedia.org/wiki/The_Vessel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Hudson_Yards_Plaza_March_2019_18.jpg","page_title":"The Vessel","context_page_description":"The Vessel o semplicemente Vessel è una struttura architettonica e attrazione turistica situata a Manhattan, New York."},{"page_url":"https://es.wikipedia.org/wiki/Spurius_bicornis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Spurius_bicornis_sjh.jpg","page_title":"Spurius bicornis","context_page_description":"Spurius bicornis es una especie de coleóptero de la familia Passalidae."},{"page_url":"https://pt.wikipedia.org/wiki/Dumbr%C4%83veni_(Suceava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Dumbraveni_jud_Suceava.png","page_title":"Dumbrăveni (Suceava)","context_page_description":"Dumbrăveni é uma comuna romena localizada no distrito de Suceava, na região de Moldávia. A comuna possui uma área de 44.77 km² e sua população era de 8911 habitantes segundo o censo de 2007."},{"page_url":"https://de.wikipedia.org/wiki/Torriglia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Torriglia-IMG_0540.JPG","page_title":"Torriglia","context_page_description":"Torriglia ist eine italienische Gemeinde in der Metropolitanstadt Genua mit 2297 Einwohnern."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1977","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Roman_Magdziarczyk.jpg","page_title":"Lijst van personen geboren in 1977","context_page_description":"Dit is een lijst van personen die geboren zijn in 1977.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sv.wikipedia.org/wiki/Asha_Haji_Elmi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Asha_Haji_Elmi_DFID_2013_crop.jpg","page_title":"Asha Haji Elmi","context_page_description":"Asha Haji Elmi Amin, ibland Asha Hagi, född 1962, är en fredsaktivist och kvinnorättsaktivist i Somalia.\\nNär kvinnor uteslöts från fredsprocessen i Somalia, bildade Elmi en \\"Sjätte klan\\"-rörelse för att vinna en plats i församlingen. Hon valdes in i republiken Somalias övergångsregering den 29 augusti 2004, en plats hon kommer att inneha till 2009.\\nElmi ligger också bakom organisationen Save Somali Women and Children, som grundades mitt under inbördeskriget i Somalia.\\nElmi har fått internationellt erkännande för sin kamp mot kvinnlig könsstympning i Somalia och andra områden i Afrika. Hon reser ofta till högskolor och universitet världen över och föreläser om de politiska villkoren i Somalia, kvinnlig omskärelse och dess påverkan på kvinnor i Somalia.\\n1 oktober 2008 tillkännagavs att Elmi blev en av fyra mottagare av 2008 års Right Livelihood Award, ett pris på två miljoner som delas mellan mottagarna. Juryns motivering löd: ...for continuing to lead at great personal risk the female participation in the peace and reconciliation process in her war-ravaged country."},{"page_url":"https://vi.wikipedia.org/wiki/Epicyrtica_metallica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Epicyrtica_metallica.jpg","page_title":"Epicyrtica metallica","context_page_description":"Epicyrtica metallica là một loài bướm đêm thuộc họ Noctuidae. Loài này có ở Úc."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_Cichociemnych","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Tarnawski_Aleksander.jpg","page_title":"Lista Cichociemnych","context_page_description":"Lista 316 Cichociemnych jest wykazem skoczków spadochronowych, wysłanych podczas II wojny światowej do okupowanej Polski przez Oddział VI Sztabu Naczelnego Wodza, którym przyznano Znak dla skoczków do Kraju. Większość badaczy uznaje za zgodną z faktami liczbę 316 CC, jednak niektórzy sądzą że nie jest ona prawidłowa.\\nCichociemni byli żołnierzami w służbie specjalnej, którzy ochotniczo zgłosili się do służby w okupowanym kraju, w szeregach Armii Krajowej. Nie byli zwartą formacją ani oddziałem wojskowym, nie mieli własnego sztandaru, barw, patrona, ani też własnej tradycji. Zgodnie z normami Konwencji Genewskich nie mogli nosić mundurów. Wszelkie działania związane z wyszkoleniem CC oraz ich przerzuceniem do okupowanej Polski były tajne. Po akceptacji Naczelnego Wodza, 1 czerwca 1943 Szef Oddziału VI ppłk. dypl. Michał Protasewicz wydał \\"Instrukcję dla żołnierzy przerzucanych drogą lotniczą do Kraju\\" L.dz. 2525/tjn. 43. W rozpoczynającym ją pkt. I. A. podkreślono –- Wszystkie bez wyjątku czynności związane z lotem do kraju są ścisłą tajemnicą wojskową."},{"page_url":"https://sv.wikipedia.org/wiki/Aizawl","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/View_of_the_ridgetop_city_of_Aizawl%2C_state_capital_of_Mizoram.jpg","page_title":"Aizawl","context_page_description":"Aizawl är huvudstad i den indiska delstaten Mizoram. Folkmängden beräknades till cirka 350 000 invånare 2018.\\nStaden ligger 1 067 meter över havet och är ett centrum för handel i den omgivande bergsregionen."},{"page_url":"https://de.wikipedia.org/wiki/Antonow_An-30","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Lukaviatrans_Antonov_An-30.jpg","page_title":"Antonow An-30","context_page_description":"Die Antonow An-30 ist ein sowjetisches Luftbildflugzeug, das Ende der 1960er Jahre entwickelt wurde. Die Maschine ist als Schulterdecker ausgelegt. Der Grundentwurf stammt von der Antonow An-24 FK ab. Wie diese verfügt sie über zwei Turboprop-Triebwerke Iwtschenko-Progress AI-24. Unterscheidungsmerkmale sind der stark verglaste Bug, das hochgesetzte Cockpit und ein zusätzliches Strahltriebwerk in der rechten Triebwerksgondel. Wie die An-24 kann auch die An-30 auf wenig befestigten Kleinflugplätzen unter wechselnden Witterungsbedingungen operieren und verfügt über STOL-Eigenschaften."},{"page_url":"https://fr.wikipedia.org/wiki/Villa_Carlotta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Tremezzo_Villa_Carlotta_il_Salone_Marte_e_Venere.jpg","page_title":"Villa Carlotta","context_page_description":"La Villa Carlotta est un palais néo-classique de la fin du XVIIᵉ siècle, un parc botanique de style jardin à l'italienne de 7 hectares, et un musée d'art, de Tremezzo en Lombardie, au bord du lac de Côme en Italie. Considérée comme l'une des plus somptueuses villas de la visite du lac, elle est ouverte au tourisme de mars à octobre."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_mit_Bayerischen_Rauten","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Wappen_Kalbensteinberg.png","page_title":"Liste der Wappen mit Bayerischen Rauten","context_page_description":"Die Liste der Wappen mit den Bayerischen Rauten enthält Kommunalwappen sowie Vereins- oder Unternehmenslogos, auf denen die Bayerischen Rauten abgebildet sind. Lokal werden diese auch als Wittelsbacher Rauten oder Pfälzische Rauten bezeichnet.\\nDie Bayerischen Rauten gehen auf das Wappen der Grafen von Bogen in Niederbayern zurück und wurde nach dem Aussterben dieses Adelsgeschlechts 1242 von den Wittelsbachern als Stammwappen übernommen."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%84%A4%EB%8D%9C%EB%9E%80%EB%93%9C%EC%9D%98_%EC%9E%AC%EC%99%B8%EA%B3%B5%EA%B4%80_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Dutch_Embassy_in_Stockholm.jpg","page_title":"네덜란드의 재외공관 목록","context_page_description":"네덜란드의 재외공관 목록은 네덜란드 주재 대사관을 각국에 상주시켜 놓는 것을 의미하며 네덜란드의 재외공관을 나열한 목록이다."},{"page_url":"https://fr.wikipedia.org/wiki/Ranquel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Pueblos_indigenas_de_Chile.svg","page_title":"Ranquel","context_page_description":"Les Ranquels, en Argentine, sont une ethnie aborigène qui faisait partie des Mapuches, bien que leur ascendance ait été en grande partie d'origine het et tehuelche du groupe septentrional des Günün-a-küna ou Genakenks.\\nEntre 1775 et 1790, un groupe de pehuenches avança depuis les pentes andines jusqu'au territoire qui s'appelait Mamül Mapu parce qu'il était couvert de bois de caldén, d'algarrobo negro et de chañar.\\nAinsi, ils s'établirent entre le Río Cuarto ou Chocancharava et le Río Colorado, depuis le sud des territoires actuels de San Luis, et Córdoba, jusqu'au sud de la province de La Pampa.\\nLeur appellation de Ranquel est le résultat de l'européanisation à l'espagnole de leur propre autodénomination en mapudungun de Rankülche, où rankül veut dire canne ou roseau, et che signifie homme, c’est-à-dire « gens des cannes ou des roseaux ».\\nIls étaient chasseurs et généralement nomades. Durant une bonne partie du XIXᵉ siècle, ils eurent une alliance avec les tribus tehuelches. Ensemble, ils firent des incursions dans l'ouest de la province de Buenos Aires et le sud de celle de Córdoba, ainsi que dans celles de Mendoza, de San Luis et de Santa Fe."},{"page_url":"https://cy.wikipedia.org/wiki/Boynton_Beach,_Florida","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/WillieByrdRiders.JPG","page_title":"Boynton Beach, Florida","context_page_description":"Dinas yn Palm Beach County, yn nhalaith Florida, Unol Daleithiau America yw Boynton Beach, Florida. ac fe'i sefydlwyd ym 1895."},{"page_url":"https://vi.wikipedia.org/wiki/Men_g%E1%BB%91m","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Che_mau_mau.JPG","page_title":"Men gốm","context_page_description":"Men gốm là một lớp thủy tinh có chiều dày từ 0,15–0,4 mm phủ lên bề mặt xương gốm. Lớp thuỷ tinh này hình thành trong quá trình nung và có tác dụng làm cho bề mặt sản phẩm trở nên sít đặc, nhẵn, bóng."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%84%D0%B8%D1%86%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D1%84%D0%B0%D0%B2%D0%BE%D1%80%D0%B8%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Madame-de-Montespan2.jpg","page_title":"Официальная фаворитка","context_page_description":"Официа́льная фавори́тка — статус, которым мог наделить король Франции одну из своих возлюбленных. Отличие официальной фаворитки от всех остальных заключалось в том, что она имела возможность влиять на ход политических событий, активно вмешиваться в жизнь королевского двора и даже во внутрисемейные взаимоотношения правящей фамилии."},{"page_url":"https://en.wikipedia.org/wiki/Ashurnasirpal_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/BM%3B_RM7_-_ANE%2C_Nimrud_Palace_Reliefs_1_Northwest_Palace_of_Ashurnasirpal_II_%28883-859_B.C%29_~_Full_Elevation_%26_Viewing_South.JPG","page_title":"Ashurnasirpal II","context_page_description":"Ashur-nasir-pal II was king of Assyria from 883 to 859 BC.\\nAshurnasirpal II succeeded his father, Tukulti-Ninurta II, in 883 BC. During his reign he embarked on a vast program of expansion, first conquering the peoples to the north in Asia Minor as far as Nairi and exacting tribute from Phrygia, then invading Aram conquering the Aramaeans and Neo-Hittites between the Khabur and the Euphrates Rivers. His harshness prompted a revolt that he crushed decisively in a pitched, two-day battle. According to his monument inscription, while recalling this massacre he says:\\nTheir men young and old I took prisoners. Of some I cut off their feet and hands; of others I cut off the ears noses and lips; of the young men's ears I made a heap; of the old men's heads I made a minaret. I exposed their heads as a trophy in front of their city. The male children and the female children I burned in flames; the city I destroyed, and consumed with fire.\\nFollowing this victory, he advanced without opposition as far as the Mediterranean and exacted tribute from Phoenicia. On his return home, he moved his capital to the city of Kalhu."},{"page_url":"https://de.wikipedia.org/wiki/W%C3%BCnnewil-Flamatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Herrensitz_De_Weck_Jun_2011.jpg","page_title":"Wünnewil-Flamatt","context_page_description":"Wünnewil-Flamatt ist eine politische Gemeinde im Sensebezirk des Kantons Freiburg in der Schweiz. Bis 1974 wurde die Gemeinde offiziell Wünnewil genannt."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_madera_de_Granhult","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Granhults_kyrka.jpg","page_title":"Iglesia de madera de Granhult","context_page_description":"La iglesia de madera de Granhult es un templo luterano en el municipio de Uppvidinge, Kronoberg, Suecia. Es la iglesia de madera más antigua de Suecia, pues de acuerdo a una investigación dendrocronológica, fue construida en la década de 1220.\\nFormalmente, dejó de utilizarse como iglesia parroquial desde 1829, pero ha sido conservada por deseo de los parroquianos, quienes consiguieron en 1879 que fuera utilizada nuevamente con fines litúrgicos de manera esporádica."},{"page_url":"https://pl.wikipedia.org/wiki/Gien-sur-Cure","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Vue_sur_Gien-sur-Cure_%28Ni%C3%A8vre%2C_Fr%29.JPG","page_title":"Gien-sur-Cure","context_page_description":"Gien-sur-Cure – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Nièvre. W 2013 roku jej populacja wynosiła 100 mieszkańców. Przez gminę przepływa rzeka Cure."},{"page_url":"https://en.wikipedia.org/wiki/Crypturgus_pusillus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Crypturgus_pusillus_-_detail_%2832210950731%29.jpg","page_title":"Crypturgus pusillus","context_page_description":"Crypturgus pusillus is a species of typical bark beetle in the family Curculionidae."},{"page_url":"https://fr.wikipedia.org/wiki/Pr%C3%A9vision_volcanologique","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/MSH80_eruption_mount_st_helens_05-18-80.jpg","page_title":"Prévision volcanologique","context_page_description":"Les objectifs de la volcanologie sont de comprendre l'origine et le fonctionnement des volcans et des phénomènes assimilés afin d'établir un diagnostic sur les risques courus par les populations et les activités humaines. Les prévisions volcanologiques nécessitent la mise en œuvre de savoir de plusieurs disciplines scientifiques adaptées."},{"page_url":"https://fr.wikipedia.org/wiki/Luigi_Cherubini","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Medea_Cherubini_titelblad.jpg","page_title":"Luigi Cherubini","context_page_description":"Marie-Louis-Charles-Zénobi-Salvador Cherubini, né Maria Luigi Carlo Zenobio Salvatore Cherubini le 14 septembre 1760 à Florence et mort le 15 mars 1842 à Paris, est un compositeur italien de la fin du XVIIIᵉ et du début du XIXᵉ siècle, dont une grande partie de la carrière s'est déroulée en France à partir de 1787."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Z%C3%BCrich/Kreis_1_(Ost)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/ZB_Z%C3%BCrich_2008_neu.jpg","page_title":"Liste der Kulturgüter in Zürich/Kreis 1 (Ost)","context_page_description":"Die Liste der Kulturgüter in Zürich/Kreis 1 (Ost) enthält alle Objekte im östlichen Teil des Kreises 1 der Stadt Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nDie Liste umfasst Kulturgüter rechts der Limmat. Objekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://id.wikipedia.org/wiki/Orakel_Sibylline","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Sibyl_Domenichino.jpg","page_title":"Orakel Sibylline","context_page_description":"Orakel Sibylline adalah sekumpulan orakular yang ditulis dalam heksameter Yunani yang ditujukan kepada Sibyl, nabi perempuan yang mendapatkan wahyu ilahi. Empat belas buku dan delapan fragmen dari Orakel Sibylline masih ada, dalam edisi abad ke-6 atau ke-7. Karya tersebut tidak sama dengan Buku Sibylline yang asli dari mitologi Etruskan kuno dan agama Romawi kuno yang dibakar atas perintah jenderal Romawi Flavius Stilicho pada abad ke-4."},{"page_url":"https://it.wikipedia.org/wiki/Alagoinha_(Para%C3%ADba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Bras%C3%A3o_Alagoinha_%28PB%29.jpg","page_title":"Alagoinha (Paraíba)","context_page_description":"Alagoinha è un comune del Brasile nello Stato del Paraíba, parte della mesoregione dell'Agreste Paraibano e della microregione di Guarabira."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_Berlino","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Croce_di_ferro_Berlino_45.jpg","page_title":"Battaglia di Berlino","context_page_description":"La battaglia di Berlino fu l'ultima grande offensiva del teatro europeo della seconda guerra mondiale e segnò la sconfitta definitiva della Germania nazista. L'Armata Rossa sovietica prima travolse, nonostante l'accanita resistenza, il precario fronte tedesco sul fiume Oder, quindi accerchiò e attaccò direttamente la capitale del Terzo Reich, disperatamente difesa da reparti raccogliticci della Wehrmacht, delle Waffen-SS, della Hitlerjugend e del Volkssturm.\\nI sovietici, in netta superiorità numerica e di mezzi terrestri e aerei, riuscirono, al comando del maresciallo Georgij Žukov e del maresciallo Ivan Konev, a portare a termine la loro missione, a distruggere o catturare il grosso delle forze nemiche e a ottenere la resa di Berlino. I combattimenti sulla linea del fiume Oder e soprattutto all'interno dell'area urbana di Berlino, violenti e prolungati, costarono pesanti perdite di uomini e mezzi a entrambe le parti.\\nDurante la battaglia Adolf Hitler, che aveva deciso di rimanere nella capitale accerchiata per organizzare l'ultima resistenza, si tolse la vita per non cadere in mano sovietica."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A1%E0%B4%AF%E0%B5%8B%E0%B4%AA%E0%B5%8D%E0%B4%B8%E0%B5%88%E0%B4%A1%E0%B5%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Diopside_Aoste.jpg","page_title":"ഡയോപ്സൈഡ്","context_page_description":"പൈറോക്സിൻ ഗണത്തിൽ ഉൾപ്പെട്ട ഒരു മോണോക്ലിനിക് ധാതവമാണ് ഡയോപ്സൈഡ്. രാസസംഘടനം: Ca Mg Si₂ O₆. നൈസർഗിക ഡയോപ്സൈഡിൽ ക്രോമിയം, ടൈറ്റാനിയം, മാം‌ഗനീസ് എന്നിവ നിർണായകമാം വിധം ഉൾപ്പെട്ടിരിക്കും. ശുദ്ധ ഡയോപ്സൈഡ് 1391⁰C -ൽ ഉരുകുന്നു. മോണോക്ലിനിക് ക്രിസ്റ്റൽ വ്യൂഹത്തിൽ പ്രിസ്മിയ പരലുകളായി ക്രിസ്റ്റലീകരിക്കപ്പെടുന്ന ഡയോപ്സൈഡ് മിക്കപ്പോഴും തുല്യ ഘനമാനം പ്രദർശിപ്പിക്കുന്നു. ഇളം പച്ച, നീല, വെള്ള, തവിട്ട് എന്നിവയാണ് ധാതവത്തിന്റെ സാധാരണനിറങ്ങൾ.മാങ്ഗനീസ് അടങ്ങിയ നീലലോഹിത ഡയോപ്സൈഡ് വയ്ലെയ് ൻ എന്ന പേരിൽ അറിയപ്പെടുന്നു. ക്രോമിയം അടങ്ങിയ ഡയോപ്സൈഡിന് ഇരു പച്ചനിറമായിരിക്കും. രാസസംഘടനത്തിൽ ഇരുമ്പിന്റെ പരിമാണം വർധിക്കുന്നതിനാനുപാതികമായി ധാതവത്തിന്റെ അപവർത്തനാങ്കത്തിനും ആപേക്ഷിക ഘനത്വത്തിനും വ്യതിയാനം സംഭവിക്കുന്നു.\\nശരാശരി ആപേക്ഷിക ഘനം 3.3 - 3.6\\nകാഠിന്യം: 5.5 - 6.5\\nവിദളനം: പ്രിസ്മീയം എന്നിവയാണ് പ്രധാന ഭൗതിക ഗുണങ്ങൾ\\nസംസർഗിത കായാന്തരിത ശിലകളിൽ പ്രത്യേകിച്ചും ഡോളോമിറ്റിക് മാർബിളിലാണ് ഡയോപ്സൈഡിന്റെ ഉപസ്ഥിതി രേഖപ്പെടുത്തിയിട്ടുള്ളത്. അശുദ്ധ ഡോളോമൈറ്റിന് കായാന്തരണ ഫലമായി ഉണ്ടാകുന്ന പരിവർത്തനമാണ് ശുദ്ധ ഡയോപ്സൈഡിന്റെ രൂപീകരണത്തിന് നിദാനം."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Nancy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/26%2C_28_rue_H%C3%A9r%C3%A9%2C_Nancy%2C_France.jpg","page_title":"Liste des monuments historiques de Nancy","context_page_description":"Cet article recense les monuments historiques de Nancy, en France."},{"page_url":"https://ceb.wikipedia.org/wiki/Wis%C5%82a_%C5%9Amia%C5%82a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Wisla_Smiala_2.JPG","page_title":"Wisła Śmiała","context_page_description":"Distributariyo ang Wisła Śmiała sa Polskowa. Nahimutang ni sa gingsakopan sa Województwo Pomorskie, sa amihanang bahin sa nasod, 280 km sa amihanan-kasadpan sa Warsaw ang ulohan sa nasod. Wisła Śmiała nidagayday paingon ngadto sa Baltiko.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 20 °C, ug ang kinabugnawan Enero, sa -3 °C."},{"page_url":"https://en.wikipedia.org/wiki/Jam%C4%81l_al-D%C4%ABn_al-Afgh%C4%81n%C4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Asadabadi_square%2C_Tehran2.JPG","page_title":"Jamāl al-Dīn al-Afghānī","context_page_description":"Sayyid Jamāl al-Dīn al-Afghānī, also known as Sayyid Jamāl ad-Dīn Asadābādī and commonly known as Al-Afghani, was a political activist and Islamic ideologist who travelled throughout the Muslim world during the late 19th century. He is one of the founders of Islamic Modernism as well as an advocate of Pan-Islamic unity in Europe and Hindu–Muslim unity in India, he has been described as being less interested in minor differences in Islamic jurisprudence than he was in organizing a united response to Western pressure. He is also known for his involvement with his follower Mirza Reza Kermani in the successful plot to assassinate Shah Naser-al-Din, who Al-Afghani considered to be making too many concessions to foreign powers, especially the British Empire."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%9C%9F%E5%BA%AD%E5%81%9C%E8%BB%8A%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Maniwa_PA.JPG","page_title":"真庭停車區","context_page_description":"真庭停车区是位于冈山县真庭市的中国自动车道之休息区。"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%AD%E0%A4%BE%E0%A4%B0%E0%A4%A4%E0%A4%BE%E0%A4%A4%E0%A5%80%E0%A4%B2_%E0%A4%B0%E0%A4%BE%E0%A4%9C%E0%A4%AE%E0%A4%BE%E0%A4%A8%E0%A5%8D%E0%A4%AF_%E0%A4%AA%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Northern_Goshawk_ad_M2.jpg","page_title":"भारतातील राजमान्य पक्षी","context_page_description":"भारतातील केंद्रशासीत प्रदेश / राज्यांचे मानचिन्ह असलेले पक्षी"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%8A%D1%80-%D0%BF%D1%80%D0%B5%D0%B4%D1%81%D0%B5%D0%B4%D0%B0%D1%82%D0%B5%D0%BB_%D0%BD%D0%B0_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Yoshihiko_Noda-1.jpg","page_title":"Министър-председател на Япония","context_page_description":null},{"page_url":"https://it.wikipedia.org/wiki/Benacantil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/SantaBarbara2.jpg","page_title":"Benacantil","context_page_description":"Il Benacantil è una montagna che domina la città di Alicante.\\nIl monte è costituito da materiale roccioso e presenta una vegetazione composta da pini e arbusti sul lato nord. Sulla montagna si erge la rocca medievale di Alicante, il Castillo de Santa Bárbara mentre alle sue pendici si trova il parco de la Ereta e i barrios di Santa Cruz, San Roque, San Anton e il Raval Roig nonché un vecchio parcheggio che è diventato negli ultimi anni un punto abituale per i botellón."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%A5%BF%E6%96%B0%E4%BA%95%E5%A4%A7%E5%B8%AB%E8%A5%BF%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Nishiaraidaishi-nishi_station.jpg","page_title":"西新井大師西站","context_page_description":"西新井大师西站位于日本东京都足立区江北六丁目，是东京都交通局日暮里-舍人线的铁路车站。车站编号是NT 09。与北邻的谷在家站一同作为足立区最西的车站。\\n站名由来是站址东侧的西新井大师，徒步约20分钟，距离达1公里以上。西新井大师较接近东武大师线大师前站的方向。"},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Affrique","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Dolmen_tiergues.jpg","page_title":"Saint-Affrique","context_page_description":"Saint-Affrique är en stad och kommun i departementet Aveyron i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Saint-Affrique som ligger i arrondissementet Millau. År 2009 hade Saint-Affrique 8 280 invånare."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D1%8E%D0%BD%D0%B8%D0%BA%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/La_structure_de_la_grotte_de_Bruniquel.jpg","page_title":"Брюникель","context_page_description":"Брюникель — коммуна Франции в департаменте Тарн и Гаронна в регионе Окситания. Расположена у впадения реки Вере в Аверон. В коммуне находится два замка Брюникель — «старый» XII века и «новый» XV века. В «новом» замке располагается музей коммуны. Замки расположены на вершине скалы, над деревней. В деревне сохранились старинные дома XIV—XVI вв. из розового камня под красной черепичной крышей. Деревня входит в ассоциацию «Самые красивые деревни Франции». Население 608 человек на 1 января 2017 года."},{"page_url":"https://pl.wikipedia.org/wiki/Wystawocznaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Vystavochnaya_station.jpg","page_title":"Wystawocznaja","context_page_description":"Wystawocznaja – stacja moskiewskiego metra linii Filowskiej, położona w rejonie Priesnienskij w centralnym okręgu administracyjnym Moskwy, stanowi ważny element komunikacji z Centrum Biznesowym Moskwy. Początkowo nazywała się Diełowoj Centr, ale 1 czerwca 2009 nazwę zmieniono na Wystawocznaja nawiązując do pobliskiego Centrum Expo. Wyjścia prowadzą na ulicę Krasnopresnenskaja Nabereżnaja, most Bagration i do centrum Expo."},{"page_url":"https://ca.wikipedia.org/wiki/Channa","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Long_Black_Fish.JPG","page_title":"Channa","context_page_description":"Channa és un gènere de peixos de la família dels cànnids i de l'ordre dels perciformes."},{"page_url":"https://en.wikipedia.org/wiki/New_Jersey_Route_167","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/2018-09-16_14_57_55_View_north_along_New_Jersey_State_Route_167_%28New_York_Road%29_at_U.S._Route_9_in_Port_Republic%2C_Atlantic_County%2C_New_Jersey.jpg","page_title":"New Jersey Route 167","context_page_description":"Route 167 is a short, 0.77-mile-long unsigned state highway in Atlantic and Burlington counties in New Jersey. The route is one of the few discontinuous state highways in New Jersey, split by wetlands, the Garden State Parkway and the Mullica River. Although the alignment is registered by the New Jersey Department of Transportation as 2.76 miles highway, the amount of roadway is considerably shorter. The route begins at an intersection with U.S. Route 9 in Port Republic, where it continues along Old New York Road to an end of roadway at the Parkway embankment. Across the Mullica River, Route 167 continues at a gate for wetlands, heading northward to an intersection with US 9 in Bass River Township.\\nThe route originated as part of New Jersey Route 4 during construction of a new state highway in 1917. Route 4 was built northward to the current Route 167 northern terminus in 1926, which was designated as part of US 9 that year. The highway was 2.64 miles long and included an iron truss bridge. The route remained intact until construction of the Garden State Parkway and a new bridge over the Mullica River in the early 1950s."},{"page_url":"https://en.wikipedia.org/wiki/Armoured_cavalry","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/M8-Greyhound-Haugh-3.jpg","page_title":"Armoured cavalry","context_page_description":"Armoured cavalry are combat units using armoured fighting vehicles instead of horses. They began to replace horse cavalry as the reconnaissance, screening and exploitation/pursuit arm in most armies after the First World War, although many armies continued to maintain horse cavalry through the end of the Second World War.\\nArmoured cavalry differs from regular armoured units in that the main AFVs are generally lighter and faster, including light tanks, armoured cars, and scout cars. Typically motorised or mechanised infantry make up a large portion of the unit, supported by either motorised or self-propelled artillery, with possibly airmobile troops on helicopters included."},{"page_url":"https://it.wikipedia.org/wiki/Nembrotha_cristata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Nembrotha_cristata.jpg","page_title":"Nembrotha cristata","context_page_description":"Nembrotha cristata è una specie del genere Nembrotha, appartenente alla famiglia degli Polyceridae dei molluschi nudibranchia."},{"page_url":"https://ro.wikipedia.org/wiki/Canionul_Matka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Matka_Canyon_6.jpg","page_title":"Canionul Matka","context_page_description":"Canionul Matka este un canion săpat de râul Treska situat la circa 17 km sud-vest de Skopje, Macedonia. Acesta este una dintre cele mai populare atracții turistice naturale din Macedonia, acoperind o suprafață de 5.000 ha, găzduind mai multe mănăstiri și un baraj hidroelectric. Lacul Matka din interiorul canionului este cel mai vechi lac artificial din țară."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B6%AD%E5%BE%B7%E6%8B%89%E9%AD%AF%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Vidraru_Lake_%2810497594363%29.jpg","page_title":"維德拉魯湖","context_page_description":"維德拉魯湖是羅馬尼亞的人工湖，屬於阿爾傑什河流域的一部分，始建於1965年，長10.3公里、寬1.4公里，面積9平方公里，海拔高度830米，最大水深155米，蓄水量4.7億立方米。"},{"page_url":"https://en.wikipedia.org/wiki/Cleveland_Blues_(NL)_all-time_roster","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Jim_McCormick_baseball_card.jpg","page_title":"Cleveland Blues (NL) all-time roster","context_page_description":"The Cleveland Blues were a professional baseball franchise that operated in the National League (NL), a \\"major\\" league, from 1879 until 1884. They were organized by businessmen William Hollinger, and J. Ford Evans in 1878 as the Forest Citys, and played a season as an independent team. The NL expanded from six teams to eight before the 1879 season, and the Forest Citys accepted an invitation to join the league. Evans became their president and stayed in that capacity until C. H. Bulkeley assumed the role in 1882. In their six seasons in the NL, the team never finished higher than third place in the standings. They played their home games in League Park.\\nFor their first season in the NL, the franchise employed Jim McCormick as the manager as well as the ace of their pitching staff. Cleveland did not fare well, winning just 27 games against 55 losses, with a league-low .223 batting average. The 1880 season was better, however, as the team increased its win total to 47 against 37 losses and a tie, McCormick winning a league-leading 45 of those victories."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%96%D1%8B%D0%B3%D1%96%D0%BC%D0%BE%D0%BD%D1%82_%D0%90%D1%9E%D0%B3%D1%83%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/%C5%BDygimont_A%C5%ADgust._%D0%96%D1%8B%D0%B3%D1%96%D0%BC%D0%BE%D0%BD%D1%82_%D0%90%D1%9E%D0%B3%D1%83%D1%81%D1%82_%28J._Aziamb%C5%82o%C5%ADski%2C_1850%29.jpg","page_title":"Жыгімонт Аўгуст","context_page_description":"Жыґімо́нт А́ўгуст, Жыґімонт ІІІ — вялікі князь літоўскі і кароль польскі. Сын Жыгімонта Старога і Боны Сфорца."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%BE%D1%80%D0%B5%D0%BD%D1%81%D0%BE_%D0%A4%D0%B5%D1%80%D0%BD%D0%B0%D0%BD%D0%B4%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Lorenzo_Fern%C3%A1ndez_1928_%28cropped%29.jpg","page_title":"Лоренсо Фернандес","context_page_description":"Лоренсо Фернандес — уругвайський футболіст, що грав на позиції півзахисника.\\nВиступав, зокрема, за «Пеньяроль», з яким став чотириразовим чемпіоном Уругваю, а також національну збірну Уругваю. У складі збірної — олімпійський чемпіон, чемпіон світу та дворазовий володар чемпіонату Південної Америки."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%DA%A9%D9%88_%D9%88%D8%A7%D9%86%D8%AF%D9%87%E2%80%8C%D9%88%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/CoCo_Vandeweghe_%28USA%29_%289718213025%29.jpg","page_title":"کوکو وانده‌وگ","context_page_description":"کوکو وانده‌وگ یک تنیس‌باز اهل ایالات متحده آمریکا است. او در جام اوپن جوانان آمریکا در سال ۲۰۰۸ به مقام قهرمانی رسید. او همچنین به دو عنوان WTA دست یافته که هر دو عنوان در مسابقات قهرمانی رزمالن در زمین چمن در شهر دن بوس به دست آمده است."},{"page_url":"https://en.wikipedia.org/wiki/Lambert_Fieldhouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Purdue_fieldhouse_and_gymnasium%2C_Purdue_University%2C_West_Lafayette%2C_Indiana_%2877515%29.jpg","page_title":"Lambert Fieldhouse","context_page_description":"Lambert Fieldhouse is an athletic facility on the campus of Purdue University in West Lafayette, Indiana. It was built in 1937 on land bought by David Ross and George Ade as a replacement for Memorial Gymnasium to be the home of the Purdue basketball team, and also contained an indoor track. Memorial Gym was a 2,000 seat facility built in 1910 which had outgrown its usefulness, as the team had even resorted to playing games at the local high school gym, which seated twice as many as the gym did. In 1967, the team moved into the newly built Mackey Arena next door, and the building was remodeled to become a full-time track facility. The building also contains pool facilities, which were in use by the swimming and diving teams until 2001, when the Boilermaker Aquatic Center was completed.\\nThe basement of the facility is used by the crew team for indoor training during winter months. In 2006, the pool was filled in and now the wrestling team has their practice area where the pool used to be.\\nThe building was originally named Purdue Fieldhouse. It was renamed in honor of longtime basketball coach Ward \\"Piggy\\" Lambert. It originally housed 7,500 with the ability to expand to 10,000."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AE%E0%B2%BE%E0%B2%A8%E0%B2%B5%E0%B2%A8%E0%B2%B2%E0%B3%8D%E0%B2%B2%E0%B2%BF_%E0%B2%B0%E0%B2%95%E0%B3%8D%E0%B2%A4_%E0%B2%AA%E0%B2%B0%E0%B2%BF%E0%B2%9A%E0%B2%B2%E0%B2%A8%E0%B3%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Blausen_0170_CarotidArteries.png","page_title":"ಮಾನವನಲ್ಲಿ ರಕ್ತ ಪರಿಚಲನೆ","context_page_description":"ದೇಹದ ಕಣಗಳಿಗೆ ಆಹಾರ ಮತ್ತು ಆಮ್ಲಜನಕಗಳನ್ನು ಒದಗಿಸುವ ವ್ಯವಸ್ಥೆಯೇ ರಕ್ತಸಂಚಲನೆ ಅಥವಾ ರಕ್ತಪರಿಚಲನೆ. ಆದಿ ಜೀವಿಗಳಾದ ಏಕಕಣ ಜೀವಿಗಳಲಿ, ್ಲ ಆ ಒಂದು ಕಣವೇ ಹೊರಗಿಂದ ತನಗೆ ಬದುಕಲು ಬೇಕಾದ ಆಹಾರವನ್ನೂ ಆಮ್ಲಜನಕವನ್ನೂ ಹೀರಿಕೊಂಳ್ಳುತ್ತದೆ; ಹಾಗೆಯೇ ತನಗೆ ಬೇಡವಾದ ಇಂಗಾಲಾಮ್ಲ ಮತ್ತು ಕಶ್ಮಲಗಳನ್ನು ತನ್ನಕೋಶದಿಂದ ಹೊರಹಾಕುತ್ತದೆ. ಮುಂದೆ ವಿಕಾಸಗೊಂಡಂತೆ ಕೆಳ ತರಗತಿಯ ಜೀವಿಗಳಲ್ಲಿ ದೇಹದ ಅಂಗಾಂಗಳ ಜೀವಕಣಗಳಿಗೆ ಆಹಾರವನ್ನೂ ಆಮ್ಲಜನಕವನ್ನೂ ಒದಗಿಸುವ ಕೆಲಸವನ್ನು ಮತ್ತು ನಷ್ಟವಾದ ಕಣಗಳನ್ನೂ ಕಶ್ಮಲಗಳನ್ನೂ, ಆಮ್ಲಜನಕ ದಹಿಸಿ ಉಂಟಾದ ಇಂಗಾಲಾಮ್ಲವನ್ನೂ ಹೊರಕ್ಕೆ ಸಾಗಿಸುವ ಕೆಲಸವನ್ನು ರಕ್ತನಾಳಗಳು ಮಾಡುವುವು. ಯಾವತ್ತೂ ಪ್ರಾಣಿಗಳಲ್ಲಿ ಸಂಚರಿಸುವ ರಕ್ತದ್ರವ್ಯವು ಈ ಪ್ರಾಮುಖ್ಯ ಕೆಲಸಕ್ಕಾಗಿಯೇ ದೇಹದ ಎಲ್ಲೆಡೆಗಳಿಗೂ ಸಂಚರಿಸುವ ವ್ಯವಸ್ಥೆ ರೂಪುಗೊಂಡಿದೆ. ಈ ವ್ಯವಸ್ಥೆ ಹುಳು, ಕ್ರಿಮಿ, ಕೀಟ, ಪಶು ಪಕ್ಷಿ ಮೊದಲಾದ ಎಲ್ಲ ಜೀವಿಗಲಲ್ಲಿ ಕಾಣಬಹುದು."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A2%D2%AF%D0%BC%D1%8D%D0%BD%D0%B1%D0%B0%D1%8F%D1%80%D1%8B%D0%BD_%D0%A0%D0%B0%D0%B3%D1%87%D0%B0%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/%D0%A2%D2%AF%D0%BC%D1%8D%D0%BD%D0%B1%D0%B0%D1%8F%D1%80%D1%8B%D0%BD_%D0%A0%D0%B0%D0%B3%D1%87%D0%B0%D0%B0_40x60.jpg","page_title":"Түмэнбаярын Рагчаа","context_page_description":"Монгол Ардын Нам, төрийн ахмад зүтгэлтэн Шар Мухлай овогт Түмэнбаярын Рагчаа нь Монгол улсын төрийн зүтгэлтэн, гавьяат эдийн засагч.\\n1917 онд Увс аймгийн Хяргас сумын нутагт төрсөн. МУИС-ийг эдийн засагч мэргэжлээр төгссөн.1925 онд Увс аймгийн Хяргас сумын /тэр үеийн Чандмань Уул аймгийн Баянмандал уулын хошуу/ бага сургууль, 1934 онд Нам ба Улсын төв сургууль, Москва хотод Центрсоюзын Хоршооны ажилтны дээд курс, 1958 онд МУИС-ийг төлөвлөгөө, эдийн засагчийн мэргэжлээр тус тус төгссөн.Тэрээр 1931 онд анх Увс аймгийн Хяргас сумын захиргаанд бие зарлага, тал бичээчээс ажлынхаа гарааг эхэлж,1936-1954 онуудад Хөвсгөл, Алтанбулаг, Чойбалсангийн дамжлага баазуудад данс хөтлөгч, ня-бо, ерөнхий ня-бо, хэлтсийн дарга, орлогч дарга, 1954-1958 онд худалдааны яамны хэлтсийн дарга, 1958-1959 онд МУИС-д багш, 1959-1972 онд УТК-ын дарга, 1972-1987 онд БНМАУ-ын Сайд нарын зөвлөлийн нэгдүгээр орлогч даргаар ажилласан байна. 1981-1990 онуудад МАХН-ын Улс төрийн товчооны гишүүнээр сонгогдон ажилласан."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9F%CE%B2%CE%B5%CE%BB%CE%AF%CF%83%CE%BA%CE%BF%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/High_Point_Monument_from_roadway.jpg","page_title":"Οβελίσκος","context_page_description":"Ο οβελίσκος είναι ένα ψηλό μνημείο με τέσσερεις πλευρές που στενεύει προς τα πάνω και καταλήγει σε πυραμοειδές σχήμα στο τέλος του, το πυραμίδιο. Τα μνημεία αυτά ονομάζονταν αρχικά \\"tekhenu\\", \\"τεκχενού\\" από τους κατασκευαστές τους, τους Αρχαίους Αιγυπτίους. Οι Έλληνες που τους είδαν, χρησιμοποίησαν το ελληνικό οβελίσκος για περιγράψουν αυτά τα μνημεία, και η λέξη αυτή πέρασε στα Λατινικά και τα Αγγλικά. Οι αρχαίοι οβελίσκοι είναι μονολιθικοί, δηλαδή αποτελούνται από μία μόνο πέτρα, ή αλλιώς λίθο. Αυτό αποτελεί, εκτός από το σχήμα του, κύριο χαρακτηριστικό του οβελίσκου, καθώς καταδεικνύει ότι αυτοί που τον ανήγειραν είχαν την τεχνολογική ικανότητα που απαιτείται για την μετακίνηση και ανύψωση βράχων που ζυγίζουν εκατοντάδες τόνων. Ενώ αυτή η τεχνολογική δυνατότητα υπάρχει σήμερα, οι περισσότεροι σύγχρονοι οβελίσκοι αποτελούνται από πολλές πέτρες. Κάποιοι, όπως το Μνημείο Ουάσινγκτον είναι κτίσματα. Τυπικά, τέτοιες περιπτώσεις δεν είναι πραγματικοί οβελίσκοι αλλά κτίσματα με σχήμα οβελίσκου.\\nΟ όρος στήλη γενικά χρησιμοποιείται για άλλους μνημειακούς, όρθιους, με επιγραφή και σκαλισμένους λίθους."},{"page_url":"https://ro.wikipedia.org/wiki/Alegeri_locale_%C3%AEn_Rom%C3%A2nia,_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Crin_Antonescu.jpg","page_title":"Alegeri locale în România, 2012","context_page_description":"Alegerile locale din 2012 în România au avut loc pe data de 10 iunie 2012.\\nInițial, guvernul Ungureanu a încercat comasarea alegerilor locale cu cele parlamentare din toamnă. Opoziția a protestat împotriva comasării alegerilor locale și parlamentare, susținând că această încercare ar fi neconstituțională. Curtea Constituțională s-a pronunțat împotriva comasării alegerilor. Alegerile parlamentare vor avea loc separat.\\nS-a folosit sistemul de alegere dintr-un singur tur al președinților CJ și a primarilor."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D0%BC%D0%B0%D0%BD_%D0%B8_%D0%94%D0%B8%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Karta_diu_daman.jpg","page_title":"Даман и Диу","context_page_description":"Дама́н и Ди́у — бывшая союзная территория на западе Индии, теперь часть союзной территории Дадра и Нагар-Хавели и Даман и Диу. Административный центр — Даман. Население 242 911 человек."},{"page_url":"https://en.wikipedia.org/wiki/Stained_glass_windows_of_Chartres_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Vitrail_Chartres-044_rectifi%C3%A9.JPG","page_title":"Stained glass windows of Chartres Cathedral","context_page_description":"The stained glass windows of Chartres Cathedral are held to be one of the best-preserved and most complete set of medieval stained glass, notably celebrated for their colours, especially their cobalt blue. They cover 2600 square metres in total and consist of 172 bays illustrating biblical scenes, the lives of the saints and scenes from the life of trade guilds of the period.\\nSome windows survive from an earlier Chartres Cathedral, such as the three lancets on the west front and the lancet south of the choir known as 'Notre-Dame de la Belle Verrière', famed for its Chartres blue. However, most of the windows were probably made between 1205 and 1240 for the present church, taking in the Fourth Crusade and the Albigensian Crusade, as well as the reigns of Philip II Augustus and Louis VIII, with the building's consecration finally occurring in 1260 under Louis IX.\\nSome of the windows were made later, such as those in the Vendôme Chapel and some in the transepts, whilst some damaged 13th-century windows were restored from the 15th century onwards."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%88%D8%AF_%D8%B1%D8%A7%D8%A8%DB%8C%D9%88%D8%B3%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Rabiusa.jpg","page_title":"رود رابیوسا","context_page_description":"رود رابیوسا رودی است که از بخش انترن سرچشمه می‌گیرد. این رود از کشور سوئیس می‌گذرد."},{"page_url":"https://de.wikipedia.org/wiki/Echtes_Leinkraut","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Linaria_vulgaris_20050825_976.jpg","page_title":"Echtes Leinkraut","context_page_description":"Das Echte Leinkraut ist eine Pflanzenart aus der Gattung der Leinkräuter. Andere deutschsprachige Trivialnamen sind Gemeines Leinkraut, Gewöhnliches Leinkraut, Kleines Löwenmaul sowie Frauenflachs."},{"page_url":"https://en.wikipedia.org/wiki/Anglo-Saxon_charters","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Alfred_the_Great%27s_will.jpg","page_title":"Anglo-Saxon charters","context_page_description":"Anglo-Saxon charters are documents from the early medieval period in England, which typically made a grant of land, or recorded a privilege. The earliest surviving charters were drawn up in the 670s: the oldest surviving charters granted land to the Church, but from the eighth century, surviving charters were increasingly used to grant land to lay people.\\nThe term charter covers a range of written legal documentation including diplomas, writs and wills. A diploma was a royal charter that granted rights over land or other privileges by the king, whereas a writ was an instruction by the king which may have contained evidence of rights or privileges. Diplomas were usually written on parchment in Latin, but often contained sections in the vernacular, describing the bounds of estates, which often correspond closely to modern parish boundaries. The writ was authenticated by a seal and gradually replaced the diploma as evidence of land tenure during the late Anglo-Saxon and early Norman periods. Land held by virtue of a charter was known as bookland."},{"page_url":"https://ja.wikipedia.org/wiki/X_JAPAN_WORLD_TOUR_Live_in_TAIPEI","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Tapei101_xjapan.jpg","page_title":"X JAPAN WORLD TOUR Live in TAIPEI","context_page_description":"『X JAPAN WORLD TOUR Live in TAIPEI』は、日本のロックバンドX JAPANが台湾の板橋体育場において、2009年5月30日に開催したコンサートである。"},{"page_url":"https://es.wikipedia.org/wiki/Turismo_en_Honduras","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Catedral_de_Santa_Rosda_de_Copan%2C_Hoduras.jpg","page_title":"Turismo en Honduras","context_page_description":"Honduras es un destino turístico que llama la atención de varios turistas por su abundante y variada belleza natural que se manifiesta en su gente, en sus playas de arena blanca y obscura, arrecifes de coral, flora y fauna silvestre espectacular de admirar así como su gran belleza e historia arqueológica; además de su cultura expresada en las costumbres e idiosincrasia de sus habitantes así como en su deliciosa gastronomía típica del país, tal como la 'baleada' entre otras comidas autóctonas Honduras."},{"page_url":"https://en.wikipedia.org/wiki/University_Medical_Center_Hamburg-Eppendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/New_building%2C_University_Medical_Center_Hamburg-Eppendorf.jpg","page_title":"University Medical Center Hamburg-Eppendorf","context_page_description":"The University Medical Center Hamburg-Eppendorf is the teaching hospital of the University of Hamburg and one of the largest hospitals in Hamburg, Germany.\\nThe UKE has 1,460 beds and 121 day-care places and is listed to provide the capacity to dispatch emergency medical services."},{"page_url":"https://ro.wikipedia.org/wiki/Klein_Nordende","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Klein_Nordende-Wappen.png","page_title":"Klein Nordende","context_page_description":"Klein Nordende este o comună din landul Schleswig-Holstein, Germania."},{"page_url":"https://da.wikipedia.org/wiki/Sebasti%C3%A1n_Pi%C3%B1era","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Firma_Sebasti%C3%A1n_Pi%C3%B1era.png","page_title":"Sebastián Piñera","context_page_description":"Sebastián Piñera er en chilensk økonom og politiker, der er Chiles nuværende præsident. Han var også Chiles præsident fra 2010 til 2014. Piñera tilhører partiet National Fornyelse, et centrum-højre parti.\\nPiñera blev valgt i anden runde af præsidentvalget 2009-10, som blev gennemført 17. januar 2010. Han tiltrådte officielt posten den 11. marts 2010 og trådte tilbage 11. marts 2014. Præsidenten må ikke sidde i mere end en sammenhængende periode. Den 17. december 2017 blev Sebastián Piñera genvalgt til at være Chiles præsident for endnu en periode."},{"page_url":"https://pl.wikipedia.org/wiki/Pony_car","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/1964_Corvair_Monza.jpg","page_title":"Pony car","context_page_description":"Pony car – nazwa odnosząca się do amerykańskich samochodów sportowych. Pierwszym pojazdem tego typu był Ford Mustang. Samochód określany jako pony car cechuje się kompaktowym nadwoziem o wyróżniającej się stylistyce podkreślającej sportowe zacięcie i stosunkowo mocnym silnikiem. Pony cars różnią się od muscle cars głównie wymiarami nadwozia – pony cars są mniejsze, przez co często nazywa się je baby muscle cars. Ograniczało to maksymalną pojemność montowanych w nich silników, co w konsekwencji sprawia, że pony cars są nieco wolniejsze. Granica między tymi segmentami jest jednak dość płynna."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A4%A7%E8%A1%9B%C2%B7S%C2%B7%E9%AB%98%E8%80%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/David_Goyer.jpg","page_title":"大衛·S·高耶","context_page_description":"大卫·山缪·高耶是一位美国男编剧、监制、导演、小说家和漫画书作家。他的编剧作品包括《刀锋战士三部曲》、克里斯托弗·诺兰的《黑暗骑士三部曲》、《黑暗城市》和《超人：钢铁之躯》。\\n而他执导的四部故事片分别有《心灵推手》、《刀锋战士3》、《幽灵人口》和《生灵勿进》。高耶也担任电子游戏《决胜时刻：黑色行动》、《决胜时刻：黑色行动2》的联合编剧。他因《蝙蝠侠：侠影之谜》和《黑暗城市》赢得了土星奖最佳剧本，并提名四项雨果奖。"},{"page_url":"https://sv.wikipedia.org/wiki/Camissonia_strigulosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Camissonia_strigulosa_%281%29.jpg","page_title":"Camissonia strigulosa","context_page_description":"Camissonia strigulosa är en dunörtsväxtart som först beskrevs av Fisch. och Mey., och fick sitt nu gällande namn av John Earle Raven. Camissonia strigulosa ingår i släktet Camissonia och familjen dunörtsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_du_Pi%C3%A9mont_oriental_%C2%AB_Amedeo-Avogadro_%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Logo_Universit%C3%A0_del_Piemonte_Orientale.png","page_title":"Université du Piémont oriental « Amedeo-Avogadro »","context_page_description":"L'université du Piémont oriental « Amedeo-Avogadro » est une université italienne, basée dans le Piémont oriental, sur trois campus, Verceil, Novare et Alexandrie.\\nFondée en 1998, son histoire très discontinue peut remonter à un médiéval Studium de Vercelli, le 4 avril 1228."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Milwaukee_Brewers_first-round_draft_picks","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Rickie_Weeks.jpg","page_title":"List of Milwaukee Brewers first-round draft picks","context_page_description":"The Milwaukee Brewers are a Major League Baseball franchise based in Milwaukee, Wisconsin. They play in the National League Central division. Established in Seattle, Washington as the Seattle Pilots in 1969, the team became the Milwaukee Brewers after relocating to Milwaukee in 1970. The franchise played in the American League until 1998, when it moved to the National League as a part of MLB's realignment plan. Since the institution of MLB's Rule 4 Draft, the Brewers have selected 57 players in the first round. Officially known as the \\"First-Year Player Draft\\", the Rule 4 Draft is MLB's primary mechanism for assigning players from high schools, colleges, and other amateur clubs to its franchises. The draft order is determined based on the previous season's standings, with the team possessing the worst record receiving the first pick. In addition, teams which lost free agents in the previous off-season may be awarded compensatory or supplementary picks.\\nOf the 57 players picked in the first round by Milwaukee, 26 have been pitchers, the most of any position; 17 of these were right-handed, while nine were left-handed."},{"page_url":"https://es.wikipedia.org/wiki/Atahualpa_Severino","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Atahualpa_Severino_%288647738356%29_%28cropped%29.jpg","page_title":"Atahualpa Severino","context_page_description":"Atahualpa Severino es un lanzador de relevo dominicano que milita para los Diablos Rojos del México en la Liga Mexicana de Béisbol.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%B9%D1%82%D1%81,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/United_States_Intelligence_Community_Seal_2008.jpg","page_title":"Гейтс, Роберт","context_page_description":"Ро́берт Ма́йкл Гейтс — американский государственный и военный деятель. Служил в ВВС США в 1967—1969 годах, в Центральном разведывательном управлении — в 1966—1993 годах. Директор Центральной разведки в 1991—1993 годах. Министр обороны США в 2006 — 2011 годах."},{"page_url":"https://de.wikipedia.org/wiki/Dominic_Dale","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Dominic_Dale_at_Snooker_German_Masters_%28DerHexer%29_2013-01-30_04.jpg","page_title":"Dominic Dale","context_page_description":"Dominic Dale ist ein walisischer Snookerspieler."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Essen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Edith_Reiner.JPG","page_title":"Liste der Stolpersteine in Essen","context_page_description":"Die Liste der Stolpersteine in Essen enthält alle Stolpersteine, die im Rahmen des gleichnamigen Projekts von Gunter Demnig in Essen verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Essen lebten und wirkten."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AD%86%E9%A0%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/%E7%94%B0-jbw.png","page_title":"筆順","context_page_description":"筆順は漢字の筆画を組み合わせていく順序である。"},{"page_url":"https://fr.wikipedia.org/wiki/Trid%C3%A9cane","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/WHMIS_Class_B.svg","page_title":"Tridécane","context_page_description":"Le tridécane est un alcane linéaire de formule brute C₁₃H₂₈. Il possède 802 isomères structuraux.\\nIl se présente sous la forme d'un liquide incolore et est utilisé dans l'industrie papetière et dans celle du caoutchouc mais également comme combustible ou comme solvant.\\nIl est sécrété par certains insectes à des fins de défense contre les prédateurs."},{"page_url":"https://en.wikipedia.org/wiki/Mike_Harper_(basketball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Former_Portland_Trail_Blazer_Michael_Harper_in_2013.jpg","page_title":"Mike Harper (basketball)","context_page_description":"Michael Edward Harper is a former American professional basketball player who played for the Portland Trail Blazers of the National Basketball Association from 1980 to 1982."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89mile_Chami","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Cath%C3%A9drale_Saint-Pierre_de_Beauvais2.JPG","page_title":"Émile Chami","context_page_description":"Émile Chami est un archéologue français."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AA%D8%B4%D8%A7%D8%B1%D8%AF_%D8%A3%D9%84%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Richard_Allen_crop.jpg","page_title":"ريتشارد ألن","context_page_description":"ريتشارد ألن ‏ هو قس وكاتب ومربي وأول أسقف من أصل أفريقي ومؤسس الكنيسة الأسقفية الميثودية الأفريقية ومعروفه عام 1816 وهي أول طائفة سوداء بروتستانتية مستقلة في الولايات المتحدة, كان ألِن جزءاً من جيل رائع من الرجال والنساء السود، الذين لُقبّوا \\"بالمؤسسين السود\\" من جانب العلماء لاحقاً، وسعوا إلى توسيع نطاق الحرية خلال الأيام الأولى للجمهورية الأميركية"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%97%9C%E7%9B%AE%E9%AB%98%E6%AE%BF%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Sekime-takadono-hekiga.jpg","page_title":"關目高殿站","context_page_description":"关目高殿站是一个位于日本大阪府大阪市旭区高殿，属于大阪市高速电气轨道的铁路车站。车站编号是T15。“关目”位于城东区侧，旧东成郡榎并村，“高殿”位于旭区侧，旧东成郡城北村。此站位于两区边界道路的下方，该站的官方所在地是旭区高殿。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A3%93%E9%A3%8E%E8%83%A1%E5%AE%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Hurricane_Juan_27_sept_2003_1725Z.jpg","page_title":"飓风胡安","context_page_description":"颶風胡安是2003年9月下旬對加拿大造成重大損失的強烈熱帶氣旋，也是2003年大西洋颶風季第十個獲命名的風暴和第六場颶風。風暴源自9月24日穿越亞熱帶大西洋的東風波，在百慕達東南方向成型。系統北上進入墨西哥灣後因遇到墨西哥灣暖流而逐步加強，於9月27日達到薩菲爾-辛普森颶風等級下的二級颶風強度，並於同日達到持續風速每小時165公里的最高強度，然後在向新斯科舍海岸前進的過程中因海水溫度降低而有所減弱。9月29日清晨，胡安以風速每小時160公里的二級颶風強度在哈利法克斯的沙德灣和普羅斯佩克特之間登陸。風暴在從南向北穿越新斯科舍的過程中一直保持著颶風強度，然後在愛德華王子島上空減弱為熱帶風暴。9月29日晚，風暴在聖羅倫斯灣北部的安蒂科斯蒂島附近由另一股溫帶低氣壓吸收。\\n這場颶風在穿過新斯科舍中部和進入愛德華王子島的過程中造成了大範圍的破壞，風暴中心以東和以西區域受到的影響較小，大部分損失都是由這些區域遭受的狂風引起。胡安所過之處共造成8人死亡，經濟損失超過1.5億美元，報告中認為這是繼1893年以來對新斯科舍造成破壞最嚴重的風暴，其名稱「胡安」也因此予以退役，永不會再在大西洋風暴命名中使用。"},{"page_url":"https://en.wikipedia.org/wiki/Gary_Thornhill","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Garythornhill.jpg","page_title":"Gary Thornhill","context_page_description":"Gary Thornhill is a former English professional boxer who fought at featherweight and super featherweight.\\nHe is a former World Boxing Organization Intercontinental super featherweight champion, as well as a BBBofC super featherweight central area champion. Thornhill also held the Lonsdale belt before being stripped after failing a drugs test."},{"page_url":"https://ca.wikipedia.org/wiki/Orde_de_la_Gl%C3%B2ria_Laboral","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Order_of_Labour_Glory_1st.jpg","page_title":"Orde de la Glòria Laboral","context_page_description":"L'Orde de Glòria Laboral és un orde soviètic, establert pel Decret del Presídium del Soviet Suprem de l'URSS, sota la presidència de Leonid Bréjnev. Va ser creat el 18 de gener del 1974. Els estatuts es modificaren mitjançant decrets de 19 de febrer de 1981 i de 25 de juny de 1984.\\nPenja a l'esquerra del pit i se situa després de l'Orde de Glòria. L'orde té 3 graus. El grau superior és la 1a classe, i s'atorga de manera successiva.\\nEn total, es van atorgar 952 condecoracions de 1a classe, prop de 50.000 de 2a classe i més de 650.000 de 3a classe.\\nEls receptors de l'Orde de Glòria Laboral de tots 3 graus tenen dret a diversos beneficis socials, com a un augment del 15% en la pensió, prioritat en el manteniment de l'habitatge, al transport personal gratuït tant ferroviari com naval en 1a classe, a l'ús gratuït dels transports locals, a serveis extraordinaris de les empreses d'espectacles o culturals/educatius, etc.\\nL'orde de Glòria Laboral és l'únic orde soviètic laboral dividit en classes. Pels estatuts i per l'ordre de la condecoració, els privilegis concedits als cavallers de tots 3 graus són equivalents als de l'orde de Glòria.\\nL'autor del dibuix va ser el pintor J.M. Egorov."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%A8%E3%82%BF%E3%83%BB%E3%82%AF%E3%83%A9%E3%82%A6%E3%83%B3%E3%83%9E%E3%82%B8%E3%82%A7%E3%82%B9%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/2009_Toyota_Crown-Majesta_02.jpg","page_title":"トヨタ・クラウンマジェスタ","context_page_description":"クラウン マジェスタは、トヨタ自動車が生産・販売していた高級4ドアセダンである。取扱店はトヨタ店。\\n通称:「マジェスタ」、「マジェ」"},{"page_url":"https://cs.wikipedia.org/wiki/Sen%C3%A1tn%C3%AD_obvod_%C4%8D._44_%E2%80%93_Chrudim","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Jan_Tecl%2C_2017.jpg","page_title":"Senátní obvod č. 44 – Chrudim","context_page_description":"Senátní obvod č. 44 – Chrudim je podle zákona č. 247/1995 Sb. tvořen částí okresu Chrudim ohraničenou na východě obcemi Čankovice, Hrochův Týnec, Přestavlky, Zájezdec, Řestoky, Zaječice, Horka, Vrbatův Kostelec, Leštinka, Prosetín, Raná, Pokřikov, Vojtěchov, Kladno, Dědová, Kameničky a jihovýchodní částí okresu Havlíčkův Brod ohraničenou obcemi Jeřišno, Víska, Maleč, Chotěboř, Čachotín, Horní Krupá, Knyk, Havlíčkův Brod, Hurtova Lhota, Okrouhlička, Kochánov, Úhořilka, Úsobí a Skorkov.\\nSoučasným senátorem je od roku 2018 Jan Tecl."},{"page_url":"https://gl.wikipedia.org/wiki/Le%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Hunting_liones.jpg","page_title":"León","context_page_description":"O león é un mamífero carnívoro da familia dos félidos e unha das 5 especies do xénero Panthera. Algúns machos, excepcionalmente grandes, chegan a pesar ata 250 kg, o que os converte no segundo félido vivente máis grande despois do tigre. Os leóns salvaxes viven na África subsahariana e Asia, cunha poboación en perigo crítico ao noroeste da India, tendo desaparecido do norte de África, de Oriente Próximo e do oeste de Asia en tempos históricos. Ata finais do Plistoceno, hai aproximadamente 10 000 anos, o león era o máis estendido dos grandes mamíferos terrestres, tralos seres humanos. A súa distribución cubría a maior parte de África, gran parte de Eurasia, desde o oeste de Europa ata a India, e en América, desde o río Yukón ata o sur de México.\\nSe sobreviven ás dificultades da infancia, as leoas que viven nun hábitat seguro, por exemplo no Parque nacional Kruger, a miúdo poden chegar á idade de 12-14 anos, mentres que os leóns raramente viven máis de oito anos. Con todo, coñécense casos de leoas que viviron ata vinte anos en estado salvaxe. En cativerio, tanto os machos como as femias poden vivir máis de vinte anos."},{"page_url":"https://en.wikipedia.org/wiki/Sanxiang_noodle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Sanxiang_noodle_with_Pig_oviduct.jpg","page_title":"Sanxiang noodle","context_page_description":"Sanxiang noodle is one of the famous local food of Zhongshan city, Guangdong province, China. It has a history of more than 200 years. Because of the special recipe and techniques, the noodle is round and stretchy, which is similar to Guiling noodle, another well-known noodle of China. There are many different types of sanxiang noodle according to people’s favor. People usually eat it with the company of meat, chicken, vegetables, roast pork, pork liver and so on. It can boiled as well as fryed."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A2%D5%A5%D5%AC_(%D4%B1%D5%A4%D5%A1%D5%B4%D5%AB_%D5%B8%D6%80%D5%A4%D5%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Abel_%28Russia%2C_18_c.%29_by_shakko.jpg","page_title":"Աբել (Ադամի որդի)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Աբել\\nԱբել, ըստ Աստվածաշնչի, Ադամի և Եվայի երկրորդ որդին, որին սպանեց ավագ որդին՝ Կայենը ։ Զբաղվում էր անասնապահությամբ։ Աբելը և իր ավագ եղբայրը՝ երկրագործ Կայենը, իրենց աշխատանքի առաջին պտուղները զոհաբերեցին Աստծուն։ Աստված ընդունեց միայն Աբելի զոհաբերությունը։ Կայենը նախանձից սպանեց Աբելին։ Առասպելում արտացոլված է հին հրեական խաշնարած և երկրագործ ցեղերի հակամարտությունը։"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%E2%80%8C%D8%A7%D9%85_%DB%8C%D9%88-%DB%B1%DB%B1_(%D8%A2%D9%84%D9%85%D8%A7%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/SM_U_11_800px.jpg","page_title":"اس‌ام یو-۱۱ (آلمان)","context_page_description":"اس‌ام یو-۱۱ (آلمان) یک زیردریایی بود که طول آن ۵۷٫۳۸ متر بود. این زیردریایی در سال ۱۹۱۰ ساخته شد."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_%C5%BDatec","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Saaz-Nr345-2.jpg","page_title":"Liste der Straßen und Plätze in Žatec","context_page_description":"Die Liste der Straßen und Plätze in Žatec beinhaltet die wichtigsten Straßen und Plätze der Stadt Žatec.\\nDie Namen wurden alten Stadtplänen und den Standardwerken zur Geschichte der Stadt entnommen.\\nDargestellt wird die historische Entwicklung der Straßennamen, ausgehend von der Habsburgermonarchie über die Erste Tschechoslowakische Republik bis zum heutigen Stand in Tschechien nach der friedlichen Revolution von 1990.\\nIn der Zeit der Monarchie bis 1918 waren neben den Namen aus dem habsburgischen Herrscherhaus meist unpolitische Bezeichnungen üblich. In der Tschechoslowakei mussten nach dem „Gesetz zum Schutz der Republik vom 19. März 1923“ die Namen, die an das österreichische Herrscherhaus erinnerten, umbenannt werden. Dieses Gesetz trat am 1. Mai 1923 in Kraft.\\nBei dieser Umbenennung wurden nun vielfach die Namen regionaler deutsch-böhmischer Politiker oder deutscher Persönlichkeiten verwendet. Weitere Umbenennungen nach 1938 sollen hier nicht betrachtet werden. Nach 1945 erfolgte die Umbenennung in tschechische Namen, die nur in wenigen Fällen einen Bezug zum alten Straßennamen haben.\\nBerücksichtigt werden die folgenden Stadtteile:\\nAltstadt, einschl. Burgstädtl und Schinitz"},{"page_url":"https://sv.wikipedia.org/wiki/Prosthechea_glauca","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Prosthechea_glauca.jpg","page_title":"Prosthechea glauca","context_page_description":"Prosthechea glauca är en orkidéart som beskrevs av George Beauchamp Knowles och Frederic Westcott. Prosthechea glauca ingår i släktet Prosthechea och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://cs.wikipedia.org/wiki/Atchison_County_(Kansas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Atchison_county_kansas_courthouse_1974.jpg","page_title":"Atchison County (Kansas)","context_page_description":"Atchison County je okres ve státě Kansas v USA. K roku 2010 zde žilo 16 924 obyvatel. Správním městem okresu je Atchison. Celková rozloha okresu činí 1 127 km². Na východě sousedí se státem Missouri."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Heppenheim_(Bergstra%C3%9Fe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Heppenheim%2C_Marktstra%C3%9Fe_17.jpg","page_title":"Liste der Kulturdenkmäler in Heppenheim (Bergstraße)","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Heppenheim, Kreis Bergstraße, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDas Vorhandensein oder Fehlen eines Objekts in dieser Liste ist keine rechtsverbindliche Auskunft darüber, ob es Kulturdenkmal ist oder nicht: Diese Liste entspricht möglicherweise nicht dem aktuellen Stand der offiziellen Denkmaltopographie. Diese ist für Hessen in den entsprechenden Bänden der Denkmaltopographie Bundesrepublik Deutschland und im Internet unter DenkXweb – Kulturdenkmäler in Hessen einsehbar. Auch diese Quellen sind, obwohl sie durch das Landesamt für Denkmalpflege Hessen aktualisiert werden, nicht immer aktuell, da es im Denkmalbestand immer wieder Änderungen gibt."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%81%AB%E6%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Phobos_deimos_diff_horizontal.jpg","page_title":"火星","context_page_description":"火星，是離太陽第四近的行星，也是太陽系中僅次於水星的第二小的行星，為太陽系里四顆類地行星之一。西方稱火星為瑪爾斯，是羅馬神話中的戰神，所以在英語中，火星是羅馬戰神的意思，通常被稱為「紅色星球」；古漢語中則因為它熒熒如火，位置、亮度時常變動讓人無法捉摸而稱之為熒惑。火星是太陽系的八大行星中第二小的行星，其質量、體積僅比水星略大。火星的直徑約為地球的一半，自轉軸傾角、自轉週期則與地球相當，但繞太陽公轉周期是地球的兩倍。在地球上，火星肉眼可見，亮度可達-2.91，只比金星、月球和太陽暗，但在大部分時間裡比木星暗。火星距離地球最近在1億公里以內。\\n火星大氣以二氧化碳為主，既稀薄又寒冷，其表面特徵讓人聯想起月球上的撞擊坑，以及地球上的山谷、沙漠和極地冰蓋。英語中，通常被稱為紅色星球。是因為火星在視覺上呈現為橘紅色是因為地表廣泛普遍的分布著氧化鐵的造成的，它使火星呈現出一種紅色的外觀，在肉眼可見的天體中獨具一格。火星地表沙丘、礫石遍布且沒有穩定的液態水，火星南半球是古老、充滿隕石坑的高地，北半球則是較年輕的平原。\\n火星已被無人飛船探索。1964年11月28日，由NASA發射的水手4號是第一個訪問火星的太空飛行器，於1965年7月15日最接近該行星。蘇聯火星3號飛船於1971年12月實現了軟著陸，但著陸後秒數內失去了聯繫。歐洲空間局第一批訪問火星的火星快車號於2003年12月25日到達軌道。2014年9月24日，印度空間研究組織成為第四個訪問火星的太空機構，當時它的星際飛行任務火星軌道探測器抵達軌道。\\n火星有兩個天然衛星：火衛一和火衛二，形狀不規則，可能是捕獲的小行星。火星目前有四艘在軌運行的探測船，分別是火星奧德賽號、火星快車號和火星偵察軌道器以及2014年9月22日抵達的MAVEN軌道器，地表還有許多火星車和著陸器，包括一台火星車：好奇號，固定式登陸探測器洞察號，和已經結束任務的旅居者號、精神號、鳳凰號和機會號等等。根據觀測的證據，火星以前可能覆蓋大面積的水。亦觀察到最近十年內類似地下水湧出的現象。火星全球勘測者則觀察到南極冠有部份退縮。火星快車號和火星偵察軌道器的雷達資料顯示兩極和中緯度地表下存在大量的水冰。2008年7月31日，鳳凰號直接於表土之下證實水冰的存在。2013年9月26日，火星探測車好奇號發現火星土壤含有豐富水分，大約為1.5至3重量百分比，顯示火星有足夠的水資源供給未來移民使用。2015年9月證實火星有間歇流動的液態水。2018年7月25日，義大利太空總署宣布，在火星冰蓋之下發現一個直徑20公里的冰下湖。這是太空科學家在火星上探測到的首個大型液態水體。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Zolnoe%2C_DK.jpg","page_title":"Зольное","context_page_description":"Зо́льное — село, входящее в состав городского округа Жигулёвск Самарской области.\\nДо 2010 года село имело статус сельского населённого пункта, до 2004 — посёлка городского типа.\\nПосёлок Зольное был образован в середине XX века в результате обнаружения месторождения нефти в Жигулёвских горах.\\nСело расположено в живописных местах Самарской Луки. Находится восточнее центра городского округа — города Жигулёвск — на расстоянии около 20 км по прямой или 40 км по дорогам. Ближайшая станция железной дороги находится в Жигулёвске. Есть пристань, куда причаливают пригородные суда Самара-Зольное.\\nИмеется дворец культуры «Нефтяник». В связи с прекращением добычи нефти село находится в запустении, частично используется для коттеджного строительства.\\nНеподалёку находится радиорелейная станция, обеспечивающая передачу самарских радиопрограмм с Самарского ОРТПЦ на Жигулёвский РТПС."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B4%BB%E8%B7%83%E7%9A%84%E5%88%86%E7%A6%BB%E4%B8%BB%E4%B9%89%E8%BF%90%E5%8A%A8%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Active_separatist_movements_in_Europe.svg","page_title":"活跃的分离主义运动列表","context_page_description":"本表列出了當前正在活動的為尋求民族自決、獨立建國或自主自治的獨立運動。"},{"page_url":"https://es.wikipedia.org/wiki/Aqua_(rascacielos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/20090524_Buildings_along_Chicago_River_line_the_south_border_of_the_Near_North_Side_and_Streeterville_and_the_north_border_of_Chicago_Loop%2C_Lakeshore_East_and_Illinois_Center.jpg","page_title":"Aqua (rascacielos)","context_page_description":"El edificio o torre Aqua es un rascacielos de 86 plantas y uso mixto residencial localizado en la zona de Lakeshore East, en el centro de Chicago, Illinois, Estados Unidos.​ Diseñado por un equipo dirigido por Jeanne Gang, sus 262 m lo hacen el edificio más alto del mundo que tiene una mujer como arquitecto principal. Incluye un nivel de estacionamiento bajo tierra. La base del edificio de ocho plantas, de 13 000 m², está cubierta por 7 669 m² de terraza con jardines, gazebos, piscinas, bañeras de hidromasaje, una pista atlética y un pozo de fuego. Cada piso tiene aproximadamente 1 500 m².​ Aqua fue nombrado \\"rascacielos del año\\" en 2009 en los premios Emporis Skyscraper Award​ y fue finalista en 2010 del premio bienal del International Highrise Award.​"},{"page_url":"https://en.wikipedia.org/wiki/Notre-Dame_de_la_Daurade","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Basilique_Notre-Dame_de_la_Daurade_7312.jpg","page_title":"Notre-Dame de la Daurade","context_page_description":"Notre-Dame de la Daurade is a basilica in Toulouse, France. It was established in 410 when Emperor Honorius allowed the conversion of pagan temples to Christianity. The original building of Notre-Dame de la Daurade was a temple dedicated to Apollo."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1987","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Marcelo-Grohe.jpg","page_title":"Lijst van personen geboren in 1987","context_page_description":"Dit is een lijst van personen die geboren zijn in 1987.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://cs.wikipedia.org/wiki/Ph%C3%B6nix_D.III","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Phonix_D_III.jpg","page_title":"Phönix D.III","context_page_description":"Phönix D.III byl rakousko-uherský jednomotorový stíhací dvouplošník smíšené konstrukce, vyvinutý firmou Phönix Flugzeugwerke AG. Na sklonku války se sice ještě dostal do výroby, ale již nebyl bojově nasazen."},{"page_url":"https://fr.wikipedia.org/wiki/Les_fr%C3%A8res_Guedin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Catherine_entour%C3%A9e_par_les_Fr%C3%A8res_Guedin.jpg","page_title":"Les frères Guedin","context_page_description":"Les Frères Guedin est le pseudonyme collectif utilisé depuis le début des années 2000 par une fratrie de dessinateurs français, par ailleurs actifs individuellement sous les noms Dav Guedin et Gnot Guedin."},{"page_url":"https://de.wikipedia.org/wiki/R%C3%B6hlinghausen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Herne%2C_Rolandstra%C3%9Fe_49_-_Mittelpunkt_der_Metropole_Ruhr_%281%29.jpg","page_title":"Röhlinghausen","context_page_description":"Röhlinghausen ist ein Stadtteil von Herne im Stadtbezirk Eickel mit 11.020 Einwohnern."},{"page_url":"https://es.wikipedia.org/wiki/Cecilia_Beaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Cecilia_Beaux_painting_Cardinal_Mercier.jpg","page_title":"Cecilia Beaux","context_page_description":"Cecilia Beaux fue una retratista estadounidense de la American Society. Recibió su formación en Filadelfia y Francia. Sus representaciones de la clase dominante estadounidense la convirtieron en una de las pintoras de retratos más exitosas de su época."},{"page_url":"https://it.wikipedia.org/wiki/Locomotiva_FS_688","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/354.7152_in_Railway_museum_Luzna_u_Rakovnika.jpg","page_title":"Locomotiva FS 688","context_page_description":"Le locomotive FS 688 hanno costituito un piccolo gruppo di locomotive a vapore con tender, di fabbricazione austriaca, a vapore surriscaldato, a doppia espansione e con motore a 2 cilindri, incorporate dalle Ferrovie dello Stato come risarcimento bellico. Le locomotive, originalmente immatricolate come kkStB 429, erano macchine per servizi viaggiatori delle Kaiserlich-königliche österreichische Staatsbahnen."},{"page_url":"https://tr.wikipedia.org/wiki/Cuma_Han_Camii","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/MeczetPiatkowyGrob1.jpg","page_title":"Cuma Han Camii","context_page_description":"Cuma Han Camii, Han Camii veya Giray Han Camii, Kırım Özerk Cumhuriyeti'nin Gözleve şehrinde bulunan tarihi cami. Mimar Sinan tarafından tasarlanan cami, 1552-1564 yılları arasında inşa edilmiştir."},{"page_url":"https://sl.wikipedia.org/wiki/NGC_3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/NGC_0003_2MASS.jpg","page_title":"NGC 3","context_page_description":"NGC 3 je lečasta galaksija v ozvezdju Rib. Njen navidezni sij je 14,2ᵐ. Od Sonca je oddaljena približno 47,8 milijonov parsekov, oziroma 155,90 milijonov svetlobnih let.\\nGalaksijo je odkril Albert Marth 29. novembra 1864 istočasno kot galaksijo NGC 4 z 48 palčnim reflektorjem, tedaj drugim največjim daljnogledom na svetu."},{"page_url":"https://de.wikipedia.org/wiki/Sedimentationshypothese","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Gordon_Allport.gif","page_title":"Sedimentationshypothese","context_page_description":"Die Sedimentationshypothese, auch lexikalische Hypothese oder lexikalischer Ansatz, bezeichnet in der Psychologie die Annahme, dass alle wichtigen Persönlichkeitseigenschaften umgangssprachlich durch Eigenschaftsworte der jeweiligen Sprache repräsentiert sind.\\nMan unterstellt, dass die menschlichen Sprachen für alle persönlichen Eigenschaften, die bedeutsam, interessant oder nützlich sind oder waren, im Laufe der Zeit spezielle Wörter entwickelt haben. Mit der Wichtigkeit individueller Persönlichkeitsunterschiede stieg dabei auch die Wahrscheinlichkeit dafür, dass die Sprache ein gesondertes Wort hervorbrachte. Die Sammlung der Begriffe eines Sprachraumes, mit denen individuelle Unterschiede beschrieben werden können, sollte den Bereich der relevanten individuellen Differenzen abdecken.\\nSie ist eine der wichtigsten und am meisten gebrauchten wissenschaftlichen Theorien der differentiellen und Persönlichkeitspsychologie.\\nUnter anderem wurden die Big Five-Persönlichkeitsmerkmale aus einer lexikalischen Analyse gewonnen. Aus Tausenden von Adjektiven zur Bezeichnung der Persönlichkeit haben Psychologen mit Hilfe statistischer Verfahren die entscheidenden Dimensionen ermittelt."},{"page_url":"https://hu.wikipedia.org/wiki/Fiorano_Canavese","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Map_-_IT_-_Torino_-_Municipality_code_1105.svg","page_title":"Fiorano Canavese","context_page_description":"Fiorano Canavese Olaszország Piemont régiójának, Torino megyének egy községe."},{"page_url":"https://hr.wikipedia.org/wiki/Drenov_Klanac","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Drenov_Klanac1.JPG","page_title":"Drenov Klanac","context_page_description":"Drenov Klanac je naselje u Republici Hrvatskoj, u sastavu Grada Otočca, Ličko-senjska županija."},{"page_url":"https://simple.wikipedia.org/wiki/President_of_Paraguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Liberatorojas.jpg","page_title":"President of Paraguay","context_page_description":"The President of Paraguay is according to the Constitution of Paraguay the head of the executive branch of the Government of Paraguay, both head of state and head of government.\\nThe President is limited to a single five-year term. it was ultimately rejected.\\nThe Presidential seat is the Palacio de los López, in Asunción. The Presidential residence is the Mburuvichá Roga, also in Asunción.\\nOnce Presidents leave office, they are granted by the Constitution of Paraguay the speaking-but-non-voting position of Senator for life.\\nThe current President of Paraguay is Mario Abdo Benítez, since 15 August 2018. He was elected in 2018."},{"page_url":"https://fr.wikipedia.org/wiki/%C8%98otrile","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Sotrile_jud_Prahova.png","page_title":"Șotrile","context_page_description":"Șotrile est une commune roumaine du județ de Prahova, dans la région historique de Valachie et dans la région de développement du Sud."},{"page_url":"https://fr.wikipedia.org/wiki/NGC_4274","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Ngc4274-hst-555.png","page_title":"NGC 4274","context_page_description":"NGC 4274 est une galaxie spirale barrée située dans la constellation de la Chevelure de Bérénice à environ 42 millions d'années-lumière. NGC 4274 a été découvert l'astronome germano-britannique William Herschel en 1785.\\nLa classe de luminosité de NGC 4274 est I-II et elle présente une large raie HI. De plus, c'est une galaxie LINER, c'est-à-dire une galaxie dont le noyau présente un spectre d'émission caractérisé par de larges raies d'atomes faiblement ionisés.\\nDes mesures non basées sur le décalage vers le rouge donnent une distance de 13,911 ± 4,286 Mpc, ce qui est à l'intérieur des distances calculées en employant la valeur du décalage."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D0%B8%D0%BD%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%D0%93%D1%83%D1%89%D0%B8%D0%BD%D1%86%D1%96_-_%D0%BF%D0%B0%D0%BB%D0%B0%D1%86-1.jpg","page_title":"Калинівський район","context_page_description":"Кали́нівський райо́н — район Вінницької області в Україні. Районний центр — місто Калинівка. У районі 58 населених пунктів."},{"page_url":"https://es.wikipedia.org/wiki/Profeta_Jerem%C3%ADas_(Donatello)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Donatello%2C_geremia_02.JPG","page_title":"Profeta Jeremías (Donatello)","context_page_description":"El profeta Jeremías es una escultura proveniente de una hornacina del campanario de la catedral Santa María del Fiore de Florencia y realizada por Donatello entre 1427 y 1435. Es de mármol blanco y mide 191 x 45 x 45 cm, se encuentra en el Museo dell'Opera del Duomo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D0%B0_%D0%B0%D0%B2%D1%96%D0%B0%D1%86%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Group_photo_of_aerial_demonstrators_at_the_2005_Naval_Unmanned_Aerial_Vehicle_Air_Demo.jpg","page_title":"Військова авіація","context_page_description":"Військова авіація — різновид авіації, що застосовує різні види літаків, вертольотів та інших літальних апаратів, з метою ведення військових дій у повітряному просторі.\\nТермін «військова авіація» у низці країн, відповідає визначенню Військово-повітряні сили. На озброєнні авіаційних частин знаходяться:\\nлітаки,\\nгідролітаки\\nвертольоти.\\nОснову бойової потужності військової авіації складають надзвукові всепогодні літаки, оснащені всіляким бомбардувальним і ракетно-артилерійським озброєнням, здатні уражати на віддалених відстанях цілі як ядерними, так і звичайними засобами.\\nЗалежно від призначення і підлеглості військова авіація у більшості країн поділяється на види:\\nармійська,\\nфронтова,\\nдалека,\\nпротиповітряної оборони,\\nвійськово-морського флоту і\\nвійськово-транспортна.\\nВідповідно до бойових завдань і характеру дій військова авіація поділяється по родах:\\nбомбардувальна,\\nвинищувально-бомбардувальна,\\nвинищувальна,\\nштурмова,\\nрозвідувальна,\\nпротичовнова,\\nмінно-торпедна,\\nтранспортна,\\nспеціальна та допоміжна."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_feministes_musulmanes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Tahar_Haddad.jpg","page_title":"Llista de feministes musulmanes","context_page_description":"Aquesta és una llista de participants importants en el feminisme islàmic, originalment ordenats pel cognom en cada període.\\nEs poden incloure també escriptors/es que no s'hagin identificat com a feministes, però que han fomentat en les seves obres la «consciència feminista» per una resistència del domini masculí."},{"page_url":"https://sl.wikipedia.org/wiki/Tanganji%C5%A1ko_jezero","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Tanganjikasee.jpg","page_title":"Tanganjiško jezero","context_page_description":"Tanganjíško jézero je veliko podolgovato sladkovodno jezero v zahodnem delu Srednje Afrike. Ocenili so, da je drugo najstarejše jezero na svetu za Bajkalskim jezerom v Sibiriji.\\nJezero leži znotraj Vzhodnoafriškega tektonskega jarka in ga omejujejo stene doline. Je največje tektonsko jezero v Afriki in drugo največje na afriški celini. Je najgloblje jezero v Afriki z največjo vodno prostornino sveže vode. V glavni smeri sever-jug meri 673 km s povprečno širino 50 km in največjo 72 km. Jezero pokriva površino 32.900 km², obseg obale znaša 1.828 km in srednja globina 570 m. Največja globina 1.470 m se nahaja v severni kotanji. S tem je drugo najglobje jezero na svetu za Bajkalskim. Skupna prostornina znaša 18.900 km³. Velikanska globina jezera pomeni, da nižji nivo predstavlja t. i. 'okamenelo vodo'. Jezersko razvodje pokriva 231.000 km². Glavna reka, ki ga na severu napaja je reka Ruzizi, ki odteka iz jezera Kivu, naslednjega iz te vrste jezer. Edina reka, ki odteka je Lukuga, ki se steče v kotlino Konga in s tem del vode priteče do Atlantskega oceana. Peščeni nanosi z muljem velikokrat onemogočajo odtok vode Lukunge, kar povzroča dvigovanje jezerske gladine."},{"page_url":"https://en.wikipedia.org/wiki/Hanaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/PikiWiki_Israel_2484_Agriculture_in_Israel_%D7%A4%D7%A8%D7%95%D7%AA_%D7%91%D7%92%D7%9C%D7%99%D7%9C_%D7%94%D7%AA%D7%97%D7%AA%D7%95%D7%9F.JPG","page_title":"Hanaton","context_page_description":"Hanaton is a kibbutz in northern Israel. Located twelve kilometers north of Nazareth near the Arab town of Shefaram, it falls under the jurisdiction of Jezreel Valley Regional Council. In 2019 it had a population of 983."},{"page_url":"https://ru.wikipedia.org/wiki/Damaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Damaris.jpg","page_title":"Damaris","context_page_description":"Damaris Mallma Porras — перуанская певица. Она является представителем современной музыки Анд, которая состоит из смеси традиционных индейских языка кечуа и современной поп-музыки."},{"page_url":"https://en.wikipedia.org/wiki/Mallory_Township,_Clayton_County,_Iowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Map_highlighting_Mallory_Township%2C_Clayton_County%2C_Iowa.svg","page_title":"Mallory Township, Clayton County, Iowa","context_page_description":"Mallory Township is a township in Clayton County, Iowa, USA. At the 2010 census, its population was 395, down from 411 ten years earlier."},{"page_url":"https://en.wikipedia.org/wiki/Church_of_San_Francisco_Acatepec","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Detalle_de_la_fachada_del_Templo_de_San_Francisco_Acatepec%2C_Puebla%2C_Pue..JPG","page_title":"Church of San Francisco Acatepec","context_page_description":"Church of San Francisco Acatepec is a colonial religious building, characteristic of the Mexican Baroque architecture, especially recognized for its facade of Talavera mosaics combined with red brick. It is located in the town of San Francisco Acatepec in San Andrés Cholula, Metropolitan area of Puebla, in the state of Puebla, Mexico, and it was one of the first churches founded in the region.\\nThe church started to built in mid-16th century and was completed in 1760. The azulejos of the facade were made between 1650-1750 made with Talavera pottery."},{"page_url":"https://fr.wikipedia.org/wiki/Revel_(Haute-Garonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Map_commune_FR_insee_code_31451.png","page_title":"Revel (Haute-Garonne)","context_page_description":"Revel est une commune française située dans le département de la Haute-Garonne en région Occitanie.\\nSes habitants sont appelés les Revélois et les Revéloises."},{"page_url":"https://fr.wikipedia.org/wiki/Chandelier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Lloyd%27s_Building_-_Adam_Room_chandelier.jpg","page_title":"Chandelier","context_page_description":"Un chandelier est un objet qui sert de support à des chandelles, des cierges ou des bougies.\\nChandelier désigne également un métier, c'est-à-dire la personne qui fabrique et vend des chandelles de suif."},{"page_url":"https://af.wikipedia.org/wiki/Rondebosch-meent","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Rondebosch_Common.JPG","page_title":"Rondebosch-meent","context_page_description":"Die Rondebosch-meent in Kaapstad is 'n erfenisgebied wat sowel 'n historiese as 'n natuurmonument is. Dit is 'n vry toeganklike gebied met verskeie wandel- en drafpaadjies en is eiendom van die stad."},{"page_url":"https://de.wikipedia.org/wiki/Eisbrecher_(Band)/Diskografie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Eisbrecher-blackfieldfestival-2013.jpg","page_title":"Eisbrecher (Band)/Diskografie","context_page_description":"Diese Diskografie ist eine Übersicht über die veröffentlichten Tonträger der deutschen NDH-Band Eisbrecher. Die erfolgreichsten Veröffentlichungen von Eisbrecher sind die Studioalben Schock und Die Hölle muss warten mit je rund 100.000 verkauften Einheiten."},{"page_url":"https://zh.wikipedia.org/zh-cn/RX-7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Mazda-rx7-2nd-generation01.JPG","page_title":"馬自達RX-7","context_page_description":"马自达RX-7是由日本马自达汽车公司自1978年至2002年间制造贩售、搭载转子引擎的双门跑车。关于车名的由来，“R”代表Rotary转子引擎，“X”为代表未来的象征记号，而“7”是马自达内部的车型代码，比如马自达2、马自达5分别为小型车、轿式多功能休旅车车型。在车迷之间，则常以车型代号的开头二字譬如“FC”、“FD”来做为各代车型的昵称。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Land_Salzburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Wappen_Elsbethen.png","page_title":"Liste der Wappen im Land Salzburg","context_page_description":"F. Zaisberger, N. Pfeiffer: Salzburger Gemeindewappen. Salzburg 1985, ISBN 3-85380-048-3.\\nR. Champigny: Das falsche Wappen der Stadt Hallein. Salzburg 1930."},{"page_url":"https://et.wikipedia.org/wiki/M%C3%A4gi-Badah%C5%A1an","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Vanj_gas_station.jpg","page_title":"Mägi-Badahšan","context_page_description":"Mägi-Badahšan on 2. jaanuaril 1925 NSV Liidu Kesktäitevkomitee määrusega moodustatud autonoomia Tadžikistani koosseisus.\\nPraegu on see autonoomne vilajett, mis hõlmab umbes 45% riigi territooriumist ning piirneb Kõrgõzstani, Hiina ja Afganistaniga.\\nPiirkonna kohta kasutatakse ka nimesid Badahšan ja Pamiir, mis õigupoolest tähistavad Mägi-Badahšanist laiemaid piirkondi. Pamiiriks on nimetatud ka Mägi-Badahšani idaosa, mis kattub Murgobi rajooni territooriumiga.\\nMägi-Badahšan on üks isoleerituimaid ja kõige raskemini ligipääsetavaid piirkondi Kesk-Aasias. Ta asub Tadžikistani kõrgmäestikuosas ning on mahajäänud piirkond.\\nNõukogude Liidu ajal oli juurdepääs Mägi-Badahšanile rangelt piiratud.\\nPakistanist eraldab Mägi-Badahšani kitsas, peaaegu läbimatu Vākhāni koridor.\\nVilajeti tähis standardi ISO 3166-2 järgi on TJ-BG."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%B6%CE%AF%CE%BC%CE%B9_%CE%9A%CE%AC%CF%81%CF%84%CE%B5%CF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/ShahCarter.gif","page_title":"Τζίμι Κάρτερ","context_page_description":"Ο Τζέιμς Ερλ «Τζίμυ» Κάρτερ είναι Αμερικανός πολιτικός, ο οποίος χρημάτισε 39ος Πρόεδρος των Ηνωμένων Πολιτειών και ήταν ο παραλήπτης του βραβείου Νόμπελ Ειρήνης το 2002, ο μόνος Πρόεδρος των ΗΠΑ που έλαβε αυτό το βραβείο αφότου άφησε το αξίωμα του. Προτού γίνει Πρόεδρος, ο Κάρτερ υπηρέτησε ως αξιωματούχος του Ναυτικού των ΗΠΑ, ήταν αγρότης, υπηρέτησε δύο θητείες ως Γερουσιαστής της Τζόρτζια και μία ως Κυβερνήτης της Τζόρτζια.\\nΩς Πρόεδρος, ο Κάρτερ δημιούργησε δύο νέα κυβερνητικού επιπέδου υπουργεία: το Υπουργείο Ενέργειας και το Υπουργείο Εκπαίδευσης. Εγκαθίδρυσε μια εθνική ενεργειακή πολιτική που περιελάμβανε την διατήρηση, τον έλεγχο των τιμών, και τις νέες τεχνολογίες. Στα εξωτερικά ζητήματα, ο Κάρτερ επεδίωξε τις Συμφωνίες του Καμπ Ντέιβιντ, τις Συνθήκες του Καναλιού του Παναμά, τον δεύτερο γύρο των Συνομιλιών Περιορισμού Στρατηγικών Όπλων, και επέστρεψε την Ζώνη του Καναλιού του Παναμά στον Παναμά.\\nΣε όλη την καριέρα του, ο Κάρτερ επίμονα έδινε έμφαση στα ανθρώπινα δικαιώματα. Ανέλαβε το αξίωμα του σε περίοδο διεθνούς στασιμοπληθωρισμού, ο οποίος παρέμεινε σε όλη τη θητεία του."},{"page_url":"https://es.wikipedia.org/wiki/Stoa_de_Eumenes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Teatro_di_Erode_Attico_mar05_03.jpg","page_title":"Stoa de Eumenes","context_page_description":"La Stoa de Eumenes o Pórtico de Eumenes está situada en la parte sur de la Acrópolis de Atenas, entre el Odeón de Herodes Ático y el Teatro de Dioniso. Era el lugar de reunión y de paso de los visitantes de ambos edificios."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%88%D8%B1%D8%B3%D9%84%D8%A8%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Wappen_Gorsleben.png","page_title":"گورسلبن","context_page_description":"گورسلبن یک شهر در آلمان است که در کوفهویزرکرایس واقع شده‌است. گورسلبن ۶۶۶ نفر جمعیت دارد."},{"page_url":"https://ca.wikipedia.org/wiki/Mines_de_nitre_de_Humberstone_i_Santa_Laura","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Oficinas_salitreras_de_Humberstone_y_Santa_Laura%2C_Chile%2C_2016-02-11%2C_DD_28.jpg","page_title":"Mines de nitre de Humberstone i Santa Laura","context_page_description":"Les oficines salitreras d'Humberstone i Santa Laura són dues antigues oficines salitreres, abandonades en l'actualitat, ubicades als municipis de Pozo Almonte, I Regió de Tarapacá, a Xile."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1913","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Charles_Helou_and_Nasser_in_1964.jpg","page_title":"Lijst van personen geboren in 1913","context_page_description":"Dit is een lijst van personen die geboren zijn in 1913.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%BF%D0%B0%D1%80%D0%BA%D1%8B_(%D0%A2%D0%B0%D0%B3%D0%B0%D0%BD%D1%80%D0%BE%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%D0%92%D0%BE%D1%80%D0%BE%D1%82%D0%B0_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%81%D0%B0%D0%B4%D0%B0_%D0%A2%D0%B0%D0%B3%D0%B0%D0%BD%D1%80%D0%BE%D0%B31.jpg","page_title":"Елизавета паркы (Таганрог)","context_page_description":"Елизавета паркы — Таганрогтағы элекке ҡала паркы. Император Александр I һәм уның ғаиләһенең яратҡан ял итеү урыны. Хәҙерге ваҡытта парк территорияһын авиация предприятиеһе — Г. М. Бериев исемендәге Таганрог авиация фәнни-техник комплексы биләй.\\nЕлизавета паркына 1825 йылдың көҙөндә нигеҙ һалына, император ғаиләһенең милкендә була. Александр I ҡатыны Елизавета Алексеевна хөрмәтенә аталған. Парк Таганрог территорияһының Карантин тип аталған бер өлөшөн биләй. Паркты эшләтеү өсөн Александр I Англиянан баҡсасы Грейҙы саҡыртып ала, ул карантин баҡсаһын киңәйтә һәм унда ағастар ултыртып сыға. Парктың йүкә, дардар, саған ағастарынан торған буйға һуҙылған киң аллеяһы һәм парктың ҡапҡаһынан алып эскәмйәләр торған түңәрәк майҙансыҡ урынлашҡан ярлауға тиклем һуҙылған арҡыры аллеяһы бар. Ярлау буйлап сирень ҡыуаҡтары ултыртылған. Парк майҙаны яҡынса 2,5 га тәшкил итә. 1826 йылдың яҙында Елизавета Алексеевна Таганрогтан китер алдынан паркты ҡала ҡарамағына тапшыра, парк Таганрог халҡына ял итеү өсөн асыла. Таганрогта император ҡушағаһы булыу иҫтәлеге итеп паркта матур «Император беседкаһы» урынлаштырыла. Паркта яҙыусы Антон Павлович Чехов булған, был урынды ул «Уттар» повесында һүрәтләй."},{"page_url":"https://fr.wikipedia.org/wiki/Keechaka_Vadham","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Raja_Ravi_Varma%2C_Sairandhri_%281891%29.jpg","page_title":"Keechaka Vadham","context_page_description":"Keechaka Vadham parfois écrit Keechak Vadham ou Keechakavadha, aussi connu sous le titre Keechak Vatham ou Keechakavatham, est un film muet indien produit, réalisé, filmé et monté par Rangaswamy Nataraja Mudaliar en 1916. Aujourd'hui perdu, ce premier film de l'histoire du cinéma d'Inde du Sud est tourné à Madras en cinq semaines dans le studio qu'il fonde pour l'occasion, la Indian Film Company.\\nLe scénario de Keechaka Vadham, co-écrit par l'acteur C. Rangavadivelu, est inspiré d'un épisode du Livre de Virata, le quatrième chant du Mahabharata. Il met l'accent sur la tentative du commandant Kichaka de courtiser Draupadi. Les rôles principaux sont joués par Raju Mudaliar et Jeevarathnam.\\nKeechaka Vadham est une réussite commerciale et reçoit des critiques positives. Le succès du film pousse R. Nataraja Mudaliar à réaliser d'autres films mythologiques, qui lui vaudront d'être considéré comme le père du cinéma tamoul. Ses œuvres ont notamment inspiré les réalisateurs indiens R.S. Prakash et J. C. Daniel."},{"page_url":"https://es.wikipedia.org/wiki/Fabric","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Fabric%2C_Smithfields%2C_London_in_2008.jpg","page_title":"Fabric","context_page_description":"Fabric es una discoteca que se encuentra en la ciudad de Londres. Fue inaugurada en 1999 y desde entonces sigue siendo fiel a su estilo, teniendo los viernes la mítica noche FabricLive, donde se puede escuchar Drum&Bass, Dubstep y variantes de música electrónica. Los sábados son noches de \\"Fabric\\" donde se escucha todo tipo de música como: techno, minimal, progressive, hip hop, etc. Ha tenido Dj´s invitados de primer nivel como Ricardo Villalobos, Luciano, Magda, Tiefschwarz, Ellen Allien, Richie Hawtin, Pendulum, Feed Me, Skrillex, Elvis Toscanini y sus Dj´s residentes Craig Richards y Terry Francis."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%B8%D5%B6_%D4%B4%D6%87%D5%AB%D5%BD%D5%B8%D5%B6_%D5%8C%D5%B8%D6%84%D6%86%D5%A5%D5%AC%D5%AC%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/John_D._Rockefeller_1917_painting.jpg","page_title":"Ջոն Դևիսոն Ռոքֆելլեր","context_page_description":"Ջոն Դևիսոն Ռոքֆելլեր, ամերիկացի բիզնեսմեն, բարերար, առաջին դոլլարատեր-միլիարդերն աշխարհում մարդկության պատմության մեջ։\\n1870 թվականին հիմնադրել է Standard Oil ընկերությունը և ղեկավարել է այն մինչև 1897 թվականը՝ մինչև պաշտոնապես թոշակառու դառնալը: Standard Oil ընկերությունը հիմնադրվել է Օհայո նահանգում՝ որպես Ջոն Ռոքֆելլերի, նրա եղբոր՝ Վիլյամ Ռոքֆելլերի, Հենրի Ֆլագերի, Ջաբեզ Բոստվիկի, քիմիկոս Սեմյուել Էնդրյուսի և Ստեֆան Հարկնեսի համատեղ գործընկերություն։ Կերոսինի և բիզնեսի պահանջարկի մեծացմանը զուգընթաց աճում էր նաև Ռոքֆելլերի վարկանիշը և դարձավ իր ժամանակների աշխարհի ամենահարուստ մարդը, նրա ունեցվածքն իր մահվան պահին կազմում էր 1,4 միլիարդ դոլլար կամ ԱՄՆ-ի ՀՆԱ-ի 1,54 %-ը: The New York Times-ի տվյալներով նրա հարստությունը գնահատվել է մոտավորապես 192 միլիարդ դոլլար 2006թ.-ի դրությամբ, իսկ 2018 թ.-ին այն կազմել է 389 միլիարդ դոլլար:\\nՌոքֆելլերը ԱՄՆ-ի հայտնի բարերարներից մեկն է, Ռոքֆելլեր հիմնադրամի հիմնադիրը, բժշկական և կրթական հաստատություններին բարեգործական օգնություն տրամադրող։ Նա հիմնադրել է Չիկագոյի համալսարանը և Ռոքֆելլերի անվան ինստիտուտը։ Հիշատակվում է որպես աշխատասեր, նպատակասլաց և աստվածավախ քրիստոնյա, որի համար գործընկերները նրան կոչել են «Սարկավագ»։"},{"page_url":"https://ce.wikipedia.org/wiki/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D0%B0%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/R%C9%99fael_A%C4%9Fayev_Karate_World_Champion.JPG","page_title":"Азербайджанаш","context_page_description":"Азербайджанаш — тюркийн мотт буьцу къам, дукху берш Ӏаш бу Азербайджанехь а, Иранехь а. Дукхалла — 30 миллион стаг. Кхин Ӏаш бу Россехь а, Гуьржийчохь а, Туркойчохь а."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_%D0%93%D0%B5%D1%81%D1%81%D0%B5%D0%BD-%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D1%81%D1%82%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Philipp_von_Hessen-Philippsthal_%281655-1721%29.jpg","page_title":"Филипп Гессен-Филипстальский","context_page_description":"Филипп Гессен-Филипстальский — ландграф Гессен-Филипсталя в 1663—1721 годах."},{"page_url":"https://id.wikipedia.org/wiki/Kereta_api_Gaya_Baru_Malam_Selatan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/KA_GBMS_WO.jpg","page_title":"Kereta api Gaya Baru Malam Selatan","context_page_description":"Kereta api Gaya Baru Malam Selatan merupakan layanan kereta api penumpang kelas eksekutif dan ekonomi plus yang dioperasikan oleh PT Kereta Api Indonesia untuk melayani lintas Surabaya Gubeng–Pasar Senen dan sebaliknya. Kereta api yang pertama kali beroperasi pada 17 Februari 1975 ini merupakan penerus dari layanan kereta api Limex Gaja Baru yang pernah beroperasi pada 1960-an."},{"page_url":"https://ca.wikipedia.org/wiki/Tuqueta_Roya","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Tuca_de_Llardaneta%2C_Tuqueta_Roya_i_Posets.jpg","page_title":"Tuqueta Roya","context_page_description":"La Tuqueta Roya és una muntanya de 3.273 m d'altitud, amb una prominència de 18 m, que es troba al massís de Pocets, província d'Osca."},{"page_url":"https://ceb.wikipedia.org/wiki/Zonosaurus_laticaudatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Western_Girdled_Lizard_%28Zonosaurus_laticaudatus%29_%2810274880936%29.jpg","page_title":"Zonosaurus laticaudatus","context_page_description":"Espesye sa reptil ang Zonosaurus laticaudatus. Una ning gihulagway ni Grandidier 1869. Ang Zonosaurus laticaudatus sakop sa kahenera nga Zonosaurus sa kabanay nga Gerrhosauridae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan.\\nKini nga matang hayop na sabwag sa Madagascar. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://eo.wikipedia.org/wiki/Peipsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Lake_Peipus%2C_LandSat-8%2C_2016-10-20.jpg","page_title":"Peipsi","context_page_description":"Peipsi estas granda purakva lago sur limo inter Estonio kaj Rusio en norda Eŭropo.\\nĜi estas la kvara plej granda lago en Eŭropo, post la Ladoga lago kaj Onega lago en Rusio norde de Sankt-Peterburgo, kaj Vänern en Svedio. La sekvaj laŭ grandeco estas lagoj Saimaa kaj Inari en Finnlando.\\nLaŭ la estonlingva nomigo kaj same en la loka voroa, Peipsi estas la norda parto, Pihkva la suda, kaj la pli mallarĝa meza parto nomiĝas Lämmijärv. Tamen el geografia vidpunkto temas pri unusola lago, kaj en la plej multaj aliaj lingvoj la nomo Peipsi respektive Peipus uzatas por la tuta lago."},{"page_url":"https://fr.wikipedia.org/wiki/Jacques_M%C3%A9decin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Casino_Ruhl_Nice_by_night_2014.jpg","page_title":"Jacques Médecin","context_page_description":"Jacques Médecin, né le 5 mai 1928 à Nice et mort le 17 novembre 1998 à Punta del Este, est un homme politique français, maire de Nice de 1966 à 1990, président du conseil général des Alpes-Maritimes de 1973 à 1990, et secrétaire d'État au Tourisme de 1976 à 1978 dans les gouvernements Chirac I, Barre I et Barre II."},{"page_url":"https://de.wikipedia.org/wiki/Filmempfindlichkeit","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Dynax_7D_iso3200.jpg","page_title":"Filmempfindlichkeit","context_page_description":"Als Filmempfindlichkeit bezeichnet man die Lichtempfindlichkeit von fotografischen Platten und Filmen. Bei höherer Lichtempfindlichkeit kann man bei gleicher Belichtungszeit in dunklerer Umgebung fotografieren oder man muss bei gleicher Helligkeit die Belichtungszeit reduzieren.\\nDie Filmempfindlichkeit wird heute in ISO und teilweise zu Vergleichszwecken auch noch in DIN, ASA oder GOST angegeben; früher waren Angaben in Weston, General Electric, in amerikanischen oder europäischen Scheinergraden, in H&D-Graden und verschiedenen anderen Systemen üblich.\\nDie Angabe der Filmempfindlichkeit findet sich auf der Filmverpackung sowie auf der Filmpatrone. Die Patronen von Kleinbildfilmen im Format 135 werden seit 1983 mit der automatisch auslesbaren DX-Kodierung versehen, die aus einem von der Kamera auslesbaren Schachbrettmuster aus leitfähigem Material und einem von den Filmverarbeitungsmaschinen im Labor lesbaren Barcode besteht. Neben anderen Angaben wird dort auch die Nennempfindlichkeit des Films aufgeführt. Auch die 1996 eingeführten Patronen der APS-Filme des Formats IX240 enthalten DX-iX-Code-Angaben."},{"page_url":"https://uk.wikipedia.org/wiki/GPR50","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/PBB_GE_GPR50_208311_at_fs.png","page_title":"GPR50","context_page_description":"GPR50 – білок, який кодується однойменним геном, розташованим у людей на X-хромосомі. Довжина поліпептидного ланцюга білка становить 617 амінокислот, а молекулярна маса — 67 369.\\nКодований геном білок за функціями належить до рецепторів, g-білокспряжених рецепторів, білків внутрішньоклітинного сигналінгу.\\nЛокалізований у клітинній мембрані, мембрані."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BB%D0%B0%D1%83%D0%BC,_%D0%9B%D1%83%D0%B8%D0%B7%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Louise_Glaum_photo.jpg","page_title":"Глаум, Луиза","context_page_description":"Луиза Глаум — американская киноактриса эпохи немого кино, прославившаяся в ролях роковых женщин, соперница Теды Бара."},{"page_url":"https://en.wikipedia.org/wiki/Polycrates","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Polycrates_leaving_his_daughter_to_encounter_Oroetus.jpg","page_title":"Polycrates","context_page_description":"Polycrates, son of Aeaces, was the tyrant of Samos from the 540s BC to 522 BC. He had a reputation as both a fierce warrior and an enlightened tyrant."},{"page_url":"https://pl.wikipedia.org/wiki/Kastoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Kostur.jpg","page_title":"Kastoria","context_page_description":"Kastoria – miasto w północno-zachodniej Grecji, w Górach Dynarskich, nad jeziorem Kastoria, w administracji zdecentralizowanej Epir-Macedonia Zachodnia, w regionie Macedonia Zachodnia, w jednostce regionalnej Kastoria. Siedziba gminy Kastoria. W 2011 roku liczyło 13 387 mieszkańców.\\nMiasto tradycyjnie słynęło z wyrobu futer, zapełniających także komisy PRL. Przemysł ten i rzemiosło zaczęły podupadać w ostatnich dziesięcioleciach XX wieku."},{"page_url":"https://en.wikipedia.org/wiki/Church_of_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Holy_trinity_front_8809.jpg","page_title":"Church of England","context_page_description":"The Church of England is the established church of England. The Archbishop of Canterbury is the most senior cleric, although the monarch is the supreme governor. The Church of England is also the mother church of the international Anglican Communion. It traces its history to the Christian church recorded as existing in the Roman province of Britain by the third century, and to the 6th-century Gregorian mission to Kent led by Augustine of Canterbury.\\nThe English church renounced papal authority when Henry VIII failed to secure an annulment of his marriage to Catherine of Aragon in 1534. The English Reformation accelerated under Edward VI's regents, before a brief restoration of papal authority under Queen Mary I and King Philip. The Act of Supremacy 1558 renewed the breach, and the Elizabethan Settlement charted a course enabling the English church to describe itself as both catholic and reformed:\\nCatholic in that it views itself as a part of the universal church of Jesus Christ in unbroken continuity with the early apostolic church. This is expressed in its emphasis on the teachings of the early Church Fathers, as formalised in the Apostles', Nicene, and Athanasian creeds."},{"page_url":"https://cy.wikipedia.org/wiki/Sidydd","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/F20.v._Aries_NLW_MS_735C.png","page_title":"Sidydd","context_page_description":"Mae'r Sidydd yn gylch o 12 rhaniad 30° ar hyd yr ecliptig, sef y llwybr ymddangosiadol y mae'r haul yn ei ddilyn dros gyfnod o flwyddyn. Mae llwybr y lloer a'r planedau'n agos iawn i'r eliptig sy'n ymestyn 8-9° i'r gogledd neu'r de ac a fesurir mewn lledred seryddol.\\nGelwir y rhaniadau hyn yn ddeuddeng \\"Arwydd\\". Mae arwyddion y Sidydd yn fwy hysbys mewn cyd-destun sêr-ddewiniol na seryddol, bellach."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%84%D1%82%D0%BE%D0%B3%D0%B0%D0%B7%D0%BE%D0%BD%D0%BE%D1%81%D0%BD%D0%B0_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C_%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BC%D0%BE%D1%80%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/North_Sea_OilandGas_Fields.jpg","page_title":"Нафтогазоносна область Північного моря","context_page_description":"Нафтогазоносна область Північного моря — розташована в акваторії Північного моря та на території Норвегії, Великої Британії, Данії, Нідерландів, Німеччини."},{"page_url":"https://lb.wikipedia.org/wiki/Festung_L%C3%ABtzebuerg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Bockfiels_w_351.jpg","page_title":"Festung Lëtzebuerg","context_page_description":"D'Festung Lëtzebuerg war, bis datt se an de Joren no 1867 ofgerappt gouf, eng Befestegungsanlag ronderëm d'Stad Lëtzebuerg, déi vu grousser strategescher Bedeitung an der Regioun war an dofir am Laf vun de Joerhonnerten ëmmer erëm besat gouf."},{"page_url":"https://de.wikipedia.org/wiki/Lhaz%C3%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Tibet-Agriculture-24-Yakherde-2014-gje.jpg","page_title":"Lhazê","context_page_description":"Lhazê ist ein Kreis der bezirksfreien Stadt Xigazê im Autonomen Gebiet Tibet der Volksrepublik China. 1999 zählte er 47.252 Einwohner."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%BC%D0%BE%D0%B4%D0%B5%D0%BB%D0%B8%D0%B7%D0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Z%C3%BCricher_Spielzeugmuseum_1000741.jpg","page_title":"Железнодорожный моделизм","context_page_description":"Железнодорожный моделизм — вид железнодорожного хобби, в котором можно выделить следующие направления: коллекционирование игрушечных или масштабных железнодорожных моделей и их аксессуаров; воссоздание в миниатюре исторических станций, железнодорожных линий и т. д.; создание моделей локомотивов и вагонов; садовые и парковые модели железных дорог крупного масштаба, в том числе используемые в целях развлечения и отдыха для перевозки пассажиров на составах с управляемыми непосредственно локомотивами."},{"page_url":"https://fr.wikipedia.org/wiki/Flying_Colors","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/20120920-230338_Flying_Colors_013_Tilburg.jpg","page_title":"Flying Colors","context_page_description":"Flying Colors est un supergroupe de rock progressif américain. Il est composé de Mike Portnoy, Dave LaRue, Casey McPherson, Neal Morse et Steve Morse sur une idée de Bill Evans, et actif depuis 2012."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%87%D8%A7%D8%AC%D9%85_%D9%85%D8%BA%D9%88%D9%84%E2%80%8C%D9%87%D8%A7_%D8%A8%D9%87_%D8%A7%D8%B1%D9%88%D9%BE%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Ephrosinia_of_Suzdal.jpg","page_title":"تهاجم مغول‌ها به اروپا","context_page_description":"تهاجم مغول‌ها به اروپا با آغاز سده سیزدهم میلادی امپراتوری مغول پس از اضمحلال قلمروی اسلاوهای شرقی همچون روس کیف و ولادیمیر، اروپا را مورد تهاجم قرار داد. ادامهٔ این تهاجم به اروپای مرکزی نیز تسری داشت که منجر به وقوع جنگ‌هایی میان مغول‌ها و بخش‌های منقسم شدهٔ لهستان گردید. در پادشاهی مجارستان نیز جنگ‌های مهمی همچون نبرد لگنیکا و نبرد موهی به وقوع پیوست."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%B8%D1%87%D0%BD%D0%B8%D0%BA_%D0%B1%D0%BE%D0%BB%D0%BE%D1%82%D0%BD%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/250_Peucedanum_palustre.jpg","page_title":"Горичник болотный","context_page_description":"Гори́чник боло́тный, или тисели́нум болотный, — травянистое растение, вид рода Горичник семейства Зонтичные. В случае разделения рода Горичник на ряд более мелких родов вместе с Peucedanum lancifolium Hoffm. ex Lange выделяется в род Thysselinum."},{"page_url":"https://it.wikipedia.org/wiki/Tranvia_Asti-Cortanze","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Mappa_tranvia_Asti-Cortanze.png","page_title":"Tranvia Asti-Cortanze","context_page_description":"La tranvia Asti-Cortanze era una linea tranviaria interurbana che collegò le città di Asti e Cortanze dal 1882 al 1915."},{"page_url":"https://nl.wikipedia.org/wiki/Anelasmocephalus_cambridgei","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Anelasmocephalus_cambridgei.jpg","page_title":"Anelasmocephalus cambridgei","context_page_description":"Anelasmocephalus cambridgei is een hooiwagen uit de familie kaphooiwagens. De wetenschappelijke naam van Anelasmocephalus cambridgei gaat terug op Westwood."},{"page_url":"https://es.wikipedia.org/wiki/Cidaris_cidaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Cidaris_cidaris_MHNT.jpg","page_title":"Cidaris cidaris","context_page_description":"La tabaquera es una especie de equinodermo de la familia Cidaridae.​"},{"page_url":"https://ca.wikipedia.org/wiki/M%C3%A8tode_cient%C3%ADfic","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Metodo_cientifico.svg","page_title":"Mètode científic","context_page_description":"El mètode científic és un conjunt de tècniques utilitzades per investigar fenòmens, adquirir nous coneixements, o corregir i integrar coneixements previs. Per tal de poder-se qualificar de científic, un mètode d'investigació s'ha de basar en la recol·lecció d'evidència empírica, observable i mesurable, emprant els principis de raonament lògic. El Termcat defineix el mètode científic com aquell «procediment de recerca que es basa en processos lògics del pensament i que s'organitza per relacionar dades i generalitzacions, amb l'objectiu de proposar i contrastar explicacions d'esdeveniments perceptibles». Aquestes tècniques permeten reunir un cos de dades fruit de l'observació i l'experimentació, a partir de les quals es poden formular teories.\\nLa principal característica que distingeix el mètode científic d'altres mètodes d'adquisició de coneixement és que els científics tracten de deixar que la realitat parli per si mateixa, i que recolzi una teoria quan se'n confirmen les prediccions i la desafii quan les seves prediccions resultin ser falses."},{"page_url":"https://pt.wikipedia.org/wiki/Ch%C3%A2teau_de_la_Verrerie_(Cher)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Verrerie_01_2009.jpg","page_title":"Château de la Verrerie (Cher)","context_page_description":"O Château de la Verrerie é um palácio da França situado na comuna de Oizon, departamento de Cher, próximo de Aubigny-sur-Nère, na fronteira entre o Berry e a Sologne."},{"page_url":"https://nl.wikipedia.org/wiki/Armas_J%C3%A4rnefelt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Armas_Jarnefelt.png","page_title":"Armas Järnefelt","context_page_description":"Armas Järnefelt was een Fins componist, pianist, maar vooral dirigent."},{"page_url":"https://en.wikipedia.org/wiki/Elmcroft","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Elmcroft_Landscape.jpg","page_title":"Elmcroft","context_page_description":"Elmcroft is a 19th-century house in Smiths Falls, Ontario, Canada, built in 1895 by the town's mayor, Francis Theodore Frost, who also served as director of the local Frost & Wood foundry, as a Member of Parliament and as a senator. It is an example of Queen Anne Revival architecture."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D9%86%D8%AC%D9%88%D9%84%D8%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Ringgold_City_Hall%2C_Ringgold_%28Catoosa_County%2C_Georgia%29.JPG","page_title":"رينجولد","context_page_description":"رينجولد مدينه امريكيه اداريا بتتبع مقاطعه كاتوسا, ولايه جورجيا."},{"page_url":"https://eu.wikipedia.org/wiki/Gracehill","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Gracehill_Primary_School_-_geograph.org.uk_-_342165.jpg","page_title":"Gracehill","context_page_description":"Gracehill Ipar Irlandako Antrim konderrian dagoen udalerri bat da, Ulster probintzian. Ballymena udalerritik 3 kilometro hego-mendebaldera dago."},{"page_url":"https://cs.wikipedia.org/wiki/Macrurosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Macrurosaurus_semnus.jpg","page_title":"Macrurosaurus","context_page_description":"Macrurosaurus je pochybný rod sauropodního dinosaura, žijícího v období spodní křídy na území dnešní Anglie."},{"page_url":"https://pl.wikipedia.org/wiki/Toru%C5%84skie_Wodoci%C4%85gi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Fragment_ulicy_Rybaki_na_wysoko%C5%9Bci_Toru%C5%84skich_Wodoci%C4%85g%C3%B3w.jpg","page_title":"Toruńskie Wodociągi","context_page_description":"Toruńskie Wodociągi – zakład o tradycji sięgającej 1893 roku z siedzibą w Toruniu.\\nToruńskie Wodociągi są dostawcą wody dla: Torunia, Inowrocławia i Ciechocinka oraz gmin: Lubicz, Wielka Nieszawka, Zławieś Wielka, Obrowo i Łysomice. Ponadto spółka jest dostawcą wody dla firm z Pomorskiej Specjalnej Strefy Ekonomicznej w Ostaszewie."},{"page_url":"https://en.wikipedia.org/wiki/Wuhan_Metro_rolling_stock","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Rolling_Stock_of_Wuhan_Metro_Line_2_2018-02-13_%282%29.jpg","page_title":"Wuhan Metro rolling stock","context_page_description":"Wuhan Metro owns and uses the following types of rolling stock. The system track gauge is 1 435 mm standard gauge."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Firmin_de_Vineuil-Saint-Firmin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Vineuil-Saint-Firmin_%2860%29%2C_%C3%A9glise_Saint-Firmin%2C_cl%C3%A9_de_vo%C3%BBte_de_l%27abside.JPG","page_title":"Église Saint-Firmin de Vineuil-Saint-Firmin","context_page_description":"L'église Saint-Firmin est une église catholique paroissiale située à Vineuil-Saint-Firmin, dans le département de l'Oise, en France. Elle succède à un édifice médiéval, qui a été entièrement remplacé par l'église actuelle, édifiée dans une unique campagne de travaux entre 1540 et 1543 grâce au mécénat du connétable Anne de Montmorency. Ses dimensions sont modestes, et son architecture gothique flamboyante est très simple et sans ambition, mais les formes et proportions sont harmonieuses, et l'homogénéité de l'ensemble est remarquable. L'on note seulement que les réseaux des fenêtres sont d'une grande diversité : sur quinze fenêtres, pas plus que trois affichent un même dessin. Ce sont surtout les cinq verrières historiées de la Renaissance qui font la réputation de l'église Saint-Firmin. Elles sont regroupées dans le chœur, et ont en partie été réalisées par des grands maîtres de l'époque. Une restauration sous la direction d'Auguste Steinheil en 1881-1882 les a sauvées pour la postérité. L'église a été inscrite au titre des monuments historiques par arrêté du 13 février 1970, et bénéficié d'une restauration à la même époque."},{"page_url":"https://vi.wikipedia.org/wiki/Dmitri_Ivanovich_Mendeleev","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Periodic_table_monument.jpg","page_title":"Dmitri Ivanovich Mendeleev","context_page_description":"Dmitri Ivanovich Mendeleev, là một nhà hoá học và nhà phát minh người Nga.\\nÔng được coi là người tạo ra phiên bản đầu tiên của bảng tuần hoàn các nguyên tố hoá học, một bước ngoặt lớn trong lịch sử nghiên cứu hoá học. Sử dụng bảng tuần hoàn này, ông đã dự đoán các tính chất của các nguyên tố còn chưa được phát hiện. Ông cũng là người phát hiện nhiệt độ sôi tới hạn."},{"page_url":"https://fr.wikipedia.org/wiki/Portofino","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Portofino%2C_Italie_%282%29.jpg","page_title":"Portofino","context_page_description":"Portofino est une commune de la ville métropolitaine de Gênes en Ligurie, dont Tonio Latrij est le maire."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A3%93%E9%A3%8E%E4%BC%8A%E8%8E%8E%E8%B4%9D%E5%B0%94%E5%AF%B9%E7%89%B9%E6%8B%89%E5%8D%8E%E5%B7%9E%E7%9A%84%E5%BD%B1%E5%93%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/TRC4isabel261_G12.jpg","page_title":"飓风伊莎贝尔对特拉华州的影响","context_page_description":"颶風伊莎貝爾對德拉瓦州的影響導致美國總統喬治·沃克·布希宣布該州為災區。截至2014年3月，該州一共只有14次經總統宣布成為聯邦災區。颶風伊莎貝爾於2003年9月6日在大西洋熱帶海域的維德角附近由一股東風波發展而成。系統朝西北方向前進，進入一片水溫較高，風切變很弱的環境後穩步加強，於9月11日達到風速每小時270公里的最高強度。經過四天的強度波動後，颶風逐漸減弱，於9月18日在北卡羅萊納州的外灘群島以風速每小時165公里的強度登陸。風暴登陸後迅速減弱，於次日在賓夕法尼亞州西部轉變為溫帶氣旋。風暴的中心仍然保持在德拉瓦州的南面和西面，整個風暴距該州最近時只有約280公里，其時伊莎貝爾仍然擁有強勁熱帶風暴標準並位於維吉尼亞州中部。\\n在伊莎貝爾來襲幾天前，熱帶風暴亨利剛在德拉瓦州引發洪災，結果這場颶風又進一步加重了災情。時速100公里的狂風在州內各地颳倒了大量的樹木和電線桿，還吹斷了許多樹枝，導致至少15300人家中停電。強烈的海浪和風暴潮以及內陸的徑流泛濫導致許多低洼地區被淹，全州共因這場風暴而遭受了4000萬美元的經濟損失，不過幸運的是州內沒有人員喪生。"},{"page_url":"https://it.wikipedia.org/wiki/Filippo_II_di_Baden-Baden","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Philipp_II_Baden.jpeg","page_title":"Filippo II di Baden-Baden","context_page_description":"Filippo II di Baden-Baden fu dal 1571 al 1588 margravio di Baden-Baden. Era figlio del margravio protestante Filiberto e della cattolica Matilde di Baviera."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%B8%E3%83%A3%E3%82%B9%E3%83%A9%E3%83%951%E4%B8%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Minskizjaslav.jpg","page_title":"イジャスラフ1世","context_page_description":"イジャスラフ1世は、キエフ大公。父はヤロスラフ1世、母はスウェーデン王オーロフの娘インゲゲルド。"},{"page_url":"https://pl.wikipedia.org/wiki/Dekanat_Rab","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/20140505_Rab_church_St_Mary_front.jpg","page_title":"Dekanat Rab","context_page_description":"Dekanat Rab – jeden z 6 dekanatów rzymskokatolickich wchodzących w skład diecezji Krk w Chorwacji.\\nWedług danych na październik 2015 roku, w jego skład wchodziło 9 parafii."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B6%D5%BE%D5%A1%D6%80%D5%B3%D5%A1%D5%B6%D6%84%D5%AB_%D5%A6%D5%A2%D5%B8%D5%BD%D5%A1%D5%B5%D5%A3%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/The_Merax_Trampoline.jpg","page_title":"Զվարճանքի զբոսայգի","context_page_description":"Զվարճանքի զբոսայգի, հավաքական տերմին, որն առանձնանում է որոշակի թվով ատրակցիոնների և զվարճանքի այլ տեսակների միևնույն տարածքում գտնվելով։ Զվարճանքի այգին տարբերվում է քաղաքային զբոսայգիներից և մանկական խաղահրապարակներից նրանով, որ նախատեսված է մարդկանց լայն շրջանակի զվարճանքի համար: Իսկ ի տարբերություն տոնավաճառների և ժողովրդական զբոսահանդեսների, որոնք ժամանակավոր են և շարժական, զվարճանքի այգիները ստացիոնար են և նախատեսված են երկարատև գործելու համար։ Երբեմն զբոսայգին լինում է թեմատիկ, որը զվարճանքի այգի է՝ ատրակցիոններով, շրջապատող դեկորացիաներով, և որի սպասարկող անձնակազմը ոճավորված է որոշակի թեմայի շուրջ, օրինակ՝ Վայրի արևմուտք կամ Ծովահենների կղզի և այլ թեմաներով:"},{"page_url":"https://en.wikipedia.org/wiki/Cynthia_Ross_Friedman","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Cynthia_Ross_Friedman.jpg","page_title":"Cynthia Ross Friedman","context_page_description":"Cynthia \\"Cindy\\" Ross Friedman, FRSA was a professor in Biological Sciences at Thompson Rivers University in Kamloops, British Columbia, Canada. She was inducted into the inaugural cohort of the Royal Society of Canada's College of New Scholars, Artists, and Scientists in 2014, and as a Fellow of the Royal Society for the Encouragement of Arts, Manufactures and Commerce in 2016."},{"page_url":"https://eo.wikipedia.org/wiki/S%C3%A1ndor_Benk%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/K%C3%B6nyvh%C3%A9t_2011_0082-2.jpg","page_title":"Sándor Benkó","context_page_description":"Sándor Benkó [ŝAndor benkO], laŭ hungarlingve kutima sinsekvo Benkó Sándor estis hungara klarnetisto, elektroinĝeniero, fakverkisto kaj profesoro.\\nSándor Benkó naskiĝis la 25-an de aŭgusto 1940 en Budapeŝto. Li mortis la 15-an de decembro 2015 en Budapeŝto."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D0%BD_%D0%A0%D0%B8%D0%BA%D0%BB%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Don_Rickles.jpg","page_title":"Дон Риклс","context_page_description":"Доналд Џеј „Дон“ Риклс био је амерички комичар, глумац и телевизијска личност, који је био препознатљив по својој тзв. увредљивој комедији.\\nТоком педесетих и шездесетих, Риклс је већ био популаран комичар, а 1968. је покренуо и своју сопствену емисију, The Don Rickles Show. Због својих \\"врућих\\" шала, у којима није штедео никога, Риклс је стекао надимак \\"Господин Врућина\\". Један од најистакнутијих телевизијских наступа Риклс је имао на другој председничкој инаугурацији Роналда Регана, у јануару 1985. године, када је, својим карактеристичним шалама, присутне довео до суза.\\nЗначајну каријеру је остварио и као глумац, а најпознатија улога му је у филму Ратници из 1970. године, где је сарађивао са Клинтом Иствудом, те у Скорсезеовом филму Казино, снимљеном 1995. године.\\nОстало је упамћено и његово пријатељство са славним певачем Френком Синатром.\\nИако већ у поодмаклој старости, Риклс је радио до последњег даха. Преминуо је услед отказивања бубрега, 6. априла 2017, у 91. години."},{"page_url":"https://simple.wikipedia.org/wiki/Qibla","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Mecca_Direction_Equidistant.jpg","page_title":"Qibla","context_page_description":"Qiblah is an Arabic word for the direction that should be faced when a Muslim prays during Salah. Most mosques contain a niche in a wall that indicates the qiblah."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Hudson_River_School_artists","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Thomascole2.jpg","page_title":"List of Hudson River School artists","context_page_description":"The following is a list of painters in the Hudson River School, a mid-19th-century American art movement. The movement was led by a group of landscape painters whose aesthetic vision was influenced by romanticism. Some of these artists are also considered luminists, a related movement in mid-19th-century American painting that was characterized in the twentieth century. Their paintings depict the Hudson River Valley and the surrounding area, as well as the Catskill Mountains, Adirondack Mountains, and White Mountains of New Hampshire. Note that \\"school\\" in this sense refers to a group of people whose outlook, inspiration, output, or style demonstrates a common thread, rather than a learning institution."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%A1%D5%B6_%D5%84%D5%AB%D5%A3%D5%A5%D5%AC_(%D5%8D%D5%A1%D5%AC%D5%BE%D5%A1%D5%A4%D5%B8%D6%80)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Tercera_Brigada_de_Infanteria_El_Salvador_2012.jpg","page_title":"Սան Միգել (Սալվադոր)","context_page_description":"Սան Միգել քաղաք արևելյան Սալվադորում: Բնակչության թվով երրորդ քաղաքն է երկրում: Գտնվում է մայրաքաղաք Սան Սալվադորից 138կմ արևելք: 2017 թվականի դրությամբ բնակչությունը կազմել է 518.410 մարդ:"},{"page_url":"https://eu.wikipedia.org/wiki/Thraupis_sayaca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Sayaca_tanager.JPG","page_title":"Thraupis sayaca","context_page_description":"Thraupis sayaca Thraupis generoko animalia da. Hegaztien barruko Thraupidae familian sailkatua dago."},{"page_url":"https://fr.wikipedia.org/wiki/Sousse","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Flickr_-_%E2%80%A6trialsanderrors_-_Sousse%2C_Tunisia%2C_ca._1899.jpg","page_title":"Sousse","context_page_description":"Sousse est une ville portuaire de l'Est de la Tunisie, située à 143 kilomètres au sud de Tunis, et ouverte sur le golfe d'Hammamet.\\nCapitale du Sahel tunisien — elle est parfois surnommée la « perle du Sahel » — et chef-lieu du gouvernorat du même nom, elle est la troisième municipalité du pays après Tunis et Sfax, et la quatrième agglomération, Nabeul étant la troisième.\\nLa médina de Sousse est inscrite au patrimoine mondial de l'Unesco depuis 1988."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Monuments_of_National_Importance_in_Bangalore_circle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/The_reamins_of_the_Queen%27s_palace..jpg","page_title":"List of Monuments of National Importance in Bangalore circle","context_page_description":"This is a list of Monuments of National Importance as officially recognized by and available through the website of the Archaeological Survey of India in the Indian state Karnataka. 207 Monuments of National Importance have been recognized by the ASI in Bengaluru circle of Karnataka."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%BE%D1%81%D0%BE%D1%84,_%D0%BE%D0%B1%D1%8A%D1%8F%D1%81%D0%BD%D1%8F%D1%8E%D1%89%D0%B8%D0%B9_%D0%BC%D0%BE%D0%B4%D0%B5%D0%BB%D1%8C_%D0%A1%D0%BE%D0%BB%D0%BD%D0%B5%D1%87%D0%BD%D0%BE%D0%B9_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Wright_of_Derby%2C_The_Orrery.jpg","page_title":"Философ, объясняющий модель Солнечной системы","context_page_description":"«Философ, объясняющий модель Солнечной системы» — картина английского художника Джозефа Райта, написанная около 1766 года. Полное название «Философ, объясняющий модель Солнечной системы, в которой лампа замещает Солнце»"},{"page_url":"https://eo.wikipedia.org/wiki/Mal%C3%A9_Kozm%C3%A1lovce","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Coat_of_arms_of_Mal%C3%A9_Kozm%C3%A1lovce.jpg","page_title":"Malé Kozmálovce","context_page_description":"Malé Kozmálovce, hungare Kiskoszmály [kiŝkosmAj] estas vilaĝo en Slovakio, en Regiono Nitra, en Distrikto Levice."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%9B%D7%9D_%D7%94%D7%A7%D7%93%D7%95%D7%9E%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/%D7%94%D7%A8_%D7%92%D7%A8%D7%99%D7%96%D7%99%D7%9D_%D7%95%D7%94%D7%A8_%D7%A2%D7%99%D7%91%D7%9C._.jpg","page_title":"שכם הקדומה","context_page_description":"שכם הקדומה או שכם העתיקה היא עיר מקראית, שעל פי ממצאים ארכאולוגיים הייתה קיימת כבר בתקופה הכלקוליתית. במקרא מופיעה שכם כעיר חשובה במרכז ארץ כנען, שאוכלסה על ידי העם החיוי מבני כנען, ולאחר כיבוש הארץ על ידי עם ישראל בראשית תקופת ההתנחלות יועדה להיות אחת משלוש ערי המקלט שבעבר הירדן המערבי, ולכך אכן שימשה בשנותיה הראשונות, אולם ברוב שנות קיומה ישבו בה כנענים מבעלי שכם, וישראלים משבט מנשה.\\nבראשית התפלגות הממלכה שימשה שכם לזמן מה כעיר הבירה של ממלכת ישראל, אך כעבור זמן קצר הועתקה הבירה לעיר תרצה, ומעמדה של שכם נפגע ללא שוב עד גלות עשרת השבטים. על פי המסופר במקרא, גם לאחר חורבן בית המקדש הראשון נותרה התיישבות ישראלית מועטה בשכם, אך היא פסקה לאחר רצח גדליהו בן אחיקם ורציחת אנשי שכם על ידי ישמעאל בן נתניה זמן קצר לאחר החורבן. חשיבות נוספת הוענקה לשכם בשל היותה מקום קבורתו של יוסף, שנקבר בחלקת השדה שרכש יעקב מבעלי שכם בעת שובו לארץ מחרן."},{"page_url":"https://pt.wikipedia.org/wiki/Noite","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ibirapuera_Sampa.jpg","page_title":"Noite","context_page_description":"A noite é o período ocorrido durante a rotação da Terra em que não é recebida a luz do Sol, ou seja, aquela determinada região encontra-se na parte escura do planeta, é o período do dia compreendido entre o pôr e o Nascer do sol. Seu período de duração varia consoante a estação do ano e o local da Terra onde se encontra: é maior no inverno e menor no verão; maior nos pólos, menor nos trópicos."},{"page_url":"https://eu.wikipedia.org/wiki/Antzinako_Greziako_erlijioa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Map_greek_sanctuaries-es.svg","page_title":"Antzinako Greziako erlijioa","context_page_description":"Antzinako Greziako erlijioa Antzinako Grezian egindako erritual eta sinesmenen bilduma da, greziar mitologian oinarrituak. Edonola ere, orduko Greziak, ohitura erlijiosoak hain ezberdinak izan ziren ezen ezin baita erlijio bakartzat hitz egin.\\nAntzinako greziarren tradizio kulturalak Grezia kontinentaletik haratuago zabaltzen ziren: Joniako kostalde eta uharteetara, Magna Greziara eta baita mendebaldeko Mediterraneon barreiaturiko greziar kolonietara ere. Gainera, antzinako Greziako erlijioak, etruskoen sinesmenez eralkia, antzinako Erromako erlijioa sortu zuen.\\nEgungo adituen arabera, jatorrizko greziar erlijioak erdialdeko Asiako estepetako xamanismoaren eragin handia izan zuen. Sinismen hauek Eszitian zegoen Olbia koloniatik Grezian barrena hedatu ziren."},{"page_url":"https://en.wikipedia.org/wiki/Penitents_(Barcelona_Metro)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Estaci%C3%B3_de_Penitents.jpg","page_title":"Penitents (Barcelona Metro)","context_page_description":"Penitents is a Barcelona Metro station, named after the Vallcarca i els Penitents neighbourhood, in the Gràcia district of Barcelona.The station is served by line L3.\\nThe station opened in 1985, when the section of line L3 between Lesseps and Montbau stations was opened.\\nThe station is located underneath Avinguda de Vallcarca, between Carrer del Gòlgota, Barcelona and Carrer d'Anna Piferrer, and can be accessed from entrances in the former and the latter, leading to a single ticket hall. It has twin side platforms that are 96 metres long."},{"page_url":"https://uk.wikipedia.org/wiki/LSG1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/PBB_GE_LSG1_221535_at_fs.png","page_title":"LSG1","context_page_description":"LSG1 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 3-ї хромосоми. Довжина поліпептидного ланцюга білка становить 658 амінокислот, а молекулярна маса — 75 225.\\nКодований геном білок за функціями належить до гідролаз, фосфопротеїнів.\\nЗадіяний у таких біологічних процесах як транспорт, транспорт білків, поліморфізм.\\nБілок має сайт для зв'язування з нуклеотидами, ГТФ.\\nЛокалізований у цитоплазмі, ядрі, ендоплазматичному ретикулумі."},{"page_url":"https://en.wikipedia.org/wiki/Fluphenazine","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Fluphenazine-xtal-2012-ball-and-stick.png","page_title":"Fluphenazine","context_page_description":"Fluphenazine, sold under the brand names Prolixin among others, is an antipsychotic medication. It is used in the treatment of chronic psychoses such as schizophrenia, and appears to be about equal in effectiveness to low-potency antipsychotics like chlorpromazine. It is given by mouth, injection into a muscle, or just under the skin. There is also a long acting injectable version that may last for up to four weeks. Fluphenazine decanoate, the depot injection form of fluphenazine, should not be used by people with severe depression.\\nCommon side effects include movement problems, sleepiness, depression and increased weight. Serious side effects may include neuroleptic malignant syndrome, low white blood cell levels, and the potentially permanent movement disorder tardive dyskinesia. In older people with psychosis as a result of dementia it may increase the risk of dying. It may also increase prolactin levels which may result in milk production, enlarged breasts in males, impotence, and the absence of menstrual periods. It is unclear if it is safe for use in pregnancy.\\nFluphenazine is a typical antipsychotic of the phenothiazine class."},{"page_url":"https://es.wikipedia.org/wiki/Rocafort_y_Vilumara","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Rocafort_-_Iglesa_de_Santa_Maria_de_Rocafort.jpg","page_title":"Rocafort y Vilumara","context_page_description":"Rocafort y Vilumara​​ es un municipio de la comarca del Bages, en la provincia de Barcelona, comunidad autónoma de Cataluña, España.\\nEl municipio está formado por la unión de dos antiguos núcleos urbanos: el de Rocafort y el de El Pont de Vilomara. También pertenece a este municipio la partida de Marquet que había pertenecido a Mura. En Marquet se encuentra una antigua iglesia prerrománica, considerada una de las más antiguas de la comarca."},{"page_url":"https://en.wikipedia.org/wiki/Jostaberry","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Ribes_nidigrolaria_inflorescence.jpg","page_title":"Jostaberry","context_page_description":"The jostaberry is a complex-cross fruit bush in the genus Ribes, involving three original species, the black currant R. nigrum, the North American coastal black gooseberry R. divaricatum, and the European gooseberry R. uva-crispa. It is similar to Ribes × culverwellii, the Jochelbeere, which is descended from just two of these species, R. nigrum and R. uva-crispa."},{"page_url":"https://id.wikipedia.org/wiki/Harrison_Ford_(aktor_film_bisu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Harrison_Ford_%28silent_film_actor%29.jpg","page_title":"Harrison Ford (aktor film bisu)","context_page_description":"Harrison Edward Ford adalah seorang aktor film dan panggung Amerika Serikat. Ia adalah pementas teater Broadway utama dan bintang era film bisu."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Vaucluse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Isle_sur_la_Sorgue_-_th%C3%A9atre.jpg","page_title":"Liste des monuments historiques de Vaucluse","context_page_description":"Cet article recense les monuments historiques du département de Vaucluse, en France."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%D0%9A%D0%BB%D1%83%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%D0%91%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%D0%9A%D0%BB%D1%83%D0%B3%D0%B0_%D0%BB%D1%96%D0%B2%D0%B8%D0%B9_%D1%84%D0%BB%D0%B0%D0%BD%D0%B3_20190924.jpg","page_title":"Будинок Клуга","context_page_description":"Буди́нок Клу́га — київський прибутковий будинок на вулиці Саксаганського, 96. Яскравий архітектурний витвір доби історизму. Оздоблення фасаду со­ковитими архітектурними і скульптурними деталями робить споруду справжньою окрасою в забудові вулиці."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%A0%ED%82%A4_%EC%8B%A0%ED%95%99%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Adalar_6954.jpg","page_title":"할키 신학교","context_page_description":"할키 신학교는 1844년 10월 1일 마르마라 해의 왕자의 섬에서 두 번째로 큰 섬인 할키 섬에 세워졌던 학교이다. 이 학교는 1971년 터키 의회가 사립 고등교육기관을 금지하는 법을 제정하기 전까지 동방 정교회의 콘스탄티노폴리스 총대주교청의 주요 신학교였다. 로마 시대 삼위일체 수도원 터였던 할키 섬의 희망의 언덕 꼭대기에 자리잡고 있다. 학교 시설은 수도원에서 계속 관리되고 있으며 회의장소로 이용되고 있다. 이스탄불에서 배를 타고 약 한 시간 만에 갈 수 있다."},{"page_url":"https://nl.wikipedia.org/wiki/Onze-Lieve-Vrouw_van_Goede_Raadkerk_(Den_Haag)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/DenHaag13.JPG","page_title":"Onze-Lieve-Vrouw van Goede Raadkerk (Den Haag)","context_page_description":"De Onze-Lieve-Vrouw van Goede Raadkerk, of kortweg de Goede Raadkerk is een rooms-katholiek kerkgebouw aan de Bezuidenhoutseweg in de Haagse wijk Bezuidenhout. De kerk is gewijd aan Onze Lieve Vrouw van Goede Raad. Tegenwoordig wordt de kerk gebruikt door de Engelstalige katholieke parochie Church of Our Saviour."},{"page_url":"https://de.wikipedia.org/wiki/St._Katharinen_(Gro%C3%9Fenbrode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Grossenbrode_2006_017_096.JPG","page_title":"St. Katharinen (Großenbrode)","context_page_description":"Die Kirche St. Katharinen ist die evangelisch-lutherische Kirche der Gemeinde Großenbrode im Kreis Ostholstein in Schleswig-Holstein. Die Kirche mit ihrem Umfeld ist eines der wenigen als Kulturdenkmal ausgewiesenen Bauwerke der Gemeinde."},{"page_url":"https://es.wikipedia.org/wiki/Jean_Beausejour","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Cameroon-Chilie_%2826%29.jpg","page_title":"Jean Beausejour","context_page_description":"Jean André Emanuel Beausejour Coliqueo es un futbolista chileno de ascendencia haitiana por vía paterna y mapuche por vía materna, juega como extremo, volante o lateral por la banda izquierda en Universidad de Chile de la Primera División de Chile. Es el décimo jugador en la historia en defender la camiseta de los tres clubes más populares del fútbol chileno: Colo-Colo, Universidad de Chile y Universidad Católica.​ Integra la Generación Dorada del fútbol chileno.​\\nAdemás, fue internacional absoluto con la Selección de Chile desde 2004 hasta 2019 ​ con la que se consagró campeón de la Copa América en 2015 y 2016. Ostenta el récord de ser el primer, y hasta ahora único, seleccionado chileno en anotar un gol en dos mundiales consecutivos: Sudáfrica 2010 y Brasil 2014.​​"},{"page_url":"https://fr.wikipedia.org/wiki/Nedomice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Nedomice_07.JPG","page_title":"Nedomice","context_page_description":"Nedomice est une commune du district de Mělník, dans la région de Bohême-Centrale, en République tchèque. Sa population s'élevait à 311 habitants en 2020."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%89ta_Carinae-k%C3%B6d","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/EtaCarinae.jpg","page_title":"Éta Carinae-köd","context_page_description":"Az Éta Carinae-köd egy diffúz köd a Hajógerinc csillagképben. Csak a déli félgömbről figyelhető meg, Magyarországról nem látható. Nevét a Tejútrendszer egyik legnagyobb tömegű és legnagyobb abszolút fényességű csillagáról, a köd közepén lévő, és azt sugárzásra gerjesztő η Carinae-ről kapta."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%81%D9%86%D8%A8%D8%A7%D8%AE_%D8%A2%D9%85_%D9%85%D8%A7%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Offenbach-Bieber_Luftbild_006.jpg","page_title":"افنباخ آم ماین","context_page_description":"افنباخ آم ماین آلمانین هسن ایالتینده یئر آلان بیر شهردیر و ۹۸ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۱۲۶۹۳۴ نفر دیر. بۇ شهرین ۴۴٫۹ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B3%9B%E4%BC%8A%E6%9C%97%E4%B8%BB%E7%BE%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Greater_Iran_Map.png","page_title":"泛伊朗主義","context_page_description":"泛伊朗主义是一种存在于中亚地区的意识形态，旨在提倡居住于伊朗高原及其它经受伊朗文化影响之地域的伊朗民族之间的团结与统一。这一概念涉及到多个族群，包括波斯人、阿塞拜疆人、奥塞梯人、库尔德人与扎扎人；分布在塔吉克斯坦、乌兹别克斯坦与阿富汗的塔吉克人；以及巴基斯坦的普什图人和俾路支人。最早提出这一理论的是一位叫做穆罕默德·阿夫沙儿·亚兹迪的学者。"},{"page_url":"https://en.wikipedia.org/wiki/Bloomfield_Road","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Blackpool_football_club.jpg","page_title":"Bloomfield Road","context_page_description":"Bloomfield Road is a football stadium in Blackpool, Lancashire, England, which has been the home of Blackpool F.C. since 1901.\\nThe record attendance at Bloomfield Road is 38,098, when Blackpool played Wolverhampton Wanderers on 17 September 1955.\\nThe stadium hosted three matches of the 2005 UEFA Women's Championship. It has also been the venue for the final of the Northern Rail Cup, a rugby league tournament."},{"page_url":"https://en.wikipedia.org/wiki/Ben_Chifley_Dam","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/BenChifleyDamWall.jpg","page_title":"Ben Chifley Dam","context_page_description":"Ben Chifley Dam, or Chifley Dam, is a rock and earth-fill embankment dam across the Campbells River in the central west region of New South Wales, Australia. The main purpose of the dam is to supply potable water to the city of Bathurst.\\nThe dam is named in honour of Ben Chifley, a former Prime Minister of Australia and Member for Macquarie."},{"page_url":"https://eo.wikipedia.org/wiki/Dillingen_an_der_Donau","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Studienkirche_Dillingen_%28Donau%29.JPG","page_title":"Dillingen an der Donau","context_page_description":"Dillingen an der Donau estas urbo en Germanio, borde de la rivero Danubo. La urbo troviĝas en la samnoma distrikto Dillingen de la federacia lando Bavario, kaj estas ties administra centro. Fine de decembro 2017 la komunumo havis 18 699 loĝantojn."},{"page_url":"https://vec.wikipedia.org/wiki/Montjoyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Aiguebelle01.jpg","page_title":"Montjoyer","context_page_description":"Montjoyer el xé on comun de 286 abitanti del departemento de Drôme che el fa parte del rejon Alvergna-Rodano-Alpe in Fransa."},{"page_url":"https://sh.wikipedia.org/wiki/Hor_Virap","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Khor_Virap.jpg","page_title":"Hor Virap","context_page_description":"Hor Virap je jedan od najvećih i najpoznatijih manastira jermenske apostolske crkve. Nalazi se na planini Ararat, 8 km od Artašata, blizu granice sa Turskom. Hor Virap je usko povezan sa prihvatanjem hrišćanstva u Jermeniji. Postao je veliki religiozni centar zahvaljujući Svetom Grigoriju Prosvetitelju, koji je u njemu bio utamničen trinaest godina. Naime, paganski jermenski kralj Tiridat III Veliki zatvorio je sveca u njemu i ubrzo nakon toga počeo da gubi razum. Njegova sestra je imala snove u kojima joj anđeo govori da samo zatvorenik u Hor Virapu može izlečiti njenog brata. U zadnjem trenutku, ali posle trinaest godina, kralj je poslušao sestru i naložio da se Sveti Grigorije oslobodi. Kao što je san predvideo, svetac je izlečio kralja, a ovaj je hrišćanstvo proglasio za glavnu državnu religiju."},{"page_url":"https://es.wikipedia.org/wiki/A%C3%B1os_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Panic_at_the_Disco_Im_Park_2016_%2811_von_11%29.jpg","page_title":"Años 2010","context_page_description":"El decenio, conocido como años 2010, década del 2010 o abreviado años 10 fue un periodo entre el 1 de enero de 2010 al 31 de diciembre de 2019. La década fue declarada como: El decenio Internacional de la Seguridad Vial, El decenio Internacional de las Naciones Unidas sobre la Diversidad Biológica y El Tercer Decenio Internacional de la Eliminación del Colonialismo.​\\nUna década que siguió marcada por la Crisis económica mundial que se inició en 2008. Puso en jaque a la Unión Europea, ya que cuatro estados miembros de la zona euro tuvieron que ser rescatados debido a la crisis del euro, además de la crisis del Estado de Bienestar europeo. El Reino Unido tras un referéndum en 2016, se convirtió en el primer estado miembro que abandona la Unión Europea. La prolongación de la crisis económica mundial provocó a mitad de la década una fuerte caída de las materias primas lo que afectó a los países emergentes como Brasil, Rusia o China, en donde parte de su matriz económica continuaba muy atada al precio de las comodities."},{"page_url":"https://it.wikipedia.org/wiki/Guy_Maddin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Guy_Maddin_Berlinale_2015.jpg","page_title":"Guy Maddin","context_page_description":"Guy Maddin è uno sceneggiatore e regista canadese."},{"page_url":"https://en.wikipedia.org/wiki/Minya,_Egypt","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/MinyaLamatiCourt2.jpg","page_title":"Minya, Egypt","context_page_description":"Minya is the capital of the Minya Governorate in Upper Egypt. It is located approximately 245 km south of Cairo on the western bank of the Nile River, which flows north through the city. The name of the city is derived from its ancient Egyptian name Men'at Khufu, meaning the nursing city of Khufu, linking it to the Pharaoh Khufu or Cheops, builder of the Great Pyramid at Giza."},{"page_url":"https://vi.wikipedia.org/wiki/L%E1%BA%A1c","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Arachide_Vilmorin-Andrieux_1904.png","page_title":"Lạc","context_page_description":"Lạc hay Đậu phộng, đậu phụng, là một loài cây thực phẩm thuộc họ Đậu có nguồn gốc tại Trung và Nam Mỹ. Nó là loài cây thân thảo hàng năm tăng có thể cao từ 30–50 cm. Lá mọc đối, kép hình lông chim với bốn lá chét, kích thước lá chét dài 1–7 cm và rộng 1–3 cm. Hoa dạng hoa đậu điển hình màu vàng có điểm gân đỏ, cuống hoa dài 2–4 cm. Sau khi thụ phấn, quả phát triển thành một dạng quả đậu dài 3–7 cm, chứa 1-4 hạt, và quả thường giấu xuống đất để phát triển. Trong danh pháp khoa học của loài cây này thì phần tên chỉ tính chất loài có hypogaea nghĩa là \\"dưới đất\\" để chỉ đặc điểm quả được giấu dưới đất. Trong cách gọi tên tiếng Việt, từ \\"lạc\\" có nguồn từ chữ Hán \\"lạc hoa sinh\\" mà có người cho rằng người Hán đã phiên âm từ \\"Arachis\\". Hạt lạc là loại thực phẩm rất giàu năng lượng vì có chứa nhiều lipit."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Cluj_-_C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/GhDojaNr25.JPG","page_title":"Lista monumentelor istorice din județul Cluj - C","context_page_description":"Lista monumentelor istorice din județul Cluj - C cuprinde monumentele istorice înscrise în Patrimoniul cultural național al României și aflate în localități din județul Cluj al căror nume începe cu litera C.\\nLista completă este menținută și actualizată periodic de către Ministerul Culturii din România, prin intermediul Institutului Național al Patrimoniului, ultima versiune datând din 2015. Această listă cuprinde și actualizările ulterioare, realizate prin ordin al ministrului culturii.\\nPuteți căuta un monument din județul Cluj folosind formularul de mai jos sau puteți naviga prin toate monumentele din județ la lista monumentelor istorice din județul Cluj."},{"page_url":"https://pt.wikipedia.org/wiki/Eclesiastes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Young_Man_with_a_Skull%2C_Frans_Hals%2C_National_Gallery%2C_London.jpg","page_title":"Eclesiastes","context_page_description":"Ecclesiastes é o terceiro livro da terceira seção da Bíblia hebraica e um dos livros poéticos e sapienciais do Antigo Testamento da Bíblia cristã. O título \\"Eclesiastes\\" é uma transliteração da tradução grega do termo hebraico Kohelet, que significa \\"aquele que reúne\\", mas que é tradicionalmente traduzido como \\"professor\\" ou \\"pregador\\" nas traduções da Bíblia em português, o pseudônimo utilizado pelo autor do livro.\\nO livro data do período entre 450 e 180 a.C. e é da tradição de autobiografias míticas do Oriente Médio, na qual um personagem, descrevendo a si próprio como um rei, relata suas experiências e tira lições delas, geralmente auto-críticas. O autor, que se apresenta como \\"filho de David, rei em Jerusalém\\", discute o sentido da vida e a melhor forma de viver. Ele proclama que todas as ações de um homem são inerentemente \\"hevel\\", um termo que significa \\"vãs\\" ou \\"fúteis\\", pois tanto os sábios quanto os tolos terminam na morte."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%B1%D9%88%D8%A8%DA%86%D9%81%D8%B3%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Trubchevsk_COA_%28Oryol_Governorate%29_%281781%29.png","page_title":"تروبچفسک","context_page_description":"شهر تروبچفسک در کشور روسیه و در اوبلاست بریانسک واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Jessica_Harrison_(triathlete)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Jessica_Harrisson_-_Triathlon_de_Lausanne_2010.jpg","page_title":"Jessica Harrison (triathlete)","context_page_description":"Jessica Harrison is a British-born French triathlete. She competed at the 2008 and 2012 Summer Olympics.\\nShe is openly lesbian and in 2005 began a relationship with fellow French triathlete Carole Péon.\\nHarrison announced that she was retiring from international competition after the Grand Final of the 2013 ITU World Triathlon Series held in London on 14 September. However, she returned to competition for the 2014 Abu Dhabi International Triathlon where she finished fifth in the short distance race."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkmale_in_Wesel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/NaturdenkmalSp%C3%A4tpappel.JPG","page_title":"Liste der Naturdenkmale in Wesel","context_page_description":"Naturdenkmale im Kreis Wesel im Landschaftsplan Wesel. Rechtskraft seit 27. Dezember 2004."},{"page_url":"https://no.wikipedia.org/wiki/Penny_Arcade_Expo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/PAX_East_2012_Expo_Hall.jpg","page_title":"Penny Arcade Expo","context_page_description":"Penny Arcade Expo er en spillmesse som avholdes årlig i Seattle, Boston, Melbourne og San Antonio. PAX ble startet av Jerry Holkins og Mike Krahulik, forfatteren og illustratøren bak online-tegneserien Penny Arcade. PAX begynte som en messe fokusert på videospill uavhengig av plattform. Det utviklet seg raskt til å bli en feiring av gaming-kultur i alle sine former: videospill, brettspill, rollespill, miniatyrspill og så videre. På messene er i hovedsak feiring av spillerne i seg selv og ikke på bransjen som sådan i fokus."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%B3rdoba_(subte_de_Buenos_Aires)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Futura_Estacion_Cordoba_%282%29.JPG","page_title":"Córdoba (subte de Buenos Aires)","context_page_description":"Córdoba es una estación del Subte de Buenos Aires perteneciente a la Línea H, se encuentra ubicada en la intersección de las avenidas Córdoba y Pueyrredón, en el límite de los barrios de Balvanera y Recoleta.\\nPosee una tipología subterránea con 2 andenes laterales y dos vías. Posee un vestíbulo superior que conecta las plataformas con los accesos en la calle mediante escaleras, escaleras mecánicas y ascensores; además posee indicaciones en braille en gran parte de sus instalaciones como así también baños adaptados y servicio de Wi-Fi público.​"},{"page_url":"https://en.wikipedia.org/wiki/1911_Pittsburgh_Panthers_football_team","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Pitt_fullback_Hube_Wagner_going_around_the_end_against_Carlisle_in_1911_football_game.jpg","page_title":"1911 Pittsburgh Panthers football team","context_page_description":"The 1911 Pittsburgh Panthers football team was an American football team that represented the University of Pittsburgh as an independent during the 1911 college football season. In its third season under head coach Joseph H. Thompson, the team compiled a 4–3–1 record and outscored opponents by a total of 72 to 29."},{"page_url":"https://en.wikipedia.org/wiki/Tilloy-Floriville","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Tilloy-Floriville_%283%29.JPG","page_title":"Tilloy-Floriville","context_page_description":"Tilloy-Floriville is a commune in the Somme department in Hauts-de-France in northern France."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Laa_an_der_Thaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bildstock_10241_bei_A-2136_Hanfthal.jpg","page_title":"Liste der denkmalgeschützten Objekte in Laa an der Thaya","context_page_description":"Die Liste der denkmalgeschützten Objekte in Laa an der Thaya enthält die 41 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Stadtgemeinde Laa an der Thaya."},{"page_url":"https://en.wikipedia.org/wiki/Corona_discharge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Corona_discharge_1.JPG","page_title":"Corona discharge","context_page_description":"A corona discharge is an electrical discharge caused by the ionization of a fluid such as air surrounding a conductor carrying a high voltage. It represents a local region where the air has undergone electrical breakdown and become conductive, allowing charge to continuously leak off the conductor into the air. A corona occurs at locations where the strength of the electric field around a conductor exceeds the dielectric strength of the air. It is often seen as a bluish glow in the air adjacent to pointed metal conductors carrying high voltages, and emits light by the same property as a gas discharge lamp.\\nIn many high voltage applications, corona is an unwanted side effect. Corona discharge from high voltage electric power transmission lines constitutes an economically significant waste of energy for utilities. In high voltage equipment like cathode ray tube televisions, radio transmitters, X-ray machines, and particle accelerators, the current leakage caused by coronas can constitute an unwanted load on the circuit. In the air, coronas generate gases such as ozone and nitric oxide, and in turn, nitrogen dioxide, and thus nitric acid if water vapor is present."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D1%8C%D1%88%D1%82%D0%B0%D0%B9%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Wasserturm_W%C3%B6llstein_Nordansicht.jpg","page_title":"Вельштайн","context_page_description":"Вельштайн — громада в Німеччині, розташована в землі Рейнланд-Пфальц. Входить до складу району Альцай-Вормс. Центр об'єднання громад Вельштайн.\\nПлоща — 12,00 км². Населення становить 4599 ос."},{"page_url":"https://de.wikipedia.org/wiki/Sidney_Dillon_Ripley","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Mary_Livingston_Ripley_%28d._1996%29%2C_S._Dillon_Ripley_%281913-2001%29%2C_Salim_Ali.jpg","page_title":"Sidney Dillon Ripley","context_page_description":"Sidney Dillon Ripley, häufig S. Dillon Ripley genannt, war ein US-amerikanischer Ornithologe und Naturschützer. Von 1964 bis 1984 war er Leiter der Smithsonian Institution."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Mard-de-Vaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Map_commune_FR_insee_code_71447.png","page_title":"Saint-Mard-de-Vaux","context_page_description":"Saint-Mard-de-Vaux je francúzska obec, ktorá sa nachádza v departemente Saône-et-Loire, v regióne Burgundsko."},{"page_url":"https://id.wikipedia.org/wiki/Habib_Burquibah","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Portrait_officiel_de_Habib_Bourguiba.png","page_title":"Habib Burquibah","context_page_description":"Habib Burquibah atau disebut dengan Habib Bourguiba dalam bahasa Prancis ialah Presiden Tunisia dari 25 Juli 1957 hingga 7 November 1987. Ia sering disamakan dengan pemimpin Turki Kemal Atatürk sebab reformasi sekuler yang dilakukan selama pemerintahannya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D0%B9_%D0%9C%D1%8E%D0%BD%D1%85%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Ubahn_westfriedhof_muenchen.jpg","page_title":"Список станций Мюнхенского метрополитена","context_page_description":"Это список всех существующих, находящихся в строительстве и запланированных станций Мюнхенского метрополитена.\\nПервая линия, ныне известная как, была открыта 19 октября 1971 года и состояла из 13 станций. В настоящее время метрополитен состоит из шести линий общей длиной 103,1 километров, из которых 91,3 км проходят под землёй и 11,8 км по поверхности. Число действующих станций — 100.\\nВ Мюнхенском метрополитене пересадочный узел в одном зале считается одной станцией, а в двух залах — двумя станциями, хотя они и имеют одинаковое название. Большая часть станций — подземные, со средней платформой длиной около 120 метров.\\nВ центре города линии идут попарно в одном туннеле, образуя три основных туннеля, а на периферии расходятся в разных направлениях."},{"page_url":"https://en.wikipedia.org/wiki/Hong_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Red_River_view_from_bridge_in_Hanoi.jpg","page_title":"Hong River","context_page_description":"The Hong River, also known as the Red River, the Hồng Hà and Sông Cái in Vietnamese, and the Yuan River in Chinese, is a river that flows from Yunnan in Southwest China through northern Vietnam to the Gulf of Tonkin. According to C. Michael Hogan, the associated Red River Fault was instrumental in forming the entire South China Sea at least as early as 37 million years before present."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A6%AC%E9%99%B6%E6%8B%89%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/NZ-Mataura_R.png","page_title":"馬陶拉河","context_page_description":"馬陶拉河位於紐西蘭南島南地大區，長約190公里。\\n馬陶拉河源頭位於瓦卡蒂普湖以南的Eyre Mountains，先向東南流往高爾鎮，再向南流經馬陶拉鎮、溫得姆鎮、福特羅斯鎮，最後在南島南岸托伊托伊斯灣流入太平洋。馬陶拉河大部份水道都是呈辮狀的。\\n馬陶拉河以褐鱒知名，是一處熱門的釣魚地點。由於是瀕危動物黑喙鷗的繁殖地，馬陶拉河被國際鳥盟定為 重點鳥區。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%A4%EC%84%9C%EB%8B%88_%EB%A7%88%EC%9D%B4%ED%81%B4_%ED%99%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Gsamhall.jpg","page_title":"앤서니 마이클 홀","context_page_description":"앤서니 마이클 홀은 미국의 배우이다."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A8%9E%E5%AF%86%E9%99%A2_(%E6%97%A5%E6%9C%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Ex-Privy_Council_Building.jpg","page_title":"樞密院 (日本)","context_page_description":"日本樞密院是由樞密顧問組成的天皇的諮詢機構。因為處理了許多憲法問題，亦稱「憲法守護者」。1888年設立，在1947年廢止。簡稱樞府，議長稱樞相。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%A1%D0%BF%D0%B0%D1%80%D1%82%D0%B0%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/CrassusSpartacus_ru.svg","page_title":"Восстание Спартака","context_page_description":"Восста́ние Спартака́ — величайшее в древности и третье по счёту восстание рабов. Последнее восстание рабов в Римской республике датируется обычно 74 —71 гг. до н. э. Восстание Спартака было единственным восстанием рабов, представлявшим прямую угрозу центральной Италии. Окончательно подавлено в основном благодаря военным усилиям полководца Марка Лициния Красса. В последующие годы оно продолжало оказывать косвенное воздействие на политику Рима.\\nМежду 73 и 71 годами до н. э. группа беглых рабов — первоначально небольшая, примерно из 78 беглых гладиаторов — переросла в сообщество из более чем 120 тыс. мужчин, женщин и детей, относительно безнаказанно перемещавшихся по Италии под руководством нескольких лидеров, в том числе знаменитого гладиатора Спартака. Боеспособные взрослые мужчины из этой группы составляли удивительно эффективный вооружённый отряд, который неоднократно показывал, что может противостоять римской военной мощи, как в виде местных патрулей и милиции, так и в виде подготовленных римских легионов под консульским командованием."},{"page_url":"https://en.wikipedia.org/wiki/T._Dudley_Allen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Franklin_County_Courthouse%2C_Hampton.jpg","page_title":"T. Dudley Allen","context_page_description":"Truman Dudley Allen, commonly known as T. D. Allen or T. Dudley Allen, was an American architect.\\nHe worked also as part of Healy and Allen.\\nA number of his works are listed on the U.S. National Register of Historic Places.\\nWorks include:\\nColumbus City Hall, 105 N. Dickason St. Columbus, Wisconsin, NRHP-listed\\nFranklin County Courthouse, Central Ave. and 1st St., NW Hampton, Iowa, NRHP-listed The courthouse is also included in the NRHP-listed Hampton Double Square Historic District.\\nHardin County Courthouse, Edgington Ave. Eldora, Iowa, NRHP-listed The courthouse is included in the Eldora Downtown Historic District.\\nMedina County Courthouse, Liberty St. and Broadway, Public Sq. Medina, Ohio, NRHP-listed\\nMerrill City Hall, 717 E. 2nd St. Merrill, Wisconsin, NRHP-listed\\nRock County Courthouse and Jail, 204 E. Brown Luverne, Minnesota, NRHP-listed"},{"page_url":"https://hr.wikipedia.org/wiki/Jan_III._Sobjeski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Olesko_-_Zamek_02.jpg","page_title":"Jan III. Sobjeski","context_page_description":"Jan III. Sobjeski je jedan od najznačajnijih vladara Poljsko-Litavske Unije, od 1674. do svoje smrti kralj Poljske i Veliki vojvoda Litve. Njegova 22-godišnja vladavina obilježena je stabilizacijom prilika u Poljsko-Litavskoj Uniji, kojoj je to bilo prijeko potrebno nakon teških razaranja iza Švedske agresije i Ustanka Bogdana Hmeljnickog. Bio je omiljen među svojim podanicima, jer je bio i sjajni vojskovođa, najpoznatiji je po svojoj pobjedi nad Turcima 1683 u Bitci kod Beča.\\nZbog brojnih pobjeda u bitkama sa osmanskim carstvom, sami Turci su ga nazvali Poljski lav"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A6%D8%A7%D8%AA%D8%B1_%D8%A7%D9%84_%DA%A9%D8%A7%D9%BE%DB%8C%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/El_Capitan_Theater_%283714598477%29.jpg","page_title":"تئاتر ال کاپیتان","context_page_description":"تئاتر ال کاپیتان یک سالن نمایش و سینما در هالیوود، لس آنجلس، ایالات متحده آمریکا است.\\nاین تئاتر که در سال ۱۹۲۶ تأسیس شده دارای ۱۱۰۰ نفر ظرفیت می‌باشد و متعلق به شرکت والت دیزنی است."},{"page_url":"https://es.wikipedia.org/wiki/Emerico_Lobo_de_Mesquita","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Th_M_Ouro_Preto_Int.jpg","page_title":"Emerico Lobo de Mesquita","context_page_description":"José Joaquim Emerico Lobo de Mezquita fue un organista, maestro, compositor y profesor brasileño. Su vida es apenas conocida y apenas documentada. Vivió en la época del florecimiento de la región de Minas Gerais, con ocasión del descubrimiento del oro y de las piedras preciosas.\\nEs patrono de la silla número 4 de la Academia Brasileña de Música, ​ considerado uno de los grandes exponentes, si no el mayor, de la llamada Escuela de Minas, y uno de los mayores nombres de la música erudita brasileña de todo el período colonial."},{"page_url":"https://es.wikipedia.org/wiki/Geokichla_citrina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Geokichla_citrina%2C_orange-headed_thrush.jpg","page_title":"Geokichla citrina","context_page_description":"El zorzal citrino o zorzal dama ​​ es una especie de ave paseriforme de la familia Turdidae nativa del sur de Asia. Es común en las área boscosas del subcontinente indio, el sur de China y el sudeste asiático, llegando hasta Borneo y Bali. La especie tiene poblaciones sedentarias y migratorias. Esta especie muestra preferencia por las zonas pantanosas umbrías, y como muchos de sus parientes es de costumbres discretas y solitarias.\\nEl zorzal citrino es un pájaro omnívoro, que se alimenta de una gran variedad de insectos, lombrices y frutos. Suele anidar en los arbustos.\\nEl macho de zorzal citrino presenta el plumaje de las partes superiores de color gris uniforme, mientras que su cabeza y partes inferiores son de color anaranjado. Las hembras y los juveniles tienen las partes superiores parduzcas."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%BA%91%E5%BD%A2%E5%B0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Tekenschaats.JPG","page_title":"云形尺","context_page_description":"雲形尺，又稱雲尺、曲線板，是一種在繪畫或漫畫中用來繪製曲線的工具。在漫畫中，雲形尺用於繪製背景和效果線。也用於描繪機械或物件。雲形尺屬於固定圖案用尺，只能在上面尋找近似的曲線來參考繪製。多購買不同形態的雲形尺有助於將常用曲線收集齊全。\\n雲形尺在使用一段時間之後，邊緣會變得凹凸不平，這時候畫出來的線會不夠圓滑，並破壞整個畫面。"},{"page_url":"https://en.wikipedia.org/wiki/Surcoat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/BM-Metz_MS1588_0378_d%C3%A9tail.jpg","page_title":"Surcoat","context_page_description":"A surcoat or surcote initially was an outer garment commonly worn in the Middle Ages by both men and women in Western Europe. It can either refer to a coat worn over other clothes or the outermost garment itself. The name derives from French meaning \\"over the coat\\", a long, loose, often sleeveless coat reaching down to the feet."},{"page_url":"https://arz.wikipedia.org/wiki/NGC_3065_(%D9%85%D8%AC%D8%B1%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/NGC_3065_DSS.jpg","page_title":"NGC 3065 (مجره)","context_page_description":"NGC 3065 هى مجره بتتبع كوكبه الدب الاكبر و اللى اكتشفها ويليام هيرشل و الاكتشاف كان بتاريخ 3 ابريل 1785."},{"page_url":"https://nl.wikipedia.org/wiki/Cordeliers_(Franse_Revolutie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/CordeliersClub.jpg","page_title":"Cordeliers (Franse Revolutie)","context_page_description":"De Club des Cordeliers, formeel Société des droits de l'homme et du citoyen geheten, was een radicaal gezelschap tijdens Franse Revolutie. De club was verantwoordelijk voor het verspreiden van de ideeën over vrijheid, gelijkheid en broederschap. Ze zag als taak een toeziend oog op de revolutie te houden en waakzaam te willen zijn tegen misbruik van macht.\\nCamille Desmoulins was de oprichter. Tot de overige leiders of leden behoorden Jean-Paul Marat, Georges Danton, Guillaume Brune, Jacques Pierre Brissot, Pierre Choderlos de Laclos en Jacques-René Hébert. De cordeliers speelden een belangrijke rol in de verspreiding van de cultus van de Rede.\\nDe club werd op 27 april 1790 opgericht, nadat alle zestig Parijse districten waren opgegaan in 48 secties. Actieve burgers konden daardoor de politieke gebeurtenissen op de voet volgen en in zekere zin sturen. De prijs van het lidmaatschap was laag, zodat de werkende stand zich als lid kon aanmelden. Er waren veel buitenlanders actief lid. De leden vergaderden in een middeleeuws klooster dat in 1790 was gesloten. De gebouwen, toebehorend aan de franciscanen, lagen in het 6e arrondissement, ook bekend als het Quartier Latin."},{"page_url":"https://es.wikipedia.org/wiki/Tobalaba_(estaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/TOBALABA_L1.jpg","page_title":"Tobalaba (estación)","context_page_description":"Tobalaba es una estación de combinación ferroviaria y terminal que forma parte de las líneas 1 y 4 de la red del metro de Santiago de Chile. Se encuentra por subterráneo entre las estaciones Los Leones y El Golf y antecede a la estación Cristóbal Colón. La estación se ubica en el límite entre las comunas de Las Condes y Providencia. Es la estación con mayor flujo de pasajeros de toda la red, registrando alrededor de 23 millones en 2016​ y más de 84 000 pasajeros diarios.​"},{"page_url":"https://de.wikipedia.org/wiki/Josef_Maria_Lukesch","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Denkmal_neu_-_Josef_Maria_Lukesch.JPG","page_title":"Josef Maria Lukesch","context_page_description":"Josef Maria Lukesch war ein Gendarm und Opfer des Nationalsozialismus."},{"page_url":"https://de.wikipedia.org/wiki/Nationalmuseum_Neu-Delhi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Buddha_National_Museum_of_INDIA01.jpg","page_title":"Nationalmuseum Neu-Delhi","context_page_description":"Das Nationalmuseum Neu-Delhi ist ein indisches Museum in der Hauptstadt Neu-Delhi an der Kreuzung Janpath/Maulana Azad Road. Noch vor den Museen in Kolkata und Chennai ist es das größte und bedeutendste des ganzen Landes."},{"page_url":"https://es.wikipedia.org/wiki/Chikil","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Caspian5Baku_Bay.png","page_title":"Chikil","context_page_description":"Chikil es una isla deshabitada de la bahía de Bakú en Azerbaiyán.​​ Esta isla forma parte del archipiélago de Bakú, que consta de diversas islas como Boyuk Zira, Dash Zira, Kichik Zira, Zenbil, entre otras.\\nLas aguas que rodean Chikil son muy poco profundas. Hay muy poca vegetación en la isla debido a la contaminación por hidrocarburos, así como por otros factores.\\nLa Foca del Caspio, el esturión, y numerosos tipos de aves, como patos, gaviotas y somormujos, son algunas de las especies animales que se pueden encontrar en y alrededor de la isla."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_kerken_in_Kopenhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Nordenskirker_Gustaf%2801%29.jpg","page_title":"Lijst van kerken in Kopenhagen","context_page_description":"Deze lijst van kerken in Kopenhagen somt de kerkgebouwen in de Deense hoofdstad Kopenhagen op. In deze lijst zijn de kerken opgenomen die in Groot Kopenhagen staan, dus ook in de gemeente Frederiksberg."},{"page_url":"https://de.wikipedia.org/wiki/San_Luis_(Argentinien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Klimadiagramm-San_Luis-Argentinien-metrisch-deutsch.png","page_title":"San Luis (Argentinien)","context_page_description":"San Luis ist eine Stadt in der Region Cuyo in Argentinien und Hauptstadt der Provinz San Luis und deren Departamento Juan Martín de Pueyrredón. Die Stadt liegt am Fuße der Sierras Grandes auf einer Höhe von 762 m am Río Chorrillos und hat 153.322 Einwohner. San Luis liegt an der Ruta Nacional 7, die Mendoza mit Buenos Aires verbindet. Die nächstgelegenen Provinzhauptstädte sind San Juan und Córdoba. Der Aéropuerto San Luis befindet sich sieben Kilometer vom Zentrum entfernt und verbindet die Stadt mit Buenos Aires."},{"page_url":"https://en.wikipedia.org/wiki/Campbell_Post_Office%E2%80%93Kuykendall_General_Store","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Campbell_Post_Office-Kuykendall_General_Store.jpg","page_title":"Campbell Post Office–Kuykendall General Store","context_page_description":"The Campbell Post Office–Kuykendall General Store is a historic residential–commercial building in rural Searcy County, Arkansas. It is located on County Road 73, northwest of Oxley, Arkansas. It is a single-story wood frame structure with modest Greek Revival styling. Its construction date was long thought to be 1920, but it was more likely built around 1900, still an extremely late date for the Greek Revival. It was converted into a post office and general store in the 1920s by Henry Kuykendall.\\nThe building was listed on the National Register of Historic Places in 1993."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%B5%CE%BD%CE%BD%CE%AE%CF%84%CF%81%CE%B9%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Portable_electrical_generator_side.jpg","page_title":"Γεννήτρια","context_page_description":"Η γεννήτρια ή ηλεκτρογεννήτρια, είναι μηχανή που βασίζεται πάνω στους νόμους της ηλεκτροφυσικής και ιδιαίτερα του φαινομένου της ηλεκτρομαγνητικής επαγωγής που ανακάλυψε ο διάσημος άγγλος φυσικός Μιχαήλ Φαραντέϋ, το 1831, και που αφορά την ενέργεια και τη μετατροπή της από τη μια μορφή σε μια άλλη.\\nΣυγκεκριμένα η γεννήτρια μετατρέπει τη μηχανική ενέργεια σε ηλεκτρική, σύμφωνα με φαινόμενο της φυσικής κατά το οποίο εαν ένα πηνίο περιστραφεί μέσα σ' ένα μαγνητικό πεδίο, τότε στις άκρες του πηνίου παράγεται ηλεκτρικό ρεύμα.\\nΗ γεννήτρια αποτελείται από δύο μέρη: το ακίνητο μέρος της που λέγεται στάτορας, ή στατόν, ή επαγωγέας ή πόλοι της μηχανής, στο οποίο υπάρχουν μαγνήτες και το κινητό μέρος της που λέγεται επαγώγιμο, ή στρεπτόν ή ρότορας, στο οποίο υπάρχουν πηνία. Γυρίζοντας το ρότορα μέσα στο στάτορα παράγεται ηλεκτρικό ρεύμα. Η περιστροφή του ρότορα γίνεται με ατμομηχανή, με υδροστρόβιλο κλπ. Η πιο γνωστή και απλούστερη ηλεκτρογεννήτρια είναι το γνωστό «δυναμό» των ποδηλάτων."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Bruxelles-A%C3%A9roport-Zaventem","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Brussels_Airport_train_station_-_black_and_white_%2863665107%29.jpg","page_title":"Gare de Bruxelles-Aéroport-Zaventem","context_page_description":"La gare de Bruxelles-Aéroport-Zaventem est une gare ferroviaire belge de la ligne 36C. Elle est située sous l'aéroport de Bruxelles-National, sur le territoire de la commune de Zaventem, en province du Brabant flamand.\\nC'est une gare de la Société nationale des chemins de fer belges, desservie par des trains InterCity et d'Heure de pointe."},{"page_url":"https://eu.wikipedia.org/wiki/Anaxyrus_hemiophrys","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Anaxyrus_hemiophrys_range_map.png","page_title":"Anaxyrus hemiophrys","context_page_description":"Anaxyrus hemiophrys Anaxyrus generoko animalia da. Anfibioen barruko Bufonidae familian sailkatuta dago, Anura ordenan."},{"page_url":"https://uk.wikipedia.org/wiki/Porsche_Panamera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/2019_Porsche_Panamera_4_E-Hybrid_Sport_Turismo_2.9.jpg","page_title":"Porsche Panamera","context_page_description":"Porsche Panamera — люксові спортивні хетчбеки, що виробляються компанією Porsche з 2009 року."},{"page_url":"https://no.wikipedia.org/wiki/Jurjuzan_(by)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%D0%A1%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%AE%D1%80%D1%8E%D0%B7%D0%B0%D0%BD%D1%8C.jpg","page_title":"Jurjuzan (by)","context_page_description":"Jurjuzan er en by i Tsjeljabinsk oblast i Russland. Den ligger ved elva Jurjuzan, 254 km fra Tsjeljabinsk og 6 km fra den lukkede byen Trjokhgornyj. Innbyggertall: 13 700, 14 158; 18 294.\\nDen ble grunnlagt i 1758 som bosetningen Jurjuzan-Ivanovskij Zavod i forbindelse med byggingen av et jernverk. Fra slutten av 1800-tallet var bosetningen kjent som Jurjuzanskij Zavod. Den fikk bystatus og ble omdøpt til Jurjuzan 18. juni 1943.\\nByens økonomi er sentrert rundt en stor fabrikk som produserer kjøleskap."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D0%BE%D0%BB%D1%82%D1%8A%D1%80_%D0%98%D0%BB%D0%B8%D0%BD%D0%B3_%D0%95%D0%B2%D0%B0%D0%BD%D1%81-%D0%A3%D0%B5%D0%BD%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Walter_Evans-Wentz_and_Lama_Kazi_Dawa_Samdup_photographed_circa_1919.jpg","page_title":"Уолтър Илинг Еванс-Уенц","context_page_description":"Уолтър Илинг Еванс-Уенц е американски антрополог и писател, един от пионерите в изследването на тибетския будизъм."},{"page_url":"https://de.wikipedia.org/wiki/Michelbach_am_Heuchelberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Michelbach-neues-schloesschen-web.jpg","page_title":"Michelbach am Heuchelberg","context_page_description":"Michelbach am Heuchelberg ist ein Dorf im Landkreis Heilbronn in Baden-Württemberg, das seit 1. Juli 1970 zur Gemeinde Zaberfeld gehört."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D1%87%D0%B5%D0%BF%D1%96%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Roofride_kyiv.JPG","page_title":"Зачепінг","context_page_description":"Зачепінг, зацепінг, трейнсерфінг — спосіб переміщення, проїзд на автозчепах вагонів, поручнях та підніжках, на гальмівних майданчиках, та у відкритих кузовах, на міжвагонних буферах та розетках та на дахах поїздів чіпляючись за зовнішню арматуру вагона. Люди, що практикують цей небезпечний вид пересування називають себе «зачеперами», «трейнсерферами».\\nТрейнсерфінг зазвичай розглядається особами, що його практикують, як екстремальна розвага, або ж як вільний спосіб їзди при поїздці потягом куди-небудь, котрий в порівнянні з їздою у вагоні має низку переваг:\\nОтримання задоволення від швидкості і процесу їзди;\\nРозширений огляд навколишньої місцевості в порівнянні з видом з вікна вагона;\\nМожливість проїхати з відносним комфортом при переповненості вагона або сильної спеки;\\nМожливість заощадити на оплаті проїзду;\\nМожливість встигнути застрибнути на поїзд під час відправлення або зістрибнути з нього на ходу до повної зупинки."},{"page_url":"https://fr.wikipedia.org/wiki/AirPort_Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Apple_airport_express.jpg","page_title":"AirPort Express","context_page_description":"L' AirPort Express était un routeur Wi-Fi de Apple Inc., un des produits de la gamme AirPort. Alors qu'il était compact et d'une certaine manière plus simple que les autres routeurs Wi-Fi d'Apple, notamment AirPort Extreme, l'Express proposait une sortie audio. L'AirPort Express était le premier appareil AirPlay ce qui lui permettait de recevoir du streaming audio à partir d'un ordinateur exécutant iTunes sur le réseau local.\\nAirPort Express surpasse les exigences strictes du Programme des Exigences pour les Petits Équipements de Réseau de la Version 1.0 d'ENERGY STAR.\\nSelon un rapport de Bloomberg, le 21 novembre 2016, \\"Apple Inc. a dissous sa division qui développe des routeurs sans fil, pour essayer de concentrer sur les produits de consommation qui génèrent la majeure partie de ses revenus, selon des personnes familières avec l'affaire.\\"\\nEn avril 2018, via le site 9to5Mac, Apple a annoncé l'arrêt de sa gamme AirPort, délaissant ainsi le marché des routeurs."},{"page_url":"https://af.wikipedia.org/wiki/Gwanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Mchabezi_GW.jpg","page_title":"Gwanda","context_page_description":"Gwanda is 'n dorp in suidwestelike Zimbabwe. Die dorp is in 1900 gestig en is die huidige hoofstad van die provinsie van Matabeleland-Suid."},{"page_url":"https://en.wikipedia.org/wiki/Tenerife_South_Airport","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Flughaveno_Tenerifo_Suda%2C_23.jpeg","page_title":"Tenerife South Airport","context_page_description":"Tenerife South Airport, also known as Tenerife South–Reina Sofía Airport, is the larger of the two international airports located on the island of Tenerife and the second busiest in the Canary Islands. It is located in the municipality of Granadilla de Abona and handled over 11 million passengers in 2018. Combined with Tenerife North Airport, the island gathers the highest passenger movement of all the Canary Islands, with 12,248,673 passengers, surpassing Gran Canaria Airport."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Karlsruhe","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Stolperstein_Karlsruhe_Adolf_Hess_Jollystr_49_%28fcm%29.jpg","page_title":"Liste der Stolpersteine in Karlsruhe","context_page_description":"Die Liste der Stolpersteine in Karlsruhe führt die von dem Künstler Gunter Demnig verlegten Stolpersteine in der Stadt Karlsruhe auf."},{"page_url":"https://fi.wikipedia.org/wiki/Idukkin_piirikunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/India_Kerala_Idukki_district.svg","page_title":"Idukkin piirikunta","context_page_description":"Idukki on yksi Intian Keralan osavaltion 14 piirikunnasta. Piirikunnassa asuu 1 129 221 henkeä, ja sen keskuskaupunki on Painavu. Muita tärkeitä kaupunkeja ovat Thodupuzha, Kattappana ja Adimaly.\\nIdukkissa on suuri vuonna 1969 valmistunut pato, joka on rakennettu yhteistyössä Kanadan hallituksen kanssa. Pato tuottaa noin 60 prosenttia osavaltion sähköstä. Luonnoltaan Idukki on vuoristoinen: Anai Mudin 2 659 metriin nouseva vuorenhuippu on Intian korkein vuori Himalajan eteläpuolella. Piirikunnassa on 14 yli 2 000 metrin korkuista vuorta. Suuri osa Idukkista on metsien peittämää, ja siellä asuu useita harvinaisia eläinlajeja, kuten aasiannorsuja ja tiikereitä. Piirikunnan tärkeimmät maataloustuotteet ovat kardemumma, pippuri, kumi ja tee."},{"page_url":"https://en.wikipedia.org/wiki/Cirsium_occidentale","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Asteraceae_cirsium_occidentale_California_Thistle.jpg","page_title":"Cirsium occidentale","context_page_description":"Cirsium occidentale, with the common name cobweb thistle or cobwebby thistle, is a North American species of thistle in the sunflower family."},{"page_url":"https://cs.wikipedia.org/wiki/Johana_III._Burgundsk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Jeanne_de_France.jpg","page_title":"Johana III. Burgundská","context_page_description":"Johana Burgundská byla burgundská vévodkyně a hraběnka z Artois z dynastie Kapetovců."},{"page_url":"https://cs.wikipedia.org/wiki/Z%C3%A1kolany_(n%C3%A1dra%C5%BE%C3%AD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Zakolany_railway_station_CZ_002.jpg","page_title":"Zákolany (nádraží)","context_page_description":"Zákolany je železniční zastávka ve východní části obce Zákolany v okrese Kladno ve Středočeském kraji ležící v těsné blízkosti Zákolanského potoka. Leží na neelektrizované trati 093, nedaleko stanice dráhu mimoúrovňově překonává trať 121, na které se nachází železniční zastávka Zákolany zastávka."},{"page_url":"https://fr.wikipedia.org/wiki/Soci%C3%A9t%C3%A9_Copernic_des_naturalistes_polonais","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Cz%C5%82onkowie_Polskiego_Towarzystwa_Przyrodnik%C3%B3w_im._Kopernika.jpg","page_title":"Société Copernic des naturalistes polonais","context_page_description":"La Société Copernic des naturalistes polonais, la plus ancienne association de naturalistes polonais, est fondée à Lviv le 17 janvier 1875."},{"page_url":"https://fr.wikipedia.org/wiki/Villa_des_Brillants","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Mus%C3%A9e_Rodin_de_Meudon_01.jpg","page_title":"Villa des Brillants","context_page_description":"La villa des Brillants est l'un des deux sites du musée Rodin. La villa est située à Meudon dans le département des Hauts-de-Seine en France.\\nSi le site de l’hôtel Biron met en exergue le génie et la puissance de l’œuvre de l’artiste, la visite du site du musée Rodin de Meudon offre un regard beaucoup plus personnel sur le personnage d’Auguste Rodin, dont la tombe est située sur le site. Il s’agit tout d’abord de la demeure habitée par Rodin et sa compagne, Rose Beuret, à partir de 1893, avec ses meubles et les photographies de ses occupants. On pénètre ainsi dans la vie quotidienne de l’artiste."},{"page_url":"https://en.wikipedia.org/wiki/Round_Oak_Steelworks","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/William_Humble_Eric_Ward%2C_3rd_Earl_of_Dudley_%281894-1969%29.jpg","page_title":"Round Oak Steelworks","context_page_description":"The Round Oak Steelworks was an important steel production plant in Brierley Hill, West Midlands, England. It was founded in 1857 by Lord Ward, who later became, in 1860, The 1st Earl of Dudley, as an outlet for pig iron made in the nearby blast furnaces. During the Industrial Revolution, the majority of iron-making in the world was carried out within 32 kilometres of Round Oak. For the first decades of operation, the works produced wrought iron. However in the 1890s, steelmaking was introduced. At its peak, thousands of people were employed at the works. The steelworks was the first in the United Kingdom to be converted to natural gas, which was supplied from the North Sea. The works were nationalized in 1951, privatized in 1953 and nationalized again in 1967 although the private firm Tube Investments continued to part manage the operations at the site. The steelworks closed in December 1982."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Shelby_County,_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Gaston_Park_Memphis_TN_007.jpg","page_title":"National Register of Historic Places listings in Shelby County, Tennessee","context_page_description":"This is a list of the National Register of Historic Places listings in Shelby County, Tennessee.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Shelby County, Tennessee, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 196 properties and districts listed on the National Register in the county, including 4 National Historic Landmarks. There are 18 properties that have been removed from the register.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E8%A1%9B%C2%B7%E5%A5%A7%E4%BC%8A%E7%BE%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/David_Oyelowo_Golden_Globes.jpg","page_title":"大衛·奧伊羅","context_page_description":"大卫·奥耶特昆伯·欧洛沃是一位英国男演员、监制、导演与编剧。代表作品为2014年电影《塞尔玛游行》，为其获得多项最佳男主角提名。"},{"page_url":"https://en.wikipedia.org/wiki/Oregon%27s_1st_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Binger_Hermann_from_OHQ.png","page_title":"Oregon's 1st congressional district","context_page_description":"Oregon's 1st congressional district is a congressional district located in the U.S state of Oregon. The district stretches from Portland's western suburbs and exurbs, to parts of the Oregon coast. The district includes the principal cities of Beaverton, Hillsboro, and Tigard, all located in the Portland metropolitan area. Geographically, the district is located in the northwest corner of Oregon. It includes Clatsop, Columbia, Washington, and Yamhill counties, and a portion of southwest Multnomah County in Portland.\\nThe district has been represented by Democrat Suzanne Bonamici since 2012. Bonamici won a special election to replace David Wu, who resigned in the wake of accusations of sexual misconduct."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%AF%D8%A7%D8%B1%D9%86%D8%AF%DA%AF%D8%A7%D9%86_%D8%B9%D9%86%D9%88%D8%A7%D9%86_%D9%87%D9%86%D8%B1%D9%85%D9%86%D8%AF_%D8%AE%D9%84%D9%82_%D8%AC%D9%85%D9%87%D9%88%D8%B1%DB%8C_%D8%A2%D8%B0%D8%B1%D8%A8%D8%A7%DB%8C%D8%AC%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%E2%80%9CXalq_artisti%E2%80%9D_f%C9%99xri_ad%C4%B1n%C4%B1n_d%C3%B6%C5%9F_ni%C5%9Fan%C4%B1.jpg","page_title":"فهرست دارندگان عنوان هنرمند خلق جمهوری آذربایجان","context_page_description":"فهرست دارندگان عنوان هنرمند خلق جمهوری آذربایجان در زیر آمده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Acanthemblemaria_rivasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Acanthemblemaria_rivasi.jpg","page_title":"Acanthemblemaria rivasi","context_page_description":"The spotjaw blenny is a species of chaenopsid blenny found in coral reefs off Colombia and Costa Rica, in the western Atlantic Ocean. he specific name is an eponym but the individual it honours has not been identified, but it is possibly Luis R. Rivas of the University of Miami who is known to have lent specimens to Stephens."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Ma%C3%B1ihuales","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Cuenca-del-rio-aysen.jpg","page_title":"Río Mañihuales","context_page_description":"El río Mañihuales es un curso natural de agua que fluye en la Región de Aysén con dirección general sur y al confluir con el río Simpson da vida al río Aysén."},{"page_url":"https://es.wikipedia.org/wiki/Productividad_agr%C3%ADcola","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Sunset_at_Grain_Elevator_012_Cropped_more.jpg","page_title":"Productividad agrícola","context_page_description":"La productividad agrícola se mide como el cociente entre la producción y los factores productivos. Esta tiene que ver con la eficacia y la eficiencia con que se usan los recursos y se expresa como un por ciento de la producción entre los factores. Calcular la producción agrícola de forma precisa es complicado ya que aunque los productos se midan por su peso fácilmente, suelen tener densidades muy diversas. Por ese motivo la producción suele medirse por el valor de mercado del producto final, lo que excluye el valor de los productos intermedios, como por ejemplo el grano empleado en alimentar las reses en la industria de productos cárnicos; en contabilidad nacional o contabilidad sectorial suele denominarse valor añadido.\\nEl valor del producto final puede ser comparado con el valor de cada factor utilizado en su producción lo que nos daría una medida de la productividad de cada factor. La productividad agrícola puede también ser medida por la eficiencia general con la que los factores productivos son utilizados conjuntamente, suele decirse entonces que medios la productividad total de los factores."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B1%D0%B7%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%86%D0%B5%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/ScientificConference.JPG","page_title":"Кобзарский цех","context_page_description":"Кобзарский цех — цеховое объединение традиционных украинских эпических певцов. Во времена Магдебургского права цеховые объединения ремесленников были неотъемлемой частью городского быта и существовали в большинстве городов Украины. Среди них — кобзарские, лирницкие и «музыкийские» цехи, объединявшие также лютнистов, торбанистов, исполнителей на цитре и многих других старинных инструментах. Кобзарство было всегда почетной нишей для талантливого человека, для которого обычный труд был невозможен. Поэтому кобзарские цехи, вследствие социального характера, в отличие от многих других стран, сохранились до начала XX в. и позволили современным исследователям заглянуть в быт средневековой Европы."},{"page_url":"https://it.wikipedia.org/wiki/Nativi_americani","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Waa-kaun-see-kaa.jpg","page_title":"Nativi americani","context_page_description":"Con l'espressione nativi americani si intende indicare le popolazioni che abitavano il continente americano prima della colonizzazione europea e i loro odierni discendenti.\\nL'etnonimo indiani d'America era utilizzato per indicare i nativi americani ma non è univoco ed è stato spesso oggetto di discussione. Nei paesi ispanofoni dell'America Latina si usa prevalentemente il termine indios, mentre negli Stati Uniti d'America si usa l'espressione indiani d'America, benché ormai non sia più considerata un'espressione politicamente corretta.\\nL'uso del termine indiano si deve a Cristoforo Colombo che, in cerca di una rotta che consentisse di raggiungere l'Asia attraversando l'oceano Atlantico, credette di aver raggiunto le Indie Orientali, ignaro invece di aver toccato le coste di un continente allora sconosciuto agli Europei; gli Spagnoli battezzarono quindi il nuovo mondo \\"Indie occidentali\\", e solo successivamente America, in onore di Amerigo Vespucci.\\nSecondo l'ipotesi scientifica più accreditata, 13.000 anni fa l'uomo sarebbe migrato dall'Asia verso l'America attraverso la Beringia, una lingua di terra che all'epoca univa i due continenti."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B6%E0%A7%87%E0%A6%B0%E0%A6%AA%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Sherpa.jpg","page_title":"শেরপা","context_page_description":"শেরপা উচ্চ হিমালয়ে, বিশেষত নেপালের শোলোখুম্বু জেলাতে, বসবাসকারী এক উপজাতি সম্প্রদায় বিশেষ।"},{"page_url":"https://de.wikipedia.org/wiki/Fa%C3%9Fmannsreuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Naturhof_Fa%C3%9Fmannsreuth_2016_xy10.jpg","page_title":"Faßmannsreuth","context_page_description":"Faßmannsreuth ist ein Ortsteil der Stadt Rehau im Landkreis Hof und liegt etwa sieben Kilometer östlich des Hauptortes."},{"page_url":"https://ceb.wikipedia.org/wiki/Colagne","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Colagne.JPG","page_title":"Colagne","context_page_description":"Suba ang Colagne sa Pransiya. Nahimutang ni sa amihanan-sidlakang bahin sa nasod, 500 km sa habagatan sa Paris ang ulohan sa nasod. Ang Colagne mao ang bahin sa tubig-saluran sa Garonne."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%BE%BE%E5%B0%94%E7%93%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Map_commune_FR_insee_code_45123.png","page_title":"达尔瓦","context_page_description":"達爾瓦是法國盧瓦雷省的一個市鎮，位於該省中部偏西南，屬於奧爾良區。該市鎮總面積8.58平方公里，2009年時的人口為1862人。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D1%81%D0%BE%D0%B4%D1%83%D0%B1_(%D0%BF%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BA%D0%B0_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Kivertsi_Volynska-Lisodub_nature_monument-information_board.jpg","page_title":"Лісодуб (пам'ятка природи)","context_page_description":"Лісоду́б — ботанічна пам'ятка природи місцевого значення в Україні. Розташована в межах Ківерцівського району Волинської області, неподалік від міста Ківерці.\\nПлоща 8,3 га. Статус надано згідно з рішенням облвиконкому № 226 від 31 жовтня 1991 року. Перебуває у віданні ДП «Ківерцівське ЛГ».\\nСтатус надано для збереження цінної ділянки лісу з високобонітетними насадженнями дуба черещатого віком 70 років, які належать до лісового генофонду області."},{"page_url":"https://sh.wikipedia.org/wiki/Voltmetar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Voltmeter.jpg","page_title":"Voltmetar","context_page_description":"Voltmetar je mjerni instrument kojim se mjeri električni napon.\\nVećina voltmetara u stvari mjeri električnu struju koja ovisi o mjerenom naponu i unutarnjem otporu instrumenta. Kako bi se smanjio utjecaj na mjereni krug nastoji se da taj otpor bude što veći i navodi se bilo kao stalna vrijednost, npr 1 MΩ, bilo kao vrijednost koja ovisi o mjernom području, npr. 20 kΩ/V.\\nUobičajeni se tip voltmetra sastoji od osjetljivog galvanometra s pomičnim svitkom i serijski spojenog otpornika kojim se određuje mjerno područje, tj. napon koji je potreban za puni otklon kazaljke instrumenta. Zakretni se svitak galvanometra nalazi u magnetskom polju, pa je moment sile razmjeran jakosti struje koja protječe svitkom. Kako se svitak oslanja na spiralnu oprugu koja stvara suprotni moment razmjeran kutu zakretanja svitka, kut u kojem se uspostavi ravnoteža razmjeran je jakosti struje, a time i mjerenom naponu.\\nModerni digitalni voltmetri koriste analogno-digitalnu pretvorbu kako bi napon pretvorili u broj prikazan na instrumentu. Voltmetar se pri mjerenjima spaja paralelno na izvor, odn. na otpornik."},{"page_url":"https://sv.wikipedia.org/wiki/Moluckstare","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Aplonis_mysolensis_sulaensis_1898.jpg","page_title":"Moluckstare","context_page_description":"Moluckstare är en fågel i familjen starar inom ordningen tättingar. IUCN kategoriserar arten som livskraftig.\\nMoluckstare delas in i två underarter:\\nA. m. mysolensis – förekommer i Moluckerna och de västra papuanska öarna\\nA. m. sulaensis – förekommer på östra Sulawesi, Banggaiöarna och Sulaöarna"},{"page_url":"https://es.wikipedia.org/wiki/Cesana_Torinese","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Cesana_Torinese-Stemma.svg","page_title":"Cesana Torinese","context_page_description":"Cesana Torinese es una localidad italiana de 955 habitantes de la provincia de Turín."},{"page_url":"https://en.wikipedia.org/wiki/Amanoiwato_Shrine","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Amanoiwato-east-shurine.jpg","page_title":"Amanoiwato Shrine","context_page_description":"Amanoiwato-jinja is a Shinto shrine located in Takachiho, Miyazaki Prefecture, Japan. It is dedicated to the sun goddess Amaterasu and sits above the gorge containing Ama-no-Iwato, the cave where, according to Japanese legend, the goddess hid after battle with her brother, plunging the world into darkness until lured out by the spirit of merriment Ame-no-Uzume.\\nThe Amano-Iwato cave is an object of worship in festivals and is a rock cave on the other side of the Iwato River from nishihongū. You can see the cave from nishihongū after participating in a Shinto ritual for purification."},{"page_url":"https://ro.wikipedia.org/wiki/Bud%C3%AE%C8%99ce,_Kul%C3%AEkivka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%D0%91%D1%83%D0%B4%D0%B8%D1%89%D0%B5%2C_%D0%BF%D0%BE%D1%87%D0%B0%D1%82%D0%BE%D0%BA_%D1%81%D0%B5%D0%BB%D0%B0_IMG_0210_04.JPG","page_title":"Budîșce, Kulîkivka","context_page_description":"Budîșce este un sat în comuna Drimailivka din raionul Kulîkivka, regiunea Cernihiv, Ucraina."},{"page_url":"https://nl.wikipedia.org/wiki/Hertsberge","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Hertsberge_-_Sint-Joanneskerk_1.jpg","page_title":"Hertsberge","context_page_description":"Hertsberge is een dorp in de Belgische provincie West-Vlaanderen en een deelgemeente van Oostkamp. In Hertsberge is het vroegere dorpsbeeld bewaard gebleven. Men vindt er nog steeds de kapel, het klooster, de katholieke school en de kerk naast elkaar. De gemeenteschool ligt iets afgelegener. Het ooit bosrijke gebied heeft in de loop der jaren plaats gemaakt voor een woonpark met luxueuze woningen."},{"page_url":"https://da.wikipedia.org/wiki/%C5%81%C3%B3d%C5%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/5_Lodz_041.jpg","page_title":"Łódź","context_page_description":"Łódź er med 690.422 indbyggere befolkningsmæssigt Polens tredjestørste by og hovedstaden i Województwo łódzkie midt i landet. Byen er hovedcenteret for tekstil- og filmindustrien samt elektronik- og underholdningsbranchen i Polen. Med sine universiteter, teatre, museer og den verdensberømte filmhøjskole er Łódź også et vigtigt akademisk og kulturelt center.\\nByen præges af en stor udviklingsdynamik og er for tiden inde i en stærk investeringsbølge. Den har status som powiat og udgør sammen med omkringliggende områder Storbyområdet Łódź med omkring 1.050.000 indbyggere.\\nŁódź fik byrettigheder af kong Vladislav II Jagello i 1423. Storhedstiden kom imidlertid først i begyndelsen af 1800-tallet. Den lille landbrugsby, som i 1820 talte knapt tusind indbyggere, blev da omdannet til et af Europas største centre for tekstilindustri med over en halv million indbyggere lige før udbruddet af 1. verdenskrig. De to verdenskrige standsede den eventyrlige udvikling. Efter anden verdenskrig blev Łódź Polens uformelle hovedstad til genopbyggelsen af Warszawa."},{"page_url":"https://de.wikipedia.org/wiki/Geschwindigkeits%C3%BCberwachung","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/InnsbruckerPl_B-Schoeneberg_12-2017_img1.jpg","page_title":"Geschwindigkeitsüberwachung","context_page_description":"Geschwindigkeitsüberwachung ist im öffentlichen Straßenverkehr eine Kontrollmaßnahme von Polizei oder anderen Behörden zur Überwachung der Einhaltung der zulässigen Höchstgeschwindigkeit."},{"page_url":"https://fi.wikipedia.org/wiki/Valentin_Ha%C3%BCy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Brothers_of_Ha%C3%BCy_by_J._Boilly.jpg","page_title":"Valentin Haüy","context_page_description":"Valentin Haüy oli ranskalainen kaunokirjallisuuden professori ja ensimmäisen sokeille tarkoitetun koulun perustaja. Haüy kehitti myös kohokirjoitusjärjestelmän, joka levisi käyttöön melko laajalti; nykyään käytössä on Louis Braillen myöhemmin kehittämä pistekirjoitusjärjestelmä. Haüya kuvataan usein ”sokeiden apostoliksi”. Hänen veljensä oli kuuluisa mineralogisti René-Just Haüy."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A8ge_des_Trente-Trois","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Coll%C3%A8ge_des_33_b%C3%A2timent_des_%C3%A9l%C3%A8ves_sur_cour.jpg","page_title":"Collège des Trente-Trois","context_page_description":"L’ancien collège des Trente-Trois ou « séminaire des Trente-Trois » est un bâtiment situé au 37, rue des Carmes et au 11, impasse des Bœufs dans le 5ᵉ arrondissement de Paris."},{"page_url":"https://de.wikipedia.org/wiki/Elektroschwache_Wechselwirkung","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/BetaDecay.svg","page_title":"Elektroschwache Wechselwirkung","context_page_description":"Die elektroschwache Wechselwirkung bildet die Grundlage einer vereinheitlichten Theorie aus Quantenelektrodynamik und schwacher Wechselwirkung im Rahmen des Standardmodells. Sie wurde in den 1960er Jahren von den Physikern Sheldon Glashow, Steven Weinberg und Abdus Salam eingeführt, um die elektromagnetische und schwache Wechselwirkung in einer Theorie zusammenzufassen. Sie erhielten dafür 1979 den Nobelpreis für Physik, nachdem die Theorie in den 1970er Jahren experimentell bestätigt worden war.\\nWährend in der Quantenelektrodynamik die Wechselwirkung durch Austausch eines masselosen Photons beschrieben wird und die quantenfeldtheoretische Version der klassischen Elektrodynamik ist, erklärt die vereinheitlichte Theorie die geringe Reichweite der schwachen Wechselwirkung, die zum Beispiel in der Neutrino-Physik und beim Betazerfall wirkt, damit, dass hier sehr viel schwerere Teilchen ausgetauscht werden: Das geladene W-Boson und das neutrale Z-Boson mit Massen in der Größenordnung von Giga-Elektronenvolt."},{"page_url":"https://eu.wikipedia.org/wiki/Rudolph_Marcus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Prof._Dr._Rudolph_A._Marcus.jpg","page_title":"Rudolph Marcus","context_page_description":"Rudolph Arthur Marcus Estatu Batuetako kimikaria da, jatorriz kanadarra. McGill Unibertsitatean egin zituen ikasketak. 1949an, Estatu Batuetara aldatu zen, eta hango hiritartasuna eskuratu zuen 1958an. Hainbat unibertsitateko irakasle izan da, besteak beste, Brooklyngo Institutu Politeknikokoa eta Illinoisko Unibertsitatekoa. 1978an, Kaliforniako Teknologia Institutuan hasi zen lanean katedradun gisa. Sistema kimikoetako elektroien transferentziazko erreakzioen teoriaren inguruan egindako ekarpenengatik da, batez ere, ezaguna. Prozesu kimiko oinarrizko horretarako ezarri zuen ereduaren arabera, molekulen egituran gertatzen dira bi molekulen artean elektroi baten transferentzia gerta dadin behar diren aldaketak, eta aldaketa horiei esker jauzi egiten du elektroiak molekula batetik bestera. Bestalde, aldaketa horiek sistema molekularraren energian duten eragina ikertu zuen adierazpen matematiko sinpleak erabiliz, eta horrela kalkulatu eta azaldu zituen elektroi-transferentzietan gertatzen diren abiadura desberdinak. 1992an, Kimikako Nobel Saria eskuratu zuen, erreakzio kimikoen elektroi-transferentziari eta erreakzio kimikoen abiadura-desberdintasunari buruz egindako lanengatik."},{"page_url":"https://pl.wikipedia.org/wiki/Rolls-Royce_Silver_Wraith","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Rollsroyce_pr_br.jpg","page_title":"Rolls-Royce Silver Wraith","context_page_description":"Rolls-Royce Silver Wraith – luksusowy samochód osobowy produkowany przez brytyjską firmę Rolls-Royce w latach 1946–1959. Dostępny jako 4-drzwiowy sedan. Następca modeli Wraith oraz Phantom III. Do napędu używano trzech silników R6: 4,3 l, 4,6 l oraz 4,9 l. Moc przenoszona była na oś tylną poprzez 4-biegową manualną skrzynię biegów."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B0%D8%A8%D8%AD%D8%A9_%D8%A7%D9%84%D8%B7%D9%86%D8%B7%D9%88%D8%B1%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Al_Tantura.jpg","page_title":"مذبحة الطنطورة","context_page_description":"مذبحة الطنطورة و مجزرة الطنطورة بعد شهر تقريبا من مذبحة دير ياسين، واستكمالًا للهدف الصهيوني الرئيسي المتمثّل بعملية التطهير العرقي للبلاد، بقوة السلاح والترهيب للسكان تمهيدًا لتهجير أكبر عدد من المواطنين الفلسطنيين، جاءت مذبحة الطنطورة. وقد تركت أثرًا بالغًا على الفلسطينيين في القرى المجاورة ومهّدت لتهجيرهم بالفعل.\\nتختلف مذبحة الطنطورة عن سائر المذابح السابقة في فلسطين، ليس لحجم الضحايا فقط ولكن كونها جريمة ارتُكبت على يد جيش إسرائيل، بعد أسبوع واحد من إعلان قيام الدولة الإسرائيلية. وقد اختار جيش الاحتلال هذه القرية بالذات بسبب موقعها على ساحل البحر المتوسط، وسهولة مهاجمتها ومتذرعين أن القرية تمثل تهديدًا لهم، واتّهموا أهلها بتحويلها لمرفأ يصل منه السلاح للفلسطينيين."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%8F%E5%B7%9D%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Ogawamachi_Station_20121102.JPG","page_title":"小川町","context_page_description":"小川町是日本埼玉县中部、比企郡的一町，有“武藏小京都”的别称。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%81%D8%A7%D8%B1%D8%A9_%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A%D8%A9_%D9%81%D9%8A_%D9%88%D8%A7%D8%B4%D9%86%D8%B7%D9%86_%D8%A7%D9%84%D8%B9%D8%A7%D8%B5%D9%85%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Embassy_of_Saudi_Arabia%2C_Washington%2C_D.C..jpg","page_title":"سفارة السعودية في واشنطن العاصمة","context_page_description":"سفارة المملكة العربية السعودية في واشنطن ‏. هي البعثة الدبلوماسية السعودية في الولايات المتحدة الأمريكية في العاصمة واشنطن، تقع السفارة في مدينة نورث ويست، بحي السفارات. ريما بنت بندر بن سلطان آل سعود هي سفيرة خادم الحرمين الشريفين في الولايات المتحدة منذ 23 فبراير 2019."},{"page_url":"https://it.wikipedia.org/wiki/Long_Beach_(New_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Map_of_New_York_highlighting_Nassau_County.png","page_title":"Long Beach (New York)","context_page_description":"Long Beach è un comune degli Stati Uniti d'America, situata nella Contea di Nassau, nello Stato di New York. La cittadina è posta su un'isola compresa tra l'Oceano Atlantico e la parte sud-orientale dell'isola di Long Island in corrispondenza della città di Hempstead.\\nL'isola fu creata depositando sabbia al largo delle coste meridionali della contea. Per tale lavoro furono impiegati degli elefanti.\\nNel luglio 2006 la città ha compiuto 100 anni. Merita di essere visitato il suo boardwalk interamente in legno, le spiagge bianche dove ogni estate si recano molti surfisti provenienti da New York o coloro che vogliono rilassarsi e allontanarsi dalla stressante vita della \\"Grande Mela\\". Sull'isola di Long Beach, oltre all'omonima città, sorge anche Point Lookout all'estremità orientale. Le case dell'isola sono molto originali e i giardini ben curati, così come i viali. A Long Beach si trovano anche una sinagoga e la chiesa di Saint Mary, frequentata anche dalla minoranza ispanica. Le attività principali sono da collegarsi al turismo."},{"page_url":"https://hu.wikipedia.org/wiki/Hej%C5%91csaba","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/ElsoVilaghaborusEmlekmu_02.jpg","page_title":"Hejőcsaba","context_page_description":"Hejőcsaba Miskolc egyik városrésze, egykor önálló község, amelyet 1945-ben csatoltak Miskolchoz. Az egykori önálló települést legelőször 1067-ben említik Soba névalakban, a mai Martinkertváros területe 1935-ig Hejőcsabához tartozott, ekkor vásárolta meg Miskolc városa. Nevét a területén keresztülfolyó meleg vizű patakról kapta."},{"page_url":"https://eu.wikipedia.org/wiki/Anolis_bartschi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Anolis_bartschi.jpg","page_title":"Anolis bartschi","context_page_description":"Anolis bartschi Anolis generoko animalia da. Narrastien barruko Dactyloidae familian sailkatuta dago."},{"page_url":"https://war.wikipedia.org/wiki/Ranunculus_lyallii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/MtCookLily.jpg","page_title":"Ranunculus lyallii","context_page_description":"An Ranunculus lyallii in uska species han Magnoliopsida nga ginhulagway ni Joseph Dalton Hooker. An Ranunculus lyallii in nahilalakip ha genus nga Ranunculus, ngan familia nga Ranunculaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://nl.wikipedia.org/wiki/Bomaanslag_op_McGurk%27s_Bar_op_4_december_1971","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/McGurk%27s_cross.png","page_title":"Bomaanslag op McGurk's Bar op 4 december 1971","context_page_description":"De bomaanslag op McGurk's Bar in Belfast vond plaats op 4 december 1971 en werd gepleegd door de Ulster Volunteer Force.\\nDe pub werd veel bezocht door Ierse katholieken en nationalisten. De explosie deed het gebouw instorten en had vijftien doden - onder wie twee kinderen - en zeventien gewonden tot gevolg. Het was de dodelijkste aanslag in Belfast gedurende de periode van The Troubles.\\nOndanks aanwijzingen voor het tegendeel gingen de Britse veiligheidsdiensten ervan uit dat het hier ging om een bom in handen van IRA-leden die voortijdig was ontploft, waarmee impliciet de slachtoffers gedeeltelijk de schuld kregen. Nadien concludeerde een rapport dat de politie ook van dit bevooroordeelde standpunt uitging, wat het onderzoek had bemoeilijkt. Nabestaanden beweerden dat de politie en veiligheidsdiensten met opzet desinformatie hadden verspreid, met als doel de IRA in een kwaad daglicht te stellen. In 1977 werd UVF-lid Robert Campbell tot levenslang veroordeeld voor zijn aandeel in de bomaanslag, waarvan hij vijftien jaar zou uitzitten.\\nDe bomaanslag leidde tot vergeldingsacties van zowel republikeinen als loyalisten, waaronder bomaanslagen en schietpartijen."},{"page_url":"https://pt.wikipedia.org/wiki/Richard_Rappaport","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/JACK_%26_RICHARD_1972_Detail.jpg","page_title":"Richard Rappaport","context_page_description":"Richard Rappaport que nasceu em 1944 em Pittsburgh é um pintor norteamericano de retratos e obras figurativas de grandes dimensões, de formação clássica e cuja evolução pictórica há cerca de meio século tem sido uma espiral de aproximação e afastamento do ideal renascentista.\\nNa sua obra, mesmo quando aplica a abstração, Rappaport mantém a figura icónica como fonte primacial. Além de retratos de profundidade psicológica, Rappaport, na tradição da pintura como memorial, usa a iconografia cristã para representar o Holocausto, a Guerra do Biafra e a Guerra do Vietname.\\nAntigo aluno e amigo de Robert L. Lepper na Universidade Carnegie Mellon em Pittsburgh, Rappaport é um dos artistas influenciados pelo curso de Lepper intitulado Individual and Social Analysis.\\nO seu texto de 1989, Robert Lepper, Carnegie Tech, and the Oakland Project, é a principal fonte sobre a influência de Lepper sobre Andy Warhol, Philip Pearlstein, Mel Bochner, e Jonathan Borofsky quando estes foram seus alunos.\\nDesde 1981 Rappaport tem usado as páginas de anúncios de revistas de arte internacionais como lugar de exposição e a principal forma de presença pública."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%AF%D5%B8%D5%B6%D5%B8%D5%B4%D5%AB%D5%B5%D5%A1%D5%AF%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Modern-yaki_%E3%83%A2%E3%83%80%E3%83%B3%E7%84%BC%E3%81%8D_DSCF3092.jpg","page_title":"Օկոնոմիյակի","context_page_description":"Օկոնոմիյակի, հայտնի ճապոնական ուտեստ, «արագ սննդի» շարքին է դասվում, տապակած բլիթի վրա կան տարբեր բաղադրիչներ և քսված է հատուկ սոուս, վրան շաղ տված կտրատած չոր թյունոս։ Օկոնոմիյակին տապակում են տեպպանեի վրա՝ տաք մետաղե սալաքար։ Հաճախակի ճապոնական ռեստորաններում տաք սալոջախը տեղադրվում է այցելուի սեղանի վրա, որոնք էլ տապակում են պատրաստված բլիթները։"},{"page_url":"https://de.wikipedia.org/wiki/Becky_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Becky_G.jpg","page_title":"Becky G","context_page_description":"Becky G, eigentlich Rebbeca Marie Gómez ist eine US-amerikanische Sängerin, Tänzerin und Schauspielerin."},{"page_url":"https://sh.wikipedia.org/wiki/Breitenberg_(Holstein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Breitenberg_Wappen.png","page_title":"Breitenberg (Holstein)","context_page_description":"Brajtenberg je opština u njemačkoj saveznoj državi Šlezvig-Holštajn. Jedno je od 112 opštinskih središta okruga Štajnburg. Prema procjeni iz 2010. u opštini je živjelo 374 stanovnika. Posjeduje regionalnu šifru 1061016."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%A2%E6%B0%A7%E5%8C%96%E9%95%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Dysprosium%28III%29_hydroxide.jpg","page_title":"氢氧化镝","context_page_description":"氢氧化镝是一种无机化合物，化学式为Dy(OH)₃。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%B2%E6%AC%84%E5%BC%8F%E5%BB%BA%E7%AF%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Cempa_stilthouses.jpg","page_title":"干欄式建築","context_page_description":"干欄式建築，又稱干欄屋、高腳屋、吊腳樓、棚屋，是一種特色民居建築，其特點是「編竹苫茅為兩重，上以自處，下居雞豚，謂之麻欄」，盛行於東南亞、馬達加斯加、台灣、中國南部、海南等地區。其種類雖有高架式、高床式、樁上屋等類型，通常是木頭，竹子所構屋樑，並用茅草蓋頂遮蔽的住屋，也有柱樁頂端設軛木，較牢固的干欄式建築。其主要特色是將其樓板墊高，以樓梯上下住所。\\n日本的神社與穀倉是建在陸上的這類型建築物的著名例子，而香港大嶼山大澳的大澳棚屋是建在岸邊的這類型的建築物的著名例子。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%80%D0%B0%D0%BC%D0%B8%D0%B4%D0%B0_%D0%A1%D0%BE%D0%BB%D0%BD%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/15-07-13_Teotihuacan_la_Avenida_de_los_Muertos_y_la_Pir%C3%A1mide_del_Sol-RalfR-WMA_0251.jpg","page_title":"Пирамида Солнца","context_page_description":"Пирами́да Со́лнца — крупнейшая постройка города Теотиуакан и одна из самых крупных в Мезоамерике. Она располагается на Тропе Мёртвых между пирамидой Луны и Цитаделью в тени массивной горы Серро-Гордо и является частью большого храмового комплекса. Пирамида находится в 40 км от столицы Мексики — Мехико, в северо-восточном направлении. Высота пирамиды 64,01 метра."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B0%D1%82%D0%BA%D0%BE_%D0%97%D1%80%D0%BD%D1%87%D0%B8%D1%9B-%D0%94%D0%B8%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Natko_Zrncic-Dim_Spital_am_Semmering_2008.jpg","page_title":"Натко Зрнчић-Дим","context_page_description":"Натко Зрнчић-Дим је хрватски алпски скијаш. Члан је СК Медвешчак.\\nЈедан је од четворо хрватских скијаша који имају пласман међу прва три у Светском купу, то је остварио четири пута. Први пут је био на постољу у Вал д'Изеру, 3. фебруара 2008. када је био трећи у суперкомбинацији. У Кицбилу 2009. године је опет био трећи у комбинацији.\\nСвоје прве бодове у Светском купу остварио је на истом скијалишту, такође у суперкомбинацији, 11. децембра 2005. када је био 24. Први пласман у првих 10 забележио је у Венгену 11. јануара 2008. Осим у суперкомбинацији и комбинацији, Натко има бодове и у слалому.\\nДана 9. фебруара 2009, на Светском првенству у Вал д'Изеру, освојио је бронзану медаљу у комбинацији, иза Норвежанина Аксела Лунда Свиндала и Француза Жилијена Лизеруа, па је тиме постао други хрватски скијаш, уз Ивицу Костелића, који је освојио медаљу на Светском првенству."},{"page_url":"https://fr.wikipedia.org/wiki/Figure_de_la_Terre","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Geoid_undulation_10k_scale.jpg","page_title":"Figure de la Terre","context_page_description":"La détermination de la figure de la Terre, autrement dit l'étude de la forme de la surface externe du globe terrestre et de ses dimensions, constitue l'une des tâches classiques de la géodésie. Elle fournit des informations essentielles pour la géophysique et la géodynamique théorique.\\nIl convient de remarquer, cependant, qu'une surface générale est le plus souvent un objet géométrique auquel on n'associe pas de propriétés physiques particulières. Tel n'est pas le cas de la figure de la Terre, que l'on doit déterminer en faisant intervenir, d'une manière ou d'une autre, le champ de pesanteur terrestre. De ce fait, on doit associer à la forme géométrique des propriétés physiques : la plupart des surfaces qu'on définira pour représenter la figure de la Terre sont des surfaces de niveau, ou surfaces équipotentielles, autrement dit, des surfaces sur lesquelles le potentiel de pesanteur est constant.\\nIl n'existe pas une seule définition de la figure de la Terre, mais plusieurs qui ont chacune leur utilité et leur raison d'être."},{"page_url":"https://en.wikipedia.org/wiki/Fort_Lowell_(Tucson,_Arizona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Tucson-Fort_Lowell_Park_Museum.JPG","page_title":"Fort Lowell (Tucson, Arizona)","context_page_description":"Fort Lowell was a United States Army post active from 1873 to 1891 on the outskirts of Tucson, Arizona. Fort Lowell was the successor to Camp Lowell, an earlier Army installation. The Army chose a location just south of the confluence of the Tanque Verde and Pantano creeks, at the point where they form the Rillito River, due to the year-round supply of water during that period. The Hohokam natives had chosen the site centuries earlier, presumably for the same reason. To this day, shards of Hohokam pottery can still be found in the area. The Army claimed a military reservation that encompassed approximately eighty square miles and extended east toward the Rincon Mountains."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%B3%E5%B3%B6%E7%9C%8C%E9%81%93217%E5%8F%B7%E7%94%B0%E9%87%8E%E5%8B%A2%E5%90%88%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Tanotown_%E9%AB%98%E7%94%B0_Komatushimacity_Tokushimapref_Tokushimaprefectural_road_217_Tano_Seigoh_line.JPG","page_title":"徳島県道217号田野勢合線","context_page_description":"徳島県道217号田野勢合線は、徳島県小松島市田野町から小松島市赤石町に至る一般県道である。\\n全線で1.5車線程度の道幅である。小松島市田野町内を最初は南北に、その後東西方向に進む。終点近くに田野町勢合の集落があり、路線名のひとつとなっている。普通車であれば容易に離合できる道幅は全線に渡って確保されている。"},{"page_url":"https://en.wikipedia.org/wiki/Mi_Na_(athlete)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Mi_Na_Rio2016.jpg","page_title":"Mi Na (athlete)","context_page_description":"Mi Na is a Paralympic athlete from China. She competes in throwing events for F37 classification cerebral palsy athletes. From April 2014 until September 2016 she held the women's F37 World Record in the shot put. She holds the world record in the F37 discus throw.\\nMi began competing in para-athletics in 2005, and made her international debut in 2008. She competed at the 2008 Summer Paralympics in Beijing, China, where she won gold medals in the women's shot put F37/F38 and discus throw F37/F38 events, setting new F37 world records both events. At the 2012 Summer Paralympics in London, Mi repeated this double, winning the F37 shot put and F37 discus gold medals with world record throws. She placed 4th in the F37/F38 javelin event at the 2012 Paralympics. At the 2016 Rio Games she won the discus throw and placed second in the javelin and shot put."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_du_Soleil","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Aztec_Stone_of_the_Sun_%282088976462%29.jpg","page_title":"Pierre du Soleil","context_page_description":"La Pierre du Soleil, souvent appelée abusivement calendrier aztèque ou au contraire de manière plus exacte cuauhxicalli, est une des œuvres les plus célèbres et emblématiques de l'art aztèque.\\nDécouverte par hasard le 17 décembre 1790 à Mexico, lors du pavage de la grand place de la capitale de la Nouvelle-Espagne, elle est actuellement conservée au Musée national d'anthropologie de Mexico. Ce disque réalisé dans un bloc monolithique de lave basaltique d'olivine, d'un poids de 24 tonnes, de 3,6 m de diamètre et 1,22 m d'épaisseur, était probablement un cuauhxicalli ou un temalácatl. Il a été sculpté sous le règne d'Axayacatl pour commémorer la fête du feu nouveau de 1479."},{"page_url":"https://es.wikipedia.org/wiki/Extinciones_masivas_del_Ordov%C3%ADcico-Sil%C3%BArico","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Orthoceras_BW.jpg","page_title":"Extinciones masivas del Ordovícico-Silúrico","context_page_description":"Si se cuentan juntas, las dos extinciones masivas del Ordovícico-Silúrico fueron la extinción masiva más grande que ha padecido la vida en la Tierra, solo superada por la del Pérmico y la única donde no se ha encontrado presencia llamativa de impactos extraterrestres ni vulcanismo.​\\nOcurrieron hace aproximadamente 440 y 450 millones de años, y marcaron la diferencia entre los períodos Ordovícico y Silúrico. En esa época, todos los organismos complejos vivían en el mar y cerca de 100 familias biológicas se extinguieron, lo cual representaba el 85% de las especies de fauna. Los braquiópodos y los briozoos fueron de los más afectados, junto con las familias de trilobitas, conodontos y graptolites.\\nExisten dos teorías para explicarla. La más antigua postula una glaciación en el planeta; la más reciente apunta a la explosión de una supernova que irradió la Tierra con efectos devastadores para todos los seres vivos."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AF%E0%A6%BE%E0%A6%A8%E0%A7%8D%E0%A6%A4%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%95_%E0%A6%B6%E0%A6%95%E0%A7%8D%E0%A6%A4%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/HoleForceLines.svg","page_title":"যান্ত্রিক শক্তি","context_page_description":"যান্ত্রিক শক্তি হলো সেই শক্তি, যা কোনো বস্তু তার স্থির অবস্থান বা গতিশীল অবস্থার জন্য লাভ করে​। কাজেই, যান্ত্রিক শক্তিকে দুইভাগে প্রধানত বিভক্ত করা যায়। যথা- বিভব শক্তি ও গতি শক্তি।"},{"page_url":"https://pt.wikipedia.org/wiki/Adalbert_Krueger","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Adalbert_Krueger.jpg","page_title":"Adalbert Krueger","context_page_description":"Karl Nikolaus Adalbert Krueger foi um astrónomo alemão que foi editor da revista Astronomische Nachrichten."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D0%BE%D0%B7%D0%B0%D0%B2%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Allosaurus-crane.jpg","page_title":"Алозавр","context_page_description":"Алозавр — рід двоногих хижих динозаврів, що належав до підряду теропод ряду ящеротазових."},{"page_url":"https://id.wikipedia.org/wiki/Selat_Barat,_Selat,_Kapuas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Kantor_Kelurahan_Selat_Barat%2C_Kapuas.JPG","page_title":"Selat Barat, Selat, Kapuas","context_page_description":"Selat Barat adalah salah satu kelurahan yang berada di wilayah kecamatan Selat, Kabupaten Kapuas, Provinsi Kalimantan Tengah, Indonesia. Selat Barat merupakan hasil pemekaran dari kelurahan Selat Hilir dan Selat Tengah berdasarkan Peraturan Daerah Kabupaten Kapuas Nomor 7 Tahun 2012."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%B0%E0%A8%BE%E0%A8%B8%E0%A8%BC%E0%A8%9F%E0%A8%B0%E0%A9%80_%E0%A8%AE%E0%A9%82%E0%A8%B0%E0%A8%A4%E0%A9%80_%E0%A8%85%E0%A8%9C%E0%A8%BE%E0%A8%87%E0%A8%AC-%E0%A8%98%E0%A8%B0_(%E0%A8%B5%E0%A8%BE%E0%A8%87%E0%A8%86%E0%A8%A6%E0%A9%8B%E0%A8%B2%E0%A9%80%E0%A8%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Diego_de_Siloe_%28Sagrada_Familia%29.jpg","page_title":"ਰਾਸ਼ਟਰੀ ਮੂਰਤੀ ਅਜਾਇਬ-ਘਰ (ਵਾਇਆਦੋਲੀਦ)","context_page_description":"ਰਾਸ਼ਟਰੀ ਮੂਰਤੀ ਅਜਾਇਬ-ਘਰ ਵਾਇਆਦੋਲੀਦ, ਸਪੇਨ ਵਿੱਚ ਸਥਿਤ ਇੱਕ ਅਜਾਇਬ-ਘਰ ਹੈ।\\n4 ਅਕਤੂਬਰ 1842 ਨੂੰ ਇਸ ਅਜਾਇਬ ਘਰ ਦੀ ਸੂਬੇ ਦੇ ਲਲਿਤ ਕਲਾਵਾਂ ਅਜਾਇਬ-ਘਰ ਵਜੋਂ ਸਥਾਪਨਾ ਕੀਤੀ ਗਈ। ਇਸ ਦਾ ਪਹਿਲਾ ਹੈੱਡਕੁਆਟਰ ਪਲਾਸੀਓ ਦੇ ਸਾਂਤਾ ਕਰੂਸ ਸੀ। 29 ਅਪਰੈਲ 1933 ਨੂੰ ਇਹਨੂੰ ਸਾਨ ਗ੍ਰੇਗੋਰਿਓ ਕਾਲਜ ਕਰ ਦਿੱਤਾ ਗਿਆ।\\nਇਸ ਅਜਾਇਬ-ਘਰ ਵਿੱਚ 13ਵੀਂ ਸਦੀ ਤੋਂ 19ਵੀਂ ਸਦੀ ਦੀਆਂ ਕਲਾਕ੍ਰਿਤੀਆਂ ਮੌਜੂਦ ਹਨ।"},{"page_url":"https://pl.wikipedia.org/wiki/Stare_Miasto_(Akka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Akko%2C_El_Shazliya_Mosque_014.JPG","page_title":"Stare Miasto (Akka)","context_page_description":"Stare Miasto Akka jest jednym ze starożytnych miast portowych, którego historia sięga epoki brązu. Ze względu na swoje strategiczne położenie umożliwiające szeroki dostęp do Palestyny, przez setki lat było ważnym portem. Miasto miało swoje okresy rozwoju i upadku, wielokrotnie zmieniając właścicieli. Swój szczyt rozwoju osiągnęło na przełomie XII i XIII wieku jako stolica Królestwa Jerozolimskiego. Od XIX wieku jego rola malała na korzyść sąsiedniego miasta portowego Hajfa. Stare Miasto wraz z portem morskim jest otoczone zabytkowym murem obronnym. Obecne miasto posiada cechy charakterystyczne osad z okresu osmańskiego z XVIII i XIX wieku, z takimi typowymi obiektami jak cytadela, pozostałości fosy, meczety, łaźnie i karawanseraj. Pozostałości miasta krzyżowców leżą prawie nienaruszone zarówno powyżej, jak i poniżej dzisiejszego poziomu ulic, zapewniając wyjątkowy średniowieczny układ ulic. Zespół zabytków Akki jest od 2001 roku umieszczony na liście światowego dziedzictwa UNESCO."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BF%D0%B8%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D1%88%D1%82%D0%B0%D1%82%D0%B0_%D0%A0%D0%BE%D0%B4-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Rhode_Island_state_house_2009a.JPG","page_title":"Капитолий штата Род-Айленд","context_page_description":"Капито́лий шта́та Род-А́йленд находится в городе Провиденс — столице штата Род-Айленд. В нём проводит свои заседания Генеральная Ассамблея Род-Айленда, состоящая из Палаты Представителей и Сената штата Род-Айленд. В нём также находятся офисы губернатора, лейтенант-губернатора, государственного секретаря и министра финансов штата Род-Айленд. Современное здание Капитолия было построено в 1895—1904 годах по проекту архитектурной фирмы «Макким, Мид энд Уайт»."},{"page_url":"https://et.wikipedia.org/wiki/Unterperfuss","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Unterperfuss.jpg","page_title":"Unterperfuss","context_page_description":"Unterperfuss on vald Austrias Tirooli liidumaal Innsbrucki ringkonnas. Vald asub 596 m kõrgusel merepinnast. Valla pindala on 2,28 km², 1. jaanuaril 2016 elas seal 226 inimest. Vald paikneb 15 km Innsbruckist läänes ja on üks väiksemaid külasid Tiroolis. Valda piiravad põhjas Inn ja idas Melach. Unterperfussis on palju ratsutamisrajatisi."},{"page_url":"https://da.wikipedia.org/wiki/Peugeot_Partner","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Peugeot_Partner_%281%29.jpg","page_title":"Peugeot Partner","context_page_description":"Peugeot Partner er en bilmodel fra den franske bilfabrikant Peugeot, som er blevet fremstillet i tre generationer siden 1996."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%91%D0%B8%D0%BA%D1%83_%D0%BA%D0%B0%D0%BD%D0%B4%D0%B7%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/%E6%96%B0-bw.png","page_title":"Кёику кандзи","context_page_description":"Кёику кандзи или гакусю кандзи — список из 1006 учебных кандзи. Список составляется Министерством образования Японии, его полное название — гакунэмбэцу кандзи хайтохё. Именно этот список определяет, какие кандзи будут изучать японские школьники на каждом году своего обучения в шести начальных классах."},{"page_url":"https://it.wikipedia.org/wiki/M%27bour","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Streetsmbour.jpg","page_title":"M'bour","context_page_description":"M'bour è una città del Senegal di 252 645 abitanti, situata nella Regione di Thiès e capoluogo del Dipartimento di M'bour. Si trova a 83 km a sud di Dakar e a 5 km dalla stazione balneare di Saly Portudal"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%AA%D9%8A%D9%81%D9%8A%D9%86_%D9%83%D9%8A%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Espana-escocia-sub19-67_%2833222751038%29_%28cropped%29.jpg","page_title":"ستيفين كيلى","context_page_description":"ستيفين كيلى لاعب كورة قدم من المملكه المتحده."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Indonesian_dishes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Nablus_souq_pita_118_-_Aug_2011.jpg","page_title":"List of Indonesian dishes","context_page_description":"This is a list of selected dishes found in Indonesian cuisine."},{"page_url":"https://pt.wikipedia.org/wiki/Belton_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/ClarendonHouseSKILLMAN%2C_W._after_SPILBURGH_J.jpg","page_title":"Belton House","context_page_description":"Belton House é um palácio rural da Inglaterra, localizado em Belton, uma aldeia do Lincolnshire próxima de Grantham. O palácio está rodeado por jardins formais e uma série de avenidas que conduzem a construções de jardim no interior do grande parque arborizado. Belton House tem sido descrito como uma compilação da mais refinada arquitectura do estilo Carolino, o único verdadeiro estilo vernáculo de arquitectura que a Inglaterra produziu desde a época dos Tudor. O palácio também tem sido descrito como o mais completo exemplo de um típico palácio rural inglês; também se tem afirmado que a fachada principal de Belton House serviu de inspiração para o moderno símbolo das estradas inglesas, o qual indica a direcção das residências majestosas. Apenas Brympton d'Evercy tem sido enaltecido de forma semelhante como perfeito palácio rural inglês.\\nDurante trezentos anos, Belton House foi a sede da família Brownlow and Cust, a qual começou a adquirir terras na zona no final do século XVI. Entre 1685 e 1688, o jovem Sir John Brownlow e a sua esposa mandaram construir o actual palácio."},{"page_url":"https://fr.wikipedia.org/wiki/Bozzio_Levin_Stevens","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Tony_Levin_%282941873440%29.jpg","page_title":"Bozzio Levin Stevens","context_page_description":"Bozzio Levin Stevens est un groupe de rock progressif américain. Il se composait de Terry Bozzio à la batterie, Tony Levin à la basse et au chapman stick et Steve Stevens à la guitare. Le groupe compte deux albums : Black Light Syndrome et Situation Dangerous. Black Light Syndrome est publié le 15 juillet 1997, et Situation Dangerous le 8 août 2000. Les albums atteignent l'Oricon."},{"page_url":"https://en.wikipedia.org/wiki/Sch%C3%B6nberg_am_Kamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/AUT_Sch%C3%B6nberg_am_Kamp_COA.png","page_title":"Schönberg am Kamp","context_page_description":"Schönberg am Kamp is a town in the district of Krems-Land in the Austrian state of Lower Austria."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_aan_de_Groenburgwal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Amsterdam_-_Groenburgwal_17.JPG","page_title":"Lijst van rijksmonumenten aan de Groenburgwal","context_page_description":"Een overzicht van de 30 rijksmonumenten aan de Groenburgwal in Amsterdam."},{"page_url":"https://de.wikipedia.org/wiki/Modellautomobil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Mercedes_Benz_SSK_1_18.jpg","page_title":"Modellautomobil","context_page_description":"Ein Automodell oder Modellauto ist die maßstäblich verkleinerte Nachbildung eines Automobils. Dies können Personenwagen, Lieferwagen, Busse, Lastwagen mit verschiedenen Aufbauten sowie Baufahrzeuge und landwirtschaftliche Fahrzeuge sein.\\nDer Zusammenbau solcher Modelle wird im Rahmen des Modellbaus verbreitet als Hobby betrieben. Für jeden Bereich gibt es aber auch fertige Modelle zu kaufen.\\nDer Automodellbau gliedert sich in mehrere Bereiche."},{"page_url":"https://pl.wikipedia.org/wiki/Bomb","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/MacOs_Syserror.png","page_title":"Bomb","context_page_description":"Bomb – symbol przedstawiający bombę występujący jako oznaczenie błędu krytycznego w systemach: klasycznym Mac OS oraz w Atari TOS."},{"page_url":"https://it.wikipedia.org/wiki/Re_Umberto_(nave_da_battaglia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Corazzata_Re_Umberto_1888.jpg","page_title":"Re Umberto (nave da battaglia)","context_page_description":"Nave Re Umberto è stata una nave da battaglia policalibro della Regia Marina italiana della omonima classe. Come per le altre unità della classe, il lungo periodo di costruzione l'ha resa superata al momento dell'entrata in servizio. La nave, della quale inizialmente erano state finanziate solo due unità, andò a risentire dei lunghissimi tempi di allestimento, dieci anni, che la fecero entrare in servizio parzialmente obsoleta."},{"page_url":"https://es.wikipedia.org/wiki/Norbert_Elias","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Elias-tablica.JPG","page_title":"Norbert Elias","context_page_description":"Norbert Elias fue un sociólogo judío-alemán cuyo trabajo se centró en la relación entre poder, comportamiento, emoción y conocimiento. Ha dado forma a la llamada «sociología figuracional». Fue poco conocido en el campo académico hasta los años 70, cuando fue «redescubierto». Su trabajo de una sociología histórica, puede explicar estructuras sociales complejas sin menoscabo de agencias individuales.​"},{"page_url":"https://en.wikipedia.org/wiki/Japanese_Americans","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/20140314_SAINTS.png","page_title":"Japanese Americans","context_page_description":"Japanese Americans are Americans who are fully or partially of Japanese descent, especially those who identify with that ancestry and its cultural characteristics. Japanese Americans were among the three largest Asian American ethnic communities during the 20th century; but, according to the 2000 census, they have declined in number to constitute the sixth largest Asian American group at around 773,000, including those of partial ancestry. According to the 2010 census, the largest Japanese American communities were found in California with 272,528, Hawaii with 185,502, New York with 37,780, Washington with 35,008, Illinois with 17,542, and Ohio with 16,995. Southern California has the largest Japanese American population in North America and the city of Gardena holds the densest Japanese American population in the 48 contiguous states."},{"page_url":"https://id.wikipedia.org/wiki/Sungai_Sanzu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Mitsunobu_Sanzu_River.jpg","page_title":"Sungai Sanzu","context_page_description":"Sungai Sanzu adalah kepercayaan religius Buddhisme Jepang yang mirip dengan Sungai Styx. Mereka meyakini bahwa sebelum mencapai akhirat, orang mati harus menyeberangi sungai, sehingga enam koin selalu ditempatkan dalam peti mati orang yang meninggal.\\nSungai Sanzu diyakini terletka di Gunung Osore, wilayah terpencil di Jepang utara."},{"page_url":"https://es.wikipedia.org/wiki/Sistema_de_lanzamiento_espacial","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Orange_tank_SLS_evolution_-_Post_CDR.jpg","page_title":"Sistema de lanzamiento espacial","context_page_description":"El SLS, es un proyecto de lanzadera de la NASA iniciado en 2010, y en fase de desarrollo, concebido como sucesor del anterior Transbordador STS, cuyo programa finalizó su vida operativa en 2011.\\nEl programa SLS surge como sustituto del fallido Proyecto Constelación: un programa de desarrollo de lanzaderas que debía haber sucedido al STS, y que fue cancelado en 2010 por recortes presupuestarios, así como por diversas críticas sobre sus especificaciones.\\nSegún el diseño previsto, el SLS tendrá un diámetro de 8.4 m y superará los 100 m de altura, con una capacidad de carga estimada en 130 000 kg, para satisfacer el requisito del Congreso, sirviendo tanto para carga como para misiones tripuladas.​\\nEl coste del programa está estimado en 10 000 millones de dólares, ​ y se prevé que los primeros lanzamientos de prueba del SLS se realicen en 2018, ​ alcanzando el estado operativo para la década de 2020."},{"page_url":"https://en.wikipedia.org/wiki/Zadn%C3%AD_Chodov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Zadn%C3%AD_Chodov_vlajka.jpg","page_title":"Zadní Chodov","context_page_description":"Zadní Chodov is a village and municipality in Tachov District in the Plzeň Region of the Czech Republic.\\nThe municipality covers an area of 13.88 square kilometres, and has a population of 282.\\nZadní Chodov lies approximately 11 kilometres north of Tachov, 56 km west of Plzeň, and 130 km west of Prague."},{"page_url":"https://de.wikipedia.org/wiki/Atzbach_(Hessen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ev_Kirche_Atzbach_%28003%29.jpg","page_title":"Atzbach (Hessen)","context_page_description":"Atzbach ist ein Ortsteil der Gemeinde Lahnau im mittelhessischen Lahn-Dill-Kreis. Die Ortschaft ist ein Wohnort für ca. 3100 Einwohner zwischen den Städten Wetzlar und Gießen und liegt an der Lahn. Er ist seit 1979 der östlichste Ortsteil der Gemeinde Lahnau, welche auch den größeren Ortsteil Waldgirmes und den kleinsten Ortsteil Dorlar umfasst."},{"page_url":"https://en.wikipedia.org/wiki/Embassy_of_Slovenia_in_Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Duodrumartica.jpg","page_title":"Embassy of Slovenia in Washington, D.C.","context_page_description":"The Embassy of Slovenia in Washington, D.C. is the Republic of Slovenia's diplomatic mission to the United States. The embassy in Washington is also responsible for representing Slovenia in Mexico. The chancery is located just off Embassy Row at 2410 California Street NW in the Kalorama neighborhood. Consular assistance is also provided by Slovenia's network of consulates in the U.S. and Mexico.\\nSlovenia's current ambassador to the United States is Božo Cerar. Ambassador Cerar presented his letter of credence to U.S. President Barack Obama on September 17, 2013. He also serves as ambassador to Mexico and as a permanent representative to the Organization of American States and the Caribbean Community."},{"page_url":"https://cs.wikipedia.org/wiki/Ale_i_kdy%C5%BE_ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Martin_Luther_King%2C_Jr..jpg","page_title":"Ale i když ne","context_page_description":"Ale i když ne je název kázání Martina Luthera Kinga proneseného 5. listopadu 1967 v Ebenezerském baptistickém kostele v Atlantě ve státě Georgie.\\nMartin Luther King ukázal v této promluvě rozdíl mezi takzvanou „jestliže vírou“ a „ačkoli vírou“. Kromě několika starozákonních událostí a výroků, které ilustrují oba typy víry, tvoří osu kázání příběh z knihy Daniel, v němž tři Židé odmítli uctít modlu vztyčenou králem Nabuchodonozorem, neboť Bůh, kterého ctí, má moc ochránit je před královým hněvěm - ale i když by je neochránil, stejně se neskloní.\\nPostoj „jestliže věřících“ k Bohu charakterizuje kazatel jako jakýsi obchodní vztah, v němž lidé smlouvají, co jim Bůh musí nejprve dát či splnit, aby se k němu obrátili. Naproti tomu „ačkoli křesťanům“ je i podle výše uvedeného citátu Bůh tak drahý, že se ho nevzdají dokonce ani v případě obtíží či dokonce fyzického ohrožení. Důsledkem je, že motivací spravedlivého života „ačkoli věřících“ není strach z pekla nebo pouze vidina nebe, ale Bůh jako takový - je správné jednat spravedlivě, protože Bůh jedná spravedlivě."},{"page_url":"https://en.wikipedia.org/wiki/Saint_John%27s_Eve","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Midsummer_Eve_bonfire_on_Skagen%27s_beach_-_P.S._Kr%C3%B8yer_-_Google_Cultural_Institute.jpg","page_title":"Saint John's Eve","context_page_description":"Saint John's Eve, starting at sunset on 23 June, is the eve of celebration before the Feast Day of Saint John the Baptist. The Gospel of Luke states that John was born six months before Jesus; therefore, the feast of John the Baptist was fixed on 24 June, six months before Christmas according to the old Roman calculation. This feast day is one of the very few saints' days which commemorates the anniversary of the birth, rather than the death, of the saint being honored.\\nThe Feast of Saint John closely coincides with the June solstice, also referred to as Midsummer in the Northern Hemisphere. The Christian holy day is fixed at 24 June; but in most countries festivities are mostly held the night before, on Saint John's Eve. This holiday is celebrated in many places."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D8%A7%DA%A9%D9%88%D9%86%DB%8C%D8%AC%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/PanoramaRacconigi.JPG","page_title":"راکونیجی","context_page_description":"راکونیجی ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۱۰۰۱۳ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۲۶۰ متر یۇکسک‏لیکده یئر آلیب. و پیمونت اوستانیندا دا یئرلشیب."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenverkehrssicherheit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Bangkok_skytrain_sunset.jpg","page_title":"Straßenverkehrssicherheit","context_page_description":"Straßenverkehrssicherheit soll Verkehrsunfälle vermeiden und die Folgen von Unfällen vermindern.\\nStraßenverkehrssicherheit wird im System Straße-Fahrzeug-Mensch unter anderem beschrieben\\nin den Teilbereichen Straßenbau, Straßenverkehrsrecht,\\nim Teilbereich Fahrzeugsicherheit,\\nin Bezug auf Menschen als Verkehrsteilnehmer in Verkehrspsychologie, Verkehrspädagogik und Fahrtechnik.\\nMit Hilfe sogenannter Crashtests werden die Sicherheitsstandards der Fahrzeuge unter wissenschaftlichen Bedingungen technisch überprüft und ständig verbessert.\\nDas Verkehrssicherungswesen befasst sich verantwortlich mit der Gewährleistung gefährdungsfreier Verkehrsabläufe.\\nZur Straßenverkehrssicherheit tragen unmittelbar die Verkehrsteilnehmer selbst bei, mittelbar der Gesetzgeber, Wissenschaft und Forschung, die Straßenverkehrsbehörden, die Polizei, die Verkehrserziehung, die Verkehrsclubs, die Verkehrspädagogik, die Schulen, die Gebietskörperschaften als Baulastträger, sowie Politik und Medien."},{"page_url":"https://id.wikipedia.org/wiki/Katedral_Santa_Maria,_Tallinn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Exterior_of_St_Mary%27s_Cathedral%2C_Tallinn.JPG","page_title":"Katedral Santa Maria, Tallinn","context_page_description":"Katedral Santa Maria adalah sebuah gereja katedral yang terletak di Bukit Toompea di Tallinn, Estonia. Awalnya didirikan oleh Denmark pada abad ke-13, ini adalah gereja tertua di Tallinn dan daratan Estonia. Itu juga satu-satunya bangunan di Toompea yang selamat dari kebakaran abad ke-17.\\nAwalnya katedral Katolik Roma, menjadi Lutheran pada 1561 dan sekarang milik Gereja Lutheran Injili Estonia. Itu adalah kursi Uskup Agung Tallinn, pemimpin spiritual Gereja Lutheran Injili Estonia, dan ketua sinode yang mengatur gereja itu."},{"page_url":"https://no.wikipedia.org/wiki/Jacques_Charles_Dupont_de_l%27Eure","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Dupont_de_l%27Eure.jpg","page_title":"Jacques Charles Dupont de l'Eure","context_page_description":"Jacques Charles Dupont de l'Eure var en fransk advokat og statsmann.\\nHan er best kjent som den første statsoverhodet i den andre franske republikken, etter sammenbruddet av julimonarkiet. Han arbeidet som advokat og var en del av parlamentet i Normandie da den franske revolusjonen ble igangsatt i 1789.\\nUnder den første republikken hadde han flere påfølgende juridiske embeter i Louviers, Rouen og Évreux. Han hadde adoptert flere revolusjonære prinsipper, og i 1798 begynte han på sitt politiske liv som medlem av forskjellige politiske fora. I 1813 ble han medlem av den lovgivende forsamlingen, og i løpet av hundre dager, var han innsatt som visepresident i kammeret som bestod av varamedlemmer.\\nHan var statsminister fra 24. februar 1848 til 9. mai 1848. Han ble valgt til Frankrikes president, den 24. februar 1848 og han ble gikk ut fra presidentembetet 9. mai 1848, etter bare noen få måneder ved makten. Han døde 7 år senere, i en alder av 88 år."},{"page_url":"https://eu.wikipedia.org/wiki/Lolland_(udalerria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Nakskov_-_vue_mod_S%C3%B8ndergade.JPG","page_title":"Lolland (udalerria)","context_page_description":"Lolland Danimarkako Seelandia eskualdeko udalerria da, Lolland uhartearen mendebaldea hartzen duena. Hiriburua Maribo bada ere herri handiena Nakskov da."},{"page_url":"https://en.wikipedia.org/wiki/Mark_Harris_(rugby_league)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Mark_Harris%2C_2015_%28cropped%29.jpg","page_title":"Mark Harris (rugby league)","context_page_description":"Mark Walter Harris was an Australian professional rugby league footballer who played for the Eastern Suburbs and North Sydney clubs. He also represented the Montreal Alouettes in the Canadian Football League. A destructive hard running centre, Harris made 190 appearances for the Roosters and a further 33 for the Bears."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%DB%8C%D9%84_%D8%AC%D9%88%D9%84%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/John_William_Julian.jpg","page_title":"بیل جولیان","context_page_description":"بیل جولیان بازیکن فوتبال اهل بریتانیا بود.\\nاز باشگاه‌هایی که در آن بازی کرده‌است می‌توان به باشگاه فوتبال لوتون تاون، باشگاه فوتبال بوستون تاون، باشگاه فوتبال تاتنهام هاتسپر، باشگاه فوتبال آرسنال، و باشگاه فوتبال دارتفورد اشاره کرد."},{"page_url":"https://pt.wikipedia.org/wiki/H%C5%99ebe%C4%8Dn%C3%ADky","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/T%C3%BD%C5%99ovice6.jpg","page_title":"Hřebečníky","context_page_description":"Hřebečníky é uma comuna checa localizada na região da Boêmia Central, distrito de Rakovník."},{"page_url":"https://sk.wikipedia.org/wiki/Bixente_Lizarazu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Bixente_Lizarazu.jpg","page_title":"Bixente Lizarazu","context_page_description":"Bixente Lizarazu je bývalý francúzsky futbalista.\\nV roku 1998 získal s reprezentáciou Francúzska titul majstra sveta vo futbale, v roku 2000 titul majstra Európy vo futbale. Aktívnu športovú kariéru ukončil v roku 2006."},{"page_url":"https://eu.wikipedia.org/wiki/Amniataba_percoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/FMIB_45650_Therapon_percoides.jpeg","page_title":"Amniataba percoides","context_page_description":"Amniataba percoides Amniataba generoko animalia da. Arrainen barruko Terapontidae familian sailkatzen da."},{"page_url":"https://ro.wikipedia.org/wiki/Tomas_Ryde","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Tomas_Ryde_%28crop%29.jpg","page_title":"Tomas Ryde","context_page_description":"Tomas Robert Ryde este un antrenor de handbal suedez și antrenor principal al echipei naționale de handbal feminin a României.\\nLa sfârșitul sezonului 2007-08, Ryde a părăsit clubul danez Viborg HK „din motive familiale” pentru a se întoarce în Suedia. Secundul său, Jakob Vestergaard, a preluat atunci echipa după Ryde.\\nTomas Ryde a acceptat funcția de antrenor principal al reprezentativei României la jumătatea lunii martie 2015, după ce i se făcuse o propunere asemănătoare și în 2008. Pe data de 4 octombrie 2016, el a fost înlocuit cu Ambros Martín.\\nÎn anul 2019 suedezul a revenit ca selecționer al echipei naționale a României."},{"page_url":"https://ht.wikipedia.org/wiki/Toronto,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Saint_James_Church_-_Toronto%2C_Iowa.JPG","page_title":"Toronto, Iowa","context_page_description":"Toronto, Iowa se yon vil Etazini. Li sitye nan leta Iowa.\\nChèf-lye li se?."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%98%BF%E5%80%8D%E7%8E%8B%E5%AD%90%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Abeoji-jinja7.jpg","page_title":"阿倍王子神社","context_page_description":"阿倍王子神社とは大阪府大阪市阿倍野区にある神社。かつては阿倍王子といい熊野神社の分霊社である九十九王子のひとつであった。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%BF%D0%B5%D0%BB%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Spelle-Bahnhof.JPG","page_title":"Шпелле","context_page_description":"Шпелле — громада в Німеччині, розташована в землі Нижня Саксонія. Входить до складу району Емсланд. Центр об'єднання громад Шпелле.\\nПлоща — 34,2 км². Населення становить 8971 ос."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_d%27Alapan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Imus_Heritage_Park.jpg","page_title":"Bataille d'Alapan","context_page_description":"La bataille d’Alapan se déroula le 28 mai 1898 durant la révolution philippine. Elle se solda par une victoire des révolutionnaires contre les Espagnols."},{"page_url":"https://en.wikipedia.org/wiki/Dylan_Strome","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Dylan_Strome_%2839248611994%29.jpg","page_title":"Dylan Strome","context_page_description":"Dylan William Strome is a Canadian professional ice hockey center for the Chicago Blackhawks of the National Hockey League. Ahead of the 2015 NHL Entry Draft, Strome was considered a top prospect, and was selected third overall by the Arizona Coyotes. He is the brother of New York Rangers forward Ryan Strome and Philadelphia Flyers prospect Matthew Strome."},{"page_url":"https://hr.wikipedia.org/wiki/Pulsarov_planet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Artist%27s_concept_of_PSR_B1257%2B12_system.jpg","page_title":"Pulsarov planet","context_page_description":"Pulsarov planet je planet koji se nalazi u orbiti oko pulsara ili brzo rotacijskih neutronskih zvijezda. Prvi takav planet koji je otkriven bio je oko milisekundnoh pulsara i bio je prvi ekstrasolarni planet koji je potvrđen kao otkriven.\\nPulsarovi planeti otkrivaju se pulsarskim mjerenjima vremena kako bi se otkrile anomalije u razdoblju pulsacije. Sva tijela u orbiti oko pulsara uzrokovat će redovne promjene u pulsaciji. Budući da se pulsari normalno okreću gotovo konstantnom brzinom, bilo kakve promjene mogu se lako otkriti uz pomoć preciznih mjerenja vremena. Otkriće pulsarovih planeta bilo je neočekivano; pulsari ili neutronske zvijezde prethodno su otišli u supernovu, a mislilo se da bi bilo koji planet koji orbitira oko takvih zvijezda bio uništen u eksploziji."},{"page_url":"https://en.wikipedia.org/wiki/Kim_Eung-ryong","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Kim_Eung_Ryong_2006-9-6.png","page_title":"Kim Eung-ryong","context_page_description":"Kim Eung-Ryong is a Korean baseball manager. He is the winningest manager in the history of Korean professional baseball, having won ten Korean Series championships throughout his career. He was the manager of the Haitai Tigers, Samsung Lions, and Hanwha Eagles."},{"page_url":"https://zh.wikipedia.org/wiki/2011%E5%B9%B4%E5%9F%83%E5%8F%8A%E9%9D%A9%E5%91%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Unplug-mubarak.png","page_title":"2011年埃及革命","context_page_description":"2011年埃及革命又稱埃及「1·25」革命，是指從2011年1月25日開始的由埃及民眾爆發所進行的一系列街頭示威、遊行、集會、罷工等抗議活動向政府表達不滿。由於當日正值埃及法定警察假日，所以一個名為4月6日青年運動的組織選定該日作為示威活動開始的日子。抗議示威活動在開羅和亞歷山大最為激烈，在埃及的其他城市也有明顯的抗議示威活動。超過一百萬人參與了此次抗議，他們要求埃及總統穆巴拉克下台。此次大規模示威成為了自1977年埃及發生「麵包暴動」以來近30年內發生的規模最大的民主化的示威運動。\\n作為2010－2011年阿拉伯世界的反政府示威的一部分，此次大規模示威活動在突尼西亞茉莉花革命的數周後開始，部分示威者還攜帶了突尼西亞國旗以作為他們的影響力的標誌。示威者圍繞埃及警察粗暴執法，不滿國家緊急安全法，公民缺乏自由選舉權和言論自由權，政治嚴重腐敗等政治問題以及失業率嚴重，低工資和高物價等經濟問題展開抗議。示威活動組織者的主要要求包括：要求胡斯尼·穆巴拉克下台，軍隊結束戒嚴，終止緊急狀態法，獲得自由和正義的權利，組建一個負責任的民選政府，並由他們管理整個埃及的資源。\\n據報導截至1月29日，至少有105名示威者死亡，超過750名警察和1500名示威者受傷。埃及首都開羅在此次事件中被形容為「戰區」，港口城市蘇伊士一直有衝突和暴力事件發生。政府實行了宵禁，但實際上示威者並不遵守。同時，警察和軍隊也沒有強行執行宵禁。忠於穆巴拉克的埃及中央安全警察在本次示威活動中已經逐步取代並很大程度上制約了埃及的軍隊。在警力資源匱乏的時候，出現團伙搶劫等現象，反對派人士稱這些搶劫事件是由便衣警察製造的。民眾因此自發組織了隊伍以保衛他們自己的家園。\\n國際社會應對抗議活動的評價有好有壞，許多國家均呼籲希望抗議活動能夠和平進行，並希望能進行一些改革。大部分西方國家的政府還對局勢表示關切。與此同時，大多數政府已經發出了旅遊警告，並且開始從埃及疏散本國公民。\\n穆巴拉克解散了政府並且任命該國情報主管奧馬爾·蘇萊曼為副總統，企圖以此平息示威。穆巴拉克還任命前民航部長艾哈邁德·沙菲克為新政府總理，他將負責組建新政府。埃及反對各勢力已共推巴拉迪代表他們出面與穆巴拉克政權談判。面臨各方越來越大的壓力，穆巴拉克宣布他和他的兒子將不會參與將於九月舉行的重新選舉。\\n2月11日，副總統奧馬爾蘇萊曼透過國家電視台宣布，穆巴拉克已經辭去總統職務並將權力移交給埃及武裝部隊最高委員會。\\n3月19日，埃及舉行埃及憲法修正案全民公決，內容包括總統選舉改革、是否同意今年第或明年初舉行大選等九項議題。由於國際原子能機構前總幹事巴拉迪等批評者認為，此次公決時間倉促，難以組成政黨以致會讓穆斯林兄弟會和前執政的民族民主黨將從中獲利，因此他遭到大多數同意儘快舉行大選的投票民眾的激烈阻止。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1928","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Carl_Fontana.jpg","page_title":"Lijst van personen geboren in 1928","context_page_description":"Dit is een lijst van personen die geboren zijn in 1928.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ca.wikipedia.org/wiki/Crowded_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/CrowdedHouse-HydePark.jpg","page_title":"Crowded House","context_page_description":"Crowded House és un grup de rock format a Melbourne i liderat pel cantantautor neozelandès Neil Finn. L'activitat de la banda va ocórrer entre el 1986 i 1996, any en què la banda va dissoldre's. Una dècada més tard, l'any 2007 la banda va reunificar-se per continuar la trajectòria musical junts.\\nNeil Finn és àmpliament reconegut com el compositor principal i el director creatiu de la banda. La resta dels seus componenets són Paul Hester a la bateria i Nick Seymour al baix. Addicionalment, Mark Hart va col·laborar en l'àlbum Together Alone i Recurring Dream i Tim Finn va participar en l'àlbum Woodface.\\nL'any 2006 Neil Finn i Nick Seymour es van retrobar per treballar en un nou disc en solitari de Neil Finn. Comprovant la gran química que encara mantenien entre ells dos van decidir tornar a unir-se per treure un nou disc com a Crowded House aprofitant les cançons amb les quals havien estat treballant. Mark Hart va tornar a treballar amb ells com a guitarra i piano, i ocupant el lloc del difunt Paul Hester van contractar a Matt Sherrod. Com a resultat d'aquest treball va sorgir l'any 2007 l'àlbum Time on Earth i una gira mundial."},{"page_url":"https://de.wikipedia.org/wiki/Sachsenflur","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Wappen_Sachsenflur.png","page_title":"Sachsenflur","context_page_description":"Sachsenflur ist einer von zwölf Stadtteilen der Stadt Lauda-Königshofen im Main-Tauber-Kreis, dem nördlichsten Landkreis Baden-Württembergs."},{"page_url":"https://eo.wikipedia.org/wiki/Fernando_da_Piedade_Dias_dos_Santos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Fernando_da_Piedade_Dias_dos_Santos_%28cropped%29.jpg","page_title":"Fernando da Piedade Dias dos Santos","context_page_description":"Fernando da Piedade Dias dos Santos, ankaŭ konata sub la nomo Nandó, estas ĉefministro de Angolo. Li okupas tiun taskon ekde la 6-a de decembro 2002. Antaŭ 2002 dum tri jaroj neniu okupis tiun oficon. Dos Santos antaŭe estis ministro pri internaj aferoj de Angolo."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Eferding","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Eferding_-_Stadtplatz_35.jpg","page_title":"Liste der denkmalgeschützten Objekte in Eferding","context_page_description":"Die Liste der denkmalgeschützten Objekte in Eferding enthält die 113 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Eferding in Oberösterreich."},{"page_url":"https://es.wikipedia.org/wiki/Turismo_en_Florencia_(Caquet%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Edificio_Curiplaya%2C_Florencia%2C_Caquet%C3%A1..JPG","page_title":"Turismo en Florencia (Caquetá)","context_page_description":"El Turismo en Florencia (Caquetá) se refiere al sector del turismo en la ciudad colombiana de Florencia, capital del departamento de Caquetá. La actividad turística en Florencia es impulsada principalmente por el Ministerio de Comercio, Industria y Turismo del gobierno de Colombia, y a nivel local por la Alcaldía de Florencia y por el Instituto Departamental de Cultura, Deporte y Turismo del Caquetá.\\nLa ciudad ofrece una amplia variedad de restaurantes y sitios de esparcimiento nocturno, la mayoría de ellos ubicados en la zona rosa de la ciudad, cerca del parque longitudinal Paseo de los Fundadores. Destacan de igual forma sus parques, iglesias, edificios históricos y construcciones modernas. En Florencia existen múltiples monumentos públicos que rinden homenaje a los personajes y hechos históricos de la región, siendo los más conocidos el Monumento a los Colonos, a la Diosa del Chairá y a la Ciencia, Hombre y Manigua."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Passau/Ortsteile","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Schmiedgasse_21_Passau.JPG","page_title":"Liste der Baudenkmäler in Passau/Ortsteile","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen kreisfreien Stadt Passau zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://tl.wikipedia.org/wiki/Jecheon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Korea-Jecheon-SBS_Jecheon_setting_3329-07.JPG","page_title":"Jecheon","context_page_description":"Ang Lungsod ng Jecheon ay isang lungsod sa bansang Timog Korea."},{"page_url":"https://id.wikipedia.org/wiki/Lee_Ah-in","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/170602_%EB%AE%A4%EB%B1%85_%EC%95%84%EC%9D%B8_%284%29.jpg","page_title":"Lee Ah-in","context_page_description":"Ahin adalah seorang penyanyi Korea Selatan yang berada di bawah kontrak MLD Entertainment. Ia adalah vokalis utama grup vokal perempuan Momoland.\\nIa lahir di Wonju, Korea Selatan. Dari usia 6 tahun, ia tinggal di Tiongkok selama hampir 10 tahun, dan di Taiwan selama 2 tahun. Ia masuk Shanghai United International School dan dapat berbicara dalam bahasa Mandarin, bahasa Inggris dan sedikit dapat berbicara dalam bahasa Spanyol."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_galaksi_spiral","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/ESO_-_Ngc1532_gendler_%28by%29.jpg","page_title":"Daftar galaksi spiral","context_page_description":"Galaksi spiral adalah jenis galaksi yang ditandai oleh tonjolan pusat bintang tua populasi II yang dikelilingi oleh cakram berputar bintang muda populasi I. Galaksi spiral mempertahankan lengan spiralnya melalui teori gelombang kepadatan."},{"page_url":"https://br.wikipedia.org/wiki/Clara_Elisabeth_von_Platen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Platen.jpg","page_title":"Clara Elisabeth von Platen","context_page_description":"Clara Elisabeth von Platen, dug Braunschweig-Lüneburg, ha perzh a gemeras en afer Philipp Christoph von Königsmarck‎."},{"page_url":"https://en.wikipedia.org/wiki/Temple_of_Mercury_(Puy_de_D%C3%B4me)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Temple_de_Mercure%2C_Observatoire_du_Puy-de-D%C3%B4meVers1900.jpg","page_title":"Temple of Mercury (Puy de Dôme)","context_page_description":"The Temple of Mercury at Puy de Dôme is a Gallo-Roman trachyte temple built in the 2nd century at the summit of the dome. It replaced a 1st-century arkose temple on the same site, which was apparently too small to accommodate the many pilgrims who visited. Its remains were revealed by excavation campaigns in 1875 and at the turn of the century."},{"page_url":"https://fr.wikipedia.org/wiki/Fernando_Cod%C3%A1_Marques","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Coda-Marques.png","page_title":"Fernando Codá Marques","context_page_description":"Fernando Codá dos Santos Cavalcanti Marques est un mathématicien brésilien qui travaille principalement dans les domaines de la géométrie, la topologie, les équations aux dérivées partielles et la théorie de Morse. Il est professeur à l'Université de Princeton. En 2012, en collaboration avec André Neves, il a prouvé la conjecture de Willmore."},{"page_url":"https://eu.wikipedia.org/wiki/Otsa_jauregia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Elorrio_%28Vizcaya%29-Residencia_Zumelegi.jpg","page_title":"Otsa jauregia","context_page_description":"Otsa jauregia Elorrion dago, Durangaldean. XVIII. mendean eraiki zuen Ossa-Lekerika familiak estilo barrokoan. Jauregia hiru izenez ezagutzen da herrian: Otsa-Lekerika, Amileta edo Zumelegi jauregitzat.\\nAzken urteotan, Zumelegi Laguntza Zentroa dago Otsa jauregian, laguntza-erakunde bat Bizkaiko Foru Aldundiak kudeatzen duena, eta artatzen dituena herrialdeko zenbait pertsona, ahalmen psikiko urria dutenak."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%89%E5%9D%91%E5%AD%90%E8%80%81%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/%E4%B8%89%E5%9D%91%E5%AD%90%E6%B0%B8%E7%A6%8F%E5%AE%AE%E8%BF%91%E6%99%AF.jpg","page_title":"三坑子老街","context_page_description":"三坑子老街，又称三坑老街，位于台湾桃园市龙潭区，范围大致上是以永福宫为聚落的核心，向外至黑白洗，老街呈现外窄内宽的型态；三坑子为一传统客家聚落，为龙潭区开发较早的地区，有‘龙潭第一街’之称。"},{"page_url":"https://sv.wikipedia.org/wiki/Persoonia_linearis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Persoonia_linearis_range.png","page_title":"Persoonia linearis","context_page_description":"Persoonia linearis är en tvåhjärtbladig växtart som beskrevs av Gábor Gabriel Andreánszky. Persoonia linearis ingår i släktet Persoonia och familjen Proteaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%96%D0%B1%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Medieval_Byblos.png","page_title":"Бібл","context_page_description":"Бібл, Губла, нині Джубейль — місто, розташоване на східному березі Середземного моря, за 32 км на північ від Бейрута — сьогоднішньої столиці Лівану, у давнину — незалежне місто-держава."},{"page_url":"https://de.wikipedia.org/wiki/Frohnhausen_(Essen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bertha-Krupp-Schule_03.jpg","page_title":"Frohnhausen (Essen)","context_page_description":"Frohnhausen ist ein Stadtteil im Westen der Stadt Essen.\\nSeine Geschichte, dessen erste Spuren mit dem Geweihgerät von Essen-Frohnhausen in die Steinzeit weisen, begann als ländliche Ansiedlung von Höfen, und ist so über Jahrhunderte bezeugt. Erst im 19. Jahrhundert wuchs die Bevölkerung stark an, da mit der Entwicklung von Tiefbauzechen und der benachbarten Krupp-Gussstahlfabrik Arbeiter aus ganz Deutschland, dem Ausland und vor allem Polen hier ihr Auskommen zu verdienen suchten. Zwischen 1822 und 1895 hat sich die Frohnhauser Bevölkerung auf rund 5.700 Einwohner verzehnfacht. 1910 lag die Einwohnerzahl schon bei rund 27.300 Menschen. Dementsprechend entwickelte sich innerhalb eines Jahrhunderts, besonders von der Firma Krupp unterstützt, eine ländliche Gegend zu einem dichtbesiedelten Wohnquartier samt nötiger Infrastruktur. Noch heute wohnen mehr als fünf Prozent aller Essener Bürger in dem zweit-einwohnerstärksten Stadtteil der Stadt nach Altenessen. Allerdings ist Altenessen in die zwei Stadtteile Altenessen-Nord und -Süd gegliedert."},{"page_url":"https://ja.wikipedia.org/wiki/FC%E3%83%AD%E3%83%BC%E3%83%88%E3%83%B4%E3%82%A1%E3%82%A4%E3%82%B9%E3%83%BB%E3%82%A8%E3%82%A2%E3%83%95%E3%83%AB%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Steigerwaldstadion-Block_3.JPG","page_title":"FCロートヴァイス・エアフルト","context_page_description":"FCロートヴァイス・エアフルトは、ドイツの中央部、テューリンゲン州の州都エアフルトを本拠地とするサッカークラブである。"},{"page_url":"https://pl.wikipedia.org/wiki/%C4%8Cervenka_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/N%C3%A1dra%C5%BE%C3%AD_%C4%8Cervenka.jpg","page_title":"Červenka (stacja kolejowa)","context_page_description":"Červenka – stacja kolejowa w Července, w kraju ołomunieckim, w Czechach przy ulicy Nádražní 372. Znajduje się na wysokości 235 m n.p.m. i leży na linii kolejowej nr 270 oraz 273."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8F%B0%E9%AB%98%E5%B1%B1%E8%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Takamisan01.JPG","page_title":"台高山脈","context_page_description":"台高山脈は、紀伊半島東部に位置する山脈。大台ヶ原山地とも言う。\\n三重県と奈良県の境を成し、標高1,000～1,600m級の山々が連なる。大峰山脈と共に「近畿の屋根」と称されるほか、「近畿の秘境」・「三重県の屋根」の異名を持つ。柿本人麻呂の短歌「東の野にかぎろひの立つ見えてかへり見すれば月かたぶきぬ」にある「東の野」の「かぎろひ」とは、現在の奈良県宇陀市大宇陀からこの山脈にかかる陽炎を見て詠んだものとされる。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%BD%D1%89%D0%B5%D0%B9%D0%BD_(%D0%B7%D0%B0%D0%BC%D1%8A%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Burg_Pernstein.JPG","page_title":"Пернщейн (замък)","context_page_description":"Замъкът Пернщейн, наричан също Мраморен замък, е средновековен замък, намиращ се над едноименно село на около 10 km югоизточно от Бистрице над Пернщейн и на 40 km северозападно от Бърно в историческата област Моравия. Мястото е средновековното седалище на баронския род Пернщейн."},{"page_url":"https://de.wikipedia.org/wiki/Franz_Hitzel","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/MPano_07_3.jpg","page_title":"Franz Hitzel","context_page_description":"Franz Hitzel war ein deutscher Architekt und Baubeamter, ehrenamtlicher Denkmalpfleger, Hochschullehrer an der Fachhochschule Konstanz und Kommunalpolitiker der CDU."},{"page_url":"https://ca.wikipedia.org/wiki/Agust%C3%ADn_Arg%C3%BCelles_%C3%81lvarez","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Agust%C3%ADn_de_Arg%C3%BCelles_%C3%81lvarez_%28Congreso_de_los_Diputados_de_Espa%C3%B1a%29.jpg","page_title":"Agustín Argüelles Álvarez","context_page_description":"Agustín Argüelles Álvarez. Fou advocat, polític del moviment lliberal espanyol i diputat i diplomàtic. Passà a la història amb els malnoms de: El Divino Argüelles i Arístides espanyol. També fou tutor de la reina Isabel II d'Espanya.\\nEra fill d'una bona família d'ascendència aristocràtica, establerta a Ribadesella, a la costa asturiana. De molt jove treballà com a secretari del bisbe de Barcelona, Monsenyor Pere Díaz Valdés.\\nVa estudiar a la universitat d'Oviedo. S'establí a Madrid en 1800. Fou diputat per Oviedo a les Corts de Cadis. Participà en l'aprovació de les lleis com la llibertat d'impremta i l'abolició del torment.\\nTambé destacà en la redacció del preàmbul de la primera constitució espanyola, a la que anomenaven \\"La Pepa\\". No tardaria que el rei Ferran VII l'enviès a la presó quan el monarca instaurà l'absolutisme. El desembre de 1814 el rei ordenà el trasllat d'Argüelles a Alcúdia, on restarà des de 1815 fins a 1820.\\nFou ministre de Governació durant el trienni liberal, però va dimitir per desavinences amb el rei i marxà a Anglaterra, on treballà com a bibliotecari de lord Holland."},{"page_url":"https://hu.wikipedia.org/wiki/F%C3%B6ldra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/RO_BN_Biserica_Sfintii_Arhangheli_din_Feldru_%2833%29.jpg","page_title":"Földra","context_page_description":"Földra falu Romániában, Erdélyben, Beszterce-Naszód megyében."},{"page_url":"https://hr.wikipedia.org/wiki/Geomagnetska_oluja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Magnetosphere_simple.jpg","page_title":"Geomagnetska oluja","context_page_description":"Geomagnetska oluja je privremeno ometanje Zemljine magnetosfere, koje uzrokuju Sunčeve aktivnosti, a to su obično udarni val i oblak magnetskog polja Sunčevog vjetra, zajedno sa Sunčevim bakljama i koronalnim izbacivanjem mase, koji zajedno napadaju Zemljino magnetsko polje 3 dana nakon Sunčevih aktivnosti. Pritisak Sunčevog vjetra na magnetosferu i magnetsko polje Sunčevog vjetra će se povećavati ili smanjivati, ovisno o Sunčevim aktivnostima. Promjene pritiska Sunčevog vjetra mijenjaju električnu struju u ionosferi, a magnetsko polje Sunčevog vjetra će medusobno djelovati sa Zemljinim magnetskim poljem. Geomagnetske oluje obično traju dan ili dva, ali mogu trajati i danima.\\nGeomagnetska oluja su izrazite neperiodičke promjene elemenata Zemljina magnetskoga polja uzrokovane promjenama intenziteta Sunčeva vjetra. Najveći otkloni intenziteta Zemljina magnetskoga polja u odnosu na razinu neporemećenoga dana iznose oko 5 000 nT, a prosječni 100 do 500 nT. Geomagnetske oluje javljaju se na cijeloj Zemlji, a mogu trajati nekoliko dana."},{"page_url":"https://sh.wikipedia.org/wiki/Maseru","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Maseru_Leotho_main_south.jpg","page_title":"Maseru","context_page_description":"Maseru je glavni i najveći grad afričke Kraljevine Lesoto od 197 907 stanovnika."},{"page_url":"https://fr.wikipedia.org/wiki/Places_de_Naples","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Napoli_-_piazza_San_Domenico_Maggiore_e_guglia_1030736.JPG","page_title":"Places de Naples","context_page_description":"Les places de Naples ont une valeur artistique, historique, architecturale et touristique remarquable ; leur histoire accompagne celle de la ville depuis des siècles, elles ont toujours fait partie intégrante de la vie urbaine, des marchés ou des grands événements publics et politiques : elles constituent un élément de charme supplémentaire de la ville."},{"page_url":"https://da.wikipedia.org/wiki/Rupiah_Banda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Rupiah_Banda.jpg","page_title":"Rupiah Banda","context_page_description":"Rupiah Bwezani Banda var Zambias fjerde præsident. Han blev indsat som præsident d. 29. juni 2008 efter at hans forgænger Levy Mwanawasa først fik en blodprop, og siden døde i august. Banda var på det tidspunkt vicepræsident. Banda vandt marginalt valget i slutningen af oktober 2008, og blev dermed indsat som Zambias fjerde præsident.\\nOversat fra norsk Wikipedia."},{"page_url":"https://fr.wikipedia.org/wiki/Joseph_Mazzello","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Joseph_Mazzello_2010_%28cropped%29.jpg","page_title":"Joseph Mazzello","context_page_description":"Joseph Mazzello est un acteur, producteur de cinéma, réalisateur et scénariste américain né le 21 septembre 1983 à Rhinebeck\\nIl accède à la notoriété internationale pour son rôle du jeune Tim Murphy dans Jurassic Park en 1993. Par la suite, il joue notamment en 2010 Eugene Sledge dans la minisérie The Pacific, puis Dustin Moskovitz dans The Social Network. Récemment, il incarne John Deacon, le bassiste de Queen dans le film à succès Bohemian Rhapsody."},{"page_url":"https://az.wikipedia.org/wiki/Tarif_adas%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Vista_panor%C3%A1mica_de_la_isla_de_las_Palomas%2C_en_Tarifa_crop.jpg","page_title":"Tarif adası","context_page_description":"Tarif adası və ya Palomas — Cəbəllütariq boğazında yerləşən kiçik ada. Tarif şəhərinin yaxınlığında yerləşir.\\nAda Pireney yarımadası ilə damba vastəsi ilə birləşdirilmişdir. Adanın cənubunda Mərakeş burnu yerləşir. Burun Avropa qitəsinin ucqar cənub nöqtəsidir. Burunda mayak fəaliyyət göstərir."},{"page_url":"https://it.wikipedia.org/wiki/Willoughby_Norrie,_I_barone_Norrie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Sir_Willoughy_Norrie_and_family_in_the_sea.jpg","page_title":"Willoughby Norrie, I barone Norrie","context_page_description":"Charles Willoughby Moke Norrie, I barone Norrie, è stato un generale e politico britannico."},{"page_url":"https://la.wikipedia.org/wiki/Amplier","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Map_commune_FR_insee_code_62030.png","page_title":"Amplier","context_page_description":"Amplier est commune Francicum 306 incolarum praefecturae Freti Calisii in provincia Septentrioni et Freto."},{"page_url":"https://fr.wikipedia.org/wiki/Tour_de_la_Paix","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Peace_Tower_Construction.jpg","page_title":"Tour de la Paix","context_page_description":"La tour de la Paix est une tour horloge et un clocher bâti sur l'axe central de la façade du Parlement du Canada, à Ottawa, en Ontario. L'édifice actuel remplace la tour Victoria, haute de 55 mètres, détruite lors de l'incendie de 1916, qui avait ravagé la majeure partie du parlement. Devenue un symbole du Canada, la tour apparaît sur l'envers des billets de cinquante dollars canadiens ainsi que sur les billets de vingt dollars."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%DB%8C%D8%AF%D9%86_%D8%A8%DB%8C%D9%84%DB%8C%D9%85%E2%80%8C%DB%8C%D9%88%D8%B1%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Leiden_-_Rapenburg_met_Academiegebouw_en_Nonnenbrug.jpg","page_title":"لیدن بیلیم‌یوردو","context_page_description":"| free_label =\\n| free =\\n| free_label2 =\\n| free2 =\\n| colors = Dark Blue\\n| athletics =\\n| sports =\\n| athletics_nickname =\\n| sporting_affiliations =\\n| mascot =\\n| sports_free_label =\\n| sports_free =\\n| sports_free_label2 =\\n| sports_free2 =\\n| website =\\n| logo =\\n| logo_size =\\n| logo_alt =\\n}}\\nلیدن بیلیم‌یوردو هولندنین لیدن و لاهه شهرینده یئرلشن بیر عالی تحصیل موسّسه‌سی. بۇ بیلیم‌یوردو شهرین حومه‌سینده‌دیر. و ۲۴٬۳۷۵ لیسانس و لیسانس‌دان یۆکسک اؤیره‌نجی‌سی واردیر. عۆمومی و دؤولتی‌ اؤیره‌تیم قۇرومودیر و بودجه‌‌سینی دؤولت و بؤیوک شیرکت‌لر و خالقدان آلدیغی اعانه‌لرله تامین ائدیر."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_H%C3%A1jske","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/K%C3%B6p%C3%B6sd_templom_2.JPG","page_title":"Zoznam kultúrnych pamiatok v obci Hájske","context_page_description":"Toto je zoznam kultúrnych pamiatok v obci Hájske v okrese Šaľa.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí.\\nVysvetlivky:\\nFotografia objektu. Kliknutím na obrázok sa zobrazí zväčšený náhľad.\\nTu sa nachádzajú ďalšie obrázky objektu na Wikimedia Commons.\\nOdkaz na nahratie nového obrázku, pričom určité parametre sú vopred vyplnené.\\nNahratím obrázku na Wikimedia Commons sa tento zoznam nijako nezmení, takže v prípade potreby je treba upraviť tento zoznam tak, aby sa nahratý obrázok zobrazil aj tu.\\nIdentifikačné číslo objektu, prvú časť tvorí číslo okresu, druhú časť tvorí číslo, pod ktorým je pamiatka evidovaná v ÚZPF.\\nOznačenie pamiatky prebraté z databázy PÚSR.\\nPoužité skratky:\\nPÚSR Pamiatkový úrad Slovenskej republiky\\nNKP Národná kultúrna pamiatka\\nPO Pamiatkový objekt\\nÚZPF Ústredný zoznam pamiatkového fondu"},{"page_url":"https://es.wikipedia.org/wiki/Cementerio_paleocristiano_de_Tarragona","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Necropoli_tearrgona.jpg","page_title":"Cementerio paleocristiano de Tarragona","context_page_description":"El cementerio paleocristiano de Tarragona es un conjunto funerario de época tardorromana de mediados del siglo III ubicado fuera del casco urbano, cerca del río Francolí, que perdura hasta el siglo V. Es el cementerio paleocristiano más importante del Mediterráneo Occidental. Es una de las localizaciones del Lugar Patrimonio de la Humanidad denominado Conjunto arqueológico de Tarraco, en concreto identificado con el código 875-008.\\nEl cementerio de Tarraco surgió en torno a una basílica martirial dedicada a San Fructuoso y sus dos diáconos. La basílica documentada, constaba de tres naves y cabecera con ábside exterior. Posteriormente se añadieron algunas cámaras funerarias y un baptisterio. Los restos de esta basílica desaparecieron para dejar paso a la construcción de la «Fábrica de Tabacos de Tarragona» durante la primera mitad del siglo XX.\\nLa tipología de los sepulcros es muy variada y va desde entierros simples con ánfora o teja hasta los mausoleos, pasando por una gran diversidad de sarcófagos, algunos de procedencia norteafricana, o en ataúdes de madera."},{"page_url":"https://en.wikipedia.org/wiki/Aliger_gigas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Inagua_Lobatus_gigas.jpg","page_title":"Aliger gigas","context_page_description":"Aliger gigas, originally known as Strombus gigas or more recently as Lobatus gigas, commonly known as the queen conch, is a species of large edible sea snail, a marine gastropod mollusc in the family of true conches, the Strombidae. This species is one of the largest molluscs native to the Caribbean Sea, and tropical northwestern Atlantic, from Bermuda to Brazil, reaching up to 35.2 centimetres in shell length. A. gigas is closely related to the goliath conch, Lobatus goliath, a species endemic to Brazil, as well as the rooster conch, Lobatus gallus.\\nThe queen conch is herbivorous. It feeds by browsing for plant and algal material growing in the seagrass beds, and scavenging for decaying plant matter. These large sea snails typically reside in seagrass beds, which are sandy plains covered in swaying sea grass and associated with coral reefs, although the exact habitat of this species varies according to developmental age. The adult animal has a very large, solid and heavy shell, with knob-like spines on the shoulder, a flared, thick outer lip, and a characteristic pink or orange aperture."},{"page_url":"https://en.wikipedia.org/wiki/Multiple_patterning","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Self-aligned_via_patterning.png","page_title":"Multiple patterning","context_page_description":"Multiple patterning is a class of technologies for manufacturing integrated circuits, developed for photolithography to enhance the feature density. It is expected to be necessary for the 10 nm and 7 nm node semiconductor processes and beyond. The premise is that a single lithographic exposure may not be enough to provide sufficient resolution. Hence additional exposures would be needed, or else positioning patterns using etched feature sidewalls would be necessary.\\nEven with single exposure having sufficient resolution, extra masks have been implemented for better patterning quality such as by Intel for line-cutting at its 45nm node or TSMC at its 28nm node.\\nEven for electron-beam lithography, single exposure appears insufficient at ~10 nm half-pitch, hence requiring double patterning.\\nPitch double-patterning was pioneered by Gurtej Singh Sandhu of Micron Technology during the 2000s, leading to the development of 30-nm class NAND flash memory. Multi-patterning has since been widely adopted by NAND flash and RAM memory manufacturers worldwide."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E7%B7%9A%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/%E6%97%A5%E6%B2%BB%E6%99%82%E6%9C%9F%E5%8F%B0%E5%8C%97%E4%B8%89%E7%B7%9A%E8%B7%AF.jpg","page_title":"三線路","context_page_description":"三線路，又稱為三線道路，是指台灣台北在日治時代初期興建的4條市區主幹道路，主要利用台北府城城垣拆除後的空間，在城牆原址上改築由安全島分隔成3個分隔道的道路，因而得名。其分為東南西北四段，依序大致等同於今之中山南路、愛國西路、中華路、忠孝西路。\\n三線路沿路設置行人步道，步道和安全島上種植樹木，因景觀秀麗而有「東方的小巴黎」之稱。而日本統治當局延續前清時期的規劃，將原台北城區域做為總督府、總督府法院、台銀總行、台電本社等高階政府機關及國策企業的中央辦公區，三線路除了是原台北城區域的邊界之外，也構成今日台北市區道路系統的最初骨幹。\\n1930年代，台灣興起自由戀愛的風氣，當時三線路人車稀少，是情侶約會散步的好地方；而台語流行音樂的著名作詞家周添旺所寫的《月夜愁》歌詞中，亦提及了年少女子於三線路等待無緣愛人的淒美故事，也反映那個時代的台灣社會狀況。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%99%D7%A8%D7%99%D7%AA_%D7%A1%D7%9E%D7%95%D7%A8%D7%99%D7%AA_%D7%A1%D7%99%D7%A0%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Chinese_Ferret-badger_area.png","page_title":"גירית סמורית סינית","context_page_description":"גירית סמורית סינית היא מין של גירית מהסוג גירית סמורית, החיה במזרח אסיה ביערות ואזורי מחיה שונים. היא נפוצה בהרבה מקרובות משפחתה לסוג ואיננה בסכנה. תחום מחייתה העיקרי היא סין ואזורים נוספים בדרום-מזרח אסיה מהודו עד ללאוס."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A2%D0%BC%D0%B8%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Carum_carvi.JPG","page_title":"Тмин","context_page_description":"Тмин – шатыршагүлділер тұқымдасына жататын шөптесін өсімдік. Еуразияда өсетін 30-ға жуық түрі белгілі. Қазақстанда бұлақтар мен өзендердің жағалауында, шалғынды жерлер мен бұталардың арасында, тау етегінен бастап субальпілік белдеулерге дейінгі аралықта өсетін 1 түрі – кәдімгі Тмин бар. Оның биіктігі 40 – 60 см. Кіндік тамыры жіңішке, ұршық тәрізді. Сабағы дара, іші қуыс, терең жолақты, аша сияқты бұтақталған. Жапырақтары жалаңаш, түп жағынан кеңейген сағақта орналасқан, олардың жапырақ тақтасы 6 – 8 жұп отырыңқы буындармен жалғасқан, жай немесе екі қайтара қауырсынды тарамдалған. Шатыршалары орамсыз немесе 1 – 2 түп жағындағы жапырақшалармен 5 – 11 сәулелі болып келеді. Сәулелерінің ішкілері сыртқыларынан қысқа, шатырларында 20-дай гүл болады. Күлтелері ақ түсті. Мамыр – маусым айларында гүлдеп, шілдеде жеміс салады. Жемісі жұмыртқа тәрізді. Тминнің шаруашылық үшін маңызы зор. Оның тұқымының құрамында 5,75%-дай эфир майлары болады. Тмин майы медицинада, ветеринарияда, сабын қайнатуда және тамақ өнеркәсібінде қолданылады. Майының қалдықтары құнды мал азығы – күнжара алу үшін пайдаланады."},{"page_url":"https://fr.wikipedia.org/wiki/Benjamin_Darbelet","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Darbelet.jpg","page_title":"Benjamin Darbelet","context_page_description":"Benjamin Darbelet, né le 13 novembre 1980 à Dijon, est un judoka français évoluant dans la catégorie des moins de 66 kg.\\nAyant commencé le judo à cinq ans, Benjamin Darbelet devient licencié du club dijonnais de l'Alliance Judo 21 et intègre l'INSEP. Il obtient le titre de vice-champion olympique en 2008 et détient plusieurs titres européens, mais n'a jamais réussi à monter sur le podium d'une compétition mondiale. Aux Jeux olympiques de 2004 à Athènes, il est éliminé au second tour par le futur médaillé de bronze sud-coréen Choi Min-Ho. Il doit cependant effectuer un régime contraignant pour participer à la compétition dans une catégorie de poids inférieure à la sienne puisque Larbi Benboudaoud lui est préféré comme titulaire en -66 kg.\\nUne nouvelle fois sur le podium européen et logiquement sélectionné au sein de l'équipe de France pour les Mondiaux 2007 de Rio, Darbelet est pourtant sanctionné par le comité disciplinaire de la Fédération française quelques semaines plus tard. Il lui était alors reproché de ne pas s'investir suffisamment dans son entraînement et dans sa préparation."},{"page_url":"https://uk.wikipedia.org/wiki/%D2%90%D0%B4%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Konstal_NGd99.JPG","page_title":"Ґданський трамвай","context_page_description":"Трамваї у Гданську — мережа трамваю, що працює у польському місті Гданськ. Мережа розпочала роботу 23 липня 1873 року."},{"page_url":"https://en.wikipedia.org/wiki/Bortoi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D1%81._%D0%91%D0%BE%D1%80%D1%82%D0%BE%D0%B9.jpg","page_title":"Bortoi","context_page_description":"Bortoi is a village in the Zakamensky district of Buryatia, Russia."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E5%B9%B3%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kodaira-station-north-gate_20200607.jpg","page_title":"小平駅","context_page_description":"小平駅は東京都小平市美園町一丁目にある、西武鉄道の駅である。駅番号はSS19。\\n新宿線と拝島線が乗り入れている。拝島線は当駅が起点であるが、拝島線からは新宿線西武新宿駅方面へ直通する列車が多数運行されている。\\n以前は隣の萩山駅で拝島線と交差する多摩湖線西武遊園地駅方面からの列車の大多数も、拝島線を経由して当駅まで乗り入れていた。2013年3月16日のダイヤ改正により当駅からの多摩湖線直通列車は大幅に削減されたが、車内放送での乗り換え案内はされている。"},{"page_url":"https://da.wikipedia.org/wiki/N%C3%B8rre_Asmindrup","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/N%C3%B8rre_Asmindrup_Skole.jpg","page_title":"Nørre Asmindrup","context_page_description":"Nørre Asmindrup er en stationsby i Nørre Asmindrup Sogn, på Nordvestsjælland med 635 indbyggere. Svinninge og Nørre Asmindrup var tidligere to byer i Nørre Asmindrup Sogn, men er i dag sammenvokset til en som fra 2012 kaldes Nørre Asmindrup. Byen ligger i Odsherred på Nordvestsjælland.\\nNørre Asmindrup består oprindelig af de to landsbyer Nr. Asmindrup og Svinninge, der med tiden er vokset sammen. Da Odsherredsbanen blev anlagt, blev stationen etableret ved Svinninge, men da der allerede fandtes en større stationsby ved navn Svinninge godt 15 km sydligere på Odsherredsbanen blev stationen navngivet Nørre Asmindrup Station og det nybyggede område omkring stationen blev officielt betegnet Nørre Asmindrup Stationsby. For at øge navneforvirringen blev stationsbyen lokalt også kaldt Svinninge Stationsby, skønt Svinninge Stationsby var den officielle betegnelse for den større stationsby længere sydpå."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Calhoun_County,_Michigan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/B_C_V_A_Building_1.jpg","page_title":"National Register of Historic Places listings in Calhoun County, Michigan","context_page_description":"The following is a list of Registered Historic Places in Calhoun County, Michigan.\\nThis National Park Service list is complete through NPS recent listings posted November 29, 2019."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%AB%E3%82%BF%E5%8C%85%E5%9B%B2%E6%88%A6_(1798%E5%B9%B4%E2%80%931800%E5%B9%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Nap_malta.jpg","page_title":"マルタ包囲戦 (1798年–1800年)","context_page_description":"マルタ包囲戦、ヴァレッタ包囲戦は、1798年から1800年にかけ、地中海のマルタの首都ヴァレッタとコットネラ要塞群のフランス守備隊をマルタ人民兵と反フランス連合軍が2年にわたり封鎖、包囲した戦い。マルタではフランス封鎖 とも呼ばれる。マルタは1798年にフランスのナポレオン・ボナパルトによって征服され、クロード＝アンリ・ベルグラン・ド・ヴァーボワ率いる3000人のフランス守備隊による占領統治が行われていた。しかし急進的な改革が反発を招き、3か月でマルタ住民の反乱を招いた。1798年8月1日にナイルの海戦でイギリス海軍がフランス地中海艦隊を撃滅したことで、イギリスもマルタの反乱を支援できるようになった。フランス守備隊はヴァレッタに籠城したが、イギリスの効果的な封鎖により深刻な食糧不足に陥った。1799年前半に一度は小規模な補給隊が到着したものの、その後1800年前半までは通行が完全に断たれ、飢餓状態の守備隊は健康と士気を損ない、戦える状態ではなくなっていった。\\n1800年2月、マルタを救出するべくジャン＝バティスト・ペレー海軍少将率いる大補給艦隊がトゥーロンを出港した。しかしこの船団は、飢えたマルタ守備隊の見えるところでホレーショ・ネルソン海軍少将率いるイギリス艦隊に捕捉された。ペレーは戦死して彼の旗艦も奪われ、輸送艦隊は一隻としてヴァレッタにたどり着けなかった。翌月、フランス戦列艦ギヨーム・テルがヴァレッタからトゥーロンを目指し包囲を突破しようとしたが、これも圧倒的な数のイギリス艦隊に捕捉され、激しい戦闘の末に降伏した。こうした内外からの救出・脱出の試みが失敗に終わり、もはやフランス守備隊の降伏は避けられなかった。それでもヴァーボワはその後5か月耐えた末に9月1日に降伏し、マルタはイギリスの支配下に入った。"},{"page_url":"https://es.wikipedia.org/wiki/Gonzalo_Galv%C3%A1n_Castillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Srgonzalo.jpg","page_title":"Gonzalo Galván Castillo","context_page_description":"Gonzalo Galván Castillo fue obispo de la diócesis de Autlán desde 2004 hasta 2015, cuando el papa Juan Pablo II trasladó al obispo Lázaro Pérez Jiménez a la diócesis de Celaya y designó como obispo de Autlán a mons. Gonzalo Galván Castillo. El jueves 25 de junio de 2015 fue aceptada su renuncia por el Papa Francisco como obispo de AutlanAnselmo Zarza Bernal\\nLa Secretaría General de la Conferencia del Episcopado Mexicano comunica que Su Santidad Francisco ha aceptado la renuncia al oficio de Obispo de Autlán, que S.E. Mons. Gonzalo Galván Castillo, en conformidad al canon 401 § 2 del Código de Derecho Canónico, había presentado en precedencia. Al mismo tiempo, el Santo Padre se ha dignado nombrar Administrador Apostólico a S.E. Mons. José Guadalupe MARTÍN RÁBAGO, actualmente Arzobispo Emérito de León.\\nLa noticia ha sido publicada en L’Osservatore Romano el día de hoy, jueves 25 de junio de 2015, a mediodía, tiempo de Roma.\\n​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D1%81%D0%B8%D0%BC%D0%B0_(%D0%BF%D1%80%D0%BE%D0%B2%D0%B8%D0%BD%D1%86%D0%B8%D1%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Japan_prov_map_Chishima.GIF","page_title":"Тисима (провинция)","context_page_description":"Провинция Тисима — историческая провинция Японии на Курильских островах и Сахалине, существовавшая в 1869—1882 годах. Соответствует современным Курильским островам севернее острова Кунашир, включая остров Шикотан и остров Сахалин."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%B1%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/PAZ_school_buses_Chisinau_02.jpg","page_title":"Павловский автобус","context_page_description":"«Па́вловский авто́бус» — советский и российский производитель автобусов малого и среднего классов. Расположен в городе Павлово Нижегородской области. Входит в группу ГАЗ, которая владеет 93,79 % акций.\\nПроизводство автобусов с 2005 года осуществляет ООО «ПАЗ» — 100%-я дочка ПАО «Павловский автобус». Это позволяет минимизировать обязательное раскрытие информации и отчётность по российским стандартам."},{"page_url":"https://cs.wikipedia.org/wiki/Lavinov%C3%BD_vyhled%C3%A1va%C4%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/LVS_Pieps_DSP.jpg","page_title":"Lavinový vyhledávač","context_page_description":"Lavinový vyhledávač je zařízení vyvinuté k nalezení člověka zasypaného lavinou. Pracuje na principu radiového přijímače a vysílače operujícího na celosvětově sjednocené frekvenci 457 kHz. Lavinový vyhledávač je často využíván při aktivitách zahrnující pohyb v lavinovém terénu, jako je skialpinismus, freeride, zimní turistika a podobně. Ve chvíli, kdy se uživatel chystá vstoupit do lavinového terénu, zařízení aktivuje, a to pak vysílá nízkoenergetické pulzy na dané frekvenci. V případě pádu laviny a zasypání jiného uživatele, a za předpokladu, že se sám nachází v bezpečí, pak zařízení přepne do módu vyhledávání, což znamená, že zařízení přestane vysílat a začne přijímat. Lavinový vyhledávač pak směruje uživatele do míst, odkud přichází signál jiného zařízení, a umožní tak zasypaného lokalizovat. Lavinový vyhledávač je aktivní zařízení, které pro své fungování potřebuje baterie. Ke stejnému účelu nalezení zasypaného pod lavinou, ale na odlišném principu, funguje i pasivní systém RECCO, jehož odrazky mohou být zašívány do lyžařského oblečení."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A1%D5%B2%D5%BF%D5%B6%D5%AB_%D5%AF%D5%A1%D5%A6%D5%B4%D5%A1%D5%AF%D5%A5%D6%80%D5%BA%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Secret_Society_Buildings_New_Haven.jpg","page_title":"Գաղտնի կազմակերպություն","context_page_description":"Գաղտնի կազմակերպություն, հասարակությունից իր իրական գործունեությունը թաքցնող մարդկանց միավորում: Նրանց անդամները թաքցնում են իրենց հստակ գործունեությունները այն դեմքերից, որոնք չեն վերաբերվում նրանց գործունեություններին ։Անդամները կարող են պարտադրված լինել պահպանել կամ հերքել իրենց անդամ լինելը և հաճախ երդում են տալիս պահպանել միավորման գաղտնիքները։\\"Գաղտնի կազմակերպություն\\" տերմինը հաճախ օգտագործվում է, որպեսզի նկարագրեն եղբայրական կազմակերպությունները, որոնք կարող են անցկացնել գաղտնի ծեսեր, բայց կարող են կիրառվել նաև այնպիսի ոչ լուրջ կազմակերպություններ ինչպես՝ համալսարանական եղբայրություն ։\\nԳաղտնի միավորումը ֆունկցիոնալ հարաբերություններում դա սոցիալական կազմակերպության ձև է, չներառվող գերակշռող սոցիալական կառուցվածքի մեջ, որը կապված է այն նպատակների հետ, որոնք իրենց առաջ դնում են գաղտնի կազմակերպությունները, ․օրինակ՝այդպիսի նպատակ կարող է լինել ժամանակակից քաղաքական համակարգերի զարգացման մարտավարական պոտենցիալի փոփոխումը, որտեղ երկարաժամկետ ծրագրերի իրականացումը, նախատեսված տասնամյակների կամ էլ նույնիսկ հարյուրամյակների համար, դառնում է անհնարին։"},{"page_url":"https://nl.wikipedia.org/wiki/Seelze","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Wappen_Seelze.png","page_title":"Seelze","context_page_description":"Seelze is een gemeente in de Duitse deelstaat Nedersaksen. De plaats maakt als selbständige Gemeinde deel uit van de Region Hannover.\\nSeelze telt 34.442 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Hesdigneul-l%C3%A8s-B%C3%A9thune","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Mairie_d%27Hesdigneul-l%C3%A8s-B%C3%A9thune.JPG","page_title":"Hesdigneul-lès-Béthune","context_page_description":"Hesdigneul-lès-Béthune est une commune française située dans le département du Pas-de-Calais en région Hauts-de-France."},{"page_url":"https://en.wikipedia.org/wiki/First_Battle_of_al-Faw","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Operation_Valfajr-8.png","page_title":"First Battle of al-Faw","context_page_description":"The First Battle of al-Faw was a battle of the Iran–Iraq War, fought on the al-Faw Peninsula between 10 February and 10 March 1986. The Iranian operation is considered to be one of Iran's greatest achievements in the Iran–Iraq War. The Iranians were able to capture the al-Faw Peninsula, cutting off Iraqi access to the Persian Gulf in the process; this in turn hardened Iraqi attitudes to prosecute the war. The Faw Peninsula was later recaptured by Iraqi forces near the end of the war by the massive and illegal use of chemical weapons.\\nOn February 9 1986, Iran launched Operation Dawn 8, a sophisticated and carefully planned amphibious assault across the Shatt al-Arab river against the Iraqi troops defending the strategic al-Faw Peninsula, which connects Iraq to the Persian Gulf. The Iranians defeated the Iraqi defenders, mostly Iraqi Popular Army, capturing the tip of the peninsula, including Iraq's main air control and warning center covering Persian Gulf, as well as limiting Iraq's access to the ocean."},{"page_url":"https://fr.wikipedia.org/wiki/Kunde","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Khunde-06-Tor-2007-gje.jpg","page_title":"Kunde","context_page_description":"Kunde est un village situé dans la région de Khumbu au Népal, dans le Parc national de Sagarmatha."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Cattle_poison.jpg","page_title":"Гербологія","context_page_description":"Герболо́гія — наука, що вивчає біологічні особливості бур'янів, їх поширення, видовий склад, рясність у складі агрофітоценозів та розробляє методи регулювання рівня їх присутності та шкодочинності\\nГербологія тісно пов'язана з іншими науками: ботанікою, агрофітоценологією, землеробством, рослинництвом, овочівництвом та іншими.\\nОб'єктом вивчення гербології є сегетальна та рудеральна рослинність і система заходів по регулювання їх рівня присутності в складі культурфітоценозів.\\nПредметом вивчення є функції та функціональні зв'язки бур'янового компоненту в агрофітоценозах і їх зміна під впливом різних заходів регулювання.\\nОсновні розділи гербології:\\nнаукові основи гербології;\\nсегетальна і рудеральна рослинність;\\nсистеми контролювання бур'янового компоненту."},{"page_url":"https://ro.wikipedia.org/wiki/Proverbele_olandeze_(pictur%C4%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/NP-110.jpg","page_title":"Proverbele olandeze (pictură)","context_page_description":"Proverbele olandeze este o pictură în ulei pe stejar realizată de Pieter Bruegel cel Bătrân în 1559, care prezintă o scenă în care oamenii și, la o scară mai mică, animalele și obiectele, oferă ilustrații literare ale proverbelor și idiomelor din limba olandeză.\\nTemele derulate în tablourile lui Bruegel sunt absurdul, răutatea și prostia oamenilor, iar aceasta nu face excepție. Titlul original al tabloului, Mantia albastră sau Nebunia lumii, indică faptul că intenția lui Bruegel nu a fost doar să ilustreze proverbe, ci să catalogheze nebunia umană. Multe dintre persoanele înfățișate arată atributele necizelate pe care Bruegel le-a folosit pentru a înfățișa nebunia și prostia.\\nFiul său, Pieter Brueghel cel Tânăr, s-a specializat în realizarea de copii ale operei tatălui său și a pictat cel puțin 16 exemplare ale Proverbelor olandeze. Nu toate versiunile tabloului, realizate de tată sau de fiu, arată exact aceleași proverbe și diferă și în alte detalii minore."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%8F%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Corydalis_ochroleuca0.jpg","page_title":"Ряст","context_page_description":"Ряст — рід переважно багаторічних зіллястих рослин з родина руткових з підземними шишками-бульбами або бульбами з розгалуженим коренем.\\nКвітки в ґронах."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88_%D9%87%D8%A7%D8%BA%D8%B1%D8%AA%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Joe_H%40ggerty.jpg","page_title":"جو هاغرتي","context_page_description":"جو هاغرتي ‏ هو طبال أمريكي، ولد في 23 يوليو 1967."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B0%D0%B2%D0%BD%D1%8C%D0%BE%D1%80%D0%B8%D0%BC%D1%81%D1%8C%D0%BA%D0%B0_%D0%B0%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Rome.Porta_Maggiore.jpg","page_title":"Давньоримська архітектура","context_page_description":"https://discord.gg/HSJSjC\\nДавньоримська архітектура запозичила зовнішні вирази класичної давньогрецької архітектури для цілей давніх римлян, які настільки сильно відрізнялись від грецьких будівель, що створили новий архітектурний стиль. Ці два стилі часто вважаються єдиним цілим класичної архітектури. Римська архітектура розквітла в часи Римської республіки та ще більше в часи імперії, коли була збудована більшість вцілілих будівель та споруд. Вона використовувала нові матеріали, зокрема бетон, та новіші технології, напр. арки та куполи, для створення будівель, що були міцними та добре-спроектованими. По всі території колишньої Римської імперії збереглася значна кількість будівель, деякі з них в цілому вигляді та досі використовуються.\\nДавньоримська архітектура охоплює період від заснування Римської республіки 509 р.до н. е. до бл. 4 ст. н. е., після чого вона вже класифікується як Пізня Античність або архітектура Візантійської імперії відповідно. Майже не збереглося значущих зразків архітектури, створених раніше 100 р. до н. е., а переважна більшість з найбільш значущих зразків — з період пізньої імперії, після 100 р.н. е."},{"page_url":"https://ceb.wikipedia.org/wiki/Cekov","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Cekov_uObu.JPG","page_title":"Cekov","context_page_description":"Lungsod ang Cekov sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Plzeňský kraj, sa sentro nga bahin sa nasod, 60 km sa habagatan-kasadpan sa Prague ang ulohan sa nasod. 465 metros ibabaw sa dagat kahaboga ang nahimutangan sa Cekov, ug adunay 118 ka molupyo.\\nAng yuta palibot sa Cekov kay kabungtoran sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang patag. Kinahabogang dapit sa palibot ang Sirská hora, 593 ka metros ni kahaboga ibabaw sa dagat, 2.7 km sa kasadpan sa Cekov. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Cekov. Ang kinadul-ang mas dakong lungsod mao ang Rokycany, 15.0 km sa habagatan-kasadpan sa Cekov. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Cekov. Sa rehiyon palibot sa Cekov, mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Disyembre, sa -6 °C. Ang kasarangang pag-ulan 983 milimetro matag tuig. Ang kinabasaan nga bulan Agosto, sa 134 milimetro nga ulan, ug ang kinaugahan Marso, sa 30 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Raban_Truchse%C3%9F_von_Wilburgstetten","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Raban_Truchse%C3%9F_v._Wilburgstetten_aus_dem_Gundekarianum.jpg","page_title":"Raban Truchseß von Wilburgstetten","context_page_description":"Raban Truchseß von Wilburgstetten est prince-évêque d'Eichstätt de 1365 à sa mort."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B3%D0%BD%D1%96%D1%82%D0%BD%D0%B0_%D1%81%D0%BF%D1%80%D0%B8%D0%B9%D0%BD%D1%8F%D1%82%D0%BB%D0%B8%D0%B2%D1%96%D1%81%D1%82%D1%8C_%D0%B3%D1%96%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D1%85_%D0%BF%D0%BE%D1%80%D1%96%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/uk/c/c4/%D0%9C%D0%B0%D0%B3%D0%BD.%D1%81%D0%BF%D1%80%D0%B8%D0%B9%D0%BD%D1%8F%D1%82.png","page_title":"Магнітна сприйнятливість гірських порід","context_page_description":"Магнітна сприйнятливість гірських порід — характеризує здатність гірських порід до намагнічення під дією магнітного поля. Визначається головним чином вмістом включень феромагнітних мінералів.\\nПитома магнітна сприйнятливість деяких мінералів\\n10⁻⁷ м³/кг\\nСильномагнітні породи:\\nМагнетит — Fe₃O₄; — 6300—12000\\nМаґгеміт — Fe₂О₃ — 5000—6000\\nТитаномагнетит — Fe(Fe³⁺, Ti)₂O₄ — 3000—4000\\nПіротин — Fe¹⁻ˣS — 63—570\\nМартит — Fe₂O₃ — 70—90\\nСлабомагнітні\\nГематит — Fe₂O₃ — 20—30\\nЛімоніт — Fe₂O₃·nH₂О — 2 — 3\\nСидерит — FeCO₃ — 6 — 7\\nІльменіт — TiO₃ — 14—34\\nМанґаніт — MnO₂·Mn(OH)₂ — До 6,3\\nПіролюзит — MnO₂ — До 4\\nВольфраміт — WO₄ — 8—12\\nДоломіт — CaMg(CO₃)₂ — До 3,4\\nНемагнітні\\nКварц — SiO₂ —0,025\\nПольовий шпат — [AlSi₃O₈] — 0,630\\nАпатит — Са₅₃ — 0,126\\nПірит — FeS₂ — 0,126\\nРутил — TiO₂ — 0,250\\nНа величину М.с. впливає також форма і розмір зерен феромагнітних мінералів, розташування зерен один відносно одного. Для г.п. найістотніше значення має початкова М.с. Загалом найбільш високими значеннями М.с. характеризуються залізисті кварцити. У інтрузивних гірських породах, де вміст оксидів заліза зростає при збільшенні основності, М.с. збільшується від кислих до основних."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B0%D0%B9%D1%82,_%D0%9C%D0%B5%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Meg_White_1.jpg","page_title":"Уайт, Мег","context_page_description":"Меган Марта «Мег» Уайт — американская барабанщица, известная как участница рок-группы The White Stripes."},{"page_url":"https://sh.wikipedia.org/wiki/1842","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Janko_Dra%C5%A1kovi%C4%87_Litho.jpg","page_title":"1842","context_page_description":"Godina 1842. bila je redovna godina koja počinje u subotu po gregorijanskom, odn. redovna godina koja počinje u četvrtak po 12 dana zaostajućem julijanskom kalendaru."},{"page_url":"https://ro.wikipedia.org/wiki/R%C3%A2ul_Sava","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Korso_slavonski_brod.jpg","page_title":"Râul Sava","context_page_description":"Sava este un râu în Europa Centrală și de Sud-Est, afluent pe dreapta al Dunării. Curge prin Slovenia, Croația, de-a lungul frontierei nordice a Bosniei și Herțegovinei, și prin Serbia, vărsându-se în Dunăre la Belgrad. Partea sa centrală formează frontiera naturală între Bosnia-Herțegovina și Croația. Sava formează limita nordică a Peninsulei Balcanice, și marginea sudică a Câmpiei Panonice. Sava are 990 km, inclusiv 45 km ai afluentului Sava Dolinka ce izvorăște la Zelenci, Slovenia. Este cel mai mare afluent al Dunării după volum de apă, și al doilea după Tisa ca suprafață a bazinului hidrografic și lungime. Drenează o parte semnificativă a regiunii Alpilor Dinarici, prin principalii afluenți Drina, Bosna, Kupa, Una, Vrbas, Lonja, Kolubara, Bosut și Krka. Sava este unul dintre cele mai lungi râuri din Europa și printre puținele râuri europene de acea lungime care nu se varsă direct în mare.\\nPopulația bazinului hidrografic al Savei este estimată la 8.176.000, râul legând trei capitalele naționale—Ljubljana, Zagreb și Belgrad. Sava este navigabilă pentru nave mai mari de la confluența Râului Kupa de la Sisak, Croația, pe aproximativ două treimi din lungimea sa."},{"page_url":"https://en.wikipedia.org/wiki/Howard_Cook","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Cookfresco1.JPG","page_title":"Howard Cook","context_page_description":"Howard Norton Cook was an American artist, particularly known for his wood engravings and murals. Cook spent much of the 1920s in Europe and returned to live in Taos, New Mexico.\\nCook first came to Taos, New Mexico in 1926 commissioned by The Forum to make a series of woodcuts to illustrate Death Comes for the Archbishop that would be published serially in the periodical. In Taos he was introduced to artist Barbara Latham by Victor Higgins. The couple married in May 1927. From 1928 to 1935, they traveled: to Europe, Mexico and the American South. Working for New Deal art projects, Cook produced murals for courthouses in Pittsburgh and Springfield, Massachusetts. He also produced a 16-panel fresco, The Importance of San Antonio in Texas History, in a San Antonio post office, for which he was paid $12,000 in 1937. In 1938, the couple settled near Taos on the Talpa ridge. This became their base until 1976. During World War II, Cook was an artist for the US Navy. In 1943 he was appointed Leader of a War Art Unit and served in the Solomon Islands in the Asiatic-Pacific Theater.\\nIn 1967, Cook became the first artist in the Roswell Museum and Art Center's Artist-in-Residence program."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_r%C3%A9giments_de_l%27Arm%C3%A9e_de_terre_italienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/CoA_mil_ITA_rgt_trasmissioni_32.png","page_title":"Liste des régiments de l'Armée de terre italienne","context_page_description":"La liste des régiments de l'armée de terre italienne"},{"page_url":"https://la.wikipedia.org/wiki/Horgues","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%C3%89glise_Saint-Mauront_de_Horgues_%2865%29.JPG","page_title":"Horgues","context_page_description":"Horgues est commune Francicum 1'143 incolarum praefecturae Pyrenaei Superioris in regione australi Meridiano et Pyrenaeis."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9B%85%E8%BE%BE%E5%88%A9%E6%B8%B8%E6%88%8F%E6%8E%A9%E5%9F%8B%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Otero_County_New_Mexico_Incorporated_and_Unincorporated_areas_Alamogordo_Highlighted.svg","page_title":"雅达利游戏掩埋事件","context_page_description":"雅达利游戏掩埋事件是美国电子游戏和个人电脑制造商雅达利在新墨西哥州堆填区掩埋大量滞销的游戏卡带、主机和计算机的事件。到2014年，已挖掘出的游戏卡带包括无论是商业口碑都极其失败的《E.T. 外星人》以及商业表现稍好的雅达利2600版《吃豆人》。\\n自掩埋事件首次见诸报端，人们就一度怀疑事件的真实性和发生地，而使事件演变成为都市传说。因此，该事件成为了文化印记和1983年美国游戏业大萧条的代表事件。因为年度财政出现严重赤字，雅达利被华纳通讯抛弃，最终以这次掩埋事件划下了休止符。尽管据称有数百万份《E.T.外星人》被弃置于堆填区，但雅达利的工作人员后来证实被销毁的各大游戏卡带数目约70万盒，包括《E.T.外星人》在内。\\n2014年，Fuel Industries、微软等公司联合新墨西哥州政府挖掘堆填区，验证填埋场的物品，过程收录于纪录片《雅达利：游戏结束》。4月26日挖掘出了遭到废弃的游戏和硬件，但仅有约1300份，占掩埋总量的冰山一角。卡带的去向有二，小部分用于策展，大部分被拍卖以帮助筹建纪念性质的博物馆。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D1%81%D1%84%D0%B5%D0%BB%D1%8C%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Orsfeld_Weilerweg_Katholische-Filialkirche-St-Peter.jpg","page_title":"Орсфельд","context_page_description":"Орсфельд — коммуна в Германии, в земле Рейнланд-Пфальц.\\nВходит в состав района Айфель-Битбург-Прюм. Подчиняется управлению Кильбург. Население составляет 152 человека. Занимает площадь 5,17 км². Официальный код — 07 2 32 101."},{"page_url":"https://hu.wikipedia.org/wiki/P-fenil%C3%A9n-diamin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Kevlar_chemical_structure_H-bonds.svg","page_title":"P-fenilén-diamin","context_page_description":"A para-fenilén-diamin vagy 1,4-fenilén-diamin, röviden PPD egy szerves molekula, képlete C₆H₄(NH₂)₂. Ez az anilinszármazék egy fehér por, de levegőn állva az oxidáció hatására sötétül. Főként műszaki polimerek gyártásának alapanyagaként használatos, de felhasználják hajfestékekben is."},{"page_url":"https://nl.wikipedia.org/wiki/Svanninge","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Svanninge_Kirke_2.jpg","page_title":"Svanninge","context_page_description":"Svanninge is een plaats in de Deense regio Zuid-Denemarken, gemeente Faaborg-Midtfyn. De plaats telt 231 inwoners."},{"page_url":"https://ceb.wikipedia.org/wiki/Hadrobregmus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Hadrobregmus_pertinax_bl.jpg","page_title":"Hadrobregmus","context_page_description":"Henero sa mga bakukang ang Hadrobregmus. Ang Hadrobregmus sakop sa kabanay nga Anobiidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Vladimir_Rusalov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Rusalov-co.jpg","page_title":"Vladimir Rusalov","context_page_description":"Vladimir Mikhaylovich Rusalov - Russian psychologist and anthropologist who was first to develop a temperament model within the Activity-specific approach. He is best known for his work in psychology of personality, temperament and differential psychophysiology."},{"page_url":"https://sv.wikipedia.org/wiki/Curling_vid_olympiska_vinterspelen_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Anna_Le_Moine-1.png","page_title":"Curling vid olympiska vinterspelen 2010","context_page_description":"Curling vid olympiska vinterspelen 2010 arrangerades mellan den 16 och 27 februari 2010 i Vancouver Olympic/Paralympic Centre i Vancouver, Kanada. Curling spelas för femte gången i olympiska sammanhang efter att tidigare ha spelats 1924, 1998, 2002 och 2006. Tävlingen hade samma upplägg som vid OS i Turin 2006. Tio lag möttes i en alla-möter-alla-turnering som följdes av två semifinaler dit de fyra bästa lagen avancerade. Lag Anette Norberg på damsidan och lag Kevin Martin på herrsidan tog OS-guld i turneringen."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_maires_d%27H%C3%A9nin-Beaumont","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Raismes_-_Meeting_de_Marine_Le_Pen_le_16_octobre_2015_sur_l%27%C3%A9lection_r%C3%A9gionale_en_Nord-Pas-de-Calais-Picardie_%2828%29_%28cropped_2%29.JPG","page_title":"Liste des maires d'Hénin-Beaumont","context_page_description":"Cet article dresse une liste par ordre de mandat des maires d'Hénin-Beaumont."},{"page_url":"https://en.wikipedia.org/wiki/The_Hydrostone","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Hydrostone_market_Halifax.JPG","page_title":"The Hydrostone","context_page_description":"The Hydrostone is a neighbourhood in the North End of the Halifax Peninsula in the Halifax Regional Municipality, Nova Scotia, Canada. It consists of ten short parallel streets and is bordered by Duffus Street to the north, Young Street to the south, Isleville Street to the west and Novalea Drive to the east.\\nThe neighbourhood was designed by architect Thomas Adams to provide housing for working-class families displaced by the Halifax Explosion in 1917. Architectural design was by George Ross of the Montreal architectural firm of Ross and Macdonald. The neighbourhood draws its name from the special cinderblocks from which the houses were constructed. Most of the dwellings are row-houses in groups of four and six, except for the large, two-storey single-family houses at the eastern end of each street. Some have been converted to sets of flats.\\nAll of the streets in the Hydrostone are boulevards except Stanley Place. These boulevards have treed, grassy strips which serve as communal outdoor space for the neighbourhood. This is consistent with the Garden city movement by which Adams was influenced."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B0%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B2%D1%96%D1%82%D1%80%D1%8F%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/De_Valk_Leiden.jpg","page_title":"Шатровий вітряк","context_page_description":"Шатровий вітряк чи голландський вітряк, розм. шатровка — різновид вітряка, в якого обертається не весь корпус, а тільки верхня частина, де розташований вал з крилами. Походять шатрові вітряки з Нідерландів і Північної Німеччини. На території Російської імперії були поширені на великоросійських і білоруських землях, у Прибалтиці, а на території сучасної України прижилися місцями в сучасних Чернігівській, Київській, Житомирській, Рівненській, Запорізькій областях. Пізніше в Україні були поширені розроблені Володимиром Стрільцем на початку 50-х років ХХ століття шатрові вітряки типу Д-15, конструктивно прості у виготовленні, з добрими показниками потужності, ефективності, надійності та економії виробничих матеріалів."},{"page_url":"https://fr.wikipedia.org/wiki/Osmia_cornuta","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Osmia_cornuta-aile1.png","page_title":"Osmia cornuta","context_page_description":"L’osmie cornue est une espèce d'abeilles sauvages, présente dans toute l'Europe.\\nElle est l'une des nombreuses espèces d'abeilles solitaires.\\nCette espèce a disparu de la plupart des zones d'agriculture intensive, mais elle survit bien dans certaines zones urbaines, dans les friches, les parcs publics et les zones de jardins notamment."},{"page_url":"https://it.wikipedia.org/wiki/Monti_Daxue","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Hailuogou_glacier.JPG","page_title":"Monti Daxue","context_page_description":"I monti Daxue, noti anche come Alpi del Sichuan o monti Sino-Tibetani, sono una grande catena montuosa situata nella parte occidentale della provincia del Sichuan. Estremamente alti e molto impervi, questi monti si formarono attorno al fianco orientale dell'antico blocco stabile dell'altopiano del Tibet; la loro formazione avvenne nel corso di successivi corrugamenti che ebbero luogo durante la fase finale del processo orogenetico del Giurassico, nonché durante il Cretaceo e durante l'orogenesi himalayana che avrebbe avuto luogo successivamente. Un po' in tutta la regione montuosa, rocce metamorfiche, scisti, quarziti e calcari metamorfici sono le formazioni rocciose predominanti, alle quali si aggiungono vaste intrusioni di graniti. La catena costituisce una parte della vasta cintura di corrugamenti che prosegue verso sud nell'Asia sud-orientale. L'area subì ulteriori sollevamenti durante il Quaternario.\\nI monti Daxue non sono costituiti da un'unica catena, ma da una serie di catene disposte con andamento nord-sud bagnate da una serie di affluenti dello Yangtze che scorrono da nord a sud. I più importanti tra questi fiumi sono lo Yalong a ovest dei monti e il Dadu a est."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%96%D0%B4_%D0%9B%D1%96%D0%BD%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD%D0%BE%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/BattleOf_Lincoln.jpg","page_title":"Битва під Лінкольном","context_page_description":"Битва під Лінкольном — одна з найважливіших битв громадянської війни в Англії 1135—1154 років між прибічниками короля Стефана та імператриці Матильди. Армія Стефана була розбита, а сам король потрапив у полон, що дозволило Матильді захопити владу в Англії."},{"page_url":"https://ru.wikipedia.org/wiki/Tesla_Model_S","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Tesla-charging-iec-type-2-outlet-tesla02-outlet.jpg","page_title":"Tesla Model S","context_page_description":"Tesla Model S — пятидверный электромобиль производства американской компании Tesla. Прототип был впервые показан на Франкфуртском автосалоне в 2009 году; поставки автомобиля в США начались в июне 2012 года."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%94%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%94%E1%83%A0%E1%83%9D%E1%83%95%E1%83%9C%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%99%E1%83%9D%E1%83%A0%E1%83%9E%E1%83%A3%E1%83%A1%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/TITUS_Text_Retrieval.jpg","page_title":"ქართული ენის ეროვნული კორპუსი","context_page_description":"ქართული ენის ეროვნული კორპუსი — ვირტუალური სივრცე, რომელიც მოიცავს ქართული ენის ისტორიული არსებობის განმავლობაში შექმნილი წერილობით ძეგლებსა და ქართული ენის ზეპირმეტყველების გაციფრებულ რესურსებს და საშუალებას აძლევს მომხმარებელს, გამოიყენოს იგი ლინგვისტური და ინტერდისციპლინარული - როგორც დიაქრონიული, ისე სინქრონული - კვლევებისათვის. ქართული ენის ეროვნული კორპუსი შეიქმნა საერთაშორისო სამეცნიერო პროექტების ფარგლებში გერმანელი და ქართველი მეცნიერების თანამშრომლობის შედეგად."},{"page_url":"https://en.wikipedia.org/wiki/Drum_kit","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Jimi_Hendrix_Experience_in_Fenklup.png","page_title":"Drum kit","context_page_description":"A drum kit — also called a drum set, trap set, or simply drums — is a collection of drums and other percussion instruments, typically cymbals, which are set up on stands to be played by a single player, with drumsticks held in both hands, and the feet operating pedals that control the hi-hat cymbal and the beater for the bass drum. A drum kit consists of a mix of drums and idiophones – most significantly cymbals, but can also include the woodblock and cowbell. In the 2000s, some kits also include electronic instruments. Also, both hybrid and entirely electronic kits are used.\\nA standard modern kit, as used in popular music and taught in music schools, contains:\\nA snare drum, mounted on a stand, placed between the player's knees and played with drum sticks\\nA bass drum, played by a pedal operated by the right foot, which moves a felt-covered beater\\nTwo or more toms, played with sticks or brushes.\\nA hi-hat, played with the sticks, opened and closed with left foot pedal\\nOne or more cymbals, mounted on stands, played with the sticks"},{"page_url":"https://en.wikipedia.org/wiki/Farrand_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Farrand_Hall.png","page_title":"Farrand Hall","context_page_description":"Farrand Hall is a private house located at 58522 Farrand Road in Colon, Michigan. It was listed on the National Register of Historic Places in 1972."},{"page_url":"https://fr.wikipedia.org/wiki/Cit%C3%A9_de_l%27Enfance_%C3%A0_Marcinelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Marcinelle_-_Cit%C3%A9_de_l%27enfance_-_03_-_pavillon_d%27entr%C3%A9e.jpg","page_title":"Cité de l'Enfance à Marcinelle","context_page_description":"La Cité de l'Enfance à Marcinelle, section de la ville belge de Charleroi, est un ancien orphelinat de type pavillonnaire bâti en 1938 sur un terrain arboré de plus de 5 ha. Il se compose d'une vingtaine de bâtiments à étage en briques rouges et ocre sous une toiture plate. De larges baies rectangulaires à encadrement en grès blanc éclairent les pièces d'habitations."},{"page_url":"https://pl.wikipedia.org/wiki/Mosty_Solidarno%C5%9Bci_w_Bydgoszczy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bdg_mostySolidarnosci_6_07-2013.jpg","page_title":"Mosty Solidarności w Bydgoszczy","context_page_description":"Mosty Solidarności – sześć mostów, w tym cztery drogowe i dwa tramwajowe, żelbetowe, sprężone na rzece Brdzie i Młynówce, powyżej Starego Miasta w Bydgoszczy. Mają trzy pasma ruchu: dwa drogowe i tramwajowe, obsługując komunikację na kierunku wschód-zachód w ciągu ulicy Ferdynanda Focha."},{"page_url":"https://en.wikipedia.org/wiki/Dja_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Les_chutes_d%27eau_de_la_Vina_%C3%A0_Ngaound%C3%A9r%C3%A9.jpg","page_title":"Dja River","context_page_description":"The Dja River is a stream in west-central Africa. It forms part of Cameroon–Republic of Congo border and has a course of roughly 720 kilometres.\\nRising southeast of the southeastern Cameroon town of Abong-Mbang, the Dja Faunal Reserve, which was named a UNESCO World Heritage Site in 1987, lies along the banks of its upper course. It protects one of the largest tracts of tropical rainforest in Africa. Forming its natural boundary, and almost completely encircling the reserve, cliffs run along the course of the river in the south part of the reserve for 60 km and are associated with a section of the river which is broken by rapids and waterfalls.\\nFollowing its course in the reserve, the Dja flows approximately southeast past Moloundou, below which small boats can navigate. At Ouesso, in the Republic of Congo, it empties into the Sangha River.\\nEvery year, poachers travel up the Dja for central Nki National Park, where elephant ivory is abundant.\\nStrong currents on the river are a deterrent for half the year, but after that, according to freelance journalist Jemini Pandya, the fauna is easy to prey upon."},{"page_url":"https://nl.wikipedia.org/wiki/Spoorlijn_W%C3%B6rth_-_Lauterbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Bahnhof_W%C3%B6rth%2C_Gleisanlagen%2C_Blick_nach_Westen.JPG","page_title":"Spoorlijn Wörth - Lauterbourg","context_page_description":"De spoorlijn Wörth - Lauterbourg ook wel Bienwaldbahn genoemd is een Duitse spoorlijn is als spoorlijn 3400 onder beheer van DB Netze."},{"page_url":"https://fr.wikipedia.org/wiki/Fort_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/FortHallMarker.jpg","page_title":"Fort Hall","context_page_description":"Fort Hall a été construit en 1834 par l'explorateur Nathaniel Jarvis Wyeth sur la piste de l'Oregon, sur le bord de la rivière Snake au sud de l'Idaho. C'est un point de passage important, qui a été inclus dans la réserve indienne de Fort Hall. C'est l'endroit où la piste venant de l'est se sépare soit vers le nord-ouest vers l'Oregon, soit vers le sud-ouest vers la Californie.\\nIl a été classé en tant que site national historique."},{"page_url":"https://sv.wikipedia.org/wiki/Puerto_Quito_(ort)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Escudo_Puerto_Quito.jpg","page_title":"Puerto Quito (ort)","context_page_description":"Puerto Quito är en ort i Ecuador. Den ligger i provinsen Pichincha, i den nordvästra delen av landet, 90 km nordväst om huvudstaden Quito. Puerto Quito ligger 218 meter över havet och antalet invånare är 3 080.\\nTerrängen runt Puerto Quito är kuperad åt sydost, men åt nordväst är den platt. Den högsta punkten i närheten är 334 meter över havet, 1,3 km öster om Puerto Quito. Runt Puerto Quito är det glesbefolkat, med 17 invånare per kvadratkilometer. Det finns inga andra samhällen i närheten. I omgivningarna runt Puerto Quito växer i huvudsak städsegrön lövskog.\\nÅrsmedeltemperaturen i trakten är 20 °C. Den varmaste månaden är november, då medeltemperaturen är 22 °C, och den kallaste är januari, med 18 °C. Genomsnittlig årsnederbörd är 2 266 millimeter. Den regnigaste månaden är mars, med i genomsnitt 443 mm nederbörd, och den torraste är september, med 25 mm nederbörd."},{"page_url":"https://ms.wikipedia.org/wiki/Giverville","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Giverville_ch%C3%A2teau_front.jpg","page_title":"Giverville","context_page_description":"Giverville ialah komun di jabatan Eure di Haute-Normandie di utara Perancis."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bad_Berleburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/032_Tiergartenstr._10.jpg","page_title":"Liste der Baudenkmäler in Bad Berleburg","context_page_description":"Die Liste der Baudenkmäler in Bad Berleburg enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Bad Berleburg im Kreis Siegen-Wittgenstein in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Bad Berleburg eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%88%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B8_%D0%9F%D0%B0%D1%80%D0%BA_(%D0%9C%D0%B5%D1%80%D0%B8%D0%BB%D0%B5%D0%BD%D0%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/UniversityParkMDTownHall.JPG","page_title":"Јуниверсити Парк (Мериленд)","context_page_description":"Јуниверсити Парк град је у америчкој савезној држави Мериленд."},{"page_url":"https://fy.wikipedia.org/wiki/Rak_fan_Ungemak_(Boarn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/RakFanUngemak.svg","page_title":"Rak fan Ungemak (Boarn)","context_page_description":"It Rak fan Ungemak is it part fan de Boarn, by Jirnsum lâns. It werklike rak fan ûngemak is de meänder fan de Boarn eastlik fan Jirnsum, mar offisjeel wurdt it hiele stik fan it Jirnsummersyl oant Aldskou mei dy namme oanjûn.\\nOant 1200 rûn de Boarn op dit stik nei it noarden, dan kaam de Grou derby, en dan rûn it wetter foarby Raerd nei de Middelsee, dêr wêr't no de Mûzel leit. Doe't eartiids it polderjen fan de Middelsee de mûning fan de Boarn berikt hie, hat men súdlik fan Jirnsum in wjittering, de Alde Wjittering groeven, dat it wetter fan de Boarn nei de Snitser Mar fuortkomme koe. Sûnt dy tiid rûn it wetter fan de Boarn by Jirnsum krekt de oare kant út. It wie wetter dat fan de Grou út nei it suden nei de Alde Wjittering rûn.\\nDy ôfwettering fan de Grou wie wichtich om't in grut part fan Eastergoa dêrtroch ôfwettere. Mar it nivoferskil wie sa lyts dat der, doe't de ferbining mei de Middelsee noch iepen wie, oan de noardkant fan Jirnsum it Jirnsummersyl wie; in syl om foar te kommen dat by heech wetter yn de Wâlden it wetter de Grou ýn rinne soe, in stee fan út."},{"page_url":"https://da.wikipedia.org/wiki/Simone_Young","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Simone_Young_2010_-_Portrait_by_Bertold_Fabricius.jpg","page_title":"Simone Young","context_page_description":"Simone Margaret Young er en australsk dirigent. Hun blev født i Sydney. Hendes far har irske rødder og hendes mor kroatiske. Young blev uddannet på Monte Sant'Angelo Mercy College. Hun studerede komposition, klaver og direktion ved Sydneys musikkonservatorium.\\nHun var kunstnerisk leder ved Bergen filharmoniske orkester fra 1999 til 2002, hvor hun afløste Dmitrij Kitajenko."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B9%CE%BB_%CE%A0%CE%B9%CF%81%CF%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Neil-Peart.jpg","page_title":"Νιλ Πιρτ","context_page_description":"Ο Νιλ Πιρτ ήταν Καναδός μουσικός, γνωστός ως ντράμερ του hard rock συγκροτήματος Rush. Θεωρείται ένας από τους σπουδαιότερους ντράμερ της ροκ μουσικής και εκτός από τον μουσικό τομέα έχει ασχοληθεί και με τη λογοτεχνία, έχοντας γράψει πέντε βιβλία."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%A4%E3%81%B0%E3%82%81_(JR%E4%B9%9D%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/JRkyusyu_787_tsubame_9cars_kumoha.jpg","page_title":"つばめ (JR九州)","context_page_description":"つばめは、九州旅客鉄道が主に九州新幹線の博多駅 - 鹿児島中央駅間で運行している特別急行列車の愛称である。このうち一部の列車は西日本旅客鉄道山陽新幹線に乗り入れる。\\n本項では、1992年から九州新幹線開業までの間、鹿児島本線博多駅 - 西鹿児島駅で運行されていた在来線特急「つばめ」、ならびに九州新幹線部分開業時に新幹線「つばめ」に接続していた在来線特急「リレーつばめ」についても記述する。"},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_australienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Old_Customs_House%2C_Brisbane.jpg","page_title":"Architecture australienne","context_page_description":"L’architecture australienne, au moins au début de l'histoire du pays, fut influencée par les architectures anglaise et américaine. Au mieux, les architectes australiens cherchaient à être les premiers à importer les nouveaux styles et essayaient de leur donner des caractères locaux. L'architecture australienne contemporaine post-seconde Guerre mondiale reflète le multiculturalisme de la société australienne et lui donne une identité émergente multifactorielle."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B7%D0%B0%D0%BD%D0%BD_(%D0%9C%D0%B0%D1%80%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/S%C3%A9zanne%2C_%C3%A9glise_Saint-Denis%2C_fa%C3%A7ade_sud.jpg","page_title":"Сезанн (Марна)","context_page_description":"Сезанн — Францин гӀала-коммуна, лаьтта Гранд-Эст регионехь. Коммунан департамент — Марна. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/Uranium_tetrachloride","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Kristallstruktur_Uran%28IV%29-chlorid.png","page_title":"Uranium tetrachloride","context_page_description":"Uranium tetrachloride is compound of uranium in oxidation state +4. It was used in the electromagnetic isotope separation process of uranium enrichment. It is one of the main starting materials for organouranium chemistry."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Marcello_(Paruzzaro)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Paruzzaro_Chiesa_San_Marcello_Sperindio_Cagnola_Opere_Misericordia_01.jpg","page_title":"Chiesa di San Marcello (Paruzzaro)","context_page_description":"La chiesa di San Marcello risalente alla fine del X o all'inizio dell'XI secolo, fu parrocchiale di Paruzzaro sino alla edificazione, negli anni 1591-1595 della nuova chiesa intitolata a San Siro; mantiene oggi funzione di chiesa cimiteriale. L'interesse artistico della chiesa è legato al bel campanile romanico e al vasto ciclo di affreschi risalenti al XV e XVI secolo, che ricopre quasi interamente le pareti interne"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AE%89%E7%B4%8D%E6%89%98%E5%88%A9%E4%BA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/%E9%90%B5%E5%99%A8.jpg","page_title":"安納托利亞","context_page_description":"安納托力亞，亦作安納托利亞、安那托利亞，又名小亞細亞，是亞洲西南部的半島，位於黑海和地中海之間。\\n現時安納托力亞的全境由土耳其控制，也是土耳其大部分的領土疆域。但爭取獨立的庫爾德斯坦宣稱擁有該半島的部份主權。"},{"page_url":"https://pl.wikipedia.org/wiki/Quercus_sinuata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Quercus_durandii_range_map_1.png","page_title":"Quercus sinuata","context_page_description":"Quercus sinuata Walter – gatunek rośliny z rodziny bukowatych. Występuje naturalnie w Meksyku oraz południowych i południowo-wschodnich Stanach Zjednoczonych."},{"page_url":"https://sv.wikipedia.org/wiki/Monopis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Monopis_icterogastra_%282891533580%29.jpg","page_title":"Monopis","context_page_description":"Monopis är ett släkte av fjärilar som beskrevs av Hübner 1825. Monopis ingår i familjen äkta malar."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B8%D0%B5_%D0%BB%D0%B5%D1%81%D0%B0_%D0%9F%D0%B5%D1%80%D0%BC%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Chernyayevsky_Forest_and_Podlesnaya_Street.jpg","page_title":"Городские леса Перми","context_page_description":"Пермь — единственный крупный промышленный центр России, в котором более 40 % территории занимают леса. Общая площадь городских лесов Перми — 37 972 Га. Они находятся в ведении МКУ «Пермское городское лесничество», которое осуществляет использование, охрану, восстановление и благоустройство лесных массивов. Протяжённость лесов Пермского городского лесничества с севера на юг — 60 км, с востока на запад — 30 км.\\nВ состав Пермского городского лесничества входят следующие участковые лесничества:\\nВерхне-Курьинское;\\nЛевшинское;\\nМотовилихинское;\\nНижне-Курьинское;\\nЧерняевское.\\nВ составе лесов хвойные занимают около 60 % площади, лиственные — 40 %. На левом берегу Камы преобладают ельники дубравно-травные, на правом — сосняки-зеленомошники и берёзовые леса.\\nРяд городских ландшафтов имеют статус особо охраняемых природных территорий. В их числе: Черняевский лес, Закамский бор, Верхне-Курьинский, Левшинский, Липовая гора, Сосновый бор, Липогорский, Утиное болото, Андроновский лес, Сарматский смешанный лес, долина реки Рассохи, Бродовские лесные культуры, Язовской, Глушихинский ельник. Ещё несколько природных ландшафтов и лесных массивов могут получить статус ООПТ в перспективе."},{"page_url":"https://ceb.wikipedia.org/wiki/Puerto_de_Navacerrada","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Puerto_de_Navacerrada_14-10-2006.jpg","page_title":"Puerto de Navacerrada","context_page_description":"Gintang ang Puerto de Navacerrada sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Segovia ug rehiyon sa Castilla y León, sa sentro nga bahin sa nasod, 50 km sa amihanan-kasadpan sa Madrid ang ulohan sa nasod. 1,857 metros ibabaw sa dagat kahaboga ang nahimutangan sa Puerto de Navacerrada.\\nAng yuta palibot sa Puerto de Navacerrada kay kabungtoran sa kasadpan, apan sa sidlakan nga kini mao ang kabukiran. Kinahabogang dapit sa palibot ang Guarramillas, 2,179 ka metros ni kahaboga ibabaw sa dagat, 1.2 km sa sidlakan sa Puerto de Navacerrada. Dunay mga 90 ka tawo kada kilometro kwadrado sa palibot sa Puerto de Navacerrada medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Collado-Villalba, 17.1 km sa habagatan sa Puerto de Navacerrada. Hapit nalukop sa kasagbotan ang palibot sa Puerto de Navacerrada.\\nAng klima mediteranyo. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Hulyo, sa 25 °C, ug ang kinabugnawan Enero, sa 0 °C. Ang kasarangang pag-ulan 620 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 86 milimetro nga ulan, ug ang kinaugahan Agosto, sa 7 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/%C3%9Csk%C3%BCdar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/%C3%87inili_Mosque.jpg","page_title":"Üsküdar","context_page_description":"Üsküdar, traditionally known in Italian and English as Scutari, and in classical antiquity known as Chrysopolis, is a large and densely populated district and municipality of Istanbul, Turkey, on the Anatolian shore of the Bosphorus. It is bordered on the north by Beykoz, on the east by Ümraniye, on the southeast by Ataşehir, on the south by Kadıköy, and on the west by the Bosphorus, with the areas of Beşiktaş, Beyoğlu, and Eminönü on the opposite shore. It is home to about half a million people. Üsküdar is also the usual name for the historic center of the municipality."},{"page_url":"https://it.wikipedia.org/wiki/John_Warwick_Smith","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Remains_of_the_Castle_at_Abergavenny.jpeg","page_title":"John Warwick Smith","context_page_description":"John \\"Warwick\\" Smith è stato un pittore e illustratore inglese."},{"page_url":"https://es.wikipedia.org/wiki/Bosque_petrificado_Sarmiento","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Petrified-wood-6.jpg","page_title":"Bosque petrificado Sarmiento","context_page_description":"El Bosque Petrificado Sarmiento es un área natural protegida provincial ubicada en el departamento Sarmiento, Chubut, Argentina, a 28 km de la ciudad de Sarmiento.\\nEl «bosque petrificado» fue descubierto en 1927; se organizó como atractivo natural turístico a partir de 1970; en 1973 fue declarado área natural protegida por Ley Provincial n.º 2161 y en 2001 a través de la Ley Provincial n.º 4780 se le dio la categoría de monumento natural.​\\nTiene una superficie de 1880 ha de aspecto desértico, donde se encuentran diseminados fósiles de troncos petrificados de especies arbóreas de la familia de las coníferas, cuya edad estimada es de 65 millones de años. En la reserva hay un centro de interpretación con restos paleontológicos y arqueológicos de la región.\\nEl proceso por el cual la madera se convierte en roca demanda millones de años y es producido por la sílice aportada durante erupciones volcánicas; cubiertos los árboles por la ceniza volcánica se inicia un proceso de permineralización.​​"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%94%D1%80%D0%B5%D1%9A%D0%B0%D0%BD%D0%B8%D0%BD%D0%B0_%D0%BA%D1%80%D1%83%D1%88%D0%BA%D0%B0_(%D0%91%D0%B0%D1%9B%D0%B5%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Zapis-0989-Bacevac-Drenjanina-kruska_20161029_8309.jpg","page_title":"Запис Дрењанина крушка (Баћевац)","context_page_description":"Запис Дрењанина крушка (Баћевац) се налази на парцели чији је власник Дрењанин Душан."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%81%94%E9%87%8C%E6%8F%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Dalyan_EL.JPG","page_title":"達里揚","context_page_description":"达里扬是土耳其穆拉省辖下的一座小镇，其位在安纳托利亚西南方海岸，介于著名的马尔马里斯港和费特希耶两城之间。\\n1987年时有开发商想于达里扬附近的伊兹图祖海滩上建造豪华的酒店，而这片海滩却是濒临绝种赤蠵龟的重要繁殖地，在众多环保主义者与作家的奔走下，成功引起国际间对此项开发案的重视，最终在菲利普亲王亦呼吁停止破坏海滩的行为后，这项海滩的开发规划被宣布终止。1988年，伊兹图祖海滩以及其腹地被宣布规划为保护区。"},{"page_url":"https://fr.wikipedia.org/wiki/St%C4%9Bbo%C5%99ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/St%C4%9Bbo%C5%99ice_flag.jpg","page_title":"Stěbořice","context_page_description":"Stěbořice est une commune du district d'Opava, dans la région de Moravie-Silésie, en République tchèque. Sa population s'élevait à 672 habitants en 2017."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%85%E0%A4%9C%E0%A4%97%E0%A4%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Gravid_Ball_Python.jpg","page_title":"अजगर","context_page_description":"अजगर, हा जगात वावरणारा सर्वांत मोठा बिनविषारी सर्प आहे. सरीसृप वर्गातील बोइडी कुलातील पायथॉनिनी उपकुलात त्याचा समावेश होतो. जगाच्या विविध भागांत अजगराच्या अनेक जाती आढळतात. पायथॉन मोलुरस या जातीचे अजगर संपूर्ण भारतात आढळतात. याला रॉक पायथॉन असेही म्हणतात. घनदाट वनात, झाडावर तसेच खडकाळ जमिनींवरही यांचा वावर असतो. मध्य व दक्षिण अमेरिकेत आढळणारे व पिलांना जन्म देणारे पाणअजगर ॲंनॅकॉंडा म्हणून ओळखले जातात."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Wismar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Wismar_Grossschmiedestrasse_10_%281%29.jpg","page_title":"Liste der Baudenkmale in Wismar","context_page_description":"In der Liste der Baudenkmale in Wismar sind alle denkmalgeschützten Bauten der mecklenburgischen Stadt Wismar und ihrer Ortsteile aufgelistet. Grundlage ist eine Veröffentlichung des Landtages Mecklenburg-Vorpommern mit der Nummer 2/2880 mit dem Stand vom 11. August 1997."},{"page_url":"https://es.wikipedia.org/wiki/Hendrik_van_Minderhout","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Van_Minderhout_Battle_of_Lowestoft.jpg","page_title":"Hendrik van Minderhout","context_page_description":"Hendrik van Minderhout fue un pintor holandés de marinas, actividad que desarrolló principalmente en las ciudades de Brujas y Amberes en los Países Bajos del sur.​ También colaboró con otros pintores flamencos de paisajes y perspectivas agregando las figuras —staffage— a sus composiciones.​"},{"page_url":"https://pl.wikipedia.org/wiki/I_wojna_domowa_w_Kongu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Rwandan_refugee_camp_in_east_Zaire.jpg","page_title":"I wojna domowa w Kongu","context_page_description":"I wojna domowa w Kongu – konflikt zbrojny trwający od listopada 1996 do maja 1997 roku, w wyniku którego zostały obalone rządy dotychczasowego prezydenta Zairu Mobutu Sese Seko przez siły rebelianckie oraz wspierające je państwa: Ugandy i Rwandy. Przywódca rebeliantów Laurent-Désiré Kabila po zwycięstwie ogłosił się prezydentem oraz zmienił nazwę państwa na Demokratyczną Republikę Konga. W wyniku konfliktu ponad 200 tysięcy cywilów zostało zamordowanych.\\nKabila nie wprowadził jednak w życie postulatów, które stały się przyczyną eskalacji konfliktu. Dodatkowo alienował swoich byłych sojuszników, co w ostateczności doprowadziło do wybuchu drugiej wojny."},{"page_url":"https://nl.wikipedia.org/wiki/Veprecula_gracilispira","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Veprecula_gracilispira_001.jpg","page_title":"Veprecula gracilispira","context_page_description":"Veprecula gracilispira is een slakkensoort uit de familie van de Raphitomidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1879 door E. A. Smith."},{"page_url":"https://en.wikipedia.org/wiki/Greece%E2%80%93Norway_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Greece_Norway_Locator.png","page_title":"Greece–Norway relations","context_page_description":"Greece–Norway relations are foreign relations between Greece and Norway. The Greek Embassy in Oslo opened in 1980 and the Norwegian Embassy in Athens opened in 1974.\\nGreece's embassy in Oslo and an honorary consulate in Bergen represents Greece diplomatically in Norway. Norway has an embassy in Athens, and eight honorary consulates in Corfu, Crete, Kos, Patras, Piraeus, Rhodes and Thessaloniki. Both countries are members of NATO."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B0%BC%E4%BA%9A%E5%8A%A0%E6%8B%89%E5%B9%BF%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Taste_of_buffalo_2008.jpg","page_title":"尼亚加拉广场","context_page_description":"尼亞加拉廣場是一個城市廣場，位於布法羅德拉瓦大道、法院街、吉納西街和尼亞加拉街的交叉路口。這是約瑟夫·埃利科特在1804年為當時的新阿姆斯特丹村設計的原始街道網的中心樞紐，現在仍然是布法羅的市中心。"},{"page_url":"https://it.wikipedia.org/wiki/The_Seekers","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/The_Seekers.png","page_title":"The Seekers","context_page_description":"I Seekers sono stati una band australiana di folk, folk rock, pop e country music fondata negli anni Sessanta a Melbourne, nello stato di Victoria.\\nFurono il primo gruppo musicale australiano a raggiungere una popolarità internazionale e a guadagnare posizioni importanti nelle classifiche discografiche del Regno Unito - il paese in cui sono stati lanciati - e degli Stati Uniti.\\nCompaiono nell'elenco di artisti che hanno fatto registrare il maggior numero di dischi venduti."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1966","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Gobernador_Gabino_Cu%C3%A9_Monteagudo.jpg","page_title":"Lijst van personen geboren in 1966","context_page_description":"Dit is een lijst van personen die geboren zijn in 1966.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Arcul_de_Triumf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Arcul_de_Triumf-Bucuresti.jpg","page_title":"Arcul de Triumf","context_page_description":"El Arcul de Triumf es un arco de triunfo localizado en la zona norte de Bucarest, la capital de Rumanía. Se halla, concretamente, en la Şoseaua Kiseleff."},{"page_url":"https://de.wikipedia.org/wiki/%C3%89vreux","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Fresque_gallo-romaine_Evreux_210209.jpg","page_title":"Évreux","context_page_description":"Évreux ist eine französische Stadt mit 47.733 Einwohnern in der Region Normandie. Bezüglich der Einwohnerzahl ist es die drittgrößte Stadt der ehemaligen Haute-Normandie. Évreux ist Präfektur des Départements Eure. Die Einwohner werden nach dem gallischen Stamm der Eburovices Ébroïciens genannt."},{"page_url":"https://de.wikipedia.org/wiki/Stepper_(Sportger%C3%A4t)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Ministepper.jpg","page_title":"Stepper (Sportgerät)","context_page_description":"Ein Stepper ist ein Sportgerät, welches primär zum Training der Muskulatur eingesetzt wird."},{"page_url":"https://et.wikipedia.org/wiki/Ahi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Malingsbo_herrg%C3%A5rd_12.jpg","page_title":"Ahi","context_page_description":"Ahi on üldjuhul kinnine tulekolle, milles kütuse põlemise tagajärjel eraldub soojus. Ahje kasutatakse peamiselt ruumide kütmiseks, kuid ka toidu valmistamiseks. Mõnel pool tarvitatakse toiduvalmistamiseks ka poolkinnisi või lahtisi ahje.\\nTänapäeval nimetatakse analoogia põhjal ahjudeks samuti tööstusseadmeid, milles soojust kasutatakse tehnoloogiliseks kuumutamiseks, ning teiste soojusallikatega seadmeid.\\nEestis on traditsioonilised kinnised ahjud, kus kütusena tarvitatakse enamasti töödeldud puitu või turvast. Toitu valmistatakse sellistes ahjudes kas kinnistes nõudes, pealt kaetud nõudes või nõudeta. Tuld ahjus segatakse ahjuroobiga, nõusid võidakse ahju asetada ahjuhargiga. Ahjusuu ees on ahjuuks, suitsuava sulgemiseks on ahjusiiber.\\nTavapäraselt on ahje ehitatud kividest või keraamikast. Selline materjal salvestab soojust ja soojendab õhku ka pikka aega pärast kütmise lõppu, muutes kinnise ahju küttekoldena efektiivsemaks kui lahtised kolded, mis soojendavad ümbrust üksnes kütuse põlemise ajal.\\nTraditsioonilise vene ahju peal on lavats, kus saab magada.\\nTähtis roll on ahjudel ka saunas."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A6%99%E5%8E%B3%E5%AF%BA_(%E6%B7%85%E5%B7%9D%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Hnxcxys_%283%29.jpg","page_title":"香厳寺 (淅川県)","context_page_description":"香嚴寺は中華人民共和国河南省南陽市淅川県倉房鎮北西部の白崖山に位置する寺院。唐代に建立され、登封の少林寺、洛陽の白馬寺、開封の大相国寺とともに中国四大名寺の一つとされる。1986年に河南省文物保護単位、2006年に全国重点文物保護単位に指定された。別称に長寿寺、顕通禅寺。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BD%97%E4%BC%AF%E7%89%B9%C2%B7%E5%BC%97%E6%A0%BC%E6%A3%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Dr._R.G._Ferguson_Senior_Stick_Small.jpg","page_title":"罗伯特·弗格森","context_page_description":"罗伯特·乔治·弗格森医生，大英国协勋章，文学士，医学博士，法学博士，是北美对抗结核病及导入免费治疗的先驱.做为医院院长之后，成为加拿大萨斯喀彻温省结核病治疗协会的会长，他为省里缔造了许多第一， 包括\\n加拿大第一个提供免费治疗肺结核病的省\\n加拿大第一个开始为疗养院工作人员及原住民提供疫苗服务的省\\n加拿大第一个开展结核病调查的省\\n此外弗格森博士是一个长期研究卡介苗 的先驱。在那个时候卡介苗的研究是争议性很高的。\\n弗格森博士为他的专业，萨斯喀彻温省，及国家做出贡献并且获得许多国际性的殊荣，包括：\\n萨斯喀彻温省医疗学会 会长, 1922\\n加拿大肺结核协会 会长1935和1936\\n美国胸腔医师学会, 院士及管理长1944-48\\n美国特鲁多协会, 1945–1957\\n萨斯喀彻温省医院协会 会长\\n世界卫生组织肺结核及卡介苗专门委员会委员1948\\n为了表彰他对抗肺结核的成就，弗格森博士是荣获了许多奖项与荣誉，包括大英国协勋章。其他如：\\n国王勋章\\n查尔斯米克尔奖学金, 此奖项由多伦多大学评选颁发给十年来对医药学术有卓越贡献的人\\n萨斯喀彻温大学 荣誉法学博士\\n荣誉终身会员:\\n巴西结核病协会\\n加拿大医学学会\\n加拿大肺结核协会\\n加拿大皇家军团\\n加拿大公共卫生协会萨斯喀彻温分部\\n萨斯喀彻温医学学会\\n1939 年， 乔治国王六世及伊丽莎白女皇在加拿大访问期间，特别造访弗格森博士及他的家人, 并在他家中茶叙。为了表彰弗格森的成就萨斯喀彻温大学在1973年设立了弗格森博士荣誉教授职位；1969年在里贾纳以他命名的乔治弗格森博士学校还有1967年在萨斯喀彻温的弗格森岛。 在这些荣誉中或许带给弗格森博士 最开心的是被颁 为Qu’Appelle 山谷三个部落的荣誉酋长并且赐名为“Muskeke-O-Kemacan Ketche-na-na-ta we wayo” 意指“伟大的白人医生”。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%B1%CF%80%CF%8E%CF%81%CE%B7%CF%82_%CE%92%CE%84_%CF%84%CE%B7%CF%82_%CE%A0%CE%B5%CF%81%CF%83%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Head_of_king_Met_65.126.jpg","page_title":"Σαπώρης Β΄ της Περσίας","context_page_description":"Ο Σαπώρης Β' της Περσίας, γνωστός και ως Σαπώρης Β' ο μέγας, ήταν ο δέκατος βασιλιάς της αυτοκρατορίας των Σασσανιδών. Ήταν γιος του βασιλιά της Περσίας Ορμίσδα Β' από μία ερωμένη του. Όταν πέθανε ο πατέρας του ήταν ακόμα αγέννητος, οι Πέρσες ευγενείς σκότωσαν, τύφλωσαν και φυλάκισαν αντίστοιχα τους τρεις μεγαλύτερους αδελφούς του, η διοίκηση της χώρας δόθηκε στη μητέρα του και τους ευγενείς. Όταν ενηλικιώθηκε σε ηλικία 16 ετών ανέλαβε απευθείας τη βασιλεία, παρά το γεγονός ότι ήταν νόθος αναδείχθηκε σε έναν από τους μεγαλύτερους και σκληρότερους βασιλείς της Περσίας. Ήταν ο μοναδικός που επέβαλε με τη βία τον Ζωροαστρισμό στην Περσία εκτελώντας τους οπαδούς ξένων θρησκειών ιδιαίτερα τους χριστιανούς την ίδια εποχή που έγινε στην Ρωμαϊκή αυτοκρατορία επίσημη θρησκεία με τον αυτοκράτορα Μέγα Κωνσταντίνο. Οι λόγοι για τους οποίους συμπεριφέρθηκε έτσι στους χριστιανούς φαίνονται περισσότερο πολιτικοί, την ίδια εποχή θεωρούσε τη Ρωμαϊκή αυτοκρατορία σαν τον μοναδικό μεγάλο κίνδυνο για την χώρα του, η καθιέρωση του χριστιανισμού από τον Κωνσταντίνο του φάνηκε ως μεγάλη πρόκληση."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pinturas_de_Ernst_Ludwig_Kirchner","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/1916_Kirchner_Frankfurter_Westhafen_anagoria.JPG","page_title":"Lista de pinturas de Ernst Ludwig Kirchner","context_page_description":"Esta é uma lista de pinturas de Ernst Ludwig Kirchner que como tal estão registadas na Wikidata.\\nErnst Ludwig Kirchner foi um pintor expressionista alemão, tendo sido um dos fundadores do grupo expressionista Die Brücke, em 1905, juntamente com Fritz Bleyl, Erich Heckel e Karl Schmidt-Rottluff.\\nNos primeiros anos, Kirchner concentrou-se em nus em estúdio, na vida noturna urbana e em retratos. Nos verões passados ​​com outros artistas da Brücke e modelos nos lagos de Moritzburg e na ilha báltica de Fehmarn criaram muitas obras de nus na natureza. A partir de 1910 foi cada vez mais influenciado pela arte africana, indiana e da Oceania, tendo-se mudado para Berlim, em 1911, com outros artistas da Brücke, mas o grupo dissolveu-se em 1913. De 1913 a 1915 criou pinturas com cenas de rua de Berlim, marcando um ponto alto da sua carreira artística. Em 1915, alistou-se como \\"voluntário involuntário\\" e tornou-se motorista de um regimento de artilharia tendo sofrido um colapso mental e físico e dispensado do serviço militar. Convalesceu depois em vários sanatórios, nas montanhas da Suíça, onde a paisagem e os seus habitantes se tornaram um tema favorito."},{"page_url":"https://lmo.wikipedia.org/wiki/Chauzon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Cirque_de_Giens.jpg","page_title":"Chauzon","context_page_description":"Chauzon l'è 'n cümü fransés de la regiù Rhône-Alpes, endèla Frància meridiunàla. El fa part del cantù de Largentière, del circondàre de Largentière e del dipartimènt de l'Ardèche.\\nEl g'ha 'na popolasiù de 338 abitàncc, dato agiurnàt al ginee 2011.\\nEl sò teretóre el g'ha 'na superfìce de 10,68 km² e 'l và de 'na altèsa mìnima de 100 méter a 'na altèsa màsima de 326 méter s.l.m."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9arrangement_d%27Amadori","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/AmadoriRearrangement1.png","page_title":"Réarrangement d'Amadori","context_page_description":"Le réarrangement d'Amadori est une réaction organique qui décrit l'isomérisation, catalysée par un acide ou une base, de la glycosylamine d'un aldose. Ce réarrangement a été découvert par le chimiste organique Mario Amadori en 1925, alors qu'il étudiait les réactions de Maillard. Cette réaction est importante dans la chimie des glucides."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%B8%ED%95%98%EC%9D%B4_%ED%95%80%ED%8B%B8%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Mihai_Pintilii.png","page_title":"미하이 핀틸리","context_page_description":"미하이 도루 핀틸리는 루마니아의 전 축구 선수로, 포지션은 수비형 미드필더 또는 박스-투-박스 미드필더이다."},{"page_url":"https://no.wikipedia.org/wiki/Francesco_Casagrande","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Francesco_CASAGRANDE.jpg","page_title":"Francesco Casagrande","context_page_description":"Francesco Casagrande er en tidligere italiensk landeveissyklist, som var profesjonell i årene 1992 til 2005."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%B3%E3%83%9D%E3%83%8A%E3%82%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Hovenia_dulcis_in_Ceret_Park_S%C3%A3o_Paulo_001.jpg","page_title":"ケンポナシ","context_page_description":"ケンポナシは、クロウメモドキ科ケンポナシ属の落葉高木。"},{"page_url":"https://en.wikipedia.org/wiki/Ribophorin","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Ribophorin_is_a_subunit_of_oligosaccharide_transferasa_in_the_RER.png","page_title":"Ribophorin","context_page_description":"Ribophorins are dome shaped transmembrane glycoproteins which are located in the membrane of the rough endoplasmic reticulum, but are absent in the membrane of the smooth endoplasmic reticulum. There are two types of ribophorines: ribophorin I and II. These act in the proteic complex oligosaccharyltransferase as two different subunits of the named complex. Ribophorin I and II are only present in eukaryote cells.\\nBoth types of ribophorins develop a key role in the binding of ribosomes to the rough endoplasmic reticulum as well as in the co-translational processes that depend on this interaction. The content of ribophorin of the rough endoplasmic reticulum is equal to the stoichiometric number of ribosomal units. Therefore, this suggests the great importance, abundance and good preservation of these proteins in the reticulum. Consequently, defects in the genes that encode these proteins may cause congenital disorders and devastating consequences; ribophorin I and II are encoded by the genes RPN1 and RPN2 respectively.\\nThe ribophorins are soluble in non-ionic detergents such as Triton X-100."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%DA%AF%D8%A7%D8%B1%D8%A8%D8%A7%D9%84%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Graphium_agamemnon1.jpg","page_title":"نگاربالان","context_page_description":"نگاربالان سرده‌ای از تیره پروانه‌های دم‌چلچله‌ای می‌باشند. دم جیجاقی یکی از گونه های این سرده است."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A9%D7%A8_%D7%97%D7%A0%D7%A0%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Asher_Hnanel.jpg","page_title":"אשר חננאל","context_page_description":"הרב ד\\"ר אשר יצחק חננאל היה היסטוריון, הרב הראשי ליהודי סופיה, ובהמשך הרב הראשי של בולגריה. ב-1943 נאבק הרב חננאל ביחד עם הרב דניאל ציון להצלת יהודי סופיה מגירוש אל מחנות ההשמדה. לאחר עלייתו של הרב דניאל ציון לישראל, מונה לרב הראשי ליהודי בולגריה והחליט להישאר בבולגריה עם הקהילה הקטנה שנותרה בה. ב-1960 ביטל המשטר הקומוניסטי את משרת הרב הראשי וב-1961 הפקיע את בית הכנסת בסופיה מרשות הקהילה. הרב חננאל נקלע לעימות מול השלטונות, אשר בעקבותיו נשפט באשמת שווא ונכלא, תוך שמצב בריאותו הולך ומדרדר. לאחר לחץ בינלאומי כבד שוחרר הרב חננאל מהכלא וזמן קצר לאחר שחרורו, הלך לעולמו."},{"page_url":"https://sv.wikipedia.org/wiki/Cerisy","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Map_commune_FR_insee_code_80184.png","page_title":"Cerisy","context_page_description":"Cerisy är en kommun i departementet Somme i regionen Hauts-de-France i norra Frankrike. Kommunen ligger i kantonen Bray-sur-Somme som tillhör arrondissementet Péronne. År 2009 hade Cerisy 479 invånare."},{"page_url":"https://it.wikipedia.org/wiki/Eesti_%C3%B5huv%C3%A4gi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/L-39_Albatros_estonian.jpg","page_title":"Eesti õhuvägi","context_page_description":"L'Eesti õhuvägi, conosciuta internazionalmente con la dizione in inglese Estonian Air Force, è l'attuale aeronautica militare dell'Estonia e parte integrante delle Eesti kaitsevägi, le forze armate estoni.\\nLa sede principale si trova nella base aerea di Ämari ed opera con due aerei da trasporto Antonov An-2 e due elicotteri Robinson R44. Due Aero L-39 Albatros sono stati noleggiati per addestramento.\\nLe batterie di difesa aerea sono equipaggiate con 100 ZU-23-2 e missili Mistral.\\nIl principale radar adottato dalla forza aerea è il Lockheed Martin TPS-117, situato a Kellavere, nella contea di Lääne-Virumaa, ed integrato con la rete di difesa aerea BaltNet operante nei paesi Baltici. La base aerea situata sull'aeroporto di Ämari è dotata di radar a corto raggio ASR-8."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%8E%D0%BD%D1%85%D1%80%D1%96%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Schloss_Seusslitz.jpg","page_title":"Нюнхріц","context_page_description":"Нюнхріц — громада в Німеччині, розташована в землі Саксонія. Входить до складу району Майсен. Центр об'єднання громад Нюнхріц.\\nПлоща — 31,11 км². Населення становить 5661 ос."},{"page_url":"https://en.wikipedia.org/wiki/List_of_military_trucks","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Csepel_D-344_02.JPG","page_title":"List of military trucks","context_page_description":"This list includes military trucks, are in production for 2014. Previous models are in a separate table, which is below.\\nIn the column \\"Company\\" indicates the manufacturer of the truck, in the column \\"truck\\" model name is indicated, in the column \\"image\\" is a photograph of the model, in the \\"Type\\" column indicates the type of model payloads, here is submitted designations such as \\"chassis for missile launchers units\\", \\"tankovoz \\"pickup\\"; in the column \\"years of production\\" represents years of release. Some images provided below may show the outdated model\\nThis is not a complete list"},{"page_url":"https://fr.wikipedia.org/wiki/Ver-sur-Mer","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Rue_Robert_Riethe.jpg","page_title":"Ver-sur-Mer","context_page_description":"Ver-sur-Mer est une commune française, située dans le département du Calvados en région Normandie, peuplée de 1 625 habitants.\\nC'est une station balnéaire sur la Manche."},{"page_url":"https://ca.wikipedia.org/wiki/Montlaur_e_Vernet","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Map_commune_FR_insee_code_32272.png","page_title":"Montlaur e Vernet","context_page_description":"Montlaur e Vernet és un municipi francès, situat al departament del Gers i a la regió d'Occitània."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%B4%D8%A7%D9%86%DB%95_(%DA%98%DB%8C%D9%86%D9%86%D8%A7%D8%B3%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Plant_cell_type_collenchyma.png","page_title":"شانە (ژینناسی)","context_page_description":"شانە، بریتییه‌ له‌ كۆمه‌ڵێك خانه‌ی هاوشێوه‌ له‌ پێكهاته‌دا و به‌یه‌كه‌وه‌ كارده‌كه‌ن بۆ به‌ جێهێنانی فه‌رمانێكی دیاریكراو"},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A9%D7%A8%D7%90%D7%9C_%D7%99%D7%99%D7%91%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/IsraelYeivin3.jpg","page_title":"ישראל ייבין","context_page_description":"ישראל יֶיבין היה חוקר המסורה והלשון העברית, פרופסור באוניברסיטה העברית בירושלים, חתן פרס ישראל בשנת ה'תשמ\\"ט על תרומתו למחקר הלשון העברית."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B1%D0%B0%D1%81%D1%86%D1%8C%D1%8F%D0%BD_%D0%9F%D1%96%D0%BD%D1%8C%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Retrato_Oficial_Presidente_Pi%C3%B1era_2018.jpg","page_title":"Себасцьян Піньера","context_page_description":"Мігель Хуан Себасцьян Піньера Эчэніке — чылійскі эканаміст, інвестар і палітычны дзеяч. Прэзідэнт Рэспублікі Чылі з 11 сакавіка 2010 года па 11 сакавіка 2014 года; у 2017 годзе абраны Прэзідэнтам Чылі на тэрмін 2018—2022 гадоў."},{"page_url":"https://ceb.wikipedia.org/wiki/Radzi%C4%99cin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Radzi%C4%99cin%2C_ko%C5%9Bci%C3%B3%C5%82.JPG","page_title":"Radzięcin","context_page_description":"Lungsod ang Radzięcin sa Polskowa. Nahimutang ni sa powiat sa Powiat biłgorajski ug gingsakopan sa Województwo Lubelskie, sa habagatan-sidlakang bahin sa nasod, 210 km sa habagatan-sidlakan sa Warsaw ang ulohan sa nasod. 250 metros ibabaw sa dagat kahaboga ang nahimutangan sa Radzięcin, ug adunay 746 ka molupyo.\\nAng yuta palibot sa Radzięcin kay patag, ug nga tinakpan sa ubos sa habagatan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 306 ka metro ug 1.8 km sa kasadpan sa Radzięcin. Dunay mga 60 ka tawo kada kilometro kwadrado sa palibot sa Radzięcin medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Biłgoraj, 15.2 km sa habagatan sa Radzięcin. Hapit nalukop sa kaumahan ang palibot sa Radzięcin.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -7 °C."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D1%88%D0%BB%D1%8F%D1%85_E117","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Ananuri_bridge.jpg","page_title":"Автошлях E117","context_page_description":"E117 — європейський маршрут, що проходить по півдню Росії через територію Грузії в Вірменію. Починається в місті Мінеральні Води, йде по Військово-грузинській дорозі в грузинську столицю — Тбілісі, а далі через вірменську столицю Єреван йде на кордон з Іраном, місто Мегрі. Протяжність маршруту складає 1 050 км.\\nНа ділянці між Мінеральними Водами та Бесланом траса збігається з маршрутом x22px."},{"page_url":"https://pl.wikipedia.org/wiki/Wojew%C3%B3dztwo_podlaskie","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/%C5%81om%C5%BCa_PWSIP.jpg","page_title":"Województwo podlaskie","context_page_description":"Województwo podlaskie – jednostka podziału administracyjnego Polski, jedno z 16 województw. Położone jest w północno-wschodniej części kraju, w geograficznym środku Europy. Przez jego środek przepływa Narew. Siedzibą władz województwa jest Białystok. Na dzień 31 grudnia 2019 województwo miało około 1,18 mln mieszkańców. Obejmuje obszar 20 187,02 km²."},{"page_url":"https://fr.wikipedia.org/wiki/L%27%C3%89toile_(op%C3%A9ra_bouffe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Chabrier_-_L%27%C3%A9toile_couverture.PNG","page_title":"L'Étoile (opéra bouffe)","context_page_description":"L'Étoile est un opéra bouffe en trois actes d'Emmanuel Chabrier sur un livret d’Eugène Leterrier et Albert Vanloo, créé au Théâtre des Bouffes-Parisiens le 28 novembre 1877.\\nVoici un résumé rapide : à chacun de ses anniversaires, le roi Ouf 1ᵉʳ a pour tradition d’offrir à son peuple le réjouissant spectacle de l’empalement d’un sujet rebelle. Il rencontre un colporteur, Lazuli, qui par déception amoureuse finit par donner une gifle au roi. On prépare l’exécution qui sera annulée, car selon l’astrologue la mort de l’un sera suivie par celle de l’autre, les deux étant liés par la même étoile.\\nChabrier a rencontré ses librettistes chez un ami commun, le peintre Gaston Hirsch, en 1875. Chabrier leur a joué les premières versions de la romance O petite étoile, et la polyphonie Le pal, est de tous les supplices.... Ils ont alors décidé de collaborer. L'histoire de cette rencontre entre les trois artistes trouve elle-mème un certain écho dans les personnages et l'histoire de Fisch-Ton-Kan, un autre opéra de Chabrier."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Seebr%C3%BCcken_im_Vereinigten_K%C3%B6nigreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/The_Pier%2C_Felixstowe_-_geograph.org.uk_-_1467954.jpg","page_title":"Liste von Seebrücken im Vereinigten Königreich","context_page_description":"Die Liste von Seebrücken verzeichnet Seebrücken im Vereinigten Königreich. Piers wurden insbesondere an der Seeküste und auch an der Themse errichtet."},{"page_url":"https://de.wikipedia.org/wiki/St._Nikolaus_(Klixb%C3%BCll)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Flutmarken-klixb%C3%BCll-innen.jpg","page_title":"St. Nikolaus (Klixbüll)","context_page_description":"St. Nikolaus ist eine evangelisch-lutherische Kirche in Klixbüll im Kreis Nordfriesland in Schleswig-Holstein. Sie liegt auf einem Hügel etwas abseits des Dorfes neben dem ältesten Gebäude des Dorfes, dem Kern des ehemaligen Gutes Klixbüllhof. Sie gehört zusammen mit der Kirche von Braderup zur Kirchengemeinde Braderup-Klixbüll in der Nordkirche."},{"page_url":"https://en.wikipedia.org/wiki/Jacqueline_Foster","image_url":"https://upload.wikimedia.org/wikipedia/en/2/2f/JacquelineFoster.jpeg","page_title":"Jacqueline Foster","context_page_description":"Dame Jacqueline Foster DBE is a British Conservative politician and a former Member of the European Parliament for the North West England region."},{"page_url":"https://es.wikipedia.org/wiki/Centro_Cultural_Kirchner","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/6_y_7_piso.jpg","page_title":"Centro Cultural Kirchner","context_page_description":"Centro Cultural Kirchner es un espacio para artes plásticas, espectáculos musicales y exposiciones, inaugurado el 21 de mayo de 2015 y ubicado en el edificio que fuera anteriormente sede del Palacio de Correos y Telecomunicaciones de la Ciudad Autónoma de Buenos Aires, Argentina. Es el más importante en tamaño de América Latina y el tercero a nivel mundial junto al Centro Pompidou, de Paris; el Foro Internacional de Tokio; y el Lincoln Center, de Nueva York.​​​​ Su nombre rinde homenaje al expresidente argentino Néstor Kirchner. El centro, conocido como CCK, es la mayor inversión en un proyecto cultural hecha en la Argentina en toda su historia.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%8E%D1%82%D1%80%D1%96%D1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Sutrieu_2016_%281%29.JPG","page_title":"Сютріє","context_page_description":"Сютріє́ — муніципалітет у Франції, у регіоні Рона-Альпи, департамент Ен. Населення — 241 осіб.\\nМуніципалітет розташований на відстані близько 410 км на південний схід від Парижа, 70 км на схід від Ліона, 45 км на південний схід від Бург-ан-Бресса."},{"page_url":"https://sv.wikipedia.org/wiki/Venus_Genetrix_(skulptur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Aphrodite_Genetrix_Musei_Capitolini_MC1078.jpg","page_title":"Venus Genetrix (skulptur)","context_page_description":"Venus Genetrix är det nuvarande namnet på en specifik typ av staty föreställande gudinnan Afrodite.\\nDen ursprungliga betydelsen av namnet Venus Genetrix var Venus i hennes egenskap av modergudinna: först som legendarisk anmoder till Julius Caesars ätt, och därefter som staden Roms och därmed romarrikets beskyddare.\\nI skulptursammanhang betecknar detta namn en staty föreställande en påklädd Venus, med endast en bröst bart, hållande fram ett äpple i sin ena hand. Det finns två versioner av denna Venusstaty: en där hon bär en liten Eros på ena axeln, och en utan Eros.\\nDen ursprungliga statyn var grekisk, och föreställde Afrodite hållande i det äpple hon vunnit i legenden om herden Paris dom. Den första statyn anses ha gjorts av Kallimachos på 400-talet f.Kr. Denna staty var i brons och alla senare kopior ska ha gjorts med den som förlaga.\\nJulius Caesar lät år 46 f.Kr. uppföra Venus Genetrix tempel i Rom för att fira Roms seger i slaget vid Farsalos och då ska en kopia av denna staty av gudinnan Afrodite, som av romarna identifierades med Venus, ha gjorts för templet av den grekiske skulptören Arcesilas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D1%81%D0%B5%D1%80%D0%B1%D0%BE%D0%BB%D1%83%D0%B6%D0%B8%D1%86%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Albin_Moller_1605.png","page_title":"История серболужицкого народа","context_page_description":"Лужичане являются сохранившимся не германизированным остатком полабско-балтийских славян. Проживают на территории современной Германии с VI века. По письменным источникам известны с 631 года. С X века — в составе Германии. Территория Верхней Лужицы с 1018 по 1032 год входила во владения Польши; с перерывами c XI по XIII век, и с 1319 по 1635 год — во владения Чехии. Территория Нижней Лужицы входила в состав Чехии с 1373 по 1635 год. К XV веку произошло разделение серболужицкой территории на Верхнюю и Нижнюю Лужицу. В Средние века лужицкие сербы были народом с неполной социальной структурой, занятым в основном земледелием; серболужицкое население городов обслуживало потребности немецкого патрициата и бюргерства. В XIX веке в период «национального возрождения» возникло славянское самосознание. На начало 1940-х годов власти Германии планировали массовое переселение лужицких сербов как расово неполноценного элемента.\\nСербам-лужичанам неоднократно предсказывали их окончательную германизацию. Общественное мнение Германии нередко рассматривало серболужицкий народ как нежизнеспособный пережиток прошлого."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%A8%9F%E5%AE%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Changi_Beach_Park_%283186526804%29.jpg","page_title":"樟宜","context_page_description":"樟宜（英文：Changi）係星加坡一笪地方，喺星加坡東部，最出名嘅建築係樟宜機場，嗰度重有樟宜監獄同樟宜海軍基地。"},{"page_url":"https://de.wikipedia.org/wiki/Drymen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/The_Square%2C_Drymen.jpg","page_title":"Drymen","context_page_description":"Drymen ist ein Dorf mit 850 Einwohnern im Verwaltungsbezirk Stirling in Schottland. Es liegt westlich der Campsie Fells mit Blick auf den Ben Goyne im Osten und Loch Lomond im Westen. Der Queen Elizabeth Forest Park reicht bis an das Dorf. Das gesamte Gebiet ist Teil des Loch Lomond and the Trossachs National Park, dem ersten Nationalpark Schottlands.\\nOftmals übernachten Wanderer des West Highland Way in Drymen. Es gibt einige Pubs und einen Supermarkt. Der Pub The Clachan in Drymen gibt an, der älteste Pub Schottlands zu sein und Familienverbindungen bis zu Robert Roy MacGregor zu haben.\\nDer Großteil der Bevölkerung pendelt zum Arbeiten nach Glasgow, der Rest arbeitet überwiegend in der Landwirtschaft. Jedes Jahr im frühen Sommer findet auf den Feldern am Fluss Endrick eine Landwirtschaftsschau statt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%AC%E3%83%A9%E3%83%BC%E3%83%8E%E3%83%BB%E3%82%AB%E3%83%8A%E3%83%B4%E3%82%A7%E3%83%BC%E3%82%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Map_-_IT_-_Torino_-_Municipality_code_1233.svg","page_title":"サレラーノ・カナヴェーゼ","context_page_description":"サレラーノ・カナヴェーゼは、イタリア共和国ピエモンテ州トリノ県にある、人口約500人の基礎自治体。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%88%D8%B1%D9%88%D9%87%D9%8A%D8%A8%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Eurohippus_parvulus.jpg","page_title":"يوروهيبس","context_page_description":"اليوروهيپس هو جنس منقرض من الخيليات، اعتبر نوعه لفترة طويلة جزءًا من البروبالايوثيريم واللوفايوثيريم، وقد وُصفت عينة حامل في سنة 2015."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%81%D0%B8%D0%BB%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Allegoria_1890_xilografia_03.jpg","page_title":"Ксилографія","context_page_description":"Ксилогра́фія або дереворит — гравюра на дереві. Виникла ксилографія в Китаї не пізніше VI століття."},{"page_url":"https://it.wikipedia.org/wiki/Gustave_Surand","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/%27Saint_George_and_the_Monster%27_by_Gustave_Surand.JPG","page_title":"Gustave Surand","context_page_description":"Gustave Surand è stato un pittore e scultore francese."},{"page_url":"https://es.wikipedia.org/wiki/Ginebra","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Coat_of_Arms_of_Geneva.svg","page_title":"Ginebra","context_page_description":"Ginebra ​ es una ciudad y comuna de la Confederación suiza, ubicada cerca de la frontera con Francia, capital del cantón de Ginebra. Es la ciudad más poblada de Romandía y la segunda de Suiza después de Zúrich. Se encuentra situada a la salida del Ródano del lago de Ginebra y es la capital de la República y Cantón de Ginebra.\\nEl municipio en sí tiene una población de 194 458 habitantes y el cantón tiene 474 169 habitantes. En 2011, el área metropolitana tenía una población de 915 000 habitantes incluida la parte francesa. En territorio suizo, el área de tránsito tenía una población de 1,25 millones de habitantes. Esta zona se extiende al este de Ginebra hacia la zona de Riviera y al noreste hacia Yverdon-les-Bains, en el vecino cantón de Vaud.\\nGinebra es una ciudad global, centro financiero y mundial de la diplomacia debido a la presencia de numerosas organizaciones internacionales, entre ellas la sede de muchos de los organismos de las Naciones Unidas​ y la Cruz Roja.​ De hecho, Ginebra es la ciudad que alberga el mayor número de organizaciones internacionales del mundo.​"},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1985_der_Deutschen_Post_der_DDR","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Stamps_of_Germany_%28DDR%29_1985%2C_MiNr_Zusammendruck_2947-2948.jpg","page_title":"Briefmarken-Jahrgang 1985 der Deutschen Post der DDR","context_page_description":"Der Briefmarken-Jahrgang 1985 der Deutschen Post der Deutschen Demokratischen Republik umfasste 50 einzelne Sondermarken, drei Briefmarkenblocks mit fünf Sondermarken und zwei Kleinbogen mit zusammen sieben Sondermarken. Eine dieser Marken wurde auch als Einzelmotiv ausgegeben. Zwölf Briefmarken wurden zusammenhängend gedruckt; dabei gab es zwei Paare mit innenliegendem Zierfeld. In diesem Jahr wurden keine Dauermarken ausgegeben. Insgesamt erschienen 73 Motive.\\nAlle Briefmarken-Ausgaben seit 1964 sowie die 2-Mark-Werte der Dauermarkenserie Präsident Wilhelm Pieck und die bereits seit 1961 erschienene Dauermarkenserie Staatsratsvorsitzender Walter Ulbricht waren ursprünglich unbegrenzt frankaturgültig. Mit der Wiedervereinigung verloren alle Marken nach dem 2. Oktober 1990 ihre Gültigkeit."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%BE%D1%88%D1%82%D0%B8%D1%99%D0%B8%D1%98%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Leskova%C4%8Dka_ro%C5%A1tiljijada%2C_koncert_Dragane_Mirkovi%C4%87.jpg","page_title":"Роштиљијада","context_page_description":"Роштиљијада је манифестација која се одржава у Лесковцу сваке године у последњој недељи августа и првој недељи септембра. Ова манифестација афирмише спремање кулинарских специјалитета са роштиља, познатијег као лесковачки роштиљ. За седам дана трајања манифестацију посети више од 500.000 посетилаца што из Србије, што из иностранства и тиме је сврстава у сами врх туристичких приредби у Србији. Године 2018. оборен је рекорд у броју посета током једне вечери, када је на манифестацији било преко 80.000 људи, од чега је половина присуствовала концерту фолк певачице Драгане Мирковић.\\nРоштиљијада представља светски фестивал роштиља и специјалитета са скаре који су у Лесковцу основали Полтика Експрес, ХУП Балкан Лесковац, УГОПРОГРЕС Београд, Лесковачки сајам, Месокомбинат и Туристички савез општине Лесковац. На првој Роштиљијади одржаној 11. октобра 1990. године поводом победе над фашизмом, учешће је узело 63 такмичара из скоро свих југословенских република и покрајина, али и из Грчке, Немачке, Француске, Италије, САД, Аустралије и Мађарске. Највећу пљескавицу на свету направио је Новица Станковић Шапоња, по коме се данас зове ово такмичење у прављењу највеће пљескавице на свету."},{"page_url":"https://gl.wikipedia.org/wiki/Cereal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Roman_harvester%2C_Trier.jpg","page_title":"Cereal","context_page_description":"Os cereais son plantas que se aproveitan principalmente polos seus grans, que botánicamente denomínase cariópside, o cal ten o endosperma con amidón que se pode transformar en fariña e que se presta a varias preparacións alimentarias, e que tamén son a materia prima para a fabricación de bebidas alcohólicas. Ademais do seu uso dietético e en alimentación animal, sácase aceite deles, especialmente do millo.\\nEn sentido estrito só son cereais algunhas gramíneas pero tamén se adoita a considerar como cereais os grans dalgunhas outras familias cultivadas para consumo humano ou animal. Seguindo esta interpretación estrita hai que considerar só seis cereais: o trigo, o millo, o arroz, a cebada, a avea e o centeo; nun sentido máis amplo, téndese a considerar como cereais o millo miúdo, o sorgo e mesmo o alforfón.\\nActualmente os cereais abastecen a maior parte das calorías alimentarias da humanidade.\\nEn termos botánicos os cereais pertencen ás familia poáceas. Algúns grans doutras familias botánicas asimílanse ás veces cos cereais: o gran de alforfón, a quinoa e o sésamo."},{"page_url":"https://pl.wikipedia.org/wiki/Felton_(Herefordshire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Felton_Church_-_geograph.org.uk_-_151752.jpg","page_title":"Felton (Herefordshire)","context_page_description":"Felton – wieś i civil parish w Anglii, w hrabstwie Herefordshire. W 2001 civil parish liczyła 71 mieszkańców. Felton jest wspomniana w Domesday Book jako Feltone."},{"page_url":"https://en.wikipedia.org/wiki/S._Samuel_DiFalco","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Judge_S._Samuel_DiFalco_Gravesite_2006.jpg","page_title":"S. Samuel DiFalco","context_page_description":"S. Samuel DiFalco was a New York Supreme Court Justice and surrogate court judge.\\nBorn in Italy, DiFalco was a Democrat who attempted a run for State Assembly in 1935. He became a justice of the New York Supreme Court in 1949, and was later elected to New York surrogate court. DiFalco was a member of Tammany Hall. In the 1967 constitutional convention, DiFalco successfully opposed an effort to abolish the surrogate court and merge its jurisdiction into the state supreme court. In May 1976, he was indicted along with Justice Irving H. Saypol on official misconduct charges in an alleged scheme to obtain appraisal and auction commission funds for Saypol's son; the charges were dismissed. In February 1978, DiFalco was again indicted, this time for criminal contempt in connection with stating to a grand jury that he could not remember having spoken to an assistant about arranging favorable rulings for his son's law firm. Before the case went to trial, DiFalco died of a sudden heart attack at age 71 while dining with friends at the Columbus Club in Manhattan. He was survived by his wife Emma and his two children Anthony and Elisa."},{"page_url":"https://de.wikipedia.org/wiki/10_vor_Wien","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/10vorWien_Sagenhaft.jpg","page_title":"10 vor Wien","context_page_description":"10 vor Wien ist der Name und die Marke einer Region auf Gemeindeebene im österreichischen Bundesland Niederösterreich. Trägerorganisation ist der Verein Regionalentwicklungsvereines „10 vor Wien – Donau Raum Weinviertel“.\\nGeographisch und räumlich wird die Kleinregion im Weinviertel, im Einzugsbereich der Stadt Wien, durch den Rußbach, den Rohrbach und die Donau festgelegt."},{"page_url":"https://de.wikipedia.org/wiki/Pressignac-Vicq","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Pressignac-vicq.JPG","page_title":"Pressignac-Vicq","context_page_description":"Pressignac-Vicq ist eine französische Gemeinde im Département Dordogne in der Region Nouvelle-Aquitaine. Sie hat eine Fläche von 17,06 km² und 452 Einwohner.\\nNachbargemeinden sind: Sainte-Foy-de-Longas, Mauzac-et-Grand-Castang, Lalinde, Baneuil, Cause-de-Clérans und Saint-Marcel-du-Périgord."},{"page_url":"https://it.wikipedia.org/wiki/Opere_architettoniche_e_artistiche_del_Vittoriano","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Statua_allegorica_della_citt%C3%A0_di_Palermo_-_Eugenio_Maccagnani_-_Vittoriano_%28Roma%29.jpg","page_title":"Opere architettoniche e artistiche del Vittoriano","context_page_description":"Le opere architettoniche e artistiche del Vittoriano, monumento nazionale italiano situato a Roma, sul versante settentrionale del colle del Campidoglio, rappresentano, tramite allegorie e personificazioni, le virtù e i sentimenti che hanno animato gli italiani durante il Risorgimento, il periodo durante il quale l'Italia ha conseguito la propria unità nazionale e la liberazione dalla dominazione straniera. Per tale motivo il Vittoriano è considerato uno dei simboli patri italiani.\\nFu il progettista del monumento, Giuseppe Sacconi, che decise di porre solamente opere d'arte esclusivamente allegoriche, perché riteneva che solo attraverso un'arte priva di ogni riferimento alla contemporaneità si potesse dare al monumento un valore universale, che non risentisse dello scorrere del tempo. Sacconi dovette ripetutamente contrastare le varie proposte di porre all'interno dell'edificio anche opere d'arte che rappresentassero personaggi e fatti storici precisi, al di là, naturalmente del re Vittorio Emanuele II, a cui il monumento è dedicato.\\nCentro architettonico del Vittoriano è la statua equestre di Vittorio Emanuele II, unica rappresentazione non allegorica presente nel monumento."},{"page_url":"https://sl.wikipedia.org/wiki/Donatello","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Gattamelata.jpg","page_title":"Donatello","context_page_description":"Donatello, italijanski kipar, * okoli 1386, † 13. december 1466.\\nDonatello je bil sloviti zgodnjerenesančni italijanski umetnik in kipar iz Firenc. Kiparstvo je popeljal iz pozne gotike v renesanso in velja za enega največjih oblikovalcev vseh kiparskih zvrsti. Posvečal se je risbi, bil je izjemen kipar, spreten pri štukaturah, obvladal je perspektivo, bil pa je tudi arhitekt. Velja za prvega, ki je obvladal ploski relief."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%B2%D0%B8%D0%BB%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Heiwiller%2C_Chapelle_Saint-Wendelin.jpg","page_title":"Эвиллер","context_page_description":"Эвилле́р — коммуна на северо-востоке Франции в регионе Гранд-Эст, департамент Верхний Рейн, округ Альткирш, кантон Альткирш.\\nПлощадь коммуны — 2,04 км², население — 186 человек с тенденцией к стабилизации: 182 человека, плотность населения — 89,2 чел/км²."},{"page_url":"https://de.wikipedia.org/wiki/Peter_Prange","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Peter_Prange_001.jpg","page_title":"Peter Prange","context_page_description":"Peter Prange ist ein deutscher Schriftsteller."},{"page_url":"https://ca.wikipedia.org/wiki/Solmans","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Map_commune_FR_insee_code_23174.png","page_title":"Solmans","context_page_description":"Solmans és una localitat i comuna de França, a la regió de la Nova Aquitània, departament de la Cruesa. La seva població al cens de 1999 era de 544 habitants. Està integrada a la Communauté de communes du Pays de Boussac."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D8%AA%D9%86_%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Martin_Ritt_%28cropped%29.jpg","page_title":"مارتن رت","context_page_description":"مارتن رت كان مخرج افلام من امريكا."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%9D%E1%83%93%E1%83%94%E1%83%A1%E1%83%A2%E1%83%9D-%E1%83%9D%E1%83%9B%E1%83%98%E1%83%A1%E1%83%A2%E1%83%94%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%9D%E1%83%95%E1%83%98%E1%83%9C%E1%83%AA%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Bolivia_department_of_potosi.png","page_title":"მოდესტო-ომისტეს პროვინცია","context_page_description":"მოდესტო-ომისტეს პროვინცია — პროვინცია ბოლივიაში, პოტოსის დეპარტამენტის სამხრეთ ნაწილში. დედაქალაქია ვილიასონი.\\nმოდესტო-ომისტე ერთ-ერთია პოტოსის დეპარტამენტის თექვსმეტი პროვინციიდან. აღმოსავლეთით ესაზღვრება ტარიხას დეპარტამენტი, სამხრეთით და სამხრეთ-დასავლეთით — არგენტინა. ჩრდილოეთიდან სამხრეთისკენ გადაჭიმულია 65 კმ-ზე, აღმოსავლეთიდან დასავლეთისკენ 120 კმ-ზე, ხოლო მთლიანი ფართობი 2 554 კმ²-ს შეადგენს."},{"page_url":"https://de.wikipedia.org/wiki/Furth_(Schwanstetten)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Bauernhaus_in_Furth_%28D-5-76-132-12%29_01.jpg","page_title":"Furth (Schwanstetten)","context_page_description":"Furth ist ein Ortsteil des Marktes Schwanstetten im Landkreis Roth im Regierungsbezirk Mittelfranken. Der Ortsname „Furth“ rührt von einer ehemaligen Furt durch den angrenzenden Hembach her und ist zusammen mit „Neustadt“ und „Vogelherd“ einer der am häufigsten anzutreffenden Ortsnamen Deutschlands."},{"page_url":"https://sh.wikipedia.org/wiki/Theodor_Billroth","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Theodor_Billroth.jpg","page_title":"Theodor Billroth","context_page_description":"Christian Albert Theodor Billroth, austrijski kirurg, kojeg se smatra ocem moderne abdominalne kirurgije, te glazbenik.\\nKao glazbenik cijeli život je bio prijatelj skladatelja Johannesa Brahmsa, bio je patron bečke glazbene scene toga vremena i prvi je pokušao znanstvenu analizu glazbe."},{"page_url":"https://fr.wikipedia.org/wiki/Rouleaux_des_l%C3%A9gendes_du_mont_Shigi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/The_nun_meets_Myoren.jpg","page_title":"Rouleaux des légendes du mont Shigi","context_page_description":"Les Rouleaux des légendes du mont Shigi, aussi traduits en Rouleaux illustrés des antécédents du monastère du mont Shigi ou Légendes du temple du mont Shigi, forment un exemple remarquable de l’emaki, un art pictural japonais dont les bases ont été importées de Chine vers le VIᵉ siècle. Datant approximativement de la fin de l’époque de Heian et réalisés à l’encre de Chine et couleurs sur papier, ils illustrent la biographie romancée du moine Myōren et les légendes qui entourent le monastère bouddhique Chōgosonshi construit sur un versant du mont Shigi, dans l’ancienne province de Yamato. Son classement au titre de trésor national du Japon en 1951 le désigne comme chef-d’œuvre artistique d’une valeur exceptionnelle du patrimoine culturel du Japon et garantit sa conservation et sa protection par l’État japonais. Au-delà de sa valeur artistique, l’œuvre livre un témoignage historique sur la vie quotidienne des gens ordinaires de l’époque de Heian. Les scènes peintes qui se succèdent décrivent des hommes et des femmes au travail, voyageant ou recevant des hôtes."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D9%88%D8%B3%D9%87%E2%80%8C%D9%82%DB%8C%D9%81%E2%80%8C%D8%AF%D9%86%D8%AF%D8%A7%D9%86%E2%80%8C%D8%B3%D8%A7%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Gobiconodon.jpg","page_title":"هوسه‌قیف‌دندان‌سانان","context_page_description":"هوسه‌قیف‌دندان‌سانان نام یک راسته از رده پستانداران است."},{"page_url":"https://en.wikipedia.org/wiki/Coins_of_the_Australian_pound","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/1910-Australian-Shilling-Reverse.jpg","page_title":"Coins of the Australian pound","context_page_description":"The Coins of the Australian pound arose when the Federation of Australia gave the constitutional power to Commonwealth of Australia to mint its own coinage in 1901. The new power allowed the Commonwealth to issue legal tender rather than individually through the six former British self-governing colonies of Queensland, New South Wales, Victoria, Tasmania, South Australia, and Western Australia.\\nHowever, with the adoption of a Federal government in Australia, British coins continued to be used until 1910 when the first Australian silver coins were introduced. These new coins, which included florins, shillings, sixpences and threepences, were all minted with a portrait of Edward VII. A year later Australian pennies and half-pennies entered circulation. In 1931 gold sovereigns stopped being minted in Australia. A crown or five-shilling coin was minted in 1937 and 1938.\\nCoinage of the Australian pound was replaced by decimalised coins of the Australian dollar on 14 February 1966. The conversion rate was A$2 = A£1."},{"page_url":"https://fr.wikipedia.org/wiki/Jorge_Gonz%C3%A1lez_Camarena","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/MuralCamarenaBellasArtes.JPG","page_title":"Jorge González Camarena","context_page_description":"Jorge González Camarena est un peintre et sculpteur mexicain. Il est en particulier connu pour ses peintures murales et comme membre du mouvement muraliste mexicain. Ses œuvres les plus connues sont la peinture murale du bâtiment principal de l'Institut de technologie et d'études supérieures de Monterrey, et celle de l'Université de Concepción."},{"page_url":"https://de.wikipedia.org/wiki/Tod_in_Venedig_(Film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Lido_di_Venezia_-_Hotel_Les_Bains.jpg","page_title":"Tod in Venedig (Film)","context_page_description":"Tod in Venedig ist der Titel eines Films von Luchino Visconti aus dem Jahre 1971. Er beruht auf der Novelle Der Tod in Venedig von Thomas Mann und gehört zu den bekanntesten Adaptionen des Schriftstellers.\\nVon der Vorlage ausgehend schildert Visconti die Entwürdigung Gustav von Aschenbachs, dargestellt von Dirk Bogarde, der dem schönen Knaben Tadzio verfällt, ihn heimlich beobachtet und verfolgt und trotz der sich ausbreitenden Cholera die todbringende Stadt nicht verlässt. Anders als in der Novelle ist der Reisende kein berühmter Schriftsteller, sondern ein gescheiterter und kränkelnder Komponist.\\nMit der detaillierten Beschreibung Venedigs, der Atmosphäre von Dekadenz und Verfall und der spätromantischen Musik Gustav Mahlers gilt der Film vielen Kritikern als Viscontis bedeutendstes Werk und leitete andere Literaturverfilmungen ein, die sich mit Fragen und Problemen medialer Interpretation literarischer Werke beschäftigten. Wie Bogarde selbst angab, war die Rolle des zerrissenen und scheiternden Mannes der Höhepunkt seiner Laufbahn."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%84%D9%8A%D8%A7%D9%85_%D8%A3%D9%88%D8%B3%D8%A8%D9%88%D8%B1%D9%86_%D8%B3%D9%85%D9%8A%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/William_Osborne_Smith_-Past_masters%2C_St_Paul%27s_Lodge%2C_374%2C_ERmontage_of_36_photographs_%28HS85-10-25525%29_%28cropped%29.jpg","page_title":"ويليام أوسبورن سميث","context_page_description":"ويليام أوسبورن سميث هو عسكري كندي، ولد في 1833 في ويلز في المملكة المتحدة، وتوفي في 11 مايو 1887 في سوانزي في المملكة المتحدة."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%DB%8C%D9%BE%E2%80%8C%D9%81%D8%B1%D9%88%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/EnamporGrapefruit1.JPG","page_title":"گریپ‌فروت","context_page_description":"گریپ‌فروت میوه‌ای از خانواده مرکبات با پوست زردرنگ و مزهٔ ترش مایل به تلخی است گریپ‌فروت احتمالاً از پیوند پرتقال و دارابی به دست آمده‌است.\\nاین میوه دارای ویتامین‌ها و ریزمغذی‌های مختلف به ویژه ویتامین ث است. همچنین دارای اسید سیتریک، فیبری به نام پکتین، قند است. نوع سرخ و صورتی آن آنتی‌اکسیدان مفیدی به نام لیکوپن در خود دارند. کاهش کلسترول، کمک به متابولیسم بدن برای سوزاندن چربی‌های اضافی، جلوگیری از تشکیل سنگ کلیه و اثر بازدارنده در سرطان پروستات و روده بزرگ با توجه به خصوصیات آنتی‌اکسیدانی قوی و همین‌طور وجود فلاونوئیدی به نام نارژینین، از دیگر خواص این میوه است، گریپ فروت را براساس رنگ گوشت آن به سه دسته سفید، صورتی و سرخ تقسیم می‌کنند.\\nاین میوه را در زبان انگلیسی «میوهٔ خوشه‌ای» می‌نامند، زیرا به شکل خوشه به مقدار زیادی حتی تا دوازده تا بر روی شاخه می‌روید. دم‌کردهٔ گل‌های گریپ‌فروت برای رفع تب مؤثر اسیت.\\nگریپ‌فروت در درمان کم‌اشتهایی، اختلالات مفصلی و عفونت‌های ریوی، تشنج، بند آمدن ادرار، سوءهاضمه، سرماخوردگی و زخم‌های عفونی، کمبود قند و مواد حیاتی، خارش، بواسیر و خونریزی آن مؤثر است.\\nعصارهٔ هستهٔ گریپ‌فروت خواص فوق‌العادهٔ دارویی قوی دارد.\\nگریپ‌فروت در حال حاضر در چین، هند، خاورمیانه و در ایران هم در شمال و هم جنوب پرورش داده می‌شود."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AE%D0%BD%D0%B4%D0%B8%D0%BD%D1%85%D1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Lugou-Bridge-lions-3591.jpg","page_title":"Юндинхэ","context_page_description":"Юндинхэ — река в Северном Китае, один из семи крупнейших притоков реки Хайхэ. Крупнейшая река, протекающая через провинцию Хэбэй и территорию города центрального подчинения Пекин.\\nРека Юндинхэ образуется из слияния рек Санганьхэ и Янхэ, название Юндинхэ она получает после водохранилища Гуаньтин в уезде Хуайлай провинции Хэбэй. После водохранилища река преодолевает горы Гуаньтин, и в Мэньтоугоу вытекает на равнину. Далее она протекает через районы Фэнтай и Дасин, вновь попадает в провинцию Хэбэй, потом течёт по территории города центрального подчинения Тяньцзинь, и там впадает в реку Хайхэ. Оценки длины реки расходятся в зависимости от того, что считать её основным руслом до водохранилища Гуаньтин, и колеблются от 650 до 747 км.\\nРека была известна своими сменами русла и наводнениями, из-за чего её называли Удинхэ. У неё было как минимум три русла, проходивших через Пекин. В 1698 году по приказу императора, правившего под девизом «Канси», её берега были укреплены, и её нынешнее русло стало постоянным. С той поры река известна под названием Юндинхэ.\\nВ 1189 году через реку был сооружён мост Лугоу, который позднее упомянул в своих записках венецианский путешественник Марко Поло."},{"page_url":"https://fr.wikipedia.org/wiki/Sergio_G%C3%B3mez","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Espana-escocia-sub19-79_%2840133186463%29.jpg","page_title":"Sergio Gómez","context_page_description":"Sergio Gómez Martín, né le 4 septembre 2000 à Badalone, est un footballeur espagnol évoluant au poste de milieu offensif ou d'ailier gauche avec la SD Huesca, en prêt du Borussia Dortmund."},{"page_url":"https://vec.wikipedia.org/wiki/Bailly-le-Franc","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Eglise_de_Bailly-le-Franc.JPG","page_title":"Bailly-le-Franc","context_page_description":"Bailly-le-Franc el xé on comun de 37 abitanti del departemento de Aube che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://es.wikipedia.org/wiki/Eclipse_lunar_de_octubre_de_2005","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Visibility_Lunar_Eclipse_2005-10-17.png","page_title":"Eclipse lunar de octubre de 2005","context_page_description":"Este eclipse lunar parcial tuvo lugar el 17 de octubre de 2005, el segundo de dos eclipses lunares en 2005."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%BA%D8%A7%D8%B1%D8%AF%D8%8C_%D8%A7%D8%B1%D9%85%D9%86%D8%B3%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Geghard_landscape.jpg","page_title":"گغارد، ارمنستان","context_page_description":"گغارد یک روستا در ارمنستان است که در استان کوتایک واقع شده‌است. در کیلومتری شمال گیومری، مرکز استان شیراک واقع شده‌است. در کیلومتری شمال هرازدان، مرکز استان کوتایک واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Finkenstein_am_Faaker_See","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Finkenstein_am_Faaker_See_Faak_Filialkirche_hl._Georg_SW-Ansicht_31052008_01.jpg","page_title":"Finkenstein am Faaker See","context_page_description":"Finkenstein am Faaker See ist eine Marktgemeinde mit 9059 Einwohnern in Kärnten."},{"page_url":"https://en.wikipedia.org/wiki/Pimelea","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Pimelea_brachyphylla_03.jpg","page_title":"Pimelea","context_page_description":"Pimelea, commonly known as rice flowers, is a genus of plants belonging to the family Thymelaeaceae. There are about 150 species, including 110 in Australia and thirty six in New Zealand."},{"page_url":"https://en.wikipedia.org/wiki/Chital","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Chital_range_map.png","page_title":"Chital","context_page_description":"The chital, also known as spotted deer, chital deer, and axis deer, is a species of deer that is native in the Indian subcontinent. The species was first described by German naturalist Johann Christian Polycarp Erxleben in 1777. A moderate-sized deer, male chital reach nearly 90 cm and females 70 cm at the shoulder. While males weigh 30–75 kg, the lighter females weigh 25–45 kg. The species is sexually dimorphic; males are larger than females, and antlers are present only on males. The upper parts are golden to rufous, completely covered in white spots. The abdomen, rump, throat, insides of legs, ears, and tail are all white. The antlers, three-pronged, are nearly 1 m long."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D1%83%D1%89%D0%B5%D1%81%D1%82%D0%B2%D1%83%D1%8E%D1%89%D0%B8%D1%85_%D0%B2%D0%B0%D0%BB%D1%8E%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Emblem_of_the_Bolivarian_Alliance_for_the_Americas.png","page_title":"Список существующих валют","context_page_description":"Список существующих валют содержит информацию о валютах, де-юре или де-факто используемых в различных государственных или территориальных образованиях мира, в том числе с неопределённым международным статусом.\\nВ список включены:\\nвалюты, представленные в мировом стандарте ISO 4217;\\nрасчётные денежные единицы и благородные металлы;\\nвалюты частично признанных и непризнанных, а также виртуальных государств; локальные, частные, мировые валюты."},{"page_url":"https://an.wikipedia.org/wiki/Montenegrins","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Montenegrins%2C_C._M.%2C_1869.jpg","page_title":"Montenegrins","context_page_description":"Os montenegrins son os habitants mayoritarios de Montenegro. Parlan una luenga eslava meridional, o serbocrovate y son cristians ortodoxos. En a Edat Meya feban parte d'o pueblo serbio, y se'n diferencioron en o periodo otomán."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Venlo_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Huize_Elka_Tegelen.jpg","page_title":"Lijst van gemeentelijke monumenten in Venlo (gemeente)","context_page_description":"Naast 236 Rijksmonumenten telt de gemeente Venlo 237 gemeentelijke monumenten. Hieronder een overzicht."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%81%D0%BE%D0%BD,_%D0%94%D0%B6%D0%B5%D1%84%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Jeff_Monson.jpg","page_title":"Монсон, Джефф","context_page_description":"Дже́ффри Уи́льям Мо́нсон, более известный как Джефф Монсон — российский политический и спортивный деятель. Депутат Совета депутатов от партии Единая Россия городского округа Красногорск с 9 сентября 2018 года.\\nВыступает в смешанных единоборствах и бразильском джиу-джитсу. Монсон является двукратным победителем ADCC Submission Wrestling World Championship и чемпионом мира по бразильскому джиу-джитсу. Тренируется в American Top Team."},{"page_url":"https://pt.wikipedia.org/wiki/Tibagi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Trilha_pinturas.jpg","page_title":"Tibagi","context_page_description":"Tibagi é um município brasileiro localizado na região dos Campos Gerais do estado do Paraná, a 200 km da capital, Curitiba, sendo a cidade fundada em 1872. Sua população, conforme estimativas do IBGE de 2019, era de 20 522 habitantes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Unkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Burg_Unkel.jpg","page_title":"Liste der Kulturdenkmäler in Unkel","context_page_description":"In der Liste der Kulturdenkmäler in Unkel sind alle Kulturdenkmäler der rheinland-pfälzischen Stadt Unkel einschließlich der Stadtteile Heister und Scheuren aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://ca.wikipedia.org/wiki/Apogon_pseudomaculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Twospot_cardinalfish_%28_Apogon_pseudomaculatus_%29.jpg","page_title":"Apogon pseudomaculatus","context_page_description":"Apogon pseudomaculatus és una espècie de peix de la família dels apogònids i de l'ordre dels perciformes."},{"page_url":"https://pl.wikipedia.org/wiki/James_Farmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/James_L._Farmer%2C_Jr._NYWTS_1.jpg","page_title":"James Farmer","context_page_description":"James Leonard Farmer junior – amerykański działacz praw człowieka, jeden z czterech przywódców amerykańskiego ruchu obrońców Afroamerykanów w latach 50. i 60. XX wieku.\\nW 1942 był jednym z założycieli Committee of Racial Equality, organizacji walczącej o zniesienie segregacji rasowej w Ameryce bez stosowania przemocy. Inicjował wiele działań, które miały na celu zwrócenie uwagi mediów i ludności Ameryki na prawa Afroamerykanów. W 1966 został wykładowcą Lincoln University, zaś w 1968 otrzymał od prezydenta Richarda Nixona szereg zadań w sektorze ochrony zdrowia i oświaty. Po wycofaniu się z polityki w 1975 założył Fund for an Open Society, licząc na większą integrację społeczeństwa amerykańskiego. W 1985 opublikował autobiografię pt. Lay Bare the Heart, zaś od 1984 do 1998 zajmował się nauczaniem. Od prezydenta Billa Clintona otrzymał Presidential Medal of Freedom. Zmarł z powodu powikłań wywołanych cukrzycą.\\nBył synem Jamesa L. Farmera seniora, profesora Wiley College, autora esejów, teologa i pierwszego Afroamerykanina z Teksasu, który uzyskał doktorat. W filmie Klub dyskusyjny w rolę Farmerów wcielili się Forest Whitaker i Denzel Whitaker."},{"page_url":"https://ru.wikipedia.org/wiki/Solenopsis_geminata","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Solenopsis_geminata_casent0055762_head_1.jpg","page_title":"Solenopsis geminata","context_page_description":"Solenopsis geminata — вид жалящих муравьёв из группы опасных инвазивных огненных муравьёв. Имеет почти космополитное распространение, благодаря человеческой торговле интродуцирован во многие страны."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E5%B4%8E%E3%83%90%E3%82%B9%E5%A4%A7%E6%A9%8B%E5%96%B6%E6%A5%AD%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Nagasakibus_1909.JPG","page_title":"長崎バス大橋営業所","context_page_description":"長崎バス大橋営業所は、長崎県長崎市油木町2番9号にあり、空港連絡バス「エアポートライナー」、長崎市内の短距離一般路線や多くのミニバス路線を担当する長崎自動車の営業所である。"},{"page_url":"https://ast.wikipedia.org/wiki/Historia_del_arte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/El_Greco_-_The_Burial_of_the_Count_of_Orgaz.JPG","page_title":"Historia del arte","context_page_description":"La historia del arte ye la evolución del arte al traviés del tiempu.\\nEntendíu como cualquier actividá o productu realizáu pol ser humanu con finalidá estética o comunicativa, al traviés del qu'espresa idees, emociones o, polo xeneral, una visión del mundu, l'arte emplega diversos recursos, como los plásticos, llingüísticos, sonoros o mistos.\\nLa historiografía del arte, como disciplina académica y redolada institucional suelse acutar a les denominaes artes visuales o plástiques, ente qu'otres artes son más específicamente oxetu d'estudiu d'otres disciplines claramente delimitadas, como la historia de la lliteratura o la historia de la música, siendo toes elles oxetu d'atención pola denomada historia de la cultura o historia cultural, xuntu coles hestories sectoriales enfocaes a otres manifestaciones del pensamientu, como la historia de la ciencia, la historia de la filosofía o la historia de les relixones. Dellos campos de conocencia estrechamente rellacionaos cola historia del arte son la estética y la teoría del arte."},{"page_url":"https://no.wikipedia.org/wiki/Pall","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Victory_podium.png","page_title":"Pall","context_page_description":"En pall var i eldre tid en veggfast benk i stuer og andre oppholdsrom. Pallen var som regel fylt med jord for isolasjonens skyld, og ble enkelte steder kalt moldbenk.\\nEn pall er også en løs lem for oppstabling og transport av stykkgods. Et eksempel på en slik pall er europall.\\nI tillegg er en pall en forhøyning eller oppbygning, som i en seierspall."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%84%E0%B8%A3%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B8%87%E0%B8%AA%E0%B8%B3%E0%B8%AD%E0%B8%B2%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Cosmetics.JPG","page_title":"เครื่องสำอาง","context_page_description":"เครื่องสำอาง เป็นสารที่ใช้เพิ่มเติมความสวยงามให้กับร่างกายมนุษย์ นอกเหนือจากอุปกรณ์รักษาความสะอาดโดยทั่วไป การใช้งานเครื่องสำอางมีใช้กันอย่างแพร่หลาย ทั้งในโลกตะวันตกและโลกตะวันออก จำนวนบริษัทผลิตเครื่องสำอางในปัจจุบันมีเป็นจำนวนน้อยเปรียบเทียบกับธุรกิจชนิดอื่น โดยบริษัทส่วนใหญ่เป็นบริษัทขนาดใหญ่ในระดับนานาชาติ มากกว่าระดับท้องถิ่น"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D9%83%D9%88%D9%83%D9%88%D9%8A%D9%87%D8%A7%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Coquihalla_River.jpg","page_title":"نهر كوكويهالا","context_page_description":"كوكويهالا هوا نهر فى كندا"},{"page_url":"https://cs.wikipedia.org/wiki/T%C5%99%C3%ADda_Canberra","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/HMAS_Canberra_Navantia_%28Ferrol%2C_Spain%29_to_Punta_Langosteira_%28Arteixo%29.jpg","page_title":"Třída Canberra","context_page_description":"Třída Canberra je třída vrtulníkových výsadkových lodí stavěných v současnosti pro Australské námořnictvo. Jsou to vůbec největší válečné lodě, které kdy v australském námořnictvu sloužily. Slouží pro výsadkové operace, záchranné a humanitární operace či mírové mise. Třída je modifikací španělské víceúčelové lodě Juan Carlos I. Jedna loď může přepravovat až 1000 vojáků, 110 vozidel a 8-18 vrtulníků. První jednotka HMAS Canberra byla zařazena do služby v listopadu 2014 a její sesterská loď HMAS Adelaide následovala v roce 2015."},{"page_url":"https://en.wikipedia.org/wiki/Artificial_cartilage","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Cartilage_Structure.jpg","page_title":"Artificial cartilage","context_page_description":"Artificial cartilage is a synthetic material made of hydrogels or polymers that aims to mimic the functional properties of natural cartilage in the human body. Tissue engineering principles are used in order to create a non-degradable and biocompatible material that can replace cartilage. While creating a useful synthetic cartilage material, certain challenges need to be overcome. First, cartilage is an avascular structure in the body and therefore does not repair itself. This creates issues in regeneration of the tissue. Synthetic cartilage also needs to be stably attached to its underlying surface, bone. Lastly, in the case of creating synthetic cartilage to be used in joint spaces, high mechanical strength under compression needs to be an intrinsic property of the material."},{"page_url":"https://en.wikipedia.org/wiki/Bonda_mastiff_bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Molossus_currentium_map.png","page_title":"Bonda mastiff bat","context_page_description":"The Bonda mastiff bat or Thomas's mastiff bat, is a species of mastiff bat from South and Central America. It is named for the town of Bonda, near Santa Marta in Colombia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%88%D1%82%D0%BE%D0%B2%D0%B8%D0%B9_%D0%BF%D0%B0%D0%BD%D1%86%D0%B5%D1%80%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/USS_Monitor_plans.jpg","page_title":"Баштовий панцерник","context_page_description":"Баштовий панцерник — тип бойових кораблів 19-го століття, перші кораблі де гармати було встановлено у гарматних баштах, замість бортового розташування гармат."},{"page_url":"https://en.wikipedia.org/wiki/Conciliation_cross","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Kleinrettbach-Grabsleber-Kreuz-2.jpg","page_title":"Conciliation cross","context_page_description":"A conciliation cross was a stone cross, which was set up in a place where a murder or accident had happened. These memorial crosses are mostly in central and western Europe."},{"page_url":"https://sv.wikipedia.org/wiki/Slaget_vid_Narva","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/AM.010446.jpg","page_title":"Slaget vid Narva","context_page_description":"Slaget vid Narva var ett fältslag som utkämpades vid staden Narva i nordöstra Estland den 20 november 1700. Det var ett av de största slagen under stora nordiska kriget mellan 1700 och 1721, och stod mellan en svensk armé under befäl av kung Karl XII och en rysk armé under befäl av fältmarskalk Charles Eugène de Croÿ.\\nI februari 1700 inleddes kriget när en allians mellan Danmark-Norge, Sachsen-Polen och Ryssland anföll Sveriges allierade Holstein-Gottorp och de svenska östersjöprovinserna. Det danska hotet avvärjdes efter en svensk landstigning på Själland och den påföljande freden i Traventhal, vilket gav svenskarna tillfälle att undsätta Narva, som hotades av en rysk armé på 37 000 soldater. Den ryska armén belägrade staden i september 1700, varvid man byggde en befäst inneslutningsvall, bestyckad med artilleri, runt staden till skydd mot svenska undsättningsförsök och gjorde stormningsförsök mot den närliggande svenska fästningen Ivangorod.\\nI oktober landsteg Karl XII i Pernau och samlade en armé på omkring 10 500 soldater, och efter en lång och mödosam marsch anlände svenskarna till Narvas utkanter."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Gavere","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/De_Klokke%2C_Baaigemstraat_354%2C_Baaigem.jpg","page_title":"Lijst van onroerend erfgoed in Gavere","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Gavere. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://ro.wikipedia.org/wiki/Raionul_Kal%C3%AEnivka,_Vinni%C8%9Ba","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Kalynivskyi-Raion.png","page_title":"Raionul Kalînivka, Vinnița","context_page_description":"Kalînivka este un raion în regiunea Vinnița, Ucraina. Reședința sa este orașul Kalînivka."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%85%D1%8C%D1%8F%D0%BD%D0%BE%D0%B2%D0%B0,_%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/SahianovaMM.jpg","page_title":"Сахьянова, Мария Михайловна","context_page_description":"Сахьянова Мария Михайловна — член коммунистической партии с 1916 года, видный партийный и государственный деятель СССР, внесла большой вклад в образование и становление Бурят-Монгольской АССР, в качестве уполномоченного Комиссии партийного контроля при ЦК ВКП М. М. Сахьянова приняла самое активное участие в уничтожении партийных и советских кадров Чувашской АССР и Башкирской АССР."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%9A%E6%A3%98%E6%B5%B7%E7%9B%A4%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/%E6%B5%B7%E6%98%9F%EF%BC%88%E6%AD%A3%E9%9D%A2%EF%BC%89.JPG","page_title":"多棘海盤車","context_page_description":"多棘海盘车是一种原产于中国、日本、韩国和俄罗斯沿岸的海星。 后来被船只携带，引入了塔斯马尼亚岛、阿拉斯加、欧洲和缅因州附近海域。 在许多地区它都是入侵物种，更是世界百大外来入侵种之一。\\n多棘海盘车对入侵地的生态和经济都有重大影响，它既捕食幼年双壳纲生物从而对当地经济捕捞产生影响，也造成了一些濒危物种的数量衰退。 即使是在原产地日本，当地海洋养殖业每年也还会花去上百万美元来控制多棘海盘车的扩张。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%89%B2%E7%90%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sun_Atmosphere_Temperature_and_Density_SkyLab.jpg","page_title":"色球","context_page_description":"色球或色球层是太阳大气层主要三层中的第二层，厚度大约2,000公里，位于光球层的上方和过渡区的下方。\\n色球层的密度相当低，它的起始处，也就是色球层的底部，密度只有光球的10⁻⁴倍；相较于地球的大气层，更只有10⁻⁸。这使它平常无法被看见，只有在日全食的短暂时间中可以看见它展现出略带红色的色调，颜色介于红色和粉红色之间。\\n然而，若没有特殊的设备，因为光球层压倒性的明亮效果，所以无法看见色球层。\\n色球层的密度随着与太阳中心的距离增加而降低，从每立方公分10¹⁷颗微粒呈指数下降，或从大约1.6×10¹¹ kg/m³到最外的边界处为2×10⁴ kg/m³。温度从内侧边界6,000K到最低处大约是3,800K，然后向外增加至外侧与日冕过渡区交界处的温度大约是35,000K。\\n图1.呈现色球层的温度和密度随距离变化呈现的趋势。\\n除了太阳，人类也观察过其它恒星的色球层。"},{"page_url":"https://ro.wikipedia.org/wiki/Javier_Pastore","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/PSG-Shakhter15_%2812%29.jpg","page_title":"Javier Pastore","context_page_description":"Javier Matías Pastore este un fotbalist argentinian care evoluează în Serie A la clubul Roma și la echipa națională de fotbal a Argentinei.\\nEl și-a început cariera la Talleres, apoi a jucat un timp la Huracán, ambele din Argentina. În 2009 s-a transferat în Serie A la echipa Palermo contra sumei de 4,7 milioane €. În 2011, clubul Paris Saint-Germain din Ligue 1 a plătit pentru achiziția sa 39,8 milioane €."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D0%B8%D0%B0%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Location_map_Armenia_Syunik_province.png","page_title":"Сисиан","context_page_description":"Сисиа́н — город в Армении, в Сюникской области, на Сисианской равнине.\\nРанее входил в состав Сисианского района Армянской ССР и являлся его административным центром."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Ferrovi%C3%A1ria_de_Alfarelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Estacao_Alfarelos_Granja_Ulmeiro.jpg","page_title":"Estação Ferroviária de Alfarelos","context_page_description":"Formoselha - St. Varão\\nAlfarelos\\nMontemor\\nVila Nova de Anços\\nA Estação Ferroviária de Alfarelos, originalmente denominada de Alfarellos, e igualmente conhecida como Alfarelos - Granja do Ulmeiro, é uma gare da Linha do Norte e do Ramal de Alfarelos, situada na freguesia de Granja do Ulmeiro, no concelho de Soure, em Portugal. Enquanto ponto de entroncamento do Ramal de Alfarelos na Linha do Norte, faz uma ligação ferroviária importante entre Coimbra, Figueira da Foz, Porto, e Lisboa."},{"page_url":"https://de.wikipedia.org/wiki/Hitchcock_County","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Massacre_Canyon_monument_from_NE_1.JPG","page_title":"Hitchcock County","context_page_description":"Hitchcock County ist ein County im US-Bundesstaat Nebraska. Der Verwaltungssitz ist Trenton, benannt nach der Stadt Trenton in New Jersey."},{"page_url":"https://es.wikipedia.org/wiki/William_J._Seymour","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/William_J._Seymour_%28cropped%29.jpg","page_title":"William J. Seymour","context_page_description":"William Joseph Seymour fue un pastor estadounidense, iniciador del movimiento pentecostal."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E9%A0%98%E5%9C%9F%E3%81%AE%E5%A4%89%E9%81%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/United_States_1861-08-1862.png","page_title":"アメリカ合衆国領土の変遷","context_page_description":"アメリカ合衆国領土の変遷は、アメリカ合衆国の内外境界の変更、さらにはその状態と改名を含む変遷の一覧である。領土の図には最終的にアメリカ合衆国の一部となった周辺地域も示す。各段階ごとに地図があり、その時にどのような具体的変化があったかを示す。\\n1783年のパリ条約で独立を達成した後のアメリカ合衆国は西方に拡張し、その境界を7度広げたが、イギリスとスペインの植民地との間にそれぞれ1回の大きな国境調整があり、また数度の小さな論争があった。最初の13州が50州にまで成長し、その大半は準州として始まって州に昇格した。この成長の一般的なやり方は、領土の拡大、新規獲得領地から準州の成立、これら準州の境界修正、そして最後の州昇格という過程を通った。ネバダ州とミズーリ州の2州は州になってから大きくなり、ジョージア州、マサチューセッツ州、ノースカロライナ州、テキサス州およびバージニア州の5州は新しい州を創設するために小さくなった。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AF%BB%E6%9E%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/2008-03-14_Jiang_Wen.jpg","page_title":"寻枪","context_page_description":"《尋槍》是2002年上映的一部中國電影。本片是陸川導演和編劇的處女作，主要演員有姜文、寧靜、石涼、伍宇娟等。\\n電影改編自中國作家凡一平的小說《尋槍記》，情節圍繞中國貴州山區的小鎮警察馬山在遺失配槍後尋槍的歷程展開。電影表達了現代人迷失自我與拯救自我的主題。本片被認為模仿與借鑑了日本導演黑澤明的名作《野良犬》，該片也圍繞著尋槍這一主線展開。\\n2002年4月21日，電影在第九屆北京大學生影展上首映。4月28日，電影在上海試映，成為中國首部採用數位技術放映的電影。同年5月9日電影在中國各地正式公映。"},{"page_url":"https://de.wikipedia.org/wiki/Rathaus_(Waldkirch)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Rathaus_%28Waldkirch%29.JPG","page_title":"Rathaus (Waldkirch)","context_page_description":"Das Rathaus in Waldkirch, einer Großen Kreisstadt im Landkreis Emmendingen in Baden-Württemberg, wurde ursprünglich 1562/63 erbaut und nach dem Stadtbrand vom 28. Juli 1638 in den Jahren 1653/54 wiedererrichtet. Das Rathaus am Marktplatz 1 ist ein geschütztes Kulturdenkmal.\\nIn der zweiten Hälfte des 18. Jahrhunderts erfolgte im Erdgeschoss der Einbau reich verzierter Fenstergewände: Zwei Doppelfenster zum Marktplatz, eine vierteilige Fenstergruppe an der Giebelseite und zwei Einzelöffnungen an der Rücktraufe. Ebenso wurde zu gleicher Zeit ein traufseitiges Portal sowie zwei Eckkanzeln im Obergeschoss geschaffen.\\nVon 2014 bis 2016 wurde das Gebäude umfassend renoviert und der Baubestand wissenschaftlich untersucht. Dabei wurden auch die NS-Wandbilder des Künstlers Schroeder-Schoenenberg überdeckt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Northamptonshire_County_Cricket_Club_grounds","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Springtime_in_Campbell_Park_-_geograph.org.uk_-_368817.jpg","page_title":"List of Northamptonshire County Cricket Club grounds","context_page_description":"Northamptonshire County Cricket Club was established on 31 July 1878. The county entered the Minor Counties Championship in 1895 and competed in the competition until 1904, after which it was elevated to first-class status for the 1905 season. It has since played first-class cricket from 1905, List A cricket from 1963 and Twenty20 cricket from 2003, using a different number of home grounds during that time. The County Ground in Northampton has played host to the club's first home fixtures in all three formats of the game; in first-class cricket in 1905 against Leicestershire; in List A cricket in 1963 against Warwickshire; and in Twenty20 cricket against Somerset in 2003. Northamptonshire have played home matches at sixteen grounds, but have played the majority of their home fixtures at the County Ground, which has also held One Day Internationals.\\nThe sixteen grounds that Northamptonshire have used for home matches since 1895 are listed below, with statistics complete through to the end of the 2014 season."},{"page_url":"https://en.wikipedia.org/wiki/Molkenmarkt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Berlin%2C_Mitte%2C_Molkenmarkt%2C_1902.jpg","page_title":"Molkenmarkt","context_page_description":"Molkenmarkt is the oldest square in Berlin. It is located in the Alt-Berlin quarter of the Mitte district, in the historic centre of the city. With approximately 9,200 square metres in size, it is today a major traffic junction, dominated by the large Altes Stadthaus administrative building on its southeastern side."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%8C%97%E8%91%B5%E6%B6%8C%E5%85%AC%E5%85%B1%E5%9C%96%E6%9B%B8%E9%A4%A8%E6%9A%A8%E5%8C%97%E8%91%B5%E6%B6%8C%E8%A1%97%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/North_Kwai_Chung_Market_%282%29.jpg","page_title":"北葵涌公共圖書館暨北葵涌街市","context_page_description":"北葵涌公共图书馆暨北葵涌街市共用同一栋大楼，位于香港新界葵涌石荫路，由区域市政局兴建，在1985年启用；大楼分为上下两部分，图书馆3至4楼，街市位于地下及2楼，昔日皆由区域市政总署管理，区域市政局解散后，分别由康文署及食理署管理。"},{"page_url":"https://en.wikipedia.org/wiki/Shipwreck_Rapids","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Former_Shipwreck_Rapids_On-ride_photo_kiosk.jpg","page_title":"Shipwreck Rapids","context_page_description":"Shipwreck Rapids is a River rapids ride currently operating at SeaWorld San Diego in San Diego, California. This attraction is located in the Shipwreck Island themed area of the park, themed to a South Pacific island where many ships and their crews have been marooned. The four stranded ships are the Implausible, RMS Royal Star, Wholly Mackerel, and Dream Boat II.\\nThe other main part of the area is a restaurant named the Shipwreck Reef Cafe. Every so often a ship's horn can be heard, followed by a SOS signal in Morse Code.\\nThe ride has guests board yellow and white circular rafts, with a max capacity of 9, via a rotating platform station."},{"page_url":"https://it.wikipedia.org/wiki/Caporetto","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Kobarid.JPG","page_title":"Caporetto","context_page_description":"Caporetto è un comune della Slovenia, appartenente alla regione statistica del Goriziano, posto al confine con l'Italia. Con un popolazione di 4 079 abitanti ed un'area di 197 km², il comune è formato da 33 località: la più popolata è il centro omonimo, sede comunale, che conta 1 092 abitanti; quella meno popolata è Magosti con 68 residenti."},{"page_url":"https://de.wikipedia.org/wiki/Niedaltdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/REHLINGEN_NIEDALTDORF_nieder.svg","page_title":"Niedaltdorf","context_page_description":"Niedaltdorf ist ein Ortsteil der Gemeinde Rehlingen-Siersburg im Landkreis Saarlouis."},{"page_url":"https://fr.wikipedia.org/wiki/Ordre_de_bataille_lors_de_la_bataille_d%27Eylau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Guard_Grenadier_at_Eylau.jpg","page_title":"Ordre de bataille lors de la bataille d'Eylau","context_page_description":"Ce qui suit est l'ordre de bataille des forces militaires en présence lors de la bataille d'Eylau, qui eut lieu le 8 février 1807 lors de la Campagne de Prusse et de Pologne pendant les guerres de la Quatrième Coalition de 1806 à 1807."},{"page_url":"https://fi.wikipedia.org/wiki/Halla_(yritys)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Hallan_sahan_voimalaitos.JPG","page_title":"Halla (yritys)","context_page_description":"Halla Oy oli vuosina 1875–1932 Kymin kunnassa toiminut metsäteollisuusyritys, joka omisti useita sahalaitoksia. Yhtiö oli alun perin norjalaisomistuksessa, mutta se siirtyi vuonna 1916 Kymi Oy:n hallintaan, koska norjalaisomistajat halusivat luopua useita vuosia tappiollisena toimineesta yrityksestä. Halla Oy fuusioitiin Kymi Oy:hyn vuoden 1933 alussa.\\nHalla Oy sai alkunsa, kun norjalainen Aslak Holmsen vuokrasi vuonna 1873 Kymijoen suulta Hallansaaren 50 vuodeksi. Holmsen ja kahdeksan hänen yhtiökumppaniaan saivat senaatilta höyrysahan perustamisluvan vuonna 1875 ja Hallan saha aloitti toimintansa vuonna 1876. Sahan toiminta jatkui aina vuoteen 1986 saakka.\\nHalla-yhtiö rakensi 1910 puutavaran kuljetusta varten uittoreitin Saimaalta Kymijoelle. Reitti alkoi Savitaipaleelta ja kulki vesistöjä pitkin Mäntyharjun ja Vuohijärven kautta Verlaan ja edelleen Voikkaalle. Reitillä tukit jouduttiin kuljettamaan maakannaksen yli rataa pitkin Orraintaipaleessa, Honkataipaleessa, Voikoskella, Verlassa ja Voikkaalla. Pisin näistä kuljetusradoista oli noin kuusi kilometriä pitkä Honkataipaleen rata, jolla käytettiin höyryvetureita. Järviosuuksilla käytettiin hinaajia lauttojen vetämiseen."},{"page_url":"https://en.wikipedia.org/wiki/Women_in_the_Catholic_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Hildegard_von_Bingen.jpg","page_title":"Women in the Catholic Church","context_page_description":"In the history of the Catholic Church, women have played a variety of roles and the church has affected societal attitudes to women worldwide in significant ways. Women constitute the majority of members of consecrated life in the Catholic Church: in 2010, there were around 721,935 professed women religious."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D0%BE%D0%BF%D1%82%D0%B5%D1%80%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Bezpeka-ta-vzaemodia-v-Ukraini-_bez-stopterror.png","page_title":"Стоптерор","context_page_description":"«Стоптерор» — суспільний некомерційний проект, який проводить OSINT-дослідження та займається вивченням гібридної війни в Україні, а також надає можливість громадянам повідомляти про злочини."},{"page_url":"https://en.wikipedia.org/wiki/486958_Arrokoth","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/PIA21867-2014MU69-BinaryObject-ArtConcept-20170804.jpg","page_title":"486958 Arrokoth","context_page_description":"486958 Arrokoth, provisional designation 2014 MU₆₉, is a trans-Neptunian object located in the Kuiper belt. It is a contact binary 36 km long, composed of two planetesimals 21 km and 15 km across, nicknamed \\"Ultima\\" and \\"Thule\\", respectively, that are joined along their major axes. Ultima, which is flatter than Thule, appears to be an aggregate of 8 or so smaller units, each approximately 5 km across, that fused together before Ultima and Thule came into contact. Because there have been few to no disruptive impacts on Arrokoth since it formed, the details of its formation have been preserved. With the New Horizons space probe's flyby at 05:33 on 1 January 2019, Arrokoth became the farthest and most primitive object in the Solar System visited by a spacecraft. At the time of the New Horizons flyby, the object had been nicknamed Ultima Thule.\\nArrokoth was discovered on 26 June 2014 by astronomer Marc Buie and the New Horizons Search Team using the Hubble Space Telescope as part of a search for a Kuiper belt object for the New Horizons mission to target in its first extended mission; it was chosen over two other candidates to become the primary target of the mission."},{"page_url":"https://no.wikipedia.org/wiki/Michael_Spindelegger","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Michael_Spindelegger_par_Claude_Truong-Ngoc_novembre_2013.jpg","page_title":"Michael Spindelegger","context_page_description":"Michael Spindelegger er en østerriksk konservativ politiker. Spindelegger var utenriksminister 2008–2013. Han var visekansler og partiformann fra 2011 til han forlot alle verv i 2014. Han var finansminister i 2014."},{"page_url":"https://cs.wikipedia.org/wiki/Kim_Jong-%C4%8Dchol","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Kim_Yong_Chol_2019.jpg","page_title":"Kim Jong-čchol","context_page_description":"Kim Jong-čchol je severokorejský generál a politik, od roku 2010 člen Ústředního výboru Korejské strany práce.\\nOd února 2009 do ledna 2016 byl ředitelem korejské zpravodajské služby.\\nÚčastnil se obou proběhlých setkání Donalda Trumpa s Kim Čong-unem, v červnu 2018 v Singapuru a v únoru 2019 ve Vietnamu."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%82%A4%E3%82%AF%E3%83%AD%E3%82%A4%E3%83%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Hypocycloid2.png","page_title":"サイクロイド","context_page_description":"サイクロイド とは、円がある規則にしたがって回転するときの円上の定点が描く軌跡として得られる平面曲線の総称である。一般にサイクロイドといえば定直線上を回転するものを指すことが多い。擺線とも呼ばれる。サイクロイドと併せて外サイクロイドや内サイクロイドについても解説する。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D1%81%D1%82%D0%B0%D0%B2%D0%B0_%D0%9A%D0%BB%D0%B8%D1%88%D0%B8_(%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Le_mar%C3%A9chal_Monsey_%C3%A0_la_barri%C3%A8re_de_Clichy.jpg","page_title":"Застава Клиши (картина)","context_page_description":"«Заста́ва Клиши́» или «Заста́ва Клиши́. Оборо́на Пари́жа, 30 ма́рта 1814» — картина французского художника Ораса Верне, написанная им в 1820 году.\\nТворчество Верне, известного своими батальными картинами и полотнами на исторические темы, пользовалось спросом у французской элиты. В 1820 году художник получил заказ на картину от Клода Одио, придворного ювелира Наполеона. Он, как и сам Верне, принял активное участие в обороне заставы Клиши, возглавляемой маршалом Монсеем во время недолгой обороны Парижа от армии Шестой коалиции в 1814 году. На картине изображён эпизод из обороны Клиши, когда маршал Монсей отдаёт приказ полковнику Одио не допустить захвата русскими войсками Монмартра. Вокруг данной центральной группы полотна на фоне теряющихся в дыму канонады укреплений и здания заставы Клиши стоят и лежат раненые солдаты, вдалеке сражаются волонтёры-бонапартисты, а рядом сидит крестьянка-беженка с грудным ребёнком. Из-за своего про-бонапартистского содержания работа не была допущена на Парижский салон 1822 года, после чего Верне организовал частную выставку у себя в студии, на которой и выставил данное полотно."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D9%8A%D8%B1_%D9%81%D8%A7%D9%86_%D9%87%D9%88%D9%8A%D8%AF%D9%88%D9%86%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Gen%C3%A8ve_Indoors_2014_-_20140114_-_Pierre_van_Hooijdonk.jpg","page_title":"بيير فان هويدونك","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبيير فان هويدونك لاعب كورة قدم من مملكة نيديرلاند."},{"page_url":"https://tr.wikipedia.org/wiki/Uruguay%27daki_%C5%9Fehirler_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Uruguay-CIA_WFB_Map.png","page_title":"Uruguay'daki şehirler listesi","context_page_description":"Bu liste, Uruguay'daki şehirler listesidir."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%DB%8C%D9%86%DA%A9_(%D9%85%D9%86%D8%B7%D9%82%D9%87_%D8%A8%D8%B1%DA%A9%D9%84%D9%88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Znaktynec.png","page_title":"تینک (منطقه برکلو)","context_page_description":"تینک (منطقه برکلو) یک منطقهٔ مسکونی در جمهوری چک است که در Břeclav District واقع شده‌است."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AA%E0%A4%BE%E0%A4%95%E0%A4%BF%E0%A4%B8%E0%A5%8D%E0%A4%A4%E0%A4%BE%E0%A4%A8_%E0%A4%B8%E0%A5%8D%E0%A4%AE%E0%A4%BE%E0%A4%B0%E0%A4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Petals_of_Pakistan_Monument%2C_Islamabad.jpg","page_title":"पाकिस्तान स्मारक","context_page_description":"पाकिस्तान स्मारक या पाकिस्तान माॅन्युमेन्ट पाकिस्तान की राजधानी इस्लामाबाद में स्थित, पाकिस्तान का राष्ट्रीय स्मारक एवं पाकिस्तानी क़ौम का स्मारकीय प्रतीक है। इसे मई २००४ से मार्च २००७ के बीच इस्लामाबाद के शकरपारियां पहाड़ी के पश्चिमी सिरे पर बनाया गया था। पुष्पाकार बनावट वाले इस स्मारक की बनावट को आरिफ़ मसूद नामक एक पाकिस्तानी विस्तुकार ने तईयार किया था। इसकी बनावट को पाकिस्तान की सभ्यत, संस्कृती, वैचारिक नीव एवं पाकिस्तान आन्दोलन की कहानी को बयां करती है। इसकी चार बडी पंखुड़ियां, पाकिस्तान के प्रांतों का, व छोटी पंखुड़ियां प्रदेशों का प्रतिनिधित्व करती हैं। यह मूलतः पाकिस्तान आनंदोलन के शहीदों को समर्पित है।"},{"page_url":"https://fr.wikipedia.org/wiki/Minist%C3%A8re_des_Affaires_%C3%A9trang%C3%A8res_(Serbie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Jeremic_Vuk.jpg","page_title":"Ministère des Affaires étrangères (Serbie)","context_page_description":"Le ministère des Affaires étrangères est le département ministériel du gouvernement serbe chargé de mettre en œuvre la politique extérieure de la Serbie."},{"page_url":"https://de.wikipedia.org/wiki/Schlacht_bei_Schliengen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Jean-Victor_Moreau.jpg","page_title":"Schlacht bei Schliengen","context_page_description":"Die Schlacht bei Schliengen war eine Schlacht des Ersten Koalitionskrieges, in der sich die Armeen Österreichs und der französischen Republik gegenüberstanden. Sie fand am 24. Oktober 1796 im Markgräflerland zwischen Basel und Freiburg im Breisgau statt. Das Kampffeld erstreckte sich auf Schliengen, Steinenstadt, Sitzenkirch und Kandern."},{"page_url":"https://sv.wikipedia.org/wiki/Godby","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Optinova%2C_Godby%2C_%C3%85land.jpg","page_title":"Godby","context_page_description":"Godby är den näst största tätorten på Åland med 1 293 invånare. I Godby ligger Godby högstadieskola med norra Åland som upptagningsområde. Det finns ett nybyggt idrottscenter med tennisplan, simhall, idrottshall samt gym."},{"page_url":"https://et.wikipedia.org/wiki/Mill_Ends_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Mill_Ends_Park.jpg","page_title":"Mill Ends Park","context_page_description":"Mill Endsi park on park Ameerika Ühendriikides Oregoni osariigis Portlandis.\\nPargi läbimõõt on 61 sentimeetrit. 1971. aastal nimetati roheala Guinnessi rekordite raamatus maailma väikseimaks pargiks.\\nSama osariigi pealinnas Salemis, umbes 75 km kaugusel lõunaedelas asub 23 m² suurune Waldo park."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%B0_%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Zilupes_kato%C4%BCu_bazn%C4%ABca_2000-07-22.jpg","page_title":"Города Латвии","context_page_description":"В Латвии статус города присвоен 76 населённым пунктам.\\nИз них 9 имеют статус республиканских городов, 67 — статус краевых городов."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%83%E9%9D%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/MtShichimen_StoneSteps.jpg","page_title":"七面山","context_page_description":"七面山は山梨県南巨摩郡にある1,989mの山。三角点は1,982.4m。日本二百名山の一つに選定されている。\\n東側は身延山、富士川を隔てて天子山地と対峙し、西側には笊ヶ岳、青薙山など、赤石山脈南部、白峰南嶺の山々が連なる。\\n山頂東北部の約73haが歴史的に久遠寺の寺領であり、現在も周囲を早川町に囲まれた身延町の飛地である。"},{"page_url":"https://en.wikipedia.org/wiki/Arthur_Thomson_(naturalist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/John_Arthur_Thomson_%281861-1933%29.jpg","page_title":"Arthur Thomson (naturalist)","context_page_description":"Sir John Arthur Thomson FRSE LLD was a Scottish naturalist who authored several notable books and was an expert on soft corals."},{"page_url":"https://ro.wikipedia.org/wiki/Ii","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Ii_railway_station_-_Ii%2C_Finland.jpg","page_title":"Ii","context_page_description":"Ii este o comună din Finlanda."},{"page_url":"https://ru.wikipedia.org/wiki/Fratria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/%D0%9F%D0%B8%D1%80%D0%BE%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D1%88%D0%BE%D1%83_%D0%BD%D0%B0_%D0%BC%D0%B0%D1%82%D1%87%D0%B5_%D1%81_%22%D0%9B%D0%BE%D0%BA%D0%BE%D0%BC%D0%BE%D1%82%D0%B8%D0%B2%D0%BE%D0%BC%22.jpg","page_title":"Fratria","context_page_description":"Fratria — фанатское объединение и движение болельщиков спортивного общества «Спартак». Созданное 28 октября 2005 года объединение «Фратрия» уже к 2008 году по некоторым оценкам насчитывало порядка десяти тысяч членов, считаясь крупнейшей фанатской организацией общества «Спартак».\\nВ руководство организации входят:\\nСовет «Фратрии», состоящий из лидеров авторитетных объединений болельщиков «Спартака»;\\nУльтрас-совет, состоящий из представителей ультрас-групп и ответственных за каждое направление суппорта.\\nИстинным фанатам «Спартака» категорически запрещено смотреть фильмы вселенной «Marvel», а также критиковать посёлок «Спартановка», курить кальян и кататься на электросамокатах.\\nТрадиционными местами расположения участников объединения на спортивных соревнованиях являются:\\nна футбольных матчах: стадион «Локомотив» — южная трибуна; БСА «Лужники» — трибуна B; стадион «Спартак» — северная трибуна;\\nна хоккейных матчах: ДС «Сокольники» — южная трибуна; ДС «Лужники» — трибуна D; Ледовый дворец «Парк легенд» — сектора 213, 214;\\nна мини-футбольных матчах: ДС «Триумф»;\\nна гандбольных матчах: ДС «Динамо»;\\nна матчах пляжного футбольного клуба: центр пляжных видов спорта «СССР» в Химках;"},{"page_url":"https://it.wikipedia.org/wiki/Tickford","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Castle_Hill%2C_Lincoln_-_Vehicle_-_geograph.org.uk_-_1634578.jpg","page_title":"Tickford","context_page_description":"Tickford è un'azienda di ingegneria automobilistica che affonda le proprie radici nei primi decenni del XIX secolo come costruttore di carrozze, fino ad arrivare alla costruzione di carrozzerie per autoveicoli in tempi moderni."},{"page_url":"https://eo.wikipedia.org/wiki/Vilovo","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Titel_mun.png","page_title":"Vilovo","context_page_description":"Vilovo, serbe Вилово, hungare Tündéres [tundEreŝ] estas vilaĝo en Serbio, en provinco Vojvodino, en distrikto Suda Baĉka, en municipo de Titel."},{"page_url":"https://pl.wikipedia.org/wiki/Stanis%C5%82aw_Jerzy_Lec","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Stanislaw_Jerzy_Lec_Polish_writer.jpg","page_title":"Stanisław Jerzy Lec","context_page_description":"Stanisław Jerzy Lec, pseud. literacki Stach, właśc. baron Stanisław Jerzy de Tusch-Letz – polski poeta, satyryk i aforysta."},{"page_url":"https://en.wikipedia.org/wiki/Suyat","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Eskayascript.gif","page_title":"Suyat","context_page_description":"Suyat is the modern collective name of the indigenous scripts of various ethno-linguistic groups in the Philippines prior to Spanish colonization in the 16th century up to the independence era in the 21st century. The scripts are highly varied; nonetheless, the term was suggested and used by cultural organizations in the Philippines to denote a unified neutral terminology for Philippine indigenous scripts."},{"page_url":"https://es.wikipedia.org/wiki/Carmen_Castillo_(cineasta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Castillo%2C_Carmen_-FILSA_2015_11_07_fRF03.jpg","page_title":"Carmen Castillo (cineasta)","context_page_description":"María del Carmen Castillo Echeverría es una cineasta, principalmente documentalista, y guionista chilena naturalizada francesa."},{"page_url":"https://en.wikipedia.org/wiki/List_of_sniper_rifles","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Ai_as50.png","page_title":"List of sniper rifles","context_page_description":"This page is a listing of major precision rifle variants used by snipers from around the world.\\nA hunting or precision rifle equipped with a telescopic optic has been long described as a sniper rifle. A person trained in the skills and art of sniping uses many weapons to complete the task and mission given. The weapon doesn't necessarily have to be equipped with a telescopic optic. All snipers have a primary weapon. The secondary weapon is a precision rifle of some kind equipped with a telescopic optic and it is this weapon that is mistakenly referred to as a sniper rifle. Below is the list of precision rifles used by both military and law enforcement trained snipers and marksmen."},{"page_url":"https://pl.wikipedia.org/wiki/Artur_Burszta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Artur_Burszta2.jpg","page_title":"Artur Burszta","context_page_description":"Artur Burszta – polski wydawca, dyrektor i właściciel Biura Literackiego.\\nWydawca blisko pół tysiąca książek, w tym m.in. utworów Tymoteusza Karpowicza, Jacka Dehnela, Romana Honeta, Krystyny Miłobędzkiej, Andrzeja Sosnowskiego, Marty Podgórnik, Tadeusza Różewicza, Eugeniusza Tkaczyszyna-Dyckiego i Rafała Wojaczka.\\nDziałacz samorządowy w latach 1990-1998. Realizator w latach 1993-1995 wraz z Berliner Festspiele Niemiecko-Polskich Spotkań Pisarzy. Od 1996 roku dyrektor festiwalu literackiego „Fort Legnica” a od 2004 roku „Port Wrocław”. Autor programów telewizyjnych „Poezjem” oraz „Poeci”, a także filmu „Dorzecze Różewicza”.\\nPomysłodawca licznych projektów i programów literackich, m.in.: „Barbarzyńcy i nie”, „Komiks wierszem”, „Nakręć wiersz”, „Poezja polska od nowa”, „Pogotowie poetyckie”, „Piosenki na papierze”, „Połów. Poetyckie debiuty”, „Szkoła z poezją”, „Zagraj literaturą”. Animator działań integrujących europejskie środowisko literackie."},{"page_url":"https://en.wikipedia.org/wiki/Agnes_of_Solms-Laubach","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Agnes_of_Solms-Laubach.jpg","page_title":"Agnes of Solms-Laubach","context_page_description":"Agnes of Solms-Laubach was a Countess of Solms-Laubach and, by marriage, Landgravine of Hesse-Kassel from 1593 until her death."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fenbrunnen_im_Berliner_Bezirk_Tempelhof-Sch%C3%B6neberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Stra%C3%9Fenbrunnen_Sch%C3%B6neberg_93_Leberstra%C3%9Fe_81.jpg","page_title":"Liste der Straßenbrunnen im Berliner Bezirk Tempelhof-Schöneberg","context_page_description":"Die Liste der Straßenbrunnen im Berliner Bezirk Tempelhof-Schöneberg ist eine Übersicht der Brunnen der Notwasserversorgung in den Ortsteilen des Bezirks. Auf Grund der Quellenlage sind einige aufgegebene Brunnenstandorte aufgenommen."},{"page_url":"https://es.wikipedia.org/wiki/Cs%C3%A9r","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Cs%C3%A9r_F%C5%91_utca.jpg","page_title":"Csér","context_page_description":"Csér es un pueblo húngaro perteneciente al distrito de Sopron en el condado de Győr-Moson-Sopron, con una población en 2013 de 31 habitantes.​\\nSe conoce su existencia desde 1313 con el nombre de Cher y siempre ha sido una localidad agrícola de pequeño tamaño. A mediados del siglo XX albergó una fábrica de ladrillos. Actualmente casi todos los habitantes son magiares, siendo la mitad de la población católica y la otra mitad luterana.​​\\nSe ubica unos 30 km al sureste de la capital distrital Sopron.​"},{"page_url":"https://en.wikipedia.org/wiki/Herman_C._Timm_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Herman_C._Timm_House.jpg","page_title":"Herman C. Timm House","context_page_description":"The Herman C. Timm House is a house listed on the National Register of Historic Places in New Holstein, Wisconsin, United States. The house is a significant example of Stick style architecture, a rather rare predecessor of Queen Anne style architecture in the United States. The house was the home of an original settler and prominent citizen, Herman C. Timm."},{"page_url":"https://fi.wikipedia.org/wiki/Joe_Theismann","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Joe_Theismann_9-8-03_crop.jpg","page_title":"Joe Theismann","context_page_description":"Joseph Robert ”Joe” Theismann on yhdysvaltalainen amerikkalaisen ja kanadalaisen jalkapallon entinen ammattilaispelaaja. Hän oli pelipaikaltaan pelinrakentaja."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D1%85%D1%82%D0%BE%D0%BB%D1%8C%D0%B4,_%D0%91%D0%B5%D0%B4%D1%80%D0%B6%D0%B8%D1%85_%D0%92%D1%88%D0%B5%D0%BC%D0%B8%D1%80_%D1%84%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bed%C5%99ich_Karel_Eugen_V%C5%A1em%C3%ADr_hrab%C4%9B_Berchtold_z_Uher%C4%8Dic.jpeg","page_title":"Берхтольд, Бедржих Вшемир фон","context_page_description":"Бедржих Вшемир фон Берхтольд — чешский врач и ботаник."},{"page_url":"https://es.wikipedia.org/wiki/Citro%C3%ABn_C4_Cactus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Citro%C3%ABn_C4_Cactus_-_wn%C4%99trze_%28MSP17%29.jpg","page_title":"Citroën C4 Cactus","context_page_description":"El Citroën C4 Cactus es un crossover del segmento B producido por el constructor francés Citroën en la planta del Groupe PSA de Villaverde en Madrid, España. El C4 Cactus está basado en la plataforma PSA PF1 que utilizan modelos más pequeños como el Citroën C3 y DS3.\\nAlgunas características distintivas de su diseño son los “Airbump”, tableros plásticos flexibles en los laterales y parachoques del coche, diseñados para proteger el vehículo de daños en los aparcamientos o los airbag del acompañante situados en el techo permite liberar el espacio en el interior del habitáculo y ampliar las posibilidades de diseño.​\\nEl prototipo Citroën C-Cactus fue presentado en 2007 en el Salón del Automóvil de Fráncfort antes de la versión de producción.​ El modelo de producción se presentó el 5 de febrero de 2014, justamente en la fecha de cumpleaños de André Citroën, antes de comenzarse a comercializar en junio del mismo año."},{"page_url":"https://ca.wikipedia.org/wiki/Grutes_de_l%27elefanta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Elephanta_Caves_main_hall.JPG","page_title":"Grutes de l'elefanta","context_page_description":"Les Grutes d'Elefanta se situen a l'illa d'Elefanta, en el port de Bombai, districte de Kolaba, estat Maharashtra, Índia. El complex de temples ocupa una àrea de 5.600 m² que consisteixen en una càmera principal, dues càmeres laterals, patis i santuaris secundaris. Aquestes grutes contenen relleus, escultures i un temple en honor a Shivá.\\nEs creu que les cavernes van ser construïdes entre els anys 810 i 1260. Al segle XVI els portuguesos van danyar greument les estàtues, usant-les per practicar tir al blanc."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Joss","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Chris_Joss_Nov2004.jpg","page_title":"Chris Joss","context_page_description":"Chris Joss is a French multi-instrumentalist and record producer,"},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_Kl%C3%A1%C5%A1tor_pod_Znievom","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Kl%C3%A1%C5%A1tor_pod_Znievom%2C_st%C4%BAp.JPG","page_title":"Zoznam kultúrnych pamiatok v obci Kláštor pod Znievom","context_page_description":"Toto je zoznam kultúrnych pamiatok v obci Kláštor pod Znievom v okrese Martin.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://sl.wikipedia.org/wiki/Mediterranean_Shipping_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/MSC_Flaminia_at_sea.jpg","page_title":"Mediterranean Shipping Company","context_page_description":"Mediterranean Shipping Company S.A. je italijanska ladijska družba s sedežem v Ženevi v Švici. Je za Maerskom drugi največji kontejnerski ladjar na svetu. MSC ima v floti 471 kontejnerskih ladij s skupno kapaciteto 2.435.000 TEU. Najpomembnejše pristanišče družbe je Antwerpnu v Belgiji.\\nLeta 2018 je bil MSC odgovoren za približno 11 megatonov CO2; zaradi tega je MSC eden izmed desetih emisij CO2 z največjo količino toplogrednih plinov v EU. Z izjemo Ryanaira so vseh ostalih devet izdajnikov CO2 premogovne elektrarne v Nemčiji ali na Poljskem.\\nPodjetje MSC je bilo ustanovljeno leta 1970, ko je Gianluigi Aponte kupil svojo prvo ladjo Patricio in kasneje še Rafaelo. Podjetje je hitro rastlo, do leta 1977 je operiralo v Evropi, Afriki in Indijskem oceanu, v 1980-ih pa se je razširilo še v Severno Ameriko in Avstralijo. Podjetje danes operira v okrog 315 pristaniščih po vsem svetu.\\nLeta 1980 je MSC kupil križarsko podjetje Lauro Lines in ga leta 1995 preimenoval v Mediterranean Shipping Cruises."},{"page_url":"https://it.wikipedia.org/wiki/Fried_Coke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Fried_Coke.jpg","page_title":"Fried Coke","context_page_description":"La Fried Coke è uno snack statunitense creato nel 2006.\\nConsiste in palle di pastella mischiate con sciroppo di Coca-Cola, le quali vengono poi fritte e ricoperte con altro sciroppo di Coca-Cola, panna montata, cannella e una ciliegina. È stata presentata per la prima volta dal suo inventore, Abel Gonzales Jr., alla Fiera dello stato del Texas dove ha vinto il titolo di \\"snack più creativo\\" nella seconda competizione a giuria tra i rivenditori di vivande. Si è rivelato molto popolare in Texas, dove ha venduto 16 000 porzioni nelle prime due settimane, e viene ora utilizzato come snack nelle fiere del Carolina del Nord e Arizona, ma è molto popolare anche in California.\\nSi stima che la Coca-Cola fritta contenga 830 kcal per porzione."},{"page_url":"https://de.wikipedia.org/wiki/Angela_Kane","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Angela_Kane_New_York_2015_%2817094889157%29.jpg","page_title":"Angela Kane","context_page_description":"Angela Kane war von März 2012 bis März 2015 Hohe Repräsentantin der UNO für Abrüstungsfragen. Zuvor war sie seit Mai 2004 Beigeordnete Generalsekretärin für politische Angelegenheiten der Vereinten Nationen. Damit war sie die ranghöchste Deutsche bei den Vereinten Nationen nach Achim Steiner."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/De%C5%A1tn%C3%A9_v_Orlick%C3%BDch_hor%C3%A1ch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/De%C5%A1tn%C3%A9_v_Orlick%C3%BDch_hor%C3%A1ch%2C_upper_part.jpg","page_title":"Deštné v Orlických horách","context_page_description":"Deštné v Orlických horách sī Czech Hradec Králové chiu Rychnov nad Kněžnou koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://en.wikipedia.org/wiki/List_of_shield_bug_species_of_Korea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Eurygaster.testudinaria.2.jpg","page_title":"List of shield bug species of Korea","context_page_description":"This is a list of shield bug species recorded in Korea, including both the Korean Peninsula and adjacent islands.\\nSpecies on this list have been:\\nincluded in a standard database of Korean insects, such as that published by the National Institute of Agricultural Science and Technology,\\nincluded in published field guides, or\\nreported to be present in Korea in a peer-reviewed scholarly publication."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1853","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/%D0%94%D0%B6%D0%BE%D0%BD_%D0%A2%D0%B0%D0%BD%D1%81%D1%82%D0%B5%D0%BB%D0%BB.jpg","page_title":"Lijst van personen geboren in 1853","context_page_description":"Dit is een lijst van personen die geboren zijn in 1853.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Criticism_of_Rede_Globo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Glenn_Greenwald_2014-01-20_001.jpg","page_title":"Criticism of Rede Globo","context_page_description":"Criticism of Rede Globo refers to the extensive history of controversies involving the Brazilian television network and Brazilian society in partnership with José Hawilla. The broadcaster has an unparalleled ability to influence Brazil's culture and to shape the country's public opinion. Globo's owners enriched themselves with government favors until they became billionaires.\\nThe main historical controversy surrounding the television network and the rest of the Globo Organizations media empire centers on both the support for the Brazilian military government and the censorship of pro-democracy developments in its news broadcasts. The military regime, according to critics of the broadcaster, provided government concessions to Marinho family's media group and specifically to the Globo television network which had a very poor coverage the 1984 Diretas Já protests. The Globo network itself admitted in the Jornal Nacional 49 years later, pressured by the 2013 protests in Brazil, that the support given to the 1964 Brazilian coup d'état and the subsequent regime was \\"a mistake\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Fusil_%C3%A0_filet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Net_gun%2C_USDA.jpg","page_title":"Fusil à filet","context_page_description":"Un fusil à filet est une arme non létale conçue pour immobiliser une cible en projetant sur elle un filet, de manière qu'elle s'y emmêle.\\nLes fusils à filet sont essentiellement utilisés pour capturer des animaux sauvages en les gardant vivants et sans les blesser, par exemple dans le but de les étudier, de les soigner, ou de les vendre.\\nToutefois, des humains peuvent aussi être emprisonnés de la sorte, pour le maintien de l'ordre : ce fut ainsi le cas lors de la Coupe du monde de football de 2002 qui s'est déroulée au Japon, où la police locale était armée de tels fusils contre les hooligans.\\nLes fusils à filet apparaissent également dans des œuvres de fiction, en particulier des œuvres fantastiques et de science-fiction. Notamment dans la série des Predator, où le filet est néanmoins plus létal puisque ses mailles sont coupantes, et qu'il se resserre davantage si la victime tente de se dégager."},{"page_url":"https://de.wikipedia.org/wiki/Schelpe","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Plan_Corvey.svg","page_title":"Schelpe","context_page_description":"Die Schelpe ist ein orografisch linker Zufluss der Weser in Nordrhein-Westfalen."},{"page_url":"https://zh.wikipedia.org/zh-cn/2005%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B1%E9%A2%A8%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Tembin_2005_track.png","page_title":"2005年太平洋颱風季","context_page_description":"2005年太平洋台风季泛指在2005年全年内的任何时间，于赤道以北及国际换日线以西的太平洋水域，以及南中国海所产生的热带气旋。虽然有关方面并没有设下本台风季的指定期限，但大部分于西北太平洋的热带气旋通常都会于五月至十二月期间形成。\\n本条目的范围仅局限于赤道以北及国际换日线以西的太平洋及南海的水域。于赤道以北及国际换日线以东的太平洋水域产生的风暴则被称为飓风，并被列入2005年太平洋飓风季。在西太平洋产生的热带风暴是由日本东京台风中心命名，国际编号为05xx，而美国联合台风警报中心会把在该地区的热带低压的编号以W字母作结。\\n凡进入或产生于菲律宾风暴责任范围以内的热带低压，菲律宾大气地理天文部门都会为它们订立一个菲律宾名称，作当地警报用途；此外，由于中港澳采用同一翻译名，而台湾之翻译名字可能有所不同，因此同一个风暴可能会有2个不同的中文名字，及有时候会有两个不同的英文名称。\\n以下各热带气旋资讯以热带气旋存在期间的最强形态为准。"},{"page_url":"https://it.wikipedia.org/wiki/Sukumo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Sukumo_castle_ishigaki.JPG","page_title":"Sukumo","context_page_description":"Sukumo è una città giapponese della prefettura di Kōchi."},{"page_url":"https://ms.wikipedia.org/wiki/Pemerintah_Tertinggi_Angkatan_Tentera_British","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Elizabeth_II_greets_NASA_GSFC_employees%2C_May_8%2C_2007_edit.jpg","page_title":"Pemerintah Tertinggi Angkatan Tentera British","context_page_description":"Pemerintah Tertinggi Angkatan Tentera British, juga dirujuk sebagai Panglima Tertinggi Angkatan Tentera Seri Paduka Baginda, ialah satu peranan berperlembagaan bagi pemerintahan beraja British, pada masa kini Ratu Elizabeth II, adalah ketua negara merangkap \\"Ketua Angkatan Tentera\\". Pemerintahan raja berperlembagaan yang paling lama, namun, telah memberi hak kuasa eksekutif de facto, dengan menjalankan Prerogatif Diraja, pada Perdana Menteri dan Setiausaha Negara bagi Pertahanan. Perdana Menteri membuat keputusan penting mengenai penggunaan angkatan tentera. Bagaimanapun, Baginda Ratu kekal badan kuasa tertinggi angkatan tentera.\\nKonvensyen berperlembagaan baru nampaknya sudah termaktub sejak tahun 2003, dimana UK hanya akan mengambil tindakan ketenteraan dengan persetujuan Dewan Rakyat. Walaubagaimanapun, Baginda Ratu masih boleh memerintah mengikut kehendaknya. Para pegawai dan anggota lain tentera serta pasukan polis territorial juga bersumpah taat setia kepada raja dan penggantinya, dan bukan kerajaan – ini memastikan bahawa semua para menteri boleh dipertanggungjawabkan, dan oleh itu tidak 'mengatasi undang-undang', bukan seperti raja."},{"page_url":"https://nl.wikipedia.org/wiki/Kallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Kallo_-_Town_hall_1.jpg","page_title":"Kallo","context_page_description":"Kallo is een dorp in de Belgische provincie Oost-Vlaanderen en een deelgemeente van Beveren. Het dorp ligt vlak bij de Schelde; een groot deel van het grondgebied is tegenwoordig ingepalmd door de Waaslandhaven."},{"page_url":"https://it.wikipedia.org/wiki/Bricquebec","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/BricquebecRue.JPG","page_title":"Bricquebec","context_page_description":"Bricquebec è un comune francese di 4.370 abitanti situato nel dipartimento della Manica nella regione della Normandia."},{"page_url":"https://pl.wikipedia.org/wiki/Wolne_Derry","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Free_Derry_Corner_-_geograph.org.uk_-_1317804.jpg","page_title":"Wolne Derry","context_page_description":"Wolne Derry – samozwańczy, autonomiczny obszar, istniejący w mieście Londonderry w Irlandii Północnej od 1969 do 1972 roku. Nazwa „Free Derry” została zaczerpnięta z napisu namalowanego na ścianie jednego z budynków w dzielnicy Bogside w styczniu 1969. Napis ten głosił „You are now entering Free Derry”, czyli „Właśnie wchodzisz do Wolnego Derry”."},{"page_url":"https://et.wikipedia.org/wiki/Linda-Mari_V%C3%A4li","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Linda-Mari_V%C3%A4li_Vilsandil_2017._aastal.png","page_title":"Linda-Mari Väli","context_page_description":"Linda-Mari Väli on Eesti ajakirjanik ja keskkonnaaktivist.\\nAvaldanud ka ilukirjandust ja kirjanduskriitikat."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B5%81%E8%8B%8F%E9%B9%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Philomachuspugnaxmap.png","page_title":"流苏鹬","context_page_description":"流蘇鷸為鷸科濱鷸屬的鳥類。在中國大陸，分布於新疆、西藏、北京、山東、福建、廣東等地。該物種的模式產地在瑞典。"},{"page_url":"https://de.wikipedia.org/wiki/Seegrenzschlachthof_(L%C3%BCbeck)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/HL_Damals_%E2%80%93_Seegrenzschlachthof_%E2%80%93_Kaldaunenw%C3%A4sche_%E2%80%93_2.jpg","page_title":"Seegrenzschlachthof (Lübeck)","context_page_description":"Aufgrund eines 1926 erlassenen Importverbots von Lebendvieh über die Blaue Grenze wurde in den Jahren 1928/29 unmittelbar an den Städtischen Schlachthof angrenzend ein Seegrenzschlachthof errichtet und sollte am 1. Juli 1929 in Betrieb genommen werden."},{"page_url":"https://en.wikipedia.org/wiki/Chinese_mountain_cat","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/ChineseMountainCat_distribution.jpg","page_title":"Chinese mountain cat","context_page_description":"The Chinese mountain cat, also known as Chinese desert cat and Chinese steppe cat, is a wild cat endemic to western China that has been listed as Vulnerable on the IUCN Red List since 2002, as the effective population size may be fewer than 10,000 mature breeding individuals.\\nIt was provisionally classified as a wildcat subspecies with the name F. silvestris bieti in 2007.\\nIt is recognised as a valid species since 2017, as it is morphologically distinct from wildcats."},{"page_url":"https://fr.wikipedia.org/wiki/William_Fulke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/WilliamFulke2.jpg","page_title":"William Fulke","context_page_description":"William Fulke était un théologien puritain anglais."},{"page_url":"https://de.wikipedia.org/wiki/Heubach","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Heubach_st_ulrich_2019.jpg","page_title":"Heubach","context_page_description":"Heubach ist eine Stadt im Ostalbkreis in Baden-Württemberg. Sie gehört zur Region Ostwürttemberg und zur Randzone der europäischen Metropolregion Stuttgart."},{"page_url":"https://de.wikipedia.org/wiki/Venezianische_Kolonien","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%D0%93%D0%A4%D0%A17.jpg","page_title":"Venezianische Kolonien","context_page_description":"Als venezianische Kolonien werden im engeren Sinne die von der Republik Venedig beherrschten Gebiete in der Adria und im östlichen Mittelmeer bezeichnet, besonders in der Romania, dem als Einheit gedachten Gebiet des Byzantinischen Reichs – auch noch zu einer Zeit, als diese Gebiete längst nicht mehr zu Byzanz gehörten. Die venezianischen Gebiete in Italien galten hingegen als Teil der Republik oder als kurzzeitig besetzte Gebiete.\\nIm weiteren Sinne als venezianische Kolonien werden gelegentlich auch die Ansiedlungen der venezianischen Händler tituliert; die sollen jedoch nicht Teil der Darstellung sein, da sie nicht oder nur sehr kurzfristig venezianischer Herrschaft unterstanden.\\nDas venezianische Kolonialreich – die venezianischen Kolonien im engeren Sinne – entstand in erster Linie auf Grund der politischen und kulturellen, besonders aber der Handelsbeziehungen zum Byzantinischen Reich.\\nVenedig profitierte zudem durch die Kreuzzüge in mehrfacher Hinsicht. Zum einen intensivierten sich die Handelskontakte mit dem östlichen und südlichen Mittelmeer, zum anderen fuhren zahlreiche Pilger per Schiff von Venedig ins Heilige Land."},{"page_url":"https://vi.wikipedia.org/wiki/X%C3%A3_Kidder,_Qu%E1%BA%ADn_Carbon,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/HickoryRunBoulderField2007.jpg","page_title":"Xã Kidder, Quận Carbon, Pennsylvania","context_page_description":"Xã Kidder là một xã thuộc quận Carbon, tiểu bang Pennsylvania, Hoa Kỳ. Năm 2010, dân số của xã này là 1.935 người."},{"page_url":"https://nl.wikipedia.org/wiki/Phyllonorycter_trinotella","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Phyllonorycter_trinotella.JPG","page_title":"Phyllonorycter trinotella","context_page_description":"Phyllonorycter trinotella is een vlinder uit de familie van de mineermotten. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd in 1908 door Braun."},{"page_url":"https://en.wikipedia.org/wiki/Cercottes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Cercottes_%28Loiret%29_Mairie_-_%C3%A9cole.JPG","page_title":"Cercottes","context_page_description":"Cercottes is a commune in the Loiret department in north-central France."},{"page_url":"https://br.wikipedia.org/wiki/Perugia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Perugia_panoramic.jpg","page_title":"Perugia","context_page_description":"Krogit e-barzh!\\nUn danvez pennad eo ar pennad-mañ ha labour zo d'ober c'hoazh a-raok e beurechuiñ.\\nGallout a rit skoazellañ Wikipedia dre glokaat anezhañ.\\nPerugia zo ur gumun en Italia ha kêr-benn proviñs Perugia."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Pynchon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Thomas_Pynchon%2C_high_school_senior_portrait%2C_1953_%28with_caption%29.jpg","page_title":"Thomas Pynchon","context_page_description":"Thomas Ruggles Pynchon Jr. is an American novelist. A MacArthur Fellow, he is noted for his dense and complex novels. His fiction and non-fiction writings encompass a vast array of subject matter, genres and themes, including history, music, science, and mathematics. For Gravity's Rainbow, Pynchon won the 1973 U.S. National Book Award for Fiction.\\nHailing from Long Island, Pynchon served two years in the United States Navy and earned an English degree from Cornell University. After publishing several short stories in the late 1950s and early 1960s, he began composing the novels for which he is best known: V., The Crying of Lot 49, and Gravity's Rainbow. His 2009 novel Inherent Vice was adapted into a feature film of the same name by director Paul Thomas Anderson in 2014. Pynchon is notoriously reclusive; few photographs of him have been published, and rumors about his location and identity have circulated since the 1960s. Pynchon's most recent novel, Bleeding Edge, was published on September 17, 2013."},{"page_url":"https://it.wikipedia.org/wiki/Tonalpohualli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Reed%2CGrass%2CMonkey%2CDog.jpg","page_title":"Tonalpohualli","context_page_description":"Il tonalpohualli, termine nahuatl che significa \\"conto dei giorni\\", è un periodo sacro di 260 giorni in uso nella Mesoamerica precolombiana, e soprattutto tra gli Aztechi. Questo periodo non è solare né lunare, ma è piuttosto formato da 20 trecena di 13 giorni ognuna. Ogni trecena è dedicata ad una diversa divinità."},{"page_url":"https://af.wikipedia.org/wiki/Mercedes-Benz_W136","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/MB_170_V_Cabriolet_A%2C_Bj._1938.jpg","page_title":"Mercedes-Benz W136","context_page_description":"Die Mercedes-Benz W136 was Mercedes-Benz se reeks Inlynviersilinder-motors in die middel van die 1930's tot die vyftigerjare op die mark was. Die model 170 V het in Februarie 1936 sy openbare debuut gemaak as opvolger van die W15 Typ 170. Tusssen 1936 en 1939 was dit Mercedes se topverkopermodel.\\nTussen 1936 en 1942 is meer as 75 000 gebou wat dit tot op daardie stadium die gewildste Mercedes-Benz-model gemaak het.\\nGenoeg van die fabrieksgereedskap van die W136 het die geallieerde bomaanval gedurende die Tweede Wêreldoorlog oorleef om as basis te dien waarop die Mercedes-onderneming herbou is. Teen 1947 hervat die 170 V-model sy plek as Mercedes se topverkoper, 'n posisie wat dit tot 1953 beklee het.\\nDie \\"V\\" in die naam van die 170 V was 'n afkorting van \\"Vorn\\", wat bygevoeg is om dit te onderskei van die kontemporêre agterenjin Mercedes-Benz 170H wat dieselfde viersilinder 1697cc-enjin gebruik het, maar wat agter in die motor geplaas was."},{"page_url":"https://fi.wikipedia.org/wiki/Harry_W._Schreck","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Tampere_-_Teiskontie_7.jpg","page_title":"Harry W. Schreck","context_page_description":"Harry W. Schreck oli suomalainen arkkitehti. Schreck perusti vuonna 1936 oman arkkitehtitoimiston Tampereelle ja johti sitä aina vuoteen 1990 saakka."},{"page_url":"https://fr.wikipedia.org/wiki/Henry_Bauchet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Bauchet-Tracteurs.jpg","page_title":"Henry Bauchet","context_page_description":"Joseph-Gustave-Henri Bauchet, né le 22 avril 1879 à Frévent de parents champenois et mort le 19 décembre 1970 à Lyon, est un inventeur, ingénieur motoriste et constructeur automobile français ayant participé et contribué à la grande aventure de l'automobile de la fin du XIXᵉ siècle et du début du XXᵉ siècle, ainsi qu'à l'innovation de l'histoire de l'automobile.\\nDiplômé de l'école d'arts et métiers de Châlons-en-Champagne, il fut l'un des premiers titulaire du « certificat de capacité valable pour la conduite d'un automobile à pétrole » daté du 7 avril 1902. Il fut l'un des pionniers de la mécanique automobile et certaines de ses inventions qui se situent aux alentours de l'an 1900, avaient à l'époque de nombreuses années d'avance."},{"page_url":"https://ca.wikipedia.org/wiki/Transformada_discreta_de_Fourier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/From_Continuous_To_Discrete_Fourier_Transform.gif","page_title":"Transformada discreta de Fourier","context_page_description":"En matemàtica aplicada, i més particularment en teoria del senyal, la transformada discreta de Fourier o transformada de Fourier discreta, a vegades denotada per l'acrònim DFT de l'anglès discrete Fourier transform, és un tipus de transformada discreta usat en el processament del senyal digital, anàleg a la transformada de Fourier per al processament del senyal analògic."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B0%D1%88%D0%B0_%D0%9C%D0%BE%D0%B4%D0%BE%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/De_Panne_-_Driedaagse_van_De_Panne-Koksijde%2C_etappe_1%2C_31_maart_2015%2C_vertrek_%28A72%29.JPG","page_title":"Саша Модоло","context_page_description":"Саша Модоло — италијански професионален друмски велосипедист, кој вози за UCI World Tour екипата ЕФ Едукејшн Фирст."},{"page_url":"https://ceb.wikipedia.org/wiki/Pevek_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Airport_Pevek_satellite.jpg","page_title":"Pevek Airport","context_page_description":"Tugpahanan ang Pevek Airport sa Rusya. Nahimutang ni sa sidlakang bahin sa nasod, 5,600 km sa sidlakan sa Moscow ang ulohan sa nasod. 3 metros ibabaw sa dagat kahaboga ang nahimutangan sa Pevek Airport.\\nAng yuta palibot sa Pevek Airport kay patag. Sa kasadpan, dagat ang pinakaduol sa Pevek Airport. Kinahabogang dapit sa palibot ang Gora Kekurnaya, 613 ka metros ni kahaboga ibabaw sa dagat, 15.3 km sa amihanan-sidlakan sa Pevek Airport. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Pevek Airport. Ang kinadul-ang mas dakong lungsod mao ang Pevek, 14.5 km sa habagatan-kasadpan sa Pevek Airport.\\nAng klima klima sa kontinente. Ang kasarangang giiniton -10 °C. Ang kinainitan nga bulan Hulyo, sa 12 °C, ug ang kinabugnawan Marso, sa -20 °C."},{"page_url":"https://de.wikipedia.org/wiki/Michael_Vitzthum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Michael_Vitzthum.jpg","page_title":"Michael Vitzthum","context_page_description":"Michael Vitzthum ist ein deutscher Fußballspieler."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%BB%D0%B8%D0%BA_%D0%B1%D0%B5%D0%B7%D1%85%D0%B2%D0%BE%D1%81%D1%82%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Romerolagus_diazi_%28dispale%29_001.jpg","page_title":"Кролик безхвостий","context_page_description":"Кро́лик безхво́стий, або вулкані́чний — вид зайцеподібних ссавців родини Зайцеві, якого виділяють у монотипний рід Безхвостий кролик."},{"page_url":"https://ca.wikipedia.org/wiki/Castell_de_Castellb%C3%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Zona_del_Castell_de_Castellb%C3%B2.JPG","page_title":"Castell de Castellbò","context_page_description":"Castell de Castellbò és un castell romànic situat al capdamunt de la roca que culmina el nucli de Castellbò, del municipi de Montferrer i Castellbò. Està declarat bé cultural d'interès nacional."},{"page_url":"https://es.wikipedia.org/wiki/Miguel_Korybut_Wi%C5%9Bniowiecki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Micha%C5%82_Korybut_Wi%C5%9Bniowiecki.jpg","page_title":"Miguel Korybut Wiśniowiecki","context_page_description":"Miguel Korybut Wisniowiecki fue rey de la Mancomunidad polaco-lituana, perteneciente al clan Korybut.\\nSu predecesor, Juan II Casimiro Vasa abdicó en 1668, planteando el problema de la sucesión a la Dieta, el consejo encargado de la elección. Aunque había varios candidatos extranjeros, impuestos por las potencias que querían controlar la Mancomunidad, principalmente Austria y Francia, se optó por un príncipe polaco: Miguel Korybut.\\nMiguel Korybut Wisniowiecki tuvo un reinado breve, sólo cuatro años, en los que se enfrentó con los turcos, que, de nuevo, invadieron Polonia. En 1670 se casó con Leonor María Josefa de Habsburgo, hija del Emperador Fernando III de Habsburgo."},{"page_url":"https://es.wikipedia.org/wiki/Hugo_Pieter_Vogel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Vogel_%26_Van_Gendt_Stadsschouwburg_Groningen_plan.jpg","page_title":"Hugo Pieter Vogel","context_page_description":"Hugo Pieter Vogel, fue un arquitecto de los Países Bajos. Fue profesor y director de la Academia Real de Bellas Artes en La Haya."},{"page_url":"https://sv.wikipedia.org/wiki/El_Cu%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/PenasBlancas%2C_part_of_the_Bosawas_Reserve%2C_Jinotega_Department%2C_Nicaragua.jpg","page_title":"El Cuá","context_page_description":"El Cuá är en kommun i Nicaragua med 56 897 invånare. Den ligger i den bergiga norra delen av landet i departementet Jinotega. Kommunen ligger mycket naturskönt och har två fina naturreservat, Peñas Blancas och Cerro Kilambé."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%BD%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Puguang_chansi_0175.jpg","page_title":"轩","context_page_description":"軒的本義是指向上翹起的曲木，在中國傳統建築中，特指南方高敞栱曲的房間，附屬於主體的卷棚式屋頂，類似於北方建築的廊。可分為內軒和廊軒。常見的軒有抬頭軒、船篷軒、鶴頸軒、菱角軒、海棠軒、一支香軒等。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B3%B0%E5%9D%A6%E5%B0%BC%E5%85%8B%E5%8F%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/John_Jacob_Astor_IVb.jpg","page_title":"泰坦尼克号","context_page_description":"泰坦尼克号是一艘英国皇家邮轮，也是白星航运公司旗下的3艘奥林匹克级邮轮之一，在其服役时间是全世界最大的海上船舶，由贝尔法斯特哈兰德与沃尔夫造船厂建造，号称“永不沉没”、“梦幻之船”。头等舱在设计上追求舒适和奢华的最高水准，设有健身房、游泳池、接待室、高档餐厅和豪华客舱。船上也有一台高功率的无线电报机，为乘客提供马可尼无线电报公司的电报收发服务，以及泰坦尼克号的航务通讯。\\n1912年4月10日，泰坦尼克号展开首航，也是唯一一次的载客出航，最终目的地为纽约。部分乘客为当时世界上顶尖富豪，以及许多来自英国、爱尔兰、斯堪的纳维亚和欧洲其他地区的移民，他们寻求在美国展开新生活的机会。4月15日在中途发生擦撞冰山后沉没的严重灾难。2,224名船上人员中有1,514人罹难，成为近代史上最严重的和平时期船难。船长爱德华·约翰·史密斯最终与船一起沉没；泰坦尼克号总设计师汤玛斯·安德鲁斯也在这起灾难中死亡。\\n1985年，前美国海军军官罗伯·巴拉德率领团队发现了泰坦尼克号残骸，该船分裂成两部分，并在3,784米的海底深处逐渐瓦解，沉船内成千上万的文物已在世界各地的博物馆中复原并展示。泰坦尼克号已成为历史上最著名的船舶之一，许多流行文化作品保存了关于她的故事，包括书籍、民谣、电影、展览和纪念品。泰坦尼克号也是一战前世界上第二大的远洋客轮残骸，仅次于她的姊妹舰不列颠号。沉没事故中的最后一位生还者米尔维娜·迪恩于2009年去世，享耆寿97岁。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B2%D0%BE%D1%80%D0%B5%D1%86_%D0%91%D0%B6%D0%BE%D1%81%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/BrzostowskiPalace9.JPG","page_title":"Дворец Бжостовских","context_page_description":"Дворе́ц Бжосто́вских — двухэтажный дворец XVIII века в стиле классицизма в Старом городе Вильнюса на стыке улицы Университето и Доминикону. Дворец является памятником архитектуры республиканского значения и охраняется государством, код в Регистре культурных ценностей Литовской Республики 771. В настоящее время здесь действует аптека, магазин оптики, одонтологическая клиника; часть здания занимают жилые квартиры."},{"page_url":"https://ja.wikipedia.org/wiki/Taspo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Taspo_Vending_Machine.jpg","page_title":"Taspo","context_page_description":"taspoは、社団法人日本たばこ協会 、全国たばこ販売協同組合連合会及び日本自動販売機工業会 が未成年者の喫煙防止に向けた取り組みのさらなる強化の一環として開発し、2008年3月から順次日本全国に導入されている、成人識別ICカードの名称、及び同カードを使用したシステムの総称である。また、taspoのカード有効期限の更新は自販機にタッチするだけで有効期限の更新がされる。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D1%80_(%D1%8D%D0%BB%D0%B5%D0%BC%D0%B5%D0%BD%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Borophene.png","page_title":"Бор (элемент)","context_page_description":"Бор — химический элемент 13-й группы, второго периода периодической системы с атомным номером 5. Бесцветное, серое или красное кристаллическое либо тёмное аморфное вещество. Известно более 10 аллотропных модификаций бора, образование и взаимные переходы которых определяются температурой, при которой бор был получен."},{"page_url":"https://de.wikipedia.org/wiki/Elizabeth_Keckley","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Mrs._Abraham_Lincoln_-_NARA_-_529952.jpg","page_title":"Elizabeth Keckley","context_page_description":"Elizabeth Keckley war eine afroamerikanische Schneiderin und Autorin. Ursprünglich eine Sklavin, gelang es ihr im Alter von 30 Jahren, sich selbst und ihren Sohn freizukaufen. Als Schneiderin machte sie sich rasch einen Namen unter den Ehefrauen hochrangiger, amerikanischer Politiker und wurde schließlich die Modistin und enge Vertraute der Präsidentengattin Mary Lincoln. Zusätzlich gründete sie Hilfsvereine für ehemalige Sklaven. Nach dem Ende des Sezessionskriegs und der Ermordung des Präsidenten Abraham Lincoln veröffentlichte Keckley im Jahr 1868 ihre Autobiografie Behind the Scenes, Or Thirty Years a Slave and Four Years in the White House, die zum Teil ihre Erinnerungen an die Sklaverei und zum Teil ihr Leben mit der Familie Lincoln beschreibt. Obwohl die Autobiografie zu Keckleys Lebzeiten unterdrückt wurde und keinen Erfolg hatte, wird sie auch heute noch als Quelle für das Familienleben der Lincolns benutzt."},{"page_url":"https://fr.wikipedia.org/wiki/Registre_national_des_lieux_historiques_dans_le_comt%C3%A9_d%27Alameda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Golden_Sheaf_Bakery_%28Berkeley%2C_CA%29.JPG","page_title":"Registre national des lieux historiques dans le comté d'Alameda","context_page_description":"Ceci est la liste des lieux historiques inscrits sur le registre national dans le comté d'Alameda en Californie.\\nC'est censé être une liste exhaustive des propriétés et des districts des lieux historiques du registre national dans le comté d'Alameda, en Californie. Les coordonnées de latitude et longitude sont fournies pour la plupart des propriétés et les districts du registre national ; ces localisations peuvent être aperçus sur Google Map.\\nIl y a 155 propriétés et districts répertoriés sur le registre national dans le comté, dont huit monuments historiques nationaux. Une autre propriété a été inscrite mais a été retirée."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D0%B8%D0%BD,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Anatoly_Voronin_2018.jpg","page_title":"Воронин, Анатолий Викторович","context_page_description":"Анатолий Викторович Воро́нин — российский учёный, доктор технических наук, ректор Петрозаводского государственного университета."},{"page_url":"https://es.wikipedia.org/wiki/Crucero_de_batalla","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/HMS_Repulse_%281919%29_profile_drawing.png","page_title":"Crucero de batalla","context_page_description":"Los cruceros de batalla fueron los mayores buques de guerra durante la primera mitad del siglo XX desde que fueron introducidos por la Royal Navy británica. Los cruceros de batalla fueron desarrollados como los sucesores de los cruceros acorazados, pero su evolución estuvo estrechamente ligada a la de los acorazados tipo dreadnought. El primero de estos buques, el Invincible, estuvo designado originalmente como \\"crucero dreadnought\\".\\nLos cruceros de batalla compartían con los acorazados el mismo armamento principal de grueso calibre, y eran generalmente, tan grandes y costosos como los acorazados de la misma generación. Cambiaban blindaje o potencia de fuego por velocidad, la cual era posible gracias a la potencia de sus máquinas y a la esbeltez de sus cascos. Los primeros cruceros de batalla, portaban un blindaje notablemente menor que los acorazados equivalentes, lo que implicaba, que al contrario que estos, no estaban diseñados para resistir impactos del calibre que ellos mismos portaban. Estos buques eran capaces de infligir un daño mucho mayor del que eran capaces de absorber.\\nLa relación entre el crucero de batalla y el acorazado nunca estuvo totalmente clara."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%85%D9%88%D8%B4%DA%A9%E2%80%8C%D8%A7%D9%86%D8%AF%D8%A7%D8%B2%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/PZR-Grom-02.jpg","page_title":"فهرست موشک‌اندازها","context_page_description":"فهرست موشک‌اندازها بر پایه نام."},{"page_url":"https://de.wikipedia.org/wiki/Haupt-_und_Staatsaktion","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Stranitzky.jpg","page_title":"Haupt- und Staatsaktion","context_page_description":"Haupt- und Staatsaktionen ist eine Bezeichnung für die Theaterstücke, die vom ausgehenden 17. Jahrhundert bis fast zur Mitte des 18. Jahrhunderts das Repertoire der deutschen Wandertruppen beherrschten. In der Regel waren es Possen, in deren Zentrum eine lustige Person, meist der Hanswurst, stand. Der bekannteste Autor und Darsteller der Haupt- und Staatsaktionen war Joseph Anton Stranitzky mit seinen Aufführungen im Wiener Kärntnertortheater. Von ihm sind 14 Stücke dieser Art erhalten, die heute in der Österreichischen Nationalbibliothek aufbewahrt werden."},{"page_url":"https://fr.wikipedia.org/wiki/Jinzhong","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Location_of_Jinzhong_Prefecture_within_Shanxi_%28China%29.png","page_title":"Jinzhong","context_page_description":"Jinzhong est une ville de l'est de la province chinoise du Shanxi. Sa population était de 238 686 habitants en 2006. Elle est le siège d'un évêché catholique."},{"page_url":"https://de.wikipedia.org/wiki/Kalkwerk_Crottendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Kalkofen_Crottendorf.JPG","page_title":"Kalkwerk Crottendorf","context_page_description":"Das Kalkwerk Crottendorf war ein Kalk-Bergwerk südlich der sächsischen Gemeinde Crottendorf im Erzgebirge."},{"page_url":"https://fr.wikipedia.org/wiki/Vall%C3%A9e_du_Tronto","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/AcquasantaTerme%28AP%29-CaveDiTravertino.jpg","page_title":"Vallée du Tronto","context_page_description":"La vallée du Tronto est le vaste bassin versant du fleuve homonyme. Elle s'étend principalement, dans la région italienne des Marches, sur la majeure partie des communes de la province d'Ascoli Piceno. Elle affleure la province de Rieti dans le Latium, la partie septentrionale de la province de Teramo et quelques communes de la province de L'Aquila dans les Abruzzes.\\nLa haute vallée située dans l'Apennin central est au cœur de la zone des séismes survenus à partir du 24 août 2016 en Italie centrale."},{"page_url":"https://fr.wikipedia.org/wiki/Yle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Vesa_Loikas_KOP-Kolmio_Shopping_Center_Turku-Finland_April10th-2010.jpg","page_title":"Yle","context_page_description":"L'Yle est la radio-télévision publique nationale de Finlande.\\nElle émet en finnois mais également en suédois pour la minorité nationale."},{"page_url":"https://bs.wikipedia.org/wiki/Oradea","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Prim%C4%83ria_Municipiului_Oradea.jpg","page_title":"Oradea","context_page_description":"Oradea jest grad u Rumuniji, smješten u Krišani, podregiji Transilvanije. Predstavlja sjedište okruga Bihor, i jedan je od najvažnijih ekonomskih, društvenih i kulturnih centara u zapadnom dijelu Rumunije. Grad se nalazi na sjeverozapadu zemlje, smješten između brežuljaka u ravnici Krišana, na obalama rijeke Brzi Kereš, koja dijeli grad na gotovo jednake polovine.\\nSmještena na oko 10 km udaljenosti od Borșa, jednog od najvažnijih prelaza na granici Rumunije s Mađarskom, Oradea je na desetom mjestu po veličini među rumunskim gradovima. Prostire se na površini od 11.556 hektara, na području dodira između produžetaka Apušenskih planina i proširene ravnice Krišana-Banat.\\nOradea uživa visok životni standard u odnosu na druge rumunske gradove i svrstava se među najprihvatljivije gradove za život u zemlji. Grad je takođe veliko industrijsko središte u regionu, sjedište je nekih od najvećih rumunskih kompanija. Pored statusa ekonomskog središta, Oradea se može pohvaliti i bogatom arhitektonskom baštinom u Art Nouveau stilu i član je mreže Réseau Art Nouveau."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Unspunnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Wilderswil-Unspunnen.jpg","page_title":"Burg Unspunnen","context_page_description":"Die Burg Unspunnen auf dem Bödeli zwischen Thuner und Brienzersee war der Schauplatz des Unspunnenfestes von 1805, das am Ende der Helvetik die Versöhnung von Stadt und Land zelebrierte.\\nDie Burg bestand wohl seit dem frühen 12. Jahrhundert als Rundturm, vermutlich erbaut von einem der Herren von Rothenfluh, die ursprünglich südlich von Unspunnen eine Balmburg hatten. Der Name Unspunnen geht vermutlich auf einen keltischen Flurnamen ussubonno zurück. Die Erweiterung der Burg um den oberen Palas geht wohl auf Freiherr Burkhard von Unspunnen zurück, der die Burg im späten 12. Jahrhundert bewohnte. Burkhard soll um 1191 an einem gescheiterten Aufstand gegen die Zähringer beteiligt gewesen sein. Mit der Ehe mit Burkhards Tochter Ita ging die Burg an Rudolf II. von Wädenswil. Im 13. Jahrhundert kamen die Freiherren von Eschenbach in ihren Besitz und erweiterten sie mehrfach.\\nWalter IV. von Eschenbach-Schnabelburg verkaufte die Burg zusammen mit anderen Besitzungen im August 1306 an die Söhne von Albrecht von Habsburg. Ab 1316 war die Burg an die Herren von Weissenburg verpfändet."},{"page_url":"https://id.wikipedia.org/wiki/Tanda_kepangkatan_Polri","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/PDH_BRIP_KOM.png","page_title":"Tanda kepangkatan Polri","context_page_description":"Tanda kepangkatan Kepolisian Republik adalah daftar tanda pangkat dan jenjang kepangkatan yang digunakan oleh Kepolisian Negara Republik Indonesia. Sejak 1 Januari 2001, Kepolisian Negara Republik Indonesia dipisahkan dari TNI dan menggunakan tanda kepangkatan tersendiri. Perubahan tersebut berdasar pada surat keputusan Kapolri No. Pol: Skep/1259/X/2000, tertanggal 3 Oktober 2000."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%84%D9%87%D9%87_%DA%A9%D9%88%D9%84%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Elahe_koolaei.jpg","page_title":"الهه کولایی","context_page_description":"الهه کولایی محقق، نویسنده و استاد علوم سیاسی دانشکده حقوق و علوم سیاسی دانشگاه تهران، عضو شورای مرکزی و نیز دفتر سیاسی جبهه مشارکت ایران اسلامی، عضو شورای هماهنگی مجمع زنان اصلاح‌طلب است و همچنین نماینده مجلس ششم ایران بوده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/Grosley-sur-Risle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Grosly-sur-Risle_%28Eure%2C_Fr%29_mairie.JPG","page_title":"Grosley-sur-Risle","context_page_description":"Grosley-sur-Risle is een gemeente in het Franse departement Eure en telt 493 inwoners. De plaats maakt deel uit van het arrondissement Bernay."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%AF%D1%80%D0%BE%D1%88%D0%B5%D0%BD%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Ritratto_di_Ivan_Kramskoj.jpg","page_title":"Николай Ярошенко","context_page_description":"Никола̀й Алекса̀ндрович Ярошѐнко е руски живописец, портретист и жанрист, майстор на еднофигурните композиции, оглавил организацията на Передвижниците след смъртта на Иван Крамской. По образование е военен инженер, завършил кариерата си с чин генерал-майор. Заедно с това завършва и Императорската художествена академия."},{"page_url":"https://en.wikipedia.org/wiki/Ingeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Martial_Exercises_of_Starkater_-_Olaus_Magnus_1555.jpg","page_title":"Ingeld","context_page_description":"Ingeld or Ingjaldr was a legendary warrior who appears in early English and Norse legends. Ingeld was so well known that, in 797, Alcuin wrote a letter to Bishop Higbald of Lindisfarne questioning the monks' interest in heroic legends with: 'Quid enim Hinieldus cum Christo?' - What has Ingeld to do with Christ?\\nThe legends that survive tell of Ingeld as an enemy of Hroðgar, Halga and Hroðulf. The conflict between the Scyldings Hroðgar and Hroðulf on one side, and the Heaðobards Froda and Ingeld on the other, appears both in Beowulf and in Widsith. Scholars generally agree that these characters appear in both Anglo-Saxon and Scandinavian tradition. However, in the Norse tradition the Heaðobards had apparently been forgotten and the conflict is instead rendered as a family feud, or as a conflict with the Saxons, where the Danes take the place of the Heaðobards."},{"page_url":"https://pt.wikipedia.org/wiki/Maria_Frederica_de_Hesse-Cassel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Marie_Fredericka_of_Hesse-Kassel.jpg","page_title":"Maria Frederica de Hesse-Cassel","context_page_description":"Maria Frederica de Hesse-Cassel foi uma filha do príncipe-eleitor Guilherme II de Hesse e da princesa Augusta da Prússia. Através do seu casamento com o duque Bernardo II de Saxe-Meiningen tornou-se duquesa consorte de Saxe-Meiningen."},{"page_url":"https://pt.wikipedia.org/wiki/Campinas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Museu_de_Hist%C3%B3ria_Natural_de_Campinas.JPG","page_title":"Campinas","context_page_description":"Campinas é um município brasileiro no interior do estado de São Paulo, Região Sudeste do país. Pertence à microrregião e mesorregião homônimas, distante 99 km a noroeste de São Paulo, capital estadual. Ocupa uma área de 797,6 km², da qual 238,323 km² estão em perímetro urbano e os 559,277 km² restantes constituem a zona rural. Em 2020, sua população foi estimada pelo Instituto Brasileiro de Geografia e Estatística em 1 213 792 habitantes, sendo o terceiro município mais populoso de São Paulo e o décimo quarto de todo o país. Aparece em quinto lugar entre 100 municípios analisados pelo Índice das Melhores e Maiores Cidades Brasileiras, o BCI100, elaborado pela Delta Economics & Finance com base nos dados do Censo 2010 do IBGE e do Ideb.\\nCampinas foi fundada em 14 de julho de 1774. Entre o final do século XVIII e o começo do século XX, a cidade teve o café e a cana-de-açúcar como importantes atividades econômicas. Porém, desde a década de 1930, a indústria e o comércio são as principais fontes de renda, sendo considerada um polo industrial regional."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AD%A6%E5%A5%88%E3%83%B6%E5%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%E5%86%AC%E3%81%AE%E6%AD%A6%E5%A5%88%E3%83%B6%E5%B2%B32.jpg","page_title":"武奈ヶ岳","context_page_description":"武奈ヶ岳は、滋賀県大津市にある、標高1214.4mの山。滋賀県西部、湖西地方に位置する比良山地の最高峰である。琵琶湖国定公園の一部。日本二百名山、近畿百名山の一つ。"},{"page_url":"https://ro.wikipedia.org/wiki/Panglica_Sf%C3%A2ntului_Gheorghe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Ledpokhod.jpg","page_title":"Panglica Sfântului Gheorghe","context_page_description":"Panglica Sfântului Gheorghe reprezintă un element simbolic militar rusesc, constând dintr-o panglică bicoloră negru-oranj. Aceasta este atașată la Ordinul Sfântului Gheorghe, Crucea Sfântului Gheorghe și Medalia Sfântului Gheorghe. Panglica își are originile în perioada Imperiului Rus fiind un element adițional la cele trei distincții cu care erau decorați militarii ruși pentru eroism și aport adus patriei.\\nÎn perioada sovietică cele trei distincții au fost interzise de către autoritățile comuniste, întrucât ele ar fi reprezentat țarismul, astfel din 1917 până în 1992 panglica nu a fost utilizată pe aceste distincții. Totuși, panglica a continuat să fie folosită în continuare pe distincțiile Sfântului Gheorghe în Armata Albă, în Corpul rus din cadrul Wehrmachtului și pe decorațiile sovietice Ordinul Gloriei și medalia pentru victoria asupra Germaniei, fiind redenumită în ”gvardeiskaia lenta”.\\nStatutul Ordinului înființat în 1769 prevedea următoarea descriere a panglicii:\\n«Panglică de mătase în trei dungi negre și două galbene».\\nÎn statutul din 1833 caracteristicile panglicii nu erau specificate, însă statutul 1913 prevedea:"},{"page_url":"https://ceb.wikipedia.org/wiki/Leptoseris_mycetoseroides","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Leptoseris_mycetoseroides.jpg","page_title":"Leptoseris mycetoseroides","context_page_description":"Espesye sa kagaangan ang Leptoseris mycetoseroides. Una ning gihulagway ni Wells ni adtong 1954. Ang Leptoseris mycetoseroides sakop sa kahenera nga Leptoseris sa kabanay nga Agariciidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://sv.wikipedia.org/wiki/Kombikraftverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/COGES-diagram.png","page_title":"Kombikraftverk","context_page_description":"Ett kombikraftverk, eller gaskombi, kombinerar en gasturbin och en ångturbin för en effektivare elproduktion. Verkningsgraden kan komma upp i 50-60%, vilket är betydligt bättre än vad de båda klarar var för sig.\\nPrincipen är att ett bränsle, ofta naturgas, först förbränns i en gasturbin. Avgaserna från denna håller fortfarande en hög temperatur, runt 500°C. Dessa leds till en avgaspanna där de används för att producera ånga som driver en ångturbin. Eventuellt kan den resterande värmen sedan användas till fjärrvärme för att ytterligare öka effektiviteten.\\nExempel på kombikraftverk är Rya Kraftvärmeverk i Göteborg och Öresundsverket i Malmö, som togs i drift 2006 respektive december 2009."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%BE%A9%E7%83%88%E7%A9%BA%E6%8C%BA%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Japanese_night_raiders_are_greeted_with_a_lacework_of_anti-aircraft_fire_by_the_Marine_defenders_of_Yontan_airfield%2C_on_Okinawa_HD-SN-99-02894.jpg","page_title":"義烈空挺隊","context_page_description":"義烈空挺隊とは、敵飛行場に輸送機で強行着陸して、敵航空機と飛行場施設を破壊することを目的とした旧日本陸軍の空挺部隊で編成された特殊部隊である。沖縄戦期間中の1945年5月24日に、連合軍に占領されていた沖縄の嘉手納飛行場と読谷飛行場に攻撃を行った。"},{"page_url":"https://hr.wikipedia.org/wiki/%C3%91eembuc%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Escudo_de_%C3%91eembuc%C3%BA.PNG","page_title":"Ñeembucú","context_page_description":"Ñeembucú je jedan od 17 okruga u Paragvaju. Središte okruga je u gradu Pilaru."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A0%80%EC%86%8D_%EC%A3%BC%EC%82%AC_%ED%85%94%EB%A0%88%EB%B9%84%EC%A0%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/SSTV_signal.jpg","page_title":"저속 주사 텔레비전","context_page_description":"저속 주사 텔레비전은 아마추어 무선 운영가가 주로 사용하는 영상 전송 방법으로 모노크롬이나 컬러의 정적 사진을 무선을 통해 전송하거나 받는 방식이다.\\n기술적으로 사용하는 SSTV는 주로 협대역 텔레비전에서 이용한다. 텔레비전 방송은 초당 25~30프레임의 사진을 보내기 때문에 6 MHz의 광대역 채널이 필요하나, SSTV의 경우에는 오직 3 kHz의 대역폭만이 필요하다. 보통 하나의 이미지 프레임을 보내는 방법에 따라 다르지만 평균 전송 시간이 8에서 30초로 정지 화상을 보내는 느린 방법이기도 하다.\\nSSTV 시스템이 아마추어 음성 주파수에서 작동하기 때문에 아마추어에서 단파 방송, VHF, UHF에서 사용한다."},{"page_url":"https://es.wikipedia.org/wiki/Democracia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Election_MG_3455.JPG","page_title":"Democracia","context_page_description":"La democracia ​ es una forma de organización social que atribuye la titularidad del poder al conjunto de la ciudadanía. En sentido estricto, la democracia es una forma de organización del Estado en la cual las decisiones colectivas son adoptadas por el pueblo mediante mecanismos de participación directa o indirecta que confieren legitimidad a sus representantes. En sentido amplio, democracia es una forma de convivencia social en la que los miembros son libres e iguales y las relaciones sociales se establecen conforme a mecanismos contractuales.\\nLa democracia se puede definir a partir de la clasificación de las formas de gobierno realizada por Platón, primero, y Aristóteles, después, en tres tipos básicos: monarquía, aristocracia, democracia.​\\nHay democracia indirecta o representativa cuando la decisión es adoptada por personas reconocidas por el pueblo como sus representantes. Hay democracia participativa cuando se aplica un modelo político que facilita a los ciudadanos su capacidad de asociarse y organizarse de tal modo que puedan ejercer una influencia directa en las decisiones públicas o cuando se facilita a la ciudadanía amplios mecanismos plebiscitarios consultivos."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_New_Mills","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/High_Lea_Hall%2C_New_Mills%2C_Derbyshire.jpg","page_title":"Listed buildings in New Mills","context_page_description":"New Mills is a civil parish in High Peak, Derbyshire. It contains 65 listed buildings, which are designated by Historic England and recorded in the National Heritage List for England. Of these, one is listed at Grade II*; the rest are at Grade II. Hague Bridge and Borderstone/Hope Cottage have two listings, as they span parish boundaries."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E7%89%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Nantes_SPOT_1247.jpg","page_title":"南特","context_page_description":"南特，法国西部城市，卢瓦尔河地区大区大西洋卢瓦尔省的一个市镇，同时也是该省省会和大区首府，下辖南特区，其市镇面积为65.19平方千米，2017年1月1日时人口数量为309,346人，在法国城市中排名第6位，其所在的城市公共社区已于2015年升级为都会区。\\n南特位于大西洋卢瓦尔省中南部，卢瓦尔河畔，历史悠久，是法国艺术与历史之城，早在高卢时期就已形成集镇，中世纪时长期被布列塔尼人统治，后因亨利四世在此颁布《南特敕令》而闻名。南特在近代黑奴三角贸易中是西欧重要的通商口岸，由此获得大量财富。20世纪20年代的河流改造工程为南特提供了新的建设用地，同时也基本奠定形成了南特的现代城市框架。\\n南特是法国西部人口最多的城市，是这一地区的政治、经济、文化、医疗和科教中心，同时也是一个水陆空俱全的综合性交通枢纽。二战后，南特成为法国可持续发展模范城市之一，南特岛的综合开发与治理是法国城市规划当中的重要正面案例。1985年，法国首个现代有轨电车系统在南特建成。2013年，南特获得了由欧盟颁发的欧洲绿色首都奖，成为法国首个获得此荣誉的城市。"},{"page_url":"https://de.wikipedia.org/wiki/Samui_Triathlon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Koh_Samui_map.png","page_title":"Samui Triathlon","context_page_description":"Der Samui Triathlon war ein 2012 und 2013 ausgetragenes Triathlon-Rennen über die Langdistanz.\\nKo Samui ist eine Insel in der Provinz Surat Thani in der Südregion von Thailand."},{"page_url":"https://et.wikipedia.org/wiki/Miikael","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/St_Michael_Raphael.jpg","page_title":"Miikael","context_page_description":"Miikael on üks peainglitest.\\nPiibli järgi on Miikael Iisraeli ning kristliku koguduse taevane kaitsja, taevavägede juht, õiguse ja kohtumõistmise, ent ka armu ja halastuse ingel. Koos teiste peainglitega kuulub ta kaheksandasse üheksast ingellike jõudude astmest ning on kõigi üheksa ingliseisuse patroon, headuse, aususe ja inimkonna hüvede eestseisja. Ta on inimeste eestkostja Jumala juures, toetab surijaid ja juhib nende hinged taevasse. Apokalüpsises on tema ülesandeks lõpliku võidu saavutamine kurjuse jõudude üle.\\nKäes hoiab ta saua - jumala käskjala sümbolit ja peeglit, mille kaudu saab jumalikku ennustusvõimet.\\nEestis on Miikaelile pühendatud Keila, Juuru, Jõhvi, Kodavere, Kihelkonna, Räpina, Häädemeeste, Rõngu, Läänemaa Mihkli kihelkonna, Tallinna Mihkli kirik. Hävinud on Narva Mihkli kirik. Rakvere Kolmainu kirikut nimetati varem samuti Mihkli kirikuks. Tallinnas asus ka tsistertslaste Miikaeli nunnaklooster.\\nEesti rahvakalendris tähistatakse Miikaeli nimepäeva ehk mihklipäeva 29. septembril."},{"page_url":"https://pl.wikipedia.org/wiki/Antoni_Halor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Antoni_Halor_-_Skarbnik.jpg","page_title":"Antoni Halor","context_page_description":"Antoni Halor – polski reżyser filmowy i telewizyjny, artysta plastyk, literaturoznawca, publicysta."},{"page_url":"https://de.wikipedia.org/wiki/Nowodugino","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Coat_of_arms_of_Novodugino_%28Smolensk_oblast%29.jpg","page_title":"Nowodugino","context_page_description":"Nowodugino ist ein Dorf in der Oblast Smolensk in Russland mit 3839 Einwohnern."},{"page_url":"https://oc.wikipedia.org/wiki/Rio_Grande_do_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Natal-Ponta-Negra-Via-Costeira.jpg","page_title":"Rio Grande do Norte","context_page_description":"Lo Rio Grande del Nòrd es un estat del nòrd-est de Brasil. Confronta l'estat de Ceará a l'oèst e l'estat de Paraíba al sud. Es bordat per l'Ocean Atlantic al nòrd e a l'èst. Sa superfícia totala es similara a la de Croàcia."},{"page_url":"https://it.wikipedia.org/wiki/Premi_C%C3%A9sar_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Naidra_Ayadi_C%C3%A9sar_2012_-_2.jpg","page_title":"Premi César 2012","context_page_description":"La cerimonia di premiazione della 37ª edizione dei Premi César si è svolta il 24 febbraio 2012 al Théâtre du Châtelet di Parigi. È stata presieduta da Guillaume Canet e presentata da Antoine de Caunes. È stata trasmessa da Canal+.\\nLe candidature sono state rese note il 27 gennaio 2012. Ad ottenerne il maggior numero è stato Polisse di Maïwenn.\\nNel corso della cerimonia è stato reso omaggio a Annie Girardot, scomparsa il 28 febbraio 2011, la cui immagine campeggia sulla locandina ufficiale della cerimonia, ed è stato consegnato un Premio César onorario a Kate Winslet.\\nIl film trionfatore è stato The Artist, diretto da Michel Hazanavicius, vincitore di sei riconoscimenti su dieci candidature, compresi quelli per miglior film e miglior regista."},{"page_url":"https://de.wikipedia.org/wiki/Louis_Auzoux","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Auzoux.jpg","page_title":"Louis Auzoux","context_page_description":"Louis Thomas Jerome Auzoux war ein französischer wissenschaftlicher Modellbauer und Anatom, der insbesondere durch seine anatomischen Modelle aus Pappmaché bekannt wurde.\\nAuzoux studierte von 1816 bis 1822 Medizin, zunächst unter Guillaume Dupuy am Hôtel-Dieu de Paris, später unter Rene-Alexis Baffos am Kinderkrankenhaus. In den frühen 1820er Jahren begann Auzoux mit der Produktion anatomischer Modelle, von denen er die ersten 1822 an der neugegründeten Académie nationale de Médecine präsentierte. Die Modelle erwiesen sich auch als kommerzieller Erfolg und Auzoux erweiterte seinen Katalog um zoologische und botanische Modelle.\\nAuzouxs Pappmaché-Modelle hatten gegenüber herkömmlichen wissenschaftlichen Modellen aus Wachs, Holz, Gips oder Elfenbein zahlreiche Vorteile, so waren sie etwa auseinandernehmbar, temperaturunempfindlich, sowie insbesondere günstig zu produzieren. 1828 eröffnete Auxoux eine Fabrik in Saint-Aubin d'Ecrosville, die Papiermodelle in über 30 Länder überwiegend in universitäre Lehrsammlungen exportierte."},{"page_url":"https://pt.wikipedia.org/wiki/Metralhadora","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Usarmy_m16a2.jpg","page_title":"Metralhadora","context_page_description":"A metralhadora é uma arma de fogo automática projetada para disparar tiros sucessivos rapidamente a partir de um cinto de munição, que são vários cartuchos presos entre si, ou de um carregador. Geralmente, a taxa de tiros por minuto de uma metralhadora comum é de várias centenas. Seu funcionamento é, em alguns pontos, similar ao de um revólver. É considerada uma das mais importantes tecnologias do século XX, tendo sido fundamental durante a primeira e segunda Guerra Mundial.\\nAs metralhadoras geralmente são classificadas em três categorias: metralhadoras propriamente ditas, submetralhadoras e canhões automáticos. Uma metralhadora tem a característica de ser até certo ponto portátil, usada preferencialmente com o auxílio de um bipé ou outro suporte aplicável e ser leve e pequena, podendo ser usada sem apoios, tal como um rifle. Geralmente, metralhadoras são usadas em guerras ou ações policiais de grande porte. Submetralhadoras são projetadas para serem mais leves e portáteis que as metralhadoras. Elas são armas de mão e têm curto alcance, geralmente usadas para defesa pessoal."},{"page_url":"https://af.wikipedia.org/wiki/Rekenaar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/DM_IBM_S360.jpg","page_title":"Rekenaar","context_page_description":"'n Rekenaar is enige toestel wat gebruik word om data volgens 'n goed gedefinieerde prosedure te verwerk. Die term word tans algemeen gebruik om na digitale rekenaars te verwys.\\nDie woord het vroeër verwys na iemand wat somme maak, met of sonder meganiese hulpmiddels, maar die woord is oorgedra na die hulpmiddels. Aanvanklik was die inligtingverwerking amper uitsluitlik vir wiskundige probleme, maar hedendaagse rekenaars word vir verskeie ander take gebruik.\\nDie wye definisie sluit dinge in soos die skuifliniaal, die verskeie meganiese rekenaars van die abakus af verder, asook alle hedendaagse elektroniese rekenaars."},{"page_url":"https://en.wikipedia.org/wiki/Zoology_of_the_Voyage_of_H.M.S._Beagle","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Darwin_Zoology_of_the_Voyage_of_HMS._Beagle_Band1_Teil1_1838.jpg","page_title":"Zoology of the Voyage of H.M.S. Beagle","context_page_description":"The Zoology of the Voyage of H.M.S. Beagle Under the Command of Captain Fitzroy, R.N., during the Years 1832 to 1836 is a 5-part book published unbound in nineteen numbers as they were ready, between February 1838 and October 1843. It was written by various authors, and edited and superintended by Charles Darwin, publishing expert descriptions of the collections he had made during the Beagle voyage.\\nPart 1. Fossil Mammalia, by Richard Owen\\nPart 2. Mammalia, by George R. Waterhouse\\nDarwin also contributed notices of habits and ranges throughout the text of Mammalia and Birds, and the text of the Fish and the Reptiles included numerous notes by him that were mostly taken from his labels. The authors of these parts were as follows:\\nPart 3. Birds, by John Gould\\nPart 4. Fish, by Leonard Jenyns\\nPart 5. Reptiles, by Thomas Bell\\nFor a small additional fee the publishers sold the completed work bound, in five volumes, and later bound in three volumes, the first incorporating Parts 1 & 2, the second Part 3 and the third Parts 4 & 5. An example of this arrangement can be seen in the catalogue entry for the copies held at the State Library of New South Wales."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_Johnson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Johnson_confederate_cemetery_monument.jpg","page_title":"Île Johnson","context_page_description":"L'île Johnson est une île du lac Erié située dans la baie de Sandusky, à 4,8 km de la ville de Sandusky dans le comté d'Ottawa.\\nC'était le site d'un camp de prisonniers de guerre pour les officiers confédérés capturés pendant la guerre de Sécession. Au départ, cette île était la seule prison de l'armée de l'Union exclusivement réservée aux officiers de l'armée des États confédérés mais a finalement détenu des soldats, des prisonniers politiques, des personnes condamnées à la cour martiale et des espions. Des civils qui ont été arrêtés en tant que guérilleros ou bushwhackers, ont également été emprisonnés sur l'île. Au cours de ses trois années de fonctionnement, plus de 15.000 hommes y ont été incarcérés.\\nLe site de la prison et du fort de la guerre civile de Johnson Island est inscrit au Registre national des lieux historiques depuis le 27 mars 1975 sous le n° 75001514 et déclaré National Historic Landmark dans l'Ohio depuis le 21 juin 1990."},{"page_url":"https://zh.wikipedia.org/wiki/2013%E5%B9%B4%E6%BE%B3%E6%B4%B2%E8%81%AF%E9%82%A6%E5%A4%A7%E9%81%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kevin_Rudd_DOS_cropped.jpg","page_title":"2013年澳洲聯邦大選","context_page_description":"2013年澳大利亚联邦大选，即第44届澳大利亚国会选举，于2013年9月7日举行。之前执政的中间偏左澳大利亚工党在总理陆克文的带领下，接受由托尼·艾伯特领导的中间偏右自由党和国家党联盟的挑战。\\n澳大利亚采用的是强制投票的方式。在众议院席位的计票中，采用单一选区完全偏好的选择投票制；选民在投票时，根据自己的偏好程度，将候选人的以“1,2,3”等顺序依次排列并标示于选票上，并在计票中每轮淘汰得到“1”选项最少的候选人，将其票转给得“2”候选人，如此类推，直到有候选人获得过半数当选。在参议院席位的计票中，采用比例代表制；每个选区按照各政党候选人名单获得票数的比例，在参加选举的各党中分配议席。\\n选举结果显示，阿博特领导的联盟党以压倒性优势击败工党。联盟赢得国会下院150席中的90席，取得绝对多数。因此在9月18日，联盟党领袖阿博特正式获总督任命为新总理，联盟成为执政党。工党同时结束六年执政期，成为联邦反对党。选举日当晚工党领袖陆克文发表演讲接受败选，同时辞去工党领袖职务。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B4%80%E3%81%AE%E5%B7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/%E6%A4%BF%E6%A9%8B%E3%82%88%E3%82%8A_Yoshinogawa%2C_view_from_Tsubaki-bashi_2011.2.02_-_panoramio.jpg","page_title":"紀の川","context_page_description":"紀の川は、奈良県から和歌山県へと流れ紀伊水道に注ぐ一級水系の本流。河川名は「紀伊国」に由来する。\\n奈良県内では奈良県南部の地名「吉野」に因み「吉野川」と呼ばれるが、河川名を案内する標識などには水系名である「紀の川」が併記される。地図や橋の銘板には吉野川と記される。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%99%E6%B8%AF%E5%9F%BA%E7%9D%A3%E5%AE%97%E6%95%99%E6%95%99%E6%9C%83%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/HK_Tai_Po_Road_Saviour_Lutheran_Church_2.JPG","page_title":"香港基督宗教教會列表","context_page_description":"以下是香港的基督教教派及其属下教会列表："},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Benon_Tour_de_l%27Horloge.jpg","page_title":"Бенон","context_page_description":"Бенон насеље је и општина у западној Француској у региону Поату-Шарант, у департману Приморски Шарант која припада префектури Rochelle.\\nПо подацима из 2011. године у општини је живело 1.193 становника, а густина насељености је износила 25,59 становника/km². Општина се простире на површини од 46,62 km². Налази се на средњој надморској висини од 22 метара."},{"page_url":"https://fr.wikipedia.org/wiki/Front_Line_Assembly","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/FrontLineAssembly.jpg","page_title":"Front Line Assembly","context_page_description":"Front Line Assembly [fɹʌnt laɪn əˈsɛmbli] ou FLA, aussi typographié Frontline Assembly selon les albums, est un groupe de musique électronique canadien, originaire de Vancouver, en Colombie-Britannique. Il est composé de Bill Leeb et Rhys Fulber. Son style musical, à la croisée de l'electronic body music, de l'indus et de la techno, est caractéristique du genre électro-industriel, dont il est l'un des fondateurs."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%94%D0%B6%D0%BE%D0%BD_%D0%9A%D0%B0%D1%80%E2%80%99%D1%8E","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Carew.jpg","page_title":"Джон Кар’ю","context_page_description":"Джон Элью Кар’ю — былы нарвэскі футбаліст, нападнік. Гуляў за нацыянальную зборную Нарвэгіі. Ягоны бацька гамбіец, маці нарвэжка."},{"page_url":"https://vi.wikipedia.org/wiki/Bi%E1%BB%83u_t%C3%ACnh_t%E1%BA%A1i_H%E1%BB%93ng_K%C3%B4ng_2019%E2%80%932020","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/190717_Silver-hair_elderly_rally.jpg","page_title":"Biểu tình tại Hồng Kông 2019–2020","context_page_description":"Biểu tình tại Hồng Kông năm 2019 – 2020 là một loạt các cuộc biểu tình hiện đang diễn ra ở Hồng Kông và các thành phố khác trên thế giới được gây ra bởi Dự luật Người phạm tội bỏ trốn do chính phủ Hồng Kông đề xuất vào năm 2019. Nếu được ban hành, dự luật sẽ cho phép chính quyền địa phương giam giữ và dẫn độ những người bị truy nã ở những vùng lãnh thổ mà Hồng Kông không có thỏa thuận dẫn độ, kể cả Trung Quốc và Đài Loan. Nhiều người lo ngại dự luật sẽ đặt người Hồng Kông và du khách tới Hồng Kông vào phạm vi tài phán của Trung Quốc đại lục do Đảng Cộng sản Trung Quốc kiểm soát, làm suy yếu nguyên tắc \\"một quốc gia, hai chế độ\\" và điều đó sẽ làm ảnh hưởng tới quyền lợi của họ.\\nMặc dù hàng trăm ngàn người đã tuần hành trong một cuộc biểu tình phản đối dự luật vào ngày 9 tháng 6 nhưng chính phủ vẫn kiên trì với dự luật. Cuộc biểu tình vào ngày 12 tháng 6, ngày dự luật sẽ được đọc lần thứ hai ở Hội đồng Lập pháp, đánh dấu sự leo thang bạo lực mạnh mẽ. Cảnh sát chống bạo động đã triển khai hơi cay và đạn cao su chống lại người biểu tình."},{"page_url":"https://es.wikipedia.org/wiki/Frente_Popular_Dar%C3%ADo_Santill%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/FPDS_2012.jpg","page_title":"Frente Popular Darío Santillán","context_page_description":"El Frente Popular Darío Santillán es un movimiento social y político de Argentina. Fue fundado en 2004, a partir de la confluencia de distintas organizaciones, en su mayoría piqueteras, y también estudiantiles, obreras, campesinas, intelectuales, artísticas, etcétera.​ Toma su nombre del militante Darío Santillán, asesinado por la policía el 26 de junio de 2002 junto a su compañero Maximiliano Kosteki en la Masacre de Avellaneda.​ Darío Santillán era militante de uno de los Movimiento de Trabajadores Desocupados que a partir del año 2004 conformaría el FPDS. Por lo tanto, inicialmente el Frente tomó como tarea prioritaria y original el reclamo por el \\"juicio y castigo\\" a los responsables, penales y políticos, del asesinato de los dos militantes.​"},{"page_url":"https://id.wikipedia.org/wiki/Candi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Prambanan_Plain_en.svg","page_title":"Candi","context_page_description":"Candi adalah istilah dalam Bahasa Indonesia yang merujuk kepada sebuah bangunan keagamaan tempat ibadah peninggalan purbakala yang berasal dari peradaban Hindu-Buddha. Bangunan ini digunakan sebagai tempat pemujaan dewa-dewi ataupun memuliakan Buddha. Akan tetapi, istilah 'candi' tidak hanya digunakan oleh masyarakat untuk menyebut tempat ibadah saja, banyak situs-situs purbakala non-religius dari masa Hindu-Buddha Indonesia klasik, baik sebagai istana, pemandian, gapura, dan sebagainya, juga disebut dengan istilah candi.\\nCandi merupakan bangunan replika tempat tinggal para dewa yang sebenarnya, yaitu Gunung Mahameru. Karena itu, seni arsitekturnya dihias dengan berbagai macam ukiran dan pahatan berupa pola hias yang disesuaikan dengan alam Gunung Mahameru. Candi-candi dan pesan yang disampaikan lewat arsitektur, relief, serta arca-arcanya tak pernah lepas dari unsur spiritualitas, daya cipta, dan keterampilan para pembuatnya.\\nBeberapa candi seperti Candi Borobudur dan Prambanan dibangun amat megah, detail, kaya akan hiasan yang mewah, bercitarasa estetika yang luhur, dengan menggunakan teknologi arsitektur yang maju pada zamannya."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D8%A7%DB%8C%D8%A7%D9%84%D8%AA%DB%8C_%D9%84%D9%88%D8%A6%DB%8C%D8%B2%DB%8C%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Will_Wright_at_SXSW.jpg","page_title":"دانشگاه ایالتی لوئیزیانا","context_page_description":"دانشگاه ایالتی لوئیزیانا یکی از دانشگاه‌های ایالات متحده آمریکا بوده و در شهر بتن روژ مرکز ایالت لوئیزیانا واقع است. هم‌اکنون بیش از صد دانشجوی ایرانی در مقاطع مختلف در این دانشگاه مشغول به تحصیل می‌باشند."},{"page_url":"https://ceb.wikipedia.org/wiki/Grafenwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Luftbild_Bottrop-Grafenwald.jpg","page_title":"Grafenwald","context_page_description":"Lasang ang Grafenwald sa Ostriya. Nahimutang ni sa estado pederal sa Niederösterreich, sa amihanan-sidlakang bahin sa nasod, 40 km sa amihanan sa Vienna ang ulohan sa nasod.\\nHapit nalukop sa kaumahan ang palibot sa Grafenwald. Dunay mga 86 ka tawo kada kilometro kwadrado sa palibot sa Grafenwald medyo hilabihan populasyon. Ang klima klima sa kontinente. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 824 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 107 milimetro nga ulan, ug ang kinaugahan Marso, sa 24 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A9giale_Saint-Martin_de_Montmorency","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Coll%C3%A9giale_de_Montmorency-Clef_de_vo%C3%BBte_centrale-20120916.jpg","page_title":"Collégiale Saint-Martin de Montmorency","context_page_description":"La collégiale Saint-Martin de Montmorency est une église de style gothique flamboyant du XVIᵉ siècle située dans le Val-d'Oise, en région Île-de-France. Bâtie sur un éperon rocheux et précédée d'une terrasse, elle domine la vallée de Montmorency. Remarquable pour son unicité architecturale avec une sobriété et harmonie correspondant à son premier rôle de lieu de sépulture de la maison de Montmorency, la collégiale est surtout réputée pour son exceptionnelle série de quatorze vitraux de la Renaissance, qui se distingue même sur le plan national. Depuis 1631, soit un an avant l'exécution du dernier connétable Henri II de Montmorency, elle sert également d'église paroissiale, et se concentre sur ce rôle unique après la Révolution française. Tout comme l'église Saint-François, l'ancienne collégiale accueille les fidèles catholiques de Montmorency et relève du diocèse de Pontoise. En 2010, son curé est le père Kurowski."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BD%90%E6%B8%A1%E9%87%91%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Sado_gold_mine005.JPG","page_title":"佐渡金山","context_page_description":"佐渡金山是一座位於日本新潟縣佐渡市的金礦。此礦中產出的礦石主要成分為被稱為「銀黑」的石英，其中夾雜有帶狀的輝銀礦與金微粒。"},{"page_url":"https://fi.wikipedia.org/wiki/Cape_Passeron_taistelu_(1940)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/RN_Artigliere_destroyed.jpg","page_title":"Cape Passeron taistelu (1940)","context_page_description":"Cape Passeron taistelu oli Britannian kuninkaallisen laivaston ja Italian laivaston välinen taistelu toisessa maailmansodassa 12. lokakuuta vastaisena yönä vuonna 1940. Taistelussa olivat vastakkain Britannian kevyt risteilijä HMS Ajax ja italialainen laivasto-osasto."},{"page_url":"https://en.wikipedia.org/wiki/List_of_municipal_flags_of_Ky%C5%ABsh%C5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Flag_of_Keisen_Fukuoka.JPG","page_title":"List of municipal flags of Kyūshū","context_page_description":"This page lists the municipal flags of Kyūshū, Japan. It is a part of the List of Japanese municipal flags, which is split into regions due to its size."},{"page_url":"https://es.wikipedia.org/wiki/Rally_en_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Carlos_Sainz_2014_Dakar.jpg","page_title":"Rally en España","context_page_description":"Los rallyes en España son una disciplina deportiva que se practica desde mediados de siglo XX. Las primeras carreras de automóviles se realizaron a principios de siglo y en la década de los 1950 se organizaron las primeras pruebas de rally aunque todavía con el antiguo formato que combinaban pruebas de velocidad y regularidad. Cabe destacar que el término «rally» durante el siglo XX, se usaba para celebraciones deportivas y/o sociales no solo de automóviles, sino también para motocicletas​​ e incluso avionetas.​​\\nEl primer certamen organizado fue el campeonato de España, por entonces denominado Campeonato de España de Conductores de rallies, que nació en 1956. A partir de la década de los años 1960 esta disciplina se fue estandarizando y las pruebas exclusivamente con tramos de velocidad se fueron popularizando sobre las otras. A finales de los años 1960 se comenzaron a organizar los primeros campeonatos regionales como el Campeonato de Castilla, el Campeonato de Cataluña o el Campeonato de Levante, que en el caso del primero abarcaba diferentes provincias y comunidades autónomas."},{"page_url":"https://fi.wikipedia.org/wiki/Formosanpuuleopardi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/LeopardusBrachyurusWolf.jpg","page_title":"Formosanpuuleopardi","context_page_description":"Formosanpuuleopardi on sukupuuttoon kuolleena pidetty puuleopardin Taiwanilla esiintynyt alalaji. Viimeisenä varmana havaintoavuonna on pidetty vuotta 1983 ja virallisesti alalaji julistettiin sukupuuttoon kuolleksi vuonna 2013. Varmentamattomia havaintoja on tosin tehty tämän jälkeenkin."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%B3%E8%8B%A5%E7%91%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ella_Wilkins_20140704.jpg","page_title":"吳若瑄","context_page_description":"吳若瑄，台灣童星。拍攝過數部戲劇和廣告，並曾與王菲合作。"},{"page_url":"https://nl.wikipedia.org/wiki/Eva_van_Marle","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Regentenkamer_-_Zwolle_-_20230047_-_RCE.jpg","page_title":"Eva van Marle","context_page_description":"Eva van Marle was mogelijk een Nederlandse portretkunstenares die actief was in en om Zwolle tussen ca. 1647 en ca. 1654. Ze signeerde haar portretten met het monogram EM.F of EVM.F, een afkorting van Eva Marle Fecit. Haar bekende oeuvre bestaat enkel uit portretten en bevindt zich in de collecties van Museum Catharijneconvent in Utrecht en het Vrouwenhuis in Zwolle, alsook in enkele buitenlandse musea. Onder de door haar geportretteerden bevinden zich goudsmit en juwelier Justinus van Moerkerken, de schoonbroer van Gerard ter Borch de Oudere en de Zwolse pastoor Volkert Herkinge. Van Marle was mogelijk de lerares van portretschilder Hendrick ten Oever die actief was in Zwolle en Amsterdam tussen 1657 en 1705 en wiens werk stilistisch overeenkomsten vertoont met dat van Van Marle."},{"page_url":"https://en.wikipedia.org/wiki/Bernhard_Pauss","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Anna_Henriette_Paus.jpg","page_title":"Bernhard Pauss","context_page_description":"Bernhard Cathrinus Pauss was a Norwegian theologian, educator, author and humanitarian and missionary leader, who was a major figure in girls' education in Norway in his lifetime.\\nHe was headmaster and owner of Nissen's Girls' School and head of its affiliated women's teachers college, the first higher education institution open to women in Norway. He was also a lecturer at the Norwegian Military Academy. He was chairman of the Norwegian Santal Mission, in succession to Oscar Nissen, and the first editor-in-chief of its journal Santalen. He also wrote and edited several schoolbooks in Norwegian and German, including the reading book series Læsebog i Modersmaalet, that was one of the most widely used schoolbooks in Norway for over half a century. A village in India, Pauspur, was named in his honour. He was a member of the government-appointed committee which proposed the Higher School Act, adopted in 1896."},{"page_url":"https://sv.wikipedia.org/wiki/Dudleya_candelabrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Dudleya_candelabrum_2.jpg","page_title":"Dudleya candelabrum","context_page_description":"Dudleya candelabrum är en fetbladsväxtart som beskrevs av Joseph Nelson Rose, Nathaniel Lord Britton och Rose. Dudleya candelabrum ingår i släktet Dudleya och familjen fetbladsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%89%E0%B0%A4%E0%B1%8D%E0%B0%B8%E0%B0%B5%E0%B0%AE%E0%B1%82%E0%B0%B0%E0%B1%8D%E0%B0%A4%E0%B0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Chenakesava_swami_idol.jpg","page_title":"ఉత్సవమూర్తి","context_page_description":"ఉత్సవమూర్తిని సంస్కృతంలో ఉత్సవార్ అంటారు. ప్రధానంగా హిందూ మతానికి సంబంధించిన ఉత్సవాలలో ఉపయోగించే దేవతా విగ్రహాలను ఉత్సవమూర్తులు లేక ఉత్సవ విగ్రహాలు అంటారు. పండుగల సమయంలో, తిరునాళ్ల సమయంలో ఉత్సవ విగ్రహాలను ఊరేగింపు చేస్తారు. ఉత్సవ విగ్రహాలను ముఖ్యంగా లోహంతో తయారు చేస్తారు. భక్తులు దేవాలయంలోని మూలవిరాట్‍ను పూజించినట్లే ఉత్సవమూర్తులను భక్తి శ్రద్ధలతో పూజిస్తారు."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_cerkva_v_Sloveniji_(M)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Locica_pri_Vranskem_Slovenia_-_church.jpg","page_title":"Seznam cerkva v Sloveniji (M)","context_page_description":null},{"page_url":"https://en.wikipedia.org/wiki/Nina_Rajarani","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Nina_Rajarani.JPG","page_title":"Nina Rajarani","context_page_description":"Nina Rajarani, MBE, is an award-winning South Asian dancer and choreographer and winner of The Place Prize 2006. She runs a dance school based in Harrow, Middlesex, and is Artistic Director of Srishti - Nina Rajarani Dance Creations, a male-dominated touring dance company.\\nNina Rajarani was awarded the Diploma in Bharatanatyam from the Bharatiya Vidya Bhavan in 1986 and in 1987 she staged her Arangetram. Rajarani has toured as a performer in the UK, Europe, Singapore, Malaysia and Australia.\\nRajarani won the Place Prize, Europe's largest choreographic competition, in the autumn of 2006. Rajarani was chosen from 20 finalists and 204 entries overall. The winning piece, QUICK!, is inspired by the fast-paced world of city traders. Popular with audiences, QUICK! remains in the touring repertory.\\nNina Rajarani was awarded an MBE in the Queen’s 2009 Birthday Honours, in recognition of her services to South Asian Dance. The award was announced on 13 June 2009.\\nRajarani has a school of dance established in 1991 and based at the Harrow Arts Centre in Middlesex. Rajarani is currently the Secretary of the South Asian Dance Faculty of the ISTD. She is also an Associate Artist of Akademi."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A4%D7%9C%D7%A8-438b","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kepler-438_b_superflare.jpg","page_title":"קפלר-438b","context_page_description":"קפלר-438b הוא כוכב לכת שמקיף כוכב מסוג ננס אדום אשר נקרא קפלר-438. קפלר-438b נמצא באזור ישיב, הוא בעל רדיוס של פי 1.12 מזה של כדור הארץ והוא מוגדר כדמוי ארץ. כוכב לכת זה נמצא בקבוצת הכוכבים נבל והוא רחוק 475 שנות אור מכדור הארץ. הוא התגלה על ידי טלסקופ החלל קפלר של נאס\\"א וקיומו הוכרז ב-6 בינואר 2015."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%95%B7%E4%BA%A8%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Cheung_Hang_Estate_Gym_Zone_%283%29.jpg","page_title":"長亨邨","context_page_description":"长亨邨是香港公共屋邨，位于新界青衣岛西面，现时由宜居物业管理有限公司负责屋邨管理。"},{"page_url":"https://ro.wikipedia.org/wiki/Coloana_Ciumei_din_Viena","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Coloana_Ciumei_din_Viena1.jpg","page_title":"Coloana Ciumei din Viena","context_page_description":"Coloana Ciumei din Viena este un monument baroc situat în centrul orașului Viena, pe strada centrală numită Graben. Ea este una dintre cele mai cunoscute și importante monumente statuare din oraș. Coloana a fost inaugurată în anul 1693, la zece ani de la eliberarea Vienei din asediul otoman.\\nProgramul artistic al monumentului evocă pioșenia împăratului Leopold I și sugerează faptul că eliberarea Vienei se datorează evlaviei și rugăciunilor monarhului. Monumentul constituie prototipul coloanelor ciumei amplasate în Imperiul Austriac."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%93%E5%94%87%E9%BA%97%E9%AD%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Limnotilapia_dardenni_%28top%29%2C_Lobochilotes_labiatus_%28bottom%29_-_Royal_Museum_for_Central_Africa_-_DSC06856.JPG","page_title":"圓唇麗魚","context_page_description":"圆唇丽鱼，为辐鳍鱼纲鲈形目隆头鱼亚目慈鲷科的一个种，分布于非洲坦干伊喀湖流域，为特有种，体长可达36.8公分，栖息在沿岸岩石水域，会至沙质水域觅食，属肉食性，以贝类、甲壳类等为食，可作为观赏鱼。"},{"page_url":"https://kk.wikipedia.org/wiki/IC_2727","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/IC2727_-_SDSS_DR14.jpg","page_title":"IC 2727","context_page_description":"IC 2727 — Арыстан шоқжұлдызында орналасқан E типті галактика."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%BF%D0%B8%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%B3%D0%B0%D0%BB%D0%B0%D0%BA%D1%82%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/NGC_7318.jpg","page_title":"Список спиральных галактик","context_page_description":"Спира́льная гала́ктика — один из основных типов галактик, разновидность галактик в последовательности Хаббла, которые характеризуются следующими физическими свойствами:\\nзначительный суммарный вращательный момент;\\nсостоят из центрального балджа, окружённого диском:\\nбалдж имеет сходство с эллиптической галактикой, содержащей множество старых звёзд — так называемое «Население II» — и нередко сверхмассивную чёрную дыру в центре;\\nдиск является плоским вращающимся образованием, состоящим из межзвёздного вещества, молодых звёзд «Населения I» и рассеянных звёздных скоплений."},{"page_url":"https://it.wikipedia.org/wiki/Cucina_mantovana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Risotto_%281%29.jpg","page_title":"Cucina mantovana","context_page_description":"La cucina mantovana è l'insieme dei piatti della tradizione culinaria della provincia italiana di Mantova, alcuni dei quali risalenti ai tempi dei Gonzaga.\\nÈ una gastronomia forte di piatti apprezzati fuori dal territorio anche nei secoli scorsi. È una cucina vincolata alla terra dalle tradizioni contadine, ma risulta molto ricca e variegata. Diverse possono essere le varianti locali di uno stesso piatto.\\nVista la posizione geografica occupata dalla provincia di Mantova, la tradizione culinaria mantovana si apparenta alla cucina emiliana del salume e della pasta ed alla cucina lombarda del riso. Altra influenza, reciproca, è quella della cucina austriaca, dovuta alla lunga permanenza degli austriaci sul territorio mantovano e all'impiego di cuochi mantovani presso la corte d'Austria. In ultimo si ritrovano legami anche con la tradizione tirolese o svizzera."},{"page_url":"https://en.wikipedia.org/wiki/The_Heiress_at_Coffee_Dan%27s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Bessie_Love_lives_as_a_rich_heiress_in_The_Heiress_at_Coffee_Dan%27s.jpg","page_title":"The Heiress at Coffee Dan's","context_page_description":"The Heiress at Coffee Dan's is a 1916 American silent comedy-drama film produced by the Fine Arts Film Company and distributed by Triangle Film Corporation. It starred Bessie Love and was directed by Edward Dillon.\\nThe film is presumed lost."},{"page_url":"https://es.wikipedia.org/wiki/Volc%C3%A1n_Lan%C3%ADn","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/MWP_Forschungsflugzeug_S10VT.jpg","page_title":"Volcán Lanín","context_page_description":"El Lanín es un estratovolcán considerado activo, ubicado en el sur de Argentina y Chile. Tiene una altitud de 3776 metros sobre el nivel del mar, este volcán se encuentra incluido en el Cinturón de Fuego del Pacífico. Por primera vez en tiempos históricos se detectó actividad en el volcán a partir del 15 de febrero de 2017 producto de movimientos sísmicos en su interior. Anteriormente pudo haber tenido actividad aproximadamente en el 540 después de Cristo datada por radiocarbono y su última erupción se estima que ocurrió hace 1600 años.​ Fue avistado en 1782 por el explorador español Basilio Villarino quien lo señala como el Cerro Imperial, ​ y comenta que los lugareños los llamaban Yajaunaujén​ El cráter que pudo dejar su última erupción no es visible y se cree que está sepultado bajo el glaciar que se encuentra en la cima de la montaña.\\nSe encuentra ubicado en el departamento Huiliches, en cercanías de la ciudad de Junín de los Andes, provincia del Neuquén, en el límite entre Argentina y Chile, rodeado por los lagos Paimún y Huechulafquen al Sur y el Lago Tromen al norte, y le da nombre al parque que lo contiene parque nacional Lanín."},{"page_url":"https://sk.wikipedia.org/wiki/Galanta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Galanta%2C_n%C3%A1dra%C5%BE%C3%AD_II.JPG","page_title":"Galanta","context_page_description":"Galanta je okresné mesto ležiace na západe Slovenska v Trnavskom kraji. Miestnymi časťami Galanty sú pripojené obce Nebojsa, Hody a Javorinka. Bývalou miestnou časťou je dnes samostatná obec Matúškovo."},{"page_url":"https://en.wikipedia.org/wiki/Culture_in_Pristina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Turkey_flag_300.png","page_title":"Culture in Pristina","context_page_description":"As the capital city of Kosovo, Pristina is the heart of the cultural and artistic development of all Albanians that live in Kosovo. The department of cultural affairs is just one of the segments that arranges the cultural events, which make Pristina one of the cities with the most emphasized cultural and artistic traditions.\\nThe Goddess on the Throne has been adopted as the symbol of Pristina. It is the most precious archaeological artifacts of Kosovo that has been founded during some excavations in 1955 in the region of Ulpiana, a suburb of Pristina.\\nIt dates back to 3500 BC in the Neolithic period and is made of clay. Pristina also has its municipal archive which was established in the 1950s and holds all the records of the city, municipality and the region."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84%E3%82%AD%E3%83%8F80%E7%B3%BB%E6%B0%97%E5%8B%95%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Jnr-Kiha81-3_kiosk.jpg","page_title":"国鉄キハ80系気動車","context_page_description":"国鉄キハ80系気動車は、日本国有鉄道が開発した特急形気動車。系統としては、1960年に量産先行車的要素で特急「はつかり」用として製造されたキハ81系グループ26両と1961年以降に製造されたキハ82系グループ358両の総称で、基本構造の多くを共通とするため本項において一括して解説する。"},{"page_url":"https://en.wikipedia.org/wiki/Morgantina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Morgantina_Greek_theater_seen_from_northeast_AvL.JPG","page_title":"Morgantina","context_page_description":"Morgantina is an archaeological site in east central Sicily, southern Italy. It is sixty kilometres from the coast of the Ionian Sea, in the province of Enna. The closest modern town is Aidone, two kilometres southwest of the site. The site consists of a two-kilometre long ridge running southwest-northeast, known as Serra Orlando, and a neighboring hill at the northeast called Cittadella. Morgantina was inhabited in several periods. The earliest major settlement was made at Cittadella and lasted from about 1000/900 to about 450 BCE. The other major settlement was located on Serra Orlando, and existed from about 450 BCE to about 50 CE. Morgantina has been the subject of archaeological investigation since the early 20th century.\\nSerra Orlando was identified as Morgantina by Kenan Erim following the discovery of a number of coins bearing the Latin word HISPANORUM. Erim used these coins and passages from Livy to argue that the city found at Serra Orlando was in fact the ancient city of Morgantina."},{"page_url":"https://el.wikipedia.org/wiki/Setra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Setra_S_6_BW_1.JPG","page_title":"Setra","context_page_description":"Η Setra είναι γερμανική εταιρεία που παράγει τουριστικά, υπεραστικά και αστικά λεωφορεία.\\nΜέχρι το 1995, η Setra άνηκε στην εταρεία Kässbohrer και δραστηριοποιούνταν υπό το όνομα Kässbohrer-Setra. Λόγω οικονομικών προβλημάτων η Kässbohrer εξαγοράστηκε από την Daimler-Benz το 1995."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%81%E9%B1%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/L%C3%ADn_obecn%C3%BD.jpg","page_title":"丁鱥","context_page_description":"丁鱖，又稱歐洲丁鱖、丁鱥、是一種分布於歐亞大陸淡水和汽水的鯉科魚類，是丁鱖屬的唯一一種。通常生活在水流緩慢的淡水中，特別是湖泊和河流下游。"},{"page_url":"https://hu.wikipedia.org/wiki/ANZAC-%C3%B6b%C3%B6l","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Anzac_Cove_beach_2004.jpg","page_title":"ANZAC-öböl","context_page_description":"Az ANZAC-öböl kis öböl a Dardanellák partjainál, a törökországi Gallipoli félszigeten. Az öböl nevét onnan kapta, hogy az első világháborúban itt szálltak partra az ANZAC hadtest katonái a Dardanellák ostroma hadművelet során, 1915. április 25-én. Az öböl mindössze 600 méter széles, két oldalán dombság övezi. A partraszállást követően ez az öböl volt az ausztrál és új-zélandi katonák legfőbb támaszpontja a Gallipoli-félszigeten a csata 8 hónapja alatt.\\nA partraszállás alatt a katonák legfontosabb célkitűzése az volt, hogy biztosítság az öblöt, vagyis megtisztítsák az ellenséges katonáktól és lehetővé tegyék további katonák és az utánpótlás partra szállítását. Az ANZAC-öböltől a kialakuló frontvonal sosem távolodott messzebbre, mint 1 km, vagyis jóval a török tüzérség hatótávolságán belül maradt. William Birdwood tábornok, az ANZAC parancsnoka, az öböl egyik rejtett vízmosásában rendezte be parancsnoki harcálláspontját, példáját követték az Új-Zélandi és Ausztrál Hadosztály, valamint az Ausztrál 1. Hadosztály parancsnokai is."},{"page_url":"https://it.wikipedia.org/wiki/San_Casciano_in_Val_di_Pesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Villa_antinori_di_cigliano%2C_giardino%2C_vasca_e_fontana_02.JPG","page_title":"San Casciano in Val di Pesa","context_page_description":"San Casciano in Val di Pesa è un comune italiano di 17 129 abitanti della città metropolitana di Firenze in Toscana.\\nÈ parte della sottozona Classico del Chianti ed è un centro rinomato per la produzione dei suoi vini, dell'olio extravergine d'oliva, e dei prodotti agricoli in generale."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%91%D0%B0%D1%81%D0%B0%D1%80%D0%B0%D0%B1%D1%8F%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Basarabeasca_coat.png","page_title":"Басарабяска","context_page_description":"Басарабяска — места ў Малдове."},{"page_url":"https://pl.wikipedia.org/wiki/Kapelanka_(kamienio%C5%82om)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/NiskiMur_Zakrz%C3%B3wek_DK46.jpg","page_title":"Kapelanka (kamieniołom)","context_page_description":"Kapelanka lub łom na Kapelance – nieczynny kamieniołom wapienia na wzniesieniu Krzemionki Zakrzowskie w będącej częścią Krakowa Dzielnicy VIII Dębniki.\\nWapienie na potrzeby budownictwa wydobywano tutaj od wielu wieków, jednak na wielką skalę dopiero od początku XX wieku. Początkowo zakłady wydobywające wapień należały do Austriackich Zakładów Solvay i Zakładów Solvay w Polsce sp. w Warszawie. Po I wojnie światowej stały się własnością Krakowskich Zakładów Sodowych Solvay. Wydobywany wapień wykorzystywano głównie do produkcji sody. W czasie II wojny światowej w zakładach tych jako pracownik fizyczny pracował Karol Wojtyła, późniejszy papież Jan Paweł II.\\nNa Krzemionkach Zakrzowskich wapienie wydobywano w kilku miejscach. Oprócz Kapelanki istniały kamieniołomy Łom Bergera, Skałki Twardowskiego i Zakrzówek. Eksploatację wapieni zakończono w 1991 roku. Niemal całe wzgórze wraz z wyrobiskami dawnych kamieniołomów stało się jednym z terenów rekreacyjnych Krakowa o nazwie Uroczysko Skałki Twardowskiego. Po dawnym kamieniołomie pozostały mury skalne o pionowych, miejscami nieco przewieszonych ścianach. Stały się one mekką krakowskich wspinaczy skalnych."},{"page_url":"https://it.wikipedia.org/wiki/Ren%C3%A9_Sch%C3%BCtzenberger","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Ren%C3%A9_Sch%C3%BCtzenberger_2.jpg","page_title":"René Schützenberger","context_page_description":"René Paul Schützenberger è stato un pittore francese."},{"page_url":"https://zh.wikipedia.org/wiki/Intel_80287","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/KL_Intel_C80287.jpg","page_title":"Intel 80287","context_page_description":"80287是Intel 80286系列微处理器的数学辅助处理器。英特尔的型号包括指定频率范围从6到12 MHz的频率。之后是带有387微架构的i80287XL和i80287XLT，这是一款适用于笔记本电脑以及其他型号的特殊版本。 80287XL实际上是80387SX，具有287引脚排列。它包含一个内部3/2乘法器，因此以2/3 CPU速度运行协处理器的主板可以以与CPU相同的速度运行FPU。其他具有类似387性能的287型号是使用CHMOS III构建的Intel 80C287，以及采用AMD CMOS工艺制造的AMD 80EC287，仅使用全静态设计。 80287和80287XL与80386微处理器配合使用，最初是80386的唯一协处理器，直到1987年推出80387.最后，他们能够使用Cyrix Cx486SLC。然而，对于这两种芯片而言，80387因其更高的性能和更强的指令集能力而备受青睐。"},{"page_url":"https://fr.wikipedia.org/wiki/Masl%C3%A9on","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ranunculus_aconitifolius01.jpg","page_title":"Masléon","context_page_description":"Masléon est une commune française située dans le département de la Haute-Vienne, en région Nouvelle-Aquitaine.\\nLe bourg est issu d’une bastide, la plus septentrionale de toutes, créée par Philippe IV le Bel, en 1289, dont il n’a gardé que la structure de ses rues parallèles et perpendiculaires. La commune englobe aujourd'hui une ancienne enclave de la commune voisine qui lui est rattachée en 1833."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Leutkirch_im_Allg%C3%A4u","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Leutkirch_G%C3%A4nsb%C3%BChl2_img01.jpg","page_title":"Liste der Kulturdenkmale in Leutkirch im Allgäu","context_page_description":"In der Liste der Kulturdenkmale in Leutkirch im Allgäu sind Bau- und Kunstdenkmale in der Kernstadt Leutkirch im Allgäu sowie in den Ortsteilen verzeichnet. Neben den 228 hier verzeichneten Bau- und Kulturdenkmalen gibt es im Stadtgebiet noch 15 archäologische Kulturdenkmale aus frühgeschichtlicher und antiker Zeit und 15 Kulturdenkmale der Mittelalterarchäologie."},{"page_url":"https://en.wikipedia.org/wiki/Vector_Limited","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Linemen_In_Henderson_Working_On_Pole.jpg","page_title":"Vector Limited","context_page_description":"Vector Limited is an electricity and gas distribution company in Auckland, New Zealand. It is the national number one provider of electricity distribution, number one provider of electricity and gas metering and number two wholesaler of LPG. It also owns a fibre optic cable network.\\nEntrust, formerly named Auckland Energy Consumer Trust, owns around three quarters of its shares, and had full ownership until 2005."},{"page_url":"https://ast.wikipedia.org/wiki/Xuegos_Ol%C3%ADmpicos_de_Sarayevu_1984","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Eirik_Kvalfoss_1986.jpg","page_title":"Xuegos Olímpicos de Sarayevu 1984","context_page_description":"Los Xuegos Olímpicos de Sarajevo 1984, oficialmente conocíos como los XIV Xuegos Olímpicos d'Iviernu, fueron un eventu multideportivu internacional celebráu en Sarajevo, Bosnia-Herzegovina, Yugoslavia, ente'l 8 y el 19 de febreru de 1984. Nesta edición participaron 1.272 atletes —998 homes y 274 muyeres— de 49 comités olímpicos nacionales, que compitieron en 39 eventos de 10 deportes.\\nLa XIV Olimpiada d'Iviernu foi la primera entamada nun estáu socialista, ensin cuntar l'eventu de branu en Moscú 1980. La mayoría de competencies tuvieron llugar en cuatro aparques de monte de los Alpes Dináricos —Bjelašnica, Jahorina, Igman y Trebević—, ente que na capital bosnia atopábense l'estadiu olímpicu y los pabellones cubiertos. A pesar de que les pruebes d'esquí sufrieron retrasos por culpa del mal tiempu, considérase que los XX.OO. de Sarajevo 1984 fueron un ésitu organizativo, a diferencia de #asoceder na edición anterior.\\nA nivel deportivu, Alemaña Oriental encabezó'l medayeru con 24 preseas —9 oros, 9 plates y 6 bronces—, magar la Xunión Soviética llogró un metal más."},{"page_url":"https://en.wikipedia.org/wiki/Portrait_painting_in_Scotland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/David_Hume_2.jpg","page_title":"Portrait painting in Scotland","context_page_description":"Portrait painting in Scotland includes all forms of painted portraiture in Scotland, from its beginnings in the early sixteenth century until the present day. The origins of the tradition of portrait painting in Scotland are in the Renaissance, particularly through contacts with the Netherlands. The first portrait of a named person that survives is that of Archbishop William Elphinstone, probably painted by a Scottish artist using Flemish techniques around 1505. Around the same period Scottish monarchs turned to the recording of royal likenesses in panel portraits, painted in oils on wood. The tradition of royal portrait painting in Scotland was probably disrupted by the minorities and regencies it underwent for much of the sixteenth century. It began to flourish after the Reformation, with paintings of royal figures and nobles by Netherlands artists Hans Eworth, Arnold Bronckorst and Adrian Vanson. A specific type of Scottish picture from this era was the \\"vendetta portrait\\", designed to keep alive the memory of an atrocity. The Union of Crowns in 1603 removed a major source of artistic patronage in Scotland as James VI and his court moved to London."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Herrscher_der_Moldau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Coat_of_arms_of_Moldavia.svg","page_title":"Liste der Herrscher der Moldau","context_page_description":"Diese Liste enthält die Herrscher des Fürstentums Moldau."},{"page_url":"https://nl.wikipedia.org/wiki/Nepenthes","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Nepenthes_rafflesiana_prey.jpg","page_title":"Nepenthes","context_page_description":"Nepenthes is een geslacht van tropische vleesetende bekerplanten in de monotypische familie Nepenthaceae. De meeste soorten groeien als klimplant of lage struik. Met hun nectar lokken ze insecten en andere prooidieren naar hun vangbekers, die op de grond liggen of hoger in de lucht hangen. Als de dieren op de bekerrand landen, glijden ze makkelijk uit op het glibberige oppervlak en vallen ze in de beker. Die is gevuld met een stroperige vloeistof vol verteringsenzymen, die aangemaakt wordt door klieren aan de binnenzijde. Veel bekerplanten leven in symbiose met andere organismen, waarvan een groot aantal volledig afhankelijk van de plant is.\\nDe meeste soorten in het geslacht zijn endemisch in hun regio. Het verspreidingsgebied ligt grotendeels in Zuidoost-Azië, met de grootste biodiversiteit op Borneo, Sumatra en de Filipijnen. Een klein aantal soorten komt tot ver daar buiten voor, waaronder op Sri Lanka, Madagaskar en de Seychellen. Hun carnivore levenswijze stelt de planten in staat om op een voedselarme grond te groeien. De meeste soorten groeien in tropische hellingbossen met grote temperatuurverschillen."},{"page_url":"https://ja.wikipedia.org/wiki/1953%E5%B9%B4%E3%81%AE%E5%8F%B0%E9%A2%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Doris_1953_track.png","page_title":"1953年の台風","context_page_description":"1953年の台風のデータ。台風の発生数は23個であった。\\nこの年から、「北西太平洋の熱帯低気圧のうち最大風速が17.2m/s以上のもの」という台風の定義が使用されることになった。1952年4月28日に講和条約が発効すると、それまでアメリカ極東空軍指令部によって細部まで管理されていた気象事業を、中央気象台 が、自主的に行えるようになり、これを機に台風作業が検討され、1953年5月29日に「台風に関する予報業務取扱細則」が作られている。この細則により、同年6月4日、それまでの外国の女性名だった台風の呼び名をやめ、番号で表すことが中央気象台より発表された。このようなことから、1953年以前の台風と称している資料については、取り扱いに注意が必要である。この年のジュディ台風は、女性名で呼称された最後の台風であもあり、そして終戦後に番号をつけられた最初の台風でもある。\\nこの年に日本に接近した台風は10個あり、うち2個が上陸台風であった。9月に上陸した台風13号は、近畿地方を中心に甚大な被害をもたらし、多数の犠牲者を出した。"},{"page_url":"https://ca.wikipedia.org/wiki/Montesa_Honda","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Toni_Bou_trial_equipment_2012_b.JPG","page_title":"Montesa Honda","context_page_description":"Montesa Honda és una empresa subsidiària del grup Honda. L'empresa fou fundada el 1986 com a Montesa Honda, S.A. fruit de la unió de Motocicletas Montesa, S.A. i d'Honda Motor Co Ltd, amb la finalitat de dedicar-se a la importació, fabricació i distribució de motocicletes. Després d'iniciar les seves activitats a la històrica fàbrica de Montesa a Esplugues de Llobregat, l'any 2000 es traslladà a unes instal·lacions de nova construcció a Santa Perpètua de Mogoda, Vallès Occidental, on segueix en l'actualitat.\\nD'ençà de la seva fundació i fins al 31 de març de 2010, Montesa Honda estigué especialitzada en la fabricació de motocicletes d'entre 125 i 1000 cc, així com del reeixit model de trial Cota. L'endemà d'aquella data, degut a la reestructuració d'Honda a nivell global, l'empresa abandonà la fabricació quasi totalment i passà a dedicar-se a activitats menors fins que el 2013 inaugurà un important centre logístic a les seves instal·lacions, des del qual abasteix els mercats espanyol, portuguès i francès."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%9C%D7%91%D7%93%D7%95%D7%A8_(%D7%A1%D7%A4%D7%99%D7%A0%D7%AA_%D7%9E%D7%A2%D7%A4%D7%99%D7%9C%D7%99%D7%9D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/PikiWiki_Israel_12118_monument_to_the_victims_on_immigrants_ship_salvado.jpg","page_title":"סלבדור (ספינת מעפילים)","context_page_description":"סלבדור היה שמה של אוניית מעפילים אשר הפליגה ב-3 בדצמבר 1940 מנמל וארנה שבבולגריה, במסגרת מפעל ההעפלה הפרטי של ד\\"ר ברוך קונפינו ועל סיפונה 352 מעפילים. ב-12 בדצמבר 1940 לפנות בוקר טבעה הספינה בים מרמרה מול חוף סיליברי ו-238 מעפילים נספו באסון. טביעת הסלבדור עוררה הדים רבים בבולגריה ומחוצה לה ובעקבותיה הופסק מפעלו של הד\\"ר קונפינו."},{"page_url":"https://en.wikipedia.org/wiki/Miss_Honey_Dijon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Honey_Dijon_on_the_LOVE_18_set.jpg","page_title":"Miss Honey Dijon","context_page_description":"Honey Dijon, is an American DJ, producer, electronic musician, and fashion icon. She was born in Chicago and is based in New York City and Berlin.\\nShe has performed at clubs, art fairs, galleries and fashion events worldwide. Renowned for not adhering to any particular genre, Honey Dijon is known for curating cross-genre sets."},{"page_url":"https://fr.wikipedia.org/wiki/Tourne_(ruisseau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/R%C3%A9surgence_du_vallon_de_Tourne.JPG","page_title":"Tourne (ruisseau)","context_page_description":"La Tourne est un ruisseau du département français de l'Ardèche, en région Auvergne-Rhône-Alpes, affluent droit du Rhône.\\nDeux sources alimentant le ruisseau sont connues pour être un lieu de record de profondeur en plongée souterraine."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%9D%BC%EA%B3%A0%EC%95%84_(%EC%95%8C%EA%B0%80%EB%A5%B4%EB%B8%8C_%EC%A7%80%EB%B0%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Porto_da_Lagoa%2C_vista_parcial%2C_foto_feita_so_Miradouro_do_Castelo%2C_Lagoa%2C_ilha_de_S%C3%A3o_Miguel%2C_A%C3%A7ores.JPG","page_title":"라고아 (알가르브 지방)","context_page_description":"라고아는 포르투갈 알가르브 지방 파루 현의 도시이다. 인구는 2011년 기준으로 22,975명이다."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AA%D8%B7%D9%84%D8%A8%D8%A7%D8%AA_%D8%A7%D9%84%D8%AD%D8%B5%D9%88%D9%84_%D8%B9%D9%84%D9%89_%D8%AA%D8%A3%D8%B4%D9%8A%D8%B1%D8%A9_%D9%84%D9%85%D9%88%D8%A7%D8%B7%D9%86%D9%8A_%D8%A7%D9%84%D8%A8%D8%AD%D8%B1%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Visa_requirements_for_Bahraini_citizens.png","page_title":"متطلبات الحصول على تأشيرة لمواطني البحرين","context_page_description":null},{"page_url":"https://es.wikipedia.org/wiki/Bas%C3%ADlica_de_Nuestra_Se%C3%B1ora_del_Puy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Estella_-_Bas%C3%ADlica_de_Nuestra_Se%C3%B1ora_del_Puy_02.jpg","page_title":"Basílica de Nuestra Señora del Puy","context_page_description":"La basílica de Nuestra Señora del Puy es una basílica de Estella y dedicada a la patrona de la localidad. Está ubicada en un alto desde el que se ve un panorama de toda la ciudad, así como las carreteras de acceso y los montes que la circundan.\\nUna leyenda cuenta que en 1085, cerca de la creación de la nueva ciudad de Estella, unos pastores de Abárzuza acudieron a un alto atraídos porque unas estrellas lo señalaban y allí encontraron, en una cueva, una imagen de la Virgen con el niño. Se la llamó Virgen del Puy, a semejanza de una advocación muy venerada en Francia: Nôtre Dame du Puy de Le Puy-en-Velay. El rey Sancho Ramírez mandó construir una ermita en su honor, que fue sustituida siglos más tarde por una iglesia de estilo barroco. Se conserva un atrio de acceso de esta época, pero el templo actual es del siglo XX, obra del arquitecto pamplonés Víctor Eusa.\\nLa planta y toda la decoración del templo gira en torno a la forma de una estrella de ocho puntas, que es el símbolo de la ciudad de Estella. El templo conserva una imagen de la virgen de finales del siglo XIII o comienzos del XIV. Es de madera forrada de plata."},{"page_url":"https://en.wikipedia.org/wiki/Pope_Alexander_VI","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Lucrezia_Borgia.jpg","page_title":"Pope Alexander VI","context_page_description":"Pope Alexander VI, born Rodrigo de Borja, was Pope from 11 August 1492 until his death in 1503.\\nBorn into the prominent Borgia family in Xàtiva in the Crown of Aragon, Rodrigo studied law at the University of Bologna. He was ordained deacon and made a cardinal in 1456 after the election of his uncle as Pope Callistus III, and a year later he became vice-chancellor of the Catholic Church. He proceeded to serve in the Curia under the next four popes, acquiring significant influence and wealth in the process. In 1492, Rodrigo was elected Pope, taking the name Alexander VI.\\nAlexander's bulls of 1493 confirmed or reconfirmed the rights of the Spanish crown in the New World following the finds of Christopher Columbus in 1492. During the second Italian war, Alexander VI supported his son Cesare Borgia as a condottiero for the French King. The scope of his foreign policy was to gain the most advantageous terms for his family.\\nAlexander is considered one of the most controversial of the Renaissance popes, partly because he acknowledged fathering several children by his mistresses."},{"page_url":"https://sq.wikipedia.org/wiki/Benazir_Buto","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Benazir_Bhutto.jpg","page_title":"Benazir Buto","context_page_description":"Benazir Buto, lindi më 21 qershor të vitit 1953 në Karaçi, Pakistan dhe u vra në një atentat më 27 dhjetor të vitit 2007 në Ravalpindi, Pakistan, ishte gruaja e parë në krye të një vendi mysliman post-kolonial.\\nButo u zgjodh kryeministre e Pakistanit në vitin 1988, por pas 20 muajve me përkrahjen e ushtrisë e shkarkoi kryetari Gulam Ishak Kan. Benazir Buto përsëri u zgjodh në vitin 1993, por tri vite pas e shkarkoi kryetari i atëhershëm Faruk Legar.\\nMë 18 tetor të vitit 2007 ajo u kthye në Pakistan pas tetë viteve azil politik. Menjëherë ditën e nesërme në Karaçi në mitingun e organizuar me rrasin e kthimit të saj në vend ishin vendosur dy bomba të cilat shkaktuan vdekjen e qindra njerëzve. Benazir Buto nuk ishte lënduar. Ndërsa më 27 dhjetor të po të njëjtit vit u kry atentati i dytë, në tubimin në Ravalpindi ku kësaj here atentatori arriti ta qëllojë për vdekje. Vdiq të njëjtën ditë në spital, në Ravalpindi."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%83%E3%83%AA%E3%83%BB%E3%83%A0%E3%82%AA%E3%83%88%E3%82%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Muotka_Olli.jpg","page_title":"オッリ・ムオトカ","context_page_description":"オッリ・ムオトカはフィンランド、ラッピ州ロバニエミ出身のスキージャンプ選手、ノルディック複合選手。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B3%DB%8C%D9%86%D8%AA%D9%88%D8%A8%D8%A7%DA%A9%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Acinetobacter_baumannii.JPG","page_title":"آسینتوباکتر","context_page_description":"آسینتوباکتر جنسی از باکتریهای گرم منفی است که به شکل باسیل یا کوکوباسیل دیده می‌شود. این باکتری‌ها اکسیداز منفی و غیرمتحرک هستند و قندها را تخمیر نمی‌کنند. این باکتری‌ها در برابر اغلب آنتی‌بیوتیکها مانند پنی‌سلین مقاوم هستند ولی به کینولونها اغلب حساسند."},{"page_url":"https://sk.wikipedia.org/wiki/Senec","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Senec_-_First_Military_Survey_%281763-1787%29.png","page_title":"Senec","context_page_description":"Senec je okresné mesto na Slovensku ležiace v Bratislavskom kraji. Je to štvrté najviac turisticky navštevované miesto na Slovensku. Pre svoju polohu a bohaté kultúrno-spoločenské vyžitie je veľmi častou voľbou pre bývanie či dovolenkovú rekreáciu nielen u Slovákov. Senec patrí medzi vinárske mestá Malokarpatského regiónu."},{"page_url":"https://nn.wikipedia.org/wiki/Hamleband","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Vidjehamleband.jpg","page_title":"Hamleband","context_page_description":"Eit hamleband eller hammel-band ligg rundt åra i keipen for å halde ho på plass og å lette roinga.\\nHamlebandet går oftast gjennom eit hol som er bora inn og ned gjennom keipen i framkant av keipsnevet. Då vert det liggande på innsida av keipen.\\nDet vert kalla hamleband fordi åra vert pressa mot det når ein hamlar. Ved roing er det viktig at hamlebandet er passe langt. Det skal vere akkurat nok plass til å gjere ferdig åretaket.\\nHamleband har tradisjonelt oftast vorte laga av vidje eller skinn. Sidan ei vidje er elastisk, kan ho gjere roren lettare og jamnare. I dag vert det oftas brukt tog til hamleband.\\nVert hamleband brukt til ein tollepinne kan det gå gjennom ripa, eller gjennom eit auge på innsida av ripbordet. Knuten på hamlebandet bør vere på innsida av keipen."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%B0%E0%B8%9E%E0%B8%B2%E0%B8%99%E0%B8%8B%E0%B8%B4%E0%B8%94%E0%B8%99%E0%B8%B5%E0%B8%A2%E0%B9%8C%E0%B8%AE%E0%B8%B2%E0%B8%A3%E0%B9%8C%E0%B9%80%E0%B8%9A%E0%B8%AD%E0%B8%A3%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/SydneyHarbourBridge1_gobeirne.jpg","page_title":"สะพานซิดนีย์ฮาร์เบอร์","context_page_description":"สะพานฮาร์เบอร์ มีโครงสร้างผิวจราจรพาดผ่านโครงเหล็กถักรูปโค้ง ตั้งอยู่บนอ่าวซิดนีย์ กลางเมืองซิดนีย์ ประเทศออสเตรเลีย เป็นสะพานระนาบเดี่ยว ที่ใหญ่ที่สุดในโลก สร้างขึ้นในช่วงเศรษฐกิจตกต่ำในทศวรรษ 1930 เพื่อเป็นสัญลักษณ์แห่งความหวัง เปิดใช้ในปีค.ศ. 1932"},{"page_url":"https://cs.wikipedia.org/wiki/Lis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Power_press_animation.gif","page_title":"Lis","context_page_description":"Lis je mechanický tvářecí stroj, který slouží k mechanickému zpracování různých produktů tlakem nebo tlakovým rázem, tento výrobní či pracovní postup se nazývá lisování."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1880","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Lady_hazel_lavery01.jpg","page_title":"Lijst van personen geboren in 1880","context_page_description":"Dit is een lijst van personen die geboren zijn in 1880.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://bs.wikipedia.org/wiki/Stiks","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Dor%C3%A9_-_Styx.jpg","page_title":"Stiks","context_page_description":"Stiks ili Stig ime je rijeke koja tvori granicu između zemlje i podzemnog svijeta - Hada. Okružuje Had, u zavisnosti od izvora, devet ili dvadeset puta. Zajedno s Flegetonom, Aherontom i Kokitusom, sreće se u središtu Hada na velikoj močvari."},{"page_url":"https://en.wikipedia.org/wiki/Ceres_(dwarf_planet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/PIA19559-Ceres-DwarfPlanet-Dawn-OpNav8-image1-20150516.jpg","page_title":"Ceres (dwarf planet)","context_page_description":"Ceres is the largest object in the main asteroid belt that lies between the orbits of Mars and Jupiter. With a diameter of 940 km, Ceres is both the largest of the asteroids and the only dwarf planet inside Neptune's orbit. It is the 25th-largest body in the Solar System within the orbit of Neptune.\\nCeres was the first asteroid to be discovered. It was originally considered a planet, but was reclassified as an asteroid in the 1850s after many other objects in similar orbits were discovered.\\nCeres is the only object in the asteroid belt rounded by its own gravity, although Vesta and perhaps other asteroids were so in the past. From Earth, the apparent magnitude of Ceres ranges from 6.7 to 9.3, peaking once at opposition every 15 to 16 months, which is its synodic period. Thus even at its brightest, it is too dim to be seen by the naked eye, except under extremely dark skies. Ceres has been classified as a C-type asteroid and, due to the presence of clay minerals, as a G-type asteroid.\\nCeres appears to be partially differentiated into a muddy mantle/core and a less-dense but stronger crust that is at most 30 percent ice."},{"page_url":"https://es.wikipedia.org/wiki/Voirons","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Geneve.JPG","page_title":"Voirons","context_page_description":"Los Voirons son una montaña situada en el macizo de Chablais, en los Prealpes franceses, en el departamento de Alta Saboya, muy próxima a la frontera con Suiza y a pocos kilómetros de la ciudad de Ginebra.\\nDa nombre a la división territorial de Francia Communauté de communes des Voirons y constituye la prolongación natural de la montaña también alpina del Salève, de la cual se encuentra separada por el valle del río Arve."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%97%AA%E8%B2%93","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Serval.jpg","page_title":"藪貓","context_page_description":"薮猫是产于非洲的中型猫科动物，为薮猫属的唯一成员。薮猫体长85厘米，尾长40厘米。平均寿命在12-20年。与其他猫科动物相比，它体型修长，腿长而尾短，耳朵又高又圆，距离很近。斑点有许多变种。\\n薮猫的主要栖息地是非洲大草原，有时也出现在山地。它们会爬树和游泳，但很少这么做。一般以群体为单位聚居，数量由于栖息地的破坏和偷猎而减少。\\n薮猫被列入《濒临绝种野生动植物国际贸易公约》。"},{"page_url":"https://en.wikipedia.org/wiki/Solamalay_Namasivayam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Solamalay_Namasivayam.png","page_title":"Solamalay Namasivayam","context_page_description":"S.Namasivayam was a prominent Singaporean artist, lecturer and educator who worked primarily in life drawing and figure study. He was also a founding member of the elite Singaporean Art Group, Group 90, and a leading proponent to the development of figurative art in Singapore."},{"page_url":"https://hsb.wikipedia.org/wiki/Lis%C4%87ina_kulturnych_pomnikow_w_Hamorje","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Boxberg%2C_OT_Tauer_F%C3%B6rstgener_Str._9%2C_Hofansicht.JPG","page_title":"Lisćina kulturnych pomnikow w Hamorje","context_page_description":"Lisćina kulturnych pomnikow w Hamorje wobsahuje 120 připóznatych pomnikow gmejny Hamor w Zhorjelskim wokrjesu, kotrež su w pomnikowej lisćinje Sakskeho krajneho zarjada za pomnikoškit zapisane."},{"page_url":"https://en.wikipedia.org/wiki/Sigrid_Arnoldson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Sigrid_Arnoldson.jpg","page_title":"Sigrid Arnoldson","context_page_description":"Sigrid Arnoldson was a Swedish opera singer with an active international career at the end of the 19th century and into the 20th. Possessing a fine coloratura soprano voice with a range of three octaves, music critics believed she was Jenny Lind's successor and dubbed her \\"the new Swedish Nightingale\\". Her voice is preserved on several recordings made in Berlin for the Gramophone Company between 1906 and 1910."},{"page_url":"https://en.wikipedia.org/wiki/Ronnie_Kasrils","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Ronnie_Kasrils_-_Russell_Tribunal.jpg","page_title":"Ronnie Kasrils","context_page_description":"Ronald \\"Ronnie\\" Kasrils is a South African politician. He was Minister for Intelligence Services from 27 April 2004 to 25 September 2008. He was a member of the National Executive Committee of the African National Congress from 1987 to 2007 as well as a member of the Central Committee of the South African Communist Party from December 1986 to 2007."},{"page_url":"https://id.wikipedia.org/wiki/Tzitzit","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Tzitzith.jpg","page_title":"Tzitzit","context_page_description":"Tzitzit [tsitsit] atau tzitziyot adalah jumbai khusus yang digunakan dalam ritual keagamaan Yahudi. Tzitzit melekat pada empat penjuru kain atau pakaian ibadah yang disebut tallit atau tallit katan."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D9%8A_%D8%AA%D8%A7%D9%8A%D9%84%D8%B1_%D8%A8%D9%8A%D8%A8%D9%88%D8%AF%D9%8A_%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Mary_Peabody_Mann.png","page_title":"ماري تايلر بيبودي مان","context_page_description":"ماري تايلر بيبودي مان ‏ هي كاتِبة أمريكية، ولدت في 16 نوفمبر 1806 في كامبريدج في الولايات المتحدة، وتوفيت في 11 فبراير 1887 في Jamaica Plain في الولايات المتحدة."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%95%D7%A8%D7%90_%D7%9E%D7%93%D7%91%D7%A8%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Ammoperdix_heyi%2C_Israel.jpg","page_title":"קורא מדברי","context_page_description":"קורא מדברי הוא עוף קרקע מדברי. זכה לשמו משום שהוא מרבה לקרוא בקולו, החוזר ונשנה פעמים רבות, אשר נשמע לרוב עוד בטרם ייראה בעצמו."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_l%27Angleterre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Statue_d%27Alfred_le_Grand_%C3%A0_Winchester.jpg","page_title":"Histoire de l'Angleterre","context_page_description":"L’Angleterre est la plus étendue et la plus peuplée des quatre nations qui composent le Royaume-Uni. L'Angleterre correspond approximativement au territoire conquis par les Anglo-Saxons au Vᵉ siècle, avant d'être unifié au Xᵉ siècle et de former le royaume d'Angleterre, qui devient la Grande-Bretagne par les Actes d'Union de 1707 avec le royaume d'Écosse, puis le Royaume-Uni par l'Acte d'Union de 1800 avec le royaume d'Irlande."},{"page_url":"https://eu.wikipedia.org/wiki/Yakitori","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Cooking_yakitori.jpg","page_title":"Yakitori","context_page_description":"Yakitori\\njaponiar oilasko broxeta mota bat da, Kushiyaki\\nbezala ere ezaguna.\\nYakitori tradizionala oilasko eta barazki piezez baino ez datza, baina erabilera modernoan behiki, txerriki, arrain, itsaski edo kebab begetalaren edozein haragi motari egiten dio erreferentzia, kushi\\nizeneko pintxoetan josiak direnak. Yakitori, ohi, gatz edo teriyaki saltsarekin zerbitzatzen dute. Saltsa haragi sastatuaren gainean aplikatzen dute, eta gero broxeta parrilan erretzen dute."},{"page_url":"https://ast.wikipedia.org/wiki/Historia_de_Xap%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/First_Japanese_treatise_on_Western_anatomy.jpg","page_title":"Historia de Xapón","context_page_description":"La hestoria de Xapón ye la socesión de fechos socedíos dientro del archipiélagu xaponés. Dalgunos d'estos fechos apaecen aisllaos ya influyíos pola naturaleza xeográfica de Xapón como nación insular, en cuantes qu'otra serie de fechos, obedez a influencies foranes como nel casu del Imperiu chinu, que definió'l so llinguaxe, el so escritura y, tamién, la so cultura política. Coles mesmes, otra de les influencies foranes foi la d'orixe occidental, lo que convirtió al país nuna nación industrial, exerciendo con ello una esfera d'influencia y una espansión territorial sobre'l área del Pacíficu. Sicasí, dichu expansionismo detener tres la Segunda Guerra Mundial y el país asitiar nun esquema de nación industrial con venceyos a la so tradición cultural.\\nL'apaición de los primeres habitantes humanos nel archipiélagu xaponés data del Paleolíticu aprosimao 35 000 años tras. Ente los años 11 000 y 500 e.C. dichos habitantes desenvolvieron un tipu d'alfarería, llamáu «Jōmon», considerada la más antigua del mundu. Darréu apaeció una cultura conocida como «Yayoi», qu'utilizaba ferramientes de metal y cultivaba arroz. Nella esistíen dellos cacicazgos, anque sobresaldría'l de Yamato."},{"page_url":"https://la.wikipedia.org/wiki/Museum_assecurationum_Germanicum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Versicherungsmuseum_Gotha.JPG","page_title":"Museum assecurationum Germanicum","context_page_description":"Museum assecurationum Germanicum invenitur Gotae, in via Bahnhofstraße 3a, haud procul a statione ferriviaria principali situm."},{"page_url":"https://fr.wikipedia.org/wiki/Ga%C3%AFta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Cimpoierul-Ioana0lte%C8%99.jpg","page_title":"Gaïta","context_page_description":"La gaïta ou gaida est un instrument de musique à vent, plus précisément une cornemuse ayant généralement un seul bourdon dont il existe plusieurs variantes en Europe, et en Amérique latine.\\nLe terme gaita peut s'appliquer à d'autres instruments à vent mais dans la plupart des langues de la péninsule Ibérique le mot gaita signifie de façon générique cornemuse et s'applique à tout type de cornemuse, si bien qu'on emploie les termes spécifiques de : gaita-de-foles pour la principale cornemuse du Portugal ; gaita galega pour la cornemuse traditionnelle de Galice, toutefois gaita galega est une appellation normée de la langue galicienne, certains musiciens et associations utilisent le terme gaita do fol ; gaita asturiana pour la cornemuse traditionnelle des Asturies, etc. Certaines cornemuses traditionnelles de la péninsule ibérique portent des appellations ou le mot gaita n'intervient pas, il en va ainsi de la cornemuse de Catalogne, le sac de gemecs.\\nLa gaïda est une cornemuse similaire de Grèce, des Balkans, de Slovaquie, Moldavie et Roumanie où elle est aussi connue sous les noms de gazia, gaidha', gajdy, gajda, gajde, kaida et cimpoï."},{"page_url":"https://pt.wikipedia.org/wiki/Redemptoris_Mater_(semin%C3%A1rio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Redemptoris_Mater_Seminary.jpg","page_title":"Redemptoris Mater (seminário)","context_page_description":"Redemptoris Mater é o nome dado aos seminários católicos apostólicos romanos que são deixados aos cuidados do Caminho Neocatecumenal e têm como missão a formação de sacerdotes para a \\"Nova Evangelização\\". Estes seminários são distribuídos em vários países, com cerca de 1.500 seminaristas atualmente em formação. Mais de 1.200 alunos dos seminários Redemptoris Mater foram ordenados para o sacerdócio para as suas respectivas dioceses de incardinação."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%8E%AB%E7%B4%8D%E6%A0%B9%E8%99%9F%E9%A9%85%E9%80%90%E8%89%A6_(DD-32)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/USS_Monaghan_%28DD-32%29.JPG","page_title":"莫納根號驅逐艦 (DD-32)","context_page_description":"莫纳根号驱逐舰是一艘隶属于美国海军的驱逐舰，为保尔丁级驱逐舰的11号舰。她是美军第一艘以莫纳根为名的军舰，以纪念第二次萨摩亚内战中与重伤同僚菲腊·兰斯代尔同死的少尉约翰·莫纳根。\\n莫纳根号在1910年于纽波特纽斯造船厂开始建造，在1911年下水服役。接着莫纳根号留在大西洋执勤。美国参与第一次世界大战后，莫纳根号被派往欧洲海域，掩护协约国商船。战后莫纳根号在1919年退役，并在1924年移交美国海岸警卫队。1931年莫纳根号返回海军，在1933年除籍，最后于1934年出售拆解。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Landkreis_Gotha","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Wappen_Petriroda.png","page_title":"Liste der Wappen im Landkreis Gotha","context_page_description":"Diese Liste erfasst die Wappen der Städte und Gemeinden des Landkreises Gotha in Thüringen sowie Wappen von heutigen Ortsteilen.\\nDie Orte sind alphabetisch geordnet."},{"page_url":"https://it.wikipedia.org/wiki/Birmingham_Triennial_Musical_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Birmingham_Town_Hall_from_Chamberlain_Square.jpg","page_title":"Birmingham Triennial Musical Festival","context_page_description":"Il Birmingham Triennial Musical Festival, a Birmingham, Inghilterra, fondato nel 1784, è stato il festival di musica classica più longevo nel suo genere. L'ultima volta ebbe luogo nel 1912."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Williamsburg_(Pennsylvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Williamsburg%2C_Pennsylvania.jpg","page_title":"Williamsburg (Pennsylvania)","context_page_description":"Williamsburg sī Bí-kok Pennsylvania chiu Blair kūn ê chi̍t ê chng-thâu.\\nChe sī chi̍t phiⁿ koan-î Bí-kok Pennsylvania Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BC%D1%96%D1%81%D0%BB%D0%B0%D0%B2_%D0%9A%D0%B0%D1%80%D0%B0%D0%B3%D0%B5%D0%BE%D1%80%D0%B3%D1%96%D1%94%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Georgian_Nobility_-_Natalie_of_Bagration_Mukhrani._%28Natasha%2C_Lady_Johnston%29.jpg","page_title":"Томіслав Карагеоргієвич","context_page_description":"Принц Томіслав Карагеоргієвич або Томіслав Югославський, — югославський принц з династії Карагеоргієвичів, син короля Югославії Александра I та румунської принцеси Марії.\\nВід 1950 року жив у Західному Сассексі, вирощуючи яблука на своїй фермі. У 1992 році першим із югославської королівської родини повернувся на постійне місце проживання на батьківщину.\\nУ роки вигнання брав активну участь у житті сербської еміграції та численних благодійних ініціативах."},{"page_url":"https://pt.wikipedia.org/wiki/Noise","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Sonic_Youth_live_20050707.jpg","page_title":"Noise","context_page_description":"Noise é o nome dado a um estilo musical que utiliza majoritariamente sons considerados, em circunstâncias comuns, desconfortáveis ou irritantes. Algumas pessoas acham que é contraditório considerar o estilo como música, já que barulho é geralmente definido como som que não é agradável, estruturado, nem proposital, que é o contrário de música. Por outro lado, barulho pode se referir a qualquer som extremamente alto ou discordante, que freqüentemente é a base do estilo. Masami Akita do Merzbow disse, \\"Se com noise você quer dizer som desconfortável, então música pop é noise para mim.\\". A música noise não é barulho para seus ouvintes, mas certamente é \\"barulhenta\\", num sentido mais geral do termo."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Hoorn_(plaats)/Grote_Oost","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Hoorn%2C_Grote_Oost_16.jpg","page_title":"Lijst van rijksmonumenten in Hoorn (plaats)/Grote Oost","context_page_description":"De stad Hoorn telt meer dan 300 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht van de 65 monumenten aan of bij de Grote Oost."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%8B%E0%AE%9F%E0%AE%BF%E0%AE%AF%E0%AE%AE%E0%AF%8D_%E0%AE%95%E0%AF%8B%E0%AE%AA%E0%AE%BE%E0%AE%B2%E0%AF%8D%E0%AE%9F%E0%AF%8D%E0%AE%A8%E0%AF%88%E0%AE%9F%E0%AF%8D%E0%AE%B0%E0%AF%88%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Sodium_cobaltinitrite_solution.jpg","page_title":"சோடியம் கோபால்ட்நைட்ரைட்டு","context_page_description":"சோடியம் கோபால்ட்நைட்ரைட்டு Na₃Co(NO₂)₆ என்ற மூலக்கூறு வாய்ப்பாட்டை உடைய ஒரு அணைவுச் சேர்மம் ஆகும். இந்த மஞ்சள் நிற உப்பின் எதிர்மின்னயனியானது கோபால்ட் (III) அயனியை மையத்திலும் N-உடன் பிணைக்கப்பட்ட நைட்ரிடோ ஈனிகளையும் கொண்டுள்ளது. இது பொட்டாசியம் மற்றும் அம்மோனியம் அயனிகளைக் கண்டறியப் பயன்படும் பண்பறிப் பகுப்பாய்வுக் காரணியாக உள்ளது."},{"page_url":"https://ca.wikipedia.org/wiki/Francma%C3%A7oneria_a_Espanya","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Portada_Tartessos.jpg","page_title":"Francmaçoneria a Espanya","context_page_description":"Els orígens de la francmaçoneria a Espanya es remunten al segle XVIII. Des de llavors han existit a Espanya obediències maçòniques importants, com el Gran Orient d'Espanya, el Gran Orient Nacional d'Espanya o el Gran Orient Espanyol, entre altres de les quals cal destacar El Derecho Humano per ser la primera obediència mixta que, ja en els anys 1920, s'instal·la a Espanya."},{"page_url":"https://en.wikipedia.org/wiki/Culshaw_and_Sumners","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Building_on_the_corner_of_Nelson_Street_and_Duke_Street%2C_Liverpool.JPG","page_title":"Culshaw and Sumners","context_page_description":"Culshaw and Sumners was a firm of English architects and surveyors who practised in Liverpool in the 19th and early 20th centuries. The work of the practice reflected the growing economic prosperity of the city during this period. Much of its work was routine and mundane, but it did produce some notable buildings, including office blocks, warehouses, domestic properties, workhouses, churches, and a hospital. The firm was established by 1839 by William Culshaw, who was joined by Henry Sumners in 1861. Following Culshaw's death in 1874, the practice was continued until 1916 by his son, Alfred."},{"page_url":"https://zh.wikipedia.org/zh-tw/Kindle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Webysther_20170725034326_-_Kindle_Paperwhite_2%C2%B0_gera%C3%A7%C3%A3o_com_4GB.png","page_title":"Kindle","context_page_description":"Amazon Kindle是亞馬遜公司設計的一系列電子書閱讀器。用戶可以通過無線網路使用Kindle購買、下載和閱讀電子書、報紙、雜誌、部落格及其他電子媒體。亞馬遜公司旗下Lab126開發的Kindle硬體平台，最早只有一種設備，現在已經發展為一個系列，大部分使用E Ink十六級灰度電子紙顯示技術，能在最小化電源消耗的情況下提供類似紙張的閱讀體驗。爲了保障版權權益，Kindle內置了數碼權利管理技術。Kindle在市場上獲得較大成功，也大力拉動了電子閲讀器產品，目前已經有包括索尼、Kobo、BOOX、reMarkable等多家生產電子閲讀器的品牌商在市場上互相競爭"},{"page_url":"https://cs.wikipedia.org/wiki/T%C5%99%C3%ADda_Frankenthal_(typ_332)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Minenjagddrohne_Pinguin.jpg","page_title":"Třída Frankenthal (typ 332)","context_page_description":"Třída Frankenthal (typ 332) je třída pobřežních minolovek německého námořnictva. Celkem bylo postaveno 12 jednotek této třídy. Dalších šest jednotek, vycházejících z třídy Frankenthal, bylo postaveno pro turecké námořnictvo jako třída A. Minolovky Frankenthal a Weiden byly roku 2006 prodány námořnictvu Spojených arabských emirátů. Ostatních osm je provozováno německým námořnictvem."},{"page_url":"https://pl.wikipedia.org/wiki/Geovany_Soto","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Geovany_Soto_2010.jpg","page_title":"Geovany Soto","context_page_description":"Geovany Soto – portorykański baseballista występujący na pozycji łapacza."},{"page_url":"https://fr.wikipedia.org/wiki/Compton_(Californie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Missing_flag.png","page_title":"Compton (Californie)","context_page_description":"Compton est une ville du comté de Los Angeles, en Californie, aux États-Unis. Elle est située au sud de Willowbrook, entre West Compton et East Rancho Dominguez.\\nLa ville comptait 94 425 habitants au recensement de 2007. Géographiquement elle est divisée en deux par un gigantesque « channel ». Elle est principalement connue à cause de la violence des gangs. Cette réputation de ville dangereuse a été illustrée par différents groupes de gangsta rap."},{"page_url":"https://es.wikipedia.org/wiki/Parque_nacional_Sirmilik","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Kittiwake_Cape_Graham_Moore_6_1995-06-10.jpg","page_title":"Parque nacional Sirmilik","context_page_description":"El Parque nacional Sirmilik es un parque nacional situado en la Región Qikiqtaaluk, Nunavut, Canadá. Significa «el lugar de los glaciares» en idioma inuktitut. Sirmilik fue creado en el año 2001 y se encuentra dentro de la cordillera Ártica.\\nEl parque se divide en tres zonas: la isla Bylot, Oliver Sound y la península Borden. Sus límites, en su mayoría agua, son los siguientes:\\nal norte, el estrecho del Lancaster Sound y la bahía de Baffin;\\nal este, la bahía de Baffin;\\nal oeste, el estrecho Admiralty y el estrecho Elwin;\\nal sur, el Pond Inlet y el Eclipse Sound."},{"page_url":"https://pt.wikipedia.org/wiki/Robert_Langer","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Robert_Langer.jpg","page_title":"Robert Langer","context_page_description":"Robert Samuel Langer, Jr. FREng é um engenheiro estadunidense. É professor do Instituto de Tecnologia de Massachusetts.\\nFoi laureado com a Medalha Priestley de 2012."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AD%D8%B1%D9%85%E2%80%8C%D8%B3%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Manuscript_of_the_Zanan-nameh_by_Fazil-Yildiz_in_the_University_of_Istanbul.jpg","page_title":"حرم‌سرا","context_page_description":"حَرَم‌سَرا، شبستان یا حرم مکانی در قصر بود که زنان و کنیزهای شاه، سلطان یا خلیفه در آن زندگی می‌کردند."},{"page_url":"https://pt.wikipedia.org/wiki/Cherte_de_Rhynie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Rhynie_chert.jpg","page_title":"Cherte de Rhynie","context_page_description":"Cherte de Rhynie é uma formação geológica e importante jazida paleontológica datada do princípio do período Devónico, com aproximadamente 410 milhões de anos, localizada nos arredores da cidade escocesa de Rhynie."},{"page_url":"https://fr.wikipedia.org/wiki/Tijana_Kriva%C4%8Devi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Tijana_Krivacevic.jpg","page_title":"Tijana Krivačević","context_page_description":"Tijana Krivačević le 8 avril 1990 à Novi Sad, est une joueuse hongroise de basket-ball."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CE%BF%CF%85%CF%84%CE%B6%CE%AD%CE%B9%CF%81%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Al_Bidya-mosque.jpg","page_title":"Φουτζέιρα","context_page_description":"Η Φουτζέιρα είναι παραλιακή πόλη και ένα από τα επτά εμιράτα που συνιστούν τα Ηνωμένα Αραβικά Εμιράτα. Πρόκειται για το μοναδικό εμιράτο που βρέχεται από τον Κόλπο του Ομάν και δεν έχει πρόσβαση στον Περσικό Κόλπο."},{"page_url":"https://ru.wikipedia.org/wiki/Tinkoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Harelbeke_-_E3_Harelbeke%2C_27_maart_2015_%28B065%29.JPG","page_title":"Tinkoff","context_page_description":"«Тинькофф» — профессиональная российская велокоманда, выступающая в Мировом Туре UCI. Титульный спонсор команды — российский «Тинькофф Банк».\\nУ «Тинькофф» самая богатая история участия в Tour de France среди существующих команд. С 2005 по 2007 год команда лидировала в командном зачёте UCI ProTour, а в 2010 заняла первое место в UCI World Ranking. На счету команды 13 побед в классических велогонках, 13 побед на шоссейных веломногодневках и 6 побед на Гранд Турах: Альберто Контадор выигрывал Вуэльту Испании в сезонах 2012 и 2014 и Джиро д’Италия 2015, Иван Бассо побеждал на Джиро в 2006, ещё две победы принесли Карлос Састре на Тур де Франс 2008 и Энди Шлек на Тур де Франс 2010.\\nСозданная в 1998 году под именем Home-Jack&Jones, она стала первой профессиональной датской велокомандой. Вместе со сменой спонсоров команда меняла названия: Memory Card-Jack & Jones, затем CSC-World Online, CSC-Tiscali, CSC, CSC Saxo Bank, Saxo Bank, Saxo Bank-Sungard. Только в сезоне 2012 команда дважды меняла имя, побывав Saxo Bank и Saxo Bank-Tinkoff Bank. В 2013 выступала как Saxo-Tinkoff, в сезонах 2014 и 2015 как Tinkoff-Saxo. С сезона 2016 года команда выступает как Tinkoff."},{"page_url":"https://en.wikipedia.org/wiki/Savoy_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Schloss_Rackeve.jpg","page_title":"Savoy Castle","context_page_description":"Savoy Castle, also known as Savoy Mansion, is an 18th-century Baroque style château located in Ráckeve, Hungary. This property is currently being used as a hotel and restaurant, and its reception halls can also be rented for special events."},{"page_url":"https://en.wikipedia.org/wiki/Cheerleading","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/03272012Borreguitas_conadeip15.JPG","page_title":"Cheerleading","context_page_description":"Cheerleading is an activity in which the participants cheer for their team as a form of encouragement. It can range from chanting slogans to intense physical activity. It can be performed to motivate sports teams, to entertain the audience, or for competition. Competitive routines typically range anywhere from one to three minutes, and contain components of tumbling, dance, jumps, cheers, and stunting.\\nCheerleading originated in the United States, and remains predominantly in America, with an estimated 1.5 million participants in all-star cheerleading. The global presentation of cheerleading was led by the 1997 broadcast of ESPN's International cheerleading competition, and the worldwide release of the 2000 film Bring It On. Due in part to this recent exposure, there are now an estimated 100,000 participants scattered around the globe in Australia, Canada, China, Colombia, Finland, France, Germany, Japan, the Netherlands, New Zealand, and the United Kingdom."},{"page_url":"https://lv.wikipedia.org/wiki/Valsts_aizsarg%C4%81jamie_kult%C5%ABras_pieminek%C4%BCi_Saldus_novad%C4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Priedulas_luter%C4%81%C5%86u_bazn%C4%ABca_8.jpg","page_title":"Valsts aizsargājamie kultūras pieminekļi Saldus novadā","context_page_description":"Šajā lapā apkopoti valsts aizsargājamie kultūras pieminekļi Saldus novadā.\\nKultūras pieminekļu karte\\nŠis saraksts tiek veidots no Vikidatiem, to periodiski atjaunina bots."},{"page_url":"https://it.wikipedia.org/wiki/%C5%BDihle","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Zihle_1.jpg","page_title":"Žihle","context_page_description":"Žihle è un comune della Repubblica Ceca facente parte del distretto di Plzeň-sever, nella regione di Plzeň."},{"page_url":"https://hu.wikipedia.org/wiki/Ganz_UV","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Margit_k%C3%B6r%C3%BAt_%28M%C3%A1rt%C3%ADrok_%C3%BAtja%29%2C_Keleti_K%C3%A1roly_utcai_villamosmeg%C3%A1ll%C3%B3._Fortepan_50380.jpg","page_title":"Ganz UV","context_page_description":"A Ganz UV egy a Ganz által gyártott villamostípus, ami a budapesti villamosközlekedés második világháború utáni korszakának legmeghatározóbb szereplője volt. Ez volt a legnagyobb darabszámban gyártott magyar villamostípus."},{"page_url":"https://en.wikipedia.org/wiki/Swimming_pool","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/2013-01-15_Sangri-La_Cebu_Infinity_pool_pano.jpeg","page_title":"Swimming pool","context_page_description":"A swimming pool, swimming bath, wading pool, paddling pool, or simply pool is a structure designed to hold water to enable swimming or other leisure activities. Pools can be built into the ground or built above ground, and are also a common feature aboard ocean-liners and cruise ships. In-ground pools are most commonly constructed from materials such as concrete, natural stone, metal, plastic, or fiberglass, and can be of a custom size and shape or built to a standardized size, the largest of which is the Olympic-size swimming pool.\\nMany health clubs, fitness centers, and private clubs have pools used mostly for exercise or recreation. Many towns and cities provide public pools. Many hotels have pools available for their guests to use at their own leisure. Educational facilities such as high schools and universities sometimes have pools for physical education classes, recreational activities, leisure, and competitive athletics such as swimming teams. Hot tubs and spas are pools filled with hot water, used for relaxation or hydrotherapy. They are common in hotels and health clubs, and can also be found in many private homes."},{"page_url":"https://es.wikipedia.org/wiki/Rinaldo_Fidel_Br%C3%A9dice","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/PrimateNonCardinal_PioM.svg","page_title":"Rinaldo Fidel Brédice","context_page_description":"Rinaldo Fidel Brédice ​ fue un sacerdote católico argentino, que ejerció como obispo de la localidad argentina de Santa Rosa desde 1992 hasta su renuncia, por motivos de salud, en 2008."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB-%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B0%D1%82%D0%BE%D1%80%D0%BE%D0%B2_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Cartephilippines1764.jpg","page_title":"Список генерал-губернаторов Филиппин","context_page_description":"Генерал-губернатор Филиппин название главы Филиппин в колониальный период. Название применяли следующие страны: Испания, США, Великобритания и Япония. Генерал-губернатор также был представителем исполнительной власти правящей партии."},{"page_url":"https://lv.wikipedia.org/wiki/Melnais_lori","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Black_Lori%2C_Prague_zoo.jpg","page_title":"Melnais lori","context_page_description":"Melnais lori ir papagaiļveidīgo kārtas suga, kas apdzīvo Doberai pussalu Jaungvinejas rietumos un vairākās tai pieguļošās salās.\\nTas ir viens no pirmajiem zinātniski aprakstītajiem lori. Latīnisko nosaukumu sugai piešķīra dabaspētnieks Džovanni Antonio Skopoli. Viņš pats gan neizpētīja nevienu sugas eksmplāru, bet vadījās no dabaspētnieka un ceļotāja Pjēra Sonnerata 1776. gadā izdotās grāmatas Voyage a la Nouvelle-Guinee. Sugas apraksts ir pietiekami precīzs tās atpazīšanai, un Skopoli ir atzīts par šī taksona autoru."},{"page_url":"https://en.wikipedia.org/wiki/Hangzhou","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/6-5859_at_Guodongyuan_Alley%2C_Jiangcheng_Rd_%2820190807101902%29.jpg","page_title":"Hangzhou","context_page_description":"Hangzhou, also romanized as Hangchow, is the capital and most populous city of Zhejiang, People's Republic of China. It sits at the head of Hangzhou Bay, which separates Shanghai and Ningbo. Hangzhou grew to prominence as the southern terminus of the Grand Canal and has been one of the most renowned and prosperous cities in China for much of the last millennium. The city's West Lake, a UNESCO World Heritage site immediately west of the city, is among its best-known attractions. A study conducted by PwC and China Development Research Foundation saw Hangzhou ranked first among \\"Chinese Cities of Opportunity\\". Hangzhou is also considered a World City with a \\"Beta+\\" classification according to GaWC.\\nHangzhou is classified as a sub-provincial city and forms the core of the Hangzhou metropolitan area, the fourth-largest in China. During the 2010 Chinese census, the metropolitan area held 21.102 million people over an area of 34,585 km². Hangzhou prefecture had a registered population of 10,360,000 in 2019.\\nHangzhou was repeatedly rated as the best commercial city in mainland China by Forbes."},{"page_url":"https://es.wikipedia.org/wiki/Parque_nacional_Doi_Suthep-Pui","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Doisuthepnationalpark0408a.jpg","page_title":"Parque nacional Doi Suthep-Pui","context_page_description":"El parque nacional de Doi Suthep-Pui es un área protegida que se encuentra en la provincia de Chiang Mai, en el norte de Tailandia. Tiene una superficie de 261,06 kilómetros cuadrados y fue creado en 1981, como el 24.º parque del país."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ko%C5%BElany","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Ko%C5%BElany_znak.png","page_title":"Kožlany","context_page_description":"Kožlany sī Czech Plzeň chiu Plzeň-sever koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A8%D7%95%D7%A1%D7%9C%D7%91_%D7%A1%D7%99%D7%A4%D7%A8%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Jaroslav_Seifert_1981_foto_Hana_Hamplov%C3%A1.jpg","page_title":"ירוסלב סיפרט","context_page_description":"ירוסלב סיפרט, משורר וסופר צ'כי. חתן פרס נובל לספרות לשנת 1984."},{"page_url":"https://es.wikipedia.org/wiki/Pandanales","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Croomia_heterosepala_001.jpg","page_title":"Pandanales","context_page_description":"Pandanales es el nombre de un taxón de plantas ubicado en la categoría taxonómica de orden, utilizado en sistemas de clasificación modernos como el sistema de clasificación APG III del 2009​ y el APWeb, ​ y está circunscripto obligadamente por la familia Pandanaceae, entre otras. En el pasado el orden estuvo circunscripto por familias muy distintas en diferentes sistemas de clasificación, pero los análisis moleculares de ADN avalan su circunscripción por las familias que posee actualmente, lo cual resultó de alguna forma inesperado, porque no hay sinapomorfias muy impresionantes fuera de las moleculares que unan entre sí a los integrantes de este clado. Además, muchas de las familias que lo componen se parecen morfológicamente a otros clados. El orden posee una distribución pantropical, y en su hábito incluye palmas, árboles, arbustos, lianas, y hierbas."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%BC%97%E9%9B%B7%E5%BE%B7%E9%87%8C%E5%85%8B%C2%B7%E9%9B%B7%E9%A0%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Leightonhero.jpg","page_title":"弗雷德里克·雷頓","context_page_description":"第一代雷顿男爵弗雷德里克·雷顿，PRA，1878年至1896年称为弗雷德里克·雷顿爵士，英国学院派画家和雕塑家，皇家艺术研究院院长。其作品题材包括了历史、圣经和古典时代的主题。雷顿在去世前一天获得男爵的封号，成为历史上最短命的贵族。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_Belgische_eurocommissarissen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Etienne_Davignon.jpg","page_title":"Lijst van Belgische eurocommissarissen","context_page_description":"Lijst van alle Belgische eurocommissarissen sinds het ontstaan van de Europese Commissie in 1958."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%96%D7%99%D7%A8%D7%95%D7%AA_%D7%90%D7%93%D7%A8%D7%99%D7%90%D7%A0%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Hadrian_sculpture.JPG","page_title":"גזירות אדריאנוס","context_page_description":"גזירות אדריאנוס היו מכלול פעולות העונשין שהטיל הקיסר אדריאנוס על התושבים המורדים בארץ ישראל לאחר דיכוי מרד בר כוכבא, שנקראו במקורות היהודיים \\"גזירות השמד\\". באמצעות גזירות אלו ביקש הקיסר להביא סוף להתנגדות היהודית לשלטונה של רומא. הגזירות כללו שורה של צווים שמטרתם הייתה לעקור את האלמנטים הלאומיים והדתיים מהקהילה היהודית ביהודה, כולל איסורים על המילה, על סמיכת חכמים ועל שמירת השבת, והן בוצעו במלוא חומרתן. העיר האלילית איליה קפיטולינה נבנתה על חורבות ירושלים, על הר הבית הוקם מתחם מקודש לאל יופיטר ובכך הוגשמה התוכנית שגרמה למרד מלכתחילה. החכמים ששמרו על המצוות ולא מילאו אחר הצווים, הוצאו להורג בעינויים, ומתקופה זו מגיע עיקר סיפורם של עשרת הרוגי מלכות."},{"page_url":"https://it.wikipedia.org/wiki/Cultura_di_Vu%C4%8Dedol","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Vucedol_culture_map.png","page_title":"Cultura di Vučedol","context_page_description":"La cultura di Vučedol fu una cultura indoeuropea che fiorì fra il 3000 e il 2200 a.C., principalmente fra la Sirmia e la Slavonia orientale, ma si estese in quasi tutta la parte nord-occidentale della penisola Balcanica."},{"page_url":"https://it.wikipedia.org/wiki/Onex","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/VieilOnex1.jpg","page_title":"Onex","context_page_description":"Onex è un comune svizzero di 18 977 abitanti del Canton Ginevra; ha lo status di città."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%85%E6%B4%A5%E9%87%87%E5%A4%AB%E7%8E%AF%E5%BD%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Mezentsev_sattelite_craters_map.jpg","page_title":"梅津采夫环形山","context_page_description":"梅津采夫环形山是位于月球背面北极区附近的一座古老大撞击坑，约形成于45.5-39.2亿年前的前酒海纪，其名称取前苏联导弹设计师尤里·鲍里索维奇·梅津采夫，1970年被国际天文学联合会正式接受。"},{"page_url":"https://it.wikipedia.org/wiki/Napoleone_III_di_Francia","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Place_de_la_Bastille.jpg","page_title":"Napoleone III di Francia","context_page_description":"Carlo Luigi Napoleone Bonaparte, regnante con il nome di Napoleone III, figlio terzogenito del re d'Olanda Luigi Bonaparte e di Hortense de Beauharnais, fu presidente della Repubblica francese dal 1848 al 1852 e Imperatore dei francesi dal 1852 al 1870.\\nDetto anche Napoleone il piccolo, sposò la contessa di Teba María Eugenia de Guzmán Montijo, una Grande di Spagna, con cui ebbe Napoleone Eugenio Luigi, mentre altri cinque figli furono illegittimi e avuti da donne diverse."},{"page_url":"https://en.wikipedia.org/wiki/Miyagi_University_of_Education","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Miyagi_University_of_Education.JPG","page_title":"Miyagi University of Education","context_page_description":"Miyagi University of Education, or MUE, is a national university at Sendai, Miyagi, Japan. The predecessor of the school was founded in 1873, and it was chartered as a university in 1965. It is accredited by the Japanese Ministry of Education as a public co-educational institute and is ranked in Japan's first tier of leading schools.\\nWith four academic divisions, MUE offers degrees in Education and in the disciplines of Language and Social Science, Science, Math and Life, and Art and Physical Education. Their Development and Education division covers Pre-School, Children and Culture, Pedagogy, and Educational Psychology. There are academic tracks for Elementary, Secondary, and Special Needs Education.\\nMany graduates become principals at schools throughout Japan."},{"page_url":"https://en.wikipedia.org/wiki/Miyagi_University_of_Education","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Miyagi_University_of_Education.JPG","page_title":"Miyagi University of Education","context_page_description":"Miyagi University of Education, or MUE, is a national university at Sendai, Miyagi, Japan. The predecessor of the school was founded in 1873, and it was chartered as a university in 1965. It is accredited by the Japanese Ministry of Education as a public co-educational institute and is ranked in Japan's first tier of leading schools.\\nWith four academic divisions, MUE offers degrees in Education and in the disciplines of Language and Social Science, Science, Math and Life, and Art and Physical Education. Their Development and Education division covers Pre-School, Children and Culture, Pedagogy, and Educational Psychology. There are academic tracks for Elementary, Secondary, and Special Needs Education.\\nMany graduates become principals at schools throughout Japan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BA%D1%83%D1%81%D1%82%D0%B8%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Anechoic_chamber.jpg","page_title":"Акустика","context_page_description":"Аку́стика — наука о звуке, изучающая физическую природу звука и проблемы, связанные с его возникновением, распространением, восприятием и воздействием. Акустика является одним из направлений физики, исследующих упругие колебания и волны от самых низких до высоких частот.\\nАкустика является междисциплинарной наукой, использующей для решения своих проблем широкий круг дисциплин: математику, физику, психологию, архитектуру, электронику, биологию, химию, медицину, гигиену, теорию музыки и другие.\\nТермин «акустика» был введён в 1701 году Ж. Совёром."},{"page_url":"https://es.wikipedia.org/wiki/Cyrtodactylus_gordongekkoi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Cyrtodactylus_gordongekkoi_distribution.png","page_title":"Cyrtodactylus gordongekkoi","context_page_description":"Cyrtodactylus gordongekkoi es una especie de gecos de la familia Gekkonidae.​"},{"page_url":"https://eo.wikipedia.org/wiki/Simbolo_de_Wythoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Uniform_dual_tiling_433-t012.png","page_title":"Simbolo de Wythoff","context_page_description":"En geometrio, simbolo de Wythoff estas mallonga skribmaniero, kreita de matematikisto Willem Abraham Wythoff, por nomado de regula kaj duonregulaj pluredroj uzante konstruon de Wythoff, per prezentado de ili kiel kahelaroj sur la surfaco de sfero, eŭklida ebeno, aŭ hiperbola ebeno.\\nLa simbolo de Wythoff donas 3 nombrojn p q r kaj pozicion de vertikala streko kiu apartigas la nombroj antaŭ kaj post ĝi. Ĉiu nombro prezentas la ordo de speguloj je vertico de la fundamenta triangulo.\\nĈiu simbolo prezentas unu uniforman pluredron aŭ uniforman kahelaron, kvankam la sama kahelaro/pluredro povas havi malsamajn simbolojn de Wythoff de malsamaj generaj simetrioj. Ekzemple, la regula kubo povas esti prezentita per 3 | 4 2 kun Oₕ simetrio, kaj 2 4 | 2 kiel kvadrata prismo kun 2 koloroj kaj D₄ₕ simetrio, kaj ankaŭ 2 2 2 | kun 3 koloroj kaj D₂ₕ simetrio."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Schwabing","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Viktoriastr6_M%C3%BCnchen.jpg","page_title":"Liste der Baudenkmäler in Schwabing","context_page_description":"Auf dieser Seite sind die Baudenkmäler im Münchner Stadtteil Schwabing im Stadtbezirk 12 Schwabing-Freimann aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung und ein Fotoalbum mit ausgewählten Bildern.\\nDiese Liste ist Teil der Liste der Baudenkmäler in München. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://fr.wikipedia.org/wiki/Usines_Fiat_Group_Automobiles_S.p.A.","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Fiat_Mirafiori_001.JPG","page_title":"Usines Fiat Group Automobiles S.p.A.","context_page_description":"Les listes ci-dessous présentent les usines de production et d'assemblage d'automobiles détenues, directement ou indirectement, par le groupe automobile Italien FCA Ityaly"},{"page_url":"https://pl.wikipedia.org/wiki/Hiena_jaskiniowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/British_Pleistocene_Mammalia_%281866%29_Cave_Hyena_Dentition_1.png","page_title":"Hiena jaskiniowa","context_page_description":"Hiena jaskiniowa – podgatunek temporalny krokuty cętkowanej. Występował od Półwyspu Iberyjskiego do wschodniej Syberii. Należy do najlepiej poznanych zwierząt epoki lodowcowej. Jego pozostałości znaleziono w wielu europejskich jaskiniach. Hiena jaskiniowa była wysoce wyspecjalizowana, z cechami progresywnymi i regresywnymi rozwiniętymi bardziej niż jej współczesna afrykańska krewna. Polowała na megafaunę, czego skutkiem jest akumulacja setek kości wielkich ssaków plejstocenu na obszarach takich jak poziome jaskinie, leje krasowe, doły z błotem i bagniste obszary wzdłuż rzek.\\nPrzyczyna wyginięcia hieny jaskiniowej nie została w pełni zrozumiana. Mogła ją spowodować kombinacja czynników, włączając w to zmiany klimatyczne i konkurencję ze strony innych drapieżników."},{"page_url":"https://it.wikipedia.org/wiki/Valutazione_delle_portate_di_piena","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Onda_piena.jpg","page_title":"Valutazione delle portate di piena","context_page_description":"Nell'ingegneria civile idraulica, l'effetto di laminazione delle portate di piena consiste nel progressivo abbassamento del colmo di piena, per un alveo fluviale, man mano che il fenomeno prosegue da monte verso valle. Nel grafico a lato si può notare come all'istante t1 la portata massima del corso d'acqua sia Q1 e nell'istante successivo t2 la portata sia traslata rigidamente riducendosi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B0%D0%BD_(%D0%B1%D0%BB%D1%8E%D0%B4%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Gurudwara_Bangla_Sahib_in_New_Delhi_03-2016_img2.jpg","page_title":"Наан (блюдо)","context_page_description":"Наан — пшеничная лепёшка, блюдо индийской национальной кухни. Кроме того, блюдо имеет широкое распространение в Афганистане, Иране, Непале, Пакистане, Таджикистане, Узбекистане и прилегающих регионах. В тюркских языках хлеб называют нан.\\nОснову лепёшки составляет пресное пшеничное тесто. В качестве начинки могут использоваться различные добавки вроде фарша из баранины, овощей, сыра или картофеля. Из приправ и пряностей используются тмин, чеснок, кевра, изюм.\\nНаан употребляется вместе с супами, чаем или в качестве основного блюда."},{"page_url":"https://no.wikipedia.org/wiki/Gregorio_Mar%C3%ADa_Aguirre_Garcia","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Cardinal_Gregorio_Maria_Aguirre_y_Garcia.jpg","page_title":"Gregorio María Aguirre Garcia","context_page_description":"Gregorio María Aguirre Garcia var en av Den katolske kirkes kardinaler, tidligere erkebiskop av Burgos 1894–1909, tidligere erkebiskop av Toledo 1909–1913, og også senator i Spania 1893–1895 og fra 1902. Han tilhørte Fransiskanerordenen.\\nHan ble kreert til kardinal av pave Pius X i 1907, med San Giovanni a Porta Latina som tittelkirke."},{"page_url":"https://es.wikipedia.org/wiki/Geograf%C3%ADa_de_la_Uni%C3%B3n_Europea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Helgoland_Vogelperspektive_sx.jpg","page_title":"Geografía de la Unión Europea","context_page_description":"La geografía de la Unión Europea toma en cuenta varios factores: en primer lugar la geografía física y su evolución a través de su ampliación, y su geografía humana, es decir, su organización, la riqueza, que, al igual que la geografía física, está sujeta a cambios relacionados con sus ampliaciones. La geografía de la UE también tiene en cuenta las regiones de ultramar de la Unión Europea y, en menor medida, los territorios dependientes de la Unión sin ser parte de ella.\\nLa Unión Europea es una estructura sin precedentes, que evoluciona de acuerdo con las sucesivas ampliaciones. Así, al principio estaba compuesta por solo seis países que limitaban su alcance geográfico. Con 27 miembros, la UE ha crecido y tiene acceso a varios mares y zonas ambientales."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%96_%D7%92%D7%A2%D7%A9%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Brothers_blacksmoker_hires.jpg","page_title":"גז געשי","context_page_description":"גז געשי הוא שם כללי למגוון חומרים גזיים הנפלטים מתוך הרי געש פעילים, ולעיתים גם מהרי געש רדומים. הגזים הגעשיים נלכדים בתוך נקבוביות הסלעים הגעשיים, במאגמה או בלבה.\\nמקורות הגז הגעשי עשויים להיות מרכיבים ראשוניים או ממוחזרים ממעטפת כדור הארץ; מרכיבים שהתערבבו בקרום כדור הארץ; או מי תהום באטמוספירת כדור הארץ. מתוכם, חומרים שעשויים להפוך לגז או לשחרר גזים כשהם מתחממים, נקראים \\"חומרים געשיים נדיפים\\".\\nהגזים הגעשיים משתחררים באופנים שונים ובחלקים שונים של הר הגעש: מלוע הפעיל ועד למורדות המרוחקים שלו."},{"page_url":"https://de.wikipedia.org/wiki/Wilhelm_Gallhof","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Wilhelm_Gallhof_Kohlenschiffe.jpg","page_title":"Wilhelm Gallhof","context_page_description":"Wilhelm Gallhof war ein deutscher Maler und Bildhauer. Er gehörte zu Beginn des 20. Jahrhunderts zu den wichtigsten Malern von Frauenakten im impressionistischen und Jugendstil."},{"page_url":"https://cs.wikipedia.org/wiki/Cvikovsk%C3%A1_Mulda","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Mulde_in_Zwickau_-_big.jpg","page_title":"Cvikovská Mulda","context_page_description":"Cvikovská Mulda je řeka v Německu, protékající na území spolkové země Sasko. Je to jedna ze zdrojnic řeky Muldy. Délka toku je 166,7 km. Plocha povodí měří 2360 km²."},{"page_url":"https://hr.wikipedia.org/wiki/Kelly_Rutherford","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Kelly_Rutherford.jpg","page_title":"Kelly Rutherford","context_page_description":"Kelly Rutherford je američka glumica. Najpoznatija je po ulozi Lily Van der Woodsen u teen seriji Tračerica kao i po ulozi Megan Lewis u \\"Melrose Place\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Sa%C3%B4ne-et-Loire_(M-Z)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Chateau_Montcony_bourgogne_bresse_monument-historique.jpg","page_title":"Liste des monuments historiques de Saône-et-Loire (M-Z)","context_page_description":"Cet article recense une partie des monuments historiques de Saône-et-Loire, en France.\\nPour des raisons de taille, la liste est découpée en deux. Cette partie regroupe les communes débutant de M à Z. Pour les autres, voir la liste des monuments historiques de Saône-et-Loire."},{"page_url":"https://fr.wikipedia.org/wiki/Jeton_d%27authentification","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/OTPC300_OCRA_by_Feitian.jpg","page_title":"Jeton d'authentification","context_page_description":"Un jeton d'authentification, est une solution d'authentification forte."},{"page_url":"https://es.wikipedia.org/wiki/Isla_de_Guana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Guana_Island%2C_BVI.JPG","page_title":"Isla de Guana","context_page_description":"La Isla de Guana​ ​ es una isla de las Islas Vírgenes Británicas un territorio británico de ultramar en el Mar Caribe. Es una de las pocas islas de propiedad privada en esta parte del mundo, y tiene siete playas de arena blanca y 850 acres de bosque tropical, montañas, colinas y valles. La isla es en su mayoría una reserva natural y tiene un pequeño complejo turístico.\\nBeth y Louis Bigelow, de Massachusetts compraron Guana en 1934. Con la ayuda de los hombres de la localidad se construyeron seis cabañas de piedra y se desarrolló una reputación como pioneros creativos. Sus invitados - profesionales, intelectuales y viajeros del mundo - fueron durante meses a la vez, atraídos por la vida sencilla, pero de ricos.\\nHenry y Gloria Jarecki, compraron Guana en 1975 y comenzaron a mejorar los alojamientos y otras instalaciones con el objetivo de mantener el estilo histórico de la isla y su entorno."},{"page_url":"https://ht.wikipedia.org/wiki/Kito","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/%28Iglesia_de_Gu%C3%A1pulo%29_vista_to_gonzalez_suarez_quito.JPG","page_title":"Kito","context_page_description":"Kito se kapital nan peyi Ekwatè."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%88%D9%87%D8%A7%D9%86_%D8%BA%D9%8A%D9%88%D8%B1%D8%BA_%D8%A7%D9%84%D8%AB%D8%A7%D9%86%D9%8A%D8%8C_%D9%86%D8%A7%D8%AE%D8%A8_%D8%B3%D8%A7%D9%83%D8%B3%D9%88%D9%86%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Johan_Georg_II_Johann_Fink%2C_vor_1675.jpg","page_title":"يوهان غيورغ الثاني، ناخب ساكسونيا","context_page_description":"يوهان غيورغ الثاني ؛ كان ناخب ساكسونيا من 1656 حتى وفاته في 1680، ينتمي إلى فرع الألبرتي من بيت فتين.\\nهو الابن الثالث والرابع من حيث الولادة لـ يوهان غيورغ الأول، ناخب ساكسونيا وزوجته الثانية ماغدالين سيبيل من بروسيا ابنة ألبرخت فريدرخ، دوق بروسيا، وفي 1657 قام بـ إعطاء أخوته بعض الأراضي لمنع النزاع، وأيضا دخل في علاقات ودية مع لويس الرابع عشر ملك فرنسا في 1664، وأيضا شهد عهد تطور في إعادة البناء الاقتصادي لـ ساكسونيا من ذلك كان بطيئاً بعد أن كانت ساكسونيا ساحة حرب أثناء حرب الثلاثين عاما، لم تكون المصالح الرئيسية لـ ناخب هي السياسة، بل كان الموسيقى والفن، بحيث أراضيه أصبحت مركزاً هاماً للموسيقى في أوروبا بحيث استقبال العديد من الموسيقيين الأجانب."},{"page_url":"https://de.wikipedia.org/wiki/Zahntroste","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Nsr-slika-243.png","page_title":"Zahntroste","context_page_description":"Die Zahntroste sind eine Pflanzengattung innerhalb der Familie der Sommerwurzgewächse. Alle Zahntroste leben halbparasitisch, indem sie mit Saugorganen in die Wurzeln benachbarter Pflanzenexemplare einwachsen und über diese Verbindung von ihnen Wasser und Nährstoffe erhalten. Das Hauptverbreitungsgebiet der etwa 26 Arten liegt im westlichen Mittelmeerraum, viele Arten kommen als Endemiten in einem sehr begrenzten Gebiet vor, nur drei Arten besiedeln ein größeres Gebiet."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%91%D0%BB%D1%83%D0%B0_(%D0%9B%D0%B0%D0%BA%D1%85%D0%B0_%D0%A1%D0%B0%D0%B2%D0%BE%D0%B9%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Entr%C3%A9e_%C3%A0_Bloye_%2874%29.JPG","page_title":"Блуа (Лакха Савойя)","context_page_description":"Блуа — Францин гӀала-коммуна, лаьтта Овернь — Рона — Альпаш регионехь. Коммунан департамент — Лакха Савойя. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://sw.wikipedia.org/wiki/Lidk%C3%B6ping","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Folkets_Hus%2C_Lidk%C3%B6ping%2C_Sweden.jpg","page_title":"Lidköping","context_page_description":"Lidköping ni mji na manispaa nchini Uswidi. Kuna wakazi 24,941. Mji ulianzishwa 1446."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%B2%D0%B5%D0%BD%D0%B0%D0%B9%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Guewenheim%2C_%C3%89glise_Saint-Maurice_1.jpg","page_title":"Гевенайм","context_page_description":"Гевена́йм — коммуна на северо-востоке Франции в регионе Гранд-Эст, департамент Верхний Рейн, округ Тан — Гебвиллер, кантон Мазво. До марта 2015 года коммуна административно входила в состав упразднённого кантона Тан.\\nПлощадь коммуны — 8,55 км², население — 1205 человек с тенденцией к росту: 1333 человека, плотность населения — 155,9 чел/км²."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%B2%D8%A9_%D8%BA%D8%B1%D8%A7%D8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Anser_albifrons_map.png","page_title":"وزة غراء","context_page_description":"وزة غراء تسمى أيضا إوز أبيض الجبهة ‏ هو طائر ينتمي إلى إوزيات."},{"page_url":"https://de.wikipedia.org/wiki/Fl%C3%A4ming","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Wittenberg-1536.jpg","page_title":"Fläming","context_page_description":"Der Fläming ist ein eiszeitlich gebildeter Höhenzug und gleichzeitig eine historisch gewachsene Kulturlandschaft im südwestlichen Brandenburg und östlichen Sachsen-Anhalt. Er erstreckt sich östlich von Magdeburg über mehr als 100 Kilometer bis zur Dahme. Der Fläming ist als 30 bis 50 Kilometer breiter Höhenrücken Teil des Südlichen Landrückens, der insbesondere in der Saaleeiszeit geformt wurde.\\nDen Namen führt der dünnbesiedelte Landstrich nach den Flamen, die nach der Gründung der Marken im Zuge der anschließenden deutschen Ostsiedlung in hoher Zahl den Höhenzug besiedelten. Jahrhundertelang war der Fläming Grenzgebiet, aufgeteilt zwischen dem Erzbistum Magdeburg, dem Bistum Brandenburg, der Grafschaft Brehna und der Markgrafschaft Meißen, dem späteren Kurfürstentum Sachsen. Die Markgrafschaft Brandenburg hatte bis zur Reformation so gut wie keinen Anteil. Mit der Schlacht bei Hagelberg und der Schlacht bei Dennewitz fanden 1813 wichtige Schlachten im Befreiungskrieg gegen die französische Fremdherrschaft im Fläming statt. Im Jahr 1815 wurde nach der französischen und sächsischen Niederlage der gesamte Fläming dem Königreich Preußen eingegliedert."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Sehensw%C3%BCrdigkeiten_in_Schw%C3%A4bisch_Gm%C3%BCnd","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Maria_K%C3%B6nigin_Rehnenhof_Westansicht.JPG","page_title":"Liste von Sehenswürdigkeiten in Schwäbisch Gmünd","context_page_description":"Schwäbisch Gmünd ist gewachsen aus dem historischen Stadtkern und mehreren früher selbständigen Gemeinden. Diese dezentrale Entwicklungsgeschichte hat zur Folge, dass es im heutigen Schwäbisch Gmünd eine Fülle von Sehenswürdigkeiten gibt – nicht nur im Zentrum der Stadt, sondern auch in den Außenbezirken. Diese reichen von den Spuren der Römerzeit bis zur Architektur der Moderne.\\nBis weit ins 19. Jahrhundert blieben Parzellen innerhalb des Bereiches der Stadtmauer unbebaut, so dass die historischen Stadtgrenzen erst zu Beginn des 20. Jahrhunderts überschritten wurden. Abgesehen vom Abriss der Stadtmauern und der meisten Türme ab 1830 blieb die historische Bausubstanz größtenteils erhalten. Schwäbisch Gmünd gehört zu den wenigen deutschen Städten, die im Zweiten Weltkrieg keine nennenswerten Zerstörungen erfuhr. Erst die Bauwut ab 1945 führte zu Verlusten in der Bausubstanz. Die Liste erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://en.wikipedia.org/wiki/Hylliev%C3%A5ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Hyllie_vattentorn%2C_sommar.jpg","page_title":"Hyllievång","context_page_description":"Hyllievång is a neighbourhood of Malmö in Sweden, situated in Väster, Malmö Municipality."},{"page_url":"https://pl.wikipedia.org/wiki/Karty","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/BA_from_Poland.jpg","page_title":"Karty","context_page_description":"Karty do gry – papierowe lub plastikowe przybory do gier karcianych.\\nPrawdopodobnie były już znane w Chinach przed X wiekiem. Powstały na skutek przeniesienia na papier notacji używanej w czasie gry w kości;\\nniektóre karty wywodzą się także z chińskich papierowych pieniędzy – uważa się, że w najstarszych grach używano prawdziwych banknotów.\\nDo Europy karty trafiły około XIV w. i zostały spopularyzowane po rozpowszechnieniu się druku wynalezionego przez Johannesa Gutenberga. Już w 1329 roku, za papieża Jana XXII, synod w Würzburgu wydał zakaz uprawiania hazardu, w tym gry w karty, w kości, szachy i w kule.\\nWykonuje się je z kilku warstw papieru, od trzydziestu lat powlekanego cienką warstwą plastiku. Wykonuje się także karty o mniejszych wymiarach, wygodne przy stawianiu pasjansów, oraz większe, lepiej widoczne na scenie w czasie pokazów. Dziś standardowe wymiary karty wynoszą 88 × 57 mm."},{"page_url":"https://en.wikipedia.org/wiki/Rilee_Rossouw","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/RILEE_ROSSOUW_%2815706681502%29.jpg","page_title":"Rilee Rossouw","context_page_description":"Rilee Roscoe Rossouw is a former South African cricketer who played internationally for South Africa until 2016. In South Africa he played domestic cricket for the Knights and Free State before signing a deal with Hampshire County Cricket Club in England in January 2017. He is a left-hand batsman and a right arm off-spin bowler."},{"page_url":"https://en.wikipedia.org/wiki/Heckler_%26_Koch_HK417","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/59th_Merdeka_Day%2C_Picture_7.jpg","page_title":"Heckler & Koch HK417","context_page_description":"The Heckler & Koch HK417 is a battle rifle/designated marksman rifle designed and manufactured by Heckler & Koch in Germany. It is the larger caliber version of the HK416, and chambered for the 7.62×51mm NATO rifle cartridge. It is a gas-operated, selective fire rifle with a rotating bolt. The HK417 is intended for use in roles where the penetrative power, stopping power, and range of the 7.62×51mm cartridge are required. It has been adopted for service by a number of armed forces, special forces, and police organizations."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E8%89%AF%E5%B7%9D%E9%B5%9C%E9%A3%BC","image_url":"https://upload.wikimedia.org/wikipedia/ja/3/3e/Ukai_gifu_1.jpg","page_title":"長良川鵜飼","context_page_description":"長良川鵜飼とは、岐阜県岐阜市の長良川で毎年5月11日から10月15日まで行われる鵜飼である。中秋の名月と増水時を除く毎夜行われる。中秋の名月に行われないのは、篝火で驚かせた鮎を捕らえる鵜飼では、「月が明る過ぎると篝火の効果が薄れるため」といわれることもあるが、他の満月の際には催されるので、これは伝統的な公休と言える。\\n正倉院所蔵の大宝年間の戸籍から、1300年以上前、既に鵜飼いを生業とする集団が美濃国に居たと推測されている。起源は漁としての鵜飼だが、現在は古典漁法を今に伝える観光及び文化・宗教的行事としての鵜飼である。そのうち宮内庁の御料場で行われる8回の鵜飼は「御料鵜飼」と呼ばれ、獲れた鮎は皇居へ納められる。\\n長良川における鵜飼は日本で唯一皇室御用の鵜飼であり、長良川の鵜匠は職名を宮内庁式部職鵜匠といい、長良川の鵜飼用具一式122点は国の重要有形民俗文化財、長良川鵜飼漁法は岐阜県指定重要無形民俗文化財である。また、鵜匠家に伝承する鮎鮓製造技術、長良川鵜飼観覧船造船技術、長良川鵜飼観覧船操船技術は岐阜市指定無形民俗文化財となっている。\\nなお、この鵜飼が行われる長良川中流域は1985年「名水百選」に、また岐阜市の長良橋から上流約1kmまでの水浴場が1998年環境省認定「日本の水浴場55選」に、2001年「日本の水浴場88選」に全国で唯一河川の水浴場で選定されるなどする清流である。"},{"page_url":"https://sk.wikipedia.org/wiki/NGC_59","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/NGC_0059_2MASS.jpg","page_title":"NGC 59","context_page_description":"NGC 59 je galaxia v súhvezdí Veľryba, ktorú objavil americký astronóm Ormond Stone v roku 1886.\\nJej zdanlivá hviezdna veľkosť je 12,1."},{"page_url":"https://en.wikipedia.org/wiki/Chloro(tetrahydrothiophene)gold(I)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Chloro%28tetrahydrothiophene%29gold%28I%29-from-xtal-1993-CM-3D-balls.png","page_title":"Chloro(tetrahydrothiophene)gold(I)","context_page_description":"Chloro(tetrahydrothiophene)gold(I), abbreviated AuCl, is a coordination complex of gold. Like the dimethyl sulfide analog, this compound is used as a convenient entry point to gold chemistry. The tetrahydrothiophene ligand is labile and is readily substituted with other stronger ligands."},{"page_url":"https://cs.wikipedia.org/wiki/Karpaty","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bucegi_jepiimici.JPG","page_title":"Karpaty","context_page_description":"Karpaty jsou rozsáhlé pásmové pohoří ve střední a východní Evropě. Zasahují na území Rakouska, Česka, Slovenska, Maďarska, Polska, Ukrajiny, Rumunska a Srbska. Na severozápadě navazují na Alpy. Na jihovýchodě, ve východním Srbsku, přecházejí v Balkanidy. Není zde ostrá geologická hranice a geografické prameny se různí: hranice se vede buď po linii Stalać – Sokobanja – Knjaževac, nebo o něco jižněji údolími řek Nišava a Beli Timok. Údolí řeky Velika Morava odděluje Karpaty od Dinarid.\\nSvou celkovou rozlohou přibližně 210 000 km² Karpaty předstihují i Alpy. Délka karpatského oblouku činí 1 500 km, šířka se pohybuje mezi 12 a 350 km. Nejvyšší částí Karpat jsou Vysoké Tatry, Gerlachovský štít je nejvyšším vrcholem Karpat vůbec. Mimo několika rozlohou malých oblastí vysokohorského charakteru jsou Karpaty spíše nízké a zalesněné hory. Nad pásmem lesa se nachází asi 5% rozlohy pohoří; části trvale nad hranicí sněhu ani ledovce zde nejsou.\\nPodle Karpat pojmenoval německý astronom Johann Heinrich von Mädler pohoří Montes Carpatus na přivrácené straně Měsíce."},{"page_url":"https://fi.wikipedia.org/wiki/Volgograd","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Volgograd_Montage_2016.png","page_title":"Volgograd","context_page_description":"Volgograd on runsaan miljoonan asukkaan kaupunki Etelä-Venäjällä Volgan varrella Itä-Euroopassa. Se on Volgogradin alueen hallinnollinen keskus. Vuoteen 1925 kaupungin nimi oli Tsaritsyn, vuosina 1925–1961 Stalingrad ven. Сталингра́д​, Stalingradin alueella. Kaupungille myönnettiin vuonna 1965 sankarikaupungin arvo."},{"page_url":"https://ast.wikipedia.org/wiki/Llista_d%27oxetos_del_cat%C3%A1logu_NGC_(1-999)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Hubble_Interacting_Galaxy_NGC_17_%282008-04-24%29.jpg","page_title":"Llista d'oxetos del catálogu NGC (1-999)","context_page_description":"Esta ye una llista de los primeres 999 oxetos del \\"Nuevu Catálogu Xeneral\\", unu de los catálogos astronómicos más importantes de galaxes, nebuloses y cúmulos estelares principalmente, con un total de 7840 entraes."},{"page_url":"https://no.wikipedia.org/wiki/Inventionen_und_Sinfonien","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/BWV_774_preview.png","page_title":"Inventionen und Sinfonien","context_page_description":"Inventionen und Sinfonien er en samling verk av Johann Sebastian Bach som består av 15 tostemte og 15 trestemte polyfone satser for klaviaturinstrumenter. Originaltittelen er «Auffrichtige Anleitung»."},{"page_url":"https://sv.wikipedia.org/wiki/Ante_%C4%8Covi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/AnteCovic.JPG","page_title":"Ante Čović","context_page_description":"Ante Čović, född 13 juni 1975 i Sydney, australisk före detta fotbollsspelare med kroatisk härkomst.\\nČović växte upp i Hurtsville söder om Sydney och han har varit proffs i Grekland och Kroatien. Han reste till Grekland 1999 för att spela med PAOK Thessaloniki där han fick speltid, men tränarbyte gjorde att han lånades ut till AO Kavala. Efter ett år där kallades han tillbaka till PAOK i april 2001. den 12 maj 2001 stod han i grekiska cupfinalen som PAOK vann. Čović är en placeringssäker målvakt. Innan säsongen 2002 skrev han på för Hammarby IF. Hans debut i Hammarby var den 25 april 2002 borta mot Snöstorp/Nyhem FF i Svenska cupen, Allsvensk debut 14 maj 2002 borta mot IFK Göteborg. Uttagen i Australiens VM-trupp 2006. Hösten 2006 bestämde han sig för att flytta hem till Australien tillsammans med sin familj. Newcastle Jets blev hans nya klubbadress. Den 18 mars 2009 skrev han på för IF Elfsborg, Borås. Han avslutade karriären efter en tid i Wellington Phoenix."},{"page_url":"https://hu.wikipedia.org/wiki/Husby","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Husby_Zum_Dorfteich_12_8960.jpg","page_title":"Husby","context_page_description":"Husby település Németországban, Schleswig-Holstein tartományban. Lakosainak száma 2353 fő. +/- Husby Ringsberg, Langballig, Grundhof, Sörup, Ausacker, Hürup, Maasbüll és Munkbrarup községekkel határos."},{"page_url":"https://it.wikipedia.org/wiki/Tranvia_Monza-Trezzo-Bergamo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Trezzo%2C_stazione_tram.jpg","page_title":"Tranvia Monza-Trezzo-Bergamo","context_page_description":"La tranvia Monza-Trezzo-Bergamo era una linea tranviaria interurbana che collegava Monza a Bergamo tra il 1890 e il 1958.\\nDopo la chiusura della tranvia Milano-Vittuone fu l'ultima interurbana a vapore in esercizio della Lombardia, nonché l'ultima in Italia ad impiegare tram ad accumulatori."},{"page_url":"https://ro.wikipedia.org/wiki/Sala_Sporturilor_Olimpia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Sala_Sporturilor_Olimpia.jpg","page_title":"Sala Sporturilor Olimpia","context_page_description":"Sala Sporturilor Olimpia, situată pe strada Mărășești, este o arenă multifuncțională din municipiul Ploiești, România. Este folosită ca bază locală pentru echipele masculine și feminine de baschet, volei și handbal din oraș. Capacitatea sălii este de 3.500 de locuri."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%8A%D9%84%DA%A4%D9%8A%D8%B1%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Vista_cidade_silveiras.JPG","page_title":"سيلڤيراس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nسيلڤيراس مدينه فى البرازيل."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8F%A4%E4%BA%AC%E9%83%BD%E9%81%BA%E5%9D%80%EF%BC%88%E4%BA%AC%E9%83%BD%E3%80%81%E5%AE%87%E6%B2%BB%E5%92%8C%E5%A4%A7%E6%B4%A5%E5%B8%82%EF%BC%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Kinkaku-ji_the_Golden_Temple_in_Kyoto_overlooking_the_lake_-_high_rez.JPG","page_title":"古京都遺址（京都、宇治和大津市）","context_page_description":"古京都遗址（京都、宇治和大津市），又被称为古都京都的文化财，是指存在于日本京都府京都市、宇治市及滋贺县大津市的寺院、神社、城堡等史迹的总称。此建筑群在1994年被联合国教科文组织登录为世界遗产，成为日本第5个世界遗产项目。"},{"page_url":"https://de.wikipedia.org/wiki/Vaulnaveys-le-Haut","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/%C3%89glise_VLH_avril_2014.jpg","page_title":"Vaulnaveys-le-Haut","context_page_description":"Vaulnaveys-le-Haut ist eine französische Gemeinde mit 3670 Einwohnern im Département Isère in der Region Auvergne-Rhône-Alpes. Sie gehört zum Gemeindeverband Grenoble-Alpes-Métropole, zum Arrondissement Grenoble und ist Teil des Kantons Oisans-Romanche. Die Einwohner werden Vaulnaviards genannt."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%95%D7%A0%D7%AA_2015_%D7%91%D7%9C%D7%99%D7%92%D7%AA_%D7%94%D7%A2%D7%9C_%D7%94%D7%A9%D7%95%D7%95%D7%93%D7%99%D7%AA_%D7%91%D7%9B%D7%93%D7%95%D7%A8%D7%92%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Behrn_Arena_2008.JPG","page_title":"עונת 2015 בליגת העל השוודית בכדורגל","context_page_description":"עונת 2015 בליגת העל השוודית הייתה העונה ה-91 של ליגת העל השוודית מאז הקמתה ב-1924, והיא הייתה ליגת הכדורגל המקצועני הבכירה ביותר בשוודיה בשנת 2015. הקבוצות החדשות שעלו מליגת המשנה ושיחקו בעונת 2015 בליגת העל היו סונדסוואל מהעיר סונדסוואל והמרבי מעיר הבירה סטוקהולם.\\nהעונה החלה ב-4 באפריל 2015 במשחק בו התארחה האקן מהעיר גטבורג במגרשה של העולה החדשה מסטוקהולם, המרבי, והסתיימה ב-31 באוקטובר 2015.\\nהאלופה היוצאת הייתה מאלמה, שהציגה עונה בינונית וסיימה במקום החמישי בלבד. האלופה החדשה הייתה נורשפינג, שהבטיחה את האליפות רק במחזור האחרון."},{"page_url":"https://fr.wikipedia.org/wiki/Claraia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Claraia_aurita_e_Claraia_clarai.JPG","page_title":"Claraia","context_page_description":"Claraia est un genre éteint de mollusques bivalves.\\nCe genre a vécu du Permien supérieur au Trias inférieur avant de s'éteindre. Claraia a ainsi survécu à la principale extinction massive intervenue dans l'histoire géologique : l'extinction Permien-Trias il y a environ 252 millions d'années.\\nOn le retrouve notamment en Chine, dans l'Utah, à Madagascar et au nord de l'Italie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B6%D0%B0%D0%BD_%D0%A6%D0%B7%D1%83%D0%BD%D1%87%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Dairen_zongchang.jpg","page_title":"Чжан Цзунчан","context_page_description":"Чжан Цзунчан по прозвищу «Генерал Собачье Мясо»\\" — китайский милитарист из провинции Шаньдун. Журнал Time называл его самым «подлым милитаристом в Китае»."},{"page_url":"https://de.wikipedia.org/wiki/Toyota_Avensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/2018_Toyota_Avensis_Business_Edition_Valvematic_facelift_Estate_1.8_Rear.jpg","page_title":"Toyota Avensis","context_page_description":"Der Toyota Avensis ist ein Pkw-Modell der Mittelklasse, welches von der japanischen Toyota Motor Corporation von Herbst 1997 bis Frühjahr 2018 hergestellt wurde. Sein Vorgängermodell war der Toyota Carina."},{"page_url":"https://et.wikipedia.org/wiki/Juuru_kirik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Rist%2C_Juuru_kirikuaed%2C_1652.jpg","page_title":"Juuru kirik","context_page_description":"Juuru Mihkli kirik on Juuru kihelkonna kirik Rapla maakonnas Juurus. Seal tegutseb EELK Juuru Mihkli kogudus."},{"page_url":"https://nl.wikipedia.org/wiki/Chanoy","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Map_commune_FR_insee_code_52106.png","page_title":"Chanoy","context_page_description":"Chanoy is een gemeente in het Franse departement Haute-Marne en telt 107 inwoners. De plaats maakt deel uit van het arrondissement Langres."},{"page_url":"https://sv.wikipedia.org/wiki/Xolotrema","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/XolotremaNotataExBinney14.jpg","page_title":"Xolotrema","context_page_description":"Xolotrema är ett släkte av snäckor. Xolotrema ingår i familjen Polygyridae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://de.wikipedia.org/wiki/Scuole","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Scuola_Grande_di_San_Marco_Ospedale_di_Venezia_facciata.jpg","page_title":"Scuole","context_page_description":"Als Scuole wurden in der Republik Venedig geistliche und karitative Korporationen, Zünfte und Gilden oder Zusammenschlüsse von auswärtigen Landsmannschaften bezeichnet. Im übrigen Italien lautete die Bezeichnung für vergleichbare Einrichtungen: Confraternita oder Arciconfraternita. Auch die Synagogen wurden als solche akzeptiert und heißen in Venedig daher gleichfalls scuola. Zu den wichtigsten Aufgaben einer solchen Vereinigung gehörte die Betreuung der Sterbenden und ihre Beisetzung sowie die Versorgung der Hinterbliebenen, dazu die allgemeine Armenfürsorge.\\nNeben den einflussreichen und vermögenden Scuole grandi gab es eine große Anzahl von Scuole piccoli, in denen sich Händler und Handwerker zusammenfanden.\\nMarin Sanudo überliefert, dass es 1501 insgesamt rund 210 große und kleine Scuole gab. Nach dem Fall der Republik Venedig wurden die Scuole durch Erlass Napoleons aufgelöst.\\nDem entging nach inständigem Bitten der Bürger nur die Scuola Grande di San Rocco. Die Scuola Grande dei Carmini wurde 1840 neu gegründet.\\nDas Gebäude, in dem eine Scuola ihren Sitz hat, wird ebenfalls scuola genannt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E3%81%AE%E5%B7%9E%E4%BC%9A%E8%AD%B0%E4%BA%8B%E5%A0%82%E3%81%AE%E4%B8%80%E8%A6%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Rhode_Island_state_house_2009a.JPG","page_title":"アメリカ合衆国の州会議事堂の一覧","context_page_description":"本項目はアメリカ合衆国の州会議事堂の一覧である。\\nアメリカ合衆国内の多くの州では、州会議事堂に州議会の上下両院の議場および州知事室が置かれているが、すべての州においてそのようになっているわけではない。例えば、アリゾナ州では州議会の議場も知事室も別個の建物の中に置かれており、州会議事堂は博物館となっている。アラバマ、ネバダ、ノースカロライナの各州の州議会の議場は州会議事堂とは別個の建物の中に置かれており、州会議事堂には州知事室のみが置かれている。逆に、バージニア州においては、州議会の議場は州会議事堂内に置かれているが、州知事室は別個の建物の中に置かれている。\\n一方、アメリカ合衆国の多くの州では、州の最高裁判所は州会議事堂とは別個の建物の中に置かれている。しかし、インディアナ、ウィスコンシン、ウェストバージニア、オクラホマ、ケンタッキー、サウスダコタ、ネブラスカ、ノースダコタ、ペンシルベニアの9つの州においては、最高裁判所も州会議事堂の中に置かれている。\\n英名では、サウスカロライナ、ニュージャージー、ニューハンプシャー、バーモント、マサチューセッツ、メイン、メリーランド、ロードアイランドの各州の州会議事堂はState Houseと呼ばれている。また、インディアナ州およびオハイオ州では、州会議事堂はStatehouseと呼ばれている。残りの40州においては、州会議事堂はState Capitolと呼ばれている。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%8F%E3%83%BC%E3%83%88%E3%83%9E%E3%83%BC%E6%9B%B8%E7%B0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Letter_8.jpg","page_title":"マハートマー書簡","context_page_description":"マハートマー書簡、マハトマ書簡 とは、神智学協会に始まる近現代の神智学運動において、｢大師」または「マハートマー」と呼ばれる霊的指導者から授かったと主張される手紙である。\\n近代神智学の創始者ヘレナ・P・ブラヴァツキーは、ヒマラヤの奥、またはチベットのシガツェに住まう大師方と超自然的な方法で通信することができると主張した。また、大師方はブラヴァツキー以外の人間にも手紙を送ることがあるとされ、インドでのブラヴァツキーの弟子アルフレッド・パーシー・シネットはマハートマーとの通信に与った。マハートマーからの手紙の出現の仕方はさまざまであったが、いつの間にか枕の下や机の上に置かれているというケースが多かった。また、ブラヴァツキーは天井から手紙が落ちてくるという「奇跡」も演じた。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B9_%D0%9A%D0%BB%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%D0%94%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D1%96_%D0%BA%D0%BE%D0%BB%D1%8C%D0%BE%D0%BD%D1%96%D1%97_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8.jpg","page_title":"Зелений Клин","context_page_description":"Зеле́ний Клин, Зелена Україна або Закитайщина — історична українська назва території Приамур'я південної частини Далекого Сходу, у нижній частині річки Амур і над Тихим океаном; площа близько 1 млн км².\\nНайбільші міста: Хабаровськ, Владивосток, Комсомольськ-на-Амурі, Уссурійськ. Загальне господарське значення мають видобуток золота і кольорових металів, рибна, лісова промисловість, ловецтво, суднобудування і морський транспорт, з продуктів сільського господарства — соя.\\nЗа даними перепису 1926 в Зеленому Клині мешкало 303 тисячі українців, або 24,5 % усього далекосхідного населення. У період існування СРСР українське населення регіону зазнало масових депортацій і зросійщення."},{"page_url":"https://de.wikipedia.org/wiki/LeBron_James","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/LeBronJamesDunkingHeat.jpg","page_title":"LeBron James","context_page_description":"LeBron Raymone James ist ein US-amerikanischer Basketballspieler, der seit der Saison 2018/19 bei den Los Angeles Lakers in der nordamerikanischen Profiliga NBA spielt. Von 2010 bis 2014 war er für die Miami Heat aktiv. Für sein erstes Team, die Cleveland Cavaliers, stand er von 2003 bis 2010, sowie von 2014 bis 2018 unter Vertrag. James ist 2,06 m groß und läuft meist als Small Forward auf. Da er dabei aber die Aufgaben eines Point Guards übernimmt, wird er manchmal auch als Point Forward bezeichnet. In Anspielung auf frühere englische Könige wird er „King James“ genannt. James gilt als einer der herausragendsten Athleten des Basketballsports.\\nBereits während seiner Highschool-Zeit als künftiger NBA-Superstar gepriesen, meldete sich James direkt nach der Schulzeit für den NBA-Draft an und wurde im Draft 2003 an erster Stelle von den Cleveland Cavaliers ausgewählt. In seiner Debüt-Saison mit den Cavaliers gewann er die Auszeichnung Rookie des Jahres, 2008/09 sowie 2009/10 wurde er als wertvollster Spieler der Liga ausgezeichnet. Von 2006 bis 2010 führte James die Cavaliers fünfmal in Folge in die Play-offs und 2007 zur ersten Finalteilnahme in der Geschichte der Franchise."},{"page_url":"https://it.wikipedia.org/wiki/Florence_Civic_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Aerial_view_of_Western_Florence%2C_South_Carolina.jpg","page_title":"Florence Civic Center","context_page_description":"Il Florence Civic Center è un'arena situata a Florence, nella Carolina del Sud."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_t%C3%B2a_nh%C3%A0_cao_nh%E1%BA%A5t_Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Khu_%C4%91%C3%B4_th%E1%BB%8B_Sunrise_City%2C_T%C3%A2n_H%C6%B0ng%2C_Qu%E1%BA%ADn_7%2C_H%E1%BB%93_Ch%C3%AD_Minh%2C_Vietnam_-_panoramio_%281%29.jpg","page_title":"Danh sách tòa nhà cao nhất Thành phố Hồ Chí Minh","context_page_description":"Đây là danh sách tòa nhà cao nhất Thành phố Hồ Chí Minh được xếp theo chiều cao. Tòa nhà cao nhất thành phố Hồ Chí Minh và Việt Nam là The Landmark 81, được hoàn thành vào cuối năm 2018 cao 461,3 mét. Đây là tòa nhà cao thứ 16 thế giới của Châu Âu.\\nThành phố Hồ Chí Minh là thành phố có nhiều tòa nhà cao tầng thứ hai Việt Nam với hơn 500 công trình cao hơn 100 m, tập trung chủ yếu ở các quận trung tâm và các khu vực ven sông Sài Gòn như:Quận 1, Quận 2, Quận 4, Quận 7, Bình Thạnh."},{"page_url":"https://cs.wikipedia.org/wiki/Alytusk%C3%BD_kraj","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Nemunas-merkys_santaka.jpg","page_title":"Alytuský kraj","context_page_description":"Alytuský kraj je nejjižnějším z deseti litevských krajů. Jeho hlavním městem je Alytus. Dalším významným městem v kraji je lázeňské město Druskininkai."},{"page_url":"https://pl.wikipedia.org/wiki/Vallirana","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Vallirana_boira.JPG","page_title":"Vallirana","context_page_description":"Vallirana – gmina w Hiszpanii, w prowincji Barcelona, w Katalonii, o powierzchni 23,81 km². W 2011 roku gmina liczyła 14 549 mieszkańców."},{"page_url":"https://sk.wikipedia.org/wiki/Hrabovo_(Ru%C5%BEomberok)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Ru%C5%BEomberok_-_Hrabovo_pano.jpg","page_title":"Hrabovo (Ružomberok)","context_page_description":"Hrabovo je prímestská časť nachádzajúca sa na západe Ružomberka. So vznikom súvisí vybudovanie vodného diela v oblasti pre účely zásobovania bavlnárskych závodov. K rozvoju prispel cestovný ruch, ktorý súvisel s budovaním lyžiarskeho strediska na Maline-Brde. V roku 1964 bola z Hrabova vybudovaná kabínková lanovka na Malinô-Brdo. Hrabovo dnes slúži nielen ako dolná stanica spomínanej lanovky, ale aj ako východisko do Veľkej Fatry. Okrem chatovej oblasti sa tu nachádzajú aj mnohé plochy na rekreáciu a šport. V súčasnosti sa v okolí vodnej nádrže realizuje stavba rekreačných budov."},{"page_url":"https://tr.wikipedia.org/wiki/Bursa_Arkeoloji_M%C3%BCzesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Bursa_Arkeoloji_M%C3%BCzesi_06.JPG","page_title":"Bursa Arkeoloji Müzesi","context_page_description":"Bursa Arkeoloji Müzesi, Bitinya ve Misya bölgelerinde bulunmuş MÖ 3000’den Bizans devri sonlarına kadar olan devirlere ait eserlerin sergilendiği Bursa müzesidir.\\n1904 yılında İstanbul Arkeoloji Müzesi'nin bir şubesi olarak kurulan müze, İstanbul Arkeoloji Müzesi ve Konya Arkeoloji Müzesi'nden sonra Türkiye'nin en eski üçüncü müzesidir. Günümüzde Bürsa Kültürparkı içinde yer alır. Kültür ve Turizm Bakanlığı'na bağlı müzede 25 bin eser bulunur, 2 bin kadarı sergilenmektedir."},{"page_url":"https://fr.wikipedia.org/wiki/Mouette_de_la_Frise_orientale","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Tab45_H%C3%BChner_%28Gefl%C3%BCgel-Album%2C_Jean_Bungartz%2C_1885%29.jpg","page_title":"Mouette de la Frise orientale","context_page_description":"La mouette de la Frise orientale est une race de poule domestique."},{"page_url":"https://de.wikipedia.org/wiki/Dietrich_von_Hildebrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Wien01_Habsburgergasse005_2017-12-30_GuentherZ_GD_Hildebrand_0070.jpg","page_title":"Dietrich von Hildebrand","context_page_description":"Dietrich von Hildebrand war ein katholischer Philosoph und Autor."},{"page_url":"https://ru.wikipedia.org/wiki/LoveGame","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Lady_Gaga_LoveGame_Manchester.jpg","page_title":"LoveGame","context_page_description":"«LoveGame» — электропоп-песня американской певицы Lady Gaga из её дебютного альбома The Fame. Её продюсером является RedOne.\\nПесня была критически расценена из-за вызывающей мелодии и хука «Я хочу прокатиться на твоем шесте». Гага объяснила термин «шест» как эвфемизм для слова «пенис» и была вдохновлена её сексуальным аттракционом с незнакомцем в ночном клубе. Передавая музыкально вибрацию андеграундных дискотек Нью-Йорка, в песне говорится о любви, славе и сексуальности, которые являются центральной темой её альбома. «LoveGame» заняла в чарте высокую строчку в США, Австралии, Новой Зеландии, Канаде и некоторых европейских странах. Она стала 3 по счету хитом номер один в чарте Billboard’s Pop Songs.\\nДействие клипа разворачивается в нью-йоркском метрополитене, где танцует Гага в подземной станции метро и на месте парковки машин. Гага посвятила эту песню нью-йоркскому стилю жизни, состоящего из гламура, фанатов и высокой моды. В клипе прослеживаются некоторые сходства с клипом Майкла Джексона «Bad», в котором сюжет происходит тоже в тоннеле. В Австралии видео было запрещено к показу из-за сексуального содержания."},{"page_url":"https://de.wikipedia.org/wiki/H%C3%A9rin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/H%C3%A9rin_%28Nord%2C_Fr%29_mairie.JPG","page_title":"Hérin","context_page_description":"Hérin ist eine französische Gemeinde mit 4135 Einwohnern im Département Nord in der Region Hauts-de-France. Sie gehört zum Kommunalverband Porte du Hainaut, zum Arrondissement Valenciennes und ist Teil des Kantons Aulnoy-lez-Valenciennes. Die Einwohner heißen Hérinois."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B5%86%E0%B4%99%E0%B5%8D%E0%B4%A6%E0%B5%86_%E0%B4%AE%E0%B5%97%E0%B4%A3%E0%B5%8D%E0%B4%9F%E0%B5%BB_%E0%B4%B1%E0%B4%BF%E0%B4%B8%E0%B5%8B%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Zhengligate.JPG","page_title":"ചെങ്ദെ മൗണ്ടൻ റിസോർട്ട്","context_page_description":"ചൈനയിലെ ചെന്ദ്ദെ പട്ടണത്തിലുള്ള രാജകീയ കൊട്ടാരങ്ങളും ഉദ്യാനങ്ങളും ഉൾപ്പെടുന്ന ഒരു സമുച്ചയമാണ് ചെങ്ദ് മൗണ്ടിൻ റിസോർട്ട്. ലിഗോങ് എന്നും ഇത് അറിയപ്പെടുന്നു. ചൈനയിലെ ഹെബെയ് പ്രവിശ്യയിലാണ് ഈ ചരിത്രകേന്ദ്രം സ്ഥിതിചെയ്യുന്നത്. ഇവിടത്തെ വൈവിധ്യവും സമ്പന്നവുമാർന്ന ഭൂദൃശ്യങ്ങളും വാസ്തുനിർമ്മിതികളും മറ്റും ഈ പ്രദേശത്തിന്റെ പ്രാധാന്യം വർദ്ധിപ്പിക്കുന്നു..\\nക്വിങ് രാജവംശത്തിന്റെ കാലഘട്ടത്തിലാണ് ഈ പ്രദേശങ്ങളുടെ നിർമ്മാണം നടക്കുന്നത്. ഇതിന്റെ പണി പൂർത്തിയാകാൻ 89-വർഷങ്ങൾ വേണ്ടിവന്നു. 5.6 ചതുരശ്ര കിലോമീറ്റർ വിസ്തൃതിയിൽ വ്യാപിച്ച് കിടക്കുന്ന ഈ പ്രദേശത്തിനുള്ളിൽ നിരവധി ക്ഷേത്രങ്ങളും, കൊട്ടാരങ്ങളും, പഗോഡകളും മറ്റും ഉൾപ്പെടുന്നുണ്ട്."},{"page_url":"https://vi.wikipedia.org/wiki/B%C4%83ng_v%E1%BB%87_sinh","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Hygienebeutel_p.jpg","page_title":"Băng vệ sinh","context_page_description":"Băng vệ sinh là miếng lót thấm hút dành cho nữ giới đang trong kỳ kinh nguyệt, sau khi vừa thực hiện ca phẫu thuật âm đạo, sau khi sinh nở hay sau khi phá thai, hoặc trong bất kỳ tình huống nào khác mà cần phải thấm hút bất kì chất lỏng hoặc máu chảy ra từ âm đạo\\nMiếng lót băng vệ sinh không nên nhầm lẫn với miếng lót không thấm nước với độ thấm hút cao hơn dùng cho những người bị chứng tiểu tiện không kiểm soát hay bị căng thẳng không kiểm soát. Băng vệ sinh cũng có thể được một số người sử dụng cho mục đích này."},{"page_url":"https://it.wikipedia.org/wiki/Mouais","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Mouais_moulin.jpg","page_title":"Mouais","context_page_description":"Mouais è un comune francese di 376 abitanti situato nel dipartimento della Loira Atlantica nella regione dei Paesi della Loira."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%84%BC%E7%81%AB%E7%A5%9E%E7%A4%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Takuhi_jinja_Honden.JPG","page_title":"焼火神社","context_page_description":"焼火神社は、島根県隠岐郡西ノ島町にある神社である。島前の西ノ島における最高峰、焼火山の8合目辺りに鎮座する旧県社。航海安全の守護神として遠く三陸海岸まで信仰を集めた。本殿・通殿・拝殿からなる社殿は国の重要文化財に指定。重要有形民俗文化財の和船トモドも所有する。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ville-Houdl%C3%A9mont","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Map_commune_FR_insee_code_54572.png","page_title":"Ville-Houdlémont","context_page_description":"Ville-Houdlémont sī ūi-tī Hoat-kok Lorraine toā-khu Meurthe-et-Moselle koān ê chi̍t ê commune."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BA%B7%E5%AE%8F%E7%92%B0%E7%90%83%E6%8E%A7%E8%82%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/HK_%E7%81%A3%E4%BB%94_Wan_Chai_%E8%8E%8A%E5%A3%AB%E9%A0%93%E9%81%93_Johnston_Road_%E5%92%8C%E6%98%8C%E5%A4%A7%E6%8A%BC_Wo_Cheong_Pawn_Shop_%E5%A4%A7%E7%8E%8B%E6%9D%B1%E8%A1%97_Tai_Wong_Street_East_January_2020_SSG_05.jpg","page_title":"康宏環球控股","context_page_description":"康宏環球控股有限公司， 是香港的金融集團，於1993年成立，並於2010年在香港交易所上市。目前主要發展三大業務，包括理財顧問、金融產品及金融科技。旗下子公司康宏理財服務有限公司 。\\n在大中華地區，集團於北京及深圳設立附屬公司及合營企業，提供人壽及一般保險經紀業務、風險管理諮詢服務、再保險經紀服務、以及機構層面上的保險及投資策劃諮詢服務等。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2%D0%BD%D1%8B%D1%85_%D1%82%D1%80%D0%B5%D0%BD%D0%B5%D1%80%D0%BE%D0%B2_%D1%81%D0%B1%D0%BE%D1%80%D0%BD%D0%BE%D0%B9_%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8F_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Shlomo_Scharf.jpg","page_title":"Список главных тренеров сборной Израиля по футболу","context_page_description":"Ниже представлен список главных тренеров национальной сборной Израиля по футболу, их статистика и достижения в сборной.\\nИзраильская футбольная ассоциация является предшественницей футбольной ассоциации Эрец-Исраэль, основанной в 1928 году в подмандатной Палестине. С 1929 года является членом ФИФА. Первый официальный международный матч сборная Эрец-Исраэль провела 16 марта 1934 года против Египта, а её первым тренером был Шимон Ратнер.\\nПосле создания государства Израиля в 1948 году его сборная сначала выступала в АФК и выиграла Кубок Азии в 1964 году, однако затем её выступления бойкотировали в Азии ввиду усиления конфликта с арабскими государствами.\\nЗа всю историю сборной у неё было 31 главных тренеров, среди которых было 12 иностранных специалистов. Трижды сборной руководил исполняющий обязанности главного тренера, а также один раз тренерский тандем, состоявший из Ицхака Шнеора и Яакова Грундмана. Действующим главным тренером сборной является Андреас Херцог.\\nСамым успешным тренером сборной является Йосеф Мирмович, выигравший с командой золотые медали Кубка Азии 1964."},{"page_url":"https://cs.wikipedia.org/wiki/Bazilika_Panny_Marie_(Candelaria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Candelaria_BW_1.JPG","page_title":"Bazilika Panny Marie (Candelaria)","context_page_description":"Bazilika Panny Marie je velký římskokatolický chrám ve městě Candelaria na španělském ostrově Tenerife."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9A%D0%B5%D0%BC%D0%B0%D0%BB%D0%B8_%D0%98%D1%81%D0%BC%D0%B0%D0%B8%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Ismail_Qemali.jpg","page_title":"Кемали Исмаил","context_page_description":"Исмаил Кема́ли Бей Влёра йәки Исмаил Кема́ли - — албан милли хәрәкәте юлбашсыһы, Албания дәүләтенә нигеҙ һалған һәм тәүге башлығы булған шәхес. Милли Йыйылыш рәйесе, Ваҡытлы хөкүмәт рәйесе, Албания сит ил эштәре министры. Албанияның Халыҡ Геройы."},{"page_url":"https://en.wikipedia.org/wiki/List_of_wild_pigeon_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/TreronFulvicollis.jpg","page_title":"List of wild pigeon species","context_page_description":"The International Ornithological Congress recognizes 344 species in family Columbidae, the pigeons and doves. They are distributed among 50 genera. This list is presented according to the IOC taxonomic sequence and can also be sorted alphabetically by common name and binomial. It includes 13 extinct species.\\nThe IOC breeding range descriptions use the following abbreviations for continents and other major geographic areas.\\nAF: Africa\\nAU: Australasia\\nEU: Eurasia\\nIO: Indian Ocean\\nMA: Middle America\\nNA: North America\\nOR: Oriental region\\nPO: Polynesia\\nSA: South America"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Sydney_Harbour_ferries","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Sydney_Ferry_Greycliffe.jpg","page_title":"List of Sydney Harbour ferries","context_page_description":"This is a list of passenger ferries operating or formerly operating on Sydney Harbour. It includes ferries serving the Manly run."},{"page_url":"https://da.wikipedia.org/wiki/Roy_Rogers","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Roy_Rogers_-_Hart_-_1938.jpg","page_title":"Roy Rogers","context_page_description":"Roy Rogers, født Leonard Franklin Slye, var en amerikansk sanger og cowboy skuespiller, en af de mest massivt markedsført stjerner i sin æra. Han og hans kone Dale Evans, hans gyldne palomino, Trigger og hans tyske schæferhund Bullet, blev præsenteret i mere end 100 film og The Roy Rogers Show. Showet kørte på radio i ni år før flytning til tv fra 1951 til 1957. Rogers kælenavn var \\"King of the Cowboys\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D1%80%D1%81%D0%B0_(%D0%BC%D1%96%D1%81%D1%82%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Bursa_7046.jpg","page_title":"Бурса (місто)","context_page_description":"Бу́рса — місто в Туреччині, у північно-західній Анатолії, Мармуровоморському регіоні, адміністративний центр провінції Бурса, четверте найбільше за кількістю населення в країні, після Стамбулу, Анкари і Ізміра, місто-мільйонник. У 2014 році, Бурса мало населення 1,800,278, у той час як провінція Бурса — 2,787,539 чоловік. Одне з найбільш промислово розвинених центрів у країні."},{"page_url":"https://en.wikipedia.org/wiki/Willy_Clarkson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Willy_Clarkson_Coping_Stone.jpg","page_title":"Willy Clarkson","context_page_description":"William Berry \\"Willy\\" Clarkson was a British theatrical costume designer and wigmaker."},{"page_url":"https://ceb.wikipedia.org/wiki/Val-Alain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Pont_couvert_val_alain.JPG","page_title":"Val-Alain","context_page_description":"Munisipyo ang Val-Alain sa Kanada. Nahimutang ni sa kondado sa Chaudière-Appalaches ug lalawigan sa Québec, sa habagatan-sidlakang bahin sa nasod, 300 km sa sidlakan sa Ottawa ang ulohan sa nasod.\\nAng klima hemiboreal. Ang kasarangang giiniton 3 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -16 °C. Ang kasarangang pag-ulan 1,399 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 171 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 71 milimetro."},{"page_url":"https://ceb.wikipedia.org/wiki/Saint_Joseph_County_(kondado_sa_Tinipong_Bansa,_Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/St_Joseph_County_Indiana_Courthouse.jpg","page_title":"Saint Joseph County (kondado sa Tinipong Bansa, Indiana)","context_page_description":"Kondado ang Saint Joseph County sa Tinipong Bansa. Nahimutang ni sa estado sa Indiana, sa sidlakang bahin sa nasod, 800 km sa kasadpan sa Washington, D.C. Adunay 266,931 ka molupyo. Naglangkob kin og 1,194 ka kilometro kwadrado. Saint Joseph County mopakigbahin sa usa ka utlanan sa Berrien County ang ulohan sa nasod.\\nAng yuta sa Saint Joseph County kay patag.\\nSaint Joseph County may sa mosunod nga mga subdibisyon:\\nSouth Bend\\nMga lungsod sa Saint Joseph County:\\nSouth Bend\\nMishawaka\\nGranger\\nNotre Dame\\nGeorgetown\\nGulivoire Park\\nOsceola\\nWalkerton\\nNorth Liberty\\nNew Carlisle\\nLakeville\\nRoseland\\nIndian Village\\nSa mosunod nga mga natural nga mga bahin makita sa Saint Joseph County:\\nMga luuk:\\nBaugo Bay\\nMga suba:\\nBaugo Creek\\nBowman Creek\\nJordans Creek\\nJudy Creek\\nKartoffel Creek\\nMinnow Branch\\nPine Creek\\nPotato Creek\\nSpud Run\\nWillow Creek\\nYellow Bank Creek\\nMga kanal:\\nAldrich Ditch\\nAnthony Ditch\\nAuthen Ditch\\nBarkey Ditch\\nBillman Ditch\\nBreckenridge Ditch\\nChain-O-Lakes Ditch\\nDixon West Place Ditch\\nEast Branch Bunch Ditch\\nEberly Ditch\\nEller Ditch\\nEller Ditch\\nElmer Kane Ditch\\nElmer Kane Lateral\\nFulmer Ditch\\nGast Ditch\\nGeyer Ditch\\nGrimes Ditch\\nGrimes Ditch\\nGross Ditch\\nHeston Ditch\\nHoffman Ditch"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8_%D1%82%D0%B5%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Luminance_Chamber.jpg","page_title":"Светлински тек","context_page_description":"Во фотометријата, светлински тек — мерка за восприемената моќ на светлината. Се разликува од зрачниот тек по тоа што светлинскиот тек е прилагоден со оглед на различната чувствителност на човечкото око на светлина со разни бранови должини."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Dipluridae","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Linothele_fg03.jpg","page_title":"Specie di Dipluridae","context_page_description":"Di seguito sono elencate le 179 specie della famiglia di ragni Dipluridae note al dicembre 2012."},{"page_url":"https://it.wikipedia.org/wiki/Milicja_Obywatelska","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/FSO_Polonez_MR%2778_militia_front_Poznan_2011.jpg","page_title":"Milicja Obywatelska","context_page_description":"La Milicja Obywatelska; era la polizia della Repubblica Popolare Polacca.\\nIl termine Milicja deriva dal termine \\"мили́ция\\", usato in molti paesi comunisti. Contrariamente al significato del termine milizia, ossia quello di una forza di cittadini, era in realtà una forza di polizia statale, usata anche per repressione politica."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Warren_County,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/CENTENARY_COLLEGIATE_INSTITUTE%2C_HACKETTSTOWN%2C_WARREN_COUNTY.jpg","page_title":"National Register of Historic Places listings in Warren County, New Jersey","context_page_description":"List of the National Register of Historic Places listings in Warren County, New Jersey\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Warren County, New Jersey. The locations of National Register properties and districts may be seen in an online map by clicking on \\"Map of all coordinates\\".\\nThis National Park Service list is complete through NPS recent listings posted April 24, 2020."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D9%86%D8%B3%D8%A7_%D8%B1%D8%AF%DA%AF%D8%B1%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Vanessa_Redgrave_536916876.jpg","page_title":"ونسا ردگریو","context_page_description":"ونسا ردگریو بازیگر برجستهٔ سینما و تئاتر انگلستان است. پدرش نیز هنرپیشه بوده‌است. ونسا به‌خاطر بازی در نقش زنان محکم و بااعتمادبه‌نفس معروف است."},{"page_url":"https://en.wikipedia.org/wiki/Military_drums","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Zhangu.jpg","page_title":"Military drums","context_page_description":"Military drums or war drums are all kinds of drums and membranophones that have been used for martial music, including military communications, as well as drill, honors music and military ceremonies."},{"page_url":"https://fr.wikipedia.org/wiki/Daniele_da_Volterra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/151_le_vite%2C_danilo_ricciarelli_da_volterra.jpg","page_title":"Daniele da Volterra","context_page_description":"Daniele Ricciarelli, né à Volterra en 1509 et mort à Rome, le 4 avril 1566, plus connu sous le nom de Daniele da Volterra ou le Volterran, est un peintre et un sculpteur maniériste italien de la Renaissance tardive.\\nIl est connu pour sa participation à l’œuvre de Michel-Ange. Plusieurs des œuvres importantes de Volterra se basent sur des dessins de Michel-Ange, et après la mort de celui-ci, à la demande de Charles Borromée, il recouvre les parties génitales des personnages du Jugement dernier par des repeints de pudeur, ce qui lui fait gagner le surnom de Il Braghettone."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Riaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Sedr_usines_travaux_2009.jpg","page_title":"Les Riaux","context_page_description":"Les Riaux est un quartier du 16ᵉ arrondissement de Marseille situé dans le VIIIᵉ secteur dans la partie nord de la ville. Il est parfois considéré comme l'un des quartiers de L'Estaque, comme l'Estaque Plage, l'Estaque Gare et les Hauts de l'Estaque. Le secteur des Riaux est en limite du terroir Marseillais, juste avant le Rove. Ce secteur est doté d'un fort patrimoine industriel mais également d'un fort patrimoine culturel, en effet, sa position entre bord de mer et colline fit aussi le bonheur des peintres les plus illustres. Ainsi beaucoup de personnes l'appellent Estaque Riaux, alors que « Les Riaux » est un quartier administratif de Marseille, tout comme les trois autres quartiers du 16ᵉ, St André, St Henri et l'Estaque."},{"page_url":"https://fy.wikipedia.org/wiki/R%C3%B6cken","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Altar_und_Kanzel_R%C3%B6cken.jpg","page_title":"Röcken","context_page_description":"Röcken is in plak en eardere gemeente yn de Dútske dielsteat Saksen-Anhalt; it heart ta it Landkreis Burgenlandkreis.\\nRöcken is it berteplak fan de filosoof Friedrich Nietzsche, syn bertehûs bestiet noch. Hy waard dêr ek beïerdige."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%81%E7%8E%8B%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Juo-Sta-West.JPG","page_title":"十王駅","context_page_description":"十王駅は、茨城県日立市十王町友部にある、東日本旅客鉄道常磐線の駅である。"},{"page_url":"https://pl.wikipedia.org/wiki/Osiedle_Tysi%C4%85clecia_(Krak%C3%B3w)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Krakow-Park_Tysi%C4%85clecia_4.jpg","page_title":"Osiedle Tysiąclecia (Kraków)","context_page_description":"Osiedle Tysiąclecia – osiedle w Krakowie wchodzące w skład Dzielnicy XV Mistrzejowice, niestanowiące jednostki pomocniczej niższego rzędu w ramach dzielnicy."},{"page_url":"https://en.wikipedia.org/wiki/Catellani_reaction","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Orgininal_reactions_2.jpg","page_title":"Catellani reaction","context_page_description":"The Catellani reaction was discovered by Marta Catellani and co-workers in 1997. The reaction uses aryl iodides to perform bi- or tri-functionalization, including C-H functionalization of the unsubstituted ortho position, followed a terminating cross-coupling reaction at the ipso position. This cross-coupling cascade reaction depends on the ortho-directing transient mediator, norbornene."},{"page_url":"https://en.wikipedia.org/wiki/Stefan_Kury%C5%82owicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Pol_modlin_airport_2.jpg","page_title":"Stefan Kuryłowicz","context_page_description":"Stefan Marian Kuryłowicz was a Polish architect and professor who is widely credited with transforming the architecture and skyline of Warsaw, Poland, in the twenty years following the collapse of Communism in 1989. Media reports have called Kuryłowicz \\"one of the most influential Polish architects.\\" He and the late architect Jacek Syropolski created the architecture company, Kurylowicz & Associates."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_City_of_Canterbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Canterbury_-_Church_of_St_Margaret.jpg","page_title":"Grade II* listed buildings in City of Canterbury","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of City of Canterbury in Kent."},{"page_url":"https://fr.wikipedia.org/wiki/Th%C3%A9orie_%C3%A9conomique_des_mus%C3%A9es","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Tate-modern-london.jpg","page_title":"Théorie économique des musées","context_page_description":"La théorie économique des musées est un domaine de l'économie de la culture qui s'intéresse au fonctionnement économique des musées.\\nPlus précisément, la théorie économique des musées analyse principalement l'activité des musées selon deux cadres. Un musée peut en premier lieu être considéré comme une unité économique, considéré sous l'angle de la relation entre ses intrants et sa production. Dans ce cadre, on peut également étudier l'effet des musées sur les autres secteurs sur le plan de l'emploi ou du chiffre d'affaires généré. En second lieu, on peut l'étudier comme un agent économique néoclassique maximisant un objectif sous une contrainte d'allocation de ressources rares.\\nL'analyse économique des musées met en évidence un impact fondamental du mode de financement sur la politique des musées en matière de gestion des collections, d'orientation artistique et de mise en place d'activités destinées à augmenter les ressources."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%BF%D0%BE%D1%80_%D0%94%D0%BE%D0%BC%D0%B0%D0%BD%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Domanivskiy_rayon_prapor.png","page_title":"Прапор Доманівського району","context_page_description":"Пра́пор Дома́нівського райо́ну затверджений 22 вересня 2006 року рішенням Доманівської районної ради."},{"page_url":"https://pl.wikipedia.org/wiki/Ptkan%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Ptkanow_20060618_1604.jpg","page_title":"Ptkanów","context_page_description":"Ptkanów – część wsi Podole w Polsce, położona w województwie świętokrzyskim, w powiecie opatowskim, w gminie Opatów, w sołectwie Podole.\\nPrywatna wieś duchowna Pkanów położona była w drugiej połowie XVI wieku w powiecie sandomierskim województwa sandomierskiego."},{"page_url":"https://pt.wikipedia.org/wiki/Arquitetura_chinesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Paifang_Boston_Chinatown_1.jpg","page_title":"Arquitetura chinesa","context_page_description":"A arquitetura chinesa refere-se ao estilo de arquitetura que tomou forma na China ao longo dos séculos. A maior parte dos princípios estruturais da arquitetura chinesa permaneceram inalterados, e as principais variações se dando apenas nos detalhes decorativos. Desde a dinastia Tang a arquitetura chinesa teve uma influência decisiva nos estilos arquitetôinesa. Para cada fonte de informação - literária, gráfica, exemplar - existem fortes evidências testemunhando o fato de que os chineses sempre empregaram um sistema indígena de construção que manteve suas principais características, desde os tempos pré-históricos até o presente. Ao longo da vasta área que vai do Turquestão chinês ao Japão, da Manchúria à metade norte da Indochina francesa, o mesmo sistema de construção prevalece; e esta era uma área de influência cultural chinesa."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B9%BB%E8%B1%A1F1%E5%9E%8B%E6%88%B0%E9%AC%A5%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/F1Cweb.jpg","page_title":"幻象F1型戰鬥機","context_page_description":"幻影F1型战斗机，是一种由法国达梭公司公司制造的中型空优战机，达梭将他定位为幻影3型战斗机的继承型号。为吸引更多国外客户，达梭在幻影F1设计上走保守风格，以普通后掠翼设计替换掉既往幻影战机家族常用的三角翼。在外销成绩上略有成果，最终有14个国家采用，共生产720架以上，曾活跃于1980年代的两伊战争。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Denkm%C3%A4ler_in_Dili","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/DSCI2823_Polizeidenkmal.jpg","page_title":"Liste der Denkmäler in Dili","context_page_description":"Die Liste der Denkmäler in Dili gibt die Denkmäler und Monumente in der Gemeinde Dili der osttimoresischen Landeshauptstadt Dili wieder."},{"page_url":"https://de.wikipedia.org/wiki/Dornhaie","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Mandarin_dogfish2.jpg","page_title":"Dornhaie","context_page_description":"Die Familie der Dornhaie ist weltweit, im Atlantik, Pazifik und Indischen Ozean verbreitet. Sie leben sowohl in kühlen, als auch in tropischen Meeren und halten sich vor allem über den Schelfgebieten von Kontinenten und Inseln und über Seamounts auf. Der bekannteste Vertreter ist der Dornhai, der auch in der Nordsee und im Mittelmeer vorkommt.\\nGemeinsam ist allen Dornhaien das Fehlen der Afterflosse, ein Merkmal, das sie mit den Engelhaien und den Sägehaien gemeinsam haben. Vor beiden Rückenflossen befindet sich je ein ungekerbter Stachel. Der Schwanzflossenstiel trägt seitliche Kiele. Dornhaie werden zwischen 50 Zentimeter und 1,20 Meter lang.\\nAlle Dornhaie sind ovovivipar, das heißt, die Embryonen schlüpfen bereits im Mutterleib aus ihren Eikapseln und entwickeln sich in der Gebärmutterregion bis zur Geburtsgröße und werden dann lebend geboren. Man spricht dabei auch von „aplazentaler Viviparie“."},{"page_url":"https://no.wikipedia.org/wiki/Ordrupgaard","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Ordrupgaards_hovedbygning_set_fra_parken.jpg","page_title":"Ordrupgaard","context_page_description":"Ordrupgaard er et statseiet kunstmuseum som ligger ved Jægersborg Dyrehave nord for København. Museet inneholder en av Nordeuropas betydeligste samlinger av dansk og fransk kunst fra det 19. og begynnelsen av det 20. århundre.\\nOrdrupgaard ble skapt av tidligere direktør for Hafnia, etatsråd Wilhelm Hansen og ektefellen Henny Hansen i årene 1916-1918. Ekteparet hadde kjøpt en stor tomt ved Jægersborg Dyrehave og her oppførte de herskapshuset Ordrupgaard ved\\narkitekt Gotfred Tvede. Samtidig som bygningen ble oppført, ble den store parken anlagt av bygartner Fabricius Hansen.\\nOrdrupgaard ble innviet med en storslått fest 14. september 1918 og i innvielsestalen erklærte Wilhelm Hansen at han ville testamentere samlingen til den danske stat."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D9%86_%D8%A8%D9%84%D9%8A%D9%83_%D8%B1%D8%A7%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/JBrice.jpg","page_title":"جون بليك رايس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجون بليك رايس كان سياسى من امريكا."},{"page_url":"https://da.wikipedia.org/wiki/Mitsubishi_Lancer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Mitsubishi_Lancer_Limousine.jpg","page_title":"Mitsubishi Lancer","context_page_description":"Mitsubishi Lancer er en lille mellemklassebil bygget af Mitsubishi Motors siden 1973. Den er i nogle tilfælde en sedan-, combi coupé- eller stationcarudgave af Mitsubishi Colt."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%A2n_bay_Bol","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Zracna_luka.jpg","page_title":"Sân bay Bol","context_page_description":"Sân bay Bol hay Sân bay Brač là một sân bay ở đảo Brač, gần thị xã Bol của Croatia. Sân bay này chủ yếu phục vụ các chuyến bay thuê bao từ khắp châu Âu trong mùa Hè. Các hãng hoạt động ở đây và mùa Hè là Croatia Airlines, Austrian Airlines và Private Wings Flugcharter. Phần lớn tuyến bay là giữa Brač và các thành phố Áo."},{"page_url":"https://ko.wikipedia.org/wiki/GNZ48","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/20171203%E2%80%94%E2%80%94GNZ48%E3%80%8A%E5%81%B6%E5%83%8F%E7%A0%94%E7%A9%B6%E8%AE%A1%E5%88%92%E3%80%8B%E5%85%AC%E6%BC%94%E9%80%81%E8%BD%A6_4.jpg","page_title":"GNZ48","context_page_description":"GNZ48는 중화인민공화국의 광둥 성 광저우를 중심으로 활동하는 여성 아이돌 그룹이다."},{"page_url":"https://eo.wikipedia.org/wiki/Pulvo","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Meister_der_Sh%C3%A2h-Jah%C3%A2n-N%C3%A2ma-Memoiren_001.jpg","page_title":"Pulvo","context_page_description":"Pulvo aŭ nigra pulvo estas eksplodema pulvoro el miksitaj salpetro, karbo kaj sulfuro, kiu estas uzata ĉefe kiel pelilo de pafaĵoj lanĉitaj per pafiloj kaj por akustikaj celoj en pirotekniko. La vorto pulvo referencas pli precize la nomitan ankaŭ kiel nigra pulvo. Ĝi estas komponita de determinitaj proporcioj da karbo, sulfuro kaj kalia nitrato, sed post la apero de la modernaj nitrocelulozaj peliloj, tiu nomo etendiĝis ankaŭ al tiuj, spite la fakton, ke ili estas produktoj kemie diferencaj.\\nĜi estas malalta eksplodaĵo, kiu eksplodas malpli rapide ol rapido de sono. La pulvo plej populara enhavas 75% da kalia nitrato, 15% da karbono kaj 10% da sulfuro. Nuntempe oni uzas tian pulvon ĉefe en pirotekniko kaj kiel pafopelilon por antikvaj armiloj. La modernaj senfumaj pulvoj estas bazitaj sur energiaj materialoj, precipe celuloza nitrato kaj nitrocelulozo plus nitroglicerino. La avantaĝoj de la modernaj pulvoj estas ilia malalta fumonivelo, malalta nivelo de stokado de brulproduktoj en la armilo kaj homogeneco, kio garantias stabilajn rezultojn kaj pliigas la precizecon de la pafoj."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Dohna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Dohna-Burgstr-26.jpg","page_title":"Liste der Kulturdenkmale in Dohna","context_page_description":"Die Liste der Kulturdenkmale in Dohna enthält die Kulturdenkmale in der Stadt Dohna und ihren Ortsteilen. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Sächsische Schweiz-Osterzgebirge und eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://ast.wikipedia.org/wiki/Hubert_H._Humphrey_Metrodome","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/051207-MPLS-006Metrodome-crop.jpg","page_title":"Hubert H. Humphrey Metrodome","context_page_description":"El Hubert H. Humphrey Metrodome foi un estadiu multiusos na ciudá de Minneapolis, Estaos Xuníos. Sirve como casa de los Minnesota Vikings de la NFL, los Minnesota Golden Gophers de fútbol americano universitariu y los Minnesota Twins de béissbol.\\nEstos trés equipos xugaron nel Metrodome dende la inauguración hasta 2009, cuando los Golden Gophers inauguraron el TCF Bank Stadium nel campus de la Universidá de Minnesota. Nel 2010 los Twins tamién abandonaron el domo en moviéndose al Target Field, un estadiu esclusivu pa bésibol, dexando a los Vikings como únicu equipu permanente.\\nPer otra parte, los Timberwolves xugaron nel Metrodome na temporada 1989/90. N'abril de 1990 xugaron contra los Denver Nuggets ante 49 551 espectadores, la cuarta mayor convocatoria na hestoria de la NBA.\\nEl 10 Mayu del 2012 la llexislatura del estáu de Minnesota paso una propuesta pa construyir en nuevu estadiu nel centru de Minneapolis, Por que seya posible la construcción d'un nuevu estadiu'l Metrodome va tener que ser baltáu. N'el so llugar construyirá una estación de tren rápidu y un estacionamiento pal nuevu estadiu a solo unes cortes."},{"page_url":"https://lt.wikipedia.org/wiki/Rug%C4%97nai","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Rug%C4%97nai_2.JPG","page_title":"Rugėnai","context_page_description":"Rugėnai – kaimas Kėdainių rajone, Pernaravos seniūnijoje, 6 km į pietryčius nuo Pernaravos, iš šiaurės, pietų ir rytų juosiamas Pernaravos-Šaravų miškų. Greta eina kelias 2032 Jankūnai–Pernarava–Kampai II. Fermos. Veikia priešgaisrinės gelbėjimo tarnybos padalinys."},{"page_url":"https://de.wikipedia.org/wiki/Staatliche_Technische_Universit%C3%A4t_Nowosibirsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Studentenwohnheim_f%C3%BCr_Doktoranden.jpg","page_title":"Staatliche Technische Universität Nowosibirsk","context_page_description":"Die Staatliche Technische Universität Nowosibirsk ist eine multidisziplinäre Universität in der russischen Stadt Nowosibirsk. Zurzeit ist sie eine der größten Hochschulen der Region Nowosibirsk.\\nAn der TU werden Bachelor und Masterstudiengänge in 95 Fachrichtungen angeboten. An 14 Fakultäten werden ca. 14.000 Studierende unterrichtet. Die TU Nowosibirsk nimmt am Programm des russischen Ministeriums für Bildung und Wissenschaft „Stützuniversitäten in Russland“ teil.\\nEs ist eine der größten Hochschulen in Sibirien. An der Universität studieren 14.000 Studenten und es sind 1500 Dozenten und Professoren tätig. Es gibt 84 Studienrichtungen und 5 Fachgebiete: die physisch-mathematischen, technischen, ökonomischen und geisteswissenschaftlichen Bereiche. Jährlich werden an der TU Nowosibirsk ca. 6000 Studenten immatrikuliert. An der TU Nowosibirsk gibt es mehr als 120 multimediale Unterrichtsräume und Computerklassen. Neben den wissenschaftlichen Ausbildungszentren und Laboratorien gibt es eine wissenschaftliche Bibliothek.\\nVon der TU werden wissenschaftlichen Publikationen herausgegeben, u. a."},{"page_url":"https://en.wikipedia.org/wiki/Civil_parishes_in_Lancashire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Lancashire_Cheese_Press_-_geograph.org.uk_-_431556.jpg","page_title":"Civil parishes in Lancashire","context_page_description":"A civil parish is a subnational entity, forming the lowest unit of local government in England. There are 219 civil parishes in the ceremonial county of Lancashire; Blackpool is completely unparished; Pendle and Ribble Valley are entirely parished. At the 2001 census, there were 587,074 people living in the 219 parishes, accounting for 41.5 per cent of the county's population."},{"page_url":"https://fr.wikipedia.org/wiki/Giuseppe_Bazzani","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/S.Romuald_by_G.Bazzani.jpg","page_title":"Giuseppe Bazzani","context_page_description":"Giuseppe Bazzani est un peintre italien du XVIIIᵉ siècle de style rococo."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BE%B7%E5%85%8B%E8%90%A8%E6%96%AF%E5%A4%A7%E5%AD%A6%E5%A5%A5%E6%96%AF%E6%B1%80%E5%88%86%E6%A0%A1%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/UTAustin_business.jpg","page_title":"德克萨斯大学奥斯汀分校建筑列表","context_page_description":"德克薩斯大學奧斯汀分校建築列表是一份關於德克薩斯州奧斯汀市德克薩斯大學奧斯汀分校現存建築的列表。這份列表是根據目前這些建築的用途與特徵進行分類的。"},{"page_url":"https://en.wikipedia.org/wiki/Rhizopus_oligosporus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Tempeh_Rhizopus_oligosporus.JPG","page_title":"Rhizopus oligosporus","context_page_description":"Rhizopus oligosporus is a fungus of the family Mucoraceae and is a widely used starter culture for the production of tempeh at home and industrially. As the mold grows it produces fluffy, white mycelia, binding the beans together to create an edible \\"cake\\" of partly catabolized soybeans. The domestication of the microbe is thought to have occurred in Indonesia several centuries ago.\\nR. oligosporus is the preferred starter culture for tempeh production for several reasons. It grows effectively in the warm temperatures which are typical of the Indonesian islands; it exhibits strong lipolytic and proteolytic activity, creating desirable properties in tempeh; and it produces metabolites that allows it to inhibit and thus outcompete other molds and gram-positive bacteria, including the potentially harmful Aspergillus flavus and Staphylococcus aureus.\\nR. oligosporus is at present considered to be a domesticated form of Rhizopus microsporus and its proper taxonomic position is thus Rhizopus microsporus var. oligosporus."},{"page_url":"https://pl.wikipedia.org/wiki/Naloty_na_Japoni%C4%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/USS_Missouri_%28BB-63%29_flyover%2C_Tokyo_Bay%2C_2_September_1945_%28520775%29.jpg","page_title":"Naloty na Japonię","context_page_description":"Naloty na Japonię – alianckie bombowe operacje powietrzne nad Japonią podczas działań bojowych na Pacyfiku w trakcie II wojny światowej. Celem nalotów, prowadzonych od połowy 1944 roku aż do zakończenia wojny, było pozbawienie Japonii zaplecza przemysłowego oraz wywarcie nacisku psychologicznego na społeczeństwo i zmuszenie tego kraju do kapitulacji bez konieczności przeprowadzania inwazji.\\nW początkowym okresie, po japońskim ataku na Pearl Harbor, naloty ograniczały się do rajdu Doolittle’a na Tokio w kwietniu 1942 roku i przeprowadzanych od połowy roku 1943 na niewielką skalę ataków na instalacje wojskowe na Wyspach Kurylskich. Na większą skalę naloty zaczęły się w połowie roku 1944 i trwały aż do zakończenia wojny w sierpniu 1945 roku. W 1945 roku do bombardowań przystąpiło również lotnictwo brytyjskie.\\nKampania powietrzna amerykańskiego lotnictwa przeciw Japonii rozpoczęła się w połowie 1944 roku, a nasiliła się w ostatnich miesiącach wojny. Wprawdzie plany ataku na Japonię przygotowywano jeszcze przed wojną, jednak do nalotów nie mogło dojść, dopóki nie były gotowe ciężkie bombowce dalekiego zasięgu B-29 Superfortress."},{"page_url":"https://en.wikipedia.org/wiki/Chudleigh,_Tasmania","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Lobster_Rivulet_falls%2C_portrait.JPG","page_title":"Chudleigh, Tasmania","context_page_description":"Chudleigh is a small rural village 64 kilometres west of Launceston in northern Tasmania, Australia. The town is in the Chudleigh Valley, between the Gog range and the Great Western Tiers. The area is primarily used for farming, though timber and lime production have been significant industries. The fertile flats of the valley are of alluvial origin, from the Permian era. The Chudleigh show, run by the Agricultural and Horticultural society, is an agricultural show held each February. Since 1889 the show has been held 125 times, and it is one of the state's oldest such events.\\nThe area had been the lands of the Pallittorre Aboriginal Tasmanians for thousands of years. European settlement and disease drove them from the lands and decimated their population. Chudleigh was first settled by Europeans in the 1830s for agriculture and lime production. The town was laid out, probably prior to 1835, to have up to 5000 residents though the population never became large. An early resident, John Badcock Gardiner, named Chudleigh, probably after Chudleigh in Devon, England."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Rees","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Rees_-_Am_B%C3%A4r1-Koenraad_Bosman_-_Kasematten_06_ies.jpg","page_title":"Liste der Baudenkmäler in Rees","context_page_description":"Die Liste der Baudenkmäler in Rees enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Rees im Kreis Kleve in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Rees eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BC%D1%8C_%D1%87%D1%83%D0%B4%D0%B5%D1%81_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/%D0%A3%D0%BA%D1%80%D0%B5%D0%BF%D0%BB%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%90%D1%80%D0%BA%D0%B0%D0%B8%D0%BC._%D0%90%D1%8D%D1%80%D0%BE%D1%84%D0%BE%D1%82%D0%BE%D1%81%D0%BD%D0%B8%D0%BC%D0%BE%D0%BA..jpg","page_title":"Семь чудес России","context_page_description":"Семь чудес России — проект, целью которого стал поиск семи чудес России. Конкурс организован газетой «Известия», телеканалом «Россия» и радиостанцией «Маяк». Выборы семи «чудес страны» происходили через SMS и интернет.\\nКонкурс проходил в три этапа. На первом шёл прием вариантов и голосование по ним. В итоге было отобрано 49 чудес из 7 федеральных округов России. С 1 февраля по 1 мая 2008 года прошёл второй этап, в результате которого были отобраны 14 финалистов конкурса. С 1 мая по 10 июня прошёл суперфинал, в котором тайным голосованием были выбраны 7 чудес России. 12 июня 2008 года, в день России, на Красной площади были объявлены победители конкурса.\\n30 мая 2007 года Российский союз туриндустрии совместно с петербургским журналом «Всемирный следопыт» объявили аналогичную акцию — «Семь чудес России». Для голосования было предложено 100 достопримечательностей, составленного «Всемирным следопытом». Было получено и обработано более 20 тысяч голосов в рамках первого этапа. В результате их подсчета 7 июля 2007 года определился 21 лидер. Далее проводился второй этап."},{"page_url":"https://fi.wikipedia.org/wiki/Bernard_Feringa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/FeringaWiki.jpg","page_title":"Bernard Feringa","context_page_description":"Bernard L. Feringa on alankomaalainen orgaaninen kemisti. Feringa on tutkinut erityisesti supramolekulaarista kemiaa ja nanotekniikkaa. Hänelle myönnettiin Nobelin kemianpalkinto vuonna 2016 yhdessä Jean-Pierre Sauvagen ja Fraser Stoddartin kanssa molekyylimoottorien synteesistä ja suunnittelusta.\\nFeringan tutkimuskohteena ovat olleet erityisesti kontrolloidut akselin ympäri pyörivät molekyylit, niin kutsutut nanomoottorit. Ensimmäiset tällaiset molekyylit Feringa ryhmineen syntetisoi vuonna 1999 ja molekyylin pyöriminen perustui aromaattisten ja alifaattisten kaksoissidosten valon ja lämmön aikaansaamiin isomeroitumisiin. Sittemmin Feringa ryhmineen on julkaissut molekyylimoottoreita, jotka toimivat kultapinnalla ja molekyylejä, joiden pyörimisen saa aikaan kemiallinen reaktio. Feringa toimii professorina Groningenin yliopistossa ja hänen tutkimusryhmänsä tutkimuskohteita ovat muun muassa molekulaarinen nanotiede, asymmetrinen katalyysi, biokatalyysi ja biohybridisysteemit."},{"page_url":"https://ca.wikipedia.org/wiki/Abellera_de_muntanya_grossa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Anacamptis_morio_hampe.jpg","page_title":"Abellera de muntanya grossa","context_page_description":"L'abellera de muntanya grossa és una espècie d'orquídies inclosa en el gènere Anacamptis de la subfamilia Orchidoideae, de la família Orchidaceae. Es distribueixen per l'Europa mediterrània, i nord-oest d'Àfrica. Són d'hàbits terrestres i tenen tubercles."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BC%D0%B0%D1%80%D0%B0%D0%B3%D0%B4%D0%BE%D0%B2%D0%B0_%D0%BC%D0%B5%D1%80%D0%B5%D0%B6%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D0%9F%D1%80%D0%B8%D0%BA%D0%BB%D0%B0%D0%B4_%D0%BD%D0%B8%D0%B7%D1%8C%D0%BA%D0%BE%D1%97_%D1%8F%D0%BA%D0%BE%D1%81%D1%82%D1%96_%D1%80%D0%BE%D0%B7%D1%80%D0%BE%D0%B1%D0%BA%D0%B8_%D0%A1%D0%BC%D0%B0%D1%80%D0%B0%D0%B3%D0%B4%D0%BE%D0%B2%D0%BE%D1%97_%D0%BC%D0%B5%D1%80%D0%B5%D0%B6%D1%96.jpg","page_title":"Смарагдова мережа України","context_page_description":"Смарагдова мережа України — українська частина Смарагдової мережі Європи, розробляється з 2009 року.\\nМережа Емеральд – це мережа, що включає Території Особливого Природоохоронного Інтересу. Мережа Емеральд проектується в державах, які є сторонами Бернської конвенції, у країнах Європейського Союзу на виконання Бернської конвенції створюється мережа «Натура 2000», яка проектується за аналогічними принципами, що і мережа Емеральд, але використовує юридичні і фінансові інструменти ЄС.\\nПровідною організацією, яка відповідає за розбудову даної мережі, є Міністерство екології та природних ресурсів України. Розробником першої черги Мережі була благодійна організація «Інтерекоцентр». У період 2017-2019 років проектуванням Смарагдової мережі займається громадська організзація \\"Українська природоохоронна група\\". Під час засідання Постійного комітету Конвенції 44-5 грудня 2019 року нові 106 територій були додані до складу мережі. Повний список їх всіх розміщений із вказаною нумерацією на сайті конвенції."},{"page_url":"https://en.wikipedia.org/wiki/Buin,_Papua_New_Guinea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/A_United_Church_village_choir_in_Siwai.jpg","page_title":"Buin, Papua New Guinea","context_page_description":"Buin is a town on Bougainville Island, and the capital of the South Bougainville District, in the Autonomous Region of Bougainville, in eastern Papua New Guinea. The island is in the northern Solomon Islands Archipelago of the Melanesia region, in the South Pacific Ocean.\\nIt is a government-established town in the jungle, now inland from the coast, where its sea-landing predecessor of the same name was located. The town is in an autonomous region of Papua New Guinea established in 2000, and was the former North Solomons Province."},{"page_url":"https://nl.wikipedia.org/wiki/Huisboktor","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Hylotrupes_bajulus_%28huisboktor%29_%281%29.jpg","page_title":"Huisboktor","context_page_description":"De huisboktor is een kever uit de familie boktorren."},{"page_url":"https://sv.wikipedia.org/wiki/Bandhagen_(tunnelbanestation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bandhagen_20180527_083807.jpg","page_title":"Bandhagen (tunnelbanestation)","context_page_description":"Bandhagen är en station inom Stockholms tunnelbana, Gröna linjen. Den ligger i stadsdelen Bandhagen i Söderort inom Stockholms kommun. Stationen ligger mellan stationerna Stureby och Högdalen. Avståndet till Slussen är 6,5 kilometer. Den öppnades den 22 november 1954 och ritades av Magnus Ahlgren."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E6%9C%AC%E7%A5%A5%E5%90%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Shokichi_Yamamoto_at_the_Imperial_Fisheries_Experimental_Station.png","page_title":"山本祥吉","context_page_description":"山本 祥吉は日本の調味学者。農林省水産講習所教授、水産試験場技師、南興水産取締役、東海大学教授、東京水産大学講師。鰹節の研究を専門とし、味の素等の商品開発や南洋群島での水産事業に関わった。"},{"page_url":"https://en.wikipedia.org/wiki/1995_Colorado_State_Rams_football_team","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Colorado_State_Script_Logo.png","page_title":"1995 Colorado State Rams football team","context_page_description":"The 1995 Colorado State Rams football team represented Colorado State University in the 1995 NCAA Division I-A football season. The Rams were led by third-year head coach Sonny Lubick and played their home games at Hughes Stadium in Fort Collins, Colorado. They competed as members of the Western Athletic Conference, finishing in a four-way tie for first with Air Force, BYU, and Utah. It was Colorado State's second consecutive conference title. The Rams were invited to the 1995 Holiday Bowl, where they were defeated by Kansas State."},{"page_url":"https://la.wikipedia.org/wiki/Guillaucourt","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Map_commune_FR_insee_code_80400.png","page_title":"Guillaucourt","context_page_description":"Guillaucourt est commune Francicum 385 incolarum praefecturae Samara in provincia Picardia."},{"page_url":"https://sco.wikipedia.org/wiki/Amanda_Sandrelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Amanda_Sandrelli.jpg","page_title":"Amanda Sandrelli","context_page_description":"Amanda Sandrelli is a Italian actress.\\nBorn in Lausanne, she is the dochter o sangster Gino Paoli an actress Stefania Sandrelli. She debuted in L'Attenzione, frae director Giovanni Soldati, in 1984.\\nHer sons' names are Rocco an Francisco.\\nHer faither is Italian sangster Gino Paoli. She haes a hauf-brither, Vito, born on 21 Mey 1973 tae her mither Stefania Sandrelli an Italian entrepreneur Nicky Pende."},{"page_url":"https://eo.wikipedia.org/wiki/Francisko_Patriko","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Aristotle_Altemps_Inv8575.jpg","page_title":"Francisko Patriko","context_page_description":"Francesco Patrizi da Cherso aŭ Franciscus Patricius estis filozofo, humanisto, poeto, beletristo, geometro, helenisto, li estas konata kiel arda defendanto de la platonismo, kaj oponanto de la aristotelismo. Laŭ la historio, lia familio vivis en la regno de Bosnio kaj ili estas devigataj fuĝi pro la falo de la bosnia regno post la otomana invado."},{"page_url":"https://sh.wikipedia.org/wiki/1-Amino-3-fenilindol","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/1-Amino-3-phenylindole.png","page_title":"1-Amino-3-fenilindol","context_page_description":"1-Amino-3-fenilindol je organsko jedinjenje, koje sadrži 14 atoma ugljenika i ima molekulsku masu od 208,258 Da."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%9A_%D0%9F%D0%B0%D0%BB%D0%B8%D0%BB%D1%83%D0%BB%D0%B0%D1%86_%D0%91%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/sr/f/fe/Amaterska_reprezentacija_Beograda_18.X.1966.jpg","page_title":"ФК Палилулац Београд","context_page_description":"Палилулац је фудбалски клуб из Београда основан у недељу 15. јуна 1924. године. Сениорска екипа је привремено неактивна од сезоне 2014/15. године,\\nдок су млађе категорије клуба и даље активне и такмиче се у оквиру Фудбалског савеза Београда.\\nЗа сезону 2019/20. клуб је активирао први тим који се такмичи у Међуоппштинској лиги Београд.\\nНавијачка група се зове „Зелени шкорпиони”.\\nАдреса клуба: Јовице Васиљевића бб, Крњача"},{"page_url":"https://eu.wikipedia.org/wiki/Ardea_cocoi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Cocoi_Heron_Ardea_cocoi_Pantanal_2009.jpg","page_title":"Ardea cocoi","context_page_description":"Ardea cocoi Ardea generoko animalia da. Hegaztien barruko Ardeidae familian sailkatua dago."},{"page_url":"https://en.wikipedia.org/wiki/Belgian_Armed_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Belgian_dogs_trained_to_draw_quick-firing_guns.JPG","page_title":"Belgian Armed Forces","context_page_description":"The Belgian Defense Forces is the national military of Belgium. The King of the Belgians is the commander-in-chief of the Armed Forces. The Belgian Armed Forces was established after Belgium became independent in October 1830. Since that time Belgian armed forces have fought in World War I, World War II, the Cold War, Kosovo, Somalia and Afghanistan. The Paracommando Brigade intervened several times in Central-Africa, for maintaining public order and evacuation of Belgian citizens. The Armed Forces comprise four branches: the Land Component, the Air Component, the Marine Component and the Medical Component."},{"page_url":"https://it.wikipedia.org/wiki/Myricaceae","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Comptonia_peregrina_BotGardBln1105HabitusFall.JPG","page_title":"Myricaceae","context_page_description":"Le Myricaceae Rich. ex Kunth, 1817 sono una famiglia di piante dell'ordine Fagales.\\nQuesta famiglia comprende cinque generi, per un totale di 53 specie.\\nLe specie di questa famiglia sono presenti in quasi tutto il mondo ad eccezione dell'Australia."},{"page_url":"https://en.wikipedia.org/wiki/Marcel_Dionne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Marcel_Dionne_1987_%282%29.JPG","page_title":"Marcel Dionne","context_page_description":"Marcel Elphège \\"Little Beaver\\" Dionne is a Canadian retired professional ice hockey centre who played 18 seasons in the National Hockey League for the Detroit Red Wings, Los Angeles Kings and New York Rangers. Marcel Dionne was inducted into the Hockey Hall of Fame in 1992. In 2017 Dionne was named one of the '100 Greatest NHL Players' in history."},{"page_url":"https://fr.wikipedia.org/wiki/Bataillon_de_marins-pompiers_de_Marseille","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Pompier13.JPG","page_title":"Bataillon de marins-pompiers de Marseille","context_page_description":"Le bataillon de marins-pompiers de Marseille, familièrement appelé le Bataillon, est une unité de la Marine nationale française qui constitue le corps militaire des pompiers de Marseille, dans le département des Bouches-du-Rhône. Le BMPM ne dépend pas du service départemental d'incendie et de secours des Bouches-du-Rhône.\\nLe BMPM possède les mêmes prérogatives qu'un SDIS pour la ville de Marseille. De ce fait, les Bouches du Rhône sont protégés par deux SDIS. Le « Bataillon » qui protège la ville de Marseille et le SDIS 13, le reste du département.\\nIl a pour rôle d'assurer les missions typiques des sapeurs-pompiers, comme n'importe quel autre service d'incendie et de secours français. Toutefois, le BMPM se distingue de la plupart des unités de pompiers du fait de son statut militaire, ce qui est aussi le cas de la brigade de sapeurs-pompiers de Paris, des unités d'instruction et d'intervention de la sécurité civile, des pompiers de l'air et des marins-pompiers des bases navales et des bases de l'aviation navale.\\nLe BMPM a été créé par décret-loi du 29 juillet 1939, à la suite de l'incendie des Nouvelles Galeries à Marseille."},{"page_url":"https://hu.wikipedia.org/wiki/Abilene_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Flag_of_Abilene%2C_Texas.PNG","page_title":"Abilene (Texas)","context_page_description":"Abilene város az USA Texas államában. Lakosainak száma 117 063 fő. +/-"},{"page_url":"https://fr.wikipedia.org/wiki/Bardehlas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/M113_armored_personnel_carriers%2C_Israeli_Defence_Forces_-_2005.jpg","page_title":"Bardehlas","context_page_description":"Le Bardehlas est un M113 blindé standard destiné au transport de troupe de l'armée israélienne.\\nConçu au début des années 1960 pour l'armée américaine, le M113 était révolutionnaire pour l'époque car il permettait de transporter un groupe de soldats sur le champ de bataille en leur offrant une protection complète contre les tirs d'armes légères et les éclats.\\nLéger, simple, mobile et assez bien protégé, le M-113 a été acheté en grand nombre par Israël à partir de 1972. Il a servi de base à un grand nombre de véhicules dérivés."},{"page_url":"https://de.wikipedia.org/wiki/Reichskanzler_Adolf_Hitler_(Briefmarkenserie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/OsterreichHitlerGraz1945.jpg","page_title":"Reichskanzler Adolf Hitler (Briefmarkenserie)","context_page_description":"Reichskanzler Adolf Hitler war eine Briefmarkendauerserie. Sie wurde von der Deutschen Reichspost ab dem 1. August 1941 zunächst mit den Pfennig-Werten herausgegeben und 1944 durch einen im aufwändigen Stichtiefdruckverfahren und mit der Inschrift „GROSSDEUTSCHES REICH“ ausgeführten 42-Pf-Wert ergänzt.\\nBereits 1942 war bei zwei Werten das Druckverfahren geändert worden, um kriegsbedingt die Druckkosten zu reduzieren. Im selben Jahr kamen die vier Werte mit Nominalen von 1 bis 5 RM an die Schalter, bei diesen wurde dann 1944 die Zähnung verändert.\\nDiese Dauerserie war bis zur Kapitulation 1945 gültig. Während des Zweiten Weltkriegs gab es die Marken auch mit den jeweiligen Aufdrucken in den besetzten Gebieten. Neben der Dauerserie Hindenburg-Medaillon, die bereits seit 1932 gültig war, bot die Serie fast die einzige Möglichkeit, Postsendungen zum reinen Portowert zu versenden. Sondermarken wurden zwischenzeitlich nur noch als Zuschlagmarken mit einem erheblichen Aufschlag herausgegeben.\\nDie Marke diente den britischen und US-amerikanischen Streitkräften und deren Geheimdiensten als Vorlage für Propagandafälschungen."},{"page_url":"https://en.wikipedia.org/wiki/%C5%9Eehzade_Mehmed_Selim","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mehmet_selim_efendi.jpg","page_title":"Şehzade Mehmed Selim","context_page_description":"Şehzade Mehmed Selim was an Ottoman prince, the son of Sultan Abdul Hamid II and his wife Bedrifelek Kadın."},{"page_url":"https://en.wikipedia.org/wiki/The_Vegetable_Market_in_Amsterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Gabriel_Metsu_-_Le_march%C3%A9_aux_herbes_%28detail_market_woman_seated_on_her_wheelbarrow_with_turnips_carrots_and_cabbage%29.jpg","page_title":"The Vegetable Market in Amsterdam","context_page_description":"The Vegetable Market in Amsterdam is an oil on canvas painting by the Dutch painter Gabriël Metsu, it is an example of Dutch Golden Age painting and is part of the collection of the Louvre.\\nHofstede de Groot in 1908 wrote; \\"It is an excellent work, but it is in an exceedingly damaged condition. The trees are not, on the whole, well rendered; it is obvious that Metsu was no landscape painter...\\"\\nSm. says:—\\"This capital picture has had the reputation of being the chef d'œuvre of the master, and the large prices for which it has been sold go far to confirm that opinion. The writer, however, can by no means subscribe to it, for there are several described in this work that possess much higher claims to the admiration of the connoisseur.\\"\\nThe work is 38 and 32.5 inches, on canvas. It was at one point in the collection of King Louis XVI and is now in the Louvre."},{"page_url":"https://cs.wikipedia.org/wiki/Mobi_Urbanov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Mobi_Urbanov%C3%A1_1928.jpg","page_title":"Mobi Urbanová","context_page_description":"Mobi Urbanová, vlastním jménem Emilie Urbanová byla česká, mezinárodně úspěšná neslyšící tanečnice a učitelka tance."},{"page_url":"https://de.wikipedia.org/wiki/Luftschiff","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Bundesarchiv_Bild_102-00715%2C_Friedrichshafen%2C_Zeppelin-Luftschiffhalle.jpg","page_title":"Luftschiff","context_page_description":"Ein Luftschiff ist ein lenkbares Luftfahrzeug, dessen Auftrieb auf aerostatischen Kräften beruht und das über eine eigene Antriebseinheit verfügt. Die Haupteinsatzgebiete heutiger Luftschiffe sind touristische Rundfahrten, Luftwerbung, Überwachungs- und vereinzelt auch Forschungsaufgaben.\\nDie Ära der Luftschifffahrt begann im 19. Jahrhundert und erreichte ihren Höhepunkt in der ersten Hälfte des 20. Jahrhunderts. Luftschiffe sind die Pioniere der zivilen Luftfahrt. Sie waren die Verkehrsmittel der ersten Luftfahrtgesellschaft und auch die ersten Luftfahrzeuge, die Passagiere im Liniendienst ohne Zwischenstopp über den Atlantik beförderten. Die Ära der Großluftschifffahrt begann im Ersten Weltkrieg, um militärischen Leistungsanforderungen nachzukommen. Während des Krieges wurden Luftschiffe mit dem Zweck des Personen- und Gütertransports eingesetzt. Zudem waren sie Langstreckenaufklärer und die einzigen Luftfahrzeuge ihrer Zeit, die eine größere Bombenlast tragen konnten. Später schützten sie Konvois vor feindlichen U-Booten und überwachten den Luftraum."},{"page_url":"https://vi.wikipedia.org/wiki/Sulz_im_Weinviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/AUT_Sulz_im_Weinviertel_COA.png","page_title":"Sulz im Weinviertel","context_page_description":"Sulz im Weinviertel là một thị trấn ở huyện Gänserndorf thuộc bang Niederösterreich nước Áo. Đô thị Sulz im Weinviertel có diện tích 31,37 km², dân số năm 2001 là 1188 người."},{"page_url":"https://en.wikipedia.org/wiki/Marthalen_Landi-Silo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Silo_Marthalen_14082011_1.JPG","page_title":"Marthalen Landi-Silo","context_page_description":"Marthalen Landi-Silo is a 35 metres high silo east of Marthalen in Switzerland. Marthalen Landi-Silo is one of the few buildings with a wind turbine on the roof."},{"page_url":"https://pt.wikipedia.org/wiki/Gravata%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Brasao_gravatai.png","page_title":"Gravataí","context_page_description":"Gravataí é um município brasileiro do estado do Rio Grande do Sul pertencente à microrregião de Porto Alegre e Mesorregião Metropolitana de Porto Alegre, localizando-se a norte da capital do estado, distando desta cerca de 23 km, sendo um dos 32 integrantes da Região Metropolitana de Porto Alegre. Ocupa uma área de 463,758 km², sendo 121,37 km² em perímetro urbano, e sua população foi contada no ano de 2010 em 255 762 habitantes e estimado a 2 em 2017, pelo Instituto Brasileiro de Geografia e Estatística, classificado então como o sexto mais populoso do estado e o terceiro da RMPA.\\nA sede tem uma temperatura média anual de 20,1 °C e na vegetação do município predomina a mata atlântica. Com uma taxa de urbanização da ordem de 91%, o município contava, em 2009, com 71 estabelecimentos de saúde. O seu Índice de Desenvolvimento Humano é de 0,736, considerando elevado se comparado ao país.\\nGravataí foi originalmente fundada em 1763, embora a emancipação oficial tenha vindo somente em 1880. A versão de sua etimologia é a de que o nome seja uma junção entre o nome de uma espécie de Apiácea, gravatá, que existia em abundância na região, e a palavra hy, que na língua guarani significa rio."},{"page_url":"https://de.wikipedia.org/wiki/Courcelles-sur-Viosne","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Courcelles-sur-Viosne_%2895%29%2C_%C3%A9glise_Saint-Lucien%2C_vue_depuis_le_sud-est_1.jpg","page_title":"Courcelles-sur-Viosne","context_page_description":"Courcelles-sur-Viosne ist ein Ort und eine nordfranzösische Gemeinde mit 274 Einwohnern im Département Val-d’Oise in der Region Île-de-France."},{"page_url":"https://it.wikipedia.org/wiki/Barack_Obama","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Obamamiltondavis1.jpg","page_title":"Barack Obama","context_page_description":"Barack Hussein Obama II è un politico statunitense, 44º presidente degli Stati Uniti d'America dal 2009 al 2017, prima persona di origini afroamericane a ricoprire tale carica.\\nFiglio di un'antropologa originaria del Kansas e di un economista keniota, Obama si è laureato in scienze politiche alla Columbia University e in giurisprudenza alla Harvard Law School, dove è stato la prima persona di colore a dirigere la rivista Harvard Law Review. Prima di portare a termine gli studi in legge, ha prestato la sua opera come «community organizer» a Chicago; successivamente ha lavorato come avvocato nel campo della difesa dei diritti civili, insegnando inoltre diritto costituzionale presso la Law School dell'Università di Chicago dal 1992 al 2004.\\nBarack Obama è stato membro del Senato dell'Illinois per tre mandati, dal 1997 al 2004. Dopo essersi candidato senza successo alla Camera dei rappresentanti nel 2000, quattro anni più tardi concorse per il Senato federale, imponendosi a sorpresa nelle primarie del Partito Democratico del marzo 2004 su un folto gruppo di contendenti."},{"page_url":"https://de.wikipedia.org/wiki/Demokratische_Republik_Kongo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Bev%C3%B6lkerungspyramide_DR_Kongo_2016.png","page_title":"Demokratische Republik Kongo","context_page_description":"Die Demokratische Republik Kongo, von 1971 bis 1997 Zaire, auch bekannt als Kongo-Kinshasa oder einfach Kongo, ist eine Republik in Zentralafrika. Sie grenzt an die Zentralafrikanische Republik, den Südsudan, Uganda, Ruanda, Burundi, Tansania, Sambia, Angola, den Atlantik und die Republik Kongo. Die DR Kongo ist an Fläche der zweitgrößte und an Bevölkerung der viertgrößte Staat Afrikas. Das Land wird vom Äquator durchzogen; es herrscht ein tropisches Klima. Große Teile des Staatsgebietes sind von tropischem Regenwald bedeckt.\\nDie etwa 80 Millionen Einwohner lassen sich in mehr als 200 Ethnien einteilen. Es existiert eine große Sprachenvielfalt, die Verkehrssprache ist Französisch. Etwa die Hälfte der Einwohner bekennt sich zur katholischen Kirche, die andere Hälfte verteilt sich auf Kimbanguisten, andere christliche Kirchen, traditionelle Religionen und den Islam. Die Hauptstadt Kinshasa gilt mit über 13 Millionen Einwohnern als drittgrößte Stadt Afrikas. Städte mit über einer Million Einwohnern sind Lubumbashi, Mbuji-Mayi, Mbandaka, Kananga und Kisangani.\\nDas Gebiet des heutigen Staates kam 1885 unter belgische Kolonialherrschaft."},{"page_url":"https://ca.wikipedia.org/wiki/North_American_P-51_Mustang","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/P51-mustang-korea-1.jpg","page_title":"North American P-51 Mustang","context_page_description":"El North American P-51 “Mustang”, va ser un dels darrers caces d'hèlix que van entrar en el conflicte de la Segona Guerra Mundial; era un avió molt ràpid. Era un producte estatunidenc, sol·licitat per la RAF, i també el va fer servir la USAAF tot i axó no va triomfar fins que no va dur el motor anglès Rolls Royce Merlin.\\nVa tenir un destacat paper com a caça de llarg abast, ideal per poder acompanyar els bombarders aliats quan es desplaçaven en grans quantitats sobre territori ocupat per dur a terme les seves operacions de bombardeig, en el que el denominaven “the little friend”. També es pot dir que és un avió del qual s'ha fet una propaganda excel·lent."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Berlin_U-Bahn_stations","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/U-Bahn_Berlin_Gesundbrunnen_Sign.JPG","page_title":"List of Berlin U-Bahn stations","context_page_description":"This is an alphabetical list of Berlin U-Bahn stations. Currently, there are 173 active stations."},{"page_url":"https://de.wikipedia.org/wiki/Erzfarbener_Nadelholz-Prachtk%C3%A4fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Buprestis_haemorrhoidalis_under.jpg","page_title":"Erzfarbener Nadelholz-Prachtkäfer","context_page_description":"Der Erzfarbene Nadelholz-Prachtkäfer ist ein Käfer aus der Familie der Prachtkäfer. In Mitteleuropa ist die Art nur in der Unterart Buprestis haemorrhoidalis haemorrhoidalis vertreten.\\nDer Gattungsname Buprestis ist aus dem Altgriechischen Βουπρέστις bōūprestis übernommen. Der Artname haemorrhoidalis ist ausnahmsweise nicht aus dem Lateinischen, sondern aus dem altgr. αἷμα hāīma „Blut“ und ῥοή rhoē „Fluss“ abgeleitet und nimmt auf die Färbung des Käfers Bezug, die auch in \\"erzfarben\\" beschrieben wird. Der Name Nadelholz-Prachtkäfer bringt die Bindung der Art an Nadelholz zum Ausdruck."},{"page_url":"https://fi.wikipedia.org/wiki/Suomi_1980-luvulla","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/1971rr4.jpg","page_title":"Suomi 1980-luvulla","context_page_description":"Suomessa elettiin 1980-luvulla nousukautta. Asukkaita oli vajaat viisi miljoonaa ja työttömyys oli varsin vähäistä. Suomen kansantalous kasvoi voimakkaasti, mikä synnytti kiinteistö- ja pörssikuplan.\\nSisäpoliittisesti merkittävimpiä tapahtumia oli presidentti Urho Kekkosen eroaminen terveyssyistä presidentin virasta vuonna 1981 ja Mauno Koiviston valitseminen presidentiksi vuonna 1982. Sisäpolitiikassa vallitsi konsensus, ilman suuria poliittisia kiistoja. Suomessa vallitsi vielä 1980-luvulla suomettumisen aika, joka päättyi lopullisesti vasta Neuvostoliiton hajoamiseen vuonna 1991. Suomen ja Neuvostoliiton välisen YYA-sopimuksen voimassaoloa pidennettiin 20 vuodella vuonna 1983. Samalla kuitenkin jo lähennyttiin Eurooppaa: vuonna 1981 Suomessa otettiin muun Euroopan tyyliin käyttöön kesäaika ja vuonna 1989 Suomesta tuli Euroopan neuvoston jäsen. Vuodesta 1961 Euroopan vapaakauppajärjestön liitännäisjäsenenä ollut Suomi liittyi järjestön täysjäseneksi vuonna 1986.\\n1980-luku muistetaan myös useista erilaisista suomirock-yhtyeistä, joiden hitit soivat yhä tiuhaan radiossa. Televisiossa esitettiin 1980-luvulla etenkin monenlaisia sketsi- ja draamasarjoja."},{"page_url":"https://de.wikipedia.org/wiki/St._Louis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/St_Louis_night_expblend.jpg","page_title":"St. Louis","context_page_description":"St. Louis ist eine Stadt im US-Bundesstaat Missouri am westlichen Ufer des Mississippi. Sie hat 319.294 Einwohner.\\nIn der Stadt befinden sich einige bedeutende Hochschulen wie die Washington University, die Saint Louis University und die University of Missouri-St. Louis. Die Stadt war früher ein großer Eisenbahnknoten; der Personenverkehr spielt heute allerdings keine Rolle mehr. In East St. Louis liegen am östlichen Mississippi-Ufer im Bundesstaat Illinois zwei Rangierbahnhöfe.\\nSaint Louis trägt auch die Spitznamen The Gateway City und Mound City sowie die durch den einheimischen Rapper Nelly bekannt gewordenen Szenebezeichnungen The Lou und Nellyville.\\n2006 führte St. Louis die Liste der gefährlichsten Städte der Vereinigten Staaten an, weil man nur die Zahlen für die Innenstadt und nicht auch die Zahlen für die gesamte Metro Area berücksichtigt hatte. Von 2014 bis 2016 führte St. Louis erneut die Liste der Städte mit den meisten Tötungsdelikten in den USA an. Im weltweiten Vergleich liegt St. Louis damit auf Platz 15. In der Statistik waren noch Baltimore, Detroit und New Orleans als gefährlichste Städte der Vereinigten Staaten angegeben.\\nIn der Metropolregion Greater St."},{"page_url":"https://sv.wikipedia.org/wiki/Magasin_f%C3%B6r_konst,_nyheter_och_moder","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Magasin_f%C3%B6r_konst%2C_nyheter_och_moder_1833%2C_illustration_nr_20.jpg","page_title":"Magasin för konst, nyheter och moder","context_page_description":"Magasin för konst, nyheter och moder gavs ut mellan 1823 och 1844 och var Sveriges första modetidning. Det var en uppföljare till Konst- och Nyhets Magasin för medborgare af alla klasser som utgivits 1818–1822."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9C%D7%9B%D7%99_%D7%A6%D7%A8%D7%A4%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Napoleon_crop.jpg","page_title":"מלכי צרפת","context_page_description":"מלכים שלטו בצרפת מאז ימי הביניים עד שנת 1870. ישנה אי הסכמה בין היסטוריונים לגבי הקמתה של ממלכת צרפת, אך התאריך המוקדם ביותר המקובל הוא ייסוד הממלכה הפרנקית בשטחי גאליה הרומאית על ידי המלך כלוביס הראשון בשנת 486. מלכי האימפריה הפרנקית הודחו במאה ה-8, ובשנת 843 חוזה ורדן סימן את ייסודה של ממלכת פרנקיה המערבית, ממנה תתפתח ישירות ממלכת צרפת המודרנית. התואר \\"מלך הפרנקים\\" נשאר בשימוש עד לתקופת שלטונו של פיליפ הרביעי, בשנים 1340-1360 ו-1369-1801 מלכי אנגליה טענו לכתר הצרפתי והכריזו על עצמם כמלכי צרפת. תביעות אלו קיבלו תוקף לזמן קצר כאשר בשנת 1420, במהלך מלחמת מאה השנים, המלך שארל השישי הכיר בחתנו הנרי החמישי, מלך אנגליה כיורשו. עד שנת 1453 האנגלים גורשו כמעט לגמרי מצרפת, אך המלכים האנגליים המשיכו לטעון לתואר \\"מלך צרפת\\" עד לייסודה של הממלכה המאוחדת בשנת 1801."},{"page_url":"https://az.wikipedia.org/wiki/Xarici_dair%C9%99vi_pardaqlama_d%C9%99zgah%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Grinding_operations.svg","page_title":"Xarici dairəvi pardaqlama dəzgahı","context_page_description":"Xarici dairəvi pardaqlama dəzgahı maşın hissələrinin silindrik xarici səthlərinin təmiz emalında istifadə olunur."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A3%85%E6%AD%BB%E6%8A%97%E8%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Die_In.jpg","page_title":"装死抗议","context_page_description":"裝死抗議，有時也叫做躺倒抗議，是指抗議者通過模擬自己已死進行的一種抗議方式。裝死抗議被廣泛用於各類抗議之中，如爭取動物權利的抗議，反戰抗議，有關人權的抗議，有關愛滋病的抗議，有關槍枝管制的抗議，以及有關環境問題的抗議之中。抗議者經常用這種方式佔領一片地區並避免被執法機關趕走。\\n示威者躺倒在地上裝死被認為是裝死抗議的最簡單形式，稍複雜一點的形式則包括用國旗或者標誌蓋在自己身上。裝死抗議的目的在於阻塞人行道上的人流，以吸引路人注意。\\n更複雜的形式中包括用假血和有血的繃帶覆蓋自己的身體，以模擬死亡時的情形；示威者為了逼真甚至會在地上打滾以模擬死亡時的劇痛。有時，示威者會在身體的周圍用粉筆描出輪廓模擬粉筆輪廓以示自己「已死」。"},{"page_url":"https://it.wikipedia.org/wiki/Antoine_V_de_Gramont","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Undated_portrait_of_Antoine_de_Gramont%2C_Duke_of_Gramont_by_an_unknown_artist.jpg","page_title":"Antoine V de Gramont","context_page_description":"Antoine V de Gramont fu duca di Guiche e Maresciallo di Francia."},{"page_url":"https://id.wikipedia.org/wiki/Falur_Rate_Laek","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/2020-03-03_Falur_Rate_Laek.jpg","page_title":"Falur Rate Laek","context_page_description":"Brigadir Jenderal FDTL Falur Rate Laek adalah Wakil Panglima F-FDTL yang menjabat sejak 1 Oktober 2018."},{"page_url":"https://de.wikipedia.org/wiki/Guardia_Civil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Gcivil23h.png","page_title":"Guardia Civil","context_page_description":"Die Guardia Civil ist eine spanische Polizeieinheit mit mehr als 80.000 Angehörigen. Sie nimmt sowohl militärische als auch zivile Funktionen wahr. Aufgrund ihrer doppelten Rolle untersteht die Guardia Civil sowohl der Befehlsgewalt des Ministeriums des Inneren als auch des Verteidigungsministeriums.\\nAm ehesten kann man die Guardia Civil mit der französischen Gendarmerie und den italienischen Carabinieri vergleichen. Andere Polizeien in Spanien sind das Cuerpo Nacional de Policía, Policía Local bzw. Guardia Urbana sowie eine eigene Polizei in den autonomen Regionen Katalonien, Navarra und Baskenland. Der Wahlspruch der Guardia Civil ist El honor es mi divisa."},{"page_url":"https://en.wikipedia.org/wiki/Structure_of_the_Italian_Army_in_1984","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/CoA_mil_ITA_btg_logistico_divisione_centauro.png","page_title":"Structure of the Italian Army in 1984","context_page_description":"On March 1, 1984 the Italian Institute for Disarmament, Development and Peace down to company level - this was justified for the radical party as one of its core demands was total disarmament of Europe, even though the data which was published was top secret. The Radical Party dissolved in 1989 (its parliamentarians had passed along the data) and the IRDISP followed suit in 1990. But Radio Radicale has survived, and the OrBat can still be found today on the homepage of the radio.\\nOrBat published by Istituto di ricerche per il disarmo, lo sviluppo e la pace (IRDISP) in Rome on March 1, 1984."},{"page_url":"https://is.wikipedia.org/wiki/Jessica_Biel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Jessica_Biel_Palm_Film_Festival.jpg","page_title":"Jessica Biel","context_page_description":"Jessica Claire Biel er bandarísk leikkona og fyrirsæta sem hefur leikið í fjölmörgum Hollywood-kvikmyndum, meðal annsr Summer Catch, endurgerð The Texas Chainsaw Massacre, The Illusionist, I Now Pronounce You Chuck and Larry og Valentine's Day. Hún er einnig þekkt fyrir hlutverk sitt sem Mary Camden í sjónvarpsþættinum 7th Heaven."},{"page_url":"https://en.wikipedia.org/wiki/Herbert_Dr%C3%B6se_Stadion","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Herbert-Dr%C3%B6se-Stadion-Haupttribuene.jpg","page_title":"Herbert Dröse Stadion","context_page_description":"The Herbert Dröse Stadion is an American Football stadium for the Hanau Hornets American football team in Hanau, Germany. It was built in 1951. Capacity of the venue is 16,000. It was used as a venue for the 2003 IFAF World Cup."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%B8%D8%B1%D8%A9_%D8%A7%D9%84%D8%B9%D9%87%D8%AF_%D8%A7%D9%84%D8%AC%D8%AF%D9%8A%D8%AF_%D9%84%D8%AD%D9%8A%D8%A7%D8%A9_%D8%A7%D9%84%D9%85%D8%B3%D9%8A%D8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Icon_03032_Raspyatie_s_predstoyaschimi.jpg","page_title":"نظرة العهد الجديد لحياة المسيح","context_page_description":"نظرة العهد الجديد لحياة المسيح أو حياة يسوع بحسب العهد الجديد وفقاً للعهد جديد فأن: يسوع المسيح ولد في بيت لحم كما توجب أن يولد بحسب ما تنبأ عنه النبي ميخا. تذكر الاناجيل الأربعة: متى، مرقس، لوقا، ويوحنا شهادات حية مما رأوه وتعلموه وكانوا شهودا له لما عمل من أعمال. كانت ولادته معجزية من غير أب، إذ حل الروح القدس على مريم العذراء، فحبلت به، ثم ولدته في بيت لحم، كما جاء في الكتاب المقدس.\\nيؤمن المسيحيون أنه صُلب ومات من أجل دفع ثمن خطايا جميع البشر، كي لا يهلك كل من يؤمن به، بل تكون له الحياة الأبدية. ثم قام من قبره في اليوم الثالث، قاهرا الموت بالموت، كما تنبأ عنه في العهد القديم. ثم ظهر لتلاميذه وبقي معهم أربعين يوماً ومن ثم صعد إلى السماء، وجلس عن يمين الآب وسوف يأتي في اليوم الأخير ليدين الأحياء والأموات وملكه لن يكون له انقضاء."},{"page_url":"https://fr.wikipedia.org/wiki/Jacques_Balmat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/00_Chamonix-Mont-Blanc_-_JPG1.jpg","page_title":"Jacques Balmat","context_page_description":"Jacques Balmat, dit « Balmat du Mont-Blanc » ou « Mont Blanc », né en 1762 dans la vallée de Chamonix dans le village des Pélerins et mort en septembre 1834 dans la vallée de Sixt, était un chasseur de chamois, cristallier et guide qui réussit la première ascension du mont Blanc en compagnie du docteur Paccard, le 8 août 1786."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Georges-du-Vi%C3%A8vre","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Mairie_de_saint_georges_du_vievre.jpg","page_title":"Saint-Georges-du-Vièvre","context_page_description":"Saint-Georges-du-Vièvre es una localidad y comuna francesa situada en la región de Alta Normandía, departamento de Eure, en el distrito de Bernay y cantón de Saint-Georges-du-Vièvre."},{"page_url":"https://it.wikipedia.org/wiki/Magenta_(Italia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/PontevecchioMagentaPonte.jpg","page_title":"Magenta (Italia)","context_page_description":"Magenta è un comune italiano di 24 388 abitanti della città metropolitana di Milano in Lombardia. È capoluogo della zona omogenea del magentino nel territorio metropolitano.\\nNota per essere stata il primo tassello della storia dell'unificazione nazionale, ancora oggi Magenta è ricordata soprattutto per la sua famosa battaglia qui combattuta il 4 giugno 1859."},{"page_url":"https://en.wikipedia.org/wiki/Huntington_Library","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Herb_Garden%2C_Spring_Blooms%2C_Huntington.jpg","page_title":"Huntington Library","context_page_description":"The Huntington Library, Art Museum and Botanical Gardens, known as The Huntington, is a collections-based educational and research institution established by Henry E. Huntington and Arabella Huntington and located in San Marino, California, United States. In addition to the library, the institution houses an extensive art collection with a focus on 18th- and 19th-century European art and 17th- to mid-20th-century American art. The property also includes approximately 120 acres of specialized botanical landscaped gardens, most notably the \\"Japanese Garden\\", the \\"Desert Garden\\", and the \\"Chinese Garden\\". On September 5, 2019, The Huntington kicked off a year-long celebration of its centennial year with exhibitions, special programs, initiatives, a special Huntington 100th rose, and a float in the 2020 Rose Parade in nearby Pasadena, CA."},{"page_url":"https://en.wikipedia.org/wiki/Winchester_Model_54","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Winchester_Model_54_Charles_Lindbergh_SI_AaS.jpg","page_title":"Winchester Model 54","context_page_description":"The Winchester Model 54 is a bolt-action rifle manufactured by the Winchester Repeating Arms Company. The 54 was the first successful production run civilian centerfire bolt action for Winchester.\\nUsing a Mauser 98-type action, the 54 was a less-expensive derivation of the limited-production handmade Model 51 \\"Imperial\\" of 1919. The Model 54 was produced until 1936 when, with some modifications, it was reintroduced as the Winchester Model 70. The Model 54 had a relatively heavy two stage trigger pull, which was greatly improved in the Model 70.\\nStandard chamberings included the .22 Hornet, .220 Swift, .250-3000 Savage, .257 Roberts, .270 Winchester, 30-30 Winchester, .30-06 Springfield, 7x57mm Mauser, 7.65x53mm Argentine, and 9x57mm Mauser. Special order chamberings were made in .25-35 Winchester, .32 Winchester Special, and .35 Whelen.\\nIntroduced prior to the popularity of telescopic sights, it was intended for use with open or aperture sights, and the bolt throw makes the addition of a scope difficult."},{"page_url":"https://it.wikipedia.org/wiki/Amatori_Wasken_Lodi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/PalaCastellotti_esterno.jpg","page_title":"Amatori Wasken Lodi","context_page_description":"L'Amatori Wasken Lodi, meglio noto come Amatori Lodi, è una società italiana di hockey su pista con sede a Lodi. I suoi colori sociali, ispirati allo stemma cittadino, sono il giallo e il rosso.\\nCostituito nel 1965, il club sospese l'attività nel 1996 e venne rifondato tre anni più tardi da un nuovo sodalizio che – pur non avendo legami formali con la vecchia compagine societaria – ne raccolse di fatto l'eredità, rilevandone il settore giovanile e adottandone la denominazione. Nel 2014 l'associazione confluì nella polisportiva lodigiana Club Wasken Boys, nata nel 1952; al nome della squadra fu aggiunta pertanto la parola «Wasken», alterazione del termine dialettale «vàsco», traducibile come «forte», «abile», «sagace».\\nSeppur tra alterne vicende, la formazione giallorossa è stata a lungo protagonista dell'hockey nazionale, aggiudicandosi tre scudetti nonché tre Coppe Italia, due Supercoppe e una Coppa di Lega; a livello europeo ha conquistato una Coppa CERS e una Coppa delle Coppe, disputando nel complesso sette finali di coppa e diventando l'unica squadra italiana ad aver raggiunto l'atto conclusivo di ciascuna delle quattro maggiori competizioni continentali per club."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%96%D0%BD%D0%BA%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Fachwerkkirche_Dammwolde_%282%29.jpg","page_title":"Фінкен","context_page_description":"Фінкен — громада в Німеччині, розташована в землі Мекленбург-Передня Померанія. Входить до складу району Мекленбургіше-Зенплатте. Складова частина об'єднання громад Ребель-Мюріц.\\nПлоща — 34,86 км². Населення становить 505 ос."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B2%E0%A4%BF%E0%A4%A8%E0%A4%B8_%E0%A4%AA%E0%A4%BE%E0%A4%89%E0%A4%B2%E0%A4%BF%E0%A4%99%E0%A5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/L_Pauling.jpg","page_title":"लिनस पाउलिङ्","context_page_description":"लिनुस कार्ल पाउलिङ एक अम्रीकी रसायनज्ञ, बायोकेमीज्ञानी, शांति कार्यकर्ता, लेखक और शिक्षक थे। उन्होने १२०० से ज्यादा सामग्री और पुस्तकें प्रकाशित कियें है। उन्में से लगभग ८५० वैज्ञानिक विषयों थे। \\"न्यू सयिन्टिस्ट\\" पत्रिका उन्को सर्वकाल की महानतम वैज्ञानिकों में एक कहतें है। आज की युग में पाउलिङ को इतिहास के 16 वीं सबसे महत्वपूर्ण वैज्ञानिक का स्तान दिया गया है। पाउलिङ क्वांटम रसायन विज्ञान और आणविक जीव विज्ञान के स्ंस्थापक थे। उन्की वैज्ञानिक कामों के लिये उन्को सन १९५४ में नोबेल पुरस्कार मिली। सन १९६२ में उन्को शान्ती का नोबेल पुरस्कार भी मिली। इससे वे दो अविभाजित नोबेल पुरस्कारों दिया हुआ इकलौता आदमी हो गया। डीएनए की संरचना पर भी पाउलिङ ने अनुसंधान किये थे।"},{"page_url":"https://lt.wikipedia.org/wiki/Pakuonis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Pakuonis._Sod%C5%B3_g.JPG","page_title":"Pakuonis","context_page_description":"Pakuonis – miestelis Prienų rajono šiaurinėje dalyje, netoli Nemuno. Seniūnijos centras, 2 seniūnaitijos.\\nYra Švč. Mergelės Marijos Ėmimo Dangun bažnyčia, kraštotyros muziejus, pagrindinė mokykla, biblioteka, paštas. Pro miestelį teka Kuonės upė.\\nPrie miestelio yra Pakuonio kaimas."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_C%C3%B4tes-d%27Armor_(A-O)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Lanrivain_%2822%29_Croix_du_XVIII%C3%A8me_02.JPG","page_title":"Liste des monuments historiques des Côtes-d'Armor (A-O)","context_page_description":"Cet article recense une partie des monuments historiques des Côtes-d'Armor, en France."},{"page_url":"https://en.wikipedia.org/wiki/Anatolian_Shepherd","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Varish.jpg","page_title":"Anatolian Shepherd","context_page_description":"The Anatolian Shepherd or Anadolu çoban köpeği is a dog breed that originated in the peninsula of Anatolia which forms a large portion of Turkey's national territory. The dog is rugged, large, and very strong, with good sight and hearing that allow it to protect livestock. With its high speed and agility, it is able to run down a predator with great efficiency. Historically, it has been treated as a separate breed from the Kangal Shepherd Dog by many canine registries, but is now generally treated as part of the same breed population."},{"page_url":"https://lt.wikipedia.org/wiki/Zvoleno_apskritis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Mazowsze_Zwole%C5%84ski.png","page_title":"Zvoleno apskritis","context_page_description":"Zvoleno apskritis – apskritis šiaurės rytų Lenkijoje, Mazovijos vaivadijoje. Apskrities centras įsikūręs Zvoleno mieste. Apskritis šiaurėje ribojasi su Kozenicės apskritimi, rytuose su Pulavų, pietryčiuose su Liublino Opolės, pietuose su Lipsko ir vakaruose su Radomo apskritimi. Apskrityje yra 5 valsčiai."},{"page_url":"https://pl.wikipedia.org/wiki/Herakles","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Antonio_del_Pollaiolo_-_Ercole_e_l%27Idra_e_Ercole_e_Anteo_-_Google_Art_Project.jpg","page_title":"Herakles","context_page_description":"Herakles, Alkides, Palajmon – w mitologii greckiej jeden z herosów, syn Zeusa i śmiertelniczki Alkmeny. Jego rzymskim odpowiednikiem był Herkules. Znany był z wielkiej siły, waleczności, męstwa, zapaśnictwa i umiejętności wojennych, zwłaszcza celnego strzelania z łuku. Lubiany przez Zeusa i Atenę, był prześladowany przez zazdrosną Herę.\\nŻonaty z Dejanirą, Megarą i Hebe."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%AA%E0%B8%B1%E0%B8%99%E0%B8%95%E0%B8%95%E0%B8%B4%E0%B8%A7%E0%B8%87%E0%B8%A8%E0%B9%8C%E0%B9%83%E0%B8%99%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%9A%E0%B8%B2%E0%B8%97%E0%B8%AA%E0%B8%A1%E0%B9%80%E0%B8%94%E0%B9%87%E0%B8%88%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%88%E0%B8%B8%E0%B8%A5%E0%B8%88%E0%B8%AD%E0%B8%A1%E0%B9%80%E0%B8%81%E0%B8%A5%E0%B9%89%E0%B8%B2%E0%B9%80%E0%B8%88%E0%B9%89%E0%B8%B2%E0%B8%AD%E0%B8%A2%E0%B8%B9%E0%B9%88%E0%B8%AB%E0%B8%B1%E0%B8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Nabhachara_Chamrassri.jpg","page_title":"พระราชสันตติวงศ์ในพระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว","context_page_description":"ในส่วนนี้จะเป็นรายพระนามพระราชโอรส พระราชธิดา และพระราชนัดดา ในพระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว รัชกาลที่ 5 แห่งราชวงศ์จักรี\\nยังทรงพระชนม์"},{"page_url":"https://cy.wikipedia.org/wiki/Gwybedog_gwenyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Pair_of_Merops_apiaster_feeding.jpg","page_title":"Gwybedog gwenyn","context_page_description":"Aderyn a rhywogaeth o adar yw Gwybedog gwenyn a adnabyddir hefyd gyda'i enw gwyddonol Merops apiaster; yr enw Saesneg arno yw European bee eater. Mae'n perthyn i deulu'r Gwenynysorion sydd yn urdd y Coraciiformes.\\nTalfyrir yr enw Lladin yn aml yn M. apiaster, sef enw'r rhywogaeth."},{"page_url":"https://it.wikipedia.org/wiki/Manfred_(Byron)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/John_Martin_-_Manfred_on_the_Jungfrau_%281837%29.jpg","page_title":"Manfred (Byron)","context_page_description":"Manfred: A dramatic poem, in Italia noto coi titoli Manfredi o Manfredo, è un closet drama in tre atti scritto da Lord Byron alla fine del 1816 e pubblicato nel 1817. L'autore lo definì un \\"poema metafisico\\"."},{"page_url":"https://de.wikipedia.org/wiki/Nostra_Signora_di_Cabu_Abbas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Torralba%2C_chiesa_di_Nostra_Signora_di_Cabu_Abbas_%2815%29.jpg","page_title":"Nostra Signora di Cabu Abbas","context_page_description":"Die Kirche Nostra Signora di Cabu Abbas befindet sich etwa 500 m westlich der Nuraghe Santu Antine in der Provinz Sassari auf Sardinien. Die im 12./13. Jahrhundert erbaute einschiffige Kirche stand im Zentrum eines mittlerweile verschwundenen Dorfes. Eine gleichnamige Kirche liegt bei Olbia.\\nDas im romanisch-pisanischen Stil errichtete Bauwerk besteht außen aus weißen, mit schwarzem Trachyt durchsetzten Kalksteinquadern und innen aus Trachytstein. Sie hat eine nach Südosten gerichtete Apsis. Ein Apsisabteil entlang der Nordseite, ein einziges Kreuzgewölbe, wird von Spitzbögen und einem Portal mit Bogen getragen. An der Außenfassade befindet sich eine schwer zu interpretierende anthropomorphe Skulptur. Sie soll eine heidnische Gottheit darstellen. Die Kirche wurde 1971 restauriert."},{"page_url":"https://ca.wikipedia.org/wiki/Cordignano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Cordignano.jpg","page_title":"Cordignano","context_page_description":"Cordignano és un municipi italià, dins de la província de Treviso. L'any 2007 tenia 6.888 habitants. Limita amb els municipis de Caneva, Cappella Maggiore, Colle Umberto, Fregona, Gaiarine, Godega di Sant'Urbano, Orsago, Sacile i Sarmede"},{"page_url":"https://be.wikipedia.org/wiki/Zygophyllum","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Morsana2.JPG","page_title":"Zygophyllum","context_page_description":"Zygophyllum — род раслін сямейства Zygophyllaceae, якія растуць у пустынях Афрыкі, Палестыны, Аравіі, Сярэдняй і Цэнтральнай Азіі, Аўстраліі.\\nЛісце супраціўнае з 2-10 лісточкамі, простае або складанае. Лісточкі плоскія або вальковыя, мясістыя. Прылісткі трявяністыя або перапончатыя.\\nКветкі 4-5-членныя, адзінкавыя або па два, пазухавыя."},{"page_url":"https://es.wikipedia.org/wiki/Muraena","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Il_pasto.jpg","page_title":"Muraena","context_page_description":"Muraena es un género de peces anguiliformes de la familia Muraenidae que contiene varias especies de morenas."},{"page_url":"https://en.wikipedia.org/wiki/Walter_Steins_Bisschop","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Walter_Herman_Jacobus_Steins%2C_Bombay_JS.jpg","page_title":"Walter Steins Bisschop","context_page_description":"Walter Hermanus Jacobus Steins Bisschop SJ was a Dutch Jesuit priest, Vicar Apostolic of Bombay, India, Vicar Apostolic of West Bengal and, third Catholic Bishop of Auckland."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B6%E3%82%A6%E3%82%B9%E3%82%AD%E5%9B%B3%E6%9B%B8%E9%A4%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/DPK1_DSC0038.JPG","page_title":"ザウスキ図書館","context_page_description":"ザウスキ図書館 は、ワルシャワで1747-1795年において、カトリック司教のザウスキ兄弟によって作られた。この図書館はポーランド初の公共図書館で、ポーランドの最大の蔵書であった。\\nコシチュシュコの蜂起後、女帝エカチェリーナ2世の命令を受けたロシア軍隊は、ザウスキ図書館の蔵書を奪い、サンクトペテルブルグにあった女帝の個人蔵書に移動した。翌年、帝国公共図書館の創設時にその蔵書の基底となった。\\n1920年にロシア・ソビエト連邦社会主義共和国の政府がリガ平和条約のおかげで作られた新しいポーランド第二共和国に元ザウスキ図書館の蔵書の一部を返還した。その蔵書は1944年のワルシャワ蜂起失敗後にドイツ軍によるワルシャワの破壊中に意図的に壊された。"},{"page_url":"https://es.wikipedia.org/wiki/Fernando_I_del_Sacro_Imperio_Romano_Germ%C3%A1nico","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Bemberg_Fondation_Toulouse_-_Portrait_paintings_of_Ferdinand_I%2C_Holy_Roman_Emperor_by_Jan_Cornelisz_Vermeyen_Inv.1056.jpg","page_title":"Fernando I del Sacro Imperio Romano Germánico","context_page_description":"Fernando I de Habsburgo fue infante de España, archiduque de Austria, rey de Hungría y Bohemia y, a partir de 1558, emperador del Sacro Imperio Romano Germánico.\\nEra hijo de Felipe el Hermoso y de Juana I de Castilla y, por lo tanto, resultado de la estratégica política matrimonial de su abuelo Maximiliano I de Habsburgo.​ Junto a su hermano mayor Carlos, era el potencial heredero de extensos dominios en Europa Occidental de la casa de Habsburgo, la casa de Borgoña y la casa de Trastámara y de nuevo gracias a la planificación de su abuelo paterno, tuvo la ocasión de aspirar a los reinos de la dinastía Jagellón en Europa Central gracias a su matrimonio con Ana de Bohemia y Hungría.\\nAunque su hermano Carlos fue el heredero de la mayoría de las tierras y títulos de sus padres, la complicación de administrar tan variados territorios y en especial la problemática política imperial en el Sacro Imperio Romano Germánico durante las guerras de religión del siglo XVI y la amenaza turca llevó a Fernando a terminar heredando el núcleo patrimonial Habsburgo en Europa Central."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8E%E3%83%BC%E3%82%B9%E3%82%A6%E3%82%A8%E3%82%B9%E3%83%88%E8%88%AA%E7%A9%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/N623US_%282767167071%29.jpg","page_title":"ノースウエスト航空","context_page_description":"ノースウエスト航空は、かつてアメリカ合衆国ミネソタ州イーガンに本部をおいていた航空会社。デルタ航空と経営統合し、2010年1月31日をもってデルタ航空となった。"},{"page_url":"https://fr.wikipedia.org/wiki/Repr%C3%A9sentations_diplomatiques_d%27Antigua-et-Barbuda","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Diplomatic_missions_of_Antigua_and_Barbuda.png","page_title":"Représentations diplomatiques d'Antigua-et-Barbuda","context_page_description":"Ceci est une liste des représentations diplomatiques d'Antigua-et-Barbuda. Le réseau diplomatique d'Antigua-et-Barbuda ne s'étend à aucun pays voisin des Caraïbes. Le pays compte également des représentants du tourisme et un consulat honoraire dans d'autres pays."},{"page_url":"https://en.wikipedia.org/wiki/Hurst_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Hurst_Castle_%2C_East_Wing_and_Lighthouse_-_geograph.org.uk_-_1721711.jpg","page_title":"Hurst Castle","context_page_description":"Hurst Castle is an artillery fort established by Henry VIII on the Hurst Spit in Hampshire, England, between 1541 and 1544. It formed part of the king's Device Forts coastal protection programme against invasion from France and the Holy Roman Empire, and defended the western entrance to the Solent waterway. The early castle had a central keep and three bastions, and in 1547 was equipped with 26 guns. It was expensive to operate due to its size, but it formed one of the most powerful forts along the coast. During the English Civil War of the 1640s, Hurst was held by Parliament and was used briefly to detain King Charles I before his execution in 1649. It continued in use during the 18th century but fell into disrepair, the spit being frequented by smugglers.\\nRepairs were made during the Revolutionary and Napoleonic Wars with France, and the castle was modernised to enable it to hold 24-pounder guns. Fresh fears of invasion followed in the 1850s, leading to heavier, 32-pounder armament being installed and new gun batteries being laid out on both sides of the castle."},{"page_url":"https://vi.wikipedia.org/wiki/Abegondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Casa_do_Concello_de_Abegondo.jpg","page_title":"Abegondo","context_page_description":"Abegondo là một đô thị của Tây Ban Nha ở tỉnh A Coruña, một cộng đồng tự trị Galicia. Đô thị này có diện tích 83,72 km², dân số 5732 và mật độ dân số 68,47 người/km². Đô thị này cách La Coruña 23 km, cách Madrid 547 km. Mã số bưu chíh là 15318."},{"page_url":"https://fr.wikipedia.org/wiki/Tambour_de_colonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Temple_of_Apollo%2C_Didyma_07.jpg","page_title":"Tambour de colonne","context_page_description":"Un tambour est une assise cylindrique monolithe généralement posé en lit et entrant dans la composition du fût d'une colonne.\\nLa méthode d'extraction des tambours peut être vue dans les carrières de Cusa à Sélinonte. Destinés au temple G, 62 tambours de colonnes inachevés, certains adhérant encore au socle rocheux, d'autres abandonnés durant le transport, restent sur les lieux ; ils nous renseignent sur les méthodes d'extraction, de transport et de construction de l'époque. Pour extraire la roche, les Sélinontins creusaient des rainures sur un tracé circulaire, de 55 centimètres à la base et de 85 cm au sommet, permettant le travail de l'ouvrier. Une dernière rainure était ménagée sous le bloc, dans laquelle étaient insérés des coins métalliques, enfoncés à la masse, qui achevaient de détacher les tambours de la roche. Une fois extraits, les tambours étaient taillés au marteau et au burin, puis sans doute cerclés de roues en bois et tirés par des chars à bœufs.\\nL'inscription d'Éleusis IG II² 1673 relate le transport, vers -330, de tambours de colonnes depuis les carrières du Pentélique jusqu'au prostoon de Philon à Éleusis, dont chacun pesait environ 7,5 tonnes."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%B6%A0%E5%8D%80_(%E5%8D%83%E8%91%89%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Hoki_museum_outside_front_001.jpg","page_title":"綠區 (千葉市)","context_page_description":"绿区是千叶市的6区之一。1992年4月1日千叶市升格为政令指定都市，绿区同时成立。"},{"page_url":"https://ru.wikipedia.org/wiki/Poecilotheria","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Poecilotheria_formosa01.jpg","page_title":"Poecilotheria","context_page_description":"Poecilotheria — род древесных пауков семейства птицеедов. Обитают в Шри-Ланке и Индии. Название Poecilotheria происходит от греческих слов \\"poikilos\\" - пёстрый, пятнистый, разнообразный, и \\"therion\\" - дикий зверь. Другое название рода - \\"украшенный\\", или \\"орнаментный\\", птицеед.\\nВидовой состав\\nТиповой вид: Poecilotheria fasciata\\nСинонимы:\\nPoecilotheria gadgili = Poecilotheria regalis\\nPoecilotheria nallamalaiensis = Poecilotheria formosa\\nPoecilotheria pederseni = Poecilotheria vittata\\nPoecilotheria pococki = Poecilotheria smithi\\nPoecilotheria fasciata — Шри-Ланка\\nPoecilotheria formosa — Индия\\nPoecilotheria hanumavilasumica — Индия\\nPoecilotheria metallica — Индия\\nPoecilotheria miranda — Индия\\nPoecilotheria ornata — Шри-Ланка\\nPoecilotheria rajaei — Шри-Ланка\\nPoecilotheria regalis — Индия\\nPoecilotheria rufilata — Индия\\nPoecilotheria smithi — Шри-Ланка\\nPoecilotheria striata — Индия\\nPoecilotheria subfusca — Шри-Ланка\\nPoecilotheria tigrinawesseli — Индия\\nPoecilotheria vittata — Шри-Ланка"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%AE%E0%A4%B9%E0%A5%87%E0%A4%B6%E0%A5%8D%E0%A4%B5%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Dancer_at_the_entrance.jpg","page_title":"महेश्वर","context_page_description":"महेश्वर हे मध्य प्रदेशातील खरगोन जिल्ह्यातील नर्मदा नदीच्या काठी वसलेले शहर आहे. पुर्वी येथे अहिल्याबाई होळकर यांची राजधानी होती."},{"page_url":"https://pl.wikipedia.org/wiki/Prze%C5%82amanie_linii_Zygfryda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Kleve_-_Royal_Air_Force_1939-1945-_Bomber_Command_C4964.jpg","page_title":"Przełamanie linii Zygfryda","context_page_description":"Przełamanie linii Zygfryda – jedna z najważniejszych kampanii frontu zachodniego II wojny światowej. Trwała od zakończenia bitwy o Normandię, czyli operacji Overlord, do przekroczenia Renu przez siły alianckie, obejmując również niemiecką ofensywę w Ardenach oraz operację Nordwind w Alzacji i Lotaryngii."},{"page_url":"https://ca.wikipedia.org/wiki/Neorom%C3%A0nic","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Igreja_do_Ros%C3%A1rio_-_Largo_do_Pai%C3%A7andu.jpg","page_title":"Neoromànic","context_page_description":"El neoromànic és un estil arquitectònic emmarcat en l'historicisme que va sorgir al segle xix, basat en la reinterpretació de l'art romànic i vigent durant l'edat mitjana europea, entre els segles XI i XIII. Es va estendre primer per tot Europa, des d'on va passar després a Amèrica. Es va utilitzar sobretot en edificis religiosos i va ser comuna en edificis civils, i també va ser emprat en la restauració d'edificis medievals a tot Europa.\\nUna primera variant de l'estil neoromànic coneguda com a Rundbogenstil va ser bastant popular a Alemanya així com entre la diàspora alemanya que va començar en la dècada de 1830. El neoromànic alemany va arribar a tenir l'estatus d'estil nacional per excel·lència, sent molt utilitzat durant la segona meitat del segle xix. A Portugal, van ser re-romanitzats molts vells castells i esglésies a la primera meitat del segle XX. Als Estats Units va ser un dels estils favorits en els edificis públics com ajuntaments i campus universitaris.\\nCom altres estils historicistes, el neoromànic sovint es va reduir a la decoració general dels edificis sense afectar les plantes ni a l'estructura."},{"page_url":"https://es.wikipedia.org/wiki/British_Aerospace_Harrier_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/BAe_Harrier_GR9_ZG502_landing_arp.jpg","page_title":"British Aerospace Harrier II","context_page_description":"El British Aerospace Harrier II es un avión de reacción británico con capacidad de despegues y aterrizajes verticales/cortos de la segunda generación Harrier utilizado por la Real Fuerza Aérea Británica y, entre 2006 y 2010, por la Marina Real. Desarrollado a partir del Hawker Siddeley Harrier, fue producido como Harrier GR.5/GR.7/GR.9 de forma estrechamente relacionada con el McDonnell Douglas AV-8B Harrier II de fabricación estadounidense. Ambos se utilizan principalmente para ataque ligero o tareas polivalentes, y suelen operar desde portaaviones pequeños. El Harrier II fue víctima de una revisión de gastos de defensa del Reino Unido que supuso que todos los aparatos activos fueran retirados de servicio en diciembre de 2010."},{"page_url":"https://de.wikipedia.org/wiki/Weidmanns_Garten","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Weidmanns_Garten_Lage.jpg","page_title":"Weidmanns Garten","context_page_description":"Weidmanns Garten war einer der zahlreichen Barockgärten, die im 18. Jahrhundert Leipzig umgaben. Er gehörte der Leipziger Verlegerfamilie Weidmann."},{"page_url":"https://it.wikipedia.org/wiki/Lithotelestidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nanipora_kamurai.jpg","page_title":"Lithotelestidae","context_page_description":"Lithotelestidae Bayer & Muzik, 1977 è una famiglia di octocoralli dell'ordine Helioporacea."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%82%D0%BE%D0%BA%D0%B8%D1%9B%D0%B0_%D1%98%D0%B0%D1%81%D0%B5%D0%BD_(%D0%A6%D0%B8%D0%BA%D0%BE%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Zapis-0726-Cikot-jasen_20160705_3118.jpg","page_title":"Запис Ђокића јасен (Цикот)","context_page_description":"Запис Ђокића јасен (Цикот) се налази на парцели чији је власник Ђокић Момчило и Младен."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%8B%D1%81%D0%BA_%D0%A1%D0%BA%D0%B0%D1%80%D1%8B%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/1211_%28500-hoddzie_bielaruskaha_knihradrukavannia%29_-_Special_postmark.png","page_title":"Францыск Скарына","context_page_description":"Францы́ск Скары́на, Франці́шак Скары́на — беларускі і ўсходнеславянскі першадрукар, асветнік-гуманіст, пісьменнік, грамадскі дзеяч, прадпрымальнік, вучоны-медык. Перакладчык і выдавец на беларускі ізвод царкоўнаславянскай мовы кніг Бібліі.\\nСкарына нарадзіўся ў сям'і заможнага купца ў Полацку, буйным гандлёвым і вытворчым цэнтры Вялікага Княства Літоўскага, імаверна атрымаўшы там першапачатковую адукацыю. У 1504 годзе паступае ў Кракаўскую акадэмію, дзе атрымлівае ступень бакалаўра, у 1512 годзе ў Падуанскім універсітэце Скарына атрымае ступень доктара медыцыны. Пераехаўшы ў Прагу менавіта тут, 6 жніўня 1517 года Скарына выдае першую друкаваную беларускую кнігу — «Псалтыр».\\nФранцыск Скарына лічыцца адным з найвыдатнейшых гістарычных дзеячаў Беларусі. У яго гонар названы вышэйшыя ўзнагароды краіны: медаль і ордэн. Яго імя носяць Гомельскі ўніверсітэт, Нацыянальная бібліятэка, недзяржаўнае грамадскае аб'яднанне «Таварыства беларускай мовы імя Францішка Скарыны» і іншыя арганізацыі і аб'екты. У гонар Францыска Скарыны ў розных краінах усталяваны помнікі, зроблены скульптурныя і жывапісныя выявы."},{"page_url":"https://eo.wikipedia.org/wiki/Passiflora_laurifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Passiflora_laurifolia_flower.jpg","page_title":"Passiflora laurifolia","context_page_description":"Passiflora laurifolia aŭ akvolimono pasifloro, kiu estas kultivata pro sia manĝebla frukto. La akvolimono havas sufiĉe grandan komercan signifon. la planto estas indiĝena en Bolivio, Gujano, franca Gujano, Karibio, Surinamo, Trinidado, Venezuelo, Peruo kaj Brazilo.\\nLa tubformaj tigoj de Passiflora laurifolia iĝas 10–18 m longaj. En la foli-akseloj estas en ĉiro kun subtenfolietoj. La folitigoj longas ĝis 1,5 cm. La altersidaj folioj estas ovalaj - oblongaj, dikaj, ledaj, helverdaj, brilaj, ununervaj kaj 6-12 x 3,5-8 cm grandaj. La folioj similas al tiuj de la nobla laŭro. la flortigoj estas ĝis 8 cm longaj kaj staras unuope en la foliakseloj. La floro estas purpura, violkolora aŭ blanka kaj 5-7 cm larĝa. La sepaloj estas blankece verdaj kaj ĉe la ekstera flanko blankaj, kun purpuraj punktoj. La petaloj estas blankaj kun purpuraj punktoj kaj ĝis 2,4 x 0,9 cm grandaj. La “krono“ konsistas el 6 vicoj, kiuj havas purpuran kaj blankan zonojn. La ekstera vico esta ĉ. 2 cm longa. La dua vico 3-4 cm longa kaj la interna vico ĉ. 0,1 cm longa.\\nLa manĝeblaj fruktoj estas ovoformaj kaj 5-8 x 4-6 cm grandaj. La matura frukto estas citronflava ĝis paloranĝa."},{"page_url":"https://fr.wikipedia.org/wiki/B%C3%BC%C5%9Fra_K%C4%B1l%C4%B1%C3%A7l%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/20130908_Volleyball_EM_2013_Spiel_Dt-T%C3%BCrkei_by_Olaf_KosinskyDSC_0032.JPG","page_title":"Büşra Kılıçlı","context_page_description":"Büşra Kılıçlı est une joueuse de volley-ball turque. Elle mesure 1,88 m et joue au poste de centrale."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D1%81%D1%96%D1%84%D0%B0%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Parsifal_%281882_retuschiert%29.jpg","page_title":"Парсіфаль","context_page_description":"«Парсіфаль» — остання опера Ріхарда Вагнера, за легендою про Персіваля. Лібрето належить самому композиторові."},{"page_url":"https://it.wikipedia.org/wiki/Villino_Favaloro","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Villino_Favaloro_stile_Liberty_in_Palermo_01.jpg","page_title":"Villino Favaloro","context_page_description":"Il villino Favaloro-Di Stefano, situato in piazza Virgilio a Palermo, fu costruito tra il 1889 e il 1891, su progetto dell'architetto Giovan Battista Filippo Basile e fu completato dal figlio Ernesto tra il 1913 e il 1914. Appartenne prima alla famiglia Favaloro e in seguito al senatore Giuseppe Di Stefano Napolitani, politico e avvocato palermitano.\\nÈ abitualmente considerato il primo esempio di modernismo a Palermo. Ernesto Basile completò l'edificio e realizzò la torretta ottagonale su via Dante, i cui decori musivi sono realizzati da Salvatore Gregorietti. È anche l'autore del giardino d'inverno in ferro e vetro con motivi Liberty.\\nL'edificio appartiene alla Regione Siciliana ed era la sede del C.r.i.c.d., il Centro regionale per l'inventario, la catalogazione e la documentazione. In seguito al terremoto del 6 settembre 2002, il villino venne dichiarato inagibile e dunque chiuso. Dopo anni di chiusura, è stato riaperto al pubblico il 12 settembre 2015. Fino al 14 novembre 2015 ha ospitato la mostra d'arte contemporanea Le stanze d'Aragona. Attualmente si progetta di destinare il sito ad ospitare il Museo della Fotografia \\"Enzo Sellerio\\"."},{"page_url":"https://en.wikipedia.org/wiki/Dewayne_Dedmon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Dewayne_Dedmon_free_throw.jpg","page_title":"Dewayne Dedmon","context_page_description":"Dewayne Jamal Dedmon is an American professional basketball player for the Atlanta Hawks of the National Basketball Association. He played college basketball for Antelope Valley College and USC."},{"page_url":"https://fr.wikipedia.org/wiki/Bord%C3%A8res-Louron","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Mairie_de_Bord%C3%A8res-Louron_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Bordères-Louron","context_page_description":"Bordères-Louron est une commune française située dans le département des Hautes-Pyrénées, en vallée du Louron, en région Occitanie.\\nSes habitants sont appelés les Borderais."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%AC%D9%88%D8%B3_(%D8%A8%D8%A7%D8%AF_%D9%83%D8%A7%D9%84%D9%8A%D9%87)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Map_commune_FR_insee_code_62077.png","page_title":"باجوس (باد كاليه)","context_page_description":"باجوس، باد كاليه ‏ هي بلدية تقع في إقليم باد كاليه من منطقة نور با دو كاليه في شمال فرنسا. تبلغ مساحة هذه المدينة 2.94، وترتفع عن سطح البحر 100 م، يبلغ عدد سكانها 303 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس بيير كليمنت البلدية خلال فترة."}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],R={key:0},H={key:1};function N(a,e,s,c,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",T,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,m)=>(t(),f(d,{key:m,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",G,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",H,"Loading...")):(t(),n("span",R,"See more"))],8,I)):p("",!0)])}const q=g(L,[["render",N],["__scopeId","data-v-025126ea"]]),W=JSON.parse('{"title":"","description":"","frontmatter":{"page":true},"headers":[],"relativePath":"quotes/50.md","filePath":"quotes/50.md"}'),K={name:"quotes/50.md"},V=Object.assign(K,{setup(a){return(e,s)=>(t(),n("div",null,[v(q)]))}});export{W as __pageData,V as default};
